Se acerco el parcial, y empezaron los problemas. Una semana antes del parcial, el profesor esconde todo su contenido (clases/presentaciones), por lo que si no lo bajaste antes lo perdiste y tenias que arreglarte para estudiar con otras cosas.
El parcial no estuvo en ninguna medida preparado como para completarse en las 2 horas dadas, por lo que aprobaron muy pocos con lo justo (6 de 10 correctas) (40 personas de 185). Después de esto Acero dio solo una clase para presentar grafos, recorrió las 7/8 semanas que faltaban en una clase de 5 horas. 

Después vino el recuperatorio, fue peor que el anterior. Aprobaron 4 de mas de 100 personas que rindieron.

Para el segundo recuperatorio Acero relajo y tomo mejor, como venia haciendo los cuatrimestres virtuales anteriores. Resulta que aprobó la mayoría con notas altas (solo 20 desaprobados) y Acero asumió que varios se copiaron y se puso a "auditar registros". Pasados unos días empiezan a llegar mails de Acero diciendo que había que presentarse a un examen escrito y resolverlo correctamente para aprobar la cursada. Esto seria más entendible si no fuera porque:
 * el examen fue muchísimo mas fácil que los anteriores 2, por lo que se tenia mas practica
 * se tuvo clase de consulta para preparar el segundo recuperatorio
 * Acero metió 4 ejercicios que ya había tomado previamente en otro parcial
por lo que aprobarlo era muchísimo más viable

Otras cuestiones,
* Respondía varias veces por el campus, pero si no preguntaste como el quería (formato y demás), ya respondía de mala forma, por lo que no se tiene un gran incentivo para preguntar por el campus (cosa de la cual el después se queja porque no hay preguntas)
* Llega el ultimo día que se tiene clase y ya saca a todos del campus, por lo que para preparar el final te tenes que bajar todo antes
 
En definitiva, la experiencia con este profesor fue nefasta, traten de evitarlo.', '315eeb70-a0e9-49b8-8ee0-9feaa0254970');
