Con respecto a la relación docente-alumno, siempre se mantuvo una cuota de respeto (nunca insultó ni denigró a nadie), pero en múltiples ocasiones evité hacer preguntas que tenía porque no me gustaba la forma de responder que tenía. Era difícil que vuelva atrás y reformule su explicación, normalmente releía el mismo apunte que se había utilizado y el tono en el que contestaba generalmente no era bueno. Durante la explicación de los ayudantes en la clase práctica les hacía acotaciones de una forma que se notaba que los ponía nerviosos y en la mayoría de los casos no aportaban mucho
En este cuatrimestre el curso decidió enseñar a utilizar Python para ayudar en los cómputos de los ejercicios. En mi opinión esa decisión fue incorrecta, porque hay herramientas como wolphram alpha que se pueden utilizar tan fácilmente que no precisan explicación y pueden hacer lo mismo y más que lo que aprendimos a programar en Python. En el ida y vuelta del apunte a Python se perdía tiempo y concentración, mientras que si se hubiera empleado la pizarra virtual como recurso principal esto hubiera sido evitado. A veces la clase se atrasaba más tiempo pasando todo a Python que si se hubiera hecho la cuenta a mano. De todas formas creo que el problema principal no fue el tiempo si no que no se entendía que es lo que estaba haciendo y mucho menos escrito como código, mi sugerencia es que se utilice la pizarra virtual o incluso una cámara con una pizarra común.
