Tiene un par de desventajas fuertes. No se le entiende bien cuando habla, hay que sentarse al frente porque sino no le entendes ni lo que dice ni la letra en el pizarrón. Explica MUY rápido y no para un segundo en las 4 horas de teoría más que para el recreo a la mitad. De todas formas incito a que si se pierden pregunten, no tiene problema en repetir cosas y dar vueltas sobre los temas hasta que los entiendas. Aparte de eso, es la única de las 4 cátedras que tiene su propia guía de problemas y usa alguna que otra notación distinta a las de los otros cursos (a mi no me trajo problemas, pero por las dudas aviso). Otra desventaja (en mi opinión) del curso es que son 4 horas de teoría un día y 4 horas de práctica el otro día. Última desventaja: el parcial consta de 3 ejercicios teóricos y 3 ejercicios prácticos, y hay que aprobar las 2 partes en la misma oportunidad. Los ejercicios teóricos son bastante difíciles así que hay qeu prepararlos bien.', 'dc9ffc4d-3b19-4cb3-a0bc-956ec2fdcc99');
