La catedra de Acosta me pareció genial, clases teóricas de nomas de 1-2 horas, luego de eso teníamos que hacer TPs con nuestro respectivos grupos (Que los Tps eran solo cuestionarios del campus, no había que entregar ningún papel escrito o nada, solo tenias que poner el resultado que te daba el ejercicio en el campus en un cuestionario y ya, el TP era solo eso). Pude aprobar los 3 parciales de una (cosa que en el primer cuatri no me fue posible), explica bien con su PowerPoint y luego se afianza conceptos con la partes practicas de la clase y las guías de ejercicios.
Es cierto lo de un comentario que pocos aprobaron el Segundo y Primer, pero creo que depende de cada uno con su esfuerzo, dedicación, tiempo y empeño que le puedas dar a la materia (Bah es así en todas). Si quieren afianzar conceptos, hay varios libros de Física en la cátedras y, también recomiendo ver las clases de Fontana en YouTube si se pierden en algún concepto.', '9501c876-f14a-4bd8-a21f-753cf8f727fc');
