como experiencia personal puedo contar lo siguiente:

♦Tiene la peculiaridad de que en sus parciales toma verdadero y falso, lo cual te prepara MUY BIEN para el final y además no evalúa nada que no haya dado en clase.
♦Es muy estricto con el tema de los celulares y la comida (Le enoja que sus alumnos usen el celular en clase). Al principio eso me pareció molesto, pero que tan difícil es no usar el celular por 2 horas?
♦Habla mas de lo que escribe y dice muchas cosas importantes así que hay que estar tomando nota constantemente pero da muchos tips para el final.
♦A diferencia de las otros cursos, va mas adelantado con los temas y no porque vaya rapido sino porque sabe dar los temas y sabe administrar muy bien las 2 horas de teoría. Esto marca la diferencia a la hora de preparar el final.
♦NO se adhiere a los paros.
♦Al mismo tiempo que da la teoría suele dar varios ejercicios de parciales y de finales para terminar de entender la teoría. Ayuda mucho esto para temas difíciles como Cuerpo Rígido y Superposición de Ondas.

