la catedra entera esta en zooms de 40 min, y en las 4 horas de clase lo unico que te dan como descanso es el minuto entre que se corta el zoom y que te mandan la siguiente invitacion. las cosas que otros profesores te dicen que no son el foco de fisica I y que esta bueno saberlas pero que no te concentres en eso, corsini te da media hora de clase contandote lo importante que es, por lo que siempre llegabamos cortos de tiempo a los parciales, especialmente al segundo.', '0ebfb184-7125-48ed-9421-252241482266');
Todos los docentes son agradables y no tienen problema de que interrumpan para preguntas. Repiten las veces que sean necesarias y tienen en cuenta los problemas de conexión de alumnes. Graban todas sus clases.
Adrían Ferrini (Ing. Naval) explica la teórica en una hoja que apunta con la cámara, en general se ve bien. Las veces que se veía mal avisamos y sube la calidad. Además, escribe todo, no deja nada al aire. A mi me gusto y me resulto cómodo, ya que era como si explicara en pizarrón, además es muy prolijo y tiene letra clara. 
 Ing. Pablo Martínez Stenger (Ing. Mecánico), Ing. Claudio Daneri (Ing. Electrónico), Ing. Juan Ignacio Suarez Anzorena (Ing. Industrial), Tomás di Benedetto (Ing. Mecánica) resolvían  ejercicios. 
Claudio y Juan resuelven ejercicios con presentaciones ya preparadas la mayoría de las veces. Pablo y Tomas resuelven ejercicios con pizarrones de compu. Personalmente, me gusta mas la metodología de Pablo y Tomas porque me era mas facil seguir el procedimiento para ir copiando y hacer anotaciones. Igualmente, a Claudio y Juan también les entendía pero me resultaba mas difícil copiar. Esto creo que es bastante personal según la comodidad de cada uno (quizá para algunos Pablo y Tomas iban un poco lentos). Por cada tema explican varios ejercicios.
Me resultaron clases muy completas y bien explicadas, a veces con algunos temas se colgaban charlando o derivan a otros temas, pero asumo que es porque les gustan esos temas (o eso parecía).
Llegaron a explicar todos los temas dando tiempo a hacer clases de consulta antes de cada parcial. 
Usan la aplicación Adobe Connect.', 'd011f713-9be8-46d9-b8bb-127f95ba19a9');

Lo que si le agradezco mucho y vale recontra la pena comentar es que es la que responde por el campus. Por lo general responde bien y bastante rápido, y si hay alguna duda que por ahí es medio complicada, la clase siguiente al final las responde junto con laura', '0c3b65e9-1b4f-4590-bbd3-a2a578f0f954');
Cabe destacar que a la hora del responder en el campus puede ser atento,pero sus respuestas al igual que sus ejercicios don demasiado complejas y largas innecesariamente generando mucho quilombo innecesario.
