No acepta críticas y si preguntas te hace sentir como un idiota. 
La organización es nefasta, le declaró la guerra a las computadoras masomenos, no las quiere, así que olvídate de que hayan pdfs de algo que no sean fotos de sus resoluciones a mano. Y en las clases va de un tema a otro que nada que ver. Me hizo dudar movimiento rectilíneo este hombre, es muy rebuscado para hablar y con sus analogías no ayuda. ', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
Lo negativo, es verdad lo de los chistes o comentarios que pueden incomodar a gente, pero este cuatrimestre se rescató bastante con eso. Además pueden hacerse medias densas sus explicaciones, lo que hace es explicarte de donde provienen las fórmulas que se utilizan en la materia, y algunas veces te llena el pizarrón de derivadas e integrales. 
Lo positivo, va a ser lo posible para que entiendas su materia,(Siempre y cuando vos quieras). Siempre esta abierto a recibir consultas y te las responde todas de la mejor manera. 
Tambien se toma la molestia de organizar clases de consulta fuera de cronograma antes de los parciales o post. Por ejemplo, a mi me dio Hidrodinámica después del último parcial, ya terminada la cursada.
Y si ve que la clase esta media embolada , la sube con unos ejemplos o anécdotas relacionadas al tema. 
Personalmente, lo recomiendo. 

