Los temas del parcial son 5 clases teóricas y el parcial consiste en realizar un cursograma a partir de un escrito contando como funciona la empresa. En el parcial les piden el cursograma de alguno de los 5 circuitos vistos en clase. Además el parcial contiene algunas preguntas sencillas relacionadas a los formularios (que información contienen) y un MC(multiple choice) de normas de control interno (NCI).

El Trabajo práctico consiste en dos partes. Una básicamente es realizar un cursograma de un circuito elegido a partir del funcionamiento de una determinada empresa (que tenemos que buscar nosotros). Si sigue las indicaciones o recomendaciones que da la profe seamana a semana, sale solo el TP.
La segunda parte del TP consiste en Armar un presupuesto en formato Excel de un ejercicio dado por la cátedra. Tampoco es dificil, te dan un ppt de ejemplo para que te guíes de como hacerlo. Importante si alguno del grupo conoce Excel para agilizar los cálculos.

El final es básicamente un oral donde te preguntan para que te explayes sobre presupuesto, Normas de control interno y con que documento empieza y termina algún circuito estudiado durante la cursada.

En fin, es una cursada bastante light si le dedican al menos 1 día a la semana para estar al día.', 'cdf376d0-99e5-43b1-92dc-b3668b8c7032');
