Sobre la cátedra: NO VAYAN A SUAREZ y les explico el por qué: Primero lean las reviews del 1C2022 y saquen sus propias conclusiones de la otra catedra, y por qué tratar de ir a toda costa con esta? El acompañamiento que te dan los docentes y colaboradores a lo largo de la cursada es inigualable, más que cualquier otra materia. Se manejan por un servidor de discord, donde podes hacer consultas, hablar con los profes, etc. A lo largo de la cursada vas a tener que trabajar en grupos de a 2 para hacer los ejercicios, y por lo general la gente va al servidor de ds a programar. Por que? Porque programaron un bot que te organiza los canales de voz, y podes realizar consultas en tiempo real interactuando con el bot, y este le avisa a los ayudantes que tenes una duda, y ellos pueden entrar a tu canal de voz, les compartis lo que estas haciendo y te re ayudan, quieren que entiendas bien lo que estas haciendo y son re buena onda todos, la catedra tiene un ambiente muy sano y amigable.
Son 2 parciales y 7 ejercicios, lo unico obligatorio es el 2do parcial, y hay papers a lo largo de la cursada que se recomienda fuertemente leerlos ya que hablan de conceptos de POO que se aplican directamente a los ejercicios que estas haciendo, ademas como incentivo a leerlos en las clases de lecturas hay una especie de kahoot que si respondes X cuestionarios con X cantidad de puntos cada uno sumas puntos para el 2do parcial y asi poder promocional mas facil (ES TREMENDO! Todos los que promocionaron en gran medida fueron gracias a los papers), estan todos traducidos al español por si se te dificulta la lectura en ingles.
Bueno, creo que te dí suficientes razones como para que elijas a donde ir, aguante leveroni wacho', 'd007f1ca-e6d4-4ffd-a118-4f80e952beec');
