La verdad que fue la peor cursada en lo que voy de carrera.

El parcial es complicado de aprobar y tiene varios recuperatorios. Compañeros míos llegaron al último recuperatorio con el TP ya terminado y los bocharon de la materia. Un mes y medio laburando en el TP para que con el parcial horrible que toman se queden afuera. 

En el TP grupal éramos 4. Yo desaprobé el parcial (al igual que la mayoría del curso) y lo aprobé en el primer recuperatorio. Mis 3 compañeros llegaron al 2do recuperatorio, ya a final de cuatrimestre con el TP ya terminado y bocharon a 2 de los 3. Por lo que 2 de los 4 integrantes del grupo recursaron. Cabe aclarar que antes del 2do TP hay un primer TP individual con una sola reentrega, y ahí muchos se fueron bochados también.

Después el final fue un múltiple choice con preguntas engañosas re mala leche, haciendo un 70% bien me quedó un 5 en la historia académica, un asco.

La práctica es realmente inmirable, lo más aburrido que me tocó ver (la da sanchez creo)', '97d25242-1ad4-4445-a876-8d2466b60de6');
Ya que el es Titular de la catedra voy a dar unas opiniones sobre la misma... La catedra a mi parecer es buena, y me hizo entender a la fuerza el paradigma orientado a objetos (me costo un monton), hubo parciales que los desaprobe y no entendia porque, en ese entonces me parecia "Injusto". Dado que es una materia en donde todo parece "subjetivo", a mi parecer es aca donde hay malas opiniones del curso, la gente desaprueba (primer parcial desaprobo la gran mayoria) y la verdad que no entendes bien por que, una vez que te cae la ficha de objetos ves que hiciste un monton de errores que antes no los notabas.
Otro punto que juega en contra es lo que tardan en corregir instancias de evalucion, la verdad que se toman su tiempo, pero es entendible ya que son un monton de alumnos los que toma la catedra.
En fin me parece una catedra buena en donde vas a salir entendiendo del tema, es pesado dado que tenes muchas instancias de poder perder la cursada (TP1 TP2 Parcial y final).', '97d25242-1ad4-4445-a876-8d2466b60de6');

Respecto de la materia, muy buena también en general, pero pesada. Se tienen TPs desde la primera clase con entregas cada 2/3 semanas (son 2 labs individuales y 4 TPs de a 2). Este cuatrimestre implementaron como devolución de los TPs un oral de 30 min por lo que se tienen correcciones mas rápido. No tiene parcial (virtualmente al menos hasta ahora vienen decidiendo de no tomarlo, puede cambiar en otros cuatris).
Tiene final que viene a ser como un remplazo del parcial.

Este cuatrimestre no estuvo Dato, por lo que de la practica se encargo Juan Manuel Fresia y Patricio Iribarne. Ambos se manejaron bien, para las practicas armaban presentaciones que cubrían los diferentes temas y presentaban el código/consignas de los trabajos. Lo único malo es el horario que se tiene, algunas clases se extendían hasta las 22:30/23 (con la teórica empezando a las 17), por lo que hacia el final ya se volvia difícil seguirlas. Las clases se graban y se pueden ver desde el calendario.

', 'fa0a59c1-689a-4519-be0e-a9cc52c0987d');
Se escudaron sobre la base que eramos demasiados alumnos para no dar el apoyo necesario. Todas las semanas había
múltiples trabajos prácticos, pero su explicación muchas veces era posterior a la realización de la tarea y de recibir la
corrección correspondiente. La forma de calificación fue inentendible (calificaciones ridículas y sin sentido, como ser
2/100=0.02). La GRAN mayoría de los textos a leer y videos que mostraban en la clase estaban en inglés, si bien hay
que reconocer muchos textos de informática están en inglés, la materia no es correlativa de ingles y deberían, la menos,
proporcionarse facilidades para aquellos que no dominan con soltura el idioma o tenerlo en consideración a la hora del
mayor insumo de tiempo que requiere comprender un texto en otro idioma. No se respondieron consultas en tiempo
y forma respecto a la realización del TP. Se inició la cursada diciendo que la cátedra se atenía firmemente a las reglas
pautadas previamente (excusa que pretendían usar para dejar en desventaja a los alumnos condicionales respecto al
sistema de notas que lleva la materia), sin embargo a lo largo de la cursada se realizaron cambios sobre fechas, formas de
calificación, métodos, etc. No hay unificación respecto a criterios de evaluación y calificación, según el docente a quien
se consulte, este da una respuesta diferente. A modo de opinión personal, el profesor Villagra suele comportarse de
forma prepotente y soberbia, lo cual no cuadra muy bien con un rol de docente. Excelente materia, pésima experiencia
debido a su dictado. No recomendaría a Villagra', '896fa263-7ea2-427d-af1c-38d52f5fa2c0');

No disfruta la materia, o si realmente la disfruta, no parece demostrarlo adentro de la clase. Sacando eso, es innegable el conocimiento que tiene al respecto a la materia, falla en lo humano para mi. ', 'ecb13fea-3185-46d2-b6c8-7454e6a0f763');
a los estudiantes sin agregar prácticamente ningún valor.
La materia se llama “Análisis de la Información”, pero también podría llamarse “Metodologías refutadas y deprecadas que
algunos dinosaurios todavía dan por vigentes”. Está en el Departamento de Computación, pero los niveles de arbitrariedad,
mala leche y desprecio por los estudiantes que la cursan tranquilamente podrían hacerla pasar por una materia del Departamento de Física. O por una del Departamento de Gestión, considerando que los contenidos de la asignatura son humo casi
en su totalidad.
Ellos siempre tienen razón, no se equivocan nunca. El que está equivocado, no entendió, o no hace lo que hay que hacer
siempre es el estudiante. Al final de cada clase hay un segmento dedicado a reforzar esta idea, habitualmente a cargo de
Guido de Benedetti. Tienen un canal de Slack que solo sirve como cartelera informativa, ya que cualquier consulta que un
estudiante haga sobre un ejercicio o tarea recibirá una respuesta genérica indicando que lo que sea que se está preguntando
forma parte de lo que ellos están evaluando. Incluso cuando esa actividad ya fue entregada por todo el curso, y alguien quiere
despejar una duda que le quedó, como ocurrió varias veces este cuatrimestre.
El ambiente que construyen es totalmente inflexible, tanto en las expectativas, como en los tiempos de aprendizaje, como
en la evaluación. No dan feedback o lo que dan es pobrísimo, muchas de las actividades que llevan nota las devuelven sin
ningún tipo de comentario, solo con la calificación, sin realizar ningún tipo de aporte al aprendizaje.
En un punto dado del cuatrimestre se les ocurrió empezar a amenazar con ponerle ausente a quienes no tuvieran la cámara
prendida durante toda la clase, tildando de irrespetuosos a quienes no la encendían, rematando con un “Si no pueden prender
la cámara, no vengan a la clase” de Sergio Villagra. Me pregunto, ¿Quiénes se piensan que son? ¿tan alta es la idea que
tienen de ellos mismos que se piensan que tienen la atribución de sacar de la galera ese tipo de reglas?
En cuanto a contenidos, la materia se limita a lo que sería el rol de un analista funcional que se quedó en el tiempo
y trabaja en una empresa medio pelo que no hace nada más complejo que un ABM. Te pasás el cuatrimestre haciendo
diagramas UML, y te pintan que eso es la ingeniería de software. Y esto coincide con la (evidentemente limitada) visión de
la Ingeniería Informática o el Análisis de Sistemas según Sergio Villagra, quien en la primera clase dijo sin avergonzarse que
“si lo que les interesa es la programación, hay otras carreras para eso”. El único docente del plantel que aparenta tener una
formación técnica es Tomás Bruno, los demás parecen salidos de una escuela de negocios de poca monta.
No fui al curso de Gonzalez porque me dijeron que no se aprendía absolutamente nada y se afanaba la materia, pero
en retrospectiva recomiendo anotarse ahí. Acá tampoco se aprende nada valioso, y te tenés que fumar a varios 4 de copa
forreándote durante cuatro meses.', 'ecb13fea-3185-46d2-b6c8-7454e6a0f763');
1) Si cursas con Villagra vas a laburar un monton, semana a semana vas a tener lecturas obligatorias, entrega de actividades, al principio sencillas (cuestionarios) y de a poco cada vez mas complejas y en mas cantidad, es importante que estes con las entregas al dia, ya que sino no sumas puntos de gamification.
2) El curso alternativo de Gonzales es una fiesta en comparacion, el nivel de exigencia es muchisimo mas bajo (no digo que es robo porque yo la curse con Villagra, pero por lo que me contaron no está lejos).

Sobre el formato de la materia hay demasiados puntos a tener en cuenta, por lo que no me voy a explayar. solo voy a decir que es importante asistir a todas las clases porque controlan asistencia, no perder puntos de gamification porque al final de cuatrimestre establecen un minimo de puntos para aprobar/promocionar la materia (este cuatri los minimos estaban en 113/150) y que las clases en si son tranquis en el sentido que no te matan con conceptos y definiciones complejas.
Otro punto importante es que al principio del cuatrimistre estaba la intencion de alcanzar el 50% de clases presenciales, pero al final terminamos teniendo 4 o como mucho 5 clases presenciales programadas con anticipacion y el resto virtuales, lo cual fue muy comodo. En las virtuales insisten en que prendás la camara.
Si al final de cuatri no cumplis alguno de los requisitos para promocionar te dan la posibilidad de rendir un examen en 3 oportunidades. (no es un final como tal, sino instancias de recuperacion).', '7e27208e-0c64-4f68-a60e-84f8113ddda2');

