motivar el alumno a aprender los temas y buscan evaluar de la forma mas arcaica poniendo preguntas super ambiguas y
subjetivas en todas las actividades habidas y por haber. En mas de una instancia te dicen que hagas consultas por slack
pero despues cuando preguntas por slack no te dan respuestas, “La interpretacion del enunciado es parte del ejercicio”
y “Vos que pensas?” son las unicas respuestas que dan a preguntas sobre los enunciados que son lo mas ambiguos que
vi en mi vida. Lo que se habla en clase tiene un enfoque completamente distinto a lo que se evalua, llegas al tp final y
tenes que hacer una aplicacion full stack por tu cuenta en 2 semanas sin ninguna ayuda tecnica por parte de la catedra
ni preparacion previa, pero en realidad lo unico que importa es la documentacion, mitad de la cual nunca te explican
como armar ni son claros en que tiene que contener. Se genera una sensascion de frustracion con la cursada en la que
sentis que no importa cuanto te esfuerzes con las actividades te van a poner un 35/100 igual y no te van a decir por
que. La frase “Todo lo que hagamos va a estar mal” se escucho en muchas instancias dentro de mi grupo durante la
cursada. Se cagaron en los condicionales toda la cursada, nos bajaron 4 puntos en la nota de “gamification” por no
haber asistido a clase y haber hecho las actividades en la primer semana porque todavia no estabamos asignados a un
curso. La cursada se evalua en base a la nota de las actividades individuales (que no te dan feedback porque en vez de
cortar actividades por la carga adicional de alumnos decidieron sacar las reentregas y dejar de dar feedback), la nota
del tp grupal (que la dibujan a gusto y placcere y no te dan feedback alguno), la nota de concepto (que es un 6 para
las personas que no interactuaron en todas las clases, menos de 6 para los que en algun momento discutieron alguna
decision de la catedra, y 9 para el alumno que se paso todo el cuatrimestre participando activamente) y la nota de
“gamification” que tambien es al azar. El sistema de gamification pareciera ser un motivador para los alumnos pero
en realidad genera una sensacion de fracaso a lo largo de toda la cursada si en algun momento te llegas a atrasar una
semana. Este cuatrimestre les resulto demasiado complejo pasar la asistencia de las clases a una planilla de excel asi
que al final de la cursada decidieron que el presentismo derepente no importaba y no se daban puntos de gamification.
Efectivamente robandole 75 puntos de gamification a las personas que asistieron a todas las clases y bajandoles la nota
final de la materia por al menos 1 punto en base a esto.
Todo lo que acabo de escupir es solo lo que mas me quedo del curso. Los temas estan buenos pero practicamente no se
dan, te dan links a papers o videos de clases de años pasados y te evaluan en base a eso. Termine la cursada sin haber leido
ninguno de los papers porque dan tantas actividades por semana que no te queda otra mas que hacer ctrl+f para resolverlas.
La catedra en todo momento te va a desmotivar, lo tenes a guido diciendo que si queres feedback de las actividades que
entregaste primero tenes que decirle que hiciste mal. Al final de todas las clases llama por nombre a la gente que esta atrasada
en la materia para meterles presion y intimidarlos a ponerse al dia o sino sale a decir que hay mucha gente entregando a
ultimo momento o que claramente no entendimos el tema de la semana anterior, obviamente por culpa nuestra y no porque
la catedra no lo explico en ningun momento. Cada consulta que le haces esta respondida con desinteres o directamente.
hostilidad. Situaciones en las que te puede responder con un si o no y en cambio te responde con una amenaza de algun tipo
o te basurea tratandote como inatente.
Por lo que entiendo en la catedra alternativa no se dan muchos temas por lo que es una lastima que esta activamente
desmotive al alumno a seguir cursando. En resumen la materia esta buena, pero las actitudes de Sergio Villagra y Guido
De Benedetti la arruinan completamente. No recomiendo cursar esta materia a menos que seas masoquista o entres con un
equipo ya armado de desarrolladores fullstack y alguien que te pase la resolucion de las actividades del cuatrimestre anterior.
Y asi y todo vas a tener suerte si te queda un 7 en la libreta y vas a odiar la materia en todo momento.
Resumo mi comentario en lo siguiente: La materia esta buena, pero los docentes titulares la hacen insufrible.', '7e27208e-0c64-4f68-a60e-84f8113ddda2');
