Despues nos mandaban por el campus los videos para ver en la semana. 
Hubo dos parciales optativos sobre 7 modulos de los 10 modulos de la materia (no todos los cuatris se dan los mismos modulos, se pueden ver en el canal de yt), por lo que la unica exigencia durante la cursada es cubrir los temas para hacer los tps. Este cuatri fueron 3 tps, el 1ero individual sobre greedy y los otros en grupo de 5 personas. Si los 5 se distribuyen bien el trabajo es sencillo. en general era un ejercicio de cada modulo y dos o tres ejercicios por tp.  
Puede promocionarse si apruebas 5 (o tal vez 6) modulos de los examenes optativos, hay instancias de recuperacion si con algun modulo te fue mal.
Al final del cuatrimestre hubo una defensa de los 3 tps individual en donde te hacian preguntas sobre como lo hiciste, tenes que tener presente todos los temas aunque los halla hecho un compañero, ojo con eso.
Aprobando la defensa y los tps se aprueba la cursada. El final no lo dí así que no opinio.', '8c541a92-7c03-4354-bb82-e3e412573aa6');
