1- La clase es poco seria a mi parecer.
2- Las correcciones de los ayudantes es muy variada, y además muchas veces las correcciones se basan en opinión del corrector, no en si el programa funciona.
3- La catedra tiene una pagina que te autocorrige los TPs, lo que causa que no tengas prácticamente libertad al hacerlos. Esto sumado a que los enunciados son muy ambiguos/abiertos hace que a pesar de tener el TP terminado tengas que estar varios días cambiando cosas hasta que la pagina te lo corrija bien.
4- No te permiten probar los TPs en la pagina hasta 2 días antes de la entrega, con lo cual si haces el TP 1 mes antes de la entrega, da igual porque lo vas a tener que volver a editar 2 días antes antes de la fecha final.
5- Le dan mas importancia a las buenas practicas de programación que a saber programar en si. Y como las buenas practicas son muy subjetivas, esto causa que a pesar de tener un programa con perfecto funcionamiento puedas todavía desaprobarlo.

A pesar de esto, lo mejor que encontré de la catedra es el sistema de nota final que tienen. El final(al menos este cuatrimestre) fueron 3 ejercicios, y por cada ejercicio bien que hagas te sumaban 1 punto a la nota de cursada. Con lo cual si sacaste una nota decente de cursada, es muy fácil sacar 8+ de nota final.', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
