Para aprobar la cursada hay que aprobar el enunciado del TP. Para el final dan una extensión del TP y se puede desarrollar en el tiempo que quieras y todo el grupo se tiene que anotar a la fecha del final y hacer una demo en vivo donde te preguntan temas de arquitectura/diseño.', 'df326813-fcd6-4c13-ad4c-f37ca96ee12e');
La cursada fue al comienzo un mini TP individual (más o menos en las 1ras 4-5 semanas) que tenes que aprobar para poder seguir con la materia. Luego de eso viene el TP grupal (que suele ser de 4 personas) que es el que más consume.
El tp consiste en un proyecto bastante grande que cambia cuatrimestre a cuatrimestre, y se van teniendo reuniones semanales con los docentes para ver como se va avanzando y para acordar objetivos para la semana que sigue.
Sacas muchisima ventaja si te armas un grupo con gente que ya conoces, porque es mucho MUY importante que todos aporten, ya que no es exageracion que el tp te consume muchisssssimo tiempo (posta) por el seguimiento semanal que hay que ir teniendo.
Ese tp es la nota de cursada, y luego en vez de examen final se implementa una funcionalidad agregada al TP (todo definido por la catedra).
Con respecto al lenguaje, si bien todas las primeras clases son de aprendizaje de Rust, es IMPORTANTISIMO leer el libro online de Rust para aprenderlo por cuenta propia, ya que suele llevar mucho más tiempo de aprender que solo las clases, es un lenguaje que en principio puede dificultarse pero cuando le agarras la mano va de 10.
La mayoria de las clases fueron virtuales este cuatri, y las reuniones semanales de seguimiento fueron virtuales todas. Lo unico presencial fueron las presentaciones del TP (Hay una presentacion intermedia en la que te piden llegar hasta cierta funcionalidad, luego está la entrega final de cursada y despues esta la entrega final que es en fechas de examen)', 'df326813-fcd6-4c13-ad4c-f37ca96ee12e');
Los ayudantes son decentes, hay uno que otro, no fui fan de Jazmin, pero si de Mauro y Nicolas', 'df326813-fcd6-4c13-ad4c-f37ca96ee12e');
