Se adaptó muy mal a la tecnología éste cuatrimestre, daba las clases con un programa mediocre que no sabía utilizar. Mostraba slides o imagenes obtenidas de otros lados y sobre eso solia hacer anotaciones en cuadros de texto que quedaban mal ubicados en la pantalla o que no se veian. También dibujaba a mano alzada con el mouse dando por resultado dibujos y palabras vergonzosas que no se terminaban entendiendo ni qué eran. Las flechas de las reacciones o de los dibujos de las moléculas por ejemplo, las hacía a mano alzada encima del cuadro de texto, por lo que después movía el cuadro de texto y quedaban las rayas dispersas sin ningún sentido. Los ejercicios los hacía también de ésta manera en un cuadro de texto, algunos símbolos los hacía bien pero otras notaciones quedaban muy poco claras ya que no usaba ni subindice ni superindice. Escribía números y explicaba las cosas con palabras (escribe casi todo lo que dice). En general si seguís bien la clase no está tan mal, pero muchas veces se hacía dificil sobrellevar lo que explica o el ejercicio que está haciendo. En fin, es muy desprolija, a veces se le borra todo y tiene que empezar a escribirlo de nuevo, hubo clases que directamente la perdimos porque empezó a explicar con la pantalla en negro (pasaba muy seguido) y no veía nuestros chats ni escuchaba el audio (esa vez finalmente a la hora y media vio que alguien le decía por la cámara que no se veía la pantalla).
Mas allá de sus deficiencias con la tecnología, en general habla muy lento y aburrido, a veces no se le entiende mucho, trata de usar palabras formales todo el tiempo, pero muchas veces no suele encontrar palabra para lo que quiere decir y termina diciendo la palabra más común. Suele hacer preguntas que nadie responde y sigue explicando (sus clases suelen ser un monólogo) 
Graba sus clases (cuando se acuerda o le hacen acordar por audio) y las sube a youtube. Algo para rescatar es que viendo las clases en 2x en youtube se hace llevadero cómo explica y se puede entender mejor. Por otro lado, admiro la capacidad que tiene para dar una clase de 3 o 4 horas sin parar y que parece demostrar mucho empeño y pasión por su trabajo en ocasiones. Las consultas del campus las responde siempre, aunque a veces no acierta lo que el alumno quiso preguntar y otras veces responde bien.
Es una señora grande, cursar la materia con ella se vuelve pesado, más que nada porque en general explica una clase natan y una o dos ella (y natan es muy buen profe). Creo que si puliera sus habilidades con la tecnología, sus clases se harían un poquito más llevaderas, pero igualmente no es tan buena profesora, tiene predisposición pero no explica muy bien y no entiende las consultas', 'c5856f35-bf0b-42b1-9214-bffd3c2c2366');
En la corrección de los TP es un muy mala, porque quizás en la tercera corrección de los TP, corrige algo que en la primera no lo había hecho, entonces parece que las primeras 2 correcciones hayan sido para nada.', 'c5856f35-bf0b-42b1-9214-bffd3c2c2366');
