El trato es MUY áspero. MUY picante. Jamás dice una mala palabra pero te pone a prueba cada segundo. Es bastante creído. No es recomendable cursar con él si sos de enojarte fácil. Es el típico docente que te "boludea" con clase y respeto (pero te dan ganas de putearlo).
Nivel de conocimiento: sabe muchísimo. Sabe todo y tira detalles de cualquier tema. Explica con Muchísima claridad y da muchos puntos de vista. Se entiende perfecto. Y sino repreguntas las mil veces que se necesiten. Explica hasta que entienda todo el curso. Y sino, se queda después personalmente con vos explicándote lo que sea necesario. Te da su teléfono, su email y se queda hasta la hora que sea necesaria. Podes preguntarle todo por Whatsapp o email. Imposible no entender o no aprender. El punto negativo es que te trata mal, con mucha clase y respeto, pero es aspero.
