Un mamaracho de docente. Se equivocó la máquina sincrónica de la asincrónica. En trifásica resolvía mal los circuitos. Sin las diapositivas no sabe ni que hacer. Y si vas a preguntarle dudas te dice que lo hagas en la práctica. No recuerda bien la materia la mina. Me dio pena que este tan desconectada de los contenidos y se equivoque en cosas tan importantes. Me confundió mucho. 
Lo triste fue que tomó conciencia de que sus clases eran pésimas y nos citó a algunos (a los que nos tenía vistos) un dia en Julio para "una clase extra". Nos dio 3 ejercicios para que los hagamos en casa (estuvimos 3 minutos en la facultad). Y nos dijo que nos anotemos en la fecha siguiente si o si. Cuando fuimos al final casi sin saber la materia, nos tomaron esos 3 ejercicios. Ella no estaba, pero se ve que sabe lo que toman. Eran los mismos ejercicios, mismos números. A un amigo el cuatri pasado le firmó libreta rindiéndo un final oral con ella porque no había podido ir al final. Le preguntó 3 cositas: qué era un circuito monofásico, que es una admitancia y para que se usa un tester. Dicen que siempre pregunta las mismas 3 preguntas si le decis que no pudiste ir al final pero te anotaste (es MEGA clave haberse anotado para que te pasen la nota). Solamente lo hace con alumnos de ella. La verdad que resulta fácil, sobretodo porque aprobas la materia sin saber máquinas ni trifásica. Pero claro, es un mamarracho. Cada uno sabe lo que hace.', 'ffcba4a6-f9cb-410a-8688-a460f74aa322');
