INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2015', 'Excelente profesor aunque anotarse con él mete mucha presión.', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'A0 es lo más grande que hay en el mundo', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'No inspira ganas de preguntar en clase, por miedo a que te conteste mal y te ridiculice.', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'El tipo... Desagradable. Las clases.... Magníficas! ', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Optima para recursantes. Va muy rapido (incluso le saca ventaja a la practica por 2  o 3 clases lo que hace difici lllevar al dia la materia).', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente profesor. No le gusta que uses el celular en clase si te sentas adelante (te llama la atención y te da un monológo). Es bastante exigente, pero exige el nivel que da. Terminás con una carpeta impecable llena de graficos y definiciones que ayudan un montón. A0 corrige todos los parciales y cuando remarca en clase que algo es importante, muy probablemente preste mucha atención a que eso se cumpla en los exámenes.', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Me pareció muy buen profesor, exigente pero nada fuera de lo alcanzable. Salís de sus clases pensando que entendés exactamente todo lo que te dice. Yo aprobé la cursada con él sin ningún problema. Eso sí, hay que justificarle hasta tu nombre y padrón jaja. Sin dudas un genio total y aparte muy organizado.', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buen docente. La mejor carpeta se consigue con el. Las clases son muy tensas porque es una persona demasiado seria. No esta bueno cursar con el. ', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Sera un ojete el profe pero me hizo entender la materia y no deja ningun hueco, tanto me quedo que gracias a el y su carpeta saque un 10', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'A0 es un grande, explica muy bien todo, pero su trato con los alumnos no es el mejor. Si te queres anotar con el, sabe que te vas a tener que esforzar, pero igualmente vale la pena. Y si necesitas su material, el graba todas sus clases y las sube, asi que si lo complementas con los videos de Maulhardt te va a ir bien', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica muy bien y sabe un montón pero es bastante nefasto como persona y si preguntas algo te boludea antes de responderte', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica muy bien, responde todo en el foro, pero te tira muy abajo con sus comentarios', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Profesor que no suele interactuar con sus alumnos, siempre esta serio, solo da la clase y ya. habla despacio y escribe muy chico por lo cual dificulta coprender bien la clase. explica muy matematicamente. explica bien y hace muy buenas devoluciones. Avanza muy rapido con los temas, recomiendo el curso solo para recursantes. si aprobas la materia en este curso significa que sabes un monton de analisis pero muy pocos lo logran.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'el mejor profesor de análisis II. explica excelente, haciendo muy buenos gráficos y comparando los temas que se ven en AMII con los de AMI (cbc) para que queden más claras las ideas. es estricto para corregir pero lo justo y necesario. no le gusta que hablen en clase ni que usen el celular estando adelante de todo pero creo que es por una cuestión de respeto y me parece excelente. lo amamos', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La verdad que Ferchu es el mejor profesor que he tenido en mi vida, la claridad que tiene este hombre para explicar la verdad que es sublime, tiene el instrumento del habla bien desarrollado y se nota claramente que sabe de lo que habla y no tira chamuyo, las correcciones en los parciales son increíbles pero muy exigente, en clases te explica como encarar y fundamentar cada cosa que escribís en los examenes y te prepara de una forma excelente para el final, tres clases antes del parcial ya había terminado los temas y te deja un gran lapso de tiempo para preparar el examen, al igual que los temas para el final, hace unos gráficos increíbles y te queda todo completamente claro, sin ningún tipo de objeción me saco el sombrero ante tal hombre y profesor que es Ferchu.', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un profesor muy profesional que enseña con pasión y se nota que sabe mucho sobre AMII. Si bien se muestra muy exigente, siento que te ayuda mucho a adaptarte al ritmo de la facultad, sobre todo si es tu primer cuatrimestre en FIUBA, como fue mi caso. Me gustaron mucho las palabras que nos dijo en nuestra última clase. Fueron muy motivadoras y no voy a negar que casi se me cae una lagrima. Realmente de los mejores profesores que tiene la facultad.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Si sos una persona que le gusta hacer preguntas, interactuar con el profesor, no te anotes acá. Enseña muy bien pero es bastante asqueroso de trato y no es muy amigable.', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Acero es un profesor perfecto para recursantes. Pero si recién empezás la materia busca otras alternativas. Es un profesor que explica muy rápido los temas y "empieza el tema en segunda", es decir, se saltea los ejemplos o explicaciones sencillas que son fundamentales para quien empiza a cursar análisis 2.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El trato a los alumnos es medio raro, pero te responde absolutamente todo por más estúpida que pueda llegar a ser tu pregunta. No le soliciten que agrande la letra por nada del mundo y pidan permiso si quieren sacar fotos del pizarrón.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es un loco, se enoja re fácil. Va a los pedos con los temas y termina mucho antes que los otros profes, muy exigente para corregir y no te deja consultarle nada// Viejo puto y encima pelado', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Por parte de acero, era terrible la forma del trato para con los alumnos. Incitaba a no hacer ninguna consulta para que no te mire mal o no te diga nada malo. Pensar que en la segunda clase amenazo a un alumno con denunciarlo por sacar una fotografía al pizarrón, ya que este estaba en el fondo y con la letra tan chica, se dificultaba entender lo que decía. Creo que fue una de las razones por las cuales a la tercera clase, el 50% de los alumnos de la clase anterior, ya no asistieron más. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buen profe, se nota que sabe un montón, ya con lo rápido que corrige los exámenes y resuelve ejercicios se ve que sabe de lo que enseña. Además tiene una claridad explicando que pocos profes tienen, la verdad uno de los mejores en AM junto con Maulhardt. Lo malo es que es medio cascarrabias, si le haces una pregunta que el considera medio boluda te va a contestar de mala manera como sobrandote. Una cosa que a mi me molestó es que escribe muy chiquito, si vas a cursar con él te tenés que sentar en las primeras 4 filas del aula, sino no ves nada, lo mismo cuando habla, muy bajito, como si diera clases a 1/4 del aula, lo cual es muy molesto porque en un aula, por lo menos las primeras clases, hay mucha gente y los de atrás se pierden un montón de lo que explica. Más allá de eso lo recomiendo porque es re buen profe. ', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'A pesar de que es un buen docente y tiene conocimiento de lo que enseña, su trato con los alumnos deja mucho que desear, los trata despectivamente', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'El tipo es literalmente de los mejores profesores de la uba, explica CLARISIMO. Pero sus correcciones son igual de duras, no sé si vale la pena cursarla con él.', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'De lo mejor de Fiuba. ', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Acero es uno de los mejores profesores que uno pueda encontrarse, sabe muchísimo y no da vueltas con los temas, explica los ejercicios clave y enseña a justificar. Se llega más que preparado para dar el final. El problema que tiene es que va muy rápido y es difícil llevar al día una materia así yendo tan rápido y en cuanto te atrasas, las teóricas cuesta entenderlas. Es un curso recomendado para recursantes. Corrige él los parciales y a las horas ya están subidas las notas al campus, también responde dudas por mensajes o antes de las clases.', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2018', 'la materia es pesada si la llevas con Acero , si le tienes paciencia y amor a las matemáticas , Acero el mejor profesor de la facultad , ojala sea decano jojojo .', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Asistencia a clase solo falta si es un caso muy urgente o excepcional  , ejemplo ; fue a dar clases aún estando resfriado ,solo faltó a una cuando no podía más y tenía que descansar para reponerse.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'tipico viejo trolo resentido, una vez se fue de una clase porque sonó un celular (empezó 7 am y terminó 7.30 am) el peor profesor de FIUBA lejos.', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Profesor distinguido. Sus explicaciones son detalladas y completas. Resuelve muchos ej. de la guia y hace observaciones claves. Puede que sea formal y un poco distante, pero siempre abierto a preguntas. Nada que envidiarle a Maulhardt. ', 'ef0fba34-a838-485b-a711-95a75d97a87e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy copado, siempre se asegura que estés comprendiendo. Es un poco difícil seguir el desarrollo pq a veces no se ve muy bien ya que graba el pizarrón físico. Pero le pone mucha onda', 'c6db63be-c321-4eeb-a9ff-d968a3a5282b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La verdad que sus clases eran la mayoría de las veces bastante confusas. Intentaba aclarar cosas pero terminaba haciéndolas mas complejas de entender, encima aún más cuando los temas finales ya de por si tenían su complejidad propia. ', 'c6db63be-c321-4eeb-a9ff-d968a3a5282b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Sinceramente se le entendía bastante lo que explicaba.. cuando explicaba. Sin embargo, pese a que la práctica se organizó MUY mal (al nivel de que se iba el 90% después de la clase de Maulhardt), si le preguntabas individualmente por un ejercicio te lo dejaba claro.', 'a0387185-bfe3-460c-8ecd-54f787fdb860');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Por ahi se enroscaba mucho en algunos ejercicios, pareciera que recien esta empezando a dar clases entonces como que hay que tenerle paciencia, hay algunas cosas que las tiene que consultar con el otro profe, pero tiene buen trato con los alumnos ', 'a0387185-bfe3-460c-8ecd-54f787fdb860');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy timida, le falta autoridad aun. Buena para las consultas.', '8461cdf9-90be-4e4d-bb73-cbc00541d788');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Explica cada tanto algun ejercicio, no participa mucho en clase. Es muy copada si te le acercas a preguntar alguna consulta individual.', 'c68ab298-8dba-44e6-9954-3d7b33e04801');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'muy buenas presentaciones ', 'c68ab298-8dba-44e6-9954-3d7b33e04801');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se adhiere a todos los paros. Igualmente es muy atento, te responde todas las dudas y sus clases son dinámicas.', '6aa2e0f8-529b-4c80-be1b-0d7616e1548a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Pedro es re buen profe! Explica muy bien y tiene excelente predisposición para consultas. Todos los profes de la práctica te responden lo más bien, pero él es el único que se queda un rato más. Lo malo es que se adhiere a todos los paros, así que no vino a algunas clases, pero no la perdías porque otro de los profes lo reemplazaba. ', '6aa2e0f8-529b-4c80-be1b-0d7616e1548a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Profesor muy nuevo, desprolijo y poco claro, muchas cosas por mejorar pero si le preguntas siempre trata de ayudar', '04c7d494-365a-4277-a722-9d0fb8deaffe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Un capo hernan, se nota que sabe mucho pero a veces le cuesta trasmitirlo. Probablemente porque es joven todavía.', '04c7d494-365a-4277-a722-9d0fb8deaffe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Medio aburrido que explique la práctica con PDFs, pero sirve para asentar un poco la teoría más dura. Suele pasarse del horario de finalización, pero nunca más de 15/20 min.', '04c7d494-365a-4277-a722-9d0fb8deaffe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Sus diapositivas estaban buenísimas, te re ayudaban a recordar los conceptos teóricos para luego aplicarlos a los ejercicios prácticos. Se le entendía todo bastante bien.', '04c7d494-365a-4277-a722-9d0fb8deaffe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Es muy claro y hacia muy buen complemento en la practica de lo que daba Martin en la teorica. Nada para reprocharle.', '42eae26a-17f3-4adc-9d6d-96e3472feef7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'lo mejor, muy claro al explicar la teorica, no hace mucho embrollo en las demostraciones y responde dudas muy bien', '42eae26a-17f3-4adc-9d6d-96e3472feef7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'excelente, da clases con una pizarra virtual y explica muy bien', '42eae26a-17f3-4adc-9d6d-96e3472feef7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Crack.. y fachero', 'cab164bf-725e-4af4-9aa2-27c94c40b2fe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'kapo, en lo personal me llego a servir un monton, y me llego a confundir tambien. Creo que si preparara las clases con anterioridad y fuera mas ordenado en el pizarron. seria un 9,50. El resto nada que decir, copado', 'cab164bf-725e-4af4-9aa2-27c94c40b2fe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'muy copado, responde bien siempre, explica bien y da clases con pizarra virtual. se tomo el trabajo de recopilar ej de parciales por tema que sumaron un monton', 'cab164bf-725e-4af4-9aa2-27c94c40b2fe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica bien pero a veces le da demasiadas vueltas a un ejercicio. ', 'cab164bf-725e-4af4-9aa2-27c94c40b2fe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Juan es un crack, explica excelente y suele poner ejemplos de cosas que después vamos a ver más adelante en la carrera, muy claro y da buenos tips para los examenes', 'cab164bf-725e-4af4-9aa2-27c94c40b2fe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Fernando es un buen profesor, es muy prolijo y ordenado para resolver ejercicios. Además, siempre despeja dudas aunque no suele justificar demasiado lo que hace, y capaz después en el examen pide cierta justificación o fundamentación. Se adhirió a dos paros (creo) lo que nos complicó un poco pero bueno, se entiende y respeta su postura. Es divertido y se nota que le gusta enseñar. ', '8ffe9de1-5a1d-460c-a9f4-e95b77cb9c92');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente profesor, muy claro', '8ffe9de1-5a1d-460c-a9f4-e95b77cb9c92');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente docente, se adhiere a algunos paros pero siempre avisa previamente. Super prolijo y acepta cualquier consulta', '8ffe9de1-5a1d-460c-a9f4-e95b77cb9c92');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'El unico que se hizo cargo de la materia', '8ffe9de1-5a1d-460c-a9f4-e95b77cb9c92');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy claras sus explicaciones, tanto en el campus como en clase. Se nota que sabe mucho, buen profesor.', '8ffe9de1-5a1d-460c-a9f4-e95b77cb9c92');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buen profesor, me hizo entender la materia hasta que dejo de explicar lo mismo que gigola y se puso a hacer ejercicios :( ', '8ffe9de1-5a1d-460c-a9f4-e95b77cb9c92');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buen profesor, me hizo entender la materia hasta que dejo de explicar lo mismo que gigola y se puso a hacer ejercicios :( ', '8ffe9de1-5a1d-460c-a9f4-e95b77cb9c92');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Sin duda un gran profesor. Le pone mucha onda a la clase, hace muchos ejercicios en el pizarrón y es muy claro explicando.', '8ffe9de1-5a1d-460c-a9f4-e95b77cb9c92');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Explica cada ejercicio que resuelve de forma clara, y no tiene ningún problema en responder todas las dudas que tengas ', '8ffe9de1-5a1d-460c-a9f4-e95b77cb9c92');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Explica re bien', '8ffe9de1-5a1d-460c-a9f4-e95b77cb9c92');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Da las prácticas turnado con otros docentes. Explica los ejercicios de manera muy calmada y por ello todo se le entiende perfecto, no hay ejercicio que no le haya entendido durante todo el cuatrimestre. Es 10/10 De Rossi, una maquina.', '8ffe9de1-5a1d-460c-a9f4-e95b77cb9c92');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Las clases teóricas son muy buenas, fundamenta todo con mucha teoría y va dando ejemplos conforme avanza la clase. Si eres ingresante, cursar con este profe es muy buena opción porque te da todas las bases para entender qué estas haciendo y por qué lo estás haciendo. Te enseña cómo escribir y fundamentar las cosas a la hora de rendir un parcial o final. Las clases prácticas son buenas también, da muchos ejercicios y diferentes formas de plantear el mismo problema, fomenta a cada rato la participación en clase porque se asegura que sus alumnos entiendan lo que él está haciendo. ', '8ffe9de1-5a1d-460c-a9f4-e95b77cb9c92');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Me pareció súper atenta y siempre dispuesta a responder consultas. A veces enreda pero llega a dar todos los temas y la carpeta te queda re completa. ', '0bc97fac-9516-4cbe-8619-ea4494a5476a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Genia total! Con ella verdaderamente aprendí análisis. Sus teóricas son muy completas, es organizada con las clases. Re buena onda, con excelente predisposición para consultas, tanto presenciales (se quedó un montón de veces después de clase, o también si llegaba antes lo mismo) como por mail, te responde enseguida generalmente y si no puede te responde en clase. Vía campus a veces tardaba un poco más. Trae ejemplos de ejercicios de parciales y finales. El curso no es muy popular, así que no está lleno de gente, terminamos siendo pocos. Faltan más profes como ella en la facu: de verdad quiere que aprendas y apruebes, te brinda todas las herramientas que están a su alcance. La práctica es muy buena también, se nota que laburan de verdad y no son improvisados. Se llevan bien todos los profes y hay buena comunicación para llevar al día el curso.', '0bc97fac-9516-4cbe-8619-ea4494a5476a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Tal vez a veces es medio rebundante en sus explicaciones, o al menos sentis que da muchas vueltas, pero eso no le quita su gran esmero en enseñar de forma correcta y ser entendido por todos sus alumnos. Se encarga de dar ejercicios prácticos que a veces pueden ser muy utiles', '73af1eef-2e59-40c7-a7c6-59ba112f19cd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'le pone onda a las clases, resuelve claro los ejercicios fomentando a la participacion, y tambien a veces explicaba un poco de teoria. Buen trato con los alumnos', '73af1eef-2e59-40c7-a7c6-59ba112f19cd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'En líneas generales, bien. Es un poco desprolijo escribiendo en el pizarrón, su letra no es muy buena, pero explica bien. Hay algunas cosas que decía que terminaban confundiendome porque hace las cosas totalmente de otra manera que seminara, pero mínimas.', '6a13922f-1fea-4042-89dc-88619b11c1a7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'No fue muy claro al momento de responder preguntas', '6a13922f-1fea-4042-89dc-88619b11c1a7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es muy malo explicando. Seminara es un 10 pero sus asistentes son malísimos', '6a13922f-1fea-4042-89dc-88619b11c1a7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Se le nota que tiene ganas de enseñar y explicar, pero no llega a los alumnos. En el cuatrimestre muchos se saltearon sus clases porque agarraba un PDF de ejercicios resueltos, que no se entendia casi nada por su letra, y se ponia a explicarlo. No se si sus clases me aportaron mucho en el cuatrimestre.', '6a13922f-1fea-4042-89dc-88619b11c1a7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'No sé si sea el profesor medio canoso que tiene una barba tipo candado ,si es en su clase de práctica hace unos te gráficos como si nada ,la prolijidad ante todo para el ,se hacen muchos ejercicios de la guía si no todos y unos más que son de coloquio ', '6a13922f-1fea-4042-89dc-88619b11c1a7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'No se le entiende nada cuando explica pero le pone onda', '6a13922f-1fea-4042-89dc-88619b11c1a7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Medio paja la verdad. La letra no se le entendia muchas veces, y es medio difícil seguirle la explicación.', '6a13922f-1fea-4042-89dc-88619b11c1a7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Un desastre la letra y como explica', '6a13922f-1fea-4042-89dc-88619b11c1a7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica bien pero aveces habla muy despacio', 'e7ac649f-dac0-4bd0-ae1c-9eb0d6b4a557');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica bastante bien, con calma y es fácil seguirle el ritmo', 'e7ac649f-dac0-4bd0-ae1c-9eb0d6b4a557');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es la profe de la práctica explica bien ,tal vez divaga un poco pero su personalidad no es como que te dé animó a participar en clase ,después del 1er parcial llegaban 30 min más tarde ,lo que si es buena onda y podes preguntarle cosas que te las contesta. La profe de la otra práctica estaría 1 punto por encima de ella a mí parecer ', 'e7ac649f-dac0-4bd0-ae1c-9eb0d6b4a557');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'nos costo mucho seguirle el hilo virtualmente, la clase estaba bien armada pero nos falto ejemplificacion con ejercicios, que cuando los veiamos con de rossi ya habian pasado unos dias y nos olvidabamos. Esta predispuesta a responder cualquier duda', '908199aa-a510-4b2f-a0c5-bdd2adc418e3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'nos costo mucho seguirle el hilo virtualmente, la clase estaba bien armada pero nos falto ejemplificacion con ejercicios, que cuando los veiamos con de rossi ya habian pasado unos dias y nos olvidabamos. Esta predispuesta a responder cualquier duda', '908199aa-a510-4b2f-a0c5-bdd2adc418e3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Muy prolija al explicar en el pizarrón, es exigente a la hora de corregir aunque si justificas como enseña en clase no hay problema. ', '908199aa-a510-4b2f-a0c5-bdd2adc418e3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Lautaro es un distinto, nunca te vas a ir de su clase sin haber entendido un ejercicio. Además tira chistes y hace la clase muy dinámica, inexplicable que no esté más recomendado.', 'c65123bd-eb9b-4a09-b83b-c1eed1db05df');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es el mejor de la práctica y explica muy bien, pero si te tiene que decir algo te lo dice y por ahi te hace quedar mal ', 'c65123bd-eb9b-4a09-b83b-c1eed1db05df');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bien y se le entiende, al ser alumno de los últimos años de su carrera busca que las cosas nos resulten sencillas', 'c65123bd-eb9b-4a09-b83b-c1eed1db05df');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Presenta con la cámara lo que a veces trae complicaciones, pero una vez que se resuelven todo perfecto, muy buena práctica.', 'c65123bd-eb9b-4a09-b83b-c1eed1db05df');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica bastante claro, pero al utilizar un pizarrón físico y la clases al ser virtuales, había veces donde no se alcanzaba a ver bien, y eso era a veces un problema porque en esta materia hay muchos gráficos que eran necesarios poder verlos correctamente y eso a veces dificultaba la cursada. ', '97501b77-46e2-4b75-9e95-e6842dde9cba');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Propone ejercicios clave, explica bien y siempre está dispuesto a recibir consultas. A veces te deja un tiempito para que resuelvas vos solo los ejercicios y está bueno para ver si entendiste realmente. ', '71740b5b-98d3-47fb-9b08-18276386589c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Buen profe, llega puntual, trae muchos ejemplos. Explica bien, súper claro. ', '71740b5b-98d3-47fb-9b08-18276386589c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2015', 'Excelente profrdora', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Nucleo duro', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Claudia es una muy buena profesora, al ser de la práctica no sé exactamente como explica los conceptos como para hablar de eso pero resuelve muy bien, siempre fundamentando con lo visto en la teórica y proponiendo que los alumnos hagan ejercicios y participen en la clase. Junto a Martins hicieron una buena dupla este cuatrimestre, turnándose y respetando cada una sus tiempos pero siempre creando un buen clima en la clase. ', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No coordinan con acero las clases, Acero les saca siempre ventaja', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'La práctica la verdad que no sentí que me ayude al lado de un profesor como Acero, tendría que ser una práctica impecable.', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Es una genia explicando. Sabe mucho y responde las dudas que le hagas. ', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Siempre atenta a las dudas de los alumnos, tanto en clase como fuera de horario.', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica muy bien, siempre se le entiende y si no, no tiene problema en explicar. Va muy lento a comparacion de acero.', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica de lo más bien. Hace un monton de ejercicios para que entiendas todo mejor. Lo que si, te va decir las definiciones 20 veces hasta que te canses, lo que no es malo porque despues te sirve para justificar en los exámenes. Se atrasa un poco, pero es sólo porque da muchos ejemplos, pero aún asi llega de lo más bien a dar los temas en tiempo y forma. La última clase antes del parcial, y la útlima clase del cuatrimestre no dió temas nuevos, las dejó como clases de consulta donde nos daba ejercicios para hacer y le podiamos consultar por ejercicios. ', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Nada que reprocharle, muy buena docente, da muchos ejemplos para cada cosa, está abierta a consultas en cualquier momento, sus clases son organizadas y claras.', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Claudia es un amor, se preocupa porque todos entiendan lo que está explicando, es muy prolija en el pizarrón aunque escribe chiquito por lo que es importante sentarse cerca. Siempre atenta y responde cualquier pregunta por más tonta que parezca, no tiene problema en repetir lo mismo 3 veces mientras que le presten atención. Súper recomendable cursar con ella', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Trata de que todos entiendan lo que explica pero muchas veces explicaba rapidísimo y costaba seguirla', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Una genia. Una de las mejores profesoras sin duda alguna. Va muy rápido, pero con que no te cuelgues o tengas un amigo que también presta atención estás bien. También tiene muy buena predisposición.', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Intenta explicar los temas de distintas formas para abarcar más temas y entenderlos mejor y es muy util', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Buenisimos los ejercicios de ejemplo y como los explica ', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Da las prácticas y se va turnando con los otros docentes. Claudia explica muy bien, y si necesitas devolverte a que te explique algo de antes lo hace perfectamente hasta que entiendas sin drama. Puede que a veces no sea de la mejor gana posible pero su explicación es impecable.', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Es una genia, da las clases de una manera espectacular, tiene muy buena letra y copia todo en el pizarron, te deja la carpeta un libro. Hace muchos ejemplos por lo cual es muy bueno, el ambiente de la clase es muy tranquilo y alentador. Recomiendo muchisimo sus clases, es muy clara en todo.', 'ea038f02-f874-412e-89eb-60b91793fcad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Sus gráficos en el pizarrón son de otro mundo, es un muy buen profesor. Mi favorito de la práctica, explica claro y es prolijo. ', '01eeeefc-cf9e-471e-8ca9-a9f7b4ea400c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Explica bien. Tiene un gran punto a favor por dibujar los gráficos muy bien.', '01eeeefc-cf9e-471e-8ca9-a9f7b4ea400c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Da clases una vez cada semanas aprox. Es muy claro, da una intro teórica antes de cada ejercicio a resolver. Gráficos impecables en hojas que sube al campus (mismas que usa para dar las clases)', '01eeeefc-cf9e-471e-8ca9-a9f7b4ea400c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'no le entendi nunca pero bueno, respondia dudas. Lo que no esta bueno es que ya trae todo escrito en una hoja y te lo relata entonces no lo seguis. Pero Seminara despues explica todo, no te preocupes xq yo estaba en la misma:)', '01eeeefc-cf9e-471e-8ca9-a9f7b4ea400c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'Es un genio dibujando, pero mal. Medio obsesivo incluso, si hace una línea medio torcida te borra todo y vuelve a hacer el dibujo. Pero es mejor, porque te permite entender gráficamente el ejercicio de manera clara. Al explicar a veces se traba, pero siempre los resuelve y no te perdes en el procedimiento.', '01eeeefc-cf9e-471e-8ca9-a9f7b4ea400c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'No me suena su nombre ,pero todos los profes de la práctica son buenos', '01eeeefc-cf9e-471e-8ca9-a9f7b4ea400c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Medio aburrido pero es uno de los que mejor explica la practica y hace unos graficos excelentes', '01eeeefc-cf9e-471e-8ca9-a9f7b4ea400c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Medio aburrido pero es uno de los que mejor explica la practica y hace unos graficos excelentes', '01eeeefc-cf9e-471e-8ca9-a9f7b4ea400c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Meh.', '01eeeefc-cf9e-471e-8ca9-a9f7b4ea400c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es muy bueno explicando y en la practica saca cualquier duda. excelente ', '01eeeefc-cf9e-471e-8ca9-a9f7b4ea400c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Muy buena persona. Va lento, así que no es muy probable que te pierdas. A veces no es tan clara explicando, pero no tiene problemas con que preguntes, te responde con toda la buena onda del mundo.', 'ee9cae64-9764-4935-a66c-35fa320a573f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Sabe bastante pero a veces se confunde fácilmente y eso afecta a la dinámica de la clase.', 'ee9cae64-9764-4935-a66c-35fa320a573f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'Maulhardt es lo mejor que hay', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Lo mejor que hay en esta facultad. Tenerlo a Maulhardt te hace ver lo bueno que puede llegar a ser un profesor. Hace algun que otro chiste con los alumnos pero no malintencionado. Si te lo tomas con gracia es muy llevadero toda la clase.', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Las clases son muy entretenidas y siempre va directo al grano. Además, Martin Maulhardt tiene una página web donde sube ejercicios resueltos paso a paso con gráficos y muy bien explicados. Un profesor que no solo da la materia, se preocupa por que sus alumnos aprendan!! Un profesor excelente!! Lo recomiendo bastante.', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Aguante el patriarcado.', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Crack. Si se pueden anotar con el, no lo duden.', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente, explica clarísimo, y no tiene problemas si le haces preguntas cuando termina la clase. Muy recomendado su curso, su material en su página y videos. Hace ejercicios de la guía durante la clase de teoría.', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Un genio de genios, te súper transmite lo que sabe y lo hace de una forma muy interesante.', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Excelente profesor, lo mejor que uno puede y va a poder encontrar por las aulas de FIUBA. No hay mas que decir. Lo único malo es que sus clases son una guerra por conseguir lugar ya que todo el mundo acude a ellas.', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Por muuuuuuuy lejos, el profesor más crack y cambiador de mentalidades de FIUBA. literlamente es un distinto. el número uno.', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se ve en pocos lados la dedicación que este hombre le pone a enseñar. Lo único fue que llegamos medio justos con el temario al final, pero aun así llegas a la primera fecha de final. Muchísima gente va a las clases y quizá eso es medio molesto pero habla bien claro y escribe grande y prolijísimo. ', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'el mejor profesor de la fiuba sin dudas. Las clases son muy didacticas, puede meter historias de la vida en medio de la clase para apaciguar el ambiente y sus explicaciones son de otro planeta. genio total', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El mejor profesor que tuve hasta ahora. Explica re bien y además es un personaje. Te da lecciones de vida en el medio de la clase y se preocupa para que sus alumnos aprueben. Se nota mucho que le apasiona lo que enseña ', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El mejor profesor que tuve hasta ahora. Explica re bien y además es un personaje. Te da lecciones de vida en el medio de la clase y se preocupa para que sus alumnos aprueben. Se nota mucho que le apasiona lo que enseña ', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Como profesor es EXCELENTE. Sus explicaciones son geniales, y sus videos también. De todas maneras, es muy multitudinaria su clase, así que si sos tímido para preguntar, quizá no lo recomendaría (responde a cualquier cosa igual). ', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'martin es un dios aparte. la práctica se cae a pedazos ', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'EXCELENTE, SI LES DA LA PRIORIDAD NO LO DUDEN.', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buena teórica, explica los temas re bien y a buen ritmo. Da tips para aprobar muy buenos. Si la clase decae un poco mete un breve showtime y levanta en seguida. Sus clases se llenan mucho', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'No se como se llamaban los que daban la práctica ya que el curso A y B estaban unificados..
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Sus clases son divertidas. Es medio flojo de boca. No tiene mucha rigurosidad, pero ejemplifica mucho y sirve para entender y aprobar los exámenes. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Martin es el mejor profesor que hay en la facultad. Se nota lo mucho que sabe y lo transmite muy bien, baja todo a tierra y lo entendes perfectamente. Si preguntas algo en clase probablemente te boludee pero si te acercas despues de la clase te explica lo que sea muy bien. Sus clases son muy entretenidas se pasan volando esas dos horas de teoirca. Tambien responde mails super rapido, si tienen la chance ni duden en cursar con el', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Maulhardt tu vieja y muy atrás esta dios ', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'grande martin!!', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica súper bien y se le entiende bien todo, es un profe bastante copado y busca que participen y entiendan los temas. No estaría errada si digo que es de las mejores cátedras de Análisis II, si ves que hay cupo anotate directo en ésta. Una pena que los problemas técnicos siempre caían cuando él iba a dar clase, pero nunca se perdía esa clase y se solucionaba al rato. Si querés ver qué onda como explica en youtube tiene banda de videos y tiene una página de la materia http://analisis2.com/ ahí hay banda de cosas y los videos re bien hechos', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Leyendo los comentarios anteriores pensé que decir "Maulhardt, tu vieja y atras Dios" era una exageración... Luego de haber estado en su curso me doy cuenta de que no lo es: Él es un dios hecho docente', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'UN GENIO, si pueden anótense con él, no pierde tiempo con boludeces y explica las cosas que te van a tomar, a él le re interesa que aprendas y apruebes. Además de que es re responsable, prolijo y explica excelente.', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Martín es el mejor docente de análisis que me tocó desde que me inscribí a la uba. Para la teoría están los videos de su página analisis2.com y empieza las clases dando un repaso de esos videos, está bueno porque te podés sacar las dudas ahí mismo, él no tiene problema en responder pero tampoco está bueno preguntar por algo que se explicó y no prestaste atención. Después del repaso se pone a hacer ejercicios, siempre consultando con los alumnos cuál les parece más atractivo para resolver.', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Excelente profesor. Explica muy bien y los videos en su página son muy claros así como sus clases', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Un docente excepcional. La forma que tiene para abordar el programa de la materia logra hacer que la materia sea mucho más sencilla, además es un tipo muy piola lo que da lugar a clases mas llevaderas. En definitiva, un capo.', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'El mejor de Am2 lejos', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'De este profe ya está todo dicho, no hace falta que yo también de mi opinión. Sin embargo la práctica arruina todo lo bueno de la teórica, es la primera vez que vi gente que no quiere dar clase. Las dudas individualmente te las pueden contestar, algunos con un poco de fiaca y otros con un poco más de ganas. Tal vez sea una buena idea ir a las teóricas y prácticas de Zitto, que esa sí es una práctica competente (este cuatri por lo menos fue imposible ir a la teórica de Maulhardt y después a la práctica de Zitto, porque las clases de Zitto eran al revés, es decir primero práctica y después teórica). Las clases de Maulhardt son muy parecidas a los videos, pero a veces te tira alguna que otra punta que en los videos no. Si bien los videos son más que excelentes, nunca van a ser un total sustituto de la clase. Pero es un adelantado a su época, cree en la eduación del futuro, no te corrige cosas sin sentido y es pragmático.', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'un escándalo de profesor, explica con una claridad superlativa, no falta nunca y quiere que aprendas, eso si, no preguntes boludeces', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Sin dudas el mejor profesor que tuve hasta el momento. Explica muy claramente todo y tiene buen trato con los alumnos. Sus videos de yt son de gran ayuda.', '3bf04f6e-b521-4132-b3e8-c07003198f88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Cuando cursé unificaron la práctica así todos se quedaban en el mismo salón. La dinámica fue escribir 4 o 5 ejercicios en el pizarrón, resolverlos y de vez en cuando poner en común. Fueron masomenos todos lo mismo: paseaban por ahí esperando alguna que otra duda individual. Estaba cada uno en la suya en la práctica. ', 'f87201e1-028c-4830-968c-ee9b08c440cb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No me gustaron las prácticas. Generalmente escribían 5 problemas en el pizarrón (que eran imposibles) y ni los resolvían. Asi que si te quedaban dudas si o si le tenías que ir a preguntar. Además los de la practica se unian a todos los paros', 'f87201e1-028c-4830-968c-ee9b08c440cb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No me gustaron las prácticas. Generalmente escribían 5 problemas en el pizarrón (que eran imposibles) y ni los resolvían. Asi que si te quedaban dudas si o si le tenías que ir a preguntar. Además los de la practica se unian a todos los paros', 'f87201e1-028c-4830-968c-ee9b08c440cb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se nota que sabe, pero dependiendo del día explica bien o mal. La práctica no estuvo muy organizada la verdad, pudo haber sido mejor... Es muy copado igual. ', 'f87201e1-028c-4830-968c-ee9b08c440cb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bastante tranquilo, por lo que la clase puede llegar a dar algo de fiaca. Pero es muy amable y siempre responde todas las dudas', 'f87201e1-028c-4830-968c-ee9b08c440cb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Lo que noté en sus clases es que Él sabe mucho, pero siento que no sabe bien como explicarlo y se traba a veces en sus explicaciones o da vueltas a temas que capaz hubiese sido mejor saltear, pero por el resto, buen profesor', 'f87201e1-028c-4830-968c-ee9b08c440cb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'No se entiende mucho cuando explica, no le pone mucha onda falta mucho', 'f87201e1-028c-4830-968c-ee9b08c440cb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Se confunde mucho, no me gustaron sus clases.', 'a96eb6d5-9410-443b-85e7-aaeb2564abbb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'También daba clases como los demás profes de la práctica y era muy clara y respondia dudas. A veces se le caia el internet pero realmente no fue algo que nos perjudique mucho, es una excelente profesora', 'a96eb6d5-9410-443b-85e7-aaeb2564abbb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es una divina. A veces no se le entiende mucho pero de los asistentes de Seminara es la mejor', 'a96eb6d5-9410-443b-85e7-aaeb2564abbb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Hace como Estrin, la mayoria de veces tiene un PDF de ejercicios resueltos y se pone a explicarlo.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Clases practicas fabulosas, explica todo paso por paso', 'a96eb6d5-9410-443b-85e7-aaeb2564abbb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bien, pero hasta ahi', 'a96eb6d5-9410-443b-85e7-aaeb2564abbb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Digamos que si la clase anterior con otro profe vimos X tema, y en la siguiente clase queres repetir algo específico que no te quedo muy en claro, medio que lo empieza a explicar algún profe y ella dice "chicos pero esto igual ya lo vimos la clase anterior"... Igualmente las clases de práctica  solo traen ejercicios resueltos y te explican cómo los hacen, a mi personalmente casi ni me sirvió. El único que me servía era Wilk que resolvía ejercicios de la guía.', 'a96eb6d5-9410-443b-85e7-aaeb2564abbb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bien pero le falta mas didactica', 'a96eb6d5-9410-443b-85e7-aaeb2564abbb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', ' La verdad una gran profesora. Se interesa mucho porque los alumnos realmente entiendan lo que está dando más que en llegar con el programa (con el cual llega, impecable en eso también). Además te da turrones si pasas al pizarrón, fomenta un lindo ambiente en el aula y se toma muy bien las críticas constructivas. Se pierde a veces porque se queda explicandole una duda a alguien, pero después retoma y sigue. Se queda después de clases y resuelve dudas también. Da gusto ir a su clase. Si no entran a Maulhardt, vengan acá.', '466fc548-a662-4ce7-ad46-38156d9c4eb7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Particularmente para mi la mejor profe de esta catedra es Verónica, es nueva en la facultad y le gusta enseñar por que se nota en todas sus clases la buena onda que le pone y como te hace entender el tema,  dio todo el contenido teórico necesario para aprobar la materia y son de esos profesores que mezclan teoría-practica para que resuelvas tus dudas, esta materia es dura pero si tienes un buen profesor teórico y resuelves la guía terminas aprobando. Para finalizar, la catedra no es perfecta por algunos profes de la practica que no se encuentran en la misma sintonía sin embargo es altamente recomendable por la profe de la teoría. ', '466fc548-a662-4ce7-ad46-38156d9c4eb7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No fui a muchas de sus clases practicas, pero en las que estuve me parecio que explica muy bien y es buena onda', '9f30fe74-528c-48ce-aeb8-4841b48dda11');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un capo, es re tranqui y explica todo super claro. Se nota que sabe. Es medio desprolijo en el prizarrón pero se le entiende. Siempre dispuesto a responder preguntas y a hacer las clases amenas y amoldarlas a lo que los alumnos necesitan. ', '9f30fe74-528c-48ce-aeb8-4841b48dda11');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Lo mismo que con García ,pero el es el ayudante ,explica muy bien aveces se va por las ramas recuerdo que una vez estuvimos más de una clase para derivar un arctg  para terminarla la clase siguiente :v ,lo bueno que tiene es que esa demora que dije es porque quiere que entendamos el porque de las cosas ,demostrar  y no solo usarlo ', '9f30fe74-528c-48ce-aeb8-4841b48dda11');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Le pone onda pero a veces te confunde con sus explicaciones', 'd76d02b3-e68b-4b7e-b1a8-ab59931758f3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es buen profesor pero sus clases son un poco pesadas y no explica con mucha claridad', 'd76d02b3-e68b-4b7e-b1a8-ab59931758f3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Da las clases practicas, unicamente resuelve ejercicios de la guia; le pone toda la onda del mundo aunque aveces las clases se hacen un poco aburridas. Para el parcial son mejores los ejercicios de parcial que vemos en clase con Marcos Sola antes que los ejercicios de la guía que resuelve Piñera en clase. ', 'd76d02b3-e68b-4b7e-b1a8-ab59931758f3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Se le cortaba siempre el internet, hubo veces donde venía medio medio la conexión y se caía; otras veces parecía que lo hacía adrede, venía bien y se iba sin que haya bajado calidad antes como suele pasar. Mandaba los links el mismo día a la madrugada via mensaje privado por el campus.', '3349533a-ed44-454f-9235-8b1fdaebc7f9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Holes compañerxs', 'f306e2db-9dae-42d8-a044-faa52e6a61ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', '85% de la clase se iba cuando terminaba Mauldhart, y no era casualidad. Ver videos de la faraona te enseña mas matemática (y te motiva más) que este tipo. Ñoqui tremendo, sabe poco.', 'f306e2db-9dae-42d8-a044-faa52e6a61ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Si bien sabe un montón y está dispuesto a ayudarte, me pareció que se enroscaba mucho para resolver problemas; siempre proponía "la otra forma de resolver el problema.." que en general era difícil y rebuscada.', 'f306e2db-9dae-42d8-a044-faa52e6a61ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Siempre llega tarde con el casco de la bici puesto. Tiene una cuenta en twitter extremadamente nefasta. busquen @faloyalabolsa en twitter, porque no tiene desperdicio', 'f306e2db-9dae-42d8-a044-faa52e6a61ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un poco molesto. Su práctica es muy mala, da ejercicios mucha más difíciles que los del parcial/final, y no toca ninguno de la guía. Eso sí, es bastante claro para dudas.', 'f306e2db-9dae-42d8-a044-faa52e6a61ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Siempre esta dispuesto a responder dudas y es muy efectivo. Se nota que sabe mucho. Buen docente', 'f306e2db-9dae-42d8-a044-faa52e6a61ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Muy mal profesor, super soberbio y te trata con una diferencia como si fueses inferior porque el sabe mas. Asi y todo sabe muy poco, explica muy mal y no tiene ganas de explicar. La mayoria de las clases en vez de explicar algo pone en el pizarron ejercicios super dificiles que nunca te van a tomar para que hagas y ni explica nada, porque para el "si sabes hacer eso ya aprobas". Su criterio de correccion es absurdo, habia cosas que el profesor de la teoirca en clase decia "NO BAJAMOS PUNTOS POR ESTO" y el por ese error te ponia mal el ejercicio diciendo que el "no estaba de acuerdo" como siempre con esa soberbia. Traten de no anotarse con el porque la practica es super impotante', 'f306e2db-9dae-42d8-a044-faa52e6a61ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Bastante copado, siempre explicaba ejercicios tanto sencillos como complejos y se le entendían bien. En la última clase aprendió como se pasa el PDF de lo anotado en OneNote asique los que vayan a cursar a partir ahora tienen ese detalle nuevo. Siempre responde todas las dudas y preguntaba si iba bien o si iba muy rápido (dijo que lee estas criticas para que se puedan aprovechar sus clases, lo que está copadísimo). A mi me pareció de los mejores profes de la cátedra (que son todos muy buenos igual)', 'f306e2db-9dae-42d8-a044-faa52e6a61ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Al principio explica tranqui pero después se enreda con los ejercicios y es difícil seguirle el hilo, igualmente buen profesor y muy copado.', 'f306e2db-9dae-42d8-a044-faa52e6a61ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy bueno. Explica muy bien y hace ejercicios de parciales/ finales viejos también para repasar antes del parcial', 'f306e2db-9dae-42d8-a044-faa52e6a61ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Apareció poco y nada', '965c8749-8334-4a5e-b216-39740399f77b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La verdad, la vi 3 veces con suerte. Suele sentarse al fondo. Escuche que responde dudas.', '0d4342b7-f264-401d-86d8-b4bc7564606e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Buen pibe, quiza habia veces que se trababa o le salia mal un ejercicio pero se notaba que se esforzaba para que entendieramos y siempre respondia dudas. ', '6fb8a92b-0d5a-4e55-96f1-7d7a155de2ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Siempre está en la práctica pero nunca dió clase en el cuatrimestre (2C2020). ', 'ef391274-7905-4605-a29c-ffc29a8b51e0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Trata con soberbia a los alumnos, explica bien pero no está abierta a las consultas. No la recomiendo', '0e1f450f-530e-45d0-be7f-0204a0eab904');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Hace muchos paros, se pierden clases y llega a las apuradas a los temas de final ya q tiene q explicar todo rapido y no siempre lo hace bien.', '0e1f450f-530e-45d0-be7f-0204a0eab904');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica muy bien. Fomenta la participacion. Tanto Sassano como sus ayudentes en la practica resuelven problemas de la guia y de parciales, lo cual ayuda mucha y hace la cursada mas amena. Se suele adherir a algun paro. Se llega perfecto con los temas. ', '0e1f450f-530e-45d0-be7f-0204a0eab904');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2015', 'Un amor de docente', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Seminara es una profesora increíble, explica bárbaro y siempre tuvo la mejor predisposición para responder consultas (casi siempre se quedaba después de ahora para aquellos que quisieran preguntar). Sus clases siempre estuvieron muy organizadas y me quedó un cuaderno ordenado y completo. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Seminara pasion', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Un amor! Seminara te da la clase como una "seño" de primaria. Muuuuuy didáctica y excelente persona.', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Buena profesora, a veces parece profesora de secundario', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es una genia!!', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente en todo su sentido', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'genia¡', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Definitivamente una de las mejores profesoras de análisis, explica todo bien claro y conciso y si no entiendes te lo vuelve a explicar. Siempre tiene preparados apuntes por si no llega a dar un tema completo como para que uno estudie por si mismo y son muy muy completos. Definitivamente la recomiendo!', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Una de las mejores profesora que me tocó en FIUBA. la clase la hace muy didactica, logra tener una trato mas cercano acordándose de los nombres de cada uno. Enseña de una forma muy maternal, lo cual es hermoso y te hace querarla. Le gusta mucho responder dudas en la campus, te responde todo por ahi. Después de clases tambien, se queda y responde todo con mucha predisposición y cariño, si no sabes algo te lo enseña sin juzgar. Ir con ella es aprender si o si. Semi es la mejor sin dudas, vas a extrañar su forma de enseñar después ', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Explica clarísimo. Meet en horario de cursada, además de que sube PDFs en el campus. Responde siempre cualquier duda en el foro. ', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es la mujer más paciente y más amorosa de la tierra. Da la sensación de que su vocación era ser maestra de primaria pero le encantaba matemática. Podés hacerle todas las preguntas que quieras siempre te las va a responder bárbaro. Escribe re prolijo y se le entiende todo. Aún cuando había terminado la cursada dió clases de consultas antes de cada fecha de final. La amooo', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Silvia es muy buena, pero no te prepara bien para los exámenes, explica de una manera que se hace fácil de seguir pero cuando tenes que resolver se complica. ', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es una de las mejores profesoras de fiuba. Su paciencia y ganas para explicar la materia hacen que sea muy agradable cursar incluso en contexto virtual. La recomiendo mucho!', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es muy buena explicando y respondiendo dudas. Para los finales organizó clases de consultas antes de cada fecha.', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Que decir, Seminara es un pan de dios. Te explica de una forma tan intuitiva que parece que supieras Analisis 2 desde chiquito. Va despacio, si tenes alguna duda o le respondes que entendiste algo pero de una forma dubitativa, te vuelve a explicar. Si no se entienden ejercicios de la guia, a veces se pone a hacerlos. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'La verdad Silvia es la única por la cual vale la pena anotarse a este curso. Es muy clara explicando los temas, realiza ejercicios para afianzar los conceptos y hasta organiza clase de consultas los feriados. ', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Esta mujer es lo mejor que me paso en la vidaa, es muy buena posta. Yo que soy un queso entendi re bien, tiene pizarra virtual y se hace muy facil seguirla, explica todo las veces que necesites, pero la practica no es muy buena la verdad, salvo Oliva y Wilk q explicaban bien. Si te cuesta, anotate aca. ', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buena persona. Explica de manera excelente.', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Una de las mejores profesoras de esta materia, siempre dispuesta a recibir consultas y explica muy claro.', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Una profesora excepcional. Daba la clase de forma excelente, siempre llegaba puntal, se llevaba ejercicios para corregir de aquellos que le pedian si se los revisaba, incluso respondía en el campus y subia cosas nuevas... De lo mejor de la FIUBA.', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Excelente profesora. Te das cuenta casi al instante de la pasión que tiene por la materia. Responde los mensajes de manera rápida y siempre esta predispuesta a ayudar al alumno, por ejemplo, ha dado una clase de repaso para el parcial en un feriado, o si tenés dudas se queda más tiempo luego de la clase. Si seguís la materia al día llegas genial al final.', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'Seminara es un amor de persona, siempre incentiva a la participación en clase y se acuerda de los nombres de sus alumnos, lo cual suele ser raro en las materias comunes a todas las ingenierías. Explica muy bien y siempre se queda después de clase respondiendo consultas con muy buena predisposición.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Silvia es una genia ,no desperdicia un minuto de clase te quedarás copiando hasta el final ,falta solo si es una cuestión de fuerza mayor . Te sentirás como si fueras su hijo ,responde a todo vuelve a explicar desde el principio si no entendés (tampoco la boludes) ,te da ejemplos y demuestra todo ,siempre responde las consultas del campus  .Hace chistes hasta con ella misma ,siempre tendrás un clima cálido con ella.', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Seminara es un amor de docente, explica muy bien y siempre con la mejor onda.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'La mejor profe que tuve en toda mi vida, explica re claro y con toda la paciencia no tiene drama en repetir las cosas, siempre se preocupa por que entiendas y ademas que es super organizada en las clases y sube archivos al campus con teoria, ejemplos etc. Un amor Silvi <3', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es un amor de persona ❤️ es una gran profe, sabe muchísimo, es una profe que te repite si es necesario porque no entendiste, aunque sean mil, ella de distintas formas te lo explica para que de alguna forma lo puedas llegar a entender. Gran profe para los que necesitan que les expliquen como a "nenes de 5", todo pausado y tranquilo.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'La mejor lejos, ya lo explique en otro comentario. La amamos ❤️ tiene toda la paciencia del mundo.', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es una genia, explica la teoría 10 puntos y te saca cualquier duda que vos tengas, si tiene que frenar la clase por que no entendiste ella lo hace. muy buena docente ', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Seminara es una genia explica bien y tiene paciencia', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'la teorica es impecable. seminara es un amor y es EXCELENTE. la practica es medio densa pero explican bien', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es una genia, se adaptó re bien a lo virtual, explica anotando como si fuera es un pizarrón virtual ( y sube después esas notas), lo que hace que sea super llevadera y entendible la clase(además graba las clases así que si te perdiste en algo podes revisarlo), responde todas las preguntas que sean necesarias si no se entiende, sube apuntes armados por ella de todos los temas donde está todo lo que vemos en clase super detallado y con más ejemplos, que si los lees antes de la clase, podes entender todo mucho mejor, está pendiente al foro de consultas todo el tiempo y contesta rapidísimo todo, super recomiendo ', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'De las mejores profesoras que tuve, muy recomendada.', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es buenísima explicando, muy agradable y tiene muchísima paciencia', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Silvia es lo mejor que me paso en la vida, la amo. No solo es una EXCELENTE docente, sino que además es un amor, literalmente te trata como si fueras su hijo y disfrutas estar en la clase. Explicaba excelentemente todos los temas, daba ejemplos para que lo entendieras todo de una forma super sencilla y respondia a TODAS las dudas (literalmente a todas, sin importar que tan tontas fueran). Un par de feriados que coincidieron con sus clases se ofreció a dar clase de consultas, se nota su pasión por enseñar y se re alegra cuando entendes el tema. Se encarga también de organizar el campus y lo tiene super ordenado y completo (sube un montón de pdfs con ejemplos y explicaciones muy utiles), además de responder siempre por el campus, esta muy atenta al foro de consultas. Definitivamente la mejor, si pueden anotarse con ella haganlo', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Seminara >>> Maulhardt', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Es muy buena, la elegí porque había leído por acá que explica los temas como si fuesemos nenes chiquitos, lo más fácil posible y es verdad, se le entiende todo bastante bien.', '36a8077a-49b8-4327-b641-0b5f36b3e6b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'El mejor de la catedra. Suele explicar con ejemplo fáciles, pero se le entiende muy bien. Es buen profesor para iniciar tema nuevo.', 'a5ff3098-b4c5-43be-baac-51b281571307');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Un genio, aprendí a resolver los ejercicios gracias a el. Ojala todas las practicas tengan un Sola, todo seria mucho mas facil', 'a5ff3098-b4c5-43be-baac-51b281571307');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Chorny tomó licencia y como adjunto esta andy juarez. Exelente profe ', 'a5ff3098-b4c5-43be-baac-51b281571307');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Por temas de horarios no pude ir tanto a las prácticas como me hubiese gustado, pero todos los profes del curso hicieron que la cursada virtual se asemejara lo más posible a la presencial, y se notó. Muy recomendado!', 'a5ff3098-b4c5-43be-baac-51b281571307');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Chorny estuvo de licencia y tuvimos con Juarez', 'a5ff3098-b4c5-43be-baac-51b281571307');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy bueno explicando y es claro, no me pareció de las mejores clases pero no esta mal. Si tenes alguna duda siempre la responde con respeto ', 'a5ff3098-b4c5-43be-baac-51b281571307');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica muy bien, buena onda. Por ahora el mejor profesor que tuve en la carrera. Te dan ganas de aprender con el.', 'a5ff3098-b4c5-43be-baac-51b281571307');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un capo, super amable y explica muy bien. No falta nunca y es organizado, sube el material todas las clases.', 'a5ff3098-b4c5-43be-baac-51b281571307');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'pasa muy rapido sus clases practicas que no se entendia al 100 por ciento', 'a5ff3098-b4c5-43be-baac-51b281571307');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Sabe mucho, una vez recuerdo que fue a 300km/h e hizo 3 ejercicios de la segunda parte de la materia en 10 mins. Se nota que sabe pero depende el día da las cosas normal o rápido.', 'c892eae3-e47d-4f1f-8d74-e075b0b74586');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Los ejercicios que hizo los hizo bastante claros, por lo menos yo los entendi bastante bien, ningun reproche', 'c892eae3-e47d-4f1f-8d74-e075b0b74586');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Hay días y días. Explica bien pero explica a 1000 por hora y si no le estás prestando atención te perdés. ', 'c892eae3-e47d-4f1f-8d74-e075b0b74586');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'No es la peor profesora de práctica, pero debe estar entre las peores. Corrige como garca.', 'c892eae3-e47d-4f1f-8d74-e075b0b74586');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No me parecieron claras las practicas con ella', '8d5cc5be-368c-455a-84c1-2489b17a192b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Dora explica muy bien las clases practicas que da, alguna que otra vez tuvo algun problema de conexion. Graba todas sus clases y las da desde la tablet, por eso es muy entendible.', '8d5cc5be-368c-455a-84c1-2489b17a192b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Amas su forma de explicar o la odias, no hay punto medio. Ella resolviendo ejercicios es un monólogo de sus pensamientos en voz alta y como que en un momento se acuerda que está en el medio de la clase y pregunta cosas a los alumnos. Explica muy bien individualmente y si tenés dudas, anda con ella porque te las saca al toque. A mí me parece divertida la forma en que explica y si se equivoca busca de que vos también te pongas y la ayudes a resolver. No me corrigió, pero amigos me han dicho que si puede, apunta para arriba. ', '8d5cc5be-368c-455a-84c1-2489b17a192b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bien ,si se perdiste no tiene ningún problema en volverlo a explicar, a veces medio desprolija  al escribir o graficar pero se entiende 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Da la parte practica. Muy densa a a la hora de explicar como se resuelven los ejercicios, muchas veces hacia cosas mal y cuando se daba cuenta decia que cuando lo hagamos nosotros nos fijemos. no la recomiendo', '8d5cc5be-368c-455a-84c1-2489b17a192b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Sus practicas son lo mejor para despejar dudas, ademas de que quedan grabadas. Es buena explicando y a veces resuelve ejercicios que piden los alumnos. Muy buena', '8d5cc5be-368c-455a-84c1-2489b17a192b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'No me gusto, si bien transmitia desde la tablet y dibujaba haciendo ejercicios, etc, muchas veces tenia a la nena despertando llorando y no me gustan los bebes AAAAAAA
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Hacía presentaciones para poder ir resolviendo ejercicios todos juntos. Siempre buena onda y muy claras explicaciones ', 'f43fa167-b55e-4d3b-a312-715aa8302a8d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'daba las practicas, explica muy bien', 'f43fa167-b55e-4d3b-a312-715aa8302a8d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La mejor de todos lo profes de prácticos. No solamente sus explicaciones estaban buenísimas, junto con sus diapositivas y como desarrollaba los ejercicios, sino que es una profesora re buena onda, copada, que hacía chistes... hacía que las clases se vuelvan mucho más dinámicas por la buena onda que le ponía, lo cual al ser una materia de 8 horas semanales y con temas pesados, era necesario y estaba buenísimo. UNa ídola Vero, ojalá puede dar todas las prácticas ella jaja', 'f43fa167-b55e-4d3b-a312-715aa8302a8d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Juan explica muy bien y se entiende. Las clases las da grabando hojas y escribiendo con un marcador, si vas a cursar desde un celular o una pantalla muy chica capaz se te complica ver. En general muy bueno', 'cfb737a9-06b2-430a-9a4e-0c23c58d96a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El profe vicedo es excelente explicando, se toma el tiempo para que se entiendan bien todos los temas y siempre responde consultas despues de clase. Muy recomendada esta practica.', 'cfb737a9-06b2-430a-9a4e-0c23c58d96a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Da clases con una hoja de papel y la filma con su celular desde un soporte, pero se le entiende perfecto, no tiene problema en explicarte varias veces si no entendes y los ejercicios que propuso a mi me parecieron muy útiles.', 'cfb737a9-06b2-430a-9a4e-0c23c58d96a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Da muchas vueltas al explicar un tema, repasa mucho los temas anteriores y despues avanza muy rapido. no tiene linda letra lamentablemente asi que hay que adivinar lo que escribe pero propone muy buenos ejercicios, es muy copado y existe buen clima en sus clases', 'cfb737a9-06b2-430a-9a4e-0c23c58d96a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es un desastre, te confunde al momento de hacer un ejercicio. No sabe si está bien o mal un ejercicio, le tiene miedo a Acero.', '8e5d4e07-4a5c-4a45-910f-def60a303592');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es desorganizado a la hora de explicar, y a veces te perdes un poco. Pero también te muestra a hacer ciertas cuentas, o resolver ciertos problemas que son muy útiles. Te responde de lo más bien, y se nota que se preocupa por que los alumnos aprueben. Solo daba la práctica una vez a la semana, se turnaba con Fan.', '8e5d4e07-4a5c-4a45-910f-def60a303592');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Nicolás es muy cordial, siempre está abierto a que le hagas todas las preguntas necesarias, y fomenta la participación en clase. Sin embargo sus clases son algo desorganizadas, se dice y se desdice, algunos eligen cursar la práctica con Juan Pablo pero desconozco como son sus clases. También siento que para algunos ejercicios presenta soluciones algo específicas a ese ejercicio en particular, no tan aplicables a los casos generales. Igual esto no es siempre y puedo estarme equivocando. Es desprolijo con la notación (a nadie le interesa) y con la letra (esto sí importa)', '8e5d4e07-4a5c-4a45-910f-def60a303592');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Nico es un crack, solía llegar tarde la mayoría de las clases y no eran organizadas, es muy importante tener buen ritmo para anotar porque es desordenado en el pizarrón y es fácil perderse. Más allá de eso, explica bien y se preocupa porque todos entiendan, varias veces se quedó después de hora y dio clases de ayuda para los que lo necesitaban. Es muy buena persona, mantiene buen trato con todos.', '8e5d4e07-4a5c-4a45-910f-def60a303592');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Iba a ser ayudante pero terminó siendo el que estuvo a cargo de las prácticas. Es un profe que enseña regular, no lo recomendaría, no justifica casi nada y Acero pide muchas justificaciones, con lo que explica él no alcanza ni para el parcial ni para el final, además le cuesta mucho llevar el ritmo de las clases de Acero.', '8e5d4e07-4a5c-4a45-910f-def60a303592');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'A veces a mi me parecía como que iba a dar la clase y no tenía nada preparado, como que iba y veía qué hacía en el momento. Yo no le entendía mucho y además sus clases me parecían super aburridas. Varias veces se equivoca mientras resuelve un problema y no se le entiende bien la letra', '8e5d4e07-4a5c-4a45-910f-def60a303592');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Va a mil, sus pdf son malísimos y boludea a los pocos alumnos que le siguen la clase', '34adfc09-789c-4eb3-9682-e21982f39ac7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Bernardo es controversial. No me parece mal profesor, se pone a explicar un word de ejercicios resueltos y explica lento para mas o menos seguirlo, pero a veces se complica o hace cosas que la primera, segunda vez no las entendes. Eso sin contar que es medio serio y sentis que te responde medio mal si preguntas algunas cosas que le parecen "basicas" o si cometes un pequeño error. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un genio para las practicas, lo único para decir es que solía llegar 10 o 15 minutos tarde y a veces puede ir un poco rápido.', '34adfc09-789c-4eb3-9682-e21982f39ac7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Puede parecer cortante al principio pero después es buena onda. Hacíamos algunos ejercicios de la guía en clase', '34adfc09-789c-4eb3-9682-e21982f39ac7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buen profe, incentivaba la participación, explicaba bien y hasta se acordaba los nombres de algunos.', '34adfc09-789c-4eb3-9682-e21982f39ac7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Bernardo es un genio. Al principio es un poco intimidante pero lo único que quiere es que estés al día para aprobar la materia. Explica bien y hace buenos gráficos para que entiendas mejor.', '34adfc09-789c-4eb3-9682-e21982f39ac7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Uno de los mejores de la practica de Seminara, siempre da una intro teorica antes de explicar los ejercicios y es re claro en su explicacion y organizado. Un capo Berni', '34adfc09-789c-4eb3-9682-e21982f39ac7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es el único que hacía ejercicios de las guías, sus clases son las que más servían de la práctica, después las otras eran más de apoyo si llegas con todo, sino no te sirven las prácticas. Wilk no daba cada semana.', '34adfc09-789c-4eb3-9682-e21982f39ac7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Las veces que dio la clase bastante bien ', '34adfc09-789c-4eb3-9682-e21982f39ac7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Buen profe, trae muchos ejemplos, sus gráficos son muy buenos. Responde consultas sin problemas. Lo malo es que anda a las corridas, llega tarde y se va corriendo, salvo cuando tiene que dar clase, ahí sí llega puntual. Es justo para corregir parciales.', '34adfc09-789c-4eb3-9682-e21982f39ac7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Bastante soberbio al responder dudas y llegaba siempre 30 minutos tarde', '34adfc09-789c-4eb3-9682-e21982f39ac7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Es de la practica, hace muchos ejemplos y tira muy buenos tips', '4230dd34-b6d9-483d-b479-f6a3374a9aad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'Es muy amable y paciente al explicar', '3fd7b674-450b-4e5e-b07a-d4e86327c36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'Muy buen docente. Explica tranquilo, pausado y repite las veces que haga falta. Muy buen trato. Se adhiere a varios paros y puede haber una o dos clases públicas a lo largo del cuatri. Es tranqui corrgiendo', '3fd7b674-450b-4e5e-b07a-d4e86327c36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Se complementa muy bien con la práctica de Bergamini.', '3fd7b674-450b-4e5e-b07a-d4e86327c36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Muy buen profresor! Explica lento y es claro.', '3fd7b674-450b-4e5e-b07a-d4e86327c36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Recomendable cátedra de análisis 2 si se cursa con Bergamini. Es verdad que a veces se pierden clases por paros pero no faltó ningún tema a ser dado y se maneja con el mismo cronograma que Maulhardt. Bergamini es una excelente profesora de práctica y no tiene problema en que vayas y le hagas consultas puntuales personales.', '3fd7b674-450b-4e5e-b07a-d4e86327c36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es excelente docente, el único inconveniente es que, si bien no está mal, se adhiere a todo paro, movilización, clase publicas habidas y por haber.', '3fd7b674-450b-4e5e-b07a-d4e86327c36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un capo Zitto, super recomendada la catedra, explica excelente y siempre te responde bien las preguntas y mantiene un muy buen trato con los alumnos.', '3fd7b674-450b-4e5e-b07a-d4e86327c36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un genio, uno de los pocos docentes que dan clase sincrónica durante la pandemia. Se nota que sabe un monton y enseña con mucha claridad y paciencia. Dio clases de consulta para sus alumnos para los finales, e incluso subió sus resoluciones. Además al final de cada clase teorica, si hay tiempo, ofrece ejercicios en un menti (Similar al kahoot) que ayudan a reforzar los conceptos.', '3fd7b674-450b-4e5e-b07a-d4e86327c36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Tremendo profesor, explica claro y no va muy rapido, muy buen trato con los alumnos, siempre que nota que la clase se perdio vuelve a explicar, se llega muy bien al parcial y al final', '3fd7b674-450b-4e5e-b07a-d4e86327c36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'zitto excelente ', '3fd7b674-450b-4e5e-b07a-d4e86327c36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy bueno explicando la teoria, se le entiende perfecto y no tiene problema en explicar mas de una vez lo mismo. Ademas explica a un ritmo tranquilo y llega bien con los temas ', '3fd7b674-450b-4e5e-b07a-d4e86327c36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy claro, comprometido y interesado en que sus alumnos aprueben. Dominio total de la tablet y las explicaciones. No me hizo falta consultar teoría en ningún otro lado. ', '3fd7b674-450b-4e5e-b07a-d4e86327c36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buen profesor, explica muy bien y trata bien a los alumnos. Lo único molesto es que habla en lenguaje inclusivo y es zurdo, sacando eso muy buen profesor', '3fd7b674-450b-4e5e-b07a-d4e86327c36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Tiene una personalidad muy fuerte y aunque explica bien su trato con los alumnos deja mucho que desear. El cuatrimestre que cursé yo no se quedo ni 5 minutos a responder dudas luego de sus teóricas y tuvo varios ataques hacia alumnos faltandoles el respeto', '315eeb70-a0e9-49b8-8ee0-9feaa0254970');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Acero por favor hacete un meet. No cuesta nada', '315eeb70-a0e9-49b8-8ee0-9feaa0254970');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No dio la cara en ningún momento, puros pdf, videos del MIT y el foro ', '315eeb70-a0e9-49b8-8ee0-9feaa0254970');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es un desastre. Si quieren disfrutar una materia NO la cursen. Explica bien pero dió una sola clase en cuanto a la segunda parte de la materia (UNA LOCURA, practicamente la tenes que preparar con libros). En el primer parcial aprobó el 20% y en el 2do menos del 5%. El nivel de los finales es desorbitante, nada que ver a los ej que están en la guia. Es una locura que no hayan rajado a este tipo de la facultad, cuatrimestre tras cuatrimestre empeora. Se queja de que no hay preguntas en el foro pero cuando las hay respondé de muy mala manera.', '315eeb70-a0e9-49b8-8ee0-9feaa0254970');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'La materia empezó bien, Acero dando clases los lunes a partir de las 7am, donde se veían varios temas de la semana, los cuales después había que complementar leyendo de la bibliografía. Así hasta el parcial mas o menos.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Mal trato con los alumnos. 2 Meses sin dar clase. Elimina contenido del campus en momentos cercanos a las evaluaciones. Definitivamente un docente que deja mucho que desear.', '315eeb70-a0e9-49b8-8ee0-9feaa0254970');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'a mitad del cuatrimestre dejó de dar clases, asi que para la parte de grafos estabas por tu cuenta. Sin embargo siempre contesta las dudas por el campus', '315eeb70-a0e9-49b8-8ee0-9feaa0254970');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Fernando Rodolfo Acero es el mejor docente que tiene esta Facultad.', '315eeb70-a0e9-49b8-8ee0-9feaa0254970');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Dios buenas clases pero pocas. Son medio aburridas. En el final, si tenes los conocimientos para aprobar el multiplechoice, y lo aprobas, ya tenes la materia adentro.', '315eeb70-a0e9-49b8-8ee0-9feaa0254970');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'PRIMERO. Si estas leyendo esto, no importa con qué catedra pusiste para cursar, estan todas unificadas. Al final toda la teoría importante recae en ver las clases de Acero.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La falta de respeto y maltrato que maneja este profesor es asquerosa, eviten como puedan cursar esta materia con él. Explica todo suelto, rápido y no deja lugar a hacer consultas, o si no las haces de la forma que él quiere se enoja. A partir de la tercer clase ya estás por tu cuenta aprox. Simplemente mediocre, no entiendo cómo sigue en una facultad como esta.', '315eeb70-a0e9-49b8-8ee0-9feaa0254970');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'subio dos o tres videos de no más de 10 min', 'da1a795e-93e0-4bcc-8ff1-d85480e2a8f2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buena profe', 'da1a795e-93e0-4bcc-8ff1-d85480e2a8f2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'un amor de persona, me cayó bien y sus clases están llevaderas', 'da1a795e-93e0-4bcc-8ff1-d85480e2a8f2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Apenas aparecio. Bastante mala onda.', 'da1a795e-93e0-4bcc-8ff1-d85480e2a8f2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es una profe amable y que explica bien. A veces sentí que se quedaba corta con algunas explicaciones, pero ante todo me ayudó bastante. Haciendo ejercicios de la guia nos ayudaba mucho.', 'da1a795e-93e0-4bcc-8ff1-d85480e2a8f2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'No explica para nada bien.', '7fee1d46-2e5e-467c-bd69-e0c2168cb80d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'nos dejó plantados una de las tres clases que dio junto con la profesora aida.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es una profe muy amable. Tuvimos pocas clases con ella, pero siempre está dispuesta a resolvernos dudas y contarnos la posta de los examenes y demas.', '0d0ae3f5-f60a-4149-9a71-7218234deef9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'el único motivo por el cual muchos no dejamos la materia antes del parcial', '57168f47-f1e9-4f99-88e3-4d571938de22');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Si no fuera por Martin esta materia no la aprueba ni dios.', '57168f47-f1e9-4f99-88e3-4d571938de22');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Excelente profesor, hasta dio clases de consulta para los parciales', '57168f47-f1e9-4f99-88e3-4d571938de22');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Siempre estuvo dispuesto a dar clases extras de consultas y con muy buena predisposición para enseñar lo que no habíamos visto', '57168f47-f1e9-4f99-88e3-4d571938de22');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un capo Martín, tiene videos subidos de todos los temas (ahora mismo hasta la guia 2, la materia tiene 3), es claro y sencillo con los temas explicando. Un personaje, la verdad que disfruté mucho cursar con él.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Salvo el parcial. Hace buenos videos y es piola. Exageradamente pragmatico.', '57168f47-f1e9-4f99-88e3-4d571938de22');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Martin es un gran profesor, amable, divertido y paciente. Él se encarga de explicar mas cosas practicas y de las guias, aunque en la segunda parte de la materia tiene varios videos teóricos de los temas e incluso clases de cuatrimestres pasados. Antes del parcial hicimos un repaso de todo con él. Es un gran profe. Nos despejó muchisimas dudas, se nota que se dedica a lo que hace.', '57168f47-f1e9-4f99-88e3-4d571938de22');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Mantiene un trato pésimo con los alumnos. Le enoja que le hagan preguntas.', '1fd94968-1f03-4f01-963b-21bc5c9d41ea');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Matías y Juan son a mi parecer una excelente dupla. Se notaba que ponían mucho esfuerzo para preparar las clases y siempre tomaban en consideración nuestra situación con la materia para poder seguir adelante o frenar con los temas que más nos costaban. Usaban muchas herramientas y material para explicar, haciendo que todo sea más fácil de digerir. Muy recomendables.', 'b3d7318a-2c7f-4dc5-b406-b8463e7e7508');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Sus clases sirven mucho, buenas practicas en la que repasa lo fundamental de la teoria', 'd04e29ec-fdb9-4e30-81d7-9c6e9f706111');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Si le seguís el ritmo y prestas atención, te das cuenta que te da todo lo que te toman después. Me gustó que intercala teoría y ejercicios. ', 'd04e29ec-fdb9-4e30-81d7-9c6e9f706111');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Sabe una barbaridad y te enseña a pensar como lo requiere la materia. A muchos no les gusta xq es desprolijo en el pizarrón y va rápido. Yo lo sufri al principio pero después me gustó. Para mí la clave es ir predispuesto a prestarle mucha atención, explica mucho y todo muy al detalle, te re enseña a pensar.', 'd04e29ec-fdb9-4e30-81d7-9c6e9f706111');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Hace los ejercicios muy pero muy despacito. Está bueno porque la podés seguir y explica todo pero la lentitud te baja un poco los ánimos y te dan ganas de irte', '6aedb2f3-c352-41aa-9a17-f044c4f35889');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Lucia es muy buena aunque es lenta para explicar las cosas. Siempre está con buena onda.', '6aedb2f3-c352-41aa-9a17-f044c4f35889');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es re dulce, hace muchos ejercicios de la guía y responde todas las dudas.', '6aedb2f3-c352-41aa-9a17-f044c4f35889');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'De las profesoras mas buena onda que tuve. Siempre hace comentarios sobre como Lopez la complica con los ejercicios. Te saca todas las dudas.', '6aedb2f3-c352-41aa-9a17-f044c4f35889');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Muy buena docente, muy amable y responde todas las dudas involucrandolas con la realidad y problemas cotidianos', '6aedb2f3-c352-41aa-9a17-f044c4f35889');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Es muy lindo que lucia de clases, es muy clara explicando y hace todo muy prolijo ya que tiene muy buena letra y resuelve los ejercicios de la guia muy detalladamente, propone ejercicios de parciales y finales claves para poder prepararlos.', '6aedb2f3-c352-41aa-9a17-f044c4f35889');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No recomiendo para nada la cátedra de Boggi. Si bien es una excelente profesora, se adhiere a todos los paros y por falta de tiempo deja temas importantes para que se den en la PRACTICA (temas importantes para la carrera como ecuaciones diferenciales).', '945799bf-f28c-45f7-a5e7-e0b853335348');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buena profesora, siempre adhiere a paros pero suele dar clase publica para no perder la clase.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Explica con muchos ejemplos, es imposible perderse si prestás atención. Se adhiere a los paros y hace clases públicas. Algunos temas me parecieron quedar medios en el aire con las clases que se perdieron. ', '945799bf-f28c-45f7-a5e7-e0b853335348');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Se adhiere a los paros ', '945799bf-f28c-45f7-a5e7-e0b853335348');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Explica muy bien y te hace entender todo, hace llevadera la teórica. El tema de la adhesión a los paros hace que no se llegue con los temas', '945799bf-f28c-45f7-a5e7-e0b853335348');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Una genial profesora virtual, pueden buscarla en youtube como silvina boggi, la verdad que me generaba motivación asistir a sus clases, muy buena explicando todos los temas y responde todo lo que quieras, da las clases por meet y se maneja bastante bien con la tablet, despues sube todo. El campus esta muy bien organizado con videos de como resolver algunos ejercicios de la guia. 5/5 ', '945799bf-f28c-45f7-a5e7-e0b853335348');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Quede muy conforme con su teorica, explica muy bien, no se le escapa nada, no le molesta que le pregunten n veces y ademas me parecio una excelente persona.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Excelente docente, sabe explicar bien todos los temas, si le preguntas algo se asegura de que lo entiendas, super simpatica. Super recomendada', '945799bf-f28c-45f7-a5e7-e0b853335348');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es buena profesora, pero tiene muy desorganizada la materia a tal punto que tuve que ir a otra cátedra para poder estar al día con la materia. deja temas inconclusos o sin explicar con claridad cosa que después esos temas entran en exámenes parciales y finales. si tuviera la materia mas organizada seria una muy buena cátedra. ', '945799bf-f28c-45f7-a5e7-e0b853335348');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buena docente... Admite cuando está despistada y es muy buena onda', '945799bf-f28c-45f7-a5e7-e0b853335348');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Excelente profesora, quiere que entiendas la materia. Y si tiene que repetirte mil veces no tiene problema. Da toda su hora de clase, hay ciertos temas que te hace leerlos de los apuntes de catedra y si no los lees te vas a perder para hacer los ejercicios. ', '945799bf-f28c-45f7-a5e7-e0b853335348');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es la mejor profesora de algebra para entender los temas. Venía viendo clases de grynberg y me pasé a Boggi porque no entendía algunas cosas. Sin embargo, no da la totalidad de los temas de la materia, tenés que mirarte a grynberg para completar eso que falta, pero 100% recomendada porque explica con sus palabras y no con notaciones formales.', '945799bf-f28c-45f7-a5e7-e0b853335348');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'me gusta como explica, puede ser medio desorganizada en el pizarrón pero siempre le pone buena onda y responde cualquier consulta, ya sea personalmente o por mail', '945799bf-f28c-45f7-a5e7-e0b853335348');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'me gusta como explica, puede ser medio desorganizada en el pizarrón pero siempre le pone buena onda y responde cualquier consulta, ya sea personalmente o por mail', '945799bf-f28c-45f7-a5e7-e0b853335348');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Qué profe infravalorada que es Silvina. A veces puede enroscarse un poco pero no se complica con formalismos, es ingenieria así que te baja la materia a tierra y te explica para qué corno sirve lo que te está enseñando, por lo menos en su especialidad (Química). Siempre que le hagas una pregunta te va a contestar con la mejor de las ondas y hace todo lo que puede para que aprueben todos. Una vez adhirió a un paro, y otra vez dio una clase pública que por lo caótica que fue, es como si no la hubiéramos tenido. De todas maneras uno puede apoyarse en el libro de Algebra II que tiene subido al campus y al material que hay en los campus de otros cursos (Grynberg/Vargas). Si te jode lo repletas que están las clases de Vargas hasta el último día, yo creo que es una muy buena opción.', '945799bf-f28c-45f7-a5e7-e0b853335348');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Si preguntas algo y estas equivocado, pareciera que le molestara, no fomenta a preguntar eso. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'Una genia explicando. Siempre hizo ejercicios clave para entender la materia. Lo malo es que llegaba tarde a las clases.', '0c223b26-5113-409a-82fd-41fb0ae9f101');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente profesora. Varias cosas de las que me tomaron en el final las supe hacer gracias a ella, te da todas las herramientas que necesitas y los ejercicios que da en clase se complementan muy bien con los temas dados en la teorica. Muy recomendable', '0c223b26-5113-409a-82fd-41fb0ae9f101');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Responde muy amenudo y es copada', '0c223b26-5113-409a-82fd-41fb0ae9f101');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica excelente. La re entendes, le pone la mejor onda, es re copada, le pone re buena onda. La verdad me re gustó ', '0c223b26-5113-409a-82fd-41fb0ae9f101');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Tremenda profesora, explica muy bien, no dudes en anotarte con ella.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'muy buena, explica bien, sencillo y al grano.', '0c223b26-5113-409a-82fd-41fb0ae9f101');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Yo fui a la practica con ella y dora, es realmente muy buena, te dan ejercicios importantes (literalmente en el ultimo final nos tomaron dos ejercicios que ella dio en la practica como "posibles ejercicios de final", y también, cada vez que me trabe con algo en la guía lo habíamos hecho en clase, sin exagerar) y tienen cero drama en responder consultas, yo muchísimas veces iba a preguntarle cosas y me explicaba lo mas tranqui. Lo único que cabe destacar es que suele llegar tarde a clase y terminan como 20 min antes a veces, pero no van rápido y dan todo lo que tienen que dar, así que la verdad es que hasta venia mejor porque podías salir de la teórica y comprarte un café o algo sin perder clase. En resumen, muy recomendada esta practica', '0c223b26-5113-409a-82fd-41fb0ae9f101');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'cabana es craaackk, re buena onda y se le entiendo todo. Escribe bastante en el pizarron, lo cual en mi opinion es un golazo porque te deja una carpeta de apuntes re completa tanto para el parcial como para el final.', '0c223b26-5113-409a-82fd-41fb0ae9f101');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Una genia. De lo mejorcito.', '0c223b26-5113-409a-82fd-41fb0ae9f101');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Llegaba a las clases tardísimo, explica muy bien pero para dar tan pocos ejercicios no alcanza. Muy buena justificando.', '0c223b26-5113-409a-82fd-41fb0ae9f101');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Esta en las practicas, me gusto su forma de explicar', '0c223b26-5113-409a-82fd-41fb0ae9f101');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es muy buena profesora de la práctica. tiene PDFs armados que tienen una variedad importante de ejercicios hechos parecidos a los de la guía. en una palabra; es muy piola.', '0c223b26-5113-409a-82fd-41fb0ae9f101');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Se adhiere a los paros. Es un buen profesor al responder consultas', 'c1baddd3-f6ad-4dd0-bd26-fa7d666b7a46');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Un desastre..se adhiere a TODOS los paros y encima explica bastante mal, es muy desprolijo en el pizarron y muchas veces se pierde y no puede ni terminar un ejercicio', 'c1baddd3-f6ad-4dd0-bd26-fa7d666b7a46');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Resuelve ejercicios de la guia, no es muy claro y a veces se trababa por algun error', 'c1baddd3-f6ad-4dd0-bd26-fa7d666b7a46');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Las pocas veces que me quede a la práctica, me pareció un señor que explica correcto y tiene buen trato ', 'c1baddd3-f6ad-4dd0-bd26-fa7d666b7a46');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Tiene un muy buen balance con Nora en tanto teórica práctica. Lo único que al ser muy monótona se puede hacer un poco densa la teoría. Pero te suele dar tips importantes y ejemplos que son clave para hacer los ejercicios importantes ', 'ece3dc09-3094-4a76-a05a-c514872d44ed');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'clases un tanto aburridas a veces', 'ece3dc09-3094-4a76-a05a-c514872d44ed');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Excelente profesora, explica clarísimo y es buena onda. Si seguís la materia día a día llegas tranquilo a final. Aprobé la primera vez que me presente. El ritmo de la clase se siente bastante tranquilo pero aún así Cammillieri terminó el programa un par de semanas antes que el resto de los cursos. Ultra recomendada.', 'ece3dc09-3094-4a76-a05a-c514872d44ed');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Excelente profesora, explica muy bien. Es ordenada, se le entiende todo, llega bien con los temas. Aprobé en la primera chance de parcial, y en la primera chance de final. La recomiendo mucho', 'ece3dc09-3094-4a76-a05a-c514872d44ed');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Traía los ejercicios de la práctica hechos de antemano y se sentaba con vos para ayudarte a entender el ejercicio', '100401dd-164d-42ac-9c04-d1a296c92f2f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Vicky es genia. Súper prolija, no sólo para explicar los ejercicios sino que para escribir, lo cual ayuda mucho en materias de mucho número. Siempre se la veía contenta y apasionada, y en todas las preguntas que le hacía me aclaraba las dudas. A los ejercicios extra que llevaban para la práctica, era la que los llevaba resueltos para comparar los resultados, la verdad que un gusto haberla tenido como docente.', '100401dd-164d-42ac-9c04-d1a296c92f2f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es un capó el pelado! ', '5cbbfbff-9999-429c-a61c-186a718924f0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Sabe mucho sobre todo lo que es la esencia del álgebra que es lo geométrico y eso. “El trasfondo”. Se va mucho por las ramas. ', '5cbbfbff-9999-429c-a61c-186a718924f0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Tiene pros y contras, pero para mi los pros fueron mucho más valiosos. Explica muy bien y tiene una visión del álgebra y de la materia muy de entenderla en profundidad. Es lo contrario del profe que hace ejercicios "así a secas", se dedica mucho a indagar para entender las cosas bien. La desventaja de eso es que a veces se va muy por las ramas o le falta más organización por ahí. Pero para mí vale la pena, rescato muchísimo el enfoque para entender las cosas "en serio" y quedarte pensando.', '5cbbfbff-9999-429c-a61c-186a718924f0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buen ayudante Gabriel! Casi siempre se le entendía, mi sugerencia es que no utilice Python en las clases porque muchas veces la explicación se hace más compleja al incluir el código, wolphram alpha hubiera estado bien.', '62b4aa64-6b94-41c3-9d97-9c7e262010db');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'A veces se perdía un poco en las explicaciones', '62b4aa64-6b94-41c3-9d97-9c7e262010db');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Lautaro es un grande, la tiene clarísima. Re simpático y paciente, me respondió cada duda que le pregunté y llegó hasta a explicarme CASI TODO producto interno (unidad 3) en 10 minutos porque me mezclaba. Cada semana llevan (entre él y los otros profes de la práctica de Grynberg) ejercicios extras, que no eran de la guía, que eran re útiles y completos (que chicos de otros cursos me terminaban pidiendo). Un verdadero tipazo.', '62b4aa64-6b94-41c3-9d97-9c7e262010db');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'responde las dudas por discord rapidisimo', '314cb34f-3e6b-4270-8140-fef84bbf6ec9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Buena profesora, explica muy bien y se preocupa en que todos entendamos, atiende cualquier duda de buena manera.', '675c6daa-0a43-4d8b-a236-4946cbe94655');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Buena onda, hace muchos ejercicios que te ayudan a cerrar los temas.', '675c6daa-0a43-4d8b-a236-4946cbe94655');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2014', 'Un mala leche. 1er recuperatorio del parcial, corrigen los de la práctica (Galván), y me dicen "Estás para aprobar pero tenemos que ver si entendiste los conceptos. Le vamos a preguntar a Alvarez". Me tuvieron 1 hora esperando para decirme "Mirá.. No te podemos aprobar porque no estamos seguro si entendiste los conceptos". A lo que le dije que estaba todo justificado, y me contestó "Si, pero eso no demuestra nada"... Patético y una experiencia de mierda, porque encima después me terminaron aprobando en el 2do recu con un parcial peor que ese. Ganas de hacer sufrir gente al pedo que tienen algunos...', '675c6daa-0a43-4d8b-a236-4946cbe94655');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'Los ejercicios que hacía en clase se entendían porque los explicaba de forma lenta y clara. Nunca tuvo drama para responder consultas. ', '2be597f8-545c-4fce-8131-6d05ea868f64');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Me encanta como docente, es super clara y organizada, se queda para consultas y es muy buena al corregir. Es exigente pero te perdona pequeños errores de cuentas y ese tipo de cosas.', '2be597f8-545c-4fce-8131-6d05ea868f64');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Buena profesora para la practica. Explica bien los ejercicios, a buen ritmo y atiende las consultas', '2be597f8-545c-4fce-8131-6d05ea868f64');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'El problema es que la clase de dos horas duraba una y se perdían de dar muchos ejercicios pero explicaba muy bien. Tomaban asistencia al principio de la clase y me iba al curso de Palacios que es una genia. ', '2be597f8-545c-4fce-8131-6d05ea868f64');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Silvina me parecio una gran profesora, tiene mucha paciencia y es muy clara. No tenia problema en explicar las cosas mil veces para que entiendas..va un poco lento pero es muy buena', '2be597f8-545c-4fce-8131-6d05ea868f64');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Excelente profesora de practica.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buena profesora. en las prácticas ya tenia un pdf armado con los ejercicios y no se perdía tiempo en escribir (ya que teníamos 1h de práctica nada más). las veces que dio la práctica fueron buenas sus clases-', '2be597f8-545c-4fce-8131-6d05ea868f64');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Una profe muy dura y explica muy rápido, pero abarca un montón de temas prácticos. Muy completa.', '2be597f8-545c-4fce-8131-6d05ea868f64');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'silvina es súper organizada en el pizarrón y junto a érica rohdenburg son un dúo genial de docentes, proponen ejercicios para hacer que no están en la guía pero sirven muchísimo para los exámenes y nos invitan a pensarlos entre todos, además responden siempre con buena onda y también si tiene que quedarse más tiempo respondiendo consultas lo hace, son lo más las dos!', '2be597f8-545c-4fce-8131-6d05ea868f64');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'silvina es súper organizada en el pizarrón y junto a érica rohdenburg son un dúo genial de docentes, proponen ejercicios para hacer que no están en la guía pero sirven muchísimo para los exámenes y nos invitan a pensarlos entre todos, además responden siempre con buena onda y también si tiene que quedarse más tiempo respondiendo consultas lo hace, son lo más las dos!', '2be597f8-545c-4fce-8131-6d05ea868f64');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Una genia! Explica muy parecido al cbc lo que hace todo más familiar. ', '4e620f9d-7d3b-4eeb-9698-557654f3e9dc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'En esta práctica nos dejaban un tiempo para hacer el ejercicio y después los hacían en el pizarrón. Georgina explicaba muy bien como hacer los ejercicios que veíamos en clase.', '4e620f9d-7d3b-4eeb-9698-557654f3e9dc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Excelente Georgi!! Su explicación me salvó en muchos temas. Se le re entiende y presenta todo de una manera súper natural e intuitiva. Le gusta que los estudiantes participen de la clase y que entiendan. Aparte se pone en el lugar del estudiante y siempre sigue los pasos que permiten resolver los ejercicios con el menor esfuerzo posible. Cuando utiliza geogebra queda clarísimo. A pesar de las acotaciones que Grynberg hacia y cortaban su explicación (muchas veces de forma innecesaria) ella respondía siempre con buena onda', '4e620f9d-7d3b-4eeb-9698-557654f3e9dc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Sin dudas las mejores pácticas de álgebra II', '4e620f9d-7d3b-4eeb-9698-557654f3e9dc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Solo paso a confirmar lo que los demás ya dijeron, Georgina es una de las mejores profesoras de la práctica que tenemos disponible. Súper clara, además tiene terrible buena onda', '4e620f9d-7d3b-4eeb-9698-557654f3e9dc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'muy soberbio, se ria de los alumnos cuando no responden bien , explicaciones vagas y muy rapidas, hace ejercicios de la guia', '8e328919-ba78-4a80-8447-203f706d19b5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'fue la materia que elegí dejar al ver que no me alcanzaba el tiempo y no pasé de la guía 2, así que tomen mi opinión con pinzas
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Las clases muy buenas, también agrega clases de consultas todas las semanas que sirven mucho. En Discord responde siempre y hasta que no quede claro se queda respondiendo las dudas. Explica muy bien', '6206bb6a-dcd9-4191-965b-9390f8cb2ae8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Imposible no aprobar la materia con todo lo que hace por que los alumnos entiendan el tema', '6206bb6a-dcd9-4191-965b-9390f8cb2ae8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Qué decir sobre este profesor. En mi opinión, lo enardecen mucho más de lo que es. Te sirve si sos un genio o si ya la cursaste, si no, probablemente termines la cursada sin haber entendido nada de nada. Por otro lado, debo admitir que es un genio matemático, sin duda debe ser uno de los profesores que más saben en la facultad, pero no sabe transmitirlo, ni bajar los temas a tierra. Además de que usa un lenguaje matemático extra complicado que hace que muchas cosas que explica no se entiendan. Si sos un genio matemático anda con el, si no, busca una opción más accesible. ', '6206bb6a-dcd9-4191-965b-9390f8cb2ae8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un grande Grynberg, las teóricas fueron claras y hacía énfasis en los temas más importantes para resolver los ejercicios, que después veíamos en la práctica (y que se parecían a algunos de la guía). El horario (de las 7 a las 11 de la mañana) hace complicado el ir a las clases, pero creo que realmente valen la pena. Además, en el campus están las clases de los cuatrimestres anteriores, que te pueden ayudar con un tema si no lo terminaste de entender, tiene un discord donde se pueden preguntar dudas sobre ejercicios y todas las semanas había clases de consulta virtuales. Realmente se esfuerza para que los alumnos aprueben la materia.', '6206bb6a-dcd9-4191-965b-9390f8cb2ae8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'lo super recomiendo al curso la verdad que grynberg me parecio un exelente profesor', '6206bb6a-dcd9-4191-965b-9390f8cb2ae8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'El mejor, anotate aca', '6206bb6a-dcd9-4191-965b-9390f8cb2ae8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'No hay dudas de que conoce lo que explica perfectamente y de atrás para adelante. Sin embargo me resultó muy difícil entender el contenido en sus clases, dependiendo en la mayoría de los temas de las recapitulaciones y ejemplos que se hacen en la clase práctica. Los apuntes que escribe y utiliza fueron para mi indescifrables, y al finalmente entender los temas y releer los mismos me pareció que la terminología y escritura que se emplea agrega una complejidad innecesaria. No me pareció buena la forma en la que se estructuraron sus clases, en las que se empleaba la mayor parte del tiempo leyendo estos apuntes. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'En la virtualidad se hacia medio complicado seguirlo porque solo mostraba su pdf y te lo iba leyendo y dando un par de ejemplos. Más allá de eso, es el único profesor que da todos los temas de la materia, sus clases son clave para entender las guías y los exámenes.', '6206bb6a-dcd9-4191-965b-9390f8cb2ae8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Le pone toda la onda para que aprendas, incluso fuera del horario de clase. La teóricas las arma el, incluso te enseña a programar para hacer cálculos algebraicos. Te da clase hasta los feriados(algo bueno o malo según como lo veas), siempre cumple con los recreos y es respetuoso con el tiempo. Particularmente a mí no me pareció un tipo que explique muy bien ya que usa un lenguaje extremadamente matemático pero el hecho que sepa tanto y se dedique completamente a explicarte los temas hace que ese punto se compense. Además apunta  a ejercicios clave buscando que aprendas y puedas aprobar el parcial. Siempre dispuesto a enseñarte.', '6206bb6a-dcd9-4191-965b-9390f8cb2ae8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'se cree que esta en la licenciatura de matemática el judio. Nefasto jefe de departamento. Arruinó todas las materias que tocó con sus guias de ejercicios son lo peor que le pasó a la fiuba, con códigos que solo él se entiende. Da temas que están fuera del programa o los complica al pedo.', '6206bb6a-dcd9-4191-965b-9390f8cb2ae8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Me había anotado con Vargas, por las reseñas, y dejé de anotarme acá porque era a las 7 AM... creo que fue la peor decisión que tomé en mi vida. Salvo algún que otro día, es re simpático pero sobre todo CLARÍSIMO para explicar, y ver gráficamente los ejercicios, pero sobre todo te enseña a RAZONAR y PENSAR, porque te baja a tierra los contenidos. Si te anotas en este curso, te corrige él los parciales y finales, y basta con resolverlos tal y como los resolvió en clase (lo cual es genial, porque escribís las frases como las dijo y va como piña). Organizó 'maratones' para el parcial y final (clases de consultas fuera de horario de cursada que terminaban cuando los alumnos queríamos, una vez fue un sábado como de 9 a 19). Otra ventaja es que como es el jefe de cátedra, te va anticipando qué ejercicios se pueden saltar, o si algún tema no entra, y como tiene presentes los contenidos siempre llegamos con una semana entera sólo para repasar. Fue de los pocos profesores que no se adhirió a un paro. Las únicas críticas: el horario.. a veces empieza incluso tipo 6:50, o sea llegás con la clase apenas empezada. La otra: en virtual (las 4 clases que tuvimos por el cierre temporal de la facultad) fueron bastante plomo y fue lento.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Tenemos al mejor profesor de Álgebra II de la facultad. Si quisiera, el tipo podría tranquilamente darte una clase con muchos teoremas y demostraciones súper exóticos (como hace la mayoría), pero el te deja sus apuntes y todo el material audiovisual de cuatrimestres anteriores para que te entretengas por tu cuenta con las notaciones y otras cosas medio engorrosas de la materia y en las clases presenciales se concentra en que razones la cantidad necesaria de teoremas, demostraciones, propiedades y ejemplos y te vayas habiendo entendido el concepto (y la geometría) de lo que estás haciendo. 10/10', '6206bb6a-dcd9-4191-965b-9390f8cb2ae8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es medio gracioso porq te tira chistes o comentarios random, pero la verdad tambien se nota que sabe una banda de la materia y te explica y te responde todo, tambien a veces de varias formas ', '94535ee5-a9ca-481a-987e-9e43892b2022');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buen docente. Explica hasta el mínimo detalle, lo que a veces confunde, pero al fin y al cabo es enriquecedor. Mantiene un trato agradable y amistoso con los estudiantes. Sabe mucho sobre Álgebra y responde todas las dudas que se te puedan presentar de la mejor manera posible. Aprovechen sus clases para preguntar e hilar fino. Recomiendo que se anoten con él. ', '94535ee5-a9ca-481a-987e-9e43892b2022');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'escribe el procedimiento y como va pensando los ejercicios, eso esta bueno. A veces plantea ejercicios muy teoricos que quizas no siguen la idea de la materia, pero estan buenos porque te surgen dudas sobre los temas. Si te acercas a preguntarle dudas en particular te responde con la mejorrr onda. Un tipazo', '94535ee5-a9ca-481a-987e-9e43892b2022');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Frente al pizarrón es monótono y su explicación no muy clara, las clases se tornaban aburridas pero cuando uno le pregunta individualmente suele responder claramente.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Nunca se usó ni dio su mail que yo recuerde. No se manjean por campus en esta práctica.', '94535ee5-a9ca-481a-987e-9e43892b2022');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'El tipo es un aparato mal, pero eso hace la clase mas llevadera. Siempre tira algun comentario medio bardero. Me pasó que cada vez que explicaba algo o daba ejercicios para hacer, parecía muy teórico y recontra al pedo, pero siempre esas cosas me las terminaron tomando, así que al final sus prácticas fueron muy útiles. Consejo: el tipo mete quinta y arranca a explicar sin parar, si no se entiende nada frenenlo y preguntenle hasta la más minima duda, que siempre va a responder de buena manera y se va a terminar super aprovechando.', '94535ee5-a9ca-481a-987e-9e43892b2022');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'En este cuatrimestre ocurrió que Pustilnik cambio de teóricas y tuvimos a Lopez. La verdad no me arrepiento de eso porque es una excelente profesora, explica muy claro con muchos ejemplos y demostraciones, además al final de la clase le podias consultar lo que quieras', '9f9b58f2-95fd-4666-b3a4-a0a96e7a2c20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Una genia la profe, muy prolija y le mete buen ritmo. Se llega si o si al final. Tiene una onda a Acero, pero más justa con las correcciones.', '9f9b58f2-95fd-4666-b3a4-a0a96e7a2c20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'De las mejores profesoras que tuve en fiuba, muy buena explicsndo, hacia ejemplos bde los temas para que se entendieran mejor y ejercicios de parcial. Muy buenas para responder consultas. Super prolija, escribe chiquito Ben el pizarrón pero se puede leer desde la última fila (comprobado)', '9f9b58f2-95fd-4666-b3a4-a0a96e7a2c20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No deja quedarte con los parciales a diferencia de otras cátedras .', '9f9b58f2-95fd-4666-b3a4-a0a96e7a2c20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Claudia es de las mejores profesoras que tuve en la facultad. Es muy clara explicando, hace buenos ejemplos, te responde todas las dudas y siempre trata de ir al día con la materia, la super recomiendo.', '9f9b58f2-95fd-4666-b3a4-a0a96e7a2c20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Tiene letra chiquita pero si le piden, algo agranda. Es una genia.', '9f9b58f2-95fd-4666-b3a4-a0a96e7a2c20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Copia muy chiquito y va a los pedos... Pero es prolijísima, te demuestra todo y te tira 20 ejemplos de cada tema. Al final del día te deja el cuaderno hecho un libro y con las 4 horas semanales de teórica cursas Álgebra II tranquilo. Además NO adhiere a ningún paro nunca. 10/10', '9f9b58f2-95fd-4666-b3a4-a0a96e7a2c20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Impecable como profesora. El cuaderno de la teoria te quedaba como un libro. Podia ser muy minuciosa enseñando cada detalle de la materia y de a momentos te dormis en la clase, pero llegaba a enseñar todo y lo hacia de buena manera.', '9f9b58f2-95fd-4666-b3a4-a0a96e7a2c20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Sabe mucho, muy teorica. Si te embola la teoria, te duerme.', '9f9b58f2-95fd-4666-b3a4-a0a96e7a2c20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Claudia es una excelente docente, super clara. Entre a su curso con dudas porque vi otras opiniones que decían que no daba clases o que no se le entendía mucho, pero la realidad es que mi experiencia cursando con ella me probó todo lo contrario. Es una docente super atenta a que se entienda lo que explica, escribe todo en el momento que da la clase (lo que hace super llevadero seguirla mientras copias) y es imposible no entenderle. Si no se entiende algo le podes consultar y no va a tener problemas en frenar la clase para volver a donde te perdiste. La materia es pesada, y ella te lo hace saber para que no te duermas, y tiene razón. Es clave seguir la cursada para estar al día y hacer las guías. ', '9f9b58f2-95fd-4666-b3a4-a0a96e7a2c20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Muy buena profesora, explica todo muy claro y va despacio, trata siempre de que el alumno entienda y da muchos ejemplos al respecto, recompiendo mucho su curso porque es un 10 y siempre hay muy lindo ambiente, me atrevo a decir que es mucho mejor que vargas.', '9f9b58f2-95fd-4666-b3a4-a0a96e7a2c20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Va un poco lento a veces pero igual se le re entiende y explica bien. Esta bueno pq te da mas de una opcion para resolver los ejercicios. Lo unico "malo" es eso del ritmo, pero la verdad es insignificante porq los 3 de la practica la rompen ', '7ecef71a-6f4a-44d3-ad89-12b9d32417ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Explica bien pero se hace medio pesado.', '7ecef71a-6f4a-44d3-ad89-12b9d32417ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Muy buena profesora; sus teoricas son claras y ademas resuelve ejercicios para que cada tema quede del todo claro ', 'f4248642-a013-4fbf-b0e9-78d0131217d7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy simpática, siempre con una sonrisa de oreja a oreja en las clases que las hacían mucho más afrontables. Quizás es un poco demasiado "dulce" en su manera de dar las clases, y por eso habla bajo y a veces podes terminar medio adormecido en las clases. Pero en cuanto al nivel de explicación es muy bueno, y la corrección justa tirando a "light". Muy recomendable, sobre todo para senarse al frente y aprender', 'f4248642-a013-4fbf-b0e9-78d0131217d7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy organizada y accesible, en las clases virtuales tiene una pizarra electrónica que suma un montón', 'f4248642-a013-4fbf-b0e9-78d0131217d7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Lo que me gusta de esta profe es que te da una lista de propiedades que podes usar, incluso antes de arrancar con los ejercicios de la guía. No todos hacen eso, es muy útil', 'f4248642-a013-4fbf-b0e9-78d0131217d7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'explica muy bien, entiende perfecto la materia. Recomendación: sientense adelante los va a reconocer.', 'f4248642-a013-4fbf-b0e9-78d0131217d7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Excelente profesora, super amable y dispuesta a contestar dudas tanto en clase como posterior a la misma', 'f4248642-a013-4fbf-b0e9-78d0131217d7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'la queremos♥ Explica bien la verdad me gusto como explica ella, a veces se atrasa con lso temas pero despues retoma bien y llega con los temas. Escribe con pizarra virtual muy bien la verdad, graba las clases y las sube. Si tenes dudas te deja preguntarle bien, a veces capaz te puede responder medio medio, pero asi son todos los profesores xd . Catedra recomendable para gente q le cuesta :)', 'f4248642-a013-4fbf-b0e9-78d0131217d7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Excelente docente,a veces puede resultar un poco chocante su forma de hablar,pero es así,no lo hace apropósito.Súper educada y muuuu prolija...Ordenada,sabe mucho de la materia.La recomiendo.En cuanto a la práctica dentro de todo esta bien...Podrían mejorar.Destaco que hacen muchos ejercicios...', 'f4248642-a013-4fbf-b0e9-78d0131217d7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Ni 1 clase dio', 'bf9d30c3-6851-4ee0-ad77-2c23e05dca04');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Detestable. No cursé con él, pero me corrigió el integrador y con eso me basta y me sobra. Me pareció ridículo el motivo por el que me reprobó, entonces respetuosamente le hablé para debatirlo y prácticamente me dijo que no tenía sentido que él me evalúe si yo lo voy a criticar. Tiene sentido que nadie quiera inscribirse en su curso.', 'bf9d30c3-6851-4ee0-ad77-2c23e05dca04');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Se iba por las ramas en las explicaciones y no terminaba de resolver ningún ejercicio. poco claro en él pizarrón', '9860d939-d5f5-4fec-b106-6db2ea7e5546');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Literalmente el peor profesor que tuve en la facultad. No se le entiende nada, tarda demasiado en corregir, es muy estricto para corregir siendo que explica muy mal. Se adhiere a TODOS los paros que existen y ademas suele reirte de vos cuando le preguntas algo(cabe aclarar que sabe muy poco y muchas veces ni puede contestar) y suele tirar comentarios mala onda por ejemplo "el que recien va por tal ejercicio de la guia que ni se presente al parcial porque va a desaprobar"', '9860d939-d5f5-4fec-b106-6db2ea7e5546');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'En consultas particulares va bien, pero dando clase no es recomendable. Se va por las ramas y a veces no queda del todo claro lo que quiere transmitir.', '9860d939-d5f5-4fec-b106-6db2ea7e5546');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'No se porque en la otra opinion dice que era estricto al corregir si era bastante permisivo, él mismo dijo que otros profesores le dicen que es demasiado bueno. Tampoco se rie de vos cuando le preguntas. Aunque es verdad que no es muy claro explicando y no sabe expresar bien como resolver el ejercicio, muchas veces te terminaba diciendo "yo lo haria asi" como si nunca lo hubiese hecho el ejercicio siendo docente de la materia y no sabe como es la forma ideal de resolverlo para explicarla correctamente.', '9860d939-d5f5-4fec-b106-6db2ea7e5546');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'No lo recomiendo, no recomiendo su practica, no me parece buena persona ', '9860d939-d5f5-4fec-b106-6db2ea7e5546');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Una de las mejores profesoras que tuve en la facultad. Explica muy claro y es muy paciente no tiene problema en responder hasta la pregunta mas tonta las veces que sea necesario para que entiendas. Al ser tan temprano la clase hay poca gente entonces llega a conocerte y esta atenta a que se entienda, incluso nos ha pasado su celular para hacerle dudas por whatsapp que contestaba siempre muy rapido y con muy buena predisosicion. Lamentablemente esta catedra cuando la curse tenia una practica lamentable(calzon-mendietta) haciendo asi que (con todo lo que comente de monica) por mi parte le recomiende a cualquier persona NO anotarse ahi', 'ad9f16a9-16b0-42ed-b985-3d6e9854a6a3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Moni es un amor. Se encargaba de toda la parte práctica, trata a todos re bien y sabe bocha', 'ad9f16a9-16b0-42ed-b985-3d6e9854a6a3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'es buenisima para la practica, hace ejercicios de la guia y de parciales anteriores y va paso por paso asegurandose de que nadie se pierda', 'ad9f16a9-16b0-42ed-b985-3d6e9854a6a3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Genia total', 'ad9f16a9-16b0-42ed-b985-3d6e9854a6a3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Buena vibra, no se si todos tienes esa buena energía a las 7am ', 'ad9f16a9-16b0-42ed-b985-3d6e9854a6a3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Es realmente una genia, totalmente recomendable cursar con ella si queres aprobarla a la primera llevándola al día. ', 'ad9f16a9-16b0-42ed-b985-3d6e9854a6a3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Ella explicaba muy bien, el problema era que llegaba y hacia 40 minutos de consulta y despues tomaba lista 10 minutos, por lo que solo daba un poco mas de una hora de clase. Un sistema bastante malo en mi opinion.', '3ad8ab9e-b5b8-423c-a849-a203e9c27fcd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Empieza 50 minutos tarde porque " da consultas ". Y si bien parece que lo hace en serio por eso, y no para robar tiempo, termina siendo totalmente horrible igual. Igual terminas prefiriendo esos 50 minutos al resto de la clase, porque explica horrible y en voz bajita(si queres escuchar algo, anda corriendo a los primeros 4 bancos. Igual es alpedo, dudo que aprendas mas de dos cosas en todo el cuatri). Y así y todo le da la cara para tomar asistencia (o sea, te tenes que fumar por lo menos una hora y media de esta mina antes de poder irte). Lo que si tiene de bueno es que si le vas a preguntar te responde con masomenos ganas, y masomenos sabe(el ejercicio lo va a hacer y bien, pero que sepa transmitirte conceptos teoricos en el medio no).
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Excelente JTP. Muy ordenada y prolija en el pizarrón, va a una velocidad adecuada y contesta todas las dudas. ', '3ad8ab9e-b5b8-423c-a849-a203e9c27fcd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Explica muy bien, va un poco lento pero se le entiende todo.', '3ad8ab9e-b5b8-423c-a849-a203e9c27fcd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Esta en la practica y es buena explicando', '3ad8ab9e-b5b8-423c-a849-a203e9c27fcd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Excelente en la práctica. Muy clara, explica a un ritmo que se le entiende perfectamente ', '3ad8ab9e-b5b8-423c-a849-a203e9c27fcd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'la practica te deban unos ejercicios para hacer y consultas', 'ca496942-d732-4ba3-93dc-fe44b98f3c12');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'de terror, nightmare', 'ca496942-d732-4ba3-93dc-fe44b98f3c12');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Va recorriendo el aula contestando y ayudándote a razonar las dudas que te vayan surgiendo en clase. Sabe muchísimo y es un tipo bastante macanudo', 'ca496942-d732-4ba3-93dc-fe44b98f3c12');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'A Nora no importa la boludez que le preguntes, te va a responder con todo el amor y paciencia del mundo. Además se nota que le gustan los temasque da porque sabe banda y lo explica todo muy claro (y es super prolija)', 'd89d2986-f12e-4b5e-b194-2bc376a6bf20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Re buena onda, explica muy bien, te da todos los tips, le podes preguntar. Excelente todos los de este curso. Posta me encanto ', 'd89d2986-f12e-4b5e-b194-2bc376a6bf20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Impecable en todos los sentidos. Explica todas las formas posibles de resolver y trata de decirte las cosas importantes que tenés que saber para encarar los ejercicios parciales .', 'd89d2986-f12e-4b5e-b194-2bc376a6bf20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'peralta es aaaltaa docente, se le entiende re bieeen. A todas las clases (literalemente todas) las dio con la mejor onda. ', 'd89d2986-f12e-4b5e-b194-2bc376a6bf20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'es una profesora fenomenal, responde todas las preguntas, sin importar cuan simples sean o que "ya lo tendriamos que saber de antes"', 'd89d2986-f12e-4b5e-b194-2bc376a6bf20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'excelente profesora, no hace ejercicios de la guia , sin embargo lo ej que explica en clase te hacen terminar de comprender el tema ', 'd89d2986-f12e-4b5e-b194-2bc376a6bf20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Excelente profesora. Al principio de cada clase te da una pequeña introducción del tema y te va haciendo ejemplos re boludos para que pises el palito y no te pase en el parcial. Si tenes dudas te tira centros para que pienses vos, y hace participar a todo el mundo.', 'd89d2986-f12e-4b5e-b194-2bc376a6bf20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Nora es lo más, sabe una banda, le re gusta la materia y tiene en claro cuales son los errores más comunes, caes re armado a rendir. La práctica con herrmann y marti es buenisima.', 'd89d2986-f12e-4b5e-b194-2bc376a6bf20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es la profesora de la práctica, es carismática y explica muy bien los ejercicios. No tiene problemas en volver atrás si no quedo algo claro.', 'd89d2986-f12e-4b5e-b194-2bc376a6bf20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es una excelente profesora. Explica bien, y aclara los errores comunes o malas interpretaciones que se suelen hacer sobre los ejercicios. A mi me encantó como profesora. ', 'd89d2986-f12e-4b5e-b194-2bc376a6bf20');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es muy buen ayudante de cátedra. explica bien y quiere darte un panorama general de como encarar los problemas que va a explicar. tuve pocas clases con él ya que tuve que irme a otra cátedra por que estábamos atrasados con la teórica (algunos temas se tuvieron que dar en la práctica y los tuvo que dar él). tiene videos armados de algunos ejercicios muy bien explicados.', 'ee25b261-529d-4bd7-9806-e3ef049076aa');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Jose es un muy buen profe, se turna con Boggi para dar la práctica, el es ayudante en todos lados asi que muchas veces lo que te explica te lo conecta con lo que tal vez ya viste o estás viendo en otra materia, especialmente Física. Siempre contesta todas las preguntas con la mejor de las ondas. Es un poco quisquilloso al corregir (cuando puse que 3 vectores eran L.I en el parcial puso "¿Por qué?"), pero de todas maneras eso no me bajó puntos. Las dos prácticas de Boggi son muy buenas, pero si te da paja cambiarte de aula podés quedarte tranquilo que es una buena práctica. Se ha quedado después de clase contestándome dudas.', 'ee25b261-529d-4bd7-9806-e3ef049076aa');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Habla muy bajo, y si le piden que levante la voz no quiere', '380452fa-dda8-49fa-8655-589c4f9a4f5c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Es buena onda, pero sus clases son tediosas, habla bajito y su letra es demasiado chiquita. Explica bien pero sin ganas.', '380452fa-dda8-49fa-8655-589c4f9a4f5c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Lo banco a muerte! Su forma de explicar me resulto clara y entendí la materia mucho mejor con el que con otros profesores con los que había ido.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Te ridiculiza si te equivocas', '380452fa-dda8-49fa-8655-589c4f9a4f5c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Me recomendaron Prelat porque era "el tipo que hace los parciales...". No lo recomiendo. La práctica con Muszkats es muy buena pero en Álgebra lo que más importa es la teórica y Prelat es simplemente malo.', '380452fa-dda8-49fa-8655-589c4f9a4f5c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Clase aburrida y poco didactica, despues no llega con los temas al final.', '380452fa-dda8-49fa-8655-589c4f9a4f5c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Se nota que sabe muchísimo pero no tiene ganas de dar clases (lo dice el mismo). Habla muy bajito y escribe muy chiquito. Si preguntas responde pero de mala gana.', '380452fa-dda8-49fa-8655-589c4f9a4f5c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'El tipo sabe mucho y se nota, pero tiene un desgano por la vida, da la impresión de que tiene depresión, no lo recomiendo', '380452fa-dda8-49fa-8655-589c4f9a4f5c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es muy teórico, no hace muchas cuentas ni ejercicios. Sabe muchísimo y tiene una personalidad interesante, no diría que es el profesor ingenieril por excelencia, y también se nota su poca predisposición e interés en sus alumnos, pero sus Notas y Comentarios de álgebra son a mi  parecer excelentes y muy interesantes y le sirve al alumno que quiere aprender álgebra de verdad. No lo recomiendo si sos una persona que necesitás que te lleven de la mano para estudiar la materia, lo recomiendo si sos medio autodidacta y querés aprender álgebra lineal con un estilo más a la facultad de Exactas', '380452fa-dda8-49fa-8655-589c4f9a4f5c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Sabe un montón, pero no sabe transmitir lo que sabe, además de ser muy pesada si clase, habla muy bajo y repite constantemente que quiere jubilarse. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Muy desprolijo en el pizarrón. A veces va muy rápido', 'be41add9-6897-4ff7-863b-c07bd3121578');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Buena onda, es medio desprolijo en el pizarron, pero sus explicaciones son claras. Esta bien predispuesto para que le consultes dudas', 'be41add9-6897-4ff7-863b-c07bd3121578');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No hubo clase practica este cuatri, la "practica" era que te respondian dudas por el foro del campus despues de la clase teorica, pero en mi experiencia personal todas las dudas las resolvia con el discord de algebra 2 que hay discuciones sobre todos los ejercicios de la guia, a esta profe la tuve mas que nada en los talleres pre-final/ pre-parcial, responde las cosas bien nada de otro mundo.', 'f0d91fa5-35ca-4c5f-9813-b40c6eb45e0e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'érica es todo lo que está bien, junto a silvina forman alto equipo de docentes, ya la tuve en análisis II en la práctica de acero y me anoté a este curso por ella, y no me arrepiento de nada! además siempre nos da recursos a los alumnos como pdfs y tips para la materia, no tiene problema en repetirte cosas de álgebra del cbc (que uno ya debería saber pero se olvida), las dos son las mejores', 'f0d91fa5-35ca-4c5f-9813-b40c6eb45e0e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'érica es todo lo que está bien, junto a silvina forman alto equipo de docentes, ya la tuve en análisis II en la práctica de acero y me anoté a este curso por ella, y no me arrepiento de nada! además siempre nos da recursos a los alumnos como pdfs y tips para la materia, no tiene problema en repetirte cosas de álgebra del cbc (que uno ya debería saber pero se olvida), las dos son las mejores', 'f0d91fa5-35ca-4c5f-9813-b40c6eb45e0e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy desprolija, tiene poco tacto a la hora de responder consultas , se equivoca en cuenta lo cual ya genera desconfianza a la hora de copiar. Se notaba un ambiente incómodo cuando ella interrumpia a su compañera mientras explicaba . No se adhiere a los paros. ', '5ff05aa4-b95b-43ca-8898-d50a91cba17e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Recomendable, sabe mucho y propone ejercicios clave.', '5ff05aa4-b95b-43ca-8898-d50a91cba17e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Buena profesora de la practica, enseña bien y atiende consultas. Me salvo en un parcial que si lo agarraba Lopez no me aprobaba, asique una genia.', '5ff05aa4-b95b-43ca-8898-d50a91cba17e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Una docente muy buena, parece media mala onda pero es super amable y se te sienta al lado hasta que entiendas lo que no entendes.', '5ff05aa4-b95b-43ca-8898-d50a91cba17e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica bien, pero es medio mala... te grita no sabes xq, la verdad la baja mucho eso ', '5ff05aa4-b95b-43ca-8898-d50a91cba17e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Es excelente, da muy buenos ejemplos y siempre esta al pendiente de sus alumnos, le gusta recibir consultas. durante la clase es un poco desorganizada ya que suele equivocarse pero los ejercicios que plantea siempre sirven para  preparar parciales y finales, maneja un humor muy bueno y divertido.', '5ff05aa4-b95b-43ca-8898-d50a91cba17e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Sarris es una genia y punto.', 'd12c1b06-045e-4fe9-a665-ea890eed7501');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No suele faltar, y si falta deja un reemplazo. Cuando usaba clases como repaso del parcial, las recuperaba dando media hora otros dias. Explica bien y no tiene problema en que le preguntes en clase las cosas, te vuelve a explicar el tema con tal de que entiendas. Nunca se adhirio a paros con tal de no perder clase.', 'd12c1b06-045e-4fe9-a665-ea890eed7501');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Es una genia explicando. Demostró casi todo cuando cursé la materia y lo que no lo hizo por escrito para que le saquemos foto. Es muy organizada y clara. Los ejemplos que hace son geniales para encarar la guía.', 'd12c1b06-045e-4fe9-a665-ea890eed7501');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'A pesar de no ofrecer clases, se la notaba atenta al curso aportado pdfs semanales y autoevaluaciones. Y a su vez todos lso dias de la semana habia 4 horas de consultas por chat. Aunque estuvo bien organizado hubiese estado bueno recibir alguna clase virtual alguna vez', 'd12c1b06-045e-4fe9-a665-ea890eed7501');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buena explicando, y tenia todo organizado para que las clases fueran lo mas completas posibles. Siempre estuvo dispuesta a quedarse mas tiempo a explayar en temas o dar algun repaso si le pediamos. Muy buena profesora', 'd12c1b06-045e-4fe9-a665-ea890eed7501');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es buena docente, da todos los temas en tiempo y forma, lo malo es que lo único que hace es recitar la teorica de memoria. Su clase es un dictado de la teoria, pero si le seguis el ritmo y no te quedas dormido es mejor que leerlo solo en tu casa. Resuelve algunos ejercicios en clase pero en mi opinion son ejemplos demasiado simples, lejos de los que toman en parciales/finales. Ademas, como recita TODA la teoria, pierde mucho tiempo demostrando teoremas.', 'd12c1b06-045e-4fe9-a665-ea890eed7501');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buena profesora. Las clases son claras y completas, y se nota que la tiene clarísima con la materia. Es un poco seria pero por eso también respeta a los alumnos, varias veces le preguntaron boludeces o la interrumpieron y siempre contesto bien predispuesta.', 'd12c1b06-045e-4fe9-a665-ea890eed7501');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Sus explicaciones son claras y demuestra todo lo que se da, a veces puede ir rápido pero siempre muestra buena predisposición cuándo alguien se lo hace notar. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Explica muy bien y llega casi a tiempo con los temas. El unico problema es que algunas veces en los ejemplos se equivoca en problemas tontos como una suma o producto mal hecho.', 'd12c1b06-045e-4fe9-a665-ea890eed7501');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La tengo en cuenta en mis oraciones por haberme aprobado el final teniendo errores en las cuentas.', 'd12c1b06-045e-4fe9-a665-ea890eed7501');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Es muy buena profesora. Siempre llega puntual a las clases y explica todo claramente, con varios ejemplos. Antes del parcial o del final se dedica a resolver ejercicios de parcial/final en clase.', 'd12c1b06-045e-4fe9-a665-ea890eed7501');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Matías y Juan son a mi parecer una excelente dupla. Se notaba que ponían mucho esfuerzo para preparar las clases y siempre tomaban en consideración nuestra situación con la materia para poder seguir adelante o frenar con los temas que más nos costaban. Usaban muchas herramientas y material para explicar, haciendo que todo sea más fácil de digerir. Muy recomendables.', '26f29efa-a65c-4fdd-8423-1e0ffe9ae22f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Hubo algunos temas que no se explicaron con la profundidad necesaria por falta de tiempo. ', '244506fd-766c-41ba-8c09-f13702fd5342');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Pocas veces logre comprender realmente lo que hacia, no es clara en las explicaciones, no la recomiendo', '244506fd-766c-41ba-8c09-f13702fd5342');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'No es muy clara a la hora de resolver ejercios. Muchas veces incluso como que se pierde y te termina dejando el resultado medio tirado. Ademas ya para finales del cuatrimestre directamente copiaba un ejercicio para que lo hagamos y lo resolvia ella una hora despues; ahi dejo de ser rendidor seguir yendo a cursar la practica.', '244506fd-766c-41ba-8c09-f13702fd5342');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'no me encanto, se traba en los ejercicios y cometia errores al explicar un ejercicio, explicaba muy lento para mi gusto, pero era la que mas respondia dudas siempre hasta al final de la clase. ', '5afba522-1e57-4639-a013-ecc95dbb0ec7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buena explicando, cero drama en responder consultas, hacen ejercicios importantes, dio gusto ir a la practica de ella y cabana. De las pocas veces que una practica se sintió realmente útil, capas las dos', '5afba522-1e57-4639-a013-ecc95dbb0ec7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Da la practica, tiene pizarra virtual, es divertido, trata de hacerlo mas dinamico y esta bueno xq deja que le pregunten de todo. Lo bamcamos ♥', '6433c8f2-94ec-4762-8919-1538b619bbdb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Esta mujer es perfecta. Lejos la mejor profesora de la facultad (y probablemente la que tuve en mi vida). Aun no llevandome bien con ella, es imposible no amarla. Lo unico malo es que solamente da esta materia; me anotaria con ella en todas. Cursar con ella es una experiencia que sobrepasa Bariloche, casarse, viajar y ser feliz, y todas esas huevadas.', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buena teorica, le pone onda, va a un buen ritmo y explica exelente.', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Sabe muchísimo de la materia y lo explica de una forma clarísima. Al final de la cursada te deja una carpeta muy completa. Además, valoro que es capaz de mantener constantemente la atención de la clase. Cuando ve que no le dan mucha atención trata de tirar algún chiste o comentario gracioso. Altamente recomendable.', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Gabriela es una de las mejores profesoras que tuve en la facultad, la recomiendo muchisimo', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Excelente docente, muy clara y organizada con los temas. Al final del cuatri tus apuntes teóricos son una pinturita ', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Vargas explica muy bien, te prepara excelente. ABz', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Odio la materia, pero realmente esta profesora es increíble. Explica muy bien y tiene todas sus clases muy preparadas. Esta muy predispuesta a enseñar y a que todos entiendan. Todas las dudas que tengas la va a responder siempre. Como no llegábamos con las clases puso CLASES EXTRAS para que lleguemos con los temas, esta actitud de responsabilidad hacia la enseñanza solo la había encontrado en Maulhardt. Además, después de terminar la cursada puso clases de consulta antes de cada final. Simplemente una genia.', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Una genia, siempre explica todo muy claro y le pone buena onda a las clases.', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Copada y te dice las cosas claritas, debería fomentar mas la participación en clase y talvez ser mas grafica al dar la materia ya que álgebra es bastante abstracta', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'es exelente profesa, sus clases entretenidas, 10/10, creo que el detalle es que tuvimos ir varias veces mas temprano que el horario para acabar los contenidos', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Hace que de gusto ir a clase, explica realmente bien y baja las cosas a tierra con ejemplos y una forma de dar los temas que puede entender cualquiera, te da algebra en criollo, pero nunca perdiendo el formalismo matematico. Cabe destacar que, en mi opinion, la primera parte de la materia fue impresionante como la dio, pero ya la segunda cuando llegamos a guia 5 y 6 hay algunas cosas que no dio y se toman (los ejercicios de transformar la esfera unitaria y de formas cuadraticas el ultimo ejercicio). No es lo mas grave del mundo, tranquilamente esto lo podes ver del mancilla y a lo sumo te toma una tarde, pero me parecio que valia la pena mencionarlo. Indistinto de eso no use ningun libro para la materia, exclusivamente sus clases y el material provisto por la catedra, y pude aprobar el final recontra tranquilo. Genia vargas', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'Buena teórica, explica dentro de todo bien. Recomendable.', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'Vargas es una GENIA. Da lo justo y necesario, y te morís de la risa porque la mina es un personaje.', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Da muy buenas clases teóricas de la materia, con ejemplificaciones', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Muy buena explicando. A veces no llega con las clases porque se adhiere a paros, pero trata de compensarlo sumándole media hora más a la clase (nos hacía ir más temprano). Pero te podés quedar tranquilo de que llega con los temas, y te enseña todo todo.', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Excelentes teoricas, con humor y buena onda siempre.', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Super copada para dar las clases, explica muy bien aunque al menos en el cuatri que lo curse se atrasaba un poco con los temas y terminaba dando las clases a los "chapazos". Aun asi no deja de ser recomendable.', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Vargas es un excelente profesora, es muy clara y llega con todos los temas. No le faltan demostraciones.', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Vargas es una profesora excelente la mejor lejos, era el mejor curso presencial y lo sigue siendo ahora que es virtual, lo unico malo que te tengo para decir es que probablemente no te lleges a inscribir en su alguno de sus cursos tiene 2 (a menos que tengas una excelente prioridad) ya que el curso se vende como pan caliente y no es por menos ya que es el mejor, si llegas con tu prioridad no dudes en anotarte con ella.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Ídola, va rápido pero eso hace que la clase sea corta y super llevadera. Es graciosa y explica bien.', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'empecé con ella cuando iba por la segunda unidad de la materia (por que me fui de mi curso ya que estábamos atrasados) y me arrepiento de no haber comenzado totalmente de 0 con ella. Vargas, que ser del bien es esta mujer. tiene las clases muy bien organizadas con PDFs armados que valen la pena tenerlos en físico ya que son muy buenos y te salvan más de una vez para los finales. Todas las opiniones y referencias de ella son ciertas. es una mujer que le pone toda la voluntad para que aprendas la materia. esta recomendada 100%', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica muy claro y no tiene problemas en volver hacia atrás y repetir o hasta dar ejemplos si se lo pedís.', '5e3673bb-b406-4a50-9a0d-a1092044c7c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Explica muuuy lento, no se le entiende mucho, esta bien predispuesto a responder consultas pero casi nunca me sirvio su respuesta', 'c9530cba-1b41-4589-917e-fc17e9d11a98');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'al principio sus clases son más aburridas o difíciles de seguir pero explica bien los ejercicios y los resuelve de forma muy metódica.', 'c9530cba-1b41-4589-917e-fc17e9d11a98');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Excelente docente, súper predispuesto a enseñar con la mejor onda. Se nota que sabe de la materia y le gusta.', 'c9530cba-1b41-4589-917e-fc17e9d11a98');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Gran profesora Lucía, explica de manera didáctica y organizada', '1e6b6dde-d1df-4063-9afa-feb774324b07');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Se le entiende todo, es muy claro explicando.', '3402c86c-bd39-44ca-8fc6-efdbf5b6456e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Gran profesor, va muy rapido en con los temas pero se le entiende todo muy claro. Si llevas al fia la materia es una excelente catedra para cursar.', '3402c86c-bd39-44ca-8fc6-efdbf5b6456e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Es buena onda pero siento que si no iba a sus clases aprobaba igual la materia. No puedo comparar con otras teóricas de esta materia porque solo asistí a esta (Tengo entendido que es de lo mejorcito Baliña) pero no le saque jugo al tiempo en su clase.', '3402c86c-bd39-44ca-8fc6-efdbf5b6456e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Bastante desprolijo y en clase lo único que haces es copiar, pero llegas a tu casa, revisas tus apuntes y te das cuenta que todo tiene sentido. Lo super recomiendo.', '3402c86c-bd39-44ca-8fc6-efdbf5b6456e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No tuvimos una sola clase teórica en todo el cuatrimestre, ni siquiera le conozco la cara a Baliña.', '3402c86c-bd39-44ca-8fc6-efdbf5b6456e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Nunca apareció este 1C 2020', '3402c86c-bd39-44ca-8fc6-efdbf5b6456e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es muy simpático y gracioso a la hora de explicar. Va bastante rápido, las clases teóricas deberían durar 2 hs y duran 1 de lo rápido que explica. Podría aprovecharse un poco mas el tiempo correspondiente y hacer mas ejemplos ', '3402c86c-bd39-44ca-8fc6-efdbf5b6456e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Muy buen profesor, te deja la carpeta muy completa. Lo unico que va muy rapido y es medio desorganizado.', '3402c86c-bd39-44ca-8fc6-efdbf5b6456e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente docente', 'a802365e-b20e-44af-b250-d384ee324669');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Excelente docente. Además de ser muy copado es super atento con sus alumnos. Llega muy bien con los temas (sobran días para practicar parciales y finales en clase) porque va rápido. No tiene problema en que consultes temas de unidades anteriores porque sabe que nos atrasamos. Contesta mails/campus. ', 'a802365e-b20e-44af-b250-d384ee324669');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Genio, muy copado, super didáctico, la rompe el chabon. Explica bien y sabe hablarle a los alumnos de una forma que se entiende. Te da tiempo para hacer los ejercicios y luego los hace el explicando en detalle cada cosa.', 'a802365e-b20e-44af-b250-d384ee324669');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Las clases son básicamente que te da ejercicios para hacer, te da 15-20 min, lo revisan, te da otro y así ', 'a802365e-b20e-44af-b250-d384ee324669');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Las clases son presenciales. La primera media hora mandaba uno o dos ejercicios por el grupo de telegram para resolver individualmente, y después arrancaba la teórica. La clase avanza medio rápido pero en el campus sube el apunte que usa, y eso ayuda a seguir la clase.', 'a802365e-b20e-44af-b250-d384ee324669');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Tiene una enorme predisposición para responder consultas(responde rápido en el campus y siempre da una hora de consultas antes de las clases) pero para explicar no es el mejor. Se nota que los temas los sabe muy bien, explica las cosas como si fuesen obvias asumiendo que todos entienden y avanza demasiado rápido', 'a802365e-b20e-44af-b250-d384ee324669');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Aguante Bello', 'a802365e-b20e-44af-b250-d384ee324669');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Un crack total, es organizado, explica muy bien, llega perfecto con los temas, antes de los parciales hace clases estilo taller en los que trae parciales viejos y recomienda que resolvamos algunos ejercicios. De lo mejor que hay en esta facultad.', 'a802365e-b20e-44af-b250-d384ee324669');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Crack..... fachero y muy buena onda', 'a802365e-b20e-44af-b250-d384ee324669');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Ignacio 10 puntos. Pero OJO, en la hora de su clase solo se dedica a darte ejercicios y vos tenes que laburar.. y pasado determinado tiempo, ahí lo resuelven entre todos en la pizarra-virtual. Es clave que todos participen, si no se vuelve aburridísima la clase. Quizás es un embole la modalidad porque no llegas a estar al día y te cae un ejercicio que es re "wtf"... pero preguntá, participá: las clases de bello se trata de participar, preguntar hasta que te salga y te tire centros para resolverlo. Nunca te va a explicar tema teórico o algo asi (no fue caso en 2C2020; solo a lo sumo te daba un super resumen apenas empieza la clase, y ahí a laburarrrrrr!!!)', 'a802365e-b20e-44af-b250-d384ee324669');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Excelente profe. Explica muy claro y da su parte de la clase tipo taller lo cual sirve para ver si se entendió la parte teorica', 'a802365e-b20e-44af-b250-d384ee324669');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La clase con Ignacio es toda práctica, da ejercicios y un tiempo para que los haga cada uno por su cuenta, en el medio va tirando alguna ayuda o corroborando resultados. Sus clases sirven mucho para saber qué tanto uno entendió', 'a802365e-b20e-44af-b250-d384ee324669');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Se queda a explicar hasta que entiendas', '560bd79b-d38a-4679-a23a-69fdb153ac1e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No responde dudas por campus pero va 1 hora antes todos los miercoles para responder dudas', '42b1a15c-3ae5-4f9d-85ae-e153806177e6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es muy buena docente! Súper dedicada y sabe. Da clases de consulta extra y responde rápido por el campus', '42b1a15c-3ae5-4f9d-85ae-e153806177e6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Otra genia más. Responde todo lo que consultes por el campus.', '42b1a15c-3ae5-4f9d-85ae-e153806177e6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy desorganizada y para mi gusto no es clara para explicar, siempre busca el camino más rápido, pero no es el que la mayoría de los alumnos entienden. A mi gusto le hace falta explicar paso a paso lo que hace, y no hacer 500 pasos y dejar a muchísimos alumnos colgados.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un amor. Lo único, siempre repregunta así que si vas con dudas que sean previamente pensadas en tu cabeza!!!', '42b1a15c-3ae5-4f9d-85ae-e153806177e6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2018', 'Ella va muy rapido y da por sentado que sabemos un monton de cosas que se dieron solo unos minutos antes en la teorica, es algo desorganizada a mi gusto', '42b1a15c-3ae5-4f9d-85ae-e153806177e6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Gran ayudante, se preocupa mucho por que entiendas cuando le haces consultas. Buena persona y explica muy bien. La unica desventaja es que es bastante desprolija en el pizarron.', '42b1a15c-3ae5-4f9d-85ae-e153806177e6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Magui es buena profe, un poco aburridas sus clases. Cuidado en los parcialitos no perdona una (apreciacion personal).', '42b1a15c-3ae5-4f9d-85ae-e153806177e6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es medio chanta', '5f1e2a08-7320-40f8-8cd8-aa4676dbbb8e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'De los mejores profesores.', '5f1e2a08-7320-40f8-8cd8-aa4676dbbb8e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'A diferencia de mucha gente Comas no me pareció para tanto. De entrada presentó la materia como si fuese la más complicada de la carrera y todo lo contrario. Yendo a las maratones me dí cuánta que otros profesores como Jemina García te la explciaban mucho más fácil, bajada a tierra. Comas se la complicaba demás', '5f1e2a08-7320-40f8-8cd8-aa4676dbbb8e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy buen profesor, recomiendo fuertemente este curso.', '5f1e2a08-7320-40f8-8cd8-aa4676dbbb8e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Buen profesor, durante este cuatrimestre virtual tuvo una suerte de clases de consulta, en las que repasaba ejercicios de la guia y otros y atendia consulta, siempre muy claro.', '5f1e2a08-7320-40f8-8cd8-aa4676dbbb8e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Excelente profesor. Sus clases son muy completas y tiene muy buen trato y relación con los alumnos. ', '5f1e2a08-7320-40f8-8cd8-aa4676dbbb8e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Un capo, explica super claro, responde consultas y no tiene drama a la hora de aceptar criticas. Se adapto bien al cuatri virtual.', '5f1e2a08-7320-40f8-8cd8-aa4676dbbb8e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'excelente profesor, responde mil 1 una vez si hace falta, siempre con la mejor. Sabe un monton y lo transmite muy bien. Graba las clases lo cual suma un monton.', '5f1e2a08-7320-40f8-8cd8-aa4676dbbb8e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es un genio!! Se nota que le gusta lo hace. Siempre esta haciendo chistes y comentarios divertidos que hacen mucho mas llevadera la clase y hace que todo parezca super fácil. Te explica la cantidad de veces que sea necesarias y se queda después de la clase respondiendo dudas, incluso pone algunos horarios fuera de clase para hacer dudas cerca de los exámenes', '5f1e2a08-7320-40f8-8cd8-aa4676dbbb8e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'La tecla está acá. Vayan a las clases, son medio embole pero tienen que hacer que Comas los reconozca. Se ven todos los videos de Jemina y los ejs también. Van al parcial tuki, preguntan todo lo que no sepan absolutamente TODO. Aprueban. Final, haganse todos los finales de la cátedra. Van al final TUKI preguntan todo de nuevo. y la meten. En general, Comas explica muy resumido y a veces te dan mucha paja de ir especialmente los jueves que son 4 horas.', '5f1e2a08-7320-40f8-8cd8-aa4676dbbb8e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Jorge es lo mas, explica clarisimo y sus clases son entretenidas. Se involucra con sus alumnos y trata de acordarse los nombres y asegurarse de que entiendan, un genio. Si podes anotate con el, ni lo dudes', '5f1e2a08-7320-40f8-8cd8-aa4676dbbb8e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'lo amo, explica muy bien y se nota que le encanta dar clase', '5f1e2a08-7320-40f8-8cd8-aa4676dbbb8e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'crack, vayan con él y participen en clase que si te conoce te da una mano', '5f1e2a08-7320-40f8-8cd8-aa4676dbbb8e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Comas es un gran profesor. Explica la teoría ahondando en los temas que mas suelen complicar a los alumnos. Además hace muchos ejercicios que no están en las guías (pueden llegar a aparecer en parciales y finales) y agrega muchas clases de consulta antes de los parciales y finales. Tiene un trato muy distendido y no pierde tiempo para hacer chistes con los alumnos. Gran profesor.', '5f1e2a08-7320-40f8-8cd8-aa4676dbbb8e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Gran profesor, da buenas teoricas, tira la posta de cada tema y te distiende las clases haciendo chistes. Repite de ser necesario, y si te conoce, te ayuda un poco en el parcial/final. Se queda despues de algunas clases a contestar consultas de las guias (si podes ir, son clave) y hace clases antes del parcial y tira algun centro de lo que pueden tomar.', '5f1e2a08-7320-40f8-8cd8-aa4676dbbb8e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Crack total. Hace una materia pesada muy llevadera, explica bien y después de cada clase está muy dispuesto a quedarse el tiempo necesario respondiendo dudas. ', '5f1e2a08-7320-40f8-8cd8-aa4676dbbb8e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Un fenómeno. De sus clases salia entendiendo todo, la hace muy llevadera.  De las mejores clases practicas que tuve el gusto de asistir', '67288d2e-ffa2-45f7-b5f2-dc7d19178899');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Un genio Pedro muy buena onda y explica muy bien', '67288d2e-ffa2-45f7-b5f2-dc7d19178899');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Pedro explica muy bien y es muy divertido. En la parte de R se lució, la verdad.  ', '67288d2e-ffa2-45f7-b5f2-dc7d19178899');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy didáctico y divertido. ', '67288d2e-ffa2-45f7-b5f2-dc7d19178899');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'La verdad que me daba ganas de levantarme a cursar. Pedro, Roberta y Bruno le ponian toda la onda a las clases y buscaban que entiendas todo. Disfuté mucho la cursada y aparte de eso, contestaban todo lo que sea necesario ya sea por el campus o por mail. ', '67288d2e-ffa2-45f7-b5f2-dc7d19178899');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy buena onda y claro en sus explicaciones. Hace la clase muy dinámica y hasta divertida a veces. No tiene problema en explicar varias veces un ejercicio o concepto si no se entendió.', '67288d2e-ffa2-45f7-b5f2-dc7d19178899');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Pedro es excelente y tiene mucha onda para dar clases, da unas prácticas clarísimas resolviendo los ejercicios más completos de la guía, se le entiende muy bien y no tiene drama en volver atrás. Las clases que dio de R estuvieron buenísimas, es un genio verdaderamente.', '67288d2e-ffa2-45f7-b5f2-dc7d19178899');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Genio total', '67288d2e-ffa2-45f7-b5f2-dc7d19178899');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Pedro es un crack, no solo sabe una banda y te explica todo 10 puntos sino que además le mete mucha onda a la clase y la hace re llevadera. La joya del curso.', '67288d2e-ffa2-45f7-b5f2-dc7d19178899');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Un crack. Con él se hace llevadera la práctica, explica todos los temas siempre desde lo básico y hace la clase muy dinámica.', '67288d2e-ffa2-45f7-b5f2-dc7d19178899');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'No aparece mucho durante las clases, pero en el recreo agarralo que te contesta todas las dudas que tengas', '890ce41d-4fae-4369-873b-1be454bdca18');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Apareció dos veces a dar clases, su función principal es corregir los parcialitos y los jueves también esta en las consultas personalizadas.', 'f196c372-8ea0-4fd2-bc7d-82aa11e2882c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'No aparecio mucho pero muy buen profesor. Explica con claridad.', 'f196c372-8ea0-4fd2-bc7d-82aa11e2882c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Diego es un profe que explica todo tranquilo, puede estar mil horas explicándote un ejercicio.', 'f196c372-8ea0-4fd2-bc7d-82aa11e2882c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Excelente profesor.', '75c80e3c-4bf2-4b6a-90ce-310e3fd919bf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un genio Martín. Se nota que sabe y te responde cualquier tipo de duda. Un poco exigente con la corrección del parcial y recuperatorios.', '75c80e3c-4bf2-4b6a-90ce-310e3fd919bf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Una genia total, responde a todos los emails, y siempre esta presente. ', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Genia total', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es una genia', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente docente, muy clara explicando y siempre predispuesta a contestar consultas en todo momento.', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Crack total', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Genia', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Hace llevar la clase muy llevadera, es una genia.', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente docente. Muy dedicada a su trabajo, se nota que sabe lo que hace. Siempre responde dudas y siempre con buena onda.', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No hay mejor profesor en la facultad que jemina', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Una genia total. Si tenés la oportunidad de cursar con ella, no hay nadie mejor.', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No fue lo que esperaba, se nota que Jemina es una gran docente que le dedica mucho. Pero en mi caso esperaba mejores explicaciones. Es una buena docente, pero no más que eso. Creo que empieza explicando las primeras unidades bien, y después asume que ya sabés todo y considero que está mal. ', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Jemina super buena onda, subia las teóricas y siempre super completas y llevaderas, excelente profesora', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Jemina es una de las mejores profesoras que tiene la FIUBA. ', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Excelente', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Jemi es lo más. Se esfuerza mucho por hacer que entiendas y te ayuda en lo que necesites. No da muchas clases teóricas porque está todo en unos videos que hizo ella durante la pandemia, entonces hay que ver los videos para cada clase.', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Jemina es una de las mejores docentes que tuve. Super dedicada, amable y paciente. Nunca la vas a ver retando a nadie. Sus clases son solo prácticas ya que la teoría te la da en videos que tiene preparados para cada tema. Osea, en su curso las horas que figuran en el SIU son TODAS de práctica de ejercicios. Si seguis la materia al dia y vas a todas las clases realmente no es necesario estudiar mucho. Es una materia muy pesada, pero si le dedicas el tiempo que se merece se aprueba de taquito.', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El curso 29 es buenisimo. Jemina es una genia, explica muy bien, siempre esta atenta a que se entienda todo sin importar cuantas veces preguntes. Metio algunas clases virtuales cosa que estuvo bueno para ahorrar viaje, recomendadisimo. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Muy buena docente. Explica con claridad y se preocupa por el aprendizaje de sus alumnos.', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Crack, la n° 1 de Proba. La tiene re clara, es re copada y te responde dudas en horas de apoyo y por mail. Le pone toda la onda y es re pila. En algún futuro va a tener su propia cátedra como titular', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es muy organizada en su forma de dar la materia y explica muy bien. Ademas, es muy buena persona y se nota que le apasiona la materia. De las mejores profes que tuve', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Jemi es una gran docente, se nota que sabe un monton. Las clases se pasaban rapido y trataba de que participemos en clase. Despues en clase se resuelven ejercicios de parciales o finales de cuatris anteriores, no te lo dice pero después practicando para finales te das cuenta, decis: "ah que loco esto lo tengo en la carpeta". ', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Jemina es de las mejores profesoras de la facultad. Es muy parecida su manera de dar la materia con la de grynberg. A veces se va por las ramas, pero es muuy buena profesora y persona.10/10', 'd236a7a6-d94c-4286-8d03-86e4f7891d41');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Me la vendieron como LA MEJOR DOCENTE pero al final no me pareció tanto, tal vez haya sido la virtualidad, pero sus explicaciones en los videos me parecieron muy teoricas, y hubo varios conceptos que no pude terminar de entender.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Buen profe aunque la teórica la intentaba dar rápido (insistía con ver los videos de Jemina) se nota que le gusta la materia. A veces se me hacia difícil seguirlo, pero siempre era abierto y respondía cualquier duda.', '5d0fd208-6793-4488-8b9b-adcbe3f96a31');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'un capo explica muy bien ', 'e0c85e6d-689d-496d-9db5-b2b97ad6fda7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Sabe todos los temas y se nota que le gusta la materia, sin embargo en la parte de estadística me mareaban un  poco sus explicaciones', 'e0c85e6d-689d-496d-9db5-b2b97ad6fda7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Santiago es EXCELENTE. Entiende todo con mucha profundidad y te contesta cualquier duda, a pesar de que sea una boludez. Lo único es bastante distraído, pero esto no afecta a la calidad de enseñanza que da.', 'e0c85e6d-689d-496d-9db5-b2b97ad6fda7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Se pierde demasiado en las cuentas y la notación y eso hace que no te ayude a ver la materia desde la perspectiva que se necesita para aprobar el final, al final de un ejercicio terminás más confundido/a que antes de intentar resolverlo. A veces trata de excederse mucho del horario de clase mostrando diferentes formas, generalmente engorrosas, de hacer un mismo ejercicio. ', 'e0c85e6d-689d-496d-9db5-b2b97ad6fda7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Santiago es un genio. Se ha quedado en las practicas despues de hora para contestar dudas. Me ayudo a hacer muchos ejercicios y contesto siempre mis consultas razonando conmigo para hacerme comprender todo. Cuando da clase prioriza hacer pocos ejercicios y que se entiendan perfecto antes que hacer muchos ejercicios. Da tambien distintas formas de hacer un mismo ejercicios lo cual sirve bastante. Es muuuy prolijo tanto con su letra como con la notacion, siempre impecable (aunque a veces divagaba explicandonos el por que de la notacion). Siempre explica la forma de resolver los ejercicios de una manera muy formal. ', 'e0c85e6d-689d-496d-9db5-b2b97ad6fda7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Santi un capo, se nota que sabe muchisimo y te muestra muchas formas distintas de hacer los ejercicios, algunas mas rebuscadas que otras. Se pone a filosofar en medio de la clase y lo relaciona con la materia, casi siempre llegaba unos 15 minutos tarde cuando le tocaba dar clase a el, sin embargo da buenas explicaciones y hace buenos ejemplos', 'e0c85e6d-689d-496d-9db5-b2b97ad6fda7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'El peor de la materia', '73a550b6-b324-4a54-bf4f-6aa8b8fe2bd3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Se pierde durante las clases. Siempre llega tarde', '73a550b6-b324-4a54-bf4f-6aa8b8fe2bd3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es un buen docente, es re buena onda. Da la materia desde cero y no se engancha mucho en las demostraciones de las formulas, va directamente al planteo correspondiente de probabilidad y estadistica (para mi eso esta bueno). De vez en cuando es un poco desorganizado o no es muy claro, pero el se da cuenta al toque y busca otra forma de explicar el tema. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Me salvó la vida. En la virtualidad fue el único que daba clases, todas grabadas. Uno puede o entender en la clase, o reverlas tranquilo, pero terminás entendiendo. Contrario a lo que muchos piensan, yo no lo noté que hable rápido, hay que saber bien qué es lo importante cuando habla.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Suuperrr claro en lo que explica dio  clase de manera sincrónica. Ademas tiene sus propias diapositivas con la teoria y los ejemplos de cada tema.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Clases monótonas, habla muy bajo, se enoja si le pedís que agrande la letra. Llevar audífonos y binoculares', '61a58428-c3cc-485c-9a13-73559d6b2bbb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Profe polémico, siempre tiene problemas con el Zoom y manda un link nada que ver por lo que el 50 % de las clases empezó tarde.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'David es un poco más desprolijo para explicar, pero también es muy accesible para preguntarle.', 'c1661bfd-9885-4c59-ae80-a36cf85f7a66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'David es muy bueno tamien. Daba la practica junto con Santiago. Mucho menos formal que Santiago en cuanto a la resolucion de problemas, mas ingenieril, mas practico digamos. Es un toque desprolijo pero no jode y siempre muy receptivo para contestar las dudas que surgen. Tambien se notaba que en la parte de estadistica estaba mas comodo que Santiago y que Roberta', 'c1661bfd-9885-4c59-ae80-a36cf85f7a66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'La clave del éxito. Un capo, un fenómeno, a veces ponía música antes de arrancar la clase para ponerle onda. Explica suuuuper claro, es super conciso, te hace pensar. Si necesitas metes meet mano a mano con el y le haces consulta. La verdad que 10 puntos, de lo mejor que me cruce en la facultad. Me saco el sombrero', 'f7a65abf-af67-4d29-93ae-fe47d27f7591');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un capo Fer, se preocupa porque entiendas bien todos los temas.', 'f7a65abf-af67-4d29-93ae-fe47d27f7591');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Fer es un genio pero se nota que no la tiene tan clara. A veces le preguntas algún ejercicio(o mismo cuando los hace en el pizarrón)  y lo tiene que pensar demasiado o empieza a plantearlo y después se da cuenta que lo que planteó está mal y eso te puede confundir bastante', 'f7a65abf-af67-4d29-93ae-fe47d27f7591');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'es buena onda, y responde siempre con la mejor. Una "critica" seria que no resuelve los ejercicios en su totalidad, deja las ecuaciones planteadas. Por otro lado, estoy seguro que si le pedíamos que los resuelva completamente ella no tenia problemas... haciendola corta, mendiburu es buena profe', 'c0474ddb-d47e-4e74-bd34-a680b549b9e1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Paso muy por arriba el 4.14', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es muy buena mina, muy justa corrigiendo, pero en las clases es hiper acelerada, cuesta seguirle el ritmo. En la práctica con Comas si vale la pena haciendo ejercicios', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Excelente docente. ', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Estaba en las clases con comas y se turnaban para explicar, tambien muy clara y muy paciente con las consultas y demas.', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Gran profesora, tiene sus cosas pero te saca bueno seguro', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Nelly es excelente, súper prolija y metódica. ', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Nelly una profe macanuda :)))))))))))))) genia. ', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Nelly una profe macanuda :)))))))))))))) genia. ', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Macanuda, se adapto bien a la virtualidad. La tuve en el curso como segunda de Comas y explica muy bien.', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'EXCELENTE!!!', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'muy buena profesora, explica muy bien y tiene muy buena onda todo el tiempo.', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Vuelve a explicar los temas que se ven en los videos teóricos para dejarlo más claro. Resuelve ejercicios modelo para poder hacer las Guias', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Es exigente corrigiendo pero para los recus afloja. La quiero. ', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Resolvia ejercicios y siempre lo hacia de la manera mas practica posible, yendo al punto y sin dar muchas vueltas al pedo. Se le entiende joya y a veces tira algunos truquitos para algunos ejercicios', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Algunos días le entendes perfecto y algunas clases va tan rapido que no la seguís. Es bastante estricta corrigiendo pero está bien porque te prepara para el final', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Conoce demasiado los temas de la materia y plasma todo esto resolviendo ejercicios. Es bastante estricta a la hora de los procedimientos de resolución y para corregir examenes.', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Sabe mucho, pero algunos dias sus explicaciones son un poco desordenadas. Asi todo, se le entiende bien. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Nelly se encarga de hacer algunos ejercicios durante las clases. Es muy clara y buen trato ante las dudas. ', 'd4797888-2047-4de7-ac2d-5a3a3e6432a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Yo estaba muy atrasada con la materia así que no entendía mucho los ejercicios pero copiaba todo lo que decía.  Cuando tuve que preparar el final los ejercicios resueltos por él fueron los que más completos y mejor justificados tenía. ', '30bc72f5-4c21-467c-bddf-c7d46eaac0f8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy bueno puebla, le falta ser un poco ordenado y mejorar su letra. Por lo menos en el cuatrimestre que la cursé yo.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un crack como siempre, super buena onda y se entiende todo lo que explica, al igual que Verá, te hace un resumen teórico rapidito y después full ejercicios ', '30bc72f5-4c21-467c-bddf-c7d46eaac0f8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un crack, no solo explica clarísimo si no que cuenta chistes y anécdotas muy divertidas, es imposible que te aburras en su clase. A veces tira algunos ejercicios medio peculiares pero ayudan a afinar conceptos teóricos.', '30bc72f5-4c21-467c-bddf-c7d46eaac0f8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Clases divertidas. Tira chistes. Le da un contexto real a todo lo que enseña. Es muy didáctico. ', '30bc72f5-4c21-467c-bddf-c7d46eaac0f8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Manuel es un genio. Explica muy bien. Escribe todo muy ordenado quedando todo explicado detalladamente en tu carpeta, después lo lees y volves a entender todo.', '30bc72f5-4c21-467c-bddf-c7d46eaac0f8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Profesor medio fantasma, fue muy pocas veces pero las veces que fue...impecable. Explica demasiado bien, debería estar mas presente en las prácticas', '30bc72f5-4c21-467c-bddf-c7d46eaac0f8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Manuel 10 puntos. Es crack el loco. No va al ritmo de Matías acelerado, es re relajado en ese aspecto Manuel. Muy tranquila la clase, se preocupa muchísimo para que entiendas y, hasta para que copies. También, suele dar ejercicios y los resuelve paso a paso, re entendible. También tiene su momentos donde explica teoría (tal como Matías, pero cosas que no se ven en los videos no te van a dar!! Todo esta en los videos :) 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica muy bien y le pone mucha onda a las clases', '30bc72f5-4c21-467c-bddf-c7d46eaac0f8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'genio lo amo', '30bc72f5-4c21-467c-bddf-c7d46eaac0f8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La clase con Manuel es mayormente práctica, a veces en el medio mete algo de teoría. Explica bastante bien los ejercicios sin importar la dificultad, el único detalle es que quizás da algunos ejercicios algo complejos que si recién se ve el tema cuesta seguir, pero vuelve para atrás y contesta todas las dudas necesarias', '30bc72f5-4c21-467c-bddf-c7d46eaac0f8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buen profe. Muy copado.', '30bc72f5-4c21-467c-bddf-c7d46eaac0f8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'es un amor explicando y repasa teoría ', 'f6d5476a-0785-4e7e-80bb-98110adb0537');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'La profe es un amor. Siempre con la mejor e intentando ayudar al alumno.', 'f6d5476a-0785-4e7e-80bb-98110adb0537');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es la mejor de todas Silvia. Tiene los temas muy en claro y te responde TODAS las dudas por campus y por mail. Sus clases son muy útiles no se detiene tanto en el formalismo matemático sino que son más prácticas así que cuando vas a hacer las guías son de gran ayuda. Tiene guías de ejercicios adicionales que son sacados de finales que recomiendo hacer porque me tomaron uno de ahí en el final de este cuatri.  ', 'f6d5476a-0785-4e7e-80bb-98110adb0537');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Por favor vayan a esta catedra. Pérez es de las mejores profesoras de la facultad de lejos.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Una de las mejores docentes de la facultad sin dudas, se las ingenia para explicar temas complicados de una forma intuitiva y facil de entender. Para sus clases tenés que ir con los videos de Jemina vistos, de todas formas explica de vuelta las definiciones y propiedades y te va haciendo ejemplos a medida que explica para que no queden huecos. Es una materia muy densa y los conceptos cuestan aprenderlos (lo bueno es que la materia esta super bien dada y organizada), recomiendo hacer la mayoria de los ejercicios de las guias y preguntar muuucho x el campus que Silvia siempre está respondiendo. La asistencia no es obligatoria pero se recomienda mucho ir a las clases. Si entendiste bien los temas y las guias los exámenes (tanto parcial como final) no son nada del otro mundo. Resumen: vayan con Silvia y se van a llevar lo mejor de la materia', 'f6d5476a-0785-4e7e-80bb-98110adb0537');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Buena docente', '56c04955-f6b3-4524-a57f-e0ceddff10f1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Va una hora antes todas las clases a responder las dudas, siempre predispuesta y con ganas de ayudar. Si no fuera por ella no hubiera podido aprobar la materia.', '56c04955-f6b3-4524-a57f-e0ceddff10f1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Tuvimos 7 clases en todo el cuatrimestre, después de junio nunca volvimos a tener. Últimamente ni siquiera contesta dudas.', '56c04955-f6b3-4524-a57f-e0ceddff10f1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Para mi, la mejor del curso de los martes a la tarde. Responde dudas un rato antes del inicio de la clase con mucha predisposición ', '56c04955-f6b3-4524-a57f-e0ceddff10f1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Matías también explica muy bien  y es accesible para preguntarle.', '0a43b5a8-1e23-4ec0-8752-eda439073a52');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No me gustó, se cree demasiado.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Al principio de cada clase te hace un resumen rápido de los videos de Jemina (este resumen no alcanza para entender todo lo teórico) y después propone ejercicios muy buenos que tocan cada tema de los videos, se entiende todo muy bien en general a pesar de que la materia es difícil', '0a43b5a8-1e23-4ec0-8752-eda439073a52');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Excelente profesor, explica muy claro, sube videos al campus para ayudar a preparar parcial/final y siempre está dispuesto a responder consultas.', '0a43b5a8-1e23-4ec0-8752-eda439073a52');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Buen profe, explica bien, responde todo. Respetuoso. ', '0a43b5a8-1e23-4ec0-8752-eda439073a52');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Matías 8 puntos. Solía comenzar 5 min antes la clase, cosa que me daba una bronca... Y lo peor, no graban las clases (ningún curso de PYE).
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica muy bien', '0a43b5a8-1e23-4ec0-8752-eda439073a52');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Empieza dando algo de teórica y lo va complementando con ejercicios de la guía o bastante similares, a veces hace algún repaso antes de la clase de propiedades o puntos importantes del tema que después implementa en ejercicios', '0a43b5a8-1e23-4ec0-8752-eda439073a52');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'm
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'En la práctica resuelve algunos ejercicios de la guía, explica de forma clara y no tiene problema en responder dudas.', '9b522f4c-252f-49d9-b9fa-66eb3756a2d5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Es muy prolijo y organizado. Siempre está dispuesto a contestar dudas por cualquier medio.', '9b522f4c-252f-49d9-b9fa-66eb3756a2d5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Una verdadera verguenza. Es una sombra del profesor que alguna vez fue. No explica nada y te manda a leer 40000 libros (no se como, supone que tenes el tiempo y la capacidad para entender un libro sin recibir NINGUNA CLASE).
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'No me pareció nada del otro mundo, lo más destacable de él es que suele ser muy organizado y te deja una muy buena carpeta (quizá los últimos temas, a partir de Fourier, se embrolla más y no es tan claro, pero en general mantiene un buen nivel). Como persona suele ser un sorete y es un bajón, realmente te lo tenes que aguantar. Algún que otro día capaz lo agarras de buen humor y las clases se hacen mucho mas llevaderas, pero no suele ser el caso. Falta constantemente el respeto a sus alumnos (consejo: no le preguntes nada, te puede tratar de idiota y no con onda) y la verdad que no te da ganas de ir a sus clases. Si podes fumarte a este tipo de gente y estas preparado para que te pueda agarrar a vos, mandale para adelante.', 'ec96f6cc-13dc-4566-bf9a-0e49f9cebc71');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Ariel explica bien y no tiene ningún problema con las consultas, se puede quedar media clase dando vueltas sobre un ejercicio si no lo entienden. Es un poco desordenado en el pizarrón y eso a veces te hace perder bastante. ', '34f329e9-2b53-498b-ba0a-04ad47156149');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'Es bueno, recomendable cátedra', '4bb29574-1aa2-4ca6-b52b-ace9487cde71');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Es muy buen docente, responde cualquier duda que tengas de buena manera. Está muy atento al aula virtual y responde casi siempre en el mismo día. Durante gran parte de la materia subía un video a youtube explicando por encima el tema de la próxima clase, y después se veía más en detalle durante el zoom. El único problema es que es medio desorganizado o a veces se confunde/olvida de cosas al explicar, muchas veces te das cuenta pero si todavía no entendés muy bien el tema y no captaste eso te juega en contra. Mandó un par de tareas obligatorias durante la cursada que después corregían, como para que vayamos siguiendo la materia, muy bueno', '4bb29574-1aa2-4ca6-b52b-ace9487cde71');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buen profesor, explica clarísimo y contando anécdotas y chistes para que no te aburras en ningún momento. Vas a tener que complementar sus clases con algún libro (o con el excelente apunte de Daniel Prelat) para suplir carencias en temas de notación o rigurosidad (Cachile se centra en que entiendas los temas intuitivamente sobre la rigurosidad de lo que presenta, me parece un tradeoff que vale la pena). 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Explica la materia de una manera particular, trata de que la clase sea mas divertida y llevadera pero eso hace que se distraiga por cualquier cosa y a mi no me gustó. Si te gusta que las clases sean serias no lo recomiendo pero es cuestión de gustos. A la mayoría de la gente le gusta esa manera "divertida" de dar clase así que depende de los gustos de cada uno.', '4bb29574-1aa2-4ca6-b52b-ace9487cde71');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Hace que las clases se sufran menos ya que mete chistes y es muy buena onda. Contesta dudas sin problemas. En mi cuatri corregía los finales de su curso y no es tan exigente con la corrección.', '4bb29574-1aa2-4ca6-b52b-ace9487cde71');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Cachile es un genio, realmente creo que no se le da el crédito suficiente que merece. Las clases son excelentes, son divertidas, te permite participar, y lo más importante es que no son un bodrio. Es verdad que no da la materia tan formal como la pueden llegar a dar Acero o Prelat, pero teniendo los apuntes de Prelat disponibles en el campus, realmente vale la pena ir con Cachile.', '4bb29574-1aa2-4ca6-b52b-ace9487cde71');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Sus clases son bastante soporíferas pero te tira truquitos y heurísticas para hacer los ejercicios de final/parcial.', 'dab55544-b395-4ae3-af30-c70f74b8e7c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Supongo que es porque ya lleva mucho tiempo dando la materia y está cansado, pero lo ves siempre sin ganas. Llega a la clase, resuelve 5 ejercicios en el pizarron explicandoselo a la pared y se suele ir 30 minutos antes de que termine la clase, y si no lo agarrás a tiempo no le llegas a hacer consultas. Lo bueno es que el tipo es un pan de dios (nada que ver con Acero) y te contesta con toda la buena voluntad. A la práctica realmente la salva el otro docente, Damián Smilovich.', 'dab55544-b395-4ae3-af30-c70f74b8e7c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Federico explica bien, es un poco mas ordenado que Ariel pero a veces un poco desprolijo. Tampoco tiene problema con las consultas.', '575d119c-8bed-4dc7-a149-8bd13da44217');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No le entendi nada de todo lo que explico. Igual dio muy pocas clases', 'ab7f05ab-e3f4-4b0e-a2bd-5a17bce17d90');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Se nota que sabe mucho, a veces explica muy rápido y se pierde un poco el hilo. Creo que si se relajara un poco y explicará los detalles "obvios" sería un excelente profesor.', 'ab7f05ab-e3f4-4b0e-a2bd-5a17bce17d90');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un crack Nelson, a veces hace resoluciones medio complicadas pero se terminan entendiendo', 'ab7f05ab-e3f4-4b0e-a2bd-5a17bce17d90');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Nelson no es un mal docente pero solo se limita a resolver ejercicios rapidisimo y no tenes ni tiempo para consultar, deberia hacer sus clases mas didácticas, hacer mas preguntas y ver si sus alumnos estan entendiendo lo que explica.', 'ab7f05ab-e3f4-4b0e-a2bd-5a17bce17d90');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Nelson dio pocas clases, generalmente hacia el final y mucha gente se iba sin escucharlo. Sus explicaciones no son tan claras, quizás porque le cuesta un poco expresarse. Sin duda sabe mucho.', 'ab7f05ab-e3f4-4b0e-a2bd-5a17bce17d90');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Poco lo vi participar este 2C2020. Va muyyy lento explicando... Solía dar ejercicios y lo resolvía en clase y poco mas me acuerdo. Pero eran ejercicios claves los que daba (recuerdo que gracias a él aprobé el recuperatorio, me acordaba como lo aplicó él en sus ejercicios :) ', 'ab7f05ab-e3f4-4b0e-a2bd-5a17bce17d90');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Sabe una LOCURA de matematica pero si maneja a la velocidad que explica le revocan la licencia. Esto es mas culpa de que la materia tiene poco tiempo que suya. Las guias son eternas y los examenes justos. Tiene una página con ejercicios resueltos, teoría y videos de YT. Es un señor.', 'dc9ffc4d-3b19-4cb3-a0bc-956ec2fdcc99');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Son dos hermanos. Gustavo es el que da AM3 A, y Eduardo da AM3 C (para mecánicos). Gustavo es todo un señor, muy educado, amable, sus clases están muy bien organizadas, te deja una carpeta completísima de la materia. A mi me gustó y lo recomiendo, además es el único profesor de AM3 que es ingeniero.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Una genia Nelly, siempre da tips sobre como resolver los ejercicios. Antes de las clases resuelve un monton de consultas siempre con la mejor predisposición.', '62ed03bb-1fd9-4ac1-aac2-9bf9001e21a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'La metodología de las clases prácticas en la cursada virtual fue la siguiente: El profesor resolvía varios ejercicios en un pdf, el cual explicaba durante la clase, y después subía el pdf al campus. En general no diría que era 100% necesario ir a las prácticas pero Nelly hacía que valiera la pena, con sus clases te quedaba más condensado todo lo que tenés que saber de cada tema', '62ed03bb-1fd9-4ac1-aac2-9bf9001e21a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Excelente docente de práctica (tranquilamente la mejor práctica que he tenido hasta ahora). Explica muy bien usando ejercicios de la guía o parciales, y se sabe todo los truquitos para resolverlos de memoria. Le podés pedir que te enseñe a hacer fraccciones parciales y hasta con eso se pone, es un amor.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'se apura mucho en las explicaciones', '62ed03bb-1fd9-4ac1-aac2-9bf9001e21a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Prelat tiene una depresión crónica desde que nació, tiene un aire al maestrito malo de Harry Potter. Habla balbuceando y es muy pancho, todo el tiempo recurre a analisis 1 y a analisis 2 pero nunca da analisis 3. Empieza una oración y no la termina jamás. Dice buehmnnnn... nada... no importa, ... taratata.... esto lo leen despues... bueno. Y se ponia con el word a dar clases. CON EL WORD. Comprenle una tableta digital chicos, 5 lucas sale nada mas, siglo 21.', '9c0d03a1-9a96-4749-a993-01ec740f242e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Prelat es un genio, demuestra todo, siempre te simplifica Análisis 3 llevándote a Análisis del CBC', '9c0d03a1-9a96-4749-a993-01ec740f242e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Daba clases de los apuntes, bastante aburrida. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'uf este troIo mamarracho infumable. Desprolijo, mal profesor, se hace la diva el jetón, esos que solo dan clase para fanfarronear que saben algo, pero no para ayudarte a aprobar.', 'e3a4a084-eda4-4aaa-b69a-0ea74242dfab');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Las clases eran llevaderas pero no estabas preparadas y cometia errores', 'e3a4a084-eda4-4aaa-b69a-0ea74242dfab');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Curse con el tanto virtual como presencial, deja mucho que desear. Una practica en donde no te prepara ni para finales ni para parciales. Si tienen que preparar final, eviten su practica. Se adhiere a los paros. Y suele realizar ejercicios muyyyyy básicos, no hace ejercicios "avanzados" de la guía. Suele darle solo un rato a los temas vistos en clase, nunca profundiza por lo que no te vas con una base solida en cada tema. ', 'e3a4a084-eda4-4aaa-b69a-0ea74242dfab');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Un maestro, el MVP de la cátedra. Honestamente si no fuera por él no valdría la pena cursarla con Acero. Siempre está abierto a consultas (el tipo te pasa su mail y todo para que le mandes tus dudas y suele contestar en el mismo día, es un crack). Te contesta con la mejor y es muy claro, podes preguntarle 5 veces lo mismo y te lo va a explicar 5 veces bien. Sabe una banda y si algo no lo llega a tener del todo claro, a veces hasta te lo averigua y te contesta la duda. Además aceptaba (más bien te alentaba, es totalmente optativo, lo hacés solo si queres) a que le entregues tus ejercicios de la práctica así te los corregía. La verdad que es de los mejores profesores que podes tener en esta materia.', '73fef2cf-a812-41f1-991d-e315788b3d78');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Acero acá vuela, en AMII volaba pero en AMIII se va de tema, da mucho contenido de una clase para otra, es imposible seguirle el ritmo a menos que seas una mente brillante. El programa es pesado y por eso quiere dar todo rápido, lo mejor es tratar de llevar leído el tema que va a dar porque es mucho y las dos horas se hacen eternas si no se entiende. Después siempre contesta todas las dudas, toma lo que da en clase en los exámenes y corrige él. ', '69445ec8-2f68-4e22-b54e-c8d50841cc86');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No se anoten con Acero', '69445ec8-2f68-4e22-b54e-c8d50841cc86');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No recomiendo que la cursen con este profesor', '69445ec8-2f68-4e22-b54e-c8d50841cc86');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Está demente, pero es excelente profesor. Le encanta tener excelentes alumnos y con estos tiene buen trato, pero si sos medio pelo le debes chupar un huevo. Va a los pedos pero despues terminas entendiendo todo por el detalle que tiene explicando. Muchos no lo recomiendan porque no estan a la altura.', '69445ec8-2f68-4e22-b54e-c8d50841cc86');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Burman el cuatri pasado apareció las primeras clases nada más. Es muy bueno explicando', 'e6fd8ec8-9e6c-426f-b1d3-bcb7e434e534');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buen hombre. Pero demasiado desorganizado como profesor. No lo recomiendo como teorica de analisis 3.', '67201073-ac8e-4bc2-b7e0-150b8089de1d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Cachile es un genio. Explica todo muy bien, y tiene un parcial super razonable donde toma lo que se vio. Es muy divertido y siempre cuenta algo que te hace reir.', '67201073-ac8e-4bc2-b7e0-150b8089de1d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Explica muy lento y muchas veces lo mismo, da los ejercicios fáciles que no son los que se evalúan pero se le entiende. En consultas explica muy bien todo y se entiende.', '127bf781-9efc-4a94-89ca-1b44efec9238');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Buena presidposición', '127bf781-9efc-4a94-89ca-1b44efec9238');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Buena presidposición', '127bf781-9efc-4a94-89ca-1b44efec9238');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Es muy teórico, pero explica bien.', '127bf781-9efc-4a94-89ca-1b44efec9238');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Lento, pero intenta que entiendas.', '127bf781-9efc-4a94-89ca-1b44efec9238');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Federico era uno de los que más estaba, explica bien y es prolijo en el pizarrón', '38d4f47e-36a6-49ca-a937-ac8a69ed8262');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'El problema con Murmis es que va tan rápido que no modula correctamente, entonces muchas veces no se le entiende lo que dice. Despúes es muy prolijo en el pizarrón, responde todas las consultas y repite si no se entiende el tema y es muy puntual (puede terminar la clase 5 minutos antes o después del horario).', '9f54372a-1d7a-4c83-8eb3-e48ba6d35ddf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Sin ella la practica no existe. De las mejores docentes de la facultad. Cualquier consulta que tengas la responde y te resuelve el ejercicio en la hoja.', '786e0bd7-b498-40ec-ad91-0a0ad5e68578');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Este chico sabe un montón, explica los ejercicios complicados. A veces es un poco desprolijo en el pizarrón pero explica tan bien que no importa. En consultas se pasa, responde todo. ', 'e3a7bcf3-5157-46f6-b3f0-c6501edcb771');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Lo mejorcito de la cátedra', 'e3a7bcf3-5157-46f6-b3f0-c6501edcb771');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Lo mejorcito de la cátedra', 'e3a7bcf3-5157-46f6-b3f0-c6501edcb771');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Explica bien, es desprolijo pero responde mails y eso. Es copado.', 'e3a7bcf3-5157-46f6-b3f0-c6501edcb771');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'En el mano a mano un genio. En el pizarrón, explica de más y te confunde', '9501c876-f14a-4bd8-a21f-753cf8f727fc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'No dudo que Acosta sea un genio pero no sabe enseñar, complica DEMASIADO cuando no es necesario. Una vez estuvo casi una clase entera explicando el momento de inercia como tensor (una matriz con integrales triples imposible de resolver para los pocos conocimientos que teniamos), salias mas confundido que antes. Ademas corrige muy exigente (me puso mal un ejercicio de termodinamica solo porque puse la velocidad como un vector). ', '9501c876-f14a-4bd8-a21f-753cf8f727fc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Tiene criterios de correción medio de mierda, haciendote recuperar todos los parciales si desaprobás alguno. Tiende a explicar cosas que son innecesarias, para complicarte adrede (dicho por él). Hay algunos temas que los explica correctamente y te dice bien como resolver los ejercicios. Y si llegás hasta el final de la cursada, rendís todos los recuperatorios y sabes masomenos algo, aprobás. Después te regalo ir al final con lo que viste en clase.', '9501c876-f14a-4bd8-a21f-753cf8f727fc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Acosta es un genio, sabe mucho y se nota que le encanta explicar hasta el más mínimo detalle. Si te quedó alguna duda después de su clase es porque no prestaste la suficiente atención, porque el tipo deja bien en claro absolutamente todo lo que hace. Además es de las pocas cátedras en las que el profesor da con profundidad hasta el último tema del programa, temas que dicho sea de paso, entran de cabeza en el final y si no te los explicaron bien los bochas. La única crítica que se le puede hacer es que hay clases en las que está medio de mal humor o algo le pasa, porque te contesta mal si le haces una pregunta "pava". Conclusión: si cursas con Acosta y aprovechas sus clases, la materia la metes de cabeza.', '9501c876-f14a-4bd8-a21f-753cf8f727fc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un genio, después de Fontana y Chiabrando quizá el mejor profe de física. El problema es que carga el solo con el resto de su cátedra media nefasta, pero por él vale la pena anotarte si no te llega para el top 2.', '9501c876-f14a-4bd8-a21f-753cf8f727fc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No me pareció un mal profesor, pero daba las teóricas muy rebuscadas y daba vueltas en temas que no eran importantes, no solo porque no son parte de la materia Física 1 sino porque no teníamos los conocimientos necesarios para entender de qué estaba hablando. Aún así se nota que sabe un montón y cuando está explicando los temas que tiene que explicar lo hace bastante bien y se puede llegar a seguir la clase.', '9501c876-f14a-4bd8-a21f-753cf8f727fc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Eduardo es un genio, un tipazo que siempre te va a intentar ayudar. Eso sí, va rapidisimo en la teoria por lo que yo recomendaría más este curso para recursantes. De igual manera es muy capo y más allá de que es medio teórico y se marea responde todas las dudas', '9501c876-f14a-4bd8-a21f-753cf8f727fc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No lo recomiendo. Es muy desorganizado, por lo que se pierde mucho tiempo. Hubo clases q por falta de organización perdimos bastante tiempo. Estuvimos como 3 clases con cinética, cosa q otros profesores la dan en menos. Te avisa desde un principio q lo más probable es q no llegue con los temas, por lo q vas a tener q leer vos. En las prácticas solo resolves ejercicios con un grupo de compañeros y los entregas.', '9501c876-f14a-4bd8-a21f-753cf8f727fc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'A pesar de que es un señor muy responsable, educado y cumplidor, desaconsejo anotarse con él de todo corazón, enseñar física no es sólo leer un pdf y rara vez resolver problemas para la clase, de verdad, yo lo tuve virtual y no son buenas las clases, este cuatrimestre fue un desastre, nadie aprobó el segundo parcial, y la minoría aprobó el primero. Tristemente tuve que dejar la materia porque sabía que si en la teórica y en la práctica rara vez hacían ejercicios para mostrarle al alumno cómo encarar los problemas, esto no iba a ninguna parte y si me quedaba seguro también la iba a perder. Háganse un favor y pregunten e investiguen profesores que hagan muchos problemas para elegir curso de física I.', '9501c876-f14a-4bd8-a21f-753cf8f727fc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La verdad que para ser recursante de esta materia, esta catedra me vino como anillo al dedo. Venia con un gusto amargo de haber cursado Física con otra catedra, en donde las clases no se organizaban bien, eran miles de Tps escritos o en Word y ni hablar de los parciales del cuatri pasado. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Eduardo es un tipazo. Prepara actividades todas las clases para que vayas siguiendo si o si el ritmo de la materia, eso ayuda muchisimo. Todos los ayudantes buenísimos también.', '9501c876-f14a-4bd8-a21f-753cf8f727fc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Excelente profesor, muy dedicado, responde preguntas y sabe. Es medio serio y a veces parece que responde de mala gana, pero creo que el es así.', '9501c876-f14a-4bd8-a21f-753cf8f727fc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Su familia hace mucho ruido de fondo. ', '8fd4a2d8-fcf2-4ffd-b2f0-28230f67286f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Buena profesora, explicaba problemas de la guia y se entendía muy bien. A veces da temas por sabidos y va rapido', '8fd4a2d8-fcf2-4ffd-b2f0-28230f67286f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es a la quien más se le entiende pero su familia hace mucho ruido atrás de ella en la clase virtual y le entendes la mitad ', '8fd4a2d8-fcf2-4ffd-b2f0-28230f67286f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Cuando explica, puede ir rápido pero frena cuando le dicen y repite, y está muy atenta en la clase a los alumnos. ', '8fd4a2d8-fcf2-4ffd-b2f0-28230f67286f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No aparece en clase.', 'd8023ef4-f63c-4dca-b052-ee12f6bcb34f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No tuvimos muchas clases con él pero cuando explicaba algun ejercicio se entendía', 'd8023ef4-f63c-4dca-b052-ee12f6bcb34f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explicaba bien y tenía muy buena predisposición para consultas.', 'd8023ef4-f63c-4dca-b052-ee12f6bcb34f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica re bien pero pocas veces aparece en clase ', 'd8023ef4-f63c-4dca-b052-ee12f6bcb34f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es muy claro cuando explica y organizado. Se entiende bien en las resoluciones de problemas. ', 'd8023ef4-f63c-4dca-b052-ee12f6bcb34f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy verde. Muy malo explicando. malas devoluciones de los tps (si las da) y deberia tomar clases de consideracion', 'd8023ef4-f63c-4dca-b052-ee12f6bcb34f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Está en la práctica con Racero, dentro de todo explica bien los ejercicios que hace, quiere que participes y le respondan lo que pregunta. Hay veces sentí que venía a dar clases no con muchas ganas. Es una profe que justifica todo lo que hace, y dentro de todo prolija las veces que presentaba con powerpoint. Resuelve ejercicios que me ayudaron mucho para los parciales, casi que resultaron claves. ', 'd59b83d9-bab4-43ef-95b1-03fd69703880');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Sus practicas estuvieron buenas, de los que temas/ejercicios que dio los entendí, y no tiene problema en que la interrumpas. Una vez nos respondio un mail con una duda de resolución de un ejercicio horas antes del parcial, una genia!', 'd59b83d9-bab4-43ef-95b1-03fd69703880');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica bien pero a veces medio desganada. Tarda un siglo en responder por el campus.', 'd59b83d9-bab4-43ef-95b1-03fd69703880');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy prolija y organizada como Diego vilaseca para explicar ejercicios. ', 'd59b83d9-bab4-43ef-95b1-03fd69703880');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Si le preguntas te responde de lo más bien. Lo único es que a veces cuando esta haciendo y explicando un ejercicio se traba y no se le ocurre como seguir, o a veces se equivocaba en algo y los otros profes lo ayudaban y corregían, lo que se hacia todo muy confuso y medio que te perdes', 'acf1836a-af12-4929-bb81-3e0835167d84');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'La tiene muy clara. Es bueno explicando.', 'd40d361d-3c68-4e69-8000-861f29e7dbda');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Me gusto mucho como explica y los pdfs que se arma. Explica todo re tranqui y contesta todas las dudas que tengas. Estaria bueno que esté más seguido pero eso es por como se organizan ellos.', 'd40d361d-3c68-4e69-8000-861f29e7dbda');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Lo vi pocas veces dando clases, explica los ejercicios bastante bien. No vi que responda dudas en el campus, pero en clases si lo hace', 'd40d361d-3c68-4e69-8000-861f29e7dbda');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Matias aparece en pocas ocaciones (quizas una vez por semana con suerte) y presenta ejercicios en word o pdf donde lo que explica generalmente se entiende bien.', 'd40d361d-3c68-4e69-8000-861f29e7dbda');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'matías es claro y conciso explicando. va directo al punto del ejercicio sin dar vueltas. god ', 'd40d361d-3c68-4e69-8000-861f29e7dbda');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Un crack, muy directo y practico. Tambien te enseña reglas memotecnicas, que al dia de hoy sigo usando.', 'd40d361d-3c68-4e69-8000-861f29e7dbda');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es muy buen profe de práctica, en esta clase estuvo como 2do profe de práctica y solo explicaba 1 vez cada dos semanas. Me parece que porque es así su organización. ', 'd40d361d-3c68-4e69-8000-861f29e7dbda');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Profesor que por lo que pude notar no estuvo en tantas ocasiones como los demás pero es muy posible que haya sido por un tema de horarios. En general las partes de clases y ejercicios explicados han estado bien, pudiendo mejorar un poco más con algunas explicaciones adicionales. Predispuesto a responder dudas en clase pero no en campus (al menos es lo que he podido observar) de buena forma. ', 'd40d361d-3c68-4e69-8000-861f29e7dbda');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Matías explica muy bien, suele explicar ejercicios y también le gusta hablar y contar un poco de las aplicaciones de los temas en la carrera en general. Tiene powerpoints muy buenos y se le entiende todo perfecto.', 'd40d361d-3c68-4e69-8000-861f29e7dbda');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'daba ejercicios y explicaba re bien. Siempre relacionaba esos ejercicios con ejemplos de la vida real que estaban piolas y te contaba algunas de las cosas que podrías hacer en el futuro con esos conocimientos, a mi personalmente me re interesaba', 'd40d361d-3c68-4e69-8000-861f29e7dbda');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'A veces va muy lento pero se entiende cuando explica y cuelga en subir los PowerPoints. Tiene buena predisposición.  ', 'd40d361d-3c68-4e69-8000-861f29e7dbda');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Al igual que patricia es muy buen docente, se nota que sabe un montón, pero aun asi las explicaciones siempre eran a buen ritmo y bajadas a tierra; no tenia ningún drama respondiendo preguntas, siempre muy buen trato y los ejercicios que hacia (muchas veces re-clave) se entendían muy bien', 'd40d361d-3c68-4e69-8000-861f29e7dbda');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Buen profe!', 'd40d361d-3c68-4e69-8000-861f29e7dbda');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Después de haberla pasado mal durante 2 horas con la teórica de Alicia Corsini, llega lo peor. Tus ganas de vivir van a desaparecer en el momento que comience la clase practica. Es una buena persona, pero explica muy mal. NO SE ANOTEN EN ESTE CURSO.', 'd1badde4-8276-4173-9d5a-6b227b70b629');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Muy mala organizacion y no s epone deacuerdo con Corsini. No explica bien y encima es bastante insoportable. No responde dudas y hace lo que quiere. Muy mal  curso', 'd1badde4-8276-4173-9d5a-6b227b70b629');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'En modo virtual no es muy buena la organizacion, sobretodo por la dificultad del manejo de las herramientas virtuales. Suele confundirse a veces en las cuentas lo cual embarran la comprensión. A veces estira la clase una hora (muchas), tiene buena pedagogia, pero en virtual no se aprecia', 'd1badde4-8276-4173-9d5a-6b227b70b629');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No se entiende nada', 'd1badde4-8276-4173-9d5a-6b227b70b629');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Cristina está en la parte práctica del curso Fontana. Es cualquier cosa pero la amamos.', 'd1badde4-8276-4173-9d5a-6b227b70b629');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es muy chota explicando. Siempre tiene el micrófono saturado y es muy molesto. ', 'd1badde4-8276-4173-9d5a-6b227b70b629');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Después de disfrutar dos horas de clase teórica con el gran Fontana, mis ganas de cursar se esfumaban apenas comenzaba la práctica con Cristina. Es re macanuda pero no debería ser docente y menos en la UBA. ', 'd1badde4-8276-4173-9d5a-6b227b70b629');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'No explicó muchos temas pero los pocos que dió los explicó muy mal, muy desordenada.', 'd1badde4-8276-4173-9d5a-6b227b70b629');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2018', 'Muy complicada y desorganizada explicando, no la recomiendo en ese sentido. Pero si hay que reconocer su predisposicion a la hora de responder mails o lo que sea, siempre  se recibia una buena respuesta', 'd1badde4-8276-4173-9d5a-6b227b70b629');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Personalmente fue realmente muy dificil seguirla virtualmente. Al no manejarse de diez con la tecnología se generan complicaciones cuando le toca dar clase (algunos alumnos podrían llegar a tener que quedarse mucho tiempo esperando a ser aceptados en el Meet porque no acostumbra a revisar la "sala de espera" y el enfoque al pizarrón nunca fue claro a la vista por lo que no se terminaba de entender al 100% lo que explicaba). Igualmente, se nota que es buena persona y en ningún momento se negó a explicar nada de lo que se le preguntara (nos tocó un cuatrimestre muy dificil para ella quizás también con respecto a todo lo relacionado a la pandemia, solía contarnos si tenía un mal día) y fomentaba mucho la participación en clase, siempre pedía que le contestaramos.', 'd1badde4-8276-4173-9d5a-6b227b70b629');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Una vez me convido galletas caseras canavicas (True story...)', 'a11cfb86-8cbd-44d6-b6f9-e130308f0dbc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se nota que este profesor sabe mucho de física I pero le cuesta explicar y hacerse entender, su método de enseñanza son ppts que hizo en pandemia y solo se limita a leer el ppt y explicarte con experiencia reales sobre el tema dándole unas pinceladas en el contexto científico de la materia ,en sus aspectos positivos es muy amigable, buena onda y sabe mucho de la materia, si te piensas anotar en esta catedra te recomiendo que antes de ir a sus clases tengas algo sobre el tema para que no te pierdas en sus explicaciones, en general la catedra lo unico a resaltar es que los parciales son fáciles de aprobar a comparación de otros profes, lo que involucra que en el final tienes ejercitarte con problemas demás dificultad, este sistema lo aproveche para obtener un buen promedio de la materia. En mi opinión esta catedra es recomendable para los que recusan la materia o para los que les gustaría obtener un promedio alto, el único profe dela practica rescatable es Thomas que es un crack.', 'a11cfb86-8cbd-44d6-b6f9-e130308f0dbc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Mario se encarga de la práctica en el curso Fontana. No pudo estar en la primera parte de la materia porque tuvo COVID pero despues volvió con todo. A veces se va un poco por las ramas explicando porque se nota que le gusta. Es capaz de pasarse 1 hora más del horario resolviendo problemas.', 'ef502c7e-feab-4aba-b104-7185b370de95');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Genio. Si estás al día sus prácticas son buenísimas. Gracias a él entendí cuerpo rígido. Siempre muy buena onda y nos tiene mucha paciencia', 'ef502c7e-feab-4aba-b104-7185b370de95');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es fisico) Buen tipo , es el que da las teoricas. Si tenes una critica constructiva la toma con la mejor e intenta amoldarse .se nota que le gusta enseñar pero es muy deorganizado . No tiene un hilo . El curso era lunes virtuales y miércoles presenciales.  Virtualmente era difícil seguirlo . Al no tener orden quiere explicar muchas cosas en poco tiempo y si no tenes una base se complica . Yo complemente el curso con teóricas de fontana . Lo recomiendo si ya cursaste análisis porque para las demostraciones usa temas de análisis.  
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Armando era profesor de la practica , en virtualidad mostraba los ejerccios con un pdf armado . Y en la presencialidad era un poco más copado , buscaba que participaremos un poco más.  Es un poco aburrido su tono de vos siempre igual', '3b309bf5-1f97-4c31-ac8e-427b2faaf548');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Explica ejercicios innecesarios para la materia y desperdicia un montón de tiempo en la resolución. Además de que no explica bien y te deja con más dudas que certezas. En cuanto a la corrección de TPs es bastante exigente.', '3b309bf5-1f97-4c31-ac8e-427b2faaf548');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica bastante bien y verdaderamente quiere que entiendas lo que estas haciendo. Es exigente corrigiendo los tps de lab.', '4a820157-da97-4492-9495-47ab022320f4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy claro al explicar, tiene re claros los contenidos de la materia. Falto algunas clases por estar enfermo, pero siempre se lo notó "contento" de explicar dudas. Medio gede con la corrección de tps igual. Algo muy valorado es que teníamos un grupo de wpp para dudas (que no contestaban demasiado rápido pero lo hacían)', '4a820157-da97-4492-9495-47ab022320f4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Le costo adaptarse a la virtualidad', '576aa79e-4d5e-4bcd-8ba4-e713afba5779');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Contesta re mal, trata mal a todos en clase tanto en clase como por el foro, los trabajos que corrige él suerte si les pone un 4', '576aa79e-4d5e-4bcd-8ba4-e713afba5779');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Si no llegas a Fontana, anotate acá. Es sencilla y muy clara', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Laura es ree buena, es prolija y tiene toda la paciencia para explicar.', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy bien organizadas sus clases. Para los parciales hacía clases de consulta y contestaba todas las dudas. Explica bien.', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buena onda, tiene mucha paciencia. Pero no graba las clases.', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Laura daba las clases, prácticas. Las veces que asistí, explico todo muy claro y tenia powers preparados. Los subia todos al campus y despues era probable que ese tipo de ej esten en parciales/ finales', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Laura es literalmente la mejor profesora que tuve en la facultad. Explica muy claro, cumple los horarios y esta siempre de buen humor. Los ayudantes también muy buenos. ', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'La mejor del curso con muchísima diferencia. Explica claro, fomenta interacción, siempre está subiendo material extra y respondiendo consultas.', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Laura es muy buena, sus powerpoint están bien organizados, contesta las dudas que mandas en el foro del campus. En la semana de parciales hace clases de consultas. Después de las clases, sube los powers y ejercicios vistos al campus.', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Laura es lo mejor que hay en esta catedra, principalmente por lo bien que explica los temas y lo bien que se le entiende. No olviden de pedirle ejercicios de parciales de otros años que ella se los sube sin problema. Al momento de ejercitar antes de un parcial es la que responde todas las dudas de ejercicios y los resuelve de una manera clara y sencilla.', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buena profe la verdad muy didactica en sus clases presenciales', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'laura es lo más explicando, siempre atenta y súper didáctica. lo único que tengo para criticar es que en el tema de ondas mecánicas se salteó fórmulas y óptica física no lo enseñó muy bien. sacando eso muy buena profesora', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'En las clases presenciales explicaba bien la teoria. Yo creo que los unicos temas que no se entendieron bien en clase fueron los ultimos (ondas mecanicas y optica fisica). Muy buen trato con los alumnos, si tenias alguna duda, aunque sea la mas boba, te la aclaraba hasta que la entiendas, fomenta la participacion, y bastante buena corrigiendo parciales.', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buena profesora, explica todo a detalle y responde cualquier consulta', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buena profesora y siempre explica claro, responde las dudas y esta con muy buena predisposición ', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Chiabrando es entre todo buena profesora. Explica más o menos bien los temas que da, responde dudas en clase y es muy amable con con los alumnos. Sin embargo, no me gusto mucho la forma en la que los temas fueron dados, especialmente en virtualidad. Siento que apuraron los temas o que no se pararon a explicarlos correctamente. Su campus no es muy abierto a dudas, ya que muchas veces no las contestan, y a veces no tenían muy claras las fechas de parcial.', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No tiene problemas en contestar ninguna consulta por mas boluda que sea, llega temprano y tiene PDFs de la teoría dada que sube después de la clase pero sentí que dio algunas cosas por arriba o desorganizadas que al ver clases grabadas de otros profes te dabas cuenta la falta de algunos temas teóricos muy importantes. Resolvía ejercicios de final muy completos que si los veías tranquilo te ayudaban bastante.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Excelente docente. Le cuesta un poco virtual pero presencial es un gol. Muy atenta y servicial.', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'si buscas una cátedra que sea medio pelo es por acá. laura está siempre bien predispuesta
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2014', 'Muy simpática. Si bien las clases no eran la gran cosa (dió pocas igual), siempre estaba dispuesta a responder dudas, mails, y mediar entre los alumnos, y la soberbia de Indelicato. Lastima que esta cátedra era insalvable, porque ella era buena docente en todo sentido.', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Muy predispuesta a aclarar las dudas de todos, y se toma el tiempo para que realmente lo entiendas. Muy buena docente.', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es excelente docente, complementa muy bien en la práctica las dudas que quedan con la teórica de Barasch', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Profe buena onda, trató de dar buenas clases durante el cuatrimestre y dentro de todo los temas se lograron dar de acuerdo al cronograma. Sin enbargo he visto que las clases a partir del tema "ondas mecánicas" fueron mucho más aceleradas, al punto que he notado que parecian los temas más simplificados en comparación con otras catedras. Pero eso no quita el hecho de que tiene muy buena predisposición para lo que son las dudas en clase. Suele responderlas y si no se entiende trata de volver a explicarlo. En su catedra hubieron clases de consulta, manteniendo un buen trato en todo momento. Una grata sorpresa me lleve con esta catedra.', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Una genia Laura, la verdad muy conforme con sus clases, explica muy bien y no tiene problema en repetirte 80 veces hasta que entiendas, tiene un pizarrón en su casa y algunos ejercicios que salen en el momento (sobre todo en las clases de consulta) los resuelve ahí y se entiende perfecto, me gustó mucho.', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Excelente Laura, carrea la catedra llena de profesores medio pelo', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'una crack, daba las teóricas (también a veces explicaba algunos ejercicios) y explicaba muy claro, le entendí todo. Explicaba con un power point que después subia al campus y a veces también prendia la cámara y usaba un pizarrón para complementar. Siento que los últimos temas (a partir de ondas mecanicas) se dieron medio rápido y creo que algunos conceptos no quedaron del todo claros, pero igual tengo entendido de que muchos cursos tuvieron el mismo problema. Para esos temas Laura uso un montón de simuladores que al menos a mi me hicieron ver con mas claridad las cosas. Otra cosa importante es que respondia a todas las dudas y repetía cuanto fuese necesario hasta que se entendiera el tema', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es muy buena onda, siempre responde todas las preguntas. Quizá va muy rápido en las explicaciones, así que recomiendo leer bibliografía antes de las clases. ', 'bb90d335-6fd6-4557-8ad9-c45fdb2f7d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buena profesora. Explica a muy buen ritmo, no tiene ningún drama en responder preguntas, excelente trato con los alumnos y te da lo necesario para que apruebes y entiendas (No se gasta tanto en demostraciones, pero las cosas no salen nunca de la galera). Yo aprobé el final en primera instancia bastante tranquilo únicamente volviéndome a ver sus clases y rehaciendo lo importante de la guía, creo que eso dice bastante de lo buena que es la cátedra. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No explica mal,pero su tono te mata te da las verdaderas ganas de dormir,podes intentar estar pero cuesta banda', '38d86ff8-c9c4-4a98-a74e-42f0bf57e8bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Conde Garrido se cae a pedazos, él da la teorica pero no la termina de dar para los examenes y hace explicaciones redundantes sin llegar a nada. Recomiendo si estan en esta catedra ver la teorica de fontana de youtube y asistir a las clases prácticas de Rossa y Sola.', '38d86ff8-c9c4-4a98-a74e-42f0bf57e8bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Juan conde Garrido es de los unicos que responde por el foro, no siempre muy claro pero por lo menos responde. Las clases son muyyyy confusas, el profesor se ve que sabe bastante pero no se le entiende mucho, o porque se queda con algunos temas o porque sobreexplica algunos llegando a demostrar hasta el mas minimo detalle, que en vez de aclarar oscurece. Tambien hay veces que termina 1 hora mas tarde de lo estipulado porque no llega a dar temas y te los mete asi nomas', '38d86ff8-c9c4-4a98-a74e-42f0bf57e8bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La cursada fue buena en general, pero en los últimos temas las clases fueron un poco rápidas y desordenadas. ', '38d86ff8-c9c4-4a98-a74e-42f0bf57e8bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'No me pareció que sea la gran cosa como profe, pero es buen tipo, amable, paciente, siempre trató bien a los alumnos. Complementa bastante bien con Rossi.', '38d86ff8-c9c4-4a98-a74e-42f0bf57e8bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Si queres dormirte unas buenas 3 horas de teoría metete acá. No solo es una paja sino que para corregirte el segundo parcial te re forrea. ', '38d86ff8-c9c4-4a98-a74e-42f0bf57e8bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Me corrigio un tp, ni idea su calidad de como profesora. Nunca estuvo en las clases', 'a9475bc9-6f15-455f-a13f-fb0e550e0a35');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No dio ni una sola clase, solo corrige los Tps y con suerte', 'a9475bc9-6f15-455f-a13f-fb0e550e0a35');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Cada tanto aparecia en alguna clase pero no daba ninguna. Solo corregia los tps y en las clases que estaba solo era para responder dudas sobre el tp o para entregarselos. Medio flojas las explicaciones del tp, y bastante exigente en la primera entrega pero despues termina siendo bastante buena corrigiendolos.', 'a9475bc9-6f15-455f-a13f-fb0e550e0a35');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Dio las clases de laboratorio, los tps si seguías lo que decía fueron bastante simples. Respondió siempre las dudas por mail sin problema.', 'a9475bc9-6f15-455f-a13f-fb0e550e0a35');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se encarga de la parte de los trabajos prácticos
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La ayudante de trabajos prácticos. En sus explicaciones faltaba contenido e información acerca de como hacer el tp. Apenas iba a clase y no solía contestar muchas dudas.', 'a9475bc9-6f15-455f-a13f-fb0e550e0a35');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Las únicas clases que dio fueron la de los trabajos prácticos y eran medio malas, pero no era muy exigente y respondía todas las dudas por mail.', 'a9475bc9-6f15-455f-a13f-fb0e550e0a35');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un poco molesta. Solo se encarga de los tps.', 'a9475bc9-6f15-455f-a13f-fb0e550e0a35');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2014', 'Un fantasma. Dió 2 o 3 clases, de las peores que tuve en la facultad. No entendía ni medio de nada, y si le querías preguntar algo se trababa "pensando" 10 minutos y ni te contestaba.', 'a9475bc9-6f15-455f-a13f-fb0e550e0a35');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'un idiota. se cree mil y es un flacucho boludo. Sus clases son nefastas, trata re mal a todo el mundo, te pelotudea si preguntas cosas y ademas es super desprolijo, no se entiende nada. lo peor de esta catedra.', 'f1e07aaa-1ab3-4af1-b6e7-c86b55f3a13f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Es medio bobo y explica mal. Además es desprolijo.', 'f1e07aaa-1ab3-4af1-b6e7-c86b55f3a13f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Nunca tuve un profesor tan violento, su frase celebre "la puta". Desde echar a compañeros de la clase porque se habian olvidado de apagar el microfono/no conectarse con camara por que no tenía, hasta retar a una persona por conectarse por el celular. Cuando alguien se animaba a aportar a la clase y no era una respuesta correcta se ofendia y te decía que no habias estudiado la teorica, pero cuando nadie respondía se enojaba aun mas y nos insultaba y dejaba de dar clase.Nunca pudo resolver un ejercicio completo como se lo hemos pedido tantas veces. Lo unico bueno fue el ayudante de Cátedra, Nico, muy empatico y nos re ayudo muchas veces.', 'f1e07aaa-1ab3-4af1-b6e7-c86b55f3a13f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'un desastre, explica mal y parece que todo le molesta. tilteado por defecto y sin motivo.', 'f1e07aaa-1ab3-4af1-b6e7-c86b55f3a13f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No me parece que te trata tan mal, cuando resuelve un ejercicio lo hace muy bien con lujos de detalles, es bastante claro explicando, eso sí podría ser más prolijo y algo más organizado. Claro para una primera cursada de física no lo recomiendo, pero si sos recursante y manejas dentro de todo la materia Corach viene bien. Insiste mucho con que participemos en clase, si no participan se enoja y se pone de mal humor. Está muy desconectado de la parte administrativa', 'f1e07aaa-1ab3-4af1-b6e7-c86b55f3a13f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se califica a sí mismo como "exigente", cuando da una explicación de tp bastante pobre y te lo manda a rehacer 800 veces. No le importa si casi nadie en el grupo trabaja (armaban grupos de 8 personas y si trabajan 2 obvio que te sobrecargás de trabajo, pero no importa). Explica ejercicios bien, pero no tiene buena letra, es desprolijo. Varias veces putea en clase y tenés que aguantarte su opinión política y preguntas (por ej. si sos del partido de Milei) que por supuesto, no tienen que ver con la física. Para consultas tiene buena predisposición (tanto presencial como virtual).', 'f1e07aaa-1ab3-4af1-b6e7-c86b55f3a13f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'muy aburrido super teorico, parciales faciles pero no llegas bien para el final', '8b7a5ef2-c162-4654-9099-1716b0ad8322');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Crack', '8b7a5ef2-c162-4654-9099-1716b0ad8322');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Crack', '8b7a5ef2-c162-4654-9099-1716b0ad8322');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Crack', '8b7a5ef2-c162-4654-9099-1716b0ad8322');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es un poco subjetivo su régimen de aprobación, depende mucho de su propia opinión de la responsabilidad del alumno para aprobarlo, más allá de si el alumno tiene los conocimientos aprendidos o no. Su trato con el alumnado también me pareció muy autoritario, por ser el un profesor no debería tratar con esa falta de respeto a ningún alumno, debería tratarlo como par. ', '8b7a5ef2-c162-4654-9099-1716b0ad8322');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente profesor de Física!! Lo super recomiendo!!
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente profesor de Física!! Lo super recomiendo!!
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Su clases son bastante buenas y claras, acepta preguntas, siempre y cuando no sean muy "brutas" aunque igual las responde.', '8b7a5ef2-c162-4654-9099-1716b0ad8322');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Sabe mucho y te da temas que otras cátedras no, pero es medio asqueroso de trato. Arma escándalos si ve a alguien usando el teléfono y no te deja hacerle ninguna pregunta casi.', '8b7a5ef2-c162-4654-9099-1716b0ad8322');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Como había feriados que afectaban las clases adelantó los temas para llegar a dar todo, siempre puntual, demuestra todo. Los parciales son accesibles.', '8b7a5ef2-c162-4654-9099-1716b0ad8322');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No dio clases. Solo PDFs y a veces con errores pero los arreglaban si le avisaban. Responde solo por mail. Tps  en grupo  cada semana algunos ejercicios o guías de preguntas. ', '8b7a5ef2-c162-4654-9099-1716b0ad8322');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'A ver, es un cuatri excepcional, es dificil hacer una critica sobre un docente cuando no esta capacitado a dar clases por falta de instrumentos. Hasta que no vuelva la presencialidad no recomiendo cursar con el, mas que nada porquue no hay clases y es una materia muy teorica. ABz', '8b7a5ef2-c162-4654-9099-1716b0ad8322');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es un muy buen profesor, explica clarisimo, no tiene problema en despejar las dudas y siempre lo hace con respeto.El ambiente de la clase es agradable, haciendo chistes con relacion a los temas. No le gusta que coman ni que usen el celular en sus clases. Siempre llega puntual y si no se llega a un tema, pone clases no obligatorias para seguir el tema y no atrasarse. cursar con cornejo es cursar tranqui y los parciales que toma son sencillos a comparacion de otras catedras.', '8b7a5ef2-c162-4654-9099-1716b0ad8322');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No hay profesor como este hombre, salis entendiendo todo, explica clarísimo. Sus parciales son diferentes a los de las otras cátedras porque siempre toma un verdadero y falso y de los 3 ejercicios tenés que tener al menos la mitad bien o te manda a recuperatorio del que pifiaste. Lo recomiendo muchísimo.', '8b7a5ef2-c162-4654-9099-1716b0ad8322');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Da los temas de manera muy teórica y eso suma para entender mejor los conceptos. Dió clases algún que otra feriado para no atrasarnos. Recomiendo practicar con sus parciales viejos ya que son muy distintos al del resto de los cursos.', '8b7a5ef2-c162-4654-9099-1716b0ad8322');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'se entiende muy bien, tiene parciales teóricos prácticos accesibles ', '8b7a5ef2-c162-4654-9099-1716b0ad8322');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', '"Da la teorica", no hizo clases virtuales, te mandaba videos y pdf. Recien el ultimo mes dio clases. Manda tp's obligatorios todas las semanas. Almenos una vez por semana tenes que participar en el campus respondiendo algun post que haga o enviarle alguna duda por email, anota las participaciones que tengas en clase para la nota final.', '8b7a5ef2-c162-4654-9099-1716b0ad8322');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Muy buena pedagoga ', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Es muy buena docente, exigente y para romper el hielo en tu primer año de la carrera va bien. Te hace bromas y te gasta, pero termina respondiendo tu duda, claramente no te olvidas nunca de ese concepto. Se desvia mucho del tema pero vuelve y con el tiempo lo administra bien. A lo ultimo de la materia, especialmente con física óptica esta mal dada y con tiempo reducido. Pero hay un apunte que complementa en la fotocopiadora muy bueno. Cuando curse, creo un grupo de WPP donde era unidireccional y planteaba ejercicios de concepto donde explicaba en la próxima clase (si no lo veias y te preguntaba, te boludeaba un rato).', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Te tenes que acostumbrar a que te haga preguntas en frente de todos y si no sabes te tiene tres horas dando vueltas', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Si sos de los que preguntan en clase, tenes que bancarte que te boludee un poco antes de responderte la duda', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Recomendada. Explica con claridad y llegas perfecto al final, pero la clase es medio desordenada. En el pizarrón no es muy clara y suele escribir chico. Insiste mucho con la participación en clase, y te hace hablar en frente de toda la clase. ', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Dentro de lo que hay para ofrecer en la materia, se puede decir que es buena. Llega con los temas al final (un poco apurada). Si preguntas cosas hacele con fundamentos y no solo por preguntar porque te vas a comer la boludiada de la vida. Mas alla de eso es una buena opcion.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Me hace mal leer tantos comentarios positivos sobre esta persona. NO la recomiendo para nada. Empieza explicando bastante bien, hasta que arranca con temas complicados. A partir de ahí, el nivel de sus teóricas baja preocupantemente y no se llega bien preparado al segundo parcial ni al final. En nuestro curso, el segundo parcial lo aprobó menos del 10% y los últimos temas los tuvimos que aprender solos. Como si fuera poco maneja un humor super áspero y desagradablemente repetitivo. HUYAN DE ESTE CURSO.', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Es un desastre que la recomienden tanto. Al principio da una falsa impresion de que es buena profesora porque los temas son de baja dificultad. Cuando la cosa se pone mas dificil ahi vienen los problemas. No explica bien, no organiza sus clases, la ultima parte de ondas(tema totalmente nuevo) la da a los pedos si es que la da, con unos power points que tiene errores y son del año 2000. Para rematarla los de la practica son igual o peores. NO RECOMIENDO ESTE CURSO. Es una muy mala combiancion. Prioricen fisica y de ultima analisis van con la segunda opcion. ', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Organiza mal la clase, repite mucho cosas que si bien sirven, no hacen al tema. Si bien explica y da clases, cosa q no todos hacen, para mi fue mas facil ver videos de fontana (recomendado) que ver 1,30hrs de teorica, donde mucho tiempo se pierde hablando. Hace toda la deducción de las formulas, pero quizás no da tanto los tips que te ayudan a darte cuenta cosas q no pueden pasar/que cosas sirven para los ejercicios. No graba clase y no te autoriza a grabar. Te gasta y si bien te responde, si sos mas timido puede incomodarte a preguntar a futuro. Las teoricas rescatan algo pq las ayudantes explican bastante y fundamentan los ejercicios/ayudan mucho. ', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Trata mal a los alumnos. Practicamente no se le puede hacer preguntas en clase. ', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Da clases pero no graba videos solo los audios, asi que es la pedo, trata mal a los alumnos, se hace la chistosa y es un desastre.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'La verdad que corisini es un desastre 0 recomendada, intimida mucho a los alumnos, si pueden anotarse en otra catedra anotense, la teorica de corsini un horror.', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'explica bien, pero medio desorganizado y cuesta seguir la materia', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Insiste en nunca grabar los zooms porque tuvo "malas experiencas en el otro cuatri". Con esto tenemos dos desventajas grandes: Lo peor del online que es el poco feedback que el profesor recibe del alumnado sin lo mejor del online que es el poder rever las clases. Eso hace que, aunque explique bien, sea complicado seguir la materia. Ademas, para cumplir con los horarios estipulados en la catedra, usan los zooms de 40 min que si se cortan se cortan, no esta muy bueno.', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'a partir del primer parcial entrabas a la clase a las 8:00 y hasta las 8:30 estaba acusando a los alumnos de que segun ella seguro se habian copiado, de como no se participaba lo suficiente en el campus.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica como el orto y mete miedo pero los parciales vienen con moño', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Los que dicen que es maltratadora exageran, tal vez se intimidan por el tono de voz: la mujer habla a los gritos y no escucha bien, así que le tenés que gritar para que te entienda. Contesta mails rapidísmo y es puntual. Fomenta la participación en clase (no es nada del otro mundo, te pregunta algo de la clase y si respondes mal o estás medio perdido, te ayuda). También da claves para el integrador y si habla de ejercicios de parcial, presten atención porque seguro los toma. Sus PDFs eran bastante buenos. Sus teóricas presenciales fueron mejores que las virtuales. Este cuatri lo malo es que tuve que ver óptica geométrica por mi cuenta, porque no lo llegó a dar y algunas clases se perdieron por feriados, a mí parecer faltaron algunas más para ver cuerpo rígido.', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'Explica bastante bien, el problema es que es de boludearte si te ve distraído o le haces alguna pregunta tonta lo cual hace que dudes a la hora de preguntar. No me gusto como se dieron los últimos temas de la materia porque se dieron muy rápido y en diapositivas. ', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Corsini es una genia ', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Cuando tiene ganas explica excelente porque tiene mucha pedagogía y le gusta, pero pierde muchísimo tiempo gastando alumnos y retando, no me sirvieron sus clases.', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2018', 'Explica extremadamente bien. de manera clara y medianamente prolija. Pero sus clases son lisa y llanamente invivibles. Una tensión constante de que te agarre por una milesima de segundo distraido, te pregunte algo imposible de responder, porque siempre lo hace. Tiene la necesidad de siempre, en cada cuatrimestre tomar a una o mas personas de punto. Los cuales son motivos de comentarios o bromas durante todo el cuatrimestre, y se ven obligados a reirse y simular entretenimiento para que no los destruya a la hora de corregir un examen.', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Muy buena profesora hasta cuerpo rígido, después decae y se vuelve muy dificil seguirla. Los ultimos temas (ondas y optica) bastante mal la verdad, no llego y bastante a las apuradas', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es la que lleva la materia al hombro. No voy a negar que es muy organizada (no se pierde una clase, siempre envió mails con cronogramas/novedades/actualizaciones y todas sus clases las prepara con powerpoints) pero su actitud como profesora es atacante, nunca va a dejar pasar una discusión hasta tener la razón o hasta que el alumno justifique correctamente todas y cada una de las palabras que salieron de su boca. Entiendo que su intención es preparar al alumno y "hacerlo pensar" (o eso dice) pero su tono y actitud terminan por incomodar y reprimir en lugar de ayudar. Si buscás un desafío definitivamente es con ella pero no recomiendo.', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Maltratadora. Participas una vez en una clase y te hace arrepentir. Muy muy desconsiderada.', '0ebfb184-7125-48ed-9421-252241482266');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Bastante claro explicando las teóricas, no mucho más que decir', '9d6dd080-ef32-4ab2-abd2-7713a6b50271');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Da las teóricas del curso SP y se queda corto con los temas, mas que nada con los últimos que son los que entran en el final si o si.', '9d6dd080-ef32-4ab2-abd2-7713a6b50271');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Muy buen profesor, explica claro y no tiene problema en explicar un tema hasta que se entienda, da las clases en powerpoint y después los sube al campus para que la gente preste más atención mientras él explica así no hay que anotar', '9d6dd080-ef32-4ab2-abd2-7713a6b50271');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Va muy lento, da vueltas en cosas innecesarias para terminar un ejercicio aunque se le termina entendiendo. No tiene problemas en responder dudas', 'd011f713-9be8-46d9-b8bb-127f95ba19a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'El y garcia los dos mas flojos,este es un poco mas buena onda', 'd011f713-9be8-46d9-b8bb-127f95ba19a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'muy lento y aburrido para explicar, le busca mucha vuelta al ejercicio', 'd011f713-9be8-46d9-b8bb-127f95ba19a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muuy lento con las explicaciones, haciamos 2 ejercicios en 2 horas. Es un buen tipo y fomenta la participación , pero me gustaria que sus clases fueran mas dinamicas', 'd011f713-9be8-46d9-b8bb-127f95ba19a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explicaba la parte practica. Al igual que Anzorena, se la pasaban hablando media hora en horario de cursada sobre el covid, perdiendo tiempo de clase. En cuanto a sus explicaciones, eran buenas, explicaba ejercicios mediante diapositivas y decia conceptos clave.', 'd011f713-9be8-46d9-b8bb-127f95ba19a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buen trato con los alumnos, explica lento y sereno, hace bien los ejercicios explicando MUY detalladamente (eso es bueno y malo a la vez ya que haciamos muy pocos ejercicios en la practica). Tengo entendido que es el que hacia los parciales (de los mas accesibles de fisica 1), bastante bueno corrigiendo', 'd011f713-9be8-46d9-b8bb-127f95ba19a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un ídolo de JTP, las practicas buenísimas ', 'd011f713-9be8-46d9-b8bb-127f95ba19a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No me gusto mucho sus clases porque no le entendía muy bien lo explicaba aunque le ponía buena onda ', 'd011f713-9be8-46d9-b8bb-127f95ba19a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Daneri es un buen ayudante ya que explica los ejercicios que hace de forma correcta y pausada.', 'd011f713-9be8-46d9-b8bb-127f95ba19a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Hacia ejercicios muy sencillos de la practica y tardaba mucho, si estabas muuy perdido te podía llegar a servir pero la mayoría de las veces era una perdida de tiempo, cosa que no sobra', 'd011f713-9be8-46d9-b8bb-127f95ba19a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Buen docente de práctica', 'd011f713-9be8-46d9-b8bb-127f95ba19a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'A Claudio no se le entiende nada.', 'd011f713-9be8-46d9-b8bb-127f95ba19a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Curso 08-Ferrini-Martínez Stenger-Suarez Anzorena
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Celeste es muy agradable y se nota que sabe mucho y que además, está muy dispuesta a aprender de sus compañeros. A mi parecer todavía le falta un poco de experiencia dando clases, a veces te perdés en medio de sus explicaciones por más de que estés prestando muchísima atención, sobre todo por los nombres de las variables que asigna o porque capaz va y viene, y no se termina de entender. Tampoco alienta mucho a la participación en clase, generalmente sus preguntas las termina respondiendo Garea o quedan a medias. No estuve muy de acuerdo con su corrección de uno de los TPs en el cual nos bajó muchos puntos (50%) por un tema de orden en el que habíamos puesto la información. De todas formas, se destaca su compromiso por su trabajo y se nota que tiene muchos conocimientos y a la vez ganas de aprender.', '0c3b65e9-1b4f-4590-bbd3-a2a578f0f954');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Tiene todas las ganas de enseñar, pero marea y se enrieda bastante. A veces esta explicando otro profesor y ella mete alguna pregunta o comentario que demora la explicacion que venia dando el otro lo mas bien. Tambien es la que mas contesta en el campus.', '0c3b65e9-1b4f-4590-bbd3-a2a578f0f954');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es buena explicando pero a veces es medio densa la explicación y es fácil perderse. Salvo eso, muy buena con las dudas.', '0c3b65e9-1b4f-4590-bbd3-a2a578f0f954');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Junto con Laura, son las que explican la teoría y algunos ejercicios. Es muy buena profesora y se nota que sabe de la materia pero cuando explica algún tema no cierra bien los conceptos y marea un poco. Siempre responde las consultas del campus. ', '0c3b65e9-1b4f-4590-bbd3-a2a578f0f954');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Celeste es muy buena y amable pero a la hora de explicar se enrieda bastante y le da mil vueltas a todo lo que trata de explicar. Aparece una vez por clase casi siempre y lamentablemente son las partes que te empezas a perder un poco con los temas. Fuera de eso contesta todo rapido y tiene un buen trato.', '0c3b65e9-1b4f-4590-bbd3-a2a578f0f954');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Super macanuda pero se vive equivocando. Dando clase nos marea y se marea.', '0c3b65e9-1b4f-4590-bbd3-a2a578f0f954');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'celeste no sabe explicar. se marea sola y pretende que le contestemos cuando es difícil seguirle el hilo. virtualmente hace PDF extras para los ejercicios que honestamente no aportan nada a la física del problema. tampoco es muy amable para contestar cuando se le pregunta algo.', '0c3b65e9-1b4f-4590-bbd3-a2a578f0f954');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', '[2c 2016] Celeste es especial, explica los problemas que da de una manera que queda poco clara y no sabe contestarte ejercicios de la guía pero algunas cosas las sabe. No sé como será ahora.', '0c3b65e9-1b4f-4590-bbd3-a2a578f0f954');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Buena profesora, pero habian algunas clases que no terminaban de cerrar del todo los conceptos. Respondio dudas planteadas en campus, uso pizarron para algunas explicaciones al igual que chiabrando y estuvo en casi todas las clases. Siento que falto un poco más de claridad con algunos conceptos dados en los últimos dos temas pero no es algo afecte en gran medida su actuar en este cuatrimestre.', '0c3b65e9-1b4f-4590-bbd3-a2a578f0f954');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'La verdad más o menos, mi profesora menos favorita de este curso. Explica con powerpoints medio feos que la mayoría de las veces tienen errores y llega un momento en el que no sabes si vos no estás entendiendo o es porque lo que estas viendo está mal. Suele cometer errores explicando y a veces tuvo problemas de wifi.', '0c3b65e9-1b4f-4590-bbd3-a2a578f0f954');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'explicaba ejercicios y arranco bien, pero ya para el final del cuatri se cayo a pedazos. Los power points que usaba a veces estaban sobrecargados de información y te confundían, eso sumado a que algunas veces se enredaba en las explicaciones. Como dije, al principio se le entendía bastante y pude seguirla, pero ya para el final la verdad es que no le entendía nada y era preferible no prestarle atención porque te terminaba confundiendo mas. Destaco igual que era la única que respondia las dudas del campus, casi siempre adjuntando un archivo donde resolvía el ejercicio para que veas como hacerlo bien', '0c3b65e9-1b4f-4590-bbd3-a2a578f0f954');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'No hace buenos PowerPoints y a veces se nota que no tiene mucha paciencia. Sin embargo siempre responde con la mejor, tanto en el campus como en plena clase. ', '0c3b65e9-1b4f-4590-bbd3-a2a578f0f954');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Celeste es la única docente realmente mala del curso, da mucha pena, porque se nota que le gustan los temas y les pone mucha onda, pero simplemente explica mal. Creo que no hubo ejercicio de este cuatrimestre que haya presentado y no haya tenido errores, hasta a veces eran errores que la verdad eran medio graves. Se tarada BOCHA en explicar cada ejercicio (aprox 1h si es un ejercicio completito), va super lento y se traba sola, también incita mucho la participación en clase, pero por como explica la verdad es que es imposible seguirla.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'A veces se enreda con lo que dice pero a fin y a cabo es buena profe', '0c3b65e9-1b4f-4590-bbd3-a2a578f0f954');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Si bien tiene buenas intenciones, a la hora de explicar es poco claro. ', '4df0d29c-82b0-4c6b-95f2-c2a2bae06893');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'El peor profesor del combo de la comision,pero por lejos. Se presentaba una vez a la semana(como todos los profrsores) y siempre 10:50 le decía a Sergio Rossi,"y Rossi,como venimos de tiempo?" Con un tono soberbio y como sintiéndose superior,para terminar dando una clase de con toda la furia media hora(debería ser 2),si le pedías un ejercicio en específico que no fuer algo del pp que haya armado el,te va a decir que "no se siente apto" y al rato se va a ir,si es que no te contesta con el mismo tono que le habla a sus compañeros.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Ferrari no tiene criterio propio y sus clases son contraproducentes, mal docente', '4df0d29c-82b0-4c6b-95f2-c2a2bae06893');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Otra vez como Juan el responde en el foro y la verdad que por el foro le entendi bastante, aunque otra cosa son las clases, las da con ejercicios de pdf que no se entienden nada. Concurri desde el principio del cuatrimestre hasta el primer parcial, y la verdad que los ejercicios que ponia, o se podian hacer mas faciles o el los complicaba mas. Ademas, cuando le queres preguntar algo de un ejercicio por ser el horario de la practica, o te manda a preguntar al foro que contestan cada muerte de obispo o te dice "No estoy calificado para responderte". La verdad que me estrese mas de lo que tendria con esta catedra, no la recomiendo para nada', '4df0d29c-82b0-4c6b-95f2-c2a2bae06893');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'los ejercicios los presenta bien tanto en el pizarrón como en las cales virtuales con los PDF, pero la explicación muchas veces confunde mucho y marea lo que estando escrito ya se entiende.', '4df0d29c-82b0-4c6b-95f2-c2a2bae06893');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'QUE LETRA FEA que tiene ese tipo. A veces no se le entendía nada', '4df0d29c-82b0-4c6b-95f2-c2a2bae06893');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Explicaba bien en el laboratorio', '4df0d29c-82b0-4c6b-95f2-c2a2bae06893');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2018', 'Las pocas cosas que dió algun tema en el pizarrón, lo hizo de la manera mas complicada y confusa que podria haber. Un tipo que ante la mas minima duda, no va a saber qué contestarte y te va a dar como respuesta algo nada que ver a lo que fue tu preguntas original. Además de que al momento de contestar estas preguntas lo hace en un tono de soberbia y sobraduría absoluta. Bastante desagradable la experiencia con él. En especial siendo el jefe de laboratorio de mi equipo.', '4df0d29c-82b0-4c6b-95f2-c2a2bae06893');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Demasiado exigente para corregir TPs, y poco claro al explicar.', '4df0d29c-82b0-4c6b-95f2-c2a2bae06893');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Con Conde, lo peor del curso. Es un desastre, no se le entiende nada cuando explica. ', '4df0d29c-82b0-4c6b-95f2-c2a2bae06893');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Es un tipazo, ayuda en los alumnos en todo lo que puede y trata de hacer la materia lo mas aprobable posible (sin regalar), lamentablemente no es muy claro explicando, pero lo dicho anteriormente es mucho mas de lo que se puede decir de otros profesores de esta materia', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Ferrini es, sin lugar a dudas, el profesor que necesitás en tu primer cuatrimestre en la FIUBA. Te ayuda a aprobar la materia, su curso en general es bueno, explica bien dentro de todo, e incluso te reís en sus clases. Eso si, sentate adelante de todo.', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Me gustó tan poco este profesor que terminé dejando física. No es mal tipo, busca acercarse a los alumnos y hacer las clases llevaderas pero termina cayendo en chistes de gente trans y chistes sexuales de minas que pone incómoda a la mitad de la clase, y siempre se la agarra con Garea. De la teórica no se entendía nada, ni un ejercicio de la guía podía hacer con los apuntes de clase. La gente que conocí de este curso terminó yendo a particular o estudiando sola de un libro, sinceramente no vale la pena. Como da muchas oportunidades, es excelente para recursantes que ya saben física. Tiene buena predisposición para contestar dudas pero nunca me transmitió ningún concepto. Tampoco llegó bien con los temas del final.', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy poco claro explicando. Saca todo "de la galera" y no tiene muy bien organizadas las clases. No es recomendable si no sabés física antes', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Asiste siempre que puede, en eso es impecable. Si vé que no llega con los temas (no llega) o pierde una clase por cortes/paros, organiza clases extraoficiales para recuperar. Tan así, que mientras rinden recuperatorios (la mayoria del curso) él sigue dando clases, a mi me tocó perderme hidrodinámica. Tiene un buen trato con los alumnos, hace las clases llevaderas, cuenta chistes (algunos, a mi parecer, fuera de tono/lugar, puede haber gente que se sienta ofendida) y hace demostraciones, por ejemplo en óptica. A mi me costó mucho entenderle, no creo que sea muy claro, tampoco diría que es malo. Odia a medio departamento de física parece. Sobre si acepta critica fundamentada voté 3, porque no tengo idea.', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Un asco de profesor, chistes y comentarios muy machistas, mas de la mitad de las mujeres de mi clase dejaron la materia por eso. El nivel de sus teoricas es bajisimo porque da poco contenido y se enrrosca en pavadas y sus parciales son los mas dificiles de todas las catedras', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Lo odie', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Recurse la materia con el. Era como no ir a cursar, daba un ejercicio por clase, que se lo complicaba solo de lo desorganizado que es, y el resto del tiempo se la pasaba hablando de Pampita. Desagradable como profesor. Comparada con el resto de las catedras rendiamos el primer parcial como un mes despues, cosa que te da a entender que no explico nada de los ultimos temas (ondas y optica). Tampoco daba hidrodinamica. ', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'En términos generales me pareció buena cursada ,las clases son una introducción teórica ,deduciendo las formulas, generalmente en una hoja A4 ,a veces la forma de explicar de Ferrini la percibí un poco desprolija , después Viñales Daniel resolvía ejercicios , compartiendo su pantalla , Daniel explica muy bien y le entendí todo, pidieron dos Tps en grupos bastante livianos pero tardaron en corregirlos.Curse los Martes y Viernes a la mañana.', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es un buen tipo que te va a ayudar a aprobar, pero sus clases avanzan a veces muy lento, por lo que (en mi cuatrimestre) no llegamos a ver nada del ultimo tema, y tuvimos que estudiarlo por nuestra cuenta. Sacando eso, demuestra de donde salen las formulas a usar y da ejemplos utiles en la clase (aunque se va un poco de tema a veces y se extiende). Pero siempre esta dispuesto a dar horas extra para compenzar, con una muy buena actitud aunque sean las 7am. Buenos chistes :)', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buen profesor, explica bien de manera Virtual, quizás un poco lento, de modo que no llegamos a ver bien el último tema de la materia. Bastante exigente a la hora de corregir, no te perdona una.', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No me gusto, eso de las manos mágicas era un mamarracho. Hablar de fútbol o x tema, media hora o más era molesto.', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Pésimo profesor, recurse la materia por la mala calidad de sus clases, no se supo adaptar a la virtualidad y se nota demasiado. Escribo solo esto y me quedo corto, pero bue.', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explicaba la parte teórica. Muy pobre en cuanto a calidad de explicación. No se maneja muy bien con la tecnologia. Explica mostrando con una cámara a una hoja con mala calidad de imagen, haciendo que no se entienda mucho y yéndose de tema y haciendo chistes a cada rato. Tampoco aceptaba muchas criticas en su explicación, decirle la palabra Fontana es como un mandamiento para él. Era muy dificil estar enfocado 2 horas mirando a una hoja con mala calidad y con una explicación desprolija. No recomiendo cursar con el. Se nota que sabe y quiere demostrarlo, pero estaría bueno que se adapte un poco mas a las clases virtuales. Tuve que dejar de asistir y mirar los videos de Fontana.', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No me gustó para nada. El que te diga que es genial para tu primer acercamiento a física en el primer año y bla bla bla, no le creas, es una trampa. Vas a terminar con el bocho quemado y sin entender nada. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', '
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es buen profesor, trata de explicar, pero hay veces que se le hace complicado transmitir.', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Me pareció bien, ni el mejor ni el peor, tuve que ver las clases de fontana en youtube para aclarar temas porque no es muy organizado y a veces no le entendia mucho, pero estaba dispuesto a responder dudas ', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se nota que sabe mucho, pero yo no entendí sus clases. Es bastante desorganizado y hace algunos chistes buenos pero la mayoría son malos. siempre me aburría mucho con sus clases virtuales. no lo recomiendo', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es un profesor que para cursar por primera vez la materia es complicado ya que va muy rapido, es muy recomendable en caso de recursar la materia.', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Ferrini es un gran profesor y principalmente demuestra ser una gran persona. Considero que da la materia de una forma bastante pragmática. Trata de no extenderse en formalidades que pueden confundir a los alumnos para enfocarse en la parte de física de los contenidos. Si querés aprender siempre va a estar dispuesto a dar una clase de consultas o tomarse algo de tiempo para tratar de ayudarte.', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Curso 08-Ferrini-Martínez Stenger-Suarez Anzorena
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Curso 08- Lamentablemente no explica bien. Terminé entendiendo más con material de cátedras ajenas que con Él. Sabe mucho pero debería cambiar su metodología de enseñanza, actualizarse, cómo sus colegas de curso...', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'No lo recomiendo para nada. Deberia cambiar los metodos de explicacion y los comentarios fuera de lugar que hace para explicar ejercicios. ', '4a5339e6-4dfc-417c-9ab4-53c711a190e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Un crack, explica muy bien. Hace ejercicios y da ejemplos para que se entienda.', '7daf1f1e-1a04-4b78-8990-b922e8c3748d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buen profesor, a veces va rápido y cuesta seguirlo, pero no tiene problema en que lo paren ni en responder dudas. Catedra recomendada.', '7daf1f1e-1a04-4b78-8990-b922e8c3748d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Marcelo es god. Todos los de otros cursos se meten a sus clases porque es el que mejor se adaptó a la virtualidad. Da clases sincrónicas que son clave para entender los temas. Es super responsable. Sus diapositivas estan buenísimas porque tienen todas las fórmulas a usar y pequeños resumenes de los temas. Al principio va medio rápido para poder detenerse a explicar con detalle Sistema de Partículas y Cuerpo Rígido que son los temas más dificiles de la materia. Casi ni asistí a la práctica pero las teóricas me salvaron. El curso es medio exigente con la entrega de cuestionarios obligatorios (todas las semanas), trabajos prácticos grupales y trabajos de laboratorio. Cuando dijeron que había trabajos grupales me dio mucha paja pero gracias a eso me hice un grupito de facuamigos, asi que está bueno.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'La mejor cátedra. A veces sentís que va a los pedos pero está bueno porque se ocupa de dejarle buen tiempo a los temas más difíciles como cuerpo rígido.', '7daf1f1e-1a04-4b78-8990-b922e8c3748d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Verdaderamente un genio. Hace que entiendas muy bien la materia, aunque quizá iba a los pedos, las partes que requerían de su tiempo se lo dedicaba y dejaba todo muy en claro. Respondía cualquier tipo de dudas y le encantaba que participemos. Es una lástima que el horario coincida con el de Maulhardt pero si llega a volver a ser semi-presencial recomiendo anotarse en ambas cátedras a la vez, ya que los martes con Fontana fueron virtuales y te permitía ir presencial con Martín y luego ver la teórica grabada en casa. Si bien arrancó muy exigente con el primer parcial, fue muy comprensivo y quería que entendamos y aprobemos la materia, así que en cuerpo rígido le bajó la dificultad. ', '7daf1f1e-1a04-4b78-8990-b922e8c3748d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El mejor en lo que hace POR LEJOS. Explica muy claro, sus videos son excepcionales (literal que todos los otros alumnos vieron sus videos y se llevaron aprendizajes muy valiosos). Las clases fueron bastante dinámicas (incluso las virtuales). Quizá hubiese estado un poco mejor que le dedicara un poco menos de tiempo a los temas del 2do parcial, porque para el tercero no hubo casi tiempo.', '7daf1f1e-1a04-4b78-8990-b922e8c3748d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Las clases a veces son un poquito tediosas, pero me parece que es así porque la materia es medio densa. Además si no le avisan que la letra es chiquita la va a seguir escribiendo de esa manera. PERO ES UN PROFE DE 10.', '7daf1f1e-1a04-4b78-8990-b922e8c3748d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'No curse con el pero me vi todas sus clases subidas a youtube, me salvo el cuatrimestre explica muuy bien ', '7daf1f1e-1a04-4b78-8990-b922e8c3748d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'No curse con el pero me vi todas sus clases subidas a youtube, me salvo el cuatrimestre explica muuy bien ', '7daf1f1e-1a04-4b78-8990-b922e8c3748d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Aunque Fontana se vaya muchas veces por las ramas, es un profesor que explica el tema de forma muy completa. Sin embargo, es altamente exigente en la corrección de trabajos prácticos y parciales (todos los ejercicios tienen que estar minimamente bien para aprobar). Recomiendo más ver sus videos de youtube, que son mejores que sus clases presenciales.', '7daf1f1e-1a04-4b78-8990-b922e8c3748d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Explica para el orto', '6f27d225-d2b2-4415-bb80-d9584bb7b16b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Es medio denso explicando, sobre todo en comparacion con Moreno. Mas alla de eso, responde consultas y es buena gente, aunque quiza un poco exigente corrigiendo.', '6f27d225-d2b2-4415-bb80-d9584bb7b16b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'simplemente un capo , si no le pones onda te parece que explica para el culo, pero eso es porque no estas al dia, si mantenes al dia las clases el loco te re simplifica la vida , quiza se pone un poco tecnico pero es fundamental para entender cuerpo rigido porque soluciona los ejercicios de manera muy sencilla y como si no fueran nada.Repito si tenes la materia al dia te ayuda demasiado si no la tenes al dia cagaste , andate de su practica porque vas a perder 2 horas.', '6f27d225-d2b2-4415-bb80-d9584bb7b16b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es exigente corrigiendo las tareas, no explica tan bien los ejercicios como Vilaseca pero siempre responde en el campus y le pone onda para que entiendas', '6f27d225-d2b2-4415-bb80-d9584bb7b16b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Me pareció el mas atento en toda la cursada. fue el que mas contestaba en los foros aunque a veces tardaba mucho en responder.', '6f27d225-d2b2-4415-bb80-d9584bb7b16b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es re bueno, sus videos no son tan claros pero en las clases de consulta se le entendía todo perfecto. Ojalá hubieran organizado más clases.', '6f27d225-d2b2-4415-bb80-d9584bb7b16b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'lo amo', '6f27d225-d2b2-4415-bb80-d9584bb7b16b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Lo mejor del semipresencial, siempre daba las prácticas él, re interactivo y claro explicando.', 'f26e3c77-a3aa-4666-a865-10bf65bb40c4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Un crack Gonzalo, explicando de 10 y muy dispuesto a responder dudas y ayudar en clase', 'f26e3c77-a3aa-4666-a865-10bf65bb40c4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Responde dudas porque administra el campus en general, pero la verdad es que es un docente horrible. Desubicado y encima malo.', '67f32190-48f3-4d8f-b8ec-62cf489648ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Me gustaba como entregaba los ejercicios, se entendian mucho', '67f32190-48f3-4d8f-b8ec-62cf489648ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Creo que ni sé quién es. Así que asumo que es Pablo, un impresentable que dio la peor práctica de todo el cuatri, y que boludeó a los que hicieron algo mal en el 1er parcial.', '67f32190-48f3-4d8f-b8ec-62cf489648ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', ' Varias veces cuando un compañero preguntaba algo en la práctica, en vez de explicarle, le decía dos boludeces que ni ayudaban y con mal tono.  No me gustó para nada como profesor', '67f32190-48f3-4d8f-b8ec-62cf489648ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un desastre, pesimo docente, la verdad de lo peor que hay. No sabe nada y para peor, cuando le consultas algo no responde con la excusa de “dejar pensar al alumno” y encima boludea. Nefasto.', '67f32190-48f3-4d8f-b8ec-62cf489648ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un asco de persona. Trata de idiota a todo el mundo. Encima es mal profesor, un desastre.', '67f32190-48f3-4d8f-b8ec-62cf489648ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Me dicen por cucaracha que este es un re salame, just saying', '67f32190-48f3-4d8f-b8ec-62cf489648ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica bien pero por ahi se distrae con otros temas, por ahi tira comentarios no adecuados', '67f32190-48f3-4d8f-b8ec-62cf489648ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Cuando es clase presencial es bueno resolviendo los ejercicios yendo al grano sin dar tantas vueltas. Lo unico malo es que no se banca mucho que le hagan preguntas que tienen que ver con "cuentas". En las clases virtuales ya venia con el ejercicio hecho y te explicaba muy por arriba que es lo que tenias que hacer y te confundia. Un poco exigente corrigiendo parciales.', '67f32190-48f3-4d8f-b8ec-62cf489648ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Las clases presenciales son su fuerte, en las virtuales es desordenado.', '67f32190-48f3-4d8f-b8ec-62cf489648ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'hay clases que es bueno explicando y otras que si le haces una duda prefiere no responder porque "no puede perder tiempo", a pasado que si alguien hacia una duda decía que eso ya debería saberse y no respondía ', '67f32190-48f3-4d8f-b8ec-62cf489648ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Este ayudante no explica de forma adecuada. Es rápido, poco conciso y muy poco claro. Sus dibujos o remarcaciones confunden más que ayudar (especialmente en modalidad virtual). No está abierto a preguntas.', '67f32190-48f3-4d8f-b8ec-62cf489648ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No acepta que le hagas preguntas del procedimiento porque según el es "perder tiempo" (y después mirando tranquilo en tu casa te das cuenta que lo hizo para el tuje). Sus ejercicios son muy "técnicos" por así decirlos, se pierde en detalles cuando ni siquiera entendiste lo importante del ejercicio y eso te hace perderte mas.', '67f32190-48f3-4d8f-b8ec-62cf489648ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un desastre.  Muy malo, si te puede ningunear te ningunea. No se le entiende nada cuando hace prácticas virtuales', '67f32190-48f3-4d8f-b8ec-62cf489648ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Explica muy bien y ayuda con las dudas que uno tiene en los TPs y la práctica. Es gracioso y hace llevadera la clase', '67f32190-48f3-4d8f-b8ec-62cf489648ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'No es mal profesor, hace demasiado largos los ejercicios y te perdes', '67f32190-48f3-4d8f-b8ec-62cf489648ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Clara cuando ayuda en las prácticas.', 'b729b65c-bd6a-451c-886e-e8b1416fd0ad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Una capa Romi, si bien a veces no sabía bien como explicarte algunas cosas y se confundía ella y medio te hacía confundir a vos también, nunca tuvo problema en explicar las cosas las veces que hiciera falta hasta que lo entendieras.', 'b729b65c-bd6a-451c-886e-e8b1416fd0ad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Romina una genia, se nota que sabe un montón y siempre intenta ayudar. Si no se acuerda algo lo busca hasta poder respondertelo, la mejor onda.', 'b729b65c-bd6a-451c-886e-e8b1416fd0ad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un amor Romi. Sabe bastante y se preocupaba porque aprendamos bien. Mandaba a hacer ejercicios en cas apara ponerlos en común y discutir entre todos.', 'b729b65c-bd6a-451c-886e-e8b1416fd0ad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Romi es muy copada y atenta a consultas. Siempre se notó que le gustó explicar, y siemprefue clara.', 'b729b65c-bd6a-451c-886e-e8b1416fd0ad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Da la practica, es excelente explicando ejercicios!', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Demasiado políticas (algunas de ) las clases como para que sean de física. No corresponde.', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Indelicato me pareció una genia la verdad. En todas las prácticas hace una banda de ejercicios y junto con los ayudantes te contestan cualquier duda que tengas, unos copados.', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No explica mal, pero tampoco es wow. Es exigente, pero creo que hay una diferencia entre exigir y hacer llorar a los alumnos. No me gustaron mucho las prácticas con ella porque me pareció muy soberbia.', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'La odié, deje la materia por Evangelina. Cero paciencia, te habla mal, y en vez de explicarte las cosas te reta por todo lo que decis o haces mal de los ejercicios. Tras que la materia no es muy llevadera, esta mujer lo empeora, cero motivación te da. En el grupo de whatsapp del curso llegamos a decir que era el grinch jajajajaja', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Su trato con los alumnos no es muy bueno, cuando un tp no tiene todo justificado, te putea xq esta incompleto, pero si justificas todo te putea xq dice que hay cosas que se sobreentienden y no hay que explicarlo, asi que no hay mierda que le venga bien. Ademas sus explicaciones no son muy claras, asi que no la recomiendo para nada', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'La unica vez que la vi sonreir fue cuando *riendose* dio la nota de los parciales diciendo que nadie habia aprobado excepto 4 personas. Te transmite que no disfruta de hacer lo que hace.', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Evangelina explica bien los temas de las practicas cuando le toca darlas, es exigente a lo hora de corregir los TPs, POGs y los parciales. Insiste en que dejemos dudas de los ejercicios en el campus, si bien los responde, esperaba a que TODOS participemos por ahí, cuando lo hacían unos pocos.', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Exageradísimos los que dicen que eva no tiene buen trato, es verdad que tiene el caracter un poco fuerte pero no es para tanto. Es muy buena y clara explicando los ejercicios.', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La verdad que le tenia miedo, habia leido que era muy maltratadora, pero no fue asi. Cada tanto talvez se calentaba, pero nada del otro mundo, pero la mayor parte del tiempo te explicaba los temas y respondía dudas de lo más bien, y tambien se le super entendia. Las prácticas precenciales de los primeros temas no me gustaron para nada, te daban un ejercicio de tipo parcial del tema que habiamos visto esa semana y nos dejaban solos por más de la mitad de la clase para que lo resolvamos, y despues recién los últimos 30/20min se ponían a resolverlo en el pizarron, por lo que a veces ni terminaban de resolver el ejercicio. Después en las prácticas virtuales si se turnaban entre los distintos profes y resolvian ejercicios, y se hacia la clase más didáctica. Y después para los temas de óptica (virtuales y presenciales) las clases fueron mucho más didácticas y llevaderas, hacíamos varios ejercicios para entender y tambien hicimos un par de experiencias. ', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Me parece una muy buena profesora. Sabe lo que está enseñando y le gusta transmitirlo.', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica bien, el la clase virtual hace un montón de ejercicios, super clara pero en la clase presencial te dejaba con un ejercicio más de 1h para que lo resuelvas y a lo último lo resolvían, siento que no sirve eso porque se pierde tiempo que podrían usar para hacer muchos más ejercicios en el pizarrón. Igual es una genia y se nota que sabe un montón. ', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2014', 'Junto con Barasch, la otra pata de este combo nefasto. Soberbia como pocas, los parciales y correcciones más dificiles posibles, totalmente opuesto a las clases teóricas horribles de Barasch, y las clases prácticas (siempre te daban el ejercicio mas boludo, y en el parcial te asesinaban). Si le ibas a reclamar o preguntar por alguna corrección, te trataba como el orto. En su curso (seríamos cerca de 30), aprobaron 5 o 6, y porque "le caían bien". Una verguenza de docente.', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Muy prepotente, hacia preguntas en clase y no seguía la clase hasta que alguien respondiera y a quien lo hacia lo gastaba por equivocarse. Los pocos ejercicios que explico no llegaban a entenderse y no los terminaba. Cuando fui a consultarle cosas de la corrección del parcial me trato mal diciendo "Esto esta Horrible, así no pienses que vas a aprobar"', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Se vive quejando de que ella hace un esfuerzo por dar clases en pandemia, sin pensar en que a nosotros tmb nos cuesta, explica mal', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'La verdad una actitud súper mala, hasta medio soberbia. Te tira comentarios sarcásticos y es mala leche. Veiras es un amor y re buen profesor. Una lástima que su cátedra no esté al mismo nivel que otras por ella.  ', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'A cargo de las practicas, siempre estubo presente, se molesta muy seguido y su humor no es el mejor cuando hay poca participacion en clase. Hay ejercicios obligatorios en grupos por cada tema, lo hace un poco denso pero son sencillos y cuando te equivocas te corrigue de buena forma.', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Genia, vale la pena tomar esta cátedra solo por ella, sabe explicar muy bien con humildad académica, te traduce muy bien los problemas complejos sin que te sientas perdide.', '4977baf7-3e94-4fb3-8784-127d44cf6ea3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'En el curso 8 de Ferrini nunca apareció', '2b8ea5a4-fd81-461f-a2d4-e53feb17669c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Pablo ese mejor de las practicas , le gusta que participes . Muy claro
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Curso 08- Resuelve prolijamente los ejercicios, a veces se distrae y confunde nomás...', '2b8ea5a4-fd81-461f-a2d4-e53feb17669c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es una gran persona y se nota que le gusta lo que enseña pero muchas veces explica de más y complica demasiado los temas en comparación a otras cátedras.', 'ff5f4526-e33a-47ef-9294-9f76bec17c8f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica mucho algebraicamente, lo cual confunde y aburre. Se vuelve pesada la cursada. Se atrasa con los temas. Estan descordinadas la practica de la teorica. No la recomiendo. ', 'ff5f4526-e33a-47ef-9294-9f76bec17c8f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'La peor docente con quién me tocó cursar en mi vida, por su culpa hace quedar mal a toda la catedrá, que son chicos copados, pero ella es la JTP y hace el parcial, y lo hace con malicia, además es arbitraria a la hora de corregir los parciales, parece que ni los mira, vi gente con 2/8 preguntas bien aprobar, y gente con 7/8 desaprobar.', 'b32d4eda-58f0-4ce7-9a1b-18c259877755');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Trató mal a un ayudante (innecesariamente). Te complica la práctica al pedo. Una vez pedí revisión de un parcial y nunca más lo trajo. Después de semanas preguntándole me resigné porque era ingresante y no sabía que podía hablarlo con el coordinador de la materia. Sabe mucho y la tiene clara, eso sí, pero no es muy pedagógica. Lo que tiene en conocimiento no vale la pena según mi gusto.', 'b32d4eda-58f0-4ce7-9a1b-18c259877755');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Huyan de ella', 'b32d4eda-58f0-4ce7-9a1b-18c259877755');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No suelta el acelerador, cuando le toca dar práctica lo más probable es que te termines yendo. ', 'b32d4eda-58f0-4ce7-9a1b-18c259877755');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Lastimosamente tira abajo la catedra', 'b32d4eda-58f0-4ce7-9a1b-18c259877755');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'va muy rápido y se va por las ramas, a veces era mejor no prestarle atención y después ver los resueltos. Por suerte solo resuelve algunos ejercicios', 'b32d4eda-58f0-4ce7-9a1b-18c259877755');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es muy buena profesora y le importa mucho la motivación de los alumnos pero aveces habla demasiado rápido', 'b32d4eda-58f0-4ce7-9a1b-18c259877755');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'No se anoten con ella!!!!', 'b32d4eda-58f0-4ce7-9a1b-18c259877755');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Explica muy rapido, demasiado y es dificil seguirle el ritmo ya que suele explicar a lo ultimo de la clase, en un tiempo muy acotado y te dice 1000 cosas.', 'b32d4eda-58f0-4ce7-9a1b-18c259877755');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Explicaciones monótonas y aburridas y explica cosas que todavía no se vieron o explica de forma distinta a Garea y marea al alumno', 'b32d4eda-58f0-4ce7-9a1b-18c259877755');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es muy histérica y explica todo súper rápido, siempre te quedas recalculando ', 'b32d4eda-58f0-4ce7-9a1b-18c259877755');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'No pude entender sus explicaciones prácticas a lo largo de la cursada. MUY RÁPIDA.', 'b32d4eda-58f0-4ce7-9a1b-18c259877755');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'En general explica bien y tiene buena predisposición. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'De los mejores profesores que tuve hasta ahora, sus teoricas son oro puro, super organizadas, muy bien explicadas y no menos importante, te reis bastante y al menos conmigo, logro hacer que me interese por la materia.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Un tremendo profesor, la verdad me sorprendí para bien cuando curse esa cátedra. No la vi muy recendada ni nada, solamente la había elegido por los horarios y termino siendo muy buena. El profesor de vez en cuando hacía chistes sobre los temas, le ponía mucha emoción a cada tema dado y daba muy buenos ejemplos cuando se trataba de cosas un toque abstractas', '9e761c59-cb29-4adc-94b1-827a2f58a341');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Parciales complicados', '9e761c59-cb29-4adc-94b1-827a2f58a341');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Explica muy bien todo, paso por paso sin nada que saltearse. Lo que si, muy exigente corrigiendo', '9e761c59-cb29-4adc-94b1-827a2f58a341');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Un crack total, me saco el sombrero. Da las clases teoricas y no solo explica super claro, sino que ademas hace las clases re dinamicas al hablar de temas relacionados, hacer experiencias o contando chistes. Quiza es un poco mas exigente que el resto de cursos, pero si queres aprender y no dormirte mientras cursas, metete con el.', '9e761c59-cb29-4adc-94b1-827a2f58a341');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Son unos capos! Con la modalidad virtual se manejaron como unos campeones. Los videos que subieron son muy claros y didácticos Y las clases por zoom también lo son. Te hacen entregar un ejercicio Por semana aprox. Lo cual hace más llevadera la cursada porque te obliga a mantenerte al día.', '9e761c59-cb29-4adc-94b1-827a2f58a341');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Simplemente un excelente profesor. Cada tanto tenia problemas de conexion y no podia ir a clase, pero siempre que estaba daba excelente clase, y en caso de no estar daba clase alguno de los otros excelentes profesores de la catedra.', '9e761c59-cb29-4adc-94b1-827a2f58a341');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Las clases teoricas con moreno en la virtualidad no existen, sube videos grabados. Si bien explica re bien me hubiera gustado tener teorica por zoom.', '9e761c59-cb29-4adc-94b1-827a2f58a341');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Las teóricas fueron dadas por vídeos hechos por él, bastante concisos y entendibles, estaban buenos porque no parecía que estabas escuchando un audiolibro como pasaba con otros videos de la cátedra. igualmente era necesario ir a la práctica para realmente complementar y ahí se entendía perfecto. Así y todo, la mayoría de las veces estaba presente durante las prácticas y aportaba parte de los temas de la teórica. En general, se nota que le interesa que los alumnos aprendan bien', '9e761c59-cb29-4adc-94b1-827a2f58a341');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Si no te gusta mucho la fisica este profe no es para vos, porque es demasiado riguroso , a la hora de corregir muy exigente , pero explica de 10 en especial la primer parte ("trabajo y energia" y cuerpo rigido). pero reitero cuando corrige agarrate catalina.De todas formas salis aprendiendo un monton con este tipo y te hace cagar de risa tambien. ', '9e761c59-cb29-4adc-94b1-827a2f58a341');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'En su momento era el jtp del curso de Echarri. Exigente con la organización de la materia pero muy buen docente. Explica bien y te hace cagar de risa.', '9e761c59-cb29-4adc-94b1-827a2f58a341');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Sus videos explicando la teoria estan buenos, explica lento y bastante claro pero no me gusto esta catedra, no dan clases solo videos de youtube y de vez en cuando zoom para consultas, arrancaron el cuatri re atentos y con toda la onda pero a medida que pasaron los meses le empezaron a dar menos bola a todo, solo nos subian mil videos de youtube para ver y tuvimos que aprender los temas del tercer parcial practicamente solos, el tema del segundo parcial que es el mas importante de la materia lo dieron muuuuy mal y a las apuradas, aprobaron re pocos', '9e761c59-cb29-4adc-94b1-827a2f58a341');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica mal, no se cursa la materia no están muy pendientes de los alumnos. En general no recomiendo la cursada. No tienen ninguna clase organizada, no generan actividad en el campus, los temas no quedan claros.', '9e761c59-cb29-4adc-94b1-827a2f58a341');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Estuvo atento en la primera parte pero después fue estando ausente en la 2da y tercera parte. debería hacer sus propios videos sobre la ultima parte de la materia y explicarlos el mismo por que pone otros videos de otros profesores que no se entiende muy bien su explicación y obliga a tener que ir a buscar explicación en otro lugar. debería de hacer zoom los días de cursada y no c/ 2 semanas', '9e761c59-cb29-4adc-94b1-827a2f58a341');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es un crack explicando, imposible no entenderle. La última parte de la materia no subió ningún video suyo, y quedaron muchas cosas en el aire. Para la segunda parte hubiera estado bueno que de clases aunque sea una vez por semana.', '9e761c59-cb29-4adc-94b1-827a2f58a341');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'buen profe', '9e761c59-cb29-4adc-94b1-827a2f58a341');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Aparición bastante esporádica, lo tenía asignado mi grupo para la corrección de tps y ejercicios, no corrigió ni un cuarto de estos. Nos los deben haber considerados aprobados todos, porque aprobamos la cursada. Te dejo a tu criterio si esto es bueno o no', 'f03ef046-84b3-4597-9516-2338c6c56b44');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Una genia naty, super recomendada para la parte practica de la materia', '312ce77c-5b33-4c33-a351-b8fb0a8b0d0d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Para cumplir con los horarios estipulados en la catedra, usan los zooms de 40 min que si se cortan se cortan, no esta muy bueno porque a veces queda un tema por la mitad', '312ce77c-5b33-4c33-a351-b8fb0a8b0d0d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'muy copada, quizás no es del todo clara a la hora de explicar pero muy amable y te responde todas las dudas', '312ce77c-5b33-4c33-a351-b8fb0a8b0d0d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'buena profe para la practica pero siempre se le cortaba el zoom por la mitad y no llegaba a explicar bien el ejercicio', '312ce77c-5b33-4c33-a351-b8fb0a8b0d0d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Va rapidísimo en las explicaciones, pero armaba pdfs muy claros. Buena onda para responder consultas y buen trato con los alumnos.', '312ce77c-5b33-4c33-a351-b8fb0a8b0d0d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Con Toscani son la salvación de este curso, totalmente opuestas a las otras dos profesoras. Tienen muy buen trato, explican bien y se les puede hacer las preguntas que uno necesite por mas tontas que sean, las van a responder sin ningún problema. Ellas dan la práctica, permiten grabar las clases y son quienes responden en el campus siempre a disposición y buscando ayudar al alumno. Si se quiere ver o consultar sobre algún ejercicio en específico te dejan y también ayuda la resolución que dan a ejercicios tipo parcial en clases próximas a exámenes o clases de consulta.', '312ce77c-5b33-4c33-a351-b8fb0a8b0d0d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Decente maso pero linda persona,', '312ce77c-5b33-4c33-a351-b8fb0a8b0d0d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Hincha bolas y no sabe mucho, pero le pone muchas ganas', '8ca133e5-ca8f-4597-af3a-60b588613f81');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Explicó tres veces en todo el cuatri y no fue TAN malo. Pero el único TP que corrigio nos hizo la misma observación a todos los grupos, y cuando le fuimos a consultar, su respuesta fue "búsquenlo en Google".', '8ca133e5-ca8f-4597-af3a-60b588613f81');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Realmente nunca supe si este tipo existia o no, para mi es una figura virtual creada unica y exclusivamente para rellenar', '8ca133e5-ca8f-4597-af3a-60b588613f81');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Hace pocos aportess a la clase pero por lo general cuando resuelve ejercicios lo hace bastante bien.', '8ca133e5-ca8f-4597-af3a-60b588613f81');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Solo dió una clase practica y fue muy buena con varios tips para el tercer parcial', '8ca133e5-ca8f-4597-af3a-60b588613f81');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Fue a alguna que otra catedra y explico un solo ejercicio, pero los que explico los explico excelente. Muy buen docente', '8ca133e5-ca8f-4597-af3a-60b588613f81');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Subía ejercicios en formato PDF muy muy completos con síntesis de todo el incluso algunos con audio. Dio un par de clases nada más . Se le entiende muy bien y responde clarísimo por mail', '74c99969-0ab2-44e9-a880-96e42e5f7925');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Quizá el mayor exponente del curso, dió clases de consultas, cuando pude, y te responde los mail muy bien, super claro', '74c99969-0ab2-44e9-a880-96e42e5f7925');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Alguna que otra vez se enredó en lo que explicó, pero el 90% de las veces se entendía perfecto. En virtual se manejó bien, y con las consultas, en tiempos de finales, respondía muy seguido al grupo de wpp de consultas', '74c99969-0ab2-44e9-a880-96e42e5f7925');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es ayudante en la practica y siempre esta para cualquier duda con los alumnos, explica clarisimo aunque de vez en cuando se enrieda explicando hasta que le da la vuelta. siempre manda ejercicios para hacer o manda resueltos para ayudar. ', '74c99969-0ab2-44e9-a880-96e42e5f7925');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Jose Luis es un genio pero es muyy lento', '74c99969-0ab2-44e9-a880-96e42e5f7925');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Re dispuesto a responder dudas, le haces una consulta y se dedica bastante. Virtualmente estuve muy presente y de desarrollaba muy bien. Presencialmente dio menos clases pero casi siempre esta ahí por si tienes algo que preguntar', '74c99969-0ab2-44e9-a880-96e42e5f7925');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'mucha vuelta para ejercicios fáciles que no requieren mucha explicacion', '6576eca5-53fc-4224-ab85-a2cfc39935fe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Solo participó en las clases virtuales . Mostraba 1 ejercicio que traía preparado mientras lo explicaba  y si tenias dudas le preguntabaas . No me gustó,  aunque como todos los profesores estaba dispuesto a contestar dudas sin problemas no me gusto.', '6576eca5-53fc-4224-ab85-a2cfc39935fe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es ayudante de segunda y no estuvo presente en muchas clases, igualmente en las que estuvo siempre contestó todas las dudas súper bien. Hizo videos resueltos de los ejercicios de la guía como el resto de los profes de la práctica y están muy bien explicados', 'b45b94e0-ebd5-43b0-aa5e-018ddc5f5232');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'estuvo en re pocas clases, corrigio algunas tareas bastante justo', 'b45b94e0-ebd5-43b0-aa5e-018ddc5f5232');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Me pareció bastante respetuoso y claro al momento de sacarte una duda pero ha estado muy ausente durante la cursada', 'b45b94e0-ebd5-43b0-aa5e-018ddc5f5232');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'un genio', 'b45b94e0-ebd5-43b0-aa5e-018ddc5f5232');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es el mejor docente de esta cátedra, encargado de la práctica, el tipo siempre anda de buen humor y tira chistes, te trata bastante bien y hace ejercicios que sirven para los parciales, finales y para comprender conceptos. Lo que no me gustó es que tiene letra algo desprolija, podría mejorar en eso y ser más organizado con las presentaciones. ', 'a7b58a47-869e-44a7-95d0-a071e160ed0b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es un buen docente, le pone toda la onda, explica bien y tiene mucha predisposición para responder cualquier duda que tengas. Pero des recomiendo fuertemente anotarse en el SP1, les aviso que no compensa absolutamente nada que te tomen aprobados los TPs de laboratorio y la menor carga horaria. Aparte de que tienen criterios de aprobación excesivos (que no sé si los ponen ellos pero no interesa). Ponele que en el parcial tenés 3 ejercicios, haces perfecto dos pero dejas uno sin plantear, bueno te desaprueban. Y ni siquiera te avisan, o por lo menos no avisaron para el primero. Para los recuperatorios directamente tienen que estar bien todos. Las autoevaluaciones son lo más rebuscado que vi en la vida y encima te dan poco tiempo para hacerlas. ', 'a7b58a47-869e-44a7-95d0-a071e160ed0b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No es tan estricto con la notación pero explica muy bien. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La verdad que me gusto el curso. Diego es bastante claro y conciso para lo que es el semipresencial, ademas hace chistes y es copado. Siempre ponen clases de consulta antes de los parciales. Aunque la materia la senti igual o más densa que cursandola en un curso regular. No lo recomiendo mucho si no aprobaron la cursada con los temas bien incorporados o si se les vencio y no la tienen muy fresca porque los parciales son mas complicados. Lo unico que no me gusto fue que nos dieron 2hs para 2do parcial y agregaron hidrodinamica (unico curso creo que lo tomo pospandemia) y lo diern muy por arriba, igual dentro de todo es fácil. Si son recursantes y están medio quemados con f1 recomiendo una cátedra más accesible', 'a7b58a47-869e-44a7-95d0-a071e160ed0b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Poco recomendada. Explica con poca claridad y se la rebusca mucho a la hora de resolver los ejercicios. ', 'a6407801-43f1-4e8d-89d3-3fc580047558');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'La persona mas mala onda que conozco. Una vez le fui a preguntar una duda al fondo y me reputio porque estaban dando clase practica.', 'a6407801-43f1-4e8d-89d3-3fc580047558');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es medio rara, si te corrige los tps el primero capaz te lo hace rehacer todo pero una vez que captaste lo que corrige ya aprobaste todos.Si tenes algo mal los podes entregar otra vez y la nota va a ser buena igual.Explica bien pero aburre.Alguien comprele un microfono nuevo', 'a6407801-43f1-4e8d-89d3-3fc580047558');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Cuando ella explicaba me tenia que ir de la clase, no se le entienden mucho los ejercicios y se marea un monton, aparte de que se distrae con otras cosas. No me parece que es una mala mina, pero la verdad es que no explica muy, pero x lo menos lo intenta', 'a6407801-43f1-4e8d-89d3-3fc580047558');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es medio densa explicando ejercicios, a veces esta una hora con un solo ejercicio y uno se re cuelga. Manda muchos tps o ejercicios obligatorios en grupo que te sirven para aprender que hacer y que no hacer en los parciales, corrigiendolos en un meet aparte para cada grupo con una devolucion en el momento. ', 'a6407801-43f1-4e8d-89d3-3fc580047558');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Literalmente me iba de la clase cuando presentaba ejercicios, y creanme que no me gusta perderme contenido. No sólo es muy monótona, también es retorcida para explicar y cuando "sube" el ejercicio, sube una foto de su hoja con letra inentendible, y a veces hasta movida. ', 'a6407801-43f1-4e8d-89d3-3fc580047558');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy mala la practica. Cuando habla te dormís. Lo único bueno es que suben los ejercicios resueltos al campus. En la presencialidad es insoportable con el tema del barbijo, si no te lo pones te echa del aula. ', 'a6407801-43f1-4e8d-89d3-3fc580047558');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'Es una persona muy buenita en corrección parece, ademas, no domina la asignatura, eso seguro, pero entiende.', 'a6407801-43f1-4e8d-89d3-3fc580047558');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es muy densa para explicar y te dormis', 'a6407801-43f1-4e8d-89d3-3fc580047558');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bien, pero son un poco aburridas sus clases, pero no te vuelve loco con los trabajos prácticos, es bastante tranquila en ese sentido y no va muy al detalle, eso está bueno', 'a6407801-43f1-4e8d-89d3-3fc580047558');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bien, algo rápido, pero cuando le agarras ritmo va bien dentro de todo. Si en la clase no habla nadie a veces paraba a preguntar qué onda. Lo malo es que en el meet no lee el chat porque se le desprograman las diapositivas que pasa, entonces si tenes una duda y no tenes micrófono quedas algo colgado en caso de que no te lean. Siempre explicaba completa la forma en que se llegaba a alguna fórmula. No será de las mejores cátedras pero como segunda opción está bien', 'a6407801-43f1-4e8d-89d3-3fc580047558');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica con powerpoints y suele ir muy rápido, si le seguis el hilo se puede entender bien. No responde preguntas que le escriban por el chat a menos que se las lean, si no tenes micro tenes que pedirle a algún compa que te la lea. Las clases las suele dar bien pero si no le seguiste el ritmo quedas algo colgado. Como segunda o tercera opción no está mal', 'a6407801-43f1-4e8d-89d3-3fc580047558');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'es buena pero da la clase muuy lenta y aburre un poco, se puso a hacer dcls de ochenta sogas en un ejercicio y fue la ultima vez que entre a la practica', 'a6407801-43f1-4e8d-89d3-3fc580047558');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Da las teoricas y son buenas', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'MUY desordenada en el pizarrón', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'La rompe toda explicando, pero no tiene un buen trato y falta bastante.. Pero cuando va, se le entiende clarísimo y sirve un montón. Lo que tiene de malo son sus ayudantes... ', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Explica bien. Tenes que seguirle la clase si o si porque escribe muy desordenado en el pizarrón. Si te distraiste medio segundo o estabas copiando, miraste al piarrón y ya esta lleno de cosas nuevas, y escritas sobre cosas viejas.', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Recomiendo que con las clases se complemente lectura de un libro (el Sears y/o el Alonso-Finn), ella los utiliza mucho de base, y refuerzan todo. Si se hacen las guías y se meditan las deducciones, se puede aprobar.', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Bastante dedicada, responde todas las dudas y preguntas sin problema aun así tenga que volver atrás y se adaptó bien a la modalidad, dio clases bastante buenas por meet.', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Las explicaciones teoricas empezaron bien y se mantuvieron asi al menos hasta la mitad de la cursada. Luego parecia que estaban algo desorganizados los tiempos de los temas ya que algunos tuvieron más tiempo, pero otros no (según mi criterio). Se lograron dar los temas en tiempo de cursada pero el enfoque estuvo algo disperso.', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Si no te podes anotar a Fontana no me parecio una mala opción. La mayoría de los problemas de fisica son por culpa del departamento,no de los profesores, asi que hay cosas de las que no vasa zafar. No me arrepiento de haberme anotado con ella. Explica bien y le podes preguntar las veces que sea necesario lo que no entiendas y se nota que le preocupa que entendamos y nos vaya bien. Los trabajos practicos son pocos y son faciles y te ayudan a entender los temas. No me gusto que si teniamos una queja sobre algo de la materia o una disconformidad se ponía a la defensiva. La última parte de la materia fue medio a los pedos pero segun entiendo pasa en varias catedras. Siempre antes de un parcial da una clase de repaso tanto teorica como practica. A los dos primeros parciales llegamos re bien de tiempo.', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Una gran profesora, explica todo muy bien y contesta cualquier duda, ademas de que trata bien a sus alumnos y no les exige mas de lo que pueden hacer, una lastima que el grupo de las practicas sea tan choto, xq sino recomendaria este curso. ', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'En virtualidad, escribe con mouse sobre diapositivas por lo cual no es muy prolijo, y ademas explica rapido. Si prestas mucha atencion y la seguis, explica genial y explica todo. Le interesa que nos vayamos sabiendo los temas, es muy buena mina, si participas en clase y te va bien en la cursada te tienen re en cuenta. ', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica bien, lástima que sus clases son escribir todo tachoneado y poco claro por encima de una diapositiva llena de texto que no se entiende nada. Además, no graban sus clases. ', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Se nota que hace lo que puede, a mi personalmente no me servían del todo los power points. Capaz ponía muchas fórmulas o información que no era tan importante. Pero posta podes preguntar con libertad y ella te responde, no siempre de la mejor manera.', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'muy aburrida la clase, parece fastidiada todo el tiempo, poca organización... no la recomiendo para nada', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica bien pero va a los pedos y es desorganizada. Sabe un montón pero sentí que explicó poco en comparacion a lo que tomó en los parciales', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'Es mala cuando puede, tenia todo 9 en los tps y me cerró la nota con 5 por mandar a recu uno de los parciales y tener en uno un 8,5 y un 5. Casi me manda a labco por una pavada, se la discutí sino iba sin sentido. No le gusta que le pongas cosas de más.', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Desorganizada, la mitad de la materia la dio con powerspoints (que no eran suyos y no los podia subir al campus)en el laboratorio, es decir nadie alcanzaba a copiar y no podíamos bajarlos y leerlos en nuestras casas. Después del parcial solo 7 íbamos a sus clases, de los 50 que eramos al comienzo.  En el ultimo recuperatorio cuando fui a hacer consultas no quiso contestarme, ni a mis compañeros.', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Repetto es explica demasiado rapido y no se le entiende nada', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'A cargo de las teoricas, buenas explicaciones, no dio clases algunas veces por problemas personales, fuera de eso siempre explico los temas, las clases no quedan grabadas. La presencia en las clases es tomada en cuenta para aprobar la cursada, a pesar de que lo avisan en la ultima clase', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bien pero solo con power points, lo que hace que sea dificil seguirle la clase y tomar apuntes', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explicaba bien y en detalle todos los ejercicios y después los dejaba en el campus para que se puedan ver, se le entendía bien si le ibas siguiendo el hilo', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bastante detallado porque los ejercicios que entreguen en los TPs hay que entregarlos así de detallados, si te colgaste en un punto cuesta volver a entenderle el ejercicio porque un pelin rápido. Pero dsp te deja el ejercicio hecho en el campus', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Escribe encima de los PDF´s lo que puede llegar a marear, pero por el resto explica bastante bien', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'alto embole la clase, sabe mucho de la materia pero te quedas medio dormido. ', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy desprolija. Los pizarrones virtuales, horribles!!! escribía sobre pdf´s y no se entendía nada. Presencialmente puede que sea mejor profe, virtualmente esta en la b.', 'e46bd761-39ea-467f-8f67-9cb84363d67b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Para cumplir con los horarios estipulados en la catedra, usan los zooms de 40 min que si se cortan se cortan, no esta muy bueno porque a veces queda un tema por la mitad', '9d39bdfd-a0e4-4bb8-8668-7417329f9fdc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Jtp resentida. Tira trabajos sin importarle lo sobrepasados que estemos y te dice "ingenieria es una carrera dura" Si, y mas dura gracias a gente como esta', '9d39bdfd-a0e4-4bb8-8668-7417329f9fdc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Desconozco a nivel presencial como se manejará Fabiana, pero yo creo que la modalidad virtual la limitaba bastante, armaba algunos power, pero le costaba darse a entender bien. Ademas de problemas de conexión bastante seguidos.', '98d55ce0-6a05-4915-8470-bb161b263a9a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Creo que es una persona que no sabe toooodo pero que resulta agradable como docente. Sabe lo que tiene que dar y alguna cosita más pero por ejemplo no está en la esfera de conocimiento de Garea. Fomenta el uso del campus un montón en curso SP y da mucho material de estudio y ejercicios hechos.', '9bbd92f7-7714-42b3-8523-465d8cc68986');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No asistía a las clases, era el encargado del Campus', '9bbd92f7-7714-42b3-8523-465d8cc68986');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Tiene un rol mas bien práctico, es el que esta con los mails y te da ejercicios en el campus. M.uy bueno en general', '9bbd92f7-7714-42b3-8523-465d8cc68986');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'El mejor profesor de la FIUBA', '9bbd92f7-7714-42b3-8523-465d8cc68986');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Simplemente un crack. Muy buen profesor', '9bbd92f7-7714-42b3-8523-465d8cc68986');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No es mal profesor,está encargado del campus y responde bastante rápido,sus clases no son malas pero su mejor rol es en el tema práctico,en esa parte si sabe desempeñarse bien.Es un corrector muy exigente,puede mandar a rehacer hasta 3 veces un ejercicio y termina siendo muy molesto', '9bbd92f7-7714-42b3-8523-465d8cc68986');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Crack, el mejor de todos los profes de este curso.', '9bbd92f7-7714-42b3-8523-465d8cc68986');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Buen profesor, explica muy claro', '9bbd92f7-7714-42b3-8523-465d8cc68986');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Me parecio que el profesor Rossi daba bastante bien las clases, fueron muy rescatables. Recalco que esta cursada fue muyyyyyy desorganizada, capaz eso afecto a la catedra pero no se dieron todos los temas, yo opte por ver las teoricas de otras catedras para llenar este contenido.', '9bbd92f7-7714-42b3-8523-465d8cc68986');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No tomen el curso Rossi-Conde-Ferrari-Larrea-Sola. Es muy desordenado. Los profesores no tan amigables, solo Rossi y Sola. No son muy justos al corregir', '9bbd92f7-7714-42b3-8523-465d8cc68986');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se encarga de los trabajos de laboratorio, los presenta y explica dejando la mayoría de las coas claras para realizar las experiencias. También aparece para dar teoría complementaria y ejercicios.', '9bbd92f7-7714-42b3-8523-465d8cc68986');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Crack, se le entiende todo y es lo mejor de la catedra
