INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Un capo, re atento al campus, sube bocha de material, videos, etc.', '9bbd92f7-7714-42b3-8523-465d8cc68986');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Lo mejor de este curso, siempre quiere que participes y lo que te explica lo hace muy bien. ', '9bbd92f7-7714-42b3-8523-465d8cc68986');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Para cumplir con los horarios estipulados en la catedra, usan los zooms de 40 min que si se cortan se cortan, no esta muy bueno porque a veces queda un tema por la mitad', 'cba47dbc-0f2f-411c-b213-618b5581a7ba');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La mejor de la práctica, tanto presencial como virtual! Buen trato y muy buena predisposición para consultas', 'cba47dbc-0f2f-411c-b213-618b5581a7ba');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Salva la comisión. Una persona amorosa y gran docente. las dudas hay que preguntarselas a ella.', 'cba47dbc-0f2f-411c-b213-618b5581a7ba');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Se nota que sabe pero la verdad es muy pajero para todo, tambien despistado, explicaba de memoria por decir asi y la mayoria de las veces se equivocaba en las formula o deducciones a tal punto que nos hacia buscar un error en una demostracion que no podia sacar cualquier alumno que recien arranca con fisica. Los ultimos temas los da asi nomas (optica, ondas, etc), tampoco los termina y recomienda libros y listo. Parciales fáciles, si recursas aprobas la cursada facil', '486c6253-30e7-43e1-9311-199a853d3c2a');
