INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'No es malo, tampoco es bueno. Está una clase entera para hacer un ejercicio y hacia el final del cuatri su forma de explicar cansa.', 'd068d6be-0bc4-4ae4-bf71-65fa6365f1b9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Muy buena onda para explicar, aclara todas las dudas que te quedan de la teórica y enseña a hacer los ejercicios sin dar demasiadas vueltas con la teoría.', 'd068d6be-0bc4-4ae4-bf71-65fa6365f1b9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No dio clases. Subió algunos ejercicios resueltos, nada del otro mundo. ', 'd068d6be-0bc4-4ae4-bf71-65fa6365f1b9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es un profe que sabe,pero hay que hacerlo entrar en ritmo como a los alumnos para que no tenga fiaca,es bastante rápido para explicar y se cuelga en subir las cosas,pero es el profe más "piadoso"(corrige adecuadamente en relación a lo que se nos da) y hasta creo un grupo de wpp para dudas antes de los recuperatorios y final', 'd068d6be-0bc4-4ae4-bf71-65fa6365f1b9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Va muy rápido en las clases pero es cortito y al pie, te explica lo q necesitas y sabe que cosas son las que cuestan. Aunque cuesta seguirle el ritmo por lo rápido q va', 'd068d6be-0bc4-4ae4-bf71-65fa6365f1b9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'La verdad que al principio del cuatrimestre las clasees son muy buenas e interactivas, pero al pasar de las semanas se vuelven medias densas. Rescato que aunque sea el profe te hace reir con las caras o los comentarios que hace que te animan en este mar de decepciones .......
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Daba ejercicios de la guía, algunos se entendían sin ningún problema y otros era difícil seguirlo. Es buena onda y podes no suele tener problema con las consultas.  ', 'd068d6be-0bc4-4ae4-bf71-65fa6365f1b9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica muy bien pero aveces lento, hace ejercicios de parciales que ayudan mucho a la cursada.', 'd068d6be-0bc4-4ae4-bf71-65fa6365f1b9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Va rapido y a veces cuesta seguirle el ritmo. Para el tercer parcial dió una clase de repaso re buena y sirvió muchísimo para solidificar todos los temas. Una vez metió un meet opcional la noche previa al examen para resolver ejercicios, muy piola', 'd068d6be-0bc4-4ae4-bf71-65fa6365f1b9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Resuelve algunos ejercicios, si los resuelve los explica sobre fotos escaneadas y va muuy rapido, no te da tiempo a copiar nada', 'd068d6be-0bc4-4ae4-bf71-65fa6365f1b9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es crack. Es medio falopero pero le mete onda. ', 'd068d6be-0bc4-4ae4-bf71-65fa6365f1b9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Habla muy bajo, no se le entiende nada', 'f6fb7a5d-0920-4a67-a98b-b93f2ae3e670');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Los ejercicios que ponia en el campus eran imagenes de una hoja, poco legible pero paciente y se entiende.', 'f6fb7a5d-0920-4a67-a98b-b93f2ae3e670');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Subía la mayoría de los ejercicios resueltos al campus. Bastante completos la mayoría(los hacía en hojas y subía foto) ', 'f6fb7a5d-0920-4a67-a98b-b93f2ae3e670');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Casi nunca va a clases y si va la mayoria de las veces no hace nada. de todas formas de vez en cuando explica un ejercicio y lo hace bien.', 'f6fb7a5d-0920-4a67-a98b-b93f2ae3e670');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Me toco como correctora, esta muy dispuesta a responder las dudas del TP y es muy comprensiva. Dio algun que otro ejercicio en las practicas, Arma power points muy buenos en los que abarca todas las posibilidades de resolucion del ejercicio de forma clara. Una genia', 'f6fb7a5d-0920-4a67-a98b-b93f2ae3e670');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No se le entendió nunca nada. Los ejercicios de la guía los hacía así nomas y los pdf, cuando era virtual, eran material viejísimo y muy malo.', '67d4bd19-65bf-46d1-9cf8-bba8aedd5f50');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'El mejor profe del curso 08', '67d4bd19-65bf-46d1-9cf8-bba8aedd5f50');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Patricia es muy entusiasta y creo que es la que más está "del lado de los alumnos" de alguna forma. Tiene un contacto especial con nosotros, es muy amable y divertida. En cuanto a los ejercicios que explicó ella, sinceramente nunca los entendí porque su método de resolución nunca fue ordenado, y los pasos nunca fueron justificados con la rigurosidad de otros docentes del curso. Siempre lleva el ejercicio resuelto por lo tanto está muy pendiente del papel y creo que eso le quita la posibilidad de explayarse y demostrar lo que sabe. En las correcciones, no baja nota por detalles pero siempre hace aclaraciones que son útiles para mejorar para la próxima. ', '0b43602c-08ed-4c93-9fa5-7dd17ef6fc88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Al principio te puede parecer pesada, porque te corrige TODO y no te deja pasar una. Pero es lo mejor, porque después sabes justificar todo y no te olvidas de nada nunca. Los ejercicios que presentaba eran súper prolijos y claros, y fomentaba la participación en clase. ', '0b43602c-08ed-4c93-9fa5-7dd17ef6fc88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Sabe mucho y es buena con los alumnos. No me gusta como explica en la virtualidad porque generalmente graba la hoja con ejercicios resueltos y no se entiende nada.', '0b43602c-08ed-4c93-9fa5-7dd17ef6fc88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'La cursé hace mucho con Pato, era su primer cuatri de ayudante, se notaba. No explica mal pero contestaba dudas nomás o ayudaba en el labo.', '0b43602c-08ed-4c93-9fa5-7dd17ef6fc88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es super estricta pero explica muy bien, se nota que es muy metódica y detallista, sus explicaciones de ejercicios son las más completas, le encanta que participen en clase, así que hace todo el tiempo preguntas antes de avanzar en la explicación del ejercicio, y no sigue si no contestan, sé que si para los trabajos prácticos le asignan tu grupo, es bastante estricta y detallista, mira y corrige TODO, hasta el más mínimo detalle', '0b43602c-08ed-4c93-9fa5-7dd17ef6fc88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Los ayudantes explican pocos ejercicios a lo largo de la cursada, en general la práctica la hace toda Reboredo. Se les suele entender bien a todos', '0b43602c-08ed-4c93-9fa5-7dd17ef6fc88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Cuando resuelve ejercicios en las clases intenta siempre que el alumno le diga que tiene que hacer o que es lo que viene después en la resolución, cosa que tiene su parte buena, porque hace que el alumno participe en la clase; pero también su parte mala, puede quedarse fácil 5 minutos en silencio esperando una respuesta', '0b43602c-08ed-4c93-9fa5-7dd17ef6fc88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'es buena onda, quizas no es muuy clara pero en general bien.', '0b43602c-08ed-4c93-9fa5-7dd17ef6fc88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Francisco es un buen profesor, creo que donde más se luce es en el laboratorio, dando indicaciones, proponiendo alternativas para la resolución de problemas. También alienta a muchos para que participen de la clase y para que no tengan miedo a equivocarse o a hacer las cosas mal. Corrigiendo es justo, tiene consideración con errores de cuenta y algún que otro paso sin justificar. ', 'c69d3a7e-9b1d-44db-b779-6b4e041ef667');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy buen profesor. Explica muy bien y no tiene drama en repetir mil y un veces hasta que la caces. Excelentes las teóricas.', 'c69d3a7e-9b1d-44db-b779-6b4e041ef667');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Francisco da las clases teóricas, explica muy bien, responde todas las dudas que se presenten y no tiene problema en repetir algún tema si lo interrumpís. Insiste para que participen y siempre algún link para material didáctico para dar los temas.', 'c69d3a7e-9b1d-44db-b779-6b4e041ef667');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'sisi todo bien con que sea un amor pero si sos HORRIBLE explicando no hay sentimiento que valga, y yo con amor no aprendo. simplemente sus clases teóricas no te van a ayudar a aprobar la materia', 'c69d3a7e-9b1d-44db-b779-6b4e041ef667');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Demasiado desorganizado. A veces las clases empezaban bien, pero despues a la mitad de la clase ya no se entendia nada. Se re atrasa con los temas y termina dando todo medio de por arriba y se apura en dar 20 temas en una sola clase, por lo que nuevamente, no terminas entendiendo. Lo que si es que tiene buen trato y es re buena persona, y si preguntas te responde de lo más bien, pero vas a terminar mirando todos los videos de Fontana para aprender los temas', 'c69d3a7e-9b1d-44db-b779-6b4e041ef667');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Parece re buena persona pero enseña muy mal, sólo da demostraciones algebraicas de las fórmulas pero no te hace un ejercicio de ejemplo ni de casualidad. Una sola clase intentó resolver un parcial de 3 ejercicios para el cual nos dieron 3hs y él no pudo terminar el primero en las 2 hs de clase. El resto de la teoría es medio pelo, saco mucha más información en un par de páginas de un libro que de sus clases que la verdad son malísimas, no me sirvieron para nada, solo para saber por que tema íbamos para estudiar de otro lado. No te acepta una crítica. Además es un desastre escribiendo en el pizarrón, lo único que puedo destacar de él es que parece copado pero para eso me junto con mis amigos. ', 'c69d3a7e-9b1d-44db-b779-6b4e041ef667');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Francisco es el mejor del profesor de práctica, los temas van de la mano con los que da Garea y es super amable al responder las dudas..si algo no se entiende no tiene drama en volverlo a repetir', 'c69d3a7e-9b1d-44db-b779-6b4e041ef667');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy buen profesor. Re bien predispuesto a contestar dudas, muy comprometido y hasta amoroso. Lástima que esté con Indelicato. Si se cambiara se disfrutaría mil veces más porque él si es un profesor que vale la pena. ', 'c69d3a7e-9b1d-44db-b779-6b4e041ef667');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica bien, pero es desordenado en la pizarra.', 'c69d3a7e-9b1d-44db-b779-6b4e041ef667');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'El mejor profe de la practica de Moreno, eso si, hay que estar atento porque va muy rapido y al momento que te colgaste y volves a prestar atencion no entendes nada.  Llegaba mas temprano a responder dudas lo cual es muy destacable', '2b1d9722-f689-4caa-9121-c12a422558a0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'El mejor junto a moreno', '2b1d9722-f689-4caa-9121-c12a422558a0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Super macanudo y tiene re buena dinamica con Moreno. Es un poco tajante con las explicaciones, pero igual es claro y se entiende.', '2b1d9722-f689-4caa-9121-c12a422558a0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Simplemente un genio. Excelente profesor y excelente persona. Siempre se ponía del lado de los alumnos e intentaba ayudarnos.', '2b1d9722-f689-4caa-9121-c12a422558a0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buen profe, las practicas con gustavo resultan llevaderas y se entienden! siempre se ponen en lugar de los alumnos.', '2b1d9722-f689-4caa-9121-c12a422558a0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica excelente y facilita muchos resueltos con explicaciones y desarrollo.', '2b1d9722-f689-4caa-9121-c12a422558a0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Grande el Diego, un genio explicando y se complementan muy bien sus clases con las prácticas de Gustavo. Siempre dispuesto a contestar dudas y explica re simple sin tampoco simplificar los temas. Las clases las da apuntando la cámara a un pizarrón pero se ve perfecto', '2b1d9722-f689-4caa-9121-c12a422558a0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un crack, súper prolijo y organizado su canal de YouTube es clave para entender ejercicios! Grande Diego', '2b1d9722-f689-4caa-9121-c12a422558a0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'el mejor de la practica de Moreno', '2b1d9722-f689-4caa-9121-c12a422558a0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'presente en la primera y 2da parte, ausente en la 3ra. muy ausente en los foros. ', '2b1d9722-f689-4caa-9121-c12a422558a0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Sus videos son muy claros, concisos y completos. En las clases de consulta explicaba todo medio rápido. La última parte ya ni apareció, espero que esté bien xd', '2b1d9722-f689-4caa-9121-c12a422558a0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'un capo', '2b1d9722-f689-4caa-9121-c12a422558a0');
