INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Gran profesor, muy atento y dedicado.', '0dc7618e-d352-4a87-803f-df7e7d8481c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La verdad que parece que sabe un monton, pero no logra transmitirlo. Te habla en terminos que no terminas de entender, te perdes en su explicacion, a veces la hace muy extensa y perdes el punto o se va medio por las ramas. Es una pena ', '0dc7618e-d352-4a87-803f-df7e7d8481c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'explica demasiado, pero la tiene clara', '0dc7618e-d352-4a87-803f-df7e7d8481c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Tiene mucha seguridad al explicar un tema, a veces cuesta por por muy técnico.', '0dc7618e-d352-4a87-803f-df7e7d8481c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'muy organizado, las clases son buenas pero es un poco monótono. ', '0dc7618e-d352-4a87-803f-df7e7d8481c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'responde dudas de guias y antes del parcial los profesores de la practica hicieron una clase de consultas que fue excelente para las dudas que fueron quedando a lo largo del cuatrimestre', '0dc7618e-d352-4a87-803f-df7e7d8481c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Sus clases son un poco pesadas porque el es muy tranquilo. Explica muy bien, las veces que he hecho consultas se toma su tiempo en explicar bien. Es muy paciente', '0dc7618e-d352-4a87-803f-df7e7d8481c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Voz clara, fuerte, explica bien. Quizá a alguno le aburra ', '0dc7618e-d352-4a87-803f-df7e7d8481c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Vino a muy pocas clases pero las veces que estuvo me pareció buen profesor, claro y cordial con los alumnos.', '0dc7618e-d352-4a87-803f-df7e7d8481c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'No explica mal, pero se fué de vacaciones y nunca más apareció.', '0dc7618e-d352-4a87-803f-df7e7d8481c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy amable ayudante, cualquier cosa que le preguntes te responde con buena onda, generalmente se acerca a preguntarte si entendiste, y se queda despues de clase un buen rato respondiendo consultas.', '81dcaa8f-71f7-451f-9345-952089e567f8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy bueno explicando y corrigiendo trabajos prácticos. Siempre se mostró dispuesto a resolver cualquier duda o problema sobre los TPs, con muy buen trato y sumamente respetuoso.', '81dcaa8f-71f7-451f-9345-952089e567f8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La verdad no se la entiende mucho. Se equivoca cuando hace ejercicios, te re confunde, va con un cuaderno como si no supiera resolver los ejercicios que hace. Te da más inseguridad que otra cosa', '0c202c97-e99e-4304-86d7-f25b34ed78b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'CRACK, tiene todos los ejercicios hechos y es un lujo para hacerle consultas. explica a los pedos y la tenés que seguir, pero siempre abierta a consultas', '0c202c97-e99e-4304-86d7-f25b34ed78b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Una genia, va rapido a veces, pero se entiende, solo una que otra vez fue difícil entender los ejercicios que daba.', '0c202c97-e99e-4304-86d7-f25b34ed78b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'a veces se pierde un poco con algunos ejercicios pero es general explica muy bien.', '0c202c97-e99e-4304-86d7-f25b34ed78b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'en mi opinion sus clases practicas fueron claras, resuelve ejercicios de manera concisa y facil de seguir, durante el intervalo responde dudas de las guias', '0c202c97-e99e-4304-86d7-f25b34ed78b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'daba la practica, tiene paciencia y se toma su tiempo en responder dudas', '0c202c97-e99e-4304-86d7-f25b34ed78b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Tanto Ines como Joel son excelentes profesores, resuelven la mayoría de los ejercicios de la guía y también traen muchos otros extra para practicar. Fomentan mucho la participación y te explican todo las veces que necesites. Además se quedan después del horario de clase a responder consultas. Al ir al día con los temas las clases anteriores al parcial se practica mucho, lo cual me parece muy importante para terminar de procesar los temas.', '0c202c97-e99e-4304-86d7-f25b34ed78b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Una genia Luana. Sabe mucho y sabe explicar, además es muy buena onda y te podés quedar charlando sobre otras cosas.', 'a0aa5594-de2e-4cd7-a1ff-e635243721a6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Contesta todas las dudas y se nota que le gusta enseñar', '37af8f8f-791f-4cdc-89e2-f978d166809f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Lo mejor de este curso. Desgraciadamente se fue a otro curso en la mitad del cuatrimestre, pero es lo mas. A la hora de dar clase, no era del todo claro explicando, pero le ponia buena onda y se esforzaba', '37af8f8f-791f-4cdc-89e2-f978d166809f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Explica bien y tiene muy buena onda...un genio', '37af8f8f-791f-4cdc-89e2-f978d166809f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es un genio. Explica bien y le pone mucha onda. Eso sí, es medio desprolijo cuando escribe en el pizarrón. ', '37af8f8f-791f-4cdc-89e2-f978d166809f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Explica muy claro y es re buena gente, uno de los mejores profesores que tuve.', '37af8f8f-791f-4cdc-89e2-f978d166809f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Sin dudas uno de los mejores practicas!', '37af8f8f-791f-4cdc-89e2-f978d166809f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Impecable. Puntual, explica clarísimo y va al grano con los ejercicios. Antes de empezar siempre hace un mini repaso de la clase anterior. Súper amable y gracioso, es perfecto. Que hombre hermoso', '37af8f8f-791f-4cdc-89e2-f978d166809f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La cátedra de Perez es un asco, pero Leo es lo que hace que valga la pena inscribirse acá. Es el JTP encargado de la práctica, en donde remonta la teoría mal dada por Liliana antes de comenzar con los ejercicios, los cuales explica de manera excelente. Más allá de lo didáctico a la hora de explicar, es una persona que me ha respondido mails todos los días a las 10 de la noche en semanas de rendir haciendo todo lo que podía para que apruebe, y acompañandome como persona más allá de lo académico. Creo que si Leo no aprobaba F2, un excelente docente y persona <3 Recomiendo no ir a la teorica de Liliana, ir con Pampillo a escuchar (total los temas de FIIA Y FIIB son los mismos excepto por termo que nosotros no tenemos) y venir a la práctica de Leo.', '37af8f8f-791f-4cdc-89e2-f978d166809f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Super dedicado. Siempre con una sonrisa en la cara. Una vez le hice preguntas de la guía durante una hora, mas o menos, dsp de que terminara la clase, y él sin ningún problema me seguía explicando. La verdad que uno de los mejores profesores con los que me topé en cuanto a dedicación por lo que hace, y además se le entiende perfecto todo. ', '37af8f8f-791f-4cdc-89e2-f978d166809f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Excelente profesor, super copado, la practica la da muy bien el y sus ayudantes. Siempre hubo buena onda y predisposicion. Nos mando a hacer grupo y exponer un ejercicio de la guia, tarea no dificil, pero que hace que se fomente la participacion. Super didactico. Responde mails, dudas, te salva si lo necesitas, te da muchisimas herramientas
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'EX CE LEN TE Solo se pueden decir cosas buenas de él. Leo da prácticas excelentes, sabe mucho, explica claro, está dispuesto a eschuchar y contestar cualquier duda de lo que sea y siempre de buen humor y con ganas de enseñar.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Excelente, siempre de muy buen humor, durante la cursada seguimos la metodologia de resolucion en clase y entrega de problemas en grupo, por lo general una vez a la semana, lo cual fue muy valioso, tanto para formar un grupo de estudio fijo, como para llevar la materia mas o menos al dia.', '37af8f8f-791f-4cdc-89e2-f978d166809f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'No tiene mucha buena energía para explicar pero cuando explica, explica bien. los PDF donde tiene los ejercicios armados a veces se saltea pasos matemáticos y cosas así que te hacen perder pero en general explica muy bien.', '9322444b-1e41-42cf-8303-be2bc05caec7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es muy didáctica, explica muy bien bajando a la tierra los conceptos no importa lo difíciles que sean. Lo que más me gustó fueron sus clases de consulta, puede estar horas sacándonos dudas (incluso enferma) y hace que siempre participemos todos. Realmente te deja bien preparado para el final, para todo. Es admirable, solo puedo tirarle flores!!', '287246e2-26c0-49dc-8c84-348303c18aa0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es muy organizada y paciente. A veces va a los pedos y la perdes, pero hace todo lo posible para q entiendas', '287246e2-26c0-49dc-8c84-348303c18aa0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'ciocci es god', '287246e2-26c0-49dc-8c84-348303c18aa0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Impecable, muy dedicada, respondia cualquier duda, sino es la mejor docente de la materia, debe estar muy cerca, anotense con ella si pueden sin dudarlo.', '287246e2-26c0-49dc-8c84-348303c18aa0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'iván es un buen docente dentro de todo. tiene voluntad de explicar y repetir pero a veces no se le entiende la letra en el pizarrón o con algún ejercicio se la complica mucho, pero es muy accesible para consultar y en los tps', '8dc9d05b-b4ca-4703-bb4a-5ab48de36b47');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Siempre atenta a todas las consultas, muy clara y ordenada.', '9e5c6b0c-cbc8-4423-985a-0660bbbd21b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No son claras las clases de Di Luozzo, quizás son más útiles para alguien que estuviera recursando la materia ya que suele hacer siempre ejercicios de parcial, por lo que si uno va a la clase queriendo aprender el tema de cero se queda bastante perdido en la clase. No es exigente con la corrección de TPs y es muy justo para corregir los parciales.', '4d343eb7-d185-47d0-b743-8aba7b25f5e7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy tranqui corrigiendo. se pueden robar los tps', '4d343eb7-d185-47d0-b743-8aba7b25f5e7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es un profesor normal. Claramente sabe de los temas que da pero no es muy didactico. En las clases basicamente se pone a resolver ejercicios de parcial en el pizarrón. El principal problema es que no explica ejercicios más básicos como para introducir a los temas, por lo que es normal perderse en sus clases. Lo bueno es que si le preguntas personalmente alguna duda explica bastante bien. Además es bastante considerado al corregir parciales y TPs.', '4d343eb7-d185-47d0-b743-8aba7b25f5e7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'No me gustó nada su manera de dar clase, no se le entendía mucho.', '4d343eb7-d185-47d0-b743-8aba7b25f5e7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Buen Profesor, super claro y atento con los alumnos', '4d343eb7-d185-47d0-b743-8aba7b25f5e7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Va resolviendo las guias y sube todo lo que hace, cumple, buena catedra
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Buen tipo. Se ve que en otros cuatrimestres le dijeron que resolvía ejercicios muy difíciles y este hizo ejercicios casi triviales. Siempre antes de cada ejercicio da un mini background teórico de fórmulas etc. que viene bien. Tiene todo el material en el campus y suele ser él quien contesta por ahí.', '4d343eb7-d185-47d0-b743-8aba7b25f5e7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'En lineas generales, explica bien pero usa muy poco el pizarron. Tira trucos para encarar los ejercicios pero a veces va demasiado rapido y no da tiempo a que uno anote en el cuaderno lo que ella dice porque te olvidas, ella sigue de largo, igualmente, se nota que quiere que aprendas. No es muy exigente con los TPS, si tienen algun error  te los va a marcar pero igual te los va a aprobar', 'f4cb1d50-6072-4577-8b41-53f63c7a4fe2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Espectacular. Resuelve ejercicios de parcial de cada tema (o casi) y tira tips para parcial/final. Lo único es que los resuelve a los mangos, pero si la frenás te explica todo.', 'f4cb1d50-6072-4577-8b41-53f63c7a4fe2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Se hizo cargo de las prácticas junto con otro ayudante. Siempre bien predispuesto y con buen trato. Explica bien pero a veces se complica demasiado.', 'f4cb1d50-6072-4577-8b41-53f63c7a4fe2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'El curso es nefasto. Dan lo que quieren y te exigen cualquier cosa. Nos hicieron PROGRAMAR pero no nos dieron los TP que exigia el departamento de fisica. Punto aparte para las explicaciones, un espanto.', 'c832a88d-bea7-4299-aaae-f5a75a3dc277');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Ferrini es medio extraño como dá la materia, al igual que en fisica 1. Introduce un tema que aún no se supone que tenemos que ver, y recién la semana proxima lo termina de explicar bien. Por ese lado me parece un tanto desorganizado. Algunos temas los sabe explicar bien, pero otros no mucho. Tiene buena actitud pero a veces deja que desear. Al ser cursada virtual no sé como sería la practica de laboratorio ni los parciales que toma', 'c832a88d-bea7-4299-aaae-f5a75a3dc277');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Alexis no la dejaba dar sus clases por que se pasaba de tiempo, pero cuando lo hacia, iba a los pedos y nunca entendia la duda de los alumnos. Tambien es exigente corrigiendo', 'f69565bb-2f51-480a-a301-96a92911a6dc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'verónica explica muy bien y es re prolija, también es accesible para consultar y no tiene problema en repetir una explicación. lo único es que es muy exigente corrigiendo tps y parciales', 'f69565bb-2f51-480a-a301-96a92911a6dc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Muy buena docente tambien.', 'f69565bb-2f51-480a-a301-96a92911a6dc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La verdad era el unico que mostraba cierta seguridad a la hora de realizar los ejercicios. Tambien tenia un cuaderno pero lo usaba más para poner los resultados finales, no todo el desarrollo. Y estaba bueno pq era más claro, no daba muchas vueltas a la hora de explicar, iba directo al punto. ', 'f3aad3f5-6742-41d4-95b6-928c4f35b9a8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'te habla en criollo, aporta bastante', 'f3aad3f5-6742-41d4-95b6-928c4f35b9a8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un crack, muy bueno dando clases, explicando claro y piola los tips que da', 'f3aad3f5-6742-41d4-95b6-928c4f35b9a8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'sabe explicar ejercicios de manera que mantiene el interes de la clase', 'f3aad3f5-6742-41d4-95b6-928c4f35b9a8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Elsa es la profesora de teóricas, muy buena profe y persona. Las clases las da con ppts por eso es que puede demorarse en empezar las clases a veces por armar el proyector hasta media hora que muchas veces es necesaria. Le interesa que entendamos los temas, le gusta que pregunten en sus clases y se queda para consultas cuando termina la clase. Corrige en parte ella los parciales, da muchas oportunidades y es muy buena al evaluar. Da la posibilidad de recuperar solo los temas que estuvieron flojos. ', '4dd7efa9-8744-4b78-b6b4-485ab884eb54');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'La verdad que es muy buena profesora, explica muy bien y contesta todas las dudas sin problemas', '4dd7efa9-8744-4b78-b6b4-485ab884eb54');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Una genia Hogert. Para dar las clases usa diapositivas que es mejor tenerlas impresas y llevarlas para no pasar tanto tiempo copiando y así poder prestar atención. Lo malo de esas diapositivas es que tienen muchos errores que siempre cuelga en corregir, y si nunca los corregiste durante las clases no conviene usarlas para estudiar. Explica todo de forma sencilla y nunca tuvo drama en responder nuestras dudas.', '4dd7efa9-8744-4b78-b6b4-485ab884eb54');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Hogert es lo mas! No entiendo porque la gente se desespera por ir a la mañana com Santiago. Muchisimo mas clara al explicar y muy ordenada', '4dd7efa9-8744-4b78-b6b4-485ab884eb54');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es una genia dando la teórica. tiene unos PDFs armados para dar en cada clase para todos los temas de la materia (a veces tienen errores pero los podes cambiar en el momento si los Tenes impresos). antes de cada parcial hace un repaso de todos los temas para evacuar dudas. va muy rápido pero si la tienen que frenar o decirle que vaya un poco mas despacio, hagan lo por que ella no sabe cuando va muy rápido. participen y sean muy activos. es lo mejor que pueden hacer para aprender esta materia que es muuy pesada y bastante conceptual.', '4dd7efa9-8744-4b78-b6b4-485ab884eb54');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'De los mejores profesores que tuve. Responde todo lo que necesites las veces que sea necesario, fomenta que manden mails, si necesita un grupo una clase extra el no tiene problema, es muy claro, organizado y le apasiona la materia, la hace muy llevadera. Y ademas arranca con un resumen de la teorica lo cual esta buenisimo porque si algo te quedo suelto ahi te termina de cerrar.', '2d9a9bc4-962b-4acc-838b-9659d7a53b7a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Emi traía siempre sus clases organizadas de antemano e iba resolviendo ejercicios en la practica y cualquier duda que tuvieramos siempre respondía y volvía si no habías entendido algo.', '2d9a9bc4-962b-4acc-838b-9659d7a53b7a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Emi te responde todas las dudas que tengas y se encarga del 80% de las clases prácticas. No me resultaron muy útiles en general las prácticas de esta cátedra porque estaban un poco desorganizadas. Sí me servía que resolvían ejercicios de multiple choice y daban clases de consulta.', '2d9a9bc4-962b-4acc-838b-9659d7a53b7a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Si mal no recuerdo, hizo sólo un ejercicio en el pizarrón este cuatrimestre, pero siempre está disponible para responder dudas. Explica bien y aparte cada tanto tira algún comentario útil mientras Leonardo está explicando un ejercicio en el pizarrón. ', '6bd93ae4-c8a6-49d3-ad44-2b3f166a1287');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bien, buena onda', '6bd93ae4-c8a6-49d3-ad44-2b3f166a1287');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Andrés es un genio. explica todo y te saca las dudas que tengas. es organizado en la practica y siempre hace los ejercicios ahí mismo cosa que lo vayas siguiendo en el procedimiento. siempre hace un análisis de cada ejercicio y busca interactuar con los alumnos para hacer las clases dinámicas. les recomiendo ser siempre activos y les van a dar la mejor de las ondas en las clases.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Daba algunas clases de consultas, es copado y te responde sin problemas.', 'dfc6f2a2-87ad-4a74-b4ca-939c2bb1b949');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se pasa de largo la hora de finalizar la clase, si tenes lab despues de esta materia como en inorgánica molesta mucho la verdad', '23fe4d23-4153-4b0d-99c4-fc10ca9adcd9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se nota que sabe un montón, pero se va medio por las ramas. Se pone medio gede si se van antes pero es buena onda', '23fe4d23-4153-4b0d-99c4-fc10ca9adcd9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy vueltero a la hora de explicar, le pone onda pero casi nunca le entendí y terminas disociando', '23fe4d23-4153-4b0d-99c4-fc10ca9adcd9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No se gasten, pesimo profesor, sus dibujos son horribles y sus explicaciones muy malas. Hay muchisimas opciones mejores que el para esta materia, la cual requiere una buena teorica', '6f80376a-9fd0-4f25-a086-0d14b1aa3151');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Infravalorado. No dudes de el.', '6f80376a-9fd0-4f25-a086-0d14b1aa3151');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'La práctica es excelente. Resuelven siempre ejs de parcial ', '6f80376a-9fd0-4f25-a086-0d14b1aa3151');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'No se le entiende mucho', '6f80376a-9fd0-4f25-a086-0d14b1aa3151');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Siento que presencial es bueno pero la virtualidad le jugó mucho en contra. Da clases con apuntes suyos escritos a mano pero la calidad de la camara y la letra hacen que sea dificil entender todo. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Va un poco rápido y a veces salta entre temas pero si estás atento se sigue bien.', '6f80376a-9fd0-4f25-a086-0d14b1aa3151');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'la mejor teorica', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'pampillo es una crack! da teoricas muy completas y explica excelente', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Una genia, persona muy querible, agradable, y que esta con buena predisposición siempre. Valen la pena sus clases', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Por lejos la mejor profesora que tuve en la facultad hasta ahora. Crack total. Explica muy bien y le da mucho hincapié al comportamiento físico por lo cual uno termina entendiendo bien el concepto.', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy buena docente que se adapto muy bien a la virtualidad, explica muy bien hace la clase participativa y tiene muy buena predispocision para con los alumnos', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica muy bien todos los ejercicios, va avanzando a medida que los alumnos participan. Siempre da lugar a que consulten para aclarar dudas ', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Laura es una grosa, igual que Roht, tiene un dominio de la materia espectacular. Siempre llega un toque antes y contesta dudas durante el recreo entre teorica y practica. Ademas los ejercicios que prepara siempre son muy claros, busca hacerte participar y te hace aprender la dinamica de los ejercicios que despues aparecen en los parciales. Si podes cursar con ella, hacelo', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La tuve en la practica y era realmente impresionante ver como daba las cosas, no se como hacia, pero en un ejercicio de ella aprendias un monton y te terminaba de cerrar todo. También al igual que lucre, cero drama en responder consultas, prolija, explica demasiado bien y te da ejercicios utiles; realmente daba gusto cada vez que explicaba un ejercicio, impecable', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Excelente profesora. La verdad que de lo mejorcito que tuve hasta ahora en fiuba. Fue como volver un poco al colegio, porque sus explicaciones son muy bajadas a tierra y ella es muy dulce. Si tenes la posibilidad, no dudes en anotarte. Con la teoría que daba en clase me alcanzó perfecto para los parciales y para el final. ', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es la mejor profesora que tuve. El clima que genera en la clase es buenisimo, hace las clases entretenidas y llevaderas. Trata a todos como pares y se aprende los nombres de todos los que participan. Explica muy bien y se asegura que todos entiendan (encima fue de las pocas catedras que llego a dar todos los temas antes del primer parcial). 10/10.', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'Es buena explicando', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Excelentes clases! Da muy buenas teoricas y hace ejercicios claves en el pizarron. Asi se compensa lo mala que es la practica.', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'excelente pampillo', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Explica excelente y muy ordenada en el pizarrón. Me sorprendió que se esforzarse por aprenderse los nombres de casi todos los alumnos y fomentaba la participación de los mismos en clase constantemente', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Ciertos temas que entraron en el final no fueron explicados en profundidad en clase', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Pampillo, una de las mejores profesora de Fiuba. Excelente docente que a la hora de dar clases siempre hace chistes para hacer la materia llevadera, esa capacidad de hacerla mucho mas entendible pocos la tienen. Prácticamente f2 es como tener una charla en criollo en la que aprendes. Siempre predispuesta a responder dudas y no juzgar si no sabes algo que "supuestamente deberías saberlo". Recomiendo mucho grabar las clases si escribís lento porque dice muchas cosas que yo no llegaba a copiar.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'la mejor teórica y práctica del departamento de física.. lejos lejos', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'La mejor profe que tuve junto a Roth. Explica re claro y re bien. Tiene re buena onda y paciencia para explicar y contestar dudas. Te repite las cosas hasta que lo aprendas. Sus ayudantes son re grosos igual que ella. Aprendes mucho en sus clases. En el campus de ambas, a lo mucho te responden la duda pasadas las tres horas; y lo tienen muy completo.', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Imposible que no te vaya bien con Pampillo, genia mal.', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'LA MEJOR CATEDRA DE LA VIDA ME HIZO SALIR DE LA DEPRESION. Fisica ll es re linda pero Pampi y Lucre hacen que sea todavia mejor. Esta catedra me hizo volver a tener ganas de estudiar y me hizo disfrutar la materia,cosa que no me habia pasado con ninguna otra. Las dos se complementan muy bien y junto con los de la practica hacen alto equipo. La clases son llevaderas y tenes un recreo de media hora. Son todos re buena onda y no tienen problema en explicarte de buena forma hasta que entiendas bien. Anotate aca', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La mejor profe que tuve hasta ahora. Explica todo muy bien y se entiende perfecto', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'idola, literalmente imposible no entenderle', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Buena mina. Explica re bien. Las clases son muy amenas.', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Lau es una de las mejores profesoras que me tocó tener. Sus clases son por zoom, de 2hs, en el horario que indica el SIU y encima sin ppts (que es lo mejor). Apunta con una cámara a una hoja y da la teórica anotando las cosas importantes, lo cual es excelente porque todo lo que hace y dice se puede seguir perfectamente mientras copias. No es siquiera necesario leer la bibliografía de la cátedra porque todo se habla en clase. Es un amor con los alumnos, responde todas las dudas que tengas las veces que quieras, en clase y por el campus (y se graban las clases). Disfruté mucho la materia y estoy seguro que en gran parte fue gracias a ella y a Lucre.', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Genia total, explica 10 puntos. Te trata bárbaro.', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Sencillamente de lo mejor de la universidad.', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Laura es lo más, super organizada y clara. Da la teórica super completa y te deja el cuaderno impecable para que sea mas llevadero preparar después el final. Se asegura que todos la sigan y si algo no se entiende lo explica cuantas veces sea necesario.', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La amo, la mejor preofesora', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Excelente profesora. Explica muy claro y no tiene problema en volver a explicar cuando no se entiende algo. Muy recomendable', '3ce72d58-d718-4230-a064-1c9e3f6ce143');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Se pierde en las clases y se confunde con lo que da en otros cursos', '20e29ec9-a08c-470b-974c-5c1d9e58658b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'La clase es de 9:30 a 11 hs. ONCE, NO ONCE Y MEDIA LILIANA. ', '20e29ec9-a08c-470b-974c-5c1d9e58658b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un desastre, nunca le entendí nada.', '20e29ec9-a08c-470b-974c-5c1d9e58658b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Me había anotado en el curso del profesor Santiago, pero él no dio las clases teóricas este cuatrimestre (no sé por qué) así que estuvo Pérez. No sé si en el 2° 2022 seguirá ella. A mí y a varios compañeros no nos gustaron sus clases, nos parecieron confusas y aburridas :( . Daba temas que no entraban en los parciales o en el final, y su forma de explicar no me pareció clara, no explicaba las cosas de manera concreta, es como que da muchas vueltas', '20e29ec9-a08c-470b-974c-5c1d9e58658b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Explica para el orto pero deja una buena carpeta para el final', '20e29ec9-a08c-470b-974c-5c1d9e58658b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Re copado y resuelve los ejercicios muy claramente, re buen ayudante', 'e1a14dde-aedf-4e03-8ca5-3d658cb97187');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Dio un par de segmentos de algunas prácticas y se nota que su formación fue en este curso. Es un excelente ayudante que explica increíblemente bien. Siempre que da alguna clase pregunta y repregunta si se entiende lo que dice y si todos lo seguimos. Su buena vibra se siente hasta del otro lado de la pantalla. Creo que su aporte al curso es super valioso.', 'e1a14dde-aedf-4e03-8ca5-3d658cb97187');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Lean es ayudante y a veces hacia ejercicios en la práctica, super claro y muy buena onda con todos los alumnos', 'e1a14dde-aedf-4e03-8ca5-3d658cb97187');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explico algunos ejercicios durante la cursada y se re entiendio todo, explica claro y te responde lo que quieras preguntar. ', 'e1a14dde-aedf-4e03-8ca5-3d658cb97187');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'LEANGOOOOOOD', 'e1a14dde-aedf-4e03-8ca5-3d658cb97187');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'leandro es lo mejor de la práctica. se le entiende todo perfecto y con él no tenés vergüenza de preguntar ni de que repita las explicaciones, además en los tps si no entendés lo que hay que hacer él se divide en 30 para ayudar a quien lo necesite. corrige tps y tira muchos consejos útiles. lo amamos', 'e1a14dde-aedf-4e03-8ca5-3d658cb97187');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Un crack. Aparte de buen tipo la tiene re clara con física II. Le falta un poquito de prolijidad en el pizarron pero es lo de menos. A parte al final de la cursada te organiza asado con todo el grupo y te tira consejos para el final', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente profesor, sabe muchísimo de la materia. Suele extender sus clases 15/20 minutos mas de la hora estipulada.', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente. Las clases las hace MUY entretenidas', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'La materia es una materia muy pesada de por si. Hay dos realidades, por un lado se puede aprender y que te sirva para la vida, pero por otro, se puede entender lo basico y necesario parapasar la cursada y el final. Siento que la materia tiene esas dos posibilides, depende de cada alumno. La clase teorica de Piva, es buena, pero quiere que entiendas todo cientificamente, cosa que hace que entender se hace muuy complicado, exepto que vayas completamente al dia (cosa que recomiendo profundamente para esta materia). Por parte de la clase practica, Di luozo es muy mal profesor, la verdad que mi calificacion para el es un 3. Su unica virtud para escribir es que en el momento de correccion, si hiciste bien el procedimiento te aprueba, no es de mirar el resultado final, si no el proceso, cosa que esta buena para una materia tan teorica. Ese es mi consejo, ir a cursar la teorica, intentando poder cazar algo y complementar diariamente con el libro de la catedra, que es bastante claro y completo, facil de entender. Espero que mi comentario le sirva a alguien en un futuro y quiero felicitar a la creadora o creador de este sitio, me parece muy intersante. Muchas gracias. La facultad la hacemos entre todos y todas. ', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelentes teoricas, me resulto muy claro a la hora de explicar los temas. Se nota que la materia le apasiona, cosa que es muy bueno en mi opinion. Datos a tener en cuenta: Al menos este cuatrimestre (Primero 2018) se adhirió a todos los paros. Otra cosa es que casi siempre las clases terminan unos 15/20 minutos mas tarde de lo que deberían  ', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es claro explicando, barre todos los temas, se queda después respondiendo dudas y siempre empieza puntual', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente profesor. Se nota la pasión que tiene por la asignatura que dicta y la trata de transmitir a sus alumnos. Sabe los temas a la perfección, es un profesor que no lo vas a ver dudar al dar algún tema o al hacerle una pregunta. Sus defectos serían que a veces se molesta un poco con alguna pregunta que no tiene mucho sentido y que cuando da algunos temas se extiende demasiado en cuestiones no tan importantes. Igualmente lo recomiendo, considero que es una materia muy interesante y un profesor como Piva la hace aún más interesante. ', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buen profesor. Las clases son dinamicas y explica los temas con lujo y detalle. Contestando consultas muchas veces al tratar de hacerte entender bien el tema, da vueltas y te confunde. Obviamente siempre te larga media hora tarde. Pero lo recomiendo mucho.', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'muy correcto en sus clases medio extensas pero tenias el plus de que subían las clases grabadas y las podías ver cuando quieras ', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Un capo, en todo sentido, apasionado, muy claro y quiere que te interese la materia. Capaz un poco repetitivo si ya viste las teoricas grabadas pero siempre le aporta algo mas que esta bueno, Recomiendo.', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'EXCELENTE profesor, clarísimo, sabe un montón, prolijo. Uno de los mejores profes que tuve desde que entre a fiuba.', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'PIVA es lo mas grande que hay, explica super claro y graba las clases ', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buen profesor, siempre con buena onda y responde todas las dudas', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buen docente, sabe una bocha y encima es copado; lo único negativo es que llega a dar muy justo los últimos temas de cada parcial.', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Sabe muchísimo, se nota que le apasiona la materia y hace que te termine gustando a vos también. A veces se va un poco por las ramas contando datos o historia sobre el tema que esté dando, pero genera una clase por demás interesante. Muy buen trato con los alumnos, clima amistoso y divertido dentro del aula. Un genio.', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'A mi personalmente me dejo con muchas dudas siempre, no me dejo bien preparado para el final.', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Excelente teorica,  explica muy bien, le pone mucho entusiasmo y hace la clase muy llevadera y entretenida. No llego a dar del todo bien Termodinamica (La parte de maquinas termicas mas que nada) y tuve que estudiarlo por mi cuenta a la hora del final, nada que el apunte de catedra o un buen libro no resuelva.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'El profesor mas capo que tuve', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Es un muy buen profesor, sabe mucho pero a veces se va por las ramas y se pierde mucho tiempo. En general explica muy bien, pero cada tanto un concepto fundamental lo explica muy por encima y no te lo deja claro.', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Muy divertido, hace la clase llevadera. Explica con ejemplos (trae materiales del laboratorio a veces), y deduce varias de las formulas. En lo personal, senti que muchas veces bajo los contenidos a un lenguaje menos formal, lo cual me sirvio mucho. Sus clases suelen extenderse.', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Responde dudas en el grupo de Facebook. Excelente profesor, sabe muchísimo y lo transmite. ', '239c1a9c-420c-4bb1-8e16-52bf079878bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Lo tuve en analsis, aca es igual, a veces hace chistes, cero drama en que le preguntes, explica ok, se le entiende y algo sacas de lo que hace. Lo unico es que le pone mucho enfasis a las cuentas, el tranquilamente puede perder mas tiempo reemplazando numeros que explicando la fisica del problema y es lo unico que hace que sea medio un bodrio cuando da un ejercicio. Lo bueno es que no todos los ejercicios que hace, ni todos los temas de la materia, son de tener mucho numero feo, cuando no es el caso me parece que sus explicaciones estaba bastante bien, pero sino agarrate porque va a estar 20min reemplazando numeros y unidades', 'bdf9286e-dd15-4eaa-8276-c54bf538fa6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Sabe muchisimo. Vale la pena preguntarle en las clases de consulta previas a los parciales, responde todas tus dudas hasta que entiendas', 'bdf9286e-dd15-4eaa-8276-c54bf538fa6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Eduardo es lo mejor que hay. Enseña para el culo, pero es un personaje, siempre con su ensalada de frutas en la practica. Si le haces preguntas se sienta y te responde, a veces con poca claridad, pero intenta.', 'bdf9286e-dd15-4eaa-8276-c54bf538fa6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'sus explicaciones se entendian joya y encima te hacia reir a veces, un capo', 'bdf9286e-dd15-4eaa-8276-c54bf538fa6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'No pincha ni corta. No es la gran profesora de Fisica II pero tampoco es mala. Le falta un poco de pila', 'c04cf984-494b-4a84-9a1b-51a2798c4b62');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Una genia, va directo al grano sin dar vueltas, sus power points me ayudaron a aprobar en este cuatri de forma virtual. Recomendado 100%', 'c04cf984-494b-4a84-9a1b-51a2798c4b62');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Se mareaba un poco, pero es buena profesora. Lo bueno es que la practica la teniamos con ella y Binda y el explica muuy bien.', 'c04cf984-494b-4a84-9a1b-51a2798c4b62');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Quizás al principio parezca un poco seria. Si participas y haces preguntas, se esfuerza mucho en tratar que entiendas y le pone toda la onda.', 'c04cf984-494b-4a84-9a1b-51a2798c4b62');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Ella es un amor y una genia. No me gustó que sus clases fueran con PowerPoint, eso le restó mucho. Igualmente, gran cátedra. ', 'c04cf984-494b-4a84-9a1b-51a2798c4b62');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'que buena docente que es presa <3. Una genia, baja a tierra todos los conceptos de la materia y hace unas analogias excelentes. Si te da la prioridad, anotate con presa', 'c04cf984-494b-4a84-9a1b-51a2798c4b62');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica ejercicios de la práctica en diapositivas, no me gustó. Es muchisimo mejor que hagan los ejercicios en el momento en el pizarrón. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La practica con Presa es buena. Es macanuda y si le preguntas algo se va a parar a explicarlo todas las veces que haga falta. Creo que es de las pocas profesoras que toma parcialitos antes de los laboratorios, pero no son dificiles y si no los tomara nadie leeria la practica antes de la clase.', 'c04cf984-494b-4a84-9a1b-51a2798c4b62');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Te tira la "posta" a la hora de encarar los ejercicios, muy dispuesta a responder dudas tambien.', 'c04cf984-494b-4a84-9a1b-51a2798c4b62');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Llegaba como 40 minutos tarde a la clase y se perdía tiempo. Pero siempre tiraba la posta de como hacer ejercicios y nos hacia resolver algunos y después consultarle antes de irnos que si se aprovechaba te quitaba un monton de dudas', 'c04cf984-494b-4a84-9a1b-51a2798c4b62');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Las explicaciones de Vero son claras y organizadas. Cuando empieza con algún tema resume los principales conceptos de la teoría (las clases prácticas iban atrasadas respecto a las teóricas), lo cual es muy útil. Cuando está explicando ejercicios también, trata de que nos quedemos con lo clave, y de hacerlo conciso. También está bueno que trata de cubrir todas las alternativas de los problemas, aunque sea de manera conceptual. Creo que lo que más dificulta las clases prácticas es la cantidad de ayudantes que hay. Está bueno porque siempre hay alguien a quién se le puede consultar dudas de ejercicios, pero quizás a la hora de explicar alguno en el pizarrón, las maneras son muy diversas, algunas confuden y puede hacer que te pierdas ejercicios claves. Está dispuesta a responder dudas. Algunas clases da algún ejercicio de la guía para que resolvamos individual o grupalmente y después ponerlo en común en el pizarrón (y pasa por los bancos a ayudar y ver si estás trabajando). En cuanto a los laboratorios es bastante insistente con que hagamos bien las prácticas y toma parcialitos antes. Una queja frecuente fue que si desaprobabas el parcialito no podías hacer la práctica de laboratorio, pero terminaban de corregir recién una hora después cuando ya habías empezado a trabajar, entonces si desaprobabas te tenías que ir. No acepta los trabajos prácticos ya aprobados, para quienes recursan. Este cuatrimestre hubo mucha confusión al respecto. Al principio, si tenías los TPs aprobados, se dijo que solo tenías que rendir el parcialito y aprobarlo. El día del primer laboratorio dijeron que teníamos que quedarnos en la práctica a "ayudar" al grupo que te asignaban (y había mucha insistencia con que si al grupo le iba mal era tu responsabilidad porque ya habías aprobado). Finalmente terminamos haciendo los trabajos como si nunca los hubiésemos hecho y nos hicieron explicar unos trabajos de magnetismo que eran demostrativos. No digo que esté mal, pero podrían haberlo aclarado desde un primer momento. ', 'c04cf984-494b-4a84-9a1b-51a2798c4b62');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Una genia, muy buena onda siempre y super clara', 'c04cf984-494b-4a84-9a1b-51a2798c4b62');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Incluso aunque allá Sido en curso SP fue muy desprolijo para explicar y que todas las clases fueran en el laboratorio no ayudo mucho porque el pizarrón era difícil de ver dependiendo del lugar por las tuberías', '92c85f4f-25a4-4195-b8c6-4fd50fde503d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'La verdad impecable como docente de la teórica, explica los temas en profundidad y te hace demostraciones matemáticas sencillas, que hacen que sea mucho más fácil preocuparse por entender la física y no estar todo el tiempo sufriendo como si estuvieras cursando Análisis 2 y 1/2. Uno de los mejores docentes que me crucé en la facultad. Incluso tuvimos algunas clases de consulta en días feriados o días que no eran los de cursada. La verdad un compromiso gigante por el aprendizaje de los alumnos', '92c85f4f-25a4-4195-b8c6-4fd50fde503d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Un crack! Le pone la re onda y se hace la clase muy amena. En esta modalidad virtual siempre impulsaba la participación de todos y nunca tuvo problemas en contestar dudas. La explicación también de 10.', '92c85f4f-25a4-4195-b8c6-4fd50fde503d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Excelente docente. La tiene clarisima en todo sentido. ', '92c85f4f-25a4-4195-b8c6-4fd50fde503d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'En el cuatri virtual, siempre pedia que algunos participen en clase así no era un monologo. Podes prender el micrófono cuando quieras y hacer preguntas. Da algunos ejemplos de casos aplicados a la vida real que esta bueno porque hace que entiendas un poco mejor. Es un poco desorganizado pero explica bastante bien y le gusta que pregunten.', '92c85f4f-25a4-4195-b8c6-4fd50fde503d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Re copado, hace que la clase sea llevadera, se le entiende pero a veces se olvida que le falto dar algo y lo agtega al final. Pero excelente profesor', '92c85f4f-25a4-4195-b8c6-4fd50fde503d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Su clase es descontracturada y un poco desorganizada, aunque me dio un panorama amplio sobre la materia y, si bien no se detenía mucho tiempo en dar demostraciones, sus explicaciones me parecieron acertadas y siempre prefirió que entendiéramos los temas razonando. Hace bastantes ejercicios prácticos, algunos sacados de finales que preparó él.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es un profesor agradable, "amiguero". En el curso semipresencial, fomentó la participación de los alumnos y no fue muy riguroso matemáticamente (tal vez en un curso regular sea mas matematico). No tiene problemas en responder preguntas.', '92c85f4f-25a4-4195-b8c6-4fd50fde503d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Redin es re copado y hasta arma experimentos en su casa para que los vieramos en virtualidad y entendiéramos de qué estabamos hablando. Siempre contesta dudas y va de a poco metiéndote en la parte dura de la materia sin problemas.', '92c85f4f-25a4-4195-b8c6-4fd50fde503d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica bien los temas, con sus palabras y va escribiendo a medida que lo hace. Es medio desprolijo pero se le entiende. Te tira tips para resolver ejercicios, hace experimentos antes de arrancar la clase y fomenta la participación.', '92c85f4f-25a4-4195-b8c6-4fd50fde503d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'roht es excelente docente y persona, muy atenta!!', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Exigente, a veces deja demasiado sin resolver, pero siempre predispuesta a atender dudas o consultas', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Muy buena profesora. Cuando daba clase ella se entendía todo. Sus ayudantes dejaban bastante que desear.', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Buena predisposicion busca diversas formas de que entendamos y ayuda a fomentar la participacion inclusive en la cursada virtual', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica muy bien los temas, cada tanto para para ver si todos la siguen y si es necesario vuelve un poco para atrás ', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Realmente Lucre es una genia. Tiene un dominio de los temas de la materia que hacen que sus clases teoricas sean impecables. No le molesta contestar una duda repetidas veces, y siempre salis de sus clases entendiendo. Ademas, siempre se toma un rato antes de la clase en contestarte dudas de las guias. Si podes cursar con ella, no dudes en hacerlo.', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica muy bien y prolijo, te da absolutamente todo, hace ejemplos, llegamos con los temas re tranqui (hubo varios cursos que fueron atrasados este cuatri) y le podes preguntar cualquier cosa y te responde lo mas bien (varias veces algunos ibamos a preguntarle cosas antes de arrancar la clase y se quedaba 20-30min explicandonos lo mas bien y llegabamos bien con la clase despues). No tengo mucho mas que comentar, realmente impecable; yo estudie exclusivamente de sus clases y pude aprobar el final tranquilo. Es una materia pesada y molesta, pero imposible desaprobarla si vas con ella y te pones las pilas para estudiar, idola lucre
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'No da clase, se limita a proponer ejercicios para que los resuelvan los alumnos y le hagan consultas. Nada recomendable.', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'excelente roth', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Lucre una gran profesora y más aún persona. Al igual que Pampillo se preocupa por conocer a los alumnos y siempre responde toda duda que tengas por el campus o por mail', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Genia, hace muy participativa la clase practica. Si vas después de que termina la clase, te responde las dudas con la mejor, no se apura ni nada, se toma su tiempo para que lo entienda. Excelente docente!', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es toda una genial explicando. La mejor que tuve en la facultad junto a Pampillo. Me gustó mucho su carácter y la buena onda a la hora de dar las clases. También la paciencia que tiene para contestar dudas en la clase y en el campus. Es muy clara y ordenada a la hora de explicar y hacer los ejercicios. Sus ayudantes son lo más.', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Otra genia explicando, sirven muchos sus practicas', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'LA MEJOR CATEDRA DE LA VIDA ME HIZO SALIR DE LA DEPRESION. Fisica ll es re linda pero Pampi y Lucre hacen que sea todavia mejor. Esta catedra me hizo volver a tener ganas de estudiar y me hizo disfrutar la materia,cosa que no me habia pasado con ninguna otra. Las dos se complementan muy bien y junto con los de la practica hacen alto equipo. La clases son llevaderas y tenes un recreo de media hora. Son todos re buena onda y no tienen problema en explicarte de buena forma hasta que entiendas bien. Anotate aca', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Buenísima profe. Siempre resuelve todas las dudas que se presenten y explica todo muy bien', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'esta catedra es lo mejor que hay, lucre y laura me hicieron amar y entender esta materia, ni dudes en anotarte aca', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Buena mina. Explica re bien. Las clases son muy amenas.', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Hasta antes de este cuatrimestre yo era fiel creyente de que las prácticas de las materias no servían de mucho. Las prácticas de Lucre te hacen cambiar de opinión. Es clave asistir a sus clases porque TODO lo que dice o hace te va a servir a la hora de rendir parciales o el final. Explica de forma clarísima y es súper carismática, hasta te tira unos chistes. Cualquier duda que tengas ella va a saber responderla, y nunca te va a hacer sentir un burro por más que tu pregunta sea super básica. Hace todos los desarrollos de ejercicios en la compu, con tableta gráfica, así que se entiende todo perfecto y encima graba todas las clases. Recomendaría tanto a ella como a Lau a cualquiera que quiera cursar esta materia.', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', '10 puntos, sabe mucho. Muy genia. Explica bárbaro.', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Hice la práctica con lucre, hace ejercicios muy buenos para poder encarar después las guías y ejercicios parecidos a lo que puede llegar a aparecer despues en parciales. Muy buena onda y super buen trato con los alumnos. Imposible no quererla', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buena profesora, algunas veces va un poquito rapido pero vuelve para atras cuando necesitas. Explica muy claro y es buena onda', '0e9f6339-12d6-451d-90f5-d265043ca084');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'lucre se preocupa mucho por los alumnos. siempre pregunta antes de comenzar la clase cómo vamos con las guías, y también no tiene problema en contestar dudas media hora antes de comenzar la clase, o en el intervalo entre la teoría y la práctica. es muy clara explicando, va a los pedos pero se le entiende todo y no tiene problema en repetir la explicación si le preguntas.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es lo malo de la catedra. Si podes anda a otra teorica pero anda a la practica de Leito Binda que es un capo', '2f773b8a-ca26-451b-8e8a-09d9275d64d7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente profesor. Super recomendable', '727ce2ab-edce-4d25-8919-18f572316994');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Es un capo mal y siempre te responde bien, ademas sabe una bannnda. Lo que sí, explica suuper lento, se va medio por las ramas y a veces se termina atrasando y deja cosas importantes medio voladas. A mi me sirve más así, esta teórica con una buena práctica va bien.', '727ce2ab-edce-4d25-8919-18f572316994');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'Santiago es EXCELENTE. Explica todo de una manera muy visual y conceptual, se entiende todo perfecto. No tiene problema en repetir las cosas y da los casos de manera teórica, que después se complementan con la práctica.', '727ce2ab-edce-4d25-8919-18f572316994');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Cuando leo los comentarios de otras cursadas con Santiago siento que estuve con otra persona. No sé si habrá sido particularmente en el 2C2019 pero sus clases eran extremadamente frustrantes. Se iba por las ramas, sin cerrar nunca los temas y dejándolos en el concepto (nunca dijo la palabra dieléctrico en todo el cuatrimestre!!!) y no estaba tampoco bien coordinado con su práctica. Irónicamente, teniendo mucho más tiempo que los de Física II A, vimos varios temas con menos profundidad que ellos. ', '727ce2ab-edce-4d25-8919-18f572316994');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Clarísima siempre que explica, se re preocupa porque todos entiendan lo que dice. Te explica todos los desarrollos paso a paso y encima es super amorosa. ', '75d4e0a1-a6cb-4dac-9289-74859bf70d94');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'A veces se mezcla un poco cuando explica los problemas pero despues vuelve y se le entiende con tiempo. ', '75d4e0a1-a6cb-4dac-9289-74859bf70d94');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Clases con PowerPoints bien hechos, habla con micrófono, por lo que es muy fácil seguirlo. Tiene ganas de dar clases, que ayuda mucho para hacer la materia. ', '95c85aef-835a-476a-b236-298ac58afa16');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'La teórica se entiende perfecta. Tiene un powerpoint para cada clase y los sube a medida que avanza el cuatrimestre. Super organizada. Siempre contesta dudas y si no sabe contestarte averigua la respuesta y la sube a un grupo de facebook que arma ella con los alumnos a principio de cada cuatrimestre. Super recomendada. ', '95c85aef-835a-476a-b236-298ac58afa16');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Super recomendable. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Re contra organizada para dar las clases. Explica muy bien. Un poco secuencial a la hora de dar las filminas, pero le da un enfoque ingenieril a la materia.', '95c85aef-835a-476a-b236-298ac58afa16');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'alta capa, las clases estas buenas, a veces se ponen un poco densas pero por ser fisica 2, de una u otra forma la parte matematica se pone un poco movida. Siempre responde con la mejor onda. Sus diapositivas estan re completas, me sirvieron para preparar el final.', '95c85aef-835a-476a-b236-298ac58afa16');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es re copada y no tiene drama en responder dudas durante la clase, re bien predispuesta pero la gran desventaja es que sus clases son en powerpoint lo que las hace medio pesadas, aburridas y dificiles de seguir ya que no podes tomar apuntes por lo rapido que va aunque sube todas las diapositivas a un drive. Me hubiera gustado que explique los temas en el pizarrón aunque las diapos muy buenas y se nota el esfuerzo que les puso.', '95c85aef-835a-476a-b236-298ac58afa16');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Las clases las da con diapositivas lo cual hace que la clase sea muy aburrida ademas de que va muy rápido. Se ve que le pone ganas y le dedicó tiempo a preparar la clase pero a mi esa manera no me resultó. Se ausentó a muchas clases porque realizó un viaje aunque lo compensó subiendo las clases en forma de video a su grupo de Facebook. Muy amable para responder consultas.', '95c85aef-835a-476a-b236-298ac58afa16');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Las clases eran leer y extender la explicación de los powerpoints que, como era su primer cuatrimestre dando la teórica, los subía muy a la noche y no llegaba a leerlos para poder seguir la clase y no se aprovechaba, ademas tenían algunos errores. Igual fueran muy útiles para preparar los finales aunque hubiera preferido que las demostraciones se hicieran en el pizarron y también aclarar algunos temas con ejercicios. Después de clase se quedaba a responder dudas con buena disposición ', '95c85aef-835a-476a-b236-298ac58afa16');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Una genia! Muy muy dedicada a que aprendas toda la materia. Cualquier consulta que le hagas se va a tomar todo el tiempo que necesites para que salgas de la clase entendiendo. ', '95c85aef-835a-476a-b236-298ac58afa16');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Buena docente, muy clara explicando. Las clases son un poco monónotonas porque no da lugar a participación.', '95c85aef-835a-476a-b236-298ac58afa16');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Bastante estricto con las reglas dentro del aula, exigía el uso de barbijo en todo momento y no permitía comer ni tomar dentro del aula. A veces imponía estas reglas de una manera un poco hostil. Más allá de eso, no me parece mal profesor ni mucho menos mala persona. Daba muchas vueltas para resolver los ejercicios, a veces se volvía tediosa la práctica ya que estaba una hora dando vueltas al rededor del mismo problema. Sin embargo, siempre estaba predispuesto a responder todas las dudas o preguntas con muy buena onda.', 'a735ce81-13b7-45eb-8c8d-ec28a1aaaa21');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy malo. Corrige muy mal y explica peor. ', '8d855c0f-6ae1-4ca6-85b2-384cc518dae6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es muy malo explicando y muy exigente para corregir.', '8d855c0f-6ae1-4ca6-85b2-384cc518dae6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'muuuy soberbio y es muy exigente corrigiendo (casi imposible de aprobar). Pero se nota q sabe muchisimo', '8d855c0f-6ae1-4ca6-85b2-384cc518dae6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La verdad explica bastante bien. La materia es pesada, pero le pone onda y se nota que le gusta lo que da. Te responde todas las dudas con la mejor y se empeña para hacerte entender', 'f91b2d98-94a4-4c53-bbce-97b3066dc729');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La tiene muy clara y te explica todo re en detalle y re tranquilo, trajo varios experimentos para demostrar en clase. porahi se te haga aburrido pero le pone toda la onda, yo igual me dormia 10 minutitos siempre y pipí cucú la clase la seguis joya', 'f91b2d98-94a4-4c53-bbce-97b3066dc729');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es El hombre, la tiene clarísima, explica muy bien los temas, no tiene problemas en repetir las cosas o explicarlo de otra manera. Esta a disposición para dudas en el laboratorio, se toma el tiempo para explicar bien lo que necesitas saber.', 'f91b2d98-94a4-4c53-bbce-97b3066dc729');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'facu es un genio, explica muy bien y se nota que sabe mucho de la materia. Este fue su primer cuatrimestre dando teóricas en F2 pero realmente la rompió. ', 'f91b2d98-94a4-4c53-bbce-97b3066dc729');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'sabe muchisimo de fisica, a veces se va un poco por las ramas, pero llego a dar todos los temas bien', 'f91b2d98-94a4-4c53-bbce-97b3066dc729');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'literalmente uno de los mejores profesores de fiuba que tuve, terrible su forma de dar las clases, fomentar la participacion y explicar. llevo cositas para poder explicar en clase y mostrar mejor el funcionamiento de las cosas. muy paciente, lo recomiendo 10/10', 'f91b2d98-94a4-4c53-bbce-97b3066dc729');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'De los mejores profesores que tuve en la facultad. En mi opinión es una materia bastante difícil/pesada pero Facu explica todo con claridad y no tiene problema en volverte a explicar si no entendiste. Va al día con el cronograma lo cual permite no dormirse con la materia. Tiene muy buen trato con los alumnos y fomenta la participación. Se nota que le encanta ser docente. No duden en anotarse a esta comisión. ', 'f91b2d98-94a4-4c53-bbce-97b3066dc729');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Euge un genio, siempre en las clases y se aseguraba de grabarlas o transmitirlas para los que no pudieran asistir a la presencial. Responde seguido por telegram. Dando clases se marea un poco, pero trae recursos que ayudan a entender los temas.', 'e5975bad-ac06-4cb0-b0a6-f2df2426255e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Tengo entendido que Euge no está más en la cátedra. Una lástima, porque explica muy bien y sobre todo, era el alma de la cátedra en cuanto a organización. Grababa todas las clases y las compartía por YT en vivo, y hasta estaba atento al chat por si alguien tenía dudas. Todo el campus estaba muy bien organizado gracias a él, y a veces mostraba simulaciones muy buenas hechas por él. Cuando se daba cuenta que no se estaba entendiendo algo que explicaban los profes, siempre saltaba al rescate. Además, era el que más respondía dudas en el chat de Telegram.', 'e5975bad-ac06-4cb0-b0a6-f2df2426255e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Facu un genio, se quedaba hasta terminar el tema aunque cursaba a las 16. Siempre trae material y resuelve ejercicios muy claros en el pizarron. Responde consultas por telegram.', 'b318d452-e8ff-4747-97fa-1dcf057d4288');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Facundo es un genio, es de lejos el que mejor explica del curso. Las clases que da él son oro, traten de aprovecharlo porque no da tantas clases y sabe muchísimo (más que los docentes en ciertos temas). Tiene cero problema con las consultas, así que preguntenle TODO. Su única desventaja es que no esta todas las clases, y cuando está no suele quedarse hasta el final (por lo menos el cuatri que yo la cursé).', 'b318d452-e8ff-4747-97fa-1dcf057d4288');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No da clases, solo corrige tps. En gral se explica bien aunque mecha mucha charla personal que no siempre es necesaria.', 'def5b3e6-0510-4d96-9733-bbbc718dae2f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'En todo el cuatrimestre que cursé, lo único que hizo fue encargarse del TP de laboratorio, que se hace en media hora. Ese día nos explicó un par de cosas que se entendieron bastante bien, pero el resto del cuatri nada de nada.', 'def5b3e6-0510-4d96-9733-bbbc718dae2f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Sus clases se basan en sentarse a consultar dudas de un libro. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se jubiló', '4155f8b8-a71b-426b-b173-ed76acadbf10');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Da la clase de forma particular no explica los temas a fondo da una breve introducción nomas, despues forma grupos y te da un cronograma y el libro para que lo lean y hagan los ejercicios.  despues va pasando por cada grupo preguntando como va si hay alguna duda y explicando si es necesario la da con 2 ayudantes lo que da variacion a las explicaciones. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Es un buen profesor y sabe bocha', '33c96447-5626-4156-9053-6520c1e7f316');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Siempre presenta aplicaciones reales de los temas vistos, lo que resulta muy interesante. Lo importante es tratar de no perderse con el desarrollo matemático en las diapositivas (modalidad virtual)', '33c96447-5626-4156-9053-6520c1e7f316');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Debe ser de los tipos que mas saben en toda la facultad pero suele irse muy por las ramas, es importante saber a que darle bola y a que no. A pesar de todo esto, la clase zafa.', '33c96447-5626-4156-9053-6520c1e7f316');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es un buen profe, se nota que sabe un monton de la materia. Si salta con cosas que nada que ver a veces y no tiene las clases super organizadas. Suele equivocarse en el pizarron al escribir mucho desarrollo de ecuaciones y a veces no usa la misma notacion que los ayudantes, pero en gral siempre que no entendes algo vuelve a explicartelo con mucha paciencia.', '33c96447-5626-4156-9053-6520c1e7f316');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se nota que sabe muchísimo, pero ya no se lo ve muy motivado para enseñar. Cuando él da una clase (se las reparten entre todos) suele hacerse muy denso y aburrido, y no se le entiende del todo bien. No tiene problema con las consultas.', '33c96447-5626-4156-9053-6520c1e7f316');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es crack, sabe una banda pero es por lejos uno de los peores profesores que tuve hasta ahora. Las clases están muy mal organizadas, no se le entiende absolutamente nada cuando explica. Un desastre', '33c96447-5626-4156-9053-6520c1e7f316');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'el profe ve la física cuántica. si vas a todas ls clases aprendes no hay vuelta. es muyy predispuesto', '33c96447-5626-4156-9053-6520c1e7f316');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es un docente muy bueno,  se nota que sabe mucho , pero a veces se hace medio densa la clase.  ', '33c96447-5626-4156-9053-6520c1e7f316');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Sus clases son muy aburridas y nunca explica nada en concreto. Cuando empieza a hablar de algún tema te cuenta la historia y datos que no son importantes, pero nunca termina explicando las definiciones o conceptos claves del tema. Además sus presentaciones están llenas de errores y sus finales tambien. ', '33c96447-5626-4156-9053-6520c1e7f316');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Algunas veces es claro pero usualmente su desprolijidad opaca todo', '4c111359-3786-4575-9c57-aa425e84fa36');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Lamentablemente el 1erC 2020 sus resoluciones de ejercicios en hoja escaneada eran ilegibles', '4c111359-3786-4575-9c57-aa425e84fa36');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Un delincuente. Daba las clases con los apuntes mas desprolijos que vi hasta ahora. Se la pasa tirando datos históricos de la Física que a nadie le interesa y para suplir su falta de conocimiento.  Cuando da la clase de el, es mucho muy importante ponerse a hacer otra cosa para no perder el tiempo. No da ninguna clase de la 2da parte de la materia porque no tiene ni idea del tema.', '4c111359-3786-4575-9c57-aa425e84fa36');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Sabe un monton, pero lo demuestra sobradamente a veces y medio mala onda. Creo que considera que tenes que saber un monton de cosas de antemano. Siempre llega tarde', '4c111359-3786-4575-9c57-aa425e84fa36');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Alejandro sabe mucho de historia de la física, suele tirar fechas interesantes. Cuando él explica, suelen ser ejercicios prácticos, pero es un poco confuso y a veces usa nomenclatura de libros que no coincide con la del resto de las clases, lo cual es un poco molesto. No tiene problema con las preguntas, siempre que no sean demasiado básicas.', '4c111359-3786-4575-9c57-aa425e84fa36');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Mediocre es quedarse corto. Da las clases con un libro en la mano y literalmente te lo LEE EN EL MOMENTO al mismo tiempo que copia y pega los ejercicios resueltos del libro. Cuando quiere explicar sin ayuda se nota que no sabe nada y hace agua por todos lados. Una vergüenza para la facultad', '4c111359-3786-4575-9c57-aa425e84fa36');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'nefasto, horrible, impresentable. No sabe nada, es un chamuyero, copia ejs de libros!!!', '4c111359-3786-4575-9c57-aa425e84fa36');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Al pincipio era medio desastre pero mejoro un monton alejandro. La letra que tiene no lo ayuda porque sabe pero habla muy lento y a veces no se entiende que escribio. Si tuviera mas preparado todo seria excelente enseñando.', '4c111359-3786-4575-9c57-aa425e84fa36');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy desprolijo y no se entiende nada cuando explica. Cuando explicaba un ejercicio directamente hacia otra cosa para no perder el tiempo.', '4c111359-3786-4575-9c57-aa425e84fa36');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Para pisarlo con el auto, las clases del viejo dan asco, mejor quedarse en su casa mirando la pared', '1bb2ce90-f140-4716-91b1-0cd4807588a6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Lo felicito, nunca pensé que se podia ser tan incoherente con lo que se dió en clase y lo que evalua despues.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No se quien es este tipo.', '7be4b8d3-3509-44e0-98c1-54c1faa03c8f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Mala predisposición, poco claro. Se nota que solo esta por un cargo. Le falta compromiso en la materia. ', '7be4b8d3-3509-44e0-98c1-54c1faa03c8f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Da muy pocas teóricas, pero las que da estan muy buenas, son muchisimo mejor que las de Fernandez.', '7015e07a-ffbc-4c70-8078-70e92e201b69');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Rey vega sabe un monton pero parece que no tiene muchas ganas de dar clase. A veces te caga un poco cuando corrige peor a la larga te aprueba.', '7015e07a-ffbc-4c70-8078-70e92e201b69');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Solo lee las diapositivas en las teoricas es practicamente faltable  y la practica no da ni clase excepto una o dos veces casi sin aviso.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Sabe de lo que enseña. Es muy claro y responde preguntas tanto en su mail como en clase. ', '7015e07a-ffbc-4c70-8078-70e92e201b69');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'EXCELENTE. SABE TODO. CRACK
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Se puso al hombro la parte del pizarrón desde la casa. Le dedica tiempo a las clases y explica bien', '1e5e19aa-3e84-49c8-95bc-c154ffd080cc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Un capo Fede. Te ayuda siempre y sabe mucho.', 'f5cc073c-2c43-4e4e-9609-acf379d47d3f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Se encarga de la teorica, aunque tambien esta presente en las practicas. Las teoricas son videos de YTB, donde los temas estan muy bien explicados. En mi opinion, con la teorica es suficiente para encarar la materia y hacer los ejercicios. Es una materia tranquila, en donde no te toman a matar; consiste en un parcial, donde te toman lo que te explicaron (x eso es clave hacer la guia) y un tp tranquilo. Es una materia que con el nombre da miedo, pero cuando la cursas te das cuenta que nada que ver.', 'c4f216a3-46ea-4e59-8e54-61a817ffc6f7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Una genia total. Clases muy entendibles, si bien se leen unas diapositivas en el pizarron llega a desarrollar todo, Si tenes una consulta sobre parciales/finales te los responde todas completamente y sin ningún problema, no se va hasta que se entienda.', 'c4f216a3-46ea-4e59-8e54-61a817ffc6f7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'La materia si no deberia existir en Ingenieria en Informatica, en la mitad del cuatrimestre mando un email justificando su trabajo. Es una materia que solo mete palos en la rueda a las personas, este curso es mucho mejor comparado al otro.', 'c4f216a3-46ea-4e59-8e54-61a817ffc6f7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Se encarga mas que nada de las clases practicas, donde resuelven ejercicios de la guia. Para preparase para el parcial y para el final, basta con hacer la guia.', 'd1bda326-c6e8-4712-b2b2-2b80cafee50b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Se encarga de las practicas, resuelve ejercicio de parciales/guía completamente, se entienden muy bien, también corrige los tps te da muchas oportunidades de tener una buena nota en el tp para poder promocionar.', 'd1bda326-c6e8-4712-b2b2-2b80cafee50b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Muy buena profesora, sabe mucho y quiere transmitirlo. Interesante materia.', '8cd3a7c2-82c8-4e5c-95a6-37cdefa280e7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Un genio como ayudante', 'b3bb4a84-bd96-4c55-a084-dfaa4dd7f8c8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buena onda y siempre dispuesto a ayudar con las dudas. Incluso armo un grupo de whatsapp para que consultemos, que realmente fue muy util. ', 'b3bb4a84-bd96-4c55-a084-dfaa4dd7f8c8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Copado y muy predispuesto a la hora de contestar lo que sea. Pero al pararse en el pizarron, es bastante desorganizado y da por sabidas cosas que no lo están.', 'b3bb4a84-bd96-4c55-a084-dfaa4dd7f8c8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es bueno como ayudante. Contesta dudas por wpp y hace varias clases de repaso para que nos haya bien', 'b3bb4a84-bd96-4c55-a084-dfaa4dd7f8c8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buenas sus practicas junto con el otro ayudante Esteban Gonzalez. Se nota que ambos quieren que aprobemos y le ponen todo de ellos para ayudar a los alumnos. Las practicas de este curso son muy buenas no asi las teoricas. Todo el tiempo ambos ayudantes buscan la participación de los alumnos y explican las veces que sea necesario el ejercicio que esten explicando.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explicando el ruso es crack, no tenía problema en quedarse después de clase para dar un par más de ejercicios o repasar para el parcial. Yo creo que mucha gente no dejó la materia solo por estar el.', 'b3bb4a84-bd96-4c55-a084-dfaa4dd7f8c8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un capo, nos salvó en el curso con Caracciolo porque él habrá venido 8 clases como mucho a hacer preguntas como "evaluando". Explica super bien y además es re copado, la clase no se te hace pesada. Tiene un grupo de wpp con los alumnos y siempre que preguntás algo te responde a los pocos minutos, super atento. ', 'b3bb4a84-bd96-4c55-a084-dfaa4dd7f8c8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2018', 'Capo el Ruso', 'b3bb4a84-bd96-4c55-a084-dfaa4dd7f8c8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy buen docente, explica un poco rápido pero siempre con la mejor onda. Además organiza clases de consulta y contesta dudas por whatsapp.', 'b3bb4a84-bd96-4c55-a084-dfaa4dd7f8c8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Lo mejor de la cátedra no solo explica demasiado bien los ejercicios sino que también hace un grupo de wpp para aclarar dudas. gracias ruso por todo tkm.', 'b3bb4a84-bd96-4c55-a084-dfaa4dd7f8c8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'El ruso(andres) y esteban hacen que la cursada sea mucho mas llevadera. Jorge también ayuda pero les daría el papel principal a ellos dos. Andres explica bien los problemas, esta abierto siempre a dudas y casi siempre contesta si le mandan una duda. Tiene un gran trato para los alumnos y es muy buena onda. Aunque hay veces que no asiste a las clases', 'b3bb4a84-bd96-4c55-a084-dfaa4dd7f8c8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'El ruso es un crack, responde dudas por el grupo de WhatsApp del curso, va a todas las clases e incentiva mucho la participación. Sabe que estamos con más materias además de la suya y se presta para darte una mano si estás dispuesto a laburar vos también. ', 'b3bb4a84-bd96-4c55-a084-dfaa4dd7f8c8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Vieja de m.... maltrataba a las otras profesoras y sus teóricas no se entendían nada, ademas de que llegaba tarde siempre. Su micrófono se escuchaba horrible, termine dejando de ver las clases, no recomiendo este curso', 'c7e597ed-4f6c-4ddd-a0ea-ab394d34426f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Ante el mínimo intento de que Lunati y Ruiz Vázquez expliquen más de lo que ella quería (porque "para las teóricas ya eran suficiente los videos de la materia") se enojaba y las trataba muy mal al punto de que era incómodo estar en las clases, además de que también le contestaba mal a la mayoría de los pocos alumnos que quedaban. Recién al final del cuatrimestre le puso un mínimo de onda porque ya no iba nadie. Lo único rescatable de su curso son Carolina y Macarena que explican bien y se la bancaban.', 'c7e597ed-4f6c-4ddd-a0ea-ab394d34426f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Me ayudo a entender la materia en este caos virtual, cuando muchos cursos no tenian clases. Genia Laura!
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'El material de estudio de la cátedra está unificado y deja bastante que desear. Hay clase un día a la semana. Las entregas de TPs de desarrollo no tienen enunciados claros.', '403ee8a6-5ed1-42ef-82c6-3358c57e4a74');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Lo mismo que Irianni, nunca dio teoria, solo practica, pero me parece que ella explica un poco mejor y esta mas conectada con los alumnos', '403ee8a6-5ed1-42ef-82c6-3358c57e4a74');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'De los mejores docentes que hay en la facultad.', '403ee8a6-5ed1-42ef-82c6-3358c57e4a74');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es súper prolija y clara para explicar los temas, todo ordenadito, con colores. Responde re bien las dudas y le gusta que respondan en la clase.', '403ee8a6-5ed1-42ef-82c6-3358c57e4a74');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Con respecto al curso de Iriranni, Porta y Boudin, no me parecieron ni bien, ni mal. No responden mails, y para que los respondas tenes que insistir potente. Son medio secos, no te corrigen los trabajos prácticos, al menos nunca tuve una devolución. Despues meh, el curso no esta mal, no curse con ningun otro asi que no podria hacer otro comentario', '403ee8a6-5ed1-42ef-82c6-3358c57e4a74');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Muy desorganizada la clase, dificil de seguir. Un personaje pero no el mejor profesor.', 'a0ad72f2-323c-4707-b4ee-df53251f3389');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Un desastre. Lee los PowerPoints y re dormiste en clase pero es el único teórico en química básica y te lo tenés que bancar igual', 'a0ad72f2-323c-4707-b4ee-df53251f3389');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Pésimo profesor. La teorica es un desastre, lo unico que hace es leer el powerpoint (y ni siquiera completo, "esto ya lo saben" dice). ', 'a0ad72f2-323c-4707-b4ee-df53251f3389');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Realmente, de lo peor que conocí en Fiuba. Un tipo que su teorica (unica para todos los cursos en ese momento) solo se dedica a leer diapositivas, llenas de errores y donde unico comentario que hacia, era para sumar confusión al asunto. El era quien realizaba los examenes, siempre horribles, llenos de errores a arreglar en el durante; con muchas consignas rebuscadas que abusaba de poder decir que eran temas dados, porque aparecian en algun rincon diminuto de los pdfs deplorables. ', 'a0ad72f2-323c-4707-b4ee-df53251f3389');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Caracciolo es la manifestacion Fisica de todo lo que esta mal con nuestra facultad.El tipo llega a las clases siempre tarde,lee con mala gana los powerpoints y los comentarios que hace solo te confunden mas (No pierdan tiempo en las teoricas quedense en su casa).Ni hablar de los examenes que hace que para resumirlo en una palabra seria NEFASTOS,el dia que se jubile va a ser un gran dia para FIUBA
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No vino nunca a dar clases y cuando vino se quedó 30 minutos como mucho. ', 'a0ad72f2-323c-4707-b4ee-df53251f3389');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'si te encantan las diapositivas del año del culo en windows xp anotate aca', 'a0ad72f2-323c-4707-b4ee-df53251f3389');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2018', 'Un desastre que dirige la materia y nadie entiende como. No sabe nada de quimica, solo lee powerpoints. Saquenlo de la facultad ya, te arruina la materia ', 'a0ad72f2-323c-4707-b4ee-df53251f3389');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Hacia las prácticas, no se le entendía muy bien y se equivocaba un montón.', '28922ce4-2519-440e-aca3-b3b1c2dcd411');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy buena profesora, aunque se la noto con un par de inconvenientes al adaptarse a la cursada virtual problema que no afecto a la cursada ya que Claudia Vera, la otra profesora, la ayudaba con sus inconvenientes ', '28922ce4-2519-440e-aca3-b3b1c2dcd411');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No está mucho en la clase. Resuelve algunos problemas más que nada', '28922ce4-2519-440e-aca3-b3b1c2dcd411');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Explica algunos ejercicios de las guias, a veces como que da muchas vueltas, pero se le entiende bien', '28922ce4-2519-440e-aca3-b3b1c2dcd411');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Lucía siempre está presente en el meet pero para tomar asistencia, a veces resuelve ejercicios pero no se le entiende mucho.', '28922ce4-2519-440e-aca3-b3b1c2dcd411');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Las clases comienzan puntual, explica la teoría que ayudan a terminar de entender los videos que estan grabados de la catedra, super buena onda. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es muy buena con los alumnos, siempre hace chistes y buena onda, pero a mi personalmente no me gustaba su forma de dar las teoricas. Leia los pdf del campus y tiraba algunas acotaciones. No aportaba demasiado (era casi lo mismo ver las teoricas en tu casa). Solia llegar tarde, aunque estaba bien porque ella daba la teoria al final de la clase. Es buena corrigiendo los parciales.', 'f68524fd-b68e-481c-861f-a066f95f88bf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es una docente que sabe mucho de la materia pero siempre llega tarde. Hace clases de consulta virtuales e intenta dar clase con algunos chistes para que no te quedes dormido. Si no entrás a Ureña o Vera, no es una mala opción. Su JTP es Mariana Melaj que realmente la rompe ', 'f68524fd-b68e-481c-861f-a066f95f88bf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No recomiendo esta cátedra para nada, es una lástima porque los profesores son buenos, pero no se supieron adaptar a la modalidad híbrida. Teniendo la teórica virtual me parece un desperdicio de tiempo volver a repetirla presencial ya que no se agregaba mucho mas de lo que ya se había dicho, quedando muy poco tiempo para la práctica que me parece fundamental. Al parcial llegamos muy mal con los tiempos y creo que hubiera estado bueno que prepararan una clase de ejercicios de parcial que engloben varios temas antes del mismo. ', 'f68524fd-b68e-481c-861f-a066f95f88bf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Su curso deja mucho que decear, llega a sus clases casi siempre tarde debido a la lejania  de su hogar con el trabajo, sus clases es ella explicando un power point que no se alcanza a leer, muy pocas veces usa el pizarron, lo unico bueno es que tiene mucha templanza y tira buenos chistes en clases', 'f68524fd-b68e-481c-861f-a066f95f88bf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Habla muy bajito.', '4c3946cc-9839-4adf-83eb-72bf0d26e2b3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Idem que Caracciolo', '4c3946cc-9839-4adf-83eb-72bf0d26e2b3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Buen ayudante, explica lento y claro para que se entienda y fomenta a que le preguntemos para que no queden dudas', '76450bcb-84d8-48e4-9a4b-b0dbb7549007');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buenas sus practicas junto con el otro ayudante Andres Andronikov. Se nota que ambos quieren que aprobemos y le ponen todo de ellos para ayudar a los alumnos. Las practicas de este curso son muy buenas no asi las teoricas. Todo el tiempo ambos ayudantes buscan la participación de los alumnos y explican las veces que sea necesario el ejercicio que esten explicando.', '76450bcb-84d8-48e4-9a4b-b0dbb7549007');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es bueno como ayudante de cátedra. A veces tiraba chistes.', '76450bcb-84d8-48e4-9a4b-b0dbb7549007');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Esteban es una gran persona y explica de la mejor manera. Explica bien los problemas y siempre esta dispuesto a explicarlos las veces necesarias con tal que se entienda.', '76450bcb-84d8-48e4-9a4b-b0dbb7549007');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'GENIO!! Se re preocupa por el alumno, porque aprendas, porque no queden dudas, por hacer las clases entretenidas. Aparte de eso, siempre trata de dar alguna mano en los parciales cuando algo no sale. Capo capo.', '3e5e0dd8-ac91-4cf1-89a1-eb1732813975');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente profesor, siempre bien predispuesto. Explica muy bien! Y tiene un trato muy bueno con los alumnos. Responde las dudas q tengas, por muy pavotas que sean!', '3e5e0dd8-ac91-4cf1-89a1-eb1732813975');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'El material de estudio de la cátedra está unificado y deja bastante que desear. Hay clase un día a la semana. Las entregas de TPs de desarrollo no tienen enunciados claros.', '3e5e0dd8-ac91-4cf1-89a1-eb1732813975');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No es mal profesor, se nota que le gusta lo que hace y es un buen tipo, este no se si sera un problema del curso o de la materia en si, pero no explicaban nada de la teoria, esperaban que entiendas directamente de los videos que subian y algunos eran inentendibles. Pero mas alla de eso, Irianni explicaba los ejercicios relativamente bien y su buena relacion con Boudin hacian la clase muy llevadera.', '3e5e0dd8-ac91-4cf1-89a1-eb1732813975');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Buen profesor. Si bien en este curso Cristina Vazquez es la encargada de la parte teorica y los ayudantes de la parte practica, El aporta muy buenos comentarios y hace ejercicios en la parte practica cada tanto que estan muy bien explicados, A diferencia de los ayudantes el los lleva hechos en una hoja y los proyecta mientras que los ayudantes usan plataformas como PAINT para hacer el ejercicio juntos. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Súper cálido, me impresionó como sabía TODO y posta podés preguntar cualquier cosa y te responde sin drama', '3e5e0dd8-ac91-4cf1-89a1-eb1732813975');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Jorge es de los mejores profesores de FIUBA que conocí. Solo palabras de agradecimiento. Explica muy bien, se preocuba por nosotros y hasta se sabía nuestros apellidos. Junto con Juan Makovec hicieron una dupla genial. Si pueden, anótense con él.', '3e5e0dd8-ac91-4cf1-89a1-eb1732813975');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'El mejor profesor de esta catedra, se queda haciendo consultas y se acuerda de cada alumno particular y su situacion con la materia. El me salvo la materia asi que lo super recomiendo', '3e5e0dd8-ac91-4cf1-89a1-eb1732813975');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2018', 'Probablemente el mejor profesor de la materia, y también uno de los mejores de la facultad entera. Siempre está atento con sus alumnos, los recuerda particularmente y siempre resuelve dudas, por más bobas que suenen. Muy recomendado.', '3e5e0dd8-ac91-4cf1-89a1-eb1732813975');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es un buen tipo, se nota que sabe muchísimo de la materia.', '3e5e0dd8-ac91-4cf1-89a1-eb1732813975');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Jorge la verdad me parece una gran persona y con mucha voluntad de ayudar y explicarle a los alumnos. Siempre esta abierto a dudas y consultas sobre la materia y responde de la mejor manera. Mantiene un buen trato con los alumnos y en general y se mandas un mail responde. Lo que pasa es que Jorge sabe muchísimo y sobre explica las cosas, le podes hacer una pregunta y puede estar 10 minutos hablando sobre la misma y se va por las ramas, lo que a veces no vuelve muy clara la explicación. Cuando muestra problemas también lo hace en formato de foto y los explica muy rápido, ademas de que la foto no queda subida al campus. ', '3e5e0dd8-ac91-4cf1-89a1-eb1732813975');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Con respecto al curso de Iriranni, Porta y Boudin, no me parecieron ni bien, ni mal. No responden mails, y para que los respondas tenes que insistir potente. Son medio secos, no te corrigen los trabajos prácticos, al menos nunca tuve una devolución. Despues meh, el curso no esta mal, no curse con ningun otro asi que no podria hacer otro comentario', '3e5e0dd8-ac91-4cf1-89a1-eb1732813975');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'El y el otro ayudante (Max en este cuatri) son los que respondian en el campus, todos los dias, muy buena explicación y predisposición por parte de ellos dos', 'ca67cf5b-6f4f-44ab-b145-7ab2207c8b50');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Tomás tambien es de la parte práctica y resolvía algunos ejercicios.', 'ca67cf5b-6f4f-44ab-b145-7ab2207c8b50');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica rápido pero bien', 'ca67cf5b-6f4f-44ab-b145-7ab2207c8b50');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Una capa. Aunque si no te gusta la informalidad en un aula no la recomiendo. Si lo único que te importa es aprender, es la mejor elección.', '06c181a0-a18a-4f92-a93c-10a40431555e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Lo mejor que me pudo pasar en el cuatri, cursando de manera virtual, por lo menos de este curso es la que más se preocupó por armar clases virtuales, armaba un monton de powerpoints explicando ejercicios, explica clarisimo, super simple, resolutiva y con la mejor onda y humor que me crucé en Fiuba en este tiempo. Una genia, sin hablar ni siquiera de el hecho de que, yo por ejemplo tenía asignado a Leguiza, que nunca apareció y ella se hizo cargo de nosotros.', '06c181a0-a18a-4f92-a93c-10a40431555e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy piola y graciosa, siempre respondía dudas y estaba predispuesta, la que mas sufría el maltrato de boeykens', '06c181a0-a18a-4f92-a93c-10a40431555e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Una genia, sus explicaciones son súper dinámicas y siempre te contesta bien, además se puso al hombro el curso de Boeykens. Lástima que esté con Susana (que la trata muy mal), si estuviera en otro curso la súper recomendaría porque ella lo vale.', '06c181a0-a18a-4f92-a93c-10a40431555e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Actitud amargada, no explica 2 veces, se enoja si le preguntas algo, y si no le preguntas también, arrancan la catedra explicando temas aludiendo a que temas avanzados que CBC no dió, vos ya lo sabés.', 'c24ac308-f5af-4102-806f-f18834a2cf10');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Realmente el peor profesor que me toco hasta ahora, super mala onda. Te hace sentir un bolud todo el tiempo, se cree superioir a todos y la verdad que constante maltrato en su forma de explicar y de hablar con c/u de los alumnos', 'c24ac308-f5af-4102-806f-f18834a2cf10');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Buena onda', 'c24ac308-f5af-4102-806f-f18834a2cf10');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buena profesora y siempre con buena predisposición.', 'd894d806-e865-41cb-b24c-772fc87468c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Hago un comentario acerca del curso en general.  Durante la cursada virtual la materia se manejo dando teoricas por videos de youtube y te daban los pdf's de donde leian, este curso en particular mantuvo semanalmente un encuentro por google meet de 1 hora y media a 2 horas en la cual se haria la "practica" de la materia (pero no tenian problemas en dar lineamientos teoricos) el cual era grabado y subido a una carpeta de drive disponible en el campus. Piden una tarea por semana, que bien puede ser los tp's que se dan para todos los cursos. No te van a hacer recursar si no entregaste una tarea, pero si es obligatorio tener todos los tp's aprobados. Todos los docentes del curso estan muy comprometidos en dar lo mejor, lo cual se nota porque estan siempre que pueden al servicio del alumno contestando dudas. Sus explicaciones son claras y se adaptaron muy bien a la virtualidad.', 'd894d806-e865-41cb-b24c-772fc87468c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No dio muchas clases es la jefa de la catedra y tiene que estar pero para supervisar. Responde preguntas durante la clase practica y en el campus. ', 'd894d806-e865-41cb-b24c-772fc87468c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy buena ', 'd894d806-e865-41cb-b24c-772fc87468c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Tiene mucha paciencia y explica con tranquilidad. Acepta todas las preguntas y participación en clase. Buena profesora.', 'd894d806-e865-41cb-b24c-772fc87468c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica los tp para realizar que son obligatorios además no es muuuyy exigente cuando los corrige. responde todas la preguntas por campus o por privado siempre ', 'd894d806-e865-41cb-b24c-772fc87468c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Mariana lejos la que carreo el curso. Siempre llegaba temprano, explicaba bien los tp. Bastante buena corrigiendolos. Se quedaba las 4 horas de la clase, contestaba dudas de cualquier tema. Cuando explicaba y se daba cuenta que la clase era medio aburrida tiraba un chiste para discolocar un poco. Ayudaba a los de la practica cuando se trababan en un ejercicio.', 'd894d806-e865-41cb-b24c-772fc87468c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Da las clases teóricas, repaso de las virtuales del campus, siempre responde dudas en clase y muy cordial.', 'd894d806-e865-41cb-b24c-772fc87468c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Bastante mala onda', 'b07f2aa6-f20a-409d-8402-42a1f354d327');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Malvada y te hace enviar correcciones de una hora para la otra. es soberbia, se hace la que sabe todo, y no es que no sepa es la actitud. Una semana despues de terminar la cursada se puso a corregir tps de chicos de hace meses y no les dejaba aprobarlos. les hacia mandarles 500 correcciones sin sentido. y a veccecs ni siquiera les habilitaba las entregas. si te toca cursar con ella, quejate. Si te quedas callado te pasa por arriba pero si te haces respetar, no te va a hacer eso. A mi no me pasó porque de principio no me dejé que me hagan eso, pero a otros compañeros más permisivos, los hizo bolsa. Fomenta la participacion en clase para hacerse ver.', 'b07f2aa6-f20a-409d-8402-42a1f354d327');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Responde de mala gana, no corrige de forma clara, si no entregas te pone un 0 y después tenés que entregar el primer informe a fin de cuatri porque cuando empezaste no sabías cómo era el formato de los tps. Mucho cuidado con entregar después de tiempo si te corrige ella porque no te lo vuelve a corregir por 4 meses...', 'b07f2aa6-f20a-409d-8402-42a1f354d327');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'La practica esta bastante bien. Resuelven ejercicios de la guia, además de poner tareas en en campus que te permiten llevar la cursada al dia. ', 'b07f2aa6-f20a-409d-8402-42a1f354d327');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'No aporta mucho a la clases', '70b40768-c032-4a6a-b63e-c75ebc36e9f1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Natalia es dinámica y buena onda. Pero muchas veces su manera de explicar es como si ya estuviera cansada de dar siempre lo mismo y explica, la gran mayoria de las cosas, a las apuradas, como dandolas por sabidas', '863e4709-e05f-4657-9dba-ca82975bf133');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buena profesora, puede explicar un poco rapido, pero sabe mucho y ademas sube al campus ejercicios resueltos explicados distintos a los que ya estan en el campus general', '863e4709-e05f-4657-9dba-ca82975bf133');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Personalmente no me caía nada bien. Está toda la clase haciéndose la graciosa (no es). Muy pesada con las demostraciones de formulas y con la entrega de trabajos practicos (1 o 2 por semana). Los ejercicios prácticos los explica bien.', '863e4709-e05f-4657-9dba-ca82975bf133');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es muy insoportable con los trabajos y corrigiendo los examenes te busca hasta lo mas minimo para no aprobarte.', '863e4709-e05f-4657-9dba-ca82975bf133');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es muy rompebolas con los Tps, y se pone a buscar hormigas en los parciales para no aprobarte. Fuera de eso, deja algunos ejercicios resueltos en el campus, explica bien( solo bien) y bastante rapidos los ejercicos en la practica, como si estuviera apurada todo el tiempo. No la recomiendo, mas que nada por la relacion (exigencia/calidad de enseñanza). Repito es muuuuy rompehuevos con los Tps. Saludos', '863e4709-e05f-4657-9dba-ca82975bf133');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica muy bien, todo lo que dice es todo lo q tenes q poner en el parcial para aprobar. Va rápido pero se le entiende, sus power son organizados y siempre hace clase de consulta antes del parcial. Eso si es exigente con los trabajos prácticos pero en mi opinión se nota que sabe bastante, con solo decir que venia muy bajo en quimica del cbc y con ella aprobé el final de quimica con nota alta. ', '863e4709-e05f-4657-9dba-ca82975bf133');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Jonás aparece en la parte de explicación de los ejercicios, no me gustó mucho como explicaba, pero siempre responde muy bien a consultas ', '90983e70-d31a-4aed-9f6e-f0f9ea675130');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No es el mejor explicando, se nota que intenta, pero a veces confunde más de lo que explica. Da algunos ejercicios de las práctica, sobrevivis igual. ', '90983e70-d31a-4aed-9f6e-f0f9ea675130');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'lo vi 2 o 3 veces marearse en un ejercicio y no poder terminarlo. Es muy buen tipo y responde todas las dudas.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'buen profe, algunas veces senti que fue un poco rápido con algunos ejercicios que explico pero en el general bien', '90983e70-d31a-4aed-9f6e-f0f9ea675130');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buen profesor', '2c0335c1-0a97-407a-b18a-bf859df0d546');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'El material de estudio de la cátedra está unificado y deja bastante que desear. Hay clase un día a la semana. Las entregas de TPs de desarrollo no tienen enunciados claros.', '2c0335c1-0a97-407a-b18a-bf859df0d546');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Cada vez que este tipo aparecia me tenia que ir de la clase xq sino me quedaba dormido, habla muy lento y no explica del todo bien,x suerte el no esta en todas las clases y ni siquiera se queda durante toda la clase, pero cuando aparece si o si tiene que hablar el xq Irianni y Boudin lo idolatran', '2c0335c1-0a97-407a-b18a-bf859df0d546');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Las clases teóricas son MUUUUUY aburridas y monótonas, únicamente lee el pdf. A veces es mejor ver el video que te dan y nada mas. Tira algunos datos de aplicación de los temas en la vida que están buenos', '2c0335c1-0a97-407a-b18a-bf859df0d546');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Dá la teórica, y es un genio. Siempre hacía chistes, y también responde y explica mil veces si lo necesitas. ', '2c0335c1-0a97-407a-b18a-bf859df0d546');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es el profesor de la teorica. Respecto al ritmo de las clases va rapido, dedica una clase virtual a la explicacion de la teorica de la semana y usa el otro dia (presencial) para pulir cosas faltantes o bien para explicar el tema de la semana por si se atraso con los temas. Literalmente puede acabar su explicacion del tema en media clase o menos, con lo cual queda tiempo para realizar ejercicios en el pizarron con los profesores de la practica. En cuanto a organización de la materia los temas y TPs se retrasaron, al punto de que la catedra tuvo dos TPs en toda la cursada. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Con respecto al curso de Iriranni, Porta y Boudin, no me parecieron ni bien, ni mal. No responden mails, y para que los respondas tenes que insistir potente. Son medio secos, no te corrigen los trabajos prácticos, al menos nunca tuve una devolución. Despues meh, el curso no esta mal, no curse con ningun otro asi que no podria hacer otro comentario', '2c0335c1-0a97-407a-b18a-bf859df0d546');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Sus clases son de las mas aburridas que hay en la facultad, y eso que la materia no es tan densa, las explica con mucha paja. Se nota que sabe del tema, pero lo transmite sin energía casi. En resumen, te dormís en su clase.', '2c0335c1-0a97-407a-b18a-bf859df0d546');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'dio una clase y pico, explica medio aburrido. no puedo concluir demasiado.', '5d65d737-f3b8-4609-b9e8-5bad4bdcfc6f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Letra y ejercicios claros ', '5d65d737-f3b8-4609-b9e8-5bad4bdcfc6f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'La practica esta bastante bien. Resuelven ejercicios de la guia, además de poner tareas en en campus que te permiten llevar la cursada al dia. ', '5d65d737-f3b8-4609-b9e8-5bad4bdcfc6f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Max y el otro ayudante, Eliseo, muy buenos para explicar ejercicios y si no están presentes para explicar en meet, responden enseguida por el grupo de whatsapp.', 'e93afaf9-b55c-42e0-b03e-53938d5e65ad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Adriana me parece muy buena profesora, a veces no te deja en claro algunas cosas, pero si le preguntas, ella busca ejemplos para ayudarte. En si la cátedra en su conjunto es muy buena, siempre bien predispuestos', 'febbf45b-f4ff-4fc8-b269-9a6e0a8d0a40');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Da las teóricas con Ureña, también es buena explicando, aunque a veces se va por las ramas, y no es muy claro qué de lo que esta explicando es parte del contenido de la asignatura y qué no. Te explica las veces que sea necesario y es organizada. ', 'febbf45b-f4ff-4fc8-b269-9a6e0a8d0a40');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'La tuve en la primer parte de la materia porque despues no pudo asistir. Es buena onda y explica bien. No escribe mucho en el pizarron, directamente de los powerpoints por eso es recomendable llevarlos y hacer anotaciones ahi mismo. Sino es dificil anotar lo de los power y lo que dice ella!', 'febbf45b-f4ff-4fc8-b269-9a6e0a8d0a40');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 're buena onda, explica bien, gran jefa de tps.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy buena docente. Quiere que aprendas.', 'febbf45b-f4ff-4fc8-b269-9a6e0a8d0a40');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'para algunos temas explico teoría y para otros dio ejercicios, explicaba muy bien y casi siempre se tiraba alguna anécdota relacionada con el tema del que estaba hablando, me cayo re bien', 'febbf45b-f4ff-4fc8-b269-9a6e0a8d0a40');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica muy bien, tiene la parte relajada que le falta a Ureña jajaja, en general explica los primeros temas de la materia y alguno de los últimos.', 'febbf45b-f4ff-4fc8-b269-9a6e0a8d0a40');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Era muy buena pero casi nunca aportaba nada, tenia un bebe que realmente molestaba cuando explicaba ejercicios.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es muy buena, explica claro y resume bien lo clave de los ejercicios, hasta me contestó sin problemas una duda aparte para un final por mail. Lo mismo que con Lunati, también se banca el maltrato de Boeykens, ojalá se pueda cambiar a otro curso.', 'fea42942-d8cd-43c6-ac63-3b0fdca34f2f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Gigi y andrea se pasaban los primeros quince minutos de cada clase hablando del respeto y de que prendamos la camara etc, para los que ya lo hacíamos era un desperdicio de tiempo. ', '76721879-db56-4248-9cd8-1125b6c022c4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Gran profesora con grandes ayudantes, te perdonaba todo, si no llegabas con las autoevaluaciones las volvia a habilitar o si faltabas mas de lo necesario te pedia 5 decimas mas en el examen y te lo perdonaba.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Cumple horarios, asiste a clase y trata bien. Te llena de tps, hacés como dos por semana, muy dificil aprobar la cursada ya que no t aprueba el tp hasta que esté todo perfecto entonces los tenés que volver a hacer infinitas veces. Muchos son excesivos e innecesarios. No recomiendo esta cátedra. ', 'eb75046a-76d3-4c4a-874b-32678ea57cf1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Se encarga de dar algunos temas y es el encargado de responderte en el campus. La explicación en las clases es media media, sabe pero no es muy bueno explicando. Sin embargo en el campus responde siempre y muy rápido, ahí las respuestas son muy completas y claras.', 'f1c98a66-ea78-465e-b596-c58eee9522db');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'Es una genia, le pone lo mejor en una materia que a los informáticos/electrónicos poco les interesa, pero te la hace llevadera', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'Muy buena profesora y además muy buena persona. Explica con diapositivas lo cual hace que las clases sean un poco aburridas pero sirven mucho para estudiar en tu casa ya que están muy bien hechas. Te da muchas chances de aprobar el parcial y se preocupan en que sus alumnos aprendan y aprueben la materia. Es justa en las correcciones. Toma parcialitos de los TP(fáciles) lo cual es un poco molesto pero nada mas que eso.', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buena docente. Sus clases no son para nada aburridas. La practica no es de lo mejor pero si haces consultas te las responden lo mas bien. Los Tps son faciles y se hacen en el laboratorio (obligatorio). La clase suele empezar media hora tarde y termina media hora despues. Puede ser que diga de empezar la clase una hora antes si ve que no llega con los temas. El parcial es facil, se recupera por tema. Los finales son faciles y como los parciales suelen repetirse el formato todos los cuatriestres.', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', '(En cursada virtual) Excelente cátedra, este cuatrimestre que fue virtual hicieron lo mejor para que sea más llevadera la cursada. Ureña explica excelente y los ayudantes complementan la clase. Dan clases en los horarios, responden consultas en la clase y por e-mail. Mandan TPs, aunque son más para que lleves la cursada al día, no son nada de otro mundo estos TPs. Si lo que buscás es aprender de verdad, esta es muy buena cátedra. ', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Ureña es la mejor por lejos: todo lo que explica se nota que realmente te lo quiere hacer entender, los parciales son accesibles (por lo menos en la cursada virtual ella o alguno de sus ayudantes los hacía). Además los apuntes que hace ella del campus están mucho más completos que los de las cátedra (cosa no menor). Anótate con ella te diría 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explicaciones muy claras. La cursada está muy bien organizada, a veces se extienden sus clases porque hay mucho contenido para dar. Se adaptó muy bien a la virtualidad, ha hecho experimentos en su casa para mostrarnos cosas más visualmente, muy útiles. No dio todas las teóricas ella, pero las que da son las mejores. Evalúan con ejercicios del estilo de las guías que nos dan en el campus. ', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'que mujer del bien claudia. no vayas a otra, está es tu primera opción siempre. no te vas a arrepentir', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica excelente, ella y sus ayudantes. La practica tambien es muy buena. Se siguen los temas al dia. Ureña suele participar en hacer los parciales y finales: La recomiendo absolutamente. Aprobable y se aprende. ', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Medio exigente pero muy buena. También está con Pablo y Adriana que explican muy bien. Lo único malo es que te mandan a ver videos antes de cada clase y dan la teórica medio rápida suponiendo que viste todo, cuando los videos pueden ser de hasta 1 hora cada uno. Después de eso muy bueno porque haces ejercicios de parciales. Recomendada', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Buena docente. Se preocupa por el aprendizaje de sus alumnos ', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Es una genia Ureña, muy buena onda y buenisima explicando. La catedra tiene powerpoint que se utilizan en clase para poder ir siguiendola. A vece se extiende unos 10 minutos la clase.', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'La mejor profesora de química. explica claro, es buena onda, hace parciales y finales que si estudiaste e hiciste las guías aprobar si o si.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Tiene muchas ganas de que aprendas, es apasionada por la materia. Es exigente, pero es la mejor profesora que tuve.', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'lejos la mejor. Explicaba la teoría SUPER clara, se nota que sabe un montón y que le apasiona la materia. Usaba power points y un pizarrón para explicar, muy copada y alta profe', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Una genia. Sabe un monton de quimica y explica muy bien. No se ausento a ninguna clase. Siempre llega muy puntual. Se esfuerza en que haya participacion en la clase.', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es muy buena', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Ureña no da clase, solo graba el contenido teórico que es asincrónico. ', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es excelente explicando y lo hace en general desde la mirada de la ingeniería. Realiza ejemplos en clase y es muy responsable. El problema principal son los tiempos que te da para hacer las cosas y la cantidad de contenido, pero entiendo que eso tampoco es completamente incumbencia de ella.', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Explica bien todos los temas que da, pero tiene criterios de aprobación demasiado exigentes y un poco tomado de los pelos, aunque eso probablemente no dependa del todo de ella. No se confíen que porque explique muy bien y hagan absolutamente TODOS los TP virtuales, aprueben los TP presenciales y hagan las guías estén en condiciones de aprobar el parcial, si no se ajustan al criterio de aprobación del parcial no lo van a aprobar. Denle mucha importancia a todo, pero más al parcial. En todo caso no se frustren si la tienen que llegar a recursar, porque la materia, como ahora está unificada, es más larga y los tiempos más cortos. ', '35fc6a9d-193c-41aa-bb32-a674fc71b798');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Dio clases virtuales con powerpoints elaborados y claros (que encima luego nos mandaba y nos quedaba como material de estudio)todas las semanas ayudando a la particiapacion en clase y cuando no estabamos en clase respondia dudas por whatsapp, una gran profesora', 'c559a656-2a7d-4c94-a36c-ebd5e319528d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Una genia. Siempre predispuesta a ayudar y que se entienda todo', 'c559a656-2a7d-4c94-a36c-ebd5e319528d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Es una genia. Prepara muy buenos Powerpoints, da clases en su respectivo horario. Muy clara, explica muy bien con ejercicios de la guia, responde siempre las dudas, hace clases de repaso para finales, y parciales. Ayuda en los tps para que no se hagan pesados. Muy recomendable', 'c559a656-2a7d-4c94-a36c-ebd5e319528d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'EXCELENTE. HERMOSA. SOLO ADJETIVOS BUENOS. Es una persona que verdaderamente tiene ganas de laburar. Siempre atenta a todo. ', 'c559a656-2a7d-4c94-a36c-ebd5e319528d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'CURSEN CON ELLA. Super paciente, bien predispuesta, da mil clases de apoyo, te re ayuda, te explica un monton si no entendes, graba todo y se entiende perfecto. Más que recomendada!!!', 'c559a656-2a7d-4c94-a36c-ebd5e319528d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Una de las mejores docentes que tuve, muy recomendada.', 'c559a656-2a7d-4c94-a36c-ebd5e319528d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Claudia es la profesora más atenta que hay. Explica excelente y no tiene problema en repetir explicación, graba las clases y manda los pdf que usa por mail a los alumnos. Arma grupo de whatsapp con sus alumnos para responder dudas y siempre responde alguien, tampoco tiene problema en dar alguna clase extra pre parcial para repasar o manda ejercicios integradores para que uno pueda practicar. Excelente docente.', 'c559a656-2a7d-4c94-a36c-ebd5e319528d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Una genia. Sabe realmente un montón y todos los pdf que ha elaborado para las clases y que luego comparten sirven un montón. Si uno lleva la materia al día es posible aprobarla tranquilamente con ella.', 'c559a656-2a7d-4c94-a36c-ebd5e319528d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Nico es un genio. Pero habla muuuuy bajito y el laboratorio es muy grande jajaja. Si tenés dudas te las saca y le gusta hacer preguntas en el medio de la explicación. ', '2084b5d3-e28e-464c-a0dc-d7b0afb10ea9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Tiene súper buena intención pero es muy desorganizado y aburrido al explicar.', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'A veces Juan se demora mucho en explicar un par de cuestiones que pueden ser explicadas rápidamente y se embola mucho. Es un gran profesor que siempre esta para contestar dudas y tiene la mejor de las intenciones.', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No tengo opinión formada', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Clases mal dadas, sumamente monótono y mediocres explicaciones. Se notaba que iba mucho menos gente que a la clases prácticas por su sóla presencia.', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es el profesor más buena gente que existe en la cátedra pero también al que más le cuesta explicar. No se si la culpa la tiene la virtualidad, pero sus clases las sufrí un montón. Muy lentas, monótonas e incluso poco claras. ', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Avanza demasiado lento con los temas, responde las dudas sin problemas pero se extiende demasiado al hacerlo y es fácil perderte en su explicación. Parece tener buena intención de explicar pero en ocasiones resulta difícil seguirlo.', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Tiene buenas intenciones pero como estudiante se necesita más que la predisposicion para poder entender. Los temas que le tocaron a él no me quedaron para nada claros y tuvimos que reveer gran parte de lo que le tocaba dar. No sabía jerarquizar las partes de los temas y le dedicaba demasiado tiempo a conceptos irrelevantes para esta materia, ademas iba exageradamente lento. Su forma de hablar es monótona y sus power points, que usa para explicar, son muy desorganizados. Siempre nos trató de forma super cordial y respondió todas las dudas que teníamos. No respetó el horario de finalizacion de las clases.', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Buenas clases, lo que pasaba es que muchas veces se iba por las ramas y se extendía hasta una hora más del horario establecido. Pero es muy buen profe, amable y atento si tenés alguna consulta.', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Entró recientemente a la materia y parece que todavía se está acomodando. Sus clases se hacen tediosas y parece que no avanzas, por lo que mucha gente no asiste y prefiere ver y resumir sus PDFs en casa. Aun así es buena gente y hasta organiza clases de consulta de ser necesarias.', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica muy denso, literal que te dormís. ', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Da clases un poco lentas pero no es mal profesor, se entiende lo que explica pero se puede detener mucho en cosas que no son tan importantes, y si le hacen una pregunta no tan relacionada con el tema, puede estar 10 minutos contestando en vez de seguir con lo más importante. Igualmente sabe mucho.', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se nota que sabe un montón pero sus clases son muy monotonas. Da muchas vueltas para cosas simples', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se entiende lo que explica y es buena persona... pero sus clases son ABURRIDÍSIMAS y bastante inútiles, en la hora y media de clase no te daba ni 3 diapositivas', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Juan es buen docente. Se nota que sabe un montón pero sus clases de hacen un poco tediosas porque explica muy lento. Es muy predispuesto para responder preguntas y ayudar con los tps.', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Los pdf son un plomo pero aun así siempre esta dispuesto a responder dudas en clase. No siempre llega a dar todo pero lo que da lo da bien. Recomiendo ir con los pdf leídos a su clase', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un gran tipo, quizá las clases te pueden llegar a parecer lentas pero explica con claridad. No te aproveches de su bondad, prestentele bastante atención y se entiende todo. Responde a cualquier duda, muy respetuoso y atento.', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 're aburrido y denso explicando', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Super bueno, hasta hizo clases de consultas para todos los temas que dio. Lamentablemente tarda mucho para explicar y algunas clases se extendieron hasta una hora más de lo normal.', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bien, pero quizás un poco lento y repetitivo, si te concentras y enfocas en seguirlo, entendes y podes tomar apuntes super bien, además graba sus clases y las sube, así que después se pueden ver de nuevo adelantándolas, sus powers para explicar son larguísimos pero super completos, si es necesario y llego muy justo de tiempo de explicación agrega un día de consulta al final de la semana para el que quiere descargar dudas con él', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Buen profesor, se suele pasar MUCHISIMO en los horarios (las clases en vez de durar hora y media duraban dos horas y media). Lo bueno es que graba todo y lo podes ver en diferido con velocidad x2. Explica con tanto detalle que las clases se hacen pesadas pero si tenes de habilidad de prestarle atencion entendes muy bien los temas', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Le pone mucha garra para explicar la teoría pero no sirve. es muy enredado y 0 lineal con lo que está explicando. hace muy larga la explicación que te terminas perdiendo y abandonando la clase. ', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Se nota que sabe de los temas, pero es extremadamente lento explicando y las clases PDF´s que utiliza para explicar son muy enrevesados', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es buen profe, se nota que sabe pero es muy monótono explicando', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Buen profesor. Sus clases se hacen medias lentas, por lo menos virtualmente', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica muy lento y a veces llega a aburrir sus clases. Sin embargo sabe bastante.', 'bf22bcfd-33a0-48cf-84fa-5c9b4d25f16e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'A veces cuesta seguirlo pero siempre responde preguntas por mas tontas que sean. Además si tenes alguna duda con la carrera se presta a conversar y aclarártela.', '84d053b5-b8fb-4235-a2ce-67a215eeeaca');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Ariel es muy buen docente. Sabe una BANDA sobre la materia. Mientras resuelve ejercicios ya sea él u otros docentes, siempre hace preguntas más complicadas y engañosas para hacernos pensar y te prepara para el parcial. Además durante toda la cursada te da tips  sobre cómo resolver ejercicios y cómo razonarlos. ', '84d053b5-b8fb-4235-a2ce-67a215eeeaca');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy bueno. Hace preguntas para que pienses y puedas razonar bien los problemas después si aparece algo diferente en el parcial', '84d053b5-b8fb-4235-a2ce-67a215eeeaca');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Los cursos prácticos de Sandra son los más exigentes con los parcialitos pero te dejan bien preparado para los parciales', 'bbb851c6-bc96-4f7b-a9ec-f50901f40433');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Excelente profesora, siempre dispuesta a resolver cualquier inquietud. Muy responsable.', 'bbb851c6-bc96-4f7b-a9ec-f50901f40433');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'muy buena onda y explica muy bien, hace buenas correcciones y los formularios que hay que completar despues de cada tema ayudan mucho para el final', 'bbb851c6-bc96-4f7b-a9ec-f50901f40433');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Genia Sandra. Explica claro y se preocupa para que apruebes y entiendas la materia. Las clases terminan generalmente dos horas antes porque va rápido pero no por eso da menos contenido. Recomendadisimo el curso 4', 'bbb851c6-bc96-4f7b-a9ec-f50901f40433');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica bien, la hace corta y te vas antes (convenientemente por la cantidad de trafico en la calle) pero sabiendo lo mismo que los otros cursos, encima es genuinamente graciosa, algo casi imposible de lograr para un profesor.  ', 'bbb851c6-bc96-4f7b-a9ec-f50901f40433');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Sandra es buena docente. Sabe mucho y le gusta que entiendas los temas en serio, no sólo que los repitas de memoria. Es sarcástica y hace chistes en las clases, por lo que la clase es más dinámica. Es bastante exigente y no muy flexible.', 'bbb851c6-bc96-4f7b-a9ec-f50901f40433');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Una crack Sandra, explica con claridad y fomenta la participación en clase. Es un curso exigente pero muy bueno. Un gran curso, con una gran dinámica entre las profes. Los parcialitos son duros porque te exigen estar muy al día con la materia pero si le ponés ganas y estudio es totalmente aprobable la materia. Las profes fomentan la participación y están disponibles para cualquier duda. Curso recomendado.', 'bbb851c6-bc96-4f7b-a9ec-f50901f40433');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bien, se nota que sabe, sus clases son llevaderas con Gisela y Cecilia hacen chistes y comentarios así no te dormís, corrige muy rápido y eso está muy bueno, le fastidia MUCHO que no se conecten a la clase o no contesten si pregunta algo, pero porque quiere que entendamos todo bien, no graba las clases porque quiere que vayamos y las escuchemos en el momento pero sube todos los archivos con los que explican en la clase la resolución de los problemas por si no entendiste algo.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buena profesora. Explica muy bien y es muy copada', 'bbb851c6-bc96-4f7b-a9ec-f50901f40433');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Sandra le pone toda la pila a la clase para que sea llevadera. Me daba las energías necesarias para levantarme a la mañana a cursar
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Una genia, explica muy bien y es muy buena gente. Siempre responde un montón de dudas y te hace sentir muy cómodo en la clase. ', 'c1217baa-2406-4d0b-b9c9-8343b53967b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica muy bien, responde las dudas sin problema y siempre está atenta frente a los mensajes por mail o foros, contestando rápidamente y brindándonos ayuda. ', 'c1217baa-2406-4d0b-b9c9-8343b53967b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'ES UN AMOR, re buena onda siempre, te tranquiliza y te da tips de cosas que no te podes olvidar para los parciales. Explica bien y siempre se pone en tu lugar diciendo como hace ella para acordarse de las cosas y cómo justificar correctamente', 'c1217baa-2406-4d0b-b9c9-8343b53967b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un amor total, un placer cursar con ella. Es muy buena la práctica y ella como persona.', 'c1217baa-2406-4d0b-b9c9-8343b53967b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Una genia total, recomendadisimo ir a cualquier curso en el que esté ella. Es muy buena persona y establece una buena relación con los alumnos, siempre que tenés una duda y vas a pedirle ayuda al departamento te contesta lo que necesitas de forma muy clara. Cuando da las teóricas prácticas te queda todo claro y te da muy buenos tips y es clara con lo que hay que tener en cuenta para cada tema. De nuevo, una genia.', 'c1217baa-2406-4d0b-b9c9-8343b53967b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La mejor profesora que tuve en este cuatrimestre (ganándole incluso a Fontana de física y Maulhardt de análisis). Te explica excelentemente cómo resolver un ejercicio de la manera más sencilla posible, dando muy buenos tips. No tiene el más mínimo problema que le hagas cuántas preguntas necesites, incluso si son de un tema anterior. No hay manera que no entiendas la química con ella, y realmente te transmite y contagia su gusto por la química. Alienta mucho a los alumnos a que no se desanimen con los bochazos. No encuentro una sola crítica para hacerle...', 'c1217baa-2406-4d0b-b9c9-8343b53967b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Ana es una excelente docente. Sabe un montón, explica increíble y transmite mucha tranquilidad. A parte tira un montón de tips para los parciales y resolución de ejercicios. De todos los docentes, es la que mejor trato tiene y es muy dulce.', 'c1217baa-2406-4d0b-b9c9-8343b53967b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Ana es lo mas. Sabe un montón y los tips que te da para los ejercicios son clave. Es super dedicada e hiper paciente, tiene una manera de dar los temas increíble. Es notable la vocación docente que tiene. Ella es una de las responsables de que el turno 1 sea el mejor :)', 'c1217baa-2406-4d0b-b9c9-8343b53967b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es super clara para explicar y siempre se procupa por recordarte esos temas claves antes del parcial.', 'c1217baa-2406-4d0b-b9c9-8343b53967b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es lo mas bueno que hay y es re clara explicando los ejercicios', 'c1217baa-2406-4d0b-b9c9-8343b53967b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Los ejercicios explicados por ella son los que mas entendi, muy buena profe', 'c1217baa-2406-4d0b-b9c9-8343b53967b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Ella es una excelente docente! Ana es como la mamá del curso 1. problema que tengas problema que se lo podes plantear y ella te lo responde enseguida. explica con mucha claridad y no tiene problema en ir y volver sobre algo si es que no entendiste el procedimiento. ', 'c1217baa-2406-4d0b-b9c9-8343b53967b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Ana es una excelente profe! Los Ana tips que tira de determinados temas son lo más, te ayudan mucho a no bloquearte ante ejercicios difíciles, etc. Una de las mejores profes que he tenido! Es clarísima explicando y además siempre está dispuesta a despejar dudas y es muuuy buena onda. Los ejercicios que explicaba eran clave, después de ahí se me despejaban muchas dudas. ', 'c1217baa-2406-4d0b-b9c9-8343b53967b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica muy bien y claro. No tiene problema en responder dudas. Una genia', 'c1217baa-2406-4d0b-b9c9-8343b53967b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'Norita es una buena docente, explica de forma organizada los temas y llega con tiempo a los examenes. Responde la consultas que tengan los alumnos y si es alguna general lo aclara en la clase.', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Ella da la teórica. Es buena profesora y siempre se preocupa por que las cosas se entiendan y no aprendamos a resolver mecánicamente. Termo hace dos cuatris que viene explicándolo más o menos, estudienlo del Atkins. Cuidado en como se dirigen a ella, es buena onda pero si no le gusta tu trato te va a mandar (muy sutilmente) a la mierda, así que ojo.', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Buena profesora', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'A pesar de ser la única opción para las teóricas de Química I, sus clases teóricas son excelentes. Orienta la materia a una perspectiva analítica, lo que facilita muchísimo la comprensión de la asignatura.', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Nora es muy buena docente y muy clara explicando.', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Genia Nora, si tan solo todos los profes que enseñan teoría fueran asi...', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No tengo opinión formada', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Nora es una genia explicando, se nota que la tiene muy clara. Los temas que da ella son los más importantes y los que más hay que estudiar para los parciales, porque en general los hace difíciles. ', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica bien, responde las dudas sin problema. Sus clases teóricas son muy buenas, pero  los parciales que arma son rebuscados. ', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Nora es una excelente docente que se preocupa por la comprension de los alumnos. Me parecieron muy buenas y claras sus explicaciones y como ella arma los parciales y finales, es bueno prestar atencion a lo que ella remarca como importante. Su metodología es que sube un video con la explicacion de los temas que dió el año pasado y en el horario de la clase hace un repaso de los conceptos más importántes y resuelve algunos problemas teóricos; por un lado tiene sus ventajas porque los problemas salen de los finales que ya se tomaron. Personalmente me molestaba tener que ver los videos porque consumía bastante tiempo, pero entiendo que no alcanzaba el horario para hacer todo así que estoy conforme con su metodología. Deberia dar electroquímica ella tambien porque a Juan no se le entendió nada.', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'La mejor sin duda alguna. Exigente, le gusta que asistan a sus clases, explica muy bien, plantea ejercicios tipo parcial o final y siempre responde consultas haciéndote pensar hasta que llegues por tu cuenta a la respuesta correcta (si estás muy perdido te guía).', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Norita es brava, es buena en el fondo, pero brava. Supongo nomás que quiere que pases de cuatri SABIENDO bien los temas, no chamuyando. Explica como los dioses y hasta te da las oportunidades que te mereces para aprobar. Igual creo que ya para 2C 2022 estará jubilada y la suplanta Ani Russo.', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Está mujer es Dios explicando química. Trata de no hacer las clases pesadas y se nota que tiene vocación. Si le vas con dudas ella trata de resolverlas y si no, te recomienda o incluso presta algún libro para que te puedas hacer una idea. ', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es muy buena profesora, se entiende muy bien lo que explica y no te deja con dudas. Suele dar clases de consulta un rato antes de las teóricas. Tiene personalidad fuerte pero no tiene mala intención contra el alumno, te busca ayudar si ve que tenés intención de aprender y no demandas nota.', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Medio dura en trato, pero explica de 10. Igualmente, para los que vayan a cursar, sepan que se jubiló, así que no va a estar en el 2do cuatri', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Nora es excelente como docente. Se nota que sabe un montón y es muy predispuesta a responder dudas y consultas.', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica muy bien, tiene un carácter fuerte. Sus teóricas son muy buenas, responde cualquier tipo de dudas y quiere que entiendas, pero sobretodo que PIENSES. Tengo entendido que Norita se jubiló y en su lugar estará Russo. ', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Gran profesora, con una muy linda actitud en las clases. Una crack', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica re bien Norita y es re buena aunque se haga la mala', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica MUY bien, pero es algo dura. En un momento de la cursada se enojó porque eran pocos los que asistían a la clase y tuvieron que pedirle que suba las grabaciones, hasta que por fin lo hizo. Es muy puntual también. ', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es super estricta y exigente, pero se nota que sabe un montón y sus explicaciones son un mil, explica los temas super en profundidad y va con un buen ritmo, hay que seguirla, sube las clases grabadas pero no le gustan que no vayan a clase para después ver la grabación, se re enoja con eso, es muy exigente para corregir, pero es muy buena profesora, recomiendo.', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy buena profe. Participen en clase por que sino se hace aburrido. Correctas clases teoricas y cada tanto aparece en alguna que otra clase practica. ', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es una profesora muy clara y concisa para explicar los temas. hace las clases un poco dinamicas y pregunta sobre cosas conceptuales durante las clases. arma PDFs resumen y los sube al campus. es la mejor dando la teoría', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buena profesora: explica claro, utiliza PDF´s bien organizados, responde todas las dudas, las clases teóricas siempre terminan con unas preguntas para ver si el alumno entendió el tema o no, y si no entendió vuelve a explicar todo.', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Nora es una genia! Sabe muchiiisimo y se nota que quiere que entendamos los temas, además es muy didáctica y si tiene que explicar 20 veces algo, lo hace con la mejor onda y buscando formas distintas de explicar para que se entienda. Es exigente, pero te a las herramientas para que puedas cumplir con esa exigencia. ', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Excelente profesora. Explica muy claro y sus clases son muy organizadas e interesantes. Es la mejor', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Nora parece estricta al principio, pero si la llevas al día llegas perfecto al final', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Nora es una genia, tremenda profe', 'c505a097-dc5b-4409-82b3-5be9bae6040a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'La cursé en el inicio de la cuarentena (virtualmente) y creo que es de las pocas profesoras que te llevas de recuerdo en tus primeros años de universidad. No acepta criticas alguna si tenes un problema respecto a su manera de enseñar y organizarse al igual que la profesora Nuñez del curso 3. Te hace una historia larga si por algun motivo les cuestionas algo mínimamente. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Ella es buena profesora, pero en cosas como la práctica da cosas muy por sentado y si no le preguntas específicamente puede que siga de largo y en el medio de resolver un ejercicio ni mencione esa cosa que a vos no te cierra. Pero por el resto es buena.', '892d3bc3-9d93-41de-b690-e7e3912c5910');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Una crack Ceci. Gran ayudante, muy gentil y atenta a las dudas. Dispuesta a responder cualquier consulta.', '725058e5-7210-4e48-ace0-ca97fcae9c1c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy copada. Expliica bien y, como también es alumna, te tira buenos tips de estudio', '725058e5-7210-4e48-ace0-ca97fcae9c1c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Puede ser medio desorganizado pero sabe mucho y sabe cómo explicar bien.', 'cddc5fe9-900b-4fbf-a5ac-12c216217c8b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Hizo todo prácticamente, explica muy bien. Contesta todas las dudas en el campus también.', 'cddc5fe9-900b-4fbf-a5ac-12c216217c8b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica bastante claro pero a veces se cierra en los conceptos que dan en la teórica y no desarrolla mucho. ', '72f8420c-bf9c-4a6a-8551-6c48165a6eeb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es buena onda Brian, explica de forma clara y práctica. Además, al ser él también estudiante te da una perspectiva de las cosas que es más cercana a lo que estas viviendo vos. Me hubiera gustado que vaya un poquito más rápido en algunas revisiones de tareas o cosas por el estilo. Estuvo re atento al foro y contestaba las dudas rápidamente; en algunas ocasiones interpretó las dudas que iban surgiendo bastante bien a pesar de que no se entendian o no estaban del todo bien formuladas :). Algo que discutimos es que habia pequeñas discrepancias entre lo que se daba en la teórica y lo que se esperaba que contestemos en las tareas, pero es súper entendible considerando que sigue siendo una modalidad "nueva" para todos y calculo que se van a ir suavizando estas cosas. ', '72f8420c-bf9c-4a6a-8551-6c48165a6eeb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Ya no está en el curso 1, estuvo un par de semanas y se tuvo que cambiar a otro curso, pero es muy buen docente y te deja muy claros los temas en la teórica práctica. Es muy copado.', '72f8420c-bf9c-4a6a-8551-6c48165a6eeb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Si bien estuvo 1 mes (porque se pasó al turno 2), sabía explicar muy bien la resolución de ejercicios. Como plus muy bueno, sabe darte tips desde el lado alumno, de qué cosas hay que tener en cuenta, etc. No tiene problema con que consultes.', '72f8420c-bf9c-4a6a-8551-6c48165a6eeb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se pasó al turno 2. El tiempo que estuvo en el 1 ayudó mucho y lo que explicó fue muy claro. Super abierto a consultas ya sea de la materia o de la carrera', '72f8420c-bf9c-4a6a-8551-6c48165a6eeb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es un curso excelente, los profesores explican muy bien y se preocupan por el rendimiento de sus alumnos, las clases son entretenidas y completas. Se hacen querer y transmiten mucha confianza ', '72f8420c-bf9c-4a6a-8551-6c48165a6eeb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Brian el mejor de todos', '72f8420c-bf9c-4a6a-8551-6c48165a6eeb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Un genio total, siempre dispuesto a contestar cualquier duda que tengas.', '72f8420c-bf9c-4a6a-8551-6c48165a6eeb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es un amor <3 toda la paciencia para explicar y organizado, siempre responde en el campus dudas', '72f8420c-bf9c-4a6a-8551-6c48165a6eeb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Si bien manda tareas casi todas las semanas que son un poco pesadas te super preparan para los parcialitos (que hay cada dos o tres semanas aprox). Nivel que estudiando lo que mandan en la tarea y prestando atencion en la resolucion que dan en clase podes aprobar tranquilamente los parcialitos. Brian explica muy bien al igual que todos los profes de la practica. Si pueden atontence con ellos', '72f8420c-bf9c-4a6a-8551-6c48165a6eeb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Un excelente docente, siempre muy claro y conciso con lo que quiere explicar. si no entendiste algo te lo explica con una paciencia que pocos la tienen. ', '72f8420c-bf9c-4a6a-8551-6c48165a6eeb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buen docente, siempre explicaba con mucho detalle y planteaba distintos caminos para resolver los ejercicios para que cada uno vea cómo lo entiende mejor.  ', '72f8420c-bf9c-4a6a-8551-6c48165a6eeb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Igual que la profe Gavioli.', '5c1f3ffe-aad9-41cd-aec8-e56b7bd25e7e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Perdón, pero no m gustó para nada. Hacer ejercicios con ella es ir a 300 km/h y no haber entendido nada al final. En el laboratorio, yo entiendo que son necesarias las medidas de seguridad pero está mujer es otro nivel de obsesiva. Grita mucho y por un mínimo error hace un escándalo.', '5c1f3ffe-aad9-41cd-aec8-e56b7bd25e7e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica muy bien junto con Cecilia, son super llevaderas sus clases y hasta divertidas, se nota que es exigente y detallista y lo aplica en sus explicaciones, super recomiendo, hace muy buenas aclaraciones de cosas que pueden llegar a tomar y donde se podría meter la pata, así que vale la pena no perderse sus clases, no le gusta que no participemos en la clase.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Se entienden muy bien sus explicaciones de ejercicios (e incluso si no entendías te hacía un resumen de la teórica también)', '0f08e9eb-0817-4b47-a7d0-9b932c2ad055');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'Ana es una grosa, responda la duda que tengas, explica con claridad. Es la JTP y los parcialitos que toma son acordes a lo que da', 'aec4466a-da44-4406-8261-ef09e41ac3c5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'El curso 1 tiene los mejores profesores. La JTP es una genia, explica claro y responde todas las dudas que tengas. Los ayudantes son unos genios también, explican los dos excelente y están siempre dispuestos a ayudar si no se entiende algo. Los parcialitos accesibles, nunca te toman nada que no hayas visto en las prácticas/laboratorio. ', 'aec4466a-da44-4406-8261-ef09e41ac3c5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buena profesora, explica bastante bien. Se le nota que te quiere ayudar con lo que sea para que te vaya bien pero siempre y cuando le pongas voluntad. A veces medio colgada para dar los prácticos, pero en líneas generales bastante bien. ', 'aec4466a-da44-4406-8261-ef09e41ac3c5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Ana explicaba correctamente, se notaba que quería que entendamos. Un poco lenta quizas a veces. Ella estaba a cargo de dar los trabajos prácticos, a mí personalmente no me gustaba como estaban propuestos (entiendo que no es algo que arme ella si no que es general de toda la materia), me pareció poco didáctica la forma en la que fueron adaptados a la virtualidad, podrian incorporar más videos.', 'aec4466a-da44-4406-8261-ef09e41ac3c5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Si les da la prioridad les recomiendo ampliamente asistir a este curso. Las prácticas son excelentes, brindando en algunos temas el desarrollo restante que haya faltado en las teóricas para la compresión de los mismos. Son un gran complemento para llevar y entender la materia. Además de la gran calidad en el nivel de enseñanza, son muy buenas personas y salís de la cursada con una sensación muy cálida. Les guardo mucho cariño! Las teóricas son las mismas para todos, Nora explica muy bien. Con Juan profundicen los temas con el Atkins y procuren no consultar mucho porque se re va por las ramas, igual es una gran persona.', 'aec4466a-da44-4406-8261-ef09e41ac3c5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La amamos, una GROSA (joda Ani). Analía hace super amena la cursada, la práctica es genial y se super preocupa por que entiendas y apruebes, no tiene problema en organizar cuantas clases de consulta quieras y hasta al final de cursada arma un picnic con sanguchitos que por tradición ella misma arma la noche anterior. Ya te tuve que haber convencido de que te anotes no? ', 'aec4466a-da44-4406-8261-ef09e41ac3c5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Yo la tuve como JTP, es muy buena persona y siempre busca que le vaya bien al alumno, te ayuda mucho para lo que sea. Como profesora en los laboratorios y teórica práctica es muy buena pero un poco desorganizada a veces, no al punto en el que sea tan molesto. Esta empezando a dar teóricas y le falta un poco de organización y enfoque en partes más importantes de los temas pero denle crítica constructiva si es necesario, te re escucha. ', 'aec4466a-da44-4406-8261-ef09e41ac3c5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Analía es la profesora que más en claro te deja que quiere que sus alumnos aprueben, por ejemplo aconsejándote que es preferible priorizar para estudiar para un parcial/final. Muy clara, se complementó muy bien con Ana (Fossati). Sinceramente, parecía una tía más que una profesora, porque también te apoya anímicamente y te habla de su vida para aconsejarte. Igualmente, al parecer, luego de este cuatri va a ser profesora de teoría, no JTP (es decir de laboratorio).', 'aec4466a-da44-4406-8261-ef09e41ac3c5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'UNA GENIA, se nota las ganas que tiene de que aprendas, es un amor. Es super dedicada en su laburo y no faltó ni a una clase. El equipo que hace con Ana es mágico. Hizo una clase de consultas en épocas de final, muy buena. El mejor turno es el 1, con ella te das cuenta por qué <3 ', 'aec4466a-da44-4406-8261-ef09e41ac3c5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'El mejor grupo el Turno 1<3 Son todos unos genios re buenos y comprensivos, analia es lo mas siempre nos retaba como una madre y nos daba lecciones de vida, es re copada y buena y explica bien igual que todos, ella se encargaba mas de explicar los tp de laboratorio', 'aec4466a-da44-4406-8261-ef09e41ac3c5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy buena profesora, las clases practicas son un 10, estan muy bien organizadas y se resuelven muchos ejercicios. Tiene un trato muy amigable con los alumnos y hace que la materia por mas de que sea un poco pesada se haga llevadera. ', 'aec4466a-da44-4406-8261-ef09e41ac3c5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es muy buena docente, siempre hace chistes y es la que explica los tps ', 'aec4466a-da44-4406-8261-ef09e41ac3c5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Analía sabe mucho, a veces pasa temas que no considera muy importantes "por arriba" pero siempre está dispuesta a despejar dudas, etc. Además, lo que destaco de ella y de los profes del turno 1 en general es que te hacen sentir muy a gusto en las clases y hacen todo lo posible por ayudar a los alumnos.', 'aec4466a-da44-4406-8261-ef09e41ac3c5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Federico fue un docente dedicado, responsable y atento a cualquier duda que tuviéramos, siempre dispuesto a responder muestras inquietudes.', 'd8cb3524-1fe6-44af-b773-ecfb66169e94');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Copado, explica bien y muy prácticamente, bien predispuesto y puntual.', 'd8cb3524-1fe6-44af-b773-ecfb66169e94');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Un amor', 'd8cb3524-1fe6-44af-b773-ecfb66169e94');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Gracias juan!! Explicó todo muy bien y prolijo  Salvo el cuatri', '3dd3ca1b-8d6d-4f65-8a40-7909e58a8abc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Es la joyita de la práctica. Explico prácticamente todos los ejercicios solo. Los explico excelentemente. Contestaba todas las preguntas en el campus. Y nos ponía vídeos para “simular” el laboratorio y que no se haga tan pesada la clase. Muy buen docente!!', '3dd3ca1b-8d6d-4f65-8a40-7909e58a8abc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Le toca explicar ejercicios prácticos, es muy claro en su forma de hablar y siempre se le pueden preguntar ejercicios extra que no estén previamente resueltos en power.', '3dd3ca1b-8d6d-4f65-8a40-7909e58a8abc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Muy dedicada. Excelente profesora y persona.', '096216bc-2b77-447f-bf01-c3d3a063357f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Es la mejor, super clara y accesible', '096216bc-2b77-447f-bf01-c3d3a063357f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'explica re bien, y se nota que sabe un monto, es re amable', '096216bc-2b77-447f-bf01-c3d3a063357f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Tremenda profesora!', '096216bc-2b77-447f-bf01-c3d3a063357f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Una genia. Explica bárbaro, súper clara y ordenada. Es re buena y da las clases con entusiasmo. Lo único, va RAPIDÍSIMO', '096216bc-2b77-447f-bf01-c3d3a063357f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es una genia , explica super bien y es muy buena onda ', '096216bc-2b77-447f-bf01-c3d3a063357f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'Vale es una genia. Es muy copada, enseña bien y te prepara muy bien para el parcial. Es clave que vas incorporando las reacciones porque te lo toma en parcialitos. No tiene problemas en hacer consultas y te pasa parciales .', '096216bc-2b77-447f-bf01-c3d3a063357f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Valeria es el ejemplo de jtp impecable. Explica todo de una manera que es imposible no entenderle, además que aporta muchísima información que se re valora para los parciales o finales, se llega muy bien preparado. Los laboratorios son super organizados, sabe muchísimo y es un amor de persona, lo que sí es bastante exigente con los parcialitos pero sin duda su curso vale la pena. Responde dudas por el campus. ', '096216bc-2b77-447f-bf01-c3d3a063357f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2018', 'Genia mal Debandi, sabe una banda, se le entiende todo, explica re bien y es un amor.', '096216bc-2b77-447f-bf01-c3d3a063357f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Vale es una genia. Sabe todo sobre la materia, al punto que explica cada detalle de los prácticos de memoria. Te da todo lo que necesitás en la práctica y en el laboratorio, y esto se ve claramente en el parcial: el curso de ella tiene sistemáticamente más promedio en los parciales.', '096216bc-2b77-447f-bf01-c3d3a063357f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Valeria es excelente docente y persona, siempre estuvo con muy buena predisposición para enseñar y para responder consultas, por lo que las clases se hacían amenas. Se puede ver que conoce los temas de la materia con profundidad y siempre está dispuesta a expandir las explicaciones si alguien le pregunta. Además valoro que haya armado presentaciones especiales mostrando algunos de los temas en los que ella explicaba la teoría, estas eran claras y gráficas. Para la segunda jornada de laboratorios recopiló las experiencias que desarrollamos en un solo cuadernillo por lo que era muy fácil de seguir lo que se iba haciendo e incluso había ilustraciones. 10/10', '096216bc-2b77-447f-bf01-c3d3a063357f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Trato muy cordial y alegre con los alumnos. Explica re bien y sabe un montón.', '096216bc-2b77-447f-bf01-c3d3a063357f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'muy bueno explicando los temas teóricos y usa muchos ejemplos para ayudar a entender', '3bc6ad8d-8f8d-433b-b309-7124a52d585b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Al principio parece un docente imponente pero realmente es como Jacobo, muy claro y solo quiere que entiendas, aprendas y apruebes la materia. ', '3bc6ad8d-8f8d-433b-b309-7124a52d585b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'es un excelente docente, explica re bien y es muy didactico', '3bc6ad8d-8f8d-433b-b309-7124a52d585b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Genio total.', '3bc6ad8d-8f8d-433b-b309-7124a52d585b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es súper dedicado. Nos llevó fotocopias, figuras, rocas, un montón de cosas para visualizar mejor lo aprendido. Proponía tareas semanales para integrar los temas, pero no eran obligatorias. Personalmente recomiendo leer el pdf antes de la clase para entenderle mejor. Está de más decir lo mucho que sabe', '3bc6ad8d-8f8d-433b-b309-7124a52d585b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es un genio!! Lo que si casi siempre terminamos 5 o 10 minutos tarde , pero lo valen , explica muy bien ', '3bc6ad8d-8f8d-433b-b309-7124a52d585b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'Ídolo', '3bc6ad8d-8f8d-433b-b309-7124a52d585b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2018', 'Es un capo y sus clases se hacen bastante llevaderas. A veces tira datazos piolas sobre las cosas que da pero despues esas pelotudeces irrelevantes te las toma en el final y te querés matar. ', '3bc6ad8d-8f8d-433b-b309-7124a52d585b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Fasoli es menos organizado en el pizarrón y en los temas que Jacobo. Es claro al explicar, cuando estás en la clase, pero te llena de datazos. A la tardecita después de almorzar dan un poco de sueño sus clases.', '3bc6ad8d-8f8d-433b-b309-7124a52d585b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Sus clases me parecian aburridas por lo cual a lo ultimo deje de ir. tiraba varios datos interesantes, las clases de el al igual que las de jacobo se basaban en escucharlo hablar y tratar de copiar. al final de cada clase llevaba un experimento que a mis compañeros les fascinaba.', '3bc6ad8d-8f8d-433b-b309-7124a52d585b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'El doctor Fasoli es quizás el mejor profesor que tuve en la universidad. Sabe muchísimo de química y su estilo de explicar es que los procesos y fenómenos parezcan lógicos y naturales, por lo que uno se queda con la sensación de que no tiene que memorizar casi nada sino más bien entender los rumbos de la naturaleza. Sumado a esto tiene experiencia interactuando con la química en diversos campos, por lo que a veces puede complementar la información con lo que vio en primera persona. No le molesta para nada contestar preguntas y sus clases están organizadas claramente. Ademas siempre sube las presentaciones al campus.', '3bc6ad8d-8f8d-433b-b309-7124a52d585b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Que kpo este muchacho. explica de manera clara o concisa, toma siempre lo que da en las teóricas (atentos con eso). Cuando explica parece un pez en el agua de la manera en que lo hace, siempre predispuesto a responder dudas y a veces tira unos datos que no tienen mucho interés pero por lo menos relaja un poco la clase y no la hace monótona. ', '3bc6ad8d-8f8d-433b-b309-7124a52d585b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Un genio. Muy dedicado a sus clases. Lleva distintas cosas como piedras, fotocopias y estructuras 3D para que se entiendan mejor sus clases. Su conocimiento es demasiado amplio.', '3bc6ad8d-8f8d-433b-b309-7124a52d585b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Un crack Juan.', '533f38f8-f921-4dca-992f-a04a2645f473');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'solo explica los Tps ', '969b3635-a8d7-4450-bb54-e341af2e1da8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es una muy buena profesora , explica bastante bien , siempre con buen humor !', '7889b149-885b-4797-a61a-e57f563dc32e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Una capa Sandrita', '7889b149-885b-4797-a61a-e57f563dc32e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Sandra es muy buena docente y siempre esta bien predispuesta para responder consultas, en el laboratorio resultó de gran ayuda', '7889b149-885b-4797-a61a-e57f563dc32e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Muy buena profe, ayuda mucho en los laboratorios y respondé cualquier duda.', '7889b149-885b-4797-a61a-e57f563dc32e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Explica los tp, pero a desgano', '814b53aa-a699-489b-bedf-7f33fbc9044c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Le toca explicar los trabajos prácticos, hace lo mejor que puede los explica claramente pero son tediosos de por si al verlos virtualmente. Muy clara al explicar los ejercicios prácticos y la parte de corrosión ', '814b53aa-a699-489b-bedf-7f33fbc9044c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Otra genia. Es re dulce y divertida, te contagia la buena onda. Sabe una bocha, y siempre esta dispuesta a contestar dudas. Al final de la cursada seguía yendo a la facu por si alguien quería hacer alguna consulta. Con el tema parcialitos es re flexible, definitivamente el mejor curso.', '814b53aa-a699-489b-bedf-7f33fbc9044c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Curse con ella cuando le abrieron su propio curso en lo personal las explicaciones de laboratorio no servian mucho, por lo cual a lo ultimo deje de ir, aunque daba sus propias reacciones, los parcialitos no eran dificiles, siempre pedia ecuaciones quimicas del tp de labo y una que otra preguntita teorica, siempre estuvo dispuesta a contestar preguntas tanto en clase como fuera de clase, es alguien muy receptiva. no aparecen pero sus ayudantes eran Joaquin y rocio, joaquin era parte de la practica, de lo mejor que habia, siempre dispuesto a explicarte los ejercicios que no te salian y traia echos para que vos veas la manera en que lo resolvia el, tambien estaba dispuesto a hablar de la carrera, en cuanto a rocio, tambien era prolija y explicaba muy bien los ejercicios en clase y se quedaba un tiempo extra por si tenias dudas. ', '814b53aa-a699-489b-bedf-7f33fbc9044c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No explica casi nada. Pero es un profesor que si le consultas, te das cuenta que sabe muchísimo.', '5886db96-94b3-4930-bae5-6220e11c0847');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'a veces explica medio mal, pero los parcialitos que hace del lab son super accesibles ', '5886db96-94b3-4930-bae5-6220e11c0847');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Ariel en este curso fue ayudante de Lab pero también tiene su curso de práctica. Para las prácticas sin duda es el mejor, sabe resolver todos los ejercicios y los explica muy bien, si no sabe algo lo consulta con la profe de teóricas sin problema. Como ayudante en laboratorio no da mucha respuestas pero tiene buena predisposición. El que da respuestas y no figura acá es el JTP que fue Javier Eiras, es uno de los mejores jtp que pueda haber, responde todo, sabe un montón y explica muy bien, es claro, ordenado y sus parcialitos son nivel intermedio, da muchas oportunidades. ', 'fcf9de5b-89fb-45b8-afcb-fd758d2cafae');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Contesta cualquier duda,  explica muy bien los tps, los parcialitos eran re accesibles y re tranqui para corregirlos', 'e3f18639-75ec-4132-8e1d-8f36efbac905');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Javier es lo mas! Se disfruta un montón hacer laboratorios', 'e3f18639-75ec-4132-8e1d-8f36efbac905');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Reemplazó a Javier Eiras el 1C2020, y se ocupa de la parte de laboratorio de la materia. Fue la parte que más zafó de toda Química Orgánica porque subían ejercicios resueltos y material, y asistían un poco con los parcialitos semanales. De cualquier forma, algunas dudas en el campus quedaban sin responder, y solamente a mitad del cuatrimestre le vimos por primera vez la cara. Se ríe de forma irritante.', 'efa76f9b-300a-4c5f-928b-bfd865dbb2bb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Josefina es buena me gusto que sobre la segunda mitad de la materia hacía videollamada para aclarar cosas del labo. En principio nos cambio el horario de parcialito y era a las 7 los cual era un bajon pero después lo paso a las 9 y fue más flexible respecto a las dudas (antes se hacían después del parcialito y después lo paso a los viernes para tener más tiempo para hacer los cuestionarios) a veces dejaban preguntas sin contestar.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Luengo fue una docente muy agradable, desde la mitad de la materia en adelante (1C2020). La adaptación a la virtualidad fue un caos, la única asistencia que teníamos eran ejercicios resueltos, no había charlas ni explicaciones, ni presentaciones con audio. Estuvimos solos en la materia durante las primeras 6 semanas y en los parcialitos tomaban cosas que a veces ni tenían que ver con el tema. Luego de la séptima semana tuvimos un receso donde pudimos charlar y de alguna forma aceptaron la crítica (aunque se quejaron ella y todos los 40 ayudantes de la cátedra porque decían que estaban haciendo ya demasiado). Desde esa semana tuvimos clases virtuales que no estaban muy bien armaadas pero se entendían, fomentaba mucho a la participación, pero a cambio demoraban entre días y semanas para responder algo en el campus. Inicialmente teníamos losnparcialitos fuera de horario, pero NO respondían consultas en la semana porque estábamos fuera del horario de laboratorio. Muchas veces en el campu quedaron preguntas sin respuestaas e incluso en otras respuestas contradictorias. El trato era adecuado. ', 'efa76f9b-300a-4c5f-928b-bfd865dbb2bb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Jose es una crack, se le entiende bien y es bastante piola. Te hace preguntas en el medio del laboratorio que te preparan para los parcialitos y parciales. Parcialitos razonables, no pregunta locuras. Conviene preguntarle antes del laboratori qué es lo que efectivamente se va a hacer porque por lo general no son todas las experiencias.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Solamente se conectó para subir PowerPoints y contestar algunas dudas de teoría (pero por lo menos HUBO clases teóricas a través de estos PowerPoints). Nunca tuvimos un mísero Meet/Zoom con la persona que dirige la cátedra en todo el cuatrimestre. Es una profesora que sabe muchísimo, pero que se ha ocupado de estructurar una materia filtro en la carrera de Ingeniería Química, no solo por la gran cantidad de temas que tiene sino por la dificultad irrisoria de sus exámenes. Se negó a dejarnos rendir el final hasta que no terminemos las prácticas de laboratorio.', '3984b355-4ac4-4891-b303-0d21b2577130');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No le conozco la cara. Subió PowerPoint con audio (algunos se escuchaban mal y no los arreglaron) nunca hizo videollamada teóricas. En los primeros parciales aprobaron solo 16 personas de las 140 que habían así que no se desanimen si les va mal. Al principio ni ellos sabían como iban a ir descartando gente supuestamente a los 3 parcialitos mal estabas fuera después cambio. Le pidieron rendir final los chicos de la cursada virtual y que les guardarán la nota y una vez echos los labos que les firmen la libreta lo cual me pareció lógico para que no se acumulen finales pero no acepto. Debían aprobar 14 parcialitos + 2 parciales para llegar a un "parcial final" y después de eso recién regularizadas para llegar a final. Un embole. AAA no se en que se basaban para responder consultas n el foro pero había consultas que no contestaban..', '3984b355-4ac4-4891-b303-0d21b2577130');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Como docente ella presenta el material completo y ordenado. Durante la virtualidad grabó los videos de todos los temas. Sin embargo el contenido se volvió excesivamente largo por la cantidad de cosaas que desea presentar dentro de los videos: cosa que en un principio no está mal, pero cuando hay que enfrentarse a los parciales toman cosas a las que ella le no les dio mucha bola. Como comentario, ella no contestaba preguntas por el campus, y el general las preguntas podían quedar colgadas más de dos semanas mientras algún JTP se las hacía llegar por mail (no sceptaba consultas directas a su mail). Si bien su trato es muy formal, tiene un fuerte toque de soberbia en sus respuestas cuando algo no le gusta. No acepta críticas. ', '3984b355-4ac4-4891-b303-0d21b2577130');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Es exigente, pero a la altura de lo que da. Cuesta entender la materia en un principio pero una vez que entendes los conceptos claves va genial. Miriam responde las dudas de forma muy completa. Si bien solo subía power points de la teórica, para mi fue más práctico, ya que dar por meet/zoom todo ese contenido hubiera sido un caos. En mi opinión, Miriam es muy buena docente.', '3984b355-4ac4-4891-b303-0d21b2577130');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Miriam es química orgánica, toda la materia pasa por ella. Sabe mucho de todo lo que enseña y se le entiende bien. Además de dar las clases teóricas (común a todos los cursos) sube videos a YouTube explicando los temas en más detalle. Todo lo que se necesita saber está en esos videos y en los powers, pero el rendimiento sería mejor si hubiera más horas de cursada presencial.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Explica muy bien, como educadora es pésima. La culpa de que a todos les vaya mal nunca es de los docentes, siempre de los alumnos que no estudian y son vagos', '3984b355-4ac4-4891-b303-0d21b2577130');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Rocío maneja todos los insumos e instrumentos del laboratorio. Es la persona que te contesta las cosas más prácticas (donde se tira esto, si esa temperatura es la correcta, donde se guarda tal reactivo). Parece mala onda pero no es.', '936651e9-01e3-4c80-ac72-08c793c3e7b7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Valeria que es profesora de práctica, sabe un montón pero le suele costar transmitir ese conocimiento por eso sus clases suelen marear un poco. Cuando se le hacen consultas personalmente responde con mucha amabilidad y bien. También le gusta dejar una clase de consultas antes de los parciales, si no se llega con los tiempos para explicar los temas agrega clases extra en un horario coordinado con los alumnos.  Explica muy bien el tema de espectroscopía. ', 'efe64270-3635-4f2c-ac05-0ff1793efda8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Valeria en orgánica es un DESASTRE. Se contradice cuando explica, no es clara y dice cosas que están mal con total seguridad(si estás medio perdido le crees y si venis siguiendo la materia te das cuenta que dice boludeces). En el 2C19 podías avisar e ir a la práctica que querías)', 'efe64270-3635-4f2c-ac05-0ff1793efda8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Desastre. La práctica estuvo ausente durante prácticamente todo el cuatrimestre. Solamente respondían ALGUNAS dudas por campus, y estas respuestas solían confundirte más de lo que te ayudaban. Dijeron que iban a cargar ejercicios resueltos, nunca lo hicieron. Agregaron un "parcialito de problemas" aún cuando las clases de problemas habían sido inexistentes y lo corrigieron como si nos hubieran dado clase en Stanford. Cuando un par de semanas antes de este parcialito se dignaron a abrir un Zoom y dar clase, fue de las peores experiencias que tuve. Les pedimos resolver un examen que ni ellos sabían cómo hacer, en el medio había un bebé llorando... paupérrimo bajo cualquier vara con la que se analice.', 'efe64270-3635-4f2c-ac05-0ff1793efda8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Nunca le entendi nada. Dos veces le habré preguntado algo y me confundio mas. Cuando da el contenido se mezcla y hasta vos mismo te das cuenta que esta mal', 'efe64270-3635-4f2c-ac05-0ff1793efda8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Valeria lleva un tiempo en la materia y sabe las cosas. Si tenés algún ejercicio de las guías que quieres consultar, pregúntale a ella y te va a saber contestar. Conviene preguntar y no sentarte a esperar que llegue al ejercicio que te interesa', 'efe64270-3635-4f2c-ac05-0ff1793efda8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es malísima, no entiendo como esta mujer es docente', 'efe64270-3635-4f2c-ac05-0ff1793efda8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Aab es crack. Tiene Altas diapositivas, y hace preguntas que generalmente son dudas clasicas de los estudiantes. Responde dudas sin ningun problema. sus pdf estan buenos para los parciales y el final.', '6c8009a6-db5e-4a5f-a779-5243ba3d4ff4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Va banco por banco explicando dudas puntuales de cada alumno, un capo', 'c234d3f5-20d5-4a54-a150-031ac9c3f6e0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Corrige un poco estricto pero no tiene problema en que le preguntes todas las cosas.', 'c234d3f5-20d5-4a54-a150-031ac9c3f6e0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'de vez en cuando usa el pizarron, pero fundamentalmente lee/explica diapositivas. Dentro de todo estan buenas las clases, si bien el siu dice que las clases son hasta las 21.30 casi todas terminaron a las 20.30. Si bien terminabamos 1 hora antes se llega re tranqui a ver todos los temas. ', 'd7b5ad2b-e490-4042-91e7-89bf7c85aff1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Ejercicios bien completos. Sirven mucho.', '8a33f375-2e4d-44b9-8f72-18c762e63638');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'muy buenos los tps, consisten en aplicar los conceptos de la materia en casos practicos de la carrera, aunque estan enfocados en problemas de ingenieria civil. te enseñan a usar algunos softwares como el mathcad (para resolver ecuaciones) o el RAM (para estructuras). tambien te recomiendan que los uses en los tps pero no es obligatorio.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buena cursada, tiene los mejores ayudantes de todo fiuba', '831122cc-bda3-4e43-a54c-d39ac427ab86');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Es un buen curso y todos los profesores y ayudantes también lo son (explican bien, respetuosos, responden dudas, etc). Sin embargo a mi no me sirvió la modalidad optada ya que en la teórica se explicaban ejercicios muy básicos de cada tema y en la práctica tenías que ir ya sabiendo resolver ejercicios más complejos, si bien te guiaban muchas veces no supe resolver los ejercicios que me daban ya que nadie me había mostrado cómo resolver algo de ese estilo. Siento que faltó mas explicación práctica pero bueno me termine ayudando con los videos de Parente en youtube.', '831122cc-bda3-4e43-a54c-d39ac427ab86');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El mejor de todos, anotate con el ', 'f5bfc932-5c34-4641-a046-e74165f52e5c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'El mejor ayudante lejos, ahora tiene su propia catedra.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Se nota que sabe un monton, pero no lo sabe explicar. Vos ves su curriculum y es impecable, pero en la clase no sabe volcar nada de todo eso. Una vez me acerque a hacerle una pregunta y me saco carpiendo. Eso si, es justa pars corregir y si ves q te esforzas te ayuda, el cuatri q yo la curse, hasta nos dio una fecha mas de recuperatorio', '3670726d-f4ca-4c19-b472-2a179db8dd43');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es bastante pesada su clase, habla bajo. Tiene buen criterio de corrección. ', '3670726d-f4ca-4c19-b472-2a179db8dd43');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2014', 'Habla bajo y las clases son muy aburridas. Le falta dinamismo, se vuelve todo super monótono y aburrido.', '3670726d-f4ca-4c19-b472-2a179db8dd43');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Da lo necesario. E1 es una materia con la que, si se razona lo necesario para resolver los ejercicios, se aprueba. Con Toscano ni se necesitan libros, alcanza con lo que da. Es más concreta, y la exigencia es normal (uno en estabilidad NO se puede equivocar nunca).', '3670726d-f4ca-4c19-b472-2a179db8dd43');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'La materia fue dada por otros docentes debido a problemas del profesor para dar las clases virtuales.
