INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'explica bien y da ejercicios clave, no resuelve numericamente los ejercicios eso si, pero responde todas las dudas por telegram ', '5ee2f9f6-96f8-498f-a8be-48938c1f98cb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'explica muy bien, sabe mucho', '64117827-08f5-444d-a966-1607466dca84');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Estaba más que nada para contestar dudas y ayudarte con ejercicios que se dieran en la práctica. Es un poco caótico pero le pone toda la onda y te explica todo de 0. Las clases que dió estuvieron buenas.', '8c6697cd-dba6-437b-8cf6-2b9ade8bb3d5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Es un poco caótico cuando da clases, aunque da pocas. El resto de las clases se dedica a pasar por los bancos y si ve que estás haciendo algo mal te explica individualmente.', '8c6697cd-dba6-437b-8cf6-2b9ade8bb3d5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica muy bien y está súper dispuesto a responder las dudas por mail.', 'd9dfd067-bca0-4f64-9ab3-b4abdb99bb16');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'explica muy bien y tiene el campus bien ordenado. con los tps aprendes a usar bien el excel y otros softwares mas especializados.', '3e0be798-b820-495e-aeb9-a55e167f37e3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Tipazo total. Explica bárbaro, es muy prolijo, los ejercicios que arma son un lujo, contesta por discord o campus. Tanto él como Baez y los otros colaboradores te ayudan de forma individual en los ejercicios, los revisan con vos, tiran tips... Top cátedras que tuve hasta ahora sin duda. Recomiendo 100%.', '2539113b-b9c8-4f5f-81da-3bd2eba19306');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'La definición de tipazo. Explica bárbaro, te mete en la clase, arma ejercicios piolas, apuntes, clases de repaso y consulta antes de los parciales y los ayudantes son copados. Si tenés la posibilidad de anotarte con él y no lo haces te pego.', '2539113b-b9c8-4f5f-81da-3bd2eba19306');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es excelente. Explica muy claro aunque un poco rápido. En la virtualidad empezó a tomar ejercicios obligatorios en cada clase y tomaba oral de ellos, explicarlos compartiendo pantalla. En ese momento me quejaba porque es difícil llevarla al día pero después para el final o parciales lo agradecí, te sacas las dudas en el momento (cosa que es vital en esta materia porque los temas van encadenados y si te quedó dudas del tema anterior sonaste).', 'e66787c8-deb9-41fd-b820-669b787e559b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Se aprovecha bien la clase, no tira cosas por relleno. Tiene una forma de hablar un poco monótona pero explica muy bien.', 'c43f0fa2-4d5b-49b9-a367-16b7a33f8059');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Habla un poco bajo y monótono, aconsejo sentarse cerca para escucharla porque explica muy bien. No toma lista pero en el final entran cosas de teoría y para aprobar la cursada tenés que aprobar unos cuestionarios que sube.', 'c43f0fa2-4d5b-49b9-a367-16b7a33f8059');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No pudo dar clases este cuatrimestre. Subió una carpeta completa de la práctica y una serie de audios que sirvieron.', '21a7571d-bd66-4af3-a965-23f5d952dcbf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Malísimo. Muy desprolijo explicando y aparte mala persona. Sobrador y canchero.', 'f6ac2e37-f613-4b6d-b83a-e815dc45573c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'De lo peorcito de la facultad. Pidió ejercicios todas las clases, nunca dio una devolución de los mismos. Hizo unos apuntes bastante desprolijos. En clase nadie participa porque tiene un trato bastante malo. Desprolijo.', 'f6ac2e37-f613-4b6d-b83a-e815dc45573c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'De lo peores profesores que me tocaron. Desprolijo, desorganizado. Subió apuntes bastante desorganizados. En las clases no participó nadie porque es medio sobrador y tiene un mal trato. Pidió ejercicios todas las clases. Nunca dio una devolución, muy probablemente ni los vio.', 'f6ac2e37-f613-4b6d-b83a-e815dc45573c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'De lo peor que vi en la facultad. Pidió ejercicios todas las clases y nunca dió una devolución de los mismos. Probablemente ni se fijó si los entregamos. Subió unos apuntes bastante desorganizados. Es desprolijo. No tiene un buen trato con los alumnos y por esa razón nadie participa en las clases.', 'f6ac2e37-f613-4b6d-b83a-e815dc45573c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Malísimo. No se entiende nada de lo que explica y encima se hace el canchero. Desprolijo.', 'f6ac2e37-f613-4b6d-b83a-e815dc45573c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Lo mismo que Martinez. llega media hora tarde, se va una hora más temprano, y se toma media hora de receso. De el no rescato nada. Si le preguntas algo te contesta de mala gana. Básicamente se nota que el tipo ve al alumnado como idiota por no entender algo (para el) tan básico. Cuando en realidad si no se entiende es simplemente porque explican mal. ', '3796da74-85cb-495f-8265-bd3430d9f8a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'De los peores profesores que tuve. Realmente no sabes cómo es que está al frente de un curso. No tiene ganas de enseñar y se le nota.', '3796da74-85cb-495f-8265-bd3430d9f8a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'El tipo explica bien. Toma lo que da.', 'e1e40da0-aff4-4f25-8f66-7bb394dde457');
