INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Tranqui, el tipo te da lo necesario para aprobar la asignatura. bueno', 'e1e40da0-aff4-4f25-8f66-7bb394dde457');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'aburre pero explica todo', 'e1e40da0-aff4-4f25-8f66-7bb394dde457');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Muy aburrido pero da bien la materia, es claro al explicar.', 'e1e40da0-aff4-4f25-8f66-7bb394dde457');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Muy aburridas sus teoricas, no es necesario ir. Y cuando fui a rendir el final, llego como una hora tarde.', 'e1e40da0-aff4-4f25-8f66-7bb394dde457');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Buen profesor lastima que los temas que da para el final casi ni los da y llegas muy mal para rendir.', 'e1e40da0-aff4-4f25-8f66-7bb394dde457');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es un muy buen docente, te da todo lo necesario para aprobar la materia. La verdad lo único malo es que es un poco "histérico" en el sentido que si te alejas un poco de su "algoritmo", de como está organizada la clase o el examen me refiero, se enoja. Entiendo que sea una persona ocupada, pero a veces pasan cosas también.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'De la clase de 3 horas llega media hora tarde, se va una hora más temprano, y se toma media hora de receso en el medio. Una vez se durmió en medio de la única hora que da de clase mientras Facundo explicaba. Cuando da clase va a los santos pedos. Rescato 1) Que si le pedís que pare y preguntas te lo explica denuevo con buena predisposición y 2) Que lo relacionado a trabajar con mapas de Karnaugh lo dio bien.', '90fa1082-2aee-4e73-8f99-21476aa98f19');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'De los profesores más mediocres que tiene la Facultad de Ingeniería. Se enoja si evidencias o hablas sobre algún tema de electrónica que el docente no sepa o desconozca. ', '90fa1082-2aee-4e73-8f99-21476aa98f19');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Buen docente. Medio hincha, pero se preocupa por el aprendizaje de sus alumnos. ', '5905e5fa-9ac0-4eb9-9586-99c66b035c6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es un tipo RE pesado, aun así recomiendo esta cátedra si no venís de escuela técnica. Es en la única que implementas varios circuitos durante todo el cuatri en lugar de solo uno como trabajo final', '5905e5fa-9ac0-4eb9-9586-99c66b035c6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'En groso de verdad!! Buen tipo, si bien no fue mi caso, se que te da la oportunidad de rendir el parcial realmente cuando vos te sentis que estas en condiciones! Eso si, quiere que estudies y consultes las dudas que tenés con él con alguno de los Pablos (unos capos también!!).
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'El tipo hace lo que tiene ganas, no le importa dejarte esperando un par de horitas para una firma de libretas o una corrección. La modalidad del curso esta muy buena pero el trato de Musso con los alumnos deja mucho que desear y varias veces terminas perjudicado/a o perdiendo tiempo por los cambios de planes a ultimo momento que hace.', '5905e5fa-9ac0-4eb9-9586-99c66b035c6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Musso me ha atendido dudas por whatsapp día domingo y un viernes antes de rendir el parcial. Es exigente, y un poco hincha, pero te explica hasta que lo entiendas y te hace preguntas para saber si realmente le entendiste.... También, brinda la posibilidad de dividir las clases presenciales en dos grupos, contemplando los días sábados que hay parcial de Análisis...se pone en el lugar del alumno....pero es exigente, en mi experiencia, no me costó nada rendir el final. El horario es flexible...', '5905e5fa-9ac0-4eb9-9586-99c66b035c6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Exigente. Yo cursé Análisis y algebra en simultaneo. Si bien es peso tener que entregar ejercicios semanales, cursando en este curso, el parcial y el coloquio lo aprobé repasando un toque. Además aprendí a usar circuitos integrados. Me ha respondido dudas varias veces e inclusive me atendio por whatsapp, capo.', '5905e5fa-9ac0-4eb9-9586-99c66b035c6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Llega siempre tarde a clase, eso es muy molesto. Es bastante intenso con lo que tenemos que saber y siempre lo corta a Pablito pobre. Sabe un montón, aunque a veces no contesta de la mejor forma y te boludea un poco...', '5905e5fa-9ac0-4eb9-9586-99c66b035c6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'la pasé como el orto pero me anotaría de nuevo, si no venís de una técnica te curte y aprendes una banda', '5905e5fa-9ac0-4eb9-9586-99c66b035c6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'No está muy presente  durante la práctica', '5905e5fa-9ac0-4eb9-9586-99c66b035c6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Curso semipresencial de dos clases por mes los sabados.', '5905e5fa-9ac0-4eb9-9586-99c66b035c6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Nunca esta en las clases porque da otra materia al mismo tiempo. Las clases presenciales son para implementar las placas mientras que las virtuales son para repasar los temas de las teoricas y aprender a hacer algunos ejercicios. Estas se cortan todo el tiempo y el audio esta muchas veces desfasado con respecto a la imagen, lo cual las hace bastante confusas. Ademas consisten basicamente de musso leyendo lo que aparece en pantalla: malas.', '5905e5fa-9ac0-4eb9-9586-99c66b035c6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Un genio! esta un poco loco, pero en el buen sentido. Preparate para tener un grupo de whatsapp bastante intenso y que te consuma bastante tiempo. de todas formas, musso siempre esta para ayudarte hasta fuera del horario de clases. Me cole varias veces en sus otras materias para que me ayude con mi plaqueta. Lo recomiendo!', '5905e5fa-9ac0-4eb9-9586-99c66b035c6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Sus clases se basan principalmente en ir punto por punto de las guías de ejercicios repasando los temas de la clase teórica en el proceso. A veces se confunde con algunas cosas pero no le molesta en absoluto que lo corrijan y tampoco le molesta intercambiar ideas sobre cómo hacer los ejercicios, aunque sea difícil de explicar de manera virtual. En mi opinión, muy recomendable.', 'f817d2d5-94ef-4755-8ea8-93605a5f94b6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Suele ser considerado el peor curso de Técnica Digital. La realidad es que Perfetto al principio de la materia se hace literalmente uno por uno todos los ejercicios de la guía. Después le empieza a dar más paja pero te da ideas de cómo resolver la totalidad de las guías. El chabón llega media hora tarde siempre y si termina la guía se va 1 hora antes. El parcial de Técnica Digital va a ser el parcial más fácil de toda tu carrera, incluyendo quizás al CBC. Para el final en realidad tenés que estudiar de lo que da en clases Fuchs, así que tampoco es tan grave que no te hagan toda la guía en la práctica. El problema principal de Perfetto es que para el TP final (el único TP de la materia) te manda a hacer algo específico (no te deja elegir como otros cursos), le parece que es algo fácil y te lo explica en teoría pero de ahí tenés que ir vos a comprar un Protoboard, ver los data sheets de los componentes y ponerte a enchufar cables para proto en el Protoboard. Es un salto importante si no sabés nada de electrónica de antemano, supongo que si venís de una técnica o ya hiciste Intro, F2 o ADC es bastante más sencillo.', 'f817d2d5-94ef-4755-8ea8-93605a5f94b6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Perfetto es un muy buen docente, explica muy bien y literalmente va ejercicio por ejercicio de la guía explicandolo. Además, si tenés dudas o lo que sea te lo explica con la mejor de las ganas.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente y bien predispuesto, al igual que Musso y Pablo Paiva!!!', '8548a0f5-a1fd-4f48-89d0-8bfccc175fc0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'El más participativo y con más predisposición de los 3 profesores de la práctica (por lejos). Siempre esta en horario o incluso antes y te ayuda con todo lo que le preguntás ya sea presencialmente o por mail/whatsapp y si no entendés te sigue explicando hasta que lo hagas.', '8548a0f5-a1fd-4f48-89d0-8bfccc175fc0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Buen docente! Al igual que Pablo Paiva!! Siempre están también para contestar dudas!', '8548a0f5-a1fd-4f48-89d0-8bfccc175fc0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Capo, al igual que Paiva', '8548a0f5-a1fd-4f48-89d0-8bfccc175fc0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Pablito presente en todas las prácticas (que fueron a las 8 los viernes, no a las 7 como figuraba en campus. Le pone onda. Es el único que contesta los mails y las consultas por mail. Al final del cuatrimestre se desborda un poco así que dejo de contestar mails a menos que fueran imprescindibles. ', '8548a0f5-a1fd-4f48-89d0-8bfccc175fc0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Excelente ayudante. Muy buena predisposición.', '8548a0f5-a1fd-4f48-89d0-8bfccc175fc0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Siempre a disposición de los alumnos, muy claro en sus explicaciones.', '8548a0f5-a1fd-4f48-89d0-8bfccc175fc0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Muy buena predisposición para ayudarte a armar las placas y resolverte todas las dudas tanto personalmente como por el grupo de wpp.  ', '8548a0f5-a1fd-4f48-89d0-8bfccc175fc0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Como el curso es semipresencial, no hay clases teoricas. Los ayudantes estan para responder consultas por wpp o en en persona los sabados que toca ir. nada wow', '8548a0f5-a1fd-4f48-89d0-8bfccc175fc0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Explicaba como si ya supieras los temas antes de verlo en la teórica. Y no explicaba de forma muy clara tampoco.', '2ab7ae94-722d-42ac-95ac-05a5d6ab5202');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Puede llegar tardísimo sin mandar mail ni avisar.', '2ab7ae94-722d-42ac-95ac-05a5d6ab5202');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Manejaron la virtualidad como unos campeones.', '0d639562-6c72-4101-ac27-f62d4f26d181');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Muy recomendable!', '137cad14-c55c-45e1-9455-f0fc5b361ec2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'No hay clases practicas, da powerpoints. En los tps la nota minima es 4, siempre los aprueba. La verdad que te la hace bien facil, si queres aprender por ahi te conviene otro curso, si queres aprobar metete en este', '80c5485a-20d7-4675-87c2-83659954f872');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un amor de profesor, muy atento. Se nota las ganas de enseñar que tiene.', '11873b35-a4e0-4466-8674-af4f02144ee7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2018', 'Clases super inecesarias, ademas de aburridas. Con una buena practica se puede obviar completamente la teorica. El final toma siempre lo mismo, suele repetir el examen durante las 5 mesas seguidas', '11873b35-a4e0-4466-8674-af4f02144ee7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Rosa es muy copado, y le pone toda la onda mostrando los instrumentos y cómo se usan c/u. También responde sin problemas dudas de la guía de ejercicios (que no hace falta hacerla, se puede practicar directamente de parciales viejos).', '11873b35-a4e0-4466-8674-af4f02144ee7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Yo me saco el sombrero. ES TODO UN SEÑOR PROFESOR ROSA. Muy educado el señor!!!! Y también el dominio que tiene con la tecnología es de admirar. Se hace muy llevadera. Hay pdfs, y hasta los videos teóricos grabados, tenes todo!! Quizás es embolada la materia, pero es re tranquila. Me habré quedado 30 min después de clase (en meet) solo para que me explique un ejercicio, es crack. A VECES ni te hace falta ir a su clase, por estar grabada. Pero andá... vale la pena ir.', '11873b35-a4e0-4466-8674-af4f02144ee7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Yo me saco el sombrero. ES TODO UN SEÑOR PROFESOR ROSA. Muy educado el señor!!!! Y también el dominio que tiene con la tecnología es de admirar. Se hace muy llevadera. Hay pdfs, y hasta los videos teóricos grabados, tenes todo!! Quizás es embolada la materia, pero es re tranquila. Me habré quedado 30 min después de clase (en meet) solo para que me explique un ejercicio, es crack. A VECES ni te hace falta ir a su clase, por estar grabada. Pero andá... vale la pena ir.', '11873b35-a4e0-4466-8674-af4f02144ee7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'Un genio Fabri. Fue el que ayudo a mi grupo de TP y siempre estuvo para darnos una mano, tanto en clase como por mail. Ademas, previo al parcial, me respondió muchisimas dudas sobre assembler (hasta ejercicios con los que habia practicado). Muy groso.', 'dfe4a6cf-1930-4ae2-b347-fe6f444aa136');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'El tipo es el que mas onda le pone a las clases, sabe bastante y siempre responde almenos por github que es por donde nos comunicamos, solo para los tps.', 'dfe4a6cf-1930-4ae2-b347-fe6f444aa136');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'Muestra diapositivas que son copy-paste de libros u otras diapositivas que no se pueden ni leer aunque estes cerca. No aporta nada, si faltas y lees el libro ya esta.', '5cac1038-8202-44fe-9df8-1eb6c0738739');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Da las clases con unos powerpoints que después sirven para estudiar para el final, si bien tienen muchas cosas repetidas. Muchos (incluyéndome) terminaban la materia sin ir a las teóricas desde algún punto ya que daba un montón de información no muy conceptual que no podías absorber en la clase, así que sencillamente te enfocabas en el proyecto y estudiabas para el final.', '5cac1038-8202-44fe-9df8-1eb6c0738739');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Sus clases son un poco aburridas. Para la cursada no te sirve mucho pero en los finales toma lo que el explico.', '5cac1038-8202-44fe-9df8-1eb6c0738739');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Las clases son una charla de 2 o 3 horas con unas diapos de base. Son bastante llevaderas y si no faltas a cursar con repasar un poco cada diapo ya estas listo para dar el final', '5cac1038-8202-44fe-9df8-1eb6c0738739');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Cada clase muestra 1k de diapositivas y encima repetidas, te dormís. Podría ser más aprovechable ese tiempo. Las clases teóricas van para el final, en la práctica se ve lo suficiente para aprobar el parcial, al menos con Stola. ', '5cac1038-8202-44fe-9df8-1eb6c0738739');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'La verdad uno termina faltando a sus teoricas y estudiando del libro, no por ser malas sino por ser demasiado largas y llega un momento en que literalmente te dormis.', '5cac1038-8202-44fe-9df8-1eb6c0738739');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica diapositivas los dias viernes, supuestamente iba a grabar las clases. Pero nunca las subio. Las clases normalmente terminan un poco antes. ', '5cac1038-8202-44fe-9df8-1eb6c0738739');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'No me parece mal docente, de hecho tiene toda la predisposición. Lo único que creo que habría que mejorar es poner ejemplos de aplicación. La materia esta muy dada como un curso de AVR, yo daría parte en assembly pero solo los primeros tps, despues dejaría que los hagan en C porque se labura con C no con assembly.', '5cac1038-8202-44fe-9df8-1eb6c0738739');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Nunca lo vi explicar algo a este', 'e9daf621-7857-4dbd-8b49-2bedcc1a4ef3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Su actitud parece un profesor de secundaria que no tiene ganas de dar clases, bastante amargo. Sabe, pero podría aprovecharlo más. Está todo el tiempo con el celular.', 'e9daf621-7857-4dbd-8b49-2bedcc1a4ef3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'no participo mucho en clase solo comentarios menores, pero parece corregir bastante heavy', 'e9daf621-7857-4dbd-8b49-2bedcc1a4ef3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'no me gusta mucho el trato. sabe pero no me gustaron algunas intervenciones. ', 'e9daf621-7857-4dbd-8b49-2bedcc1a4ef3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'No tuve mucho trato con el (y no da clases) pero me parecio muy buen docente, responde lo que le preguntes con buena onda y te ayuda con todo. ', 'd48f4062-ec9d-40d8-905e-a579d8c17acc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Las clases son siempre una introducción a los tps. Si le preguntas algo se copa en responderte hasta que se entiend, pero si no las clases son de 15 min, te explica un cuadro o un diagrama de flujo y listo', 'd48f4062-ec9d-40d8-905e-a579d8c17acc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Excelente docente, corrige los tps exhaustivamente', 'd48f4062-ec9d-40d8-905e-a579d8c17acc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Se ocupaba de explicar los tp's y hacer una mini introducción teórica de los temas. Al principio nos brindaba ejemplos de código para avanzar con los tp's, para luego seguir mas por nuestra cuenta. Se le entiende bien lo que explica, no tiene drama con que preguntes, las clases se graban y suben al classroom.', 'd48f4062-ec9d-40d8-905e-a579d8c17acc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'Nose porque esta en la materia realmente. Va, se sienta con la computadora o el celular y no aporta nada a la clase mas que algun chiste o comentario innecesario. Si le preguntas algo, te responde cualquier cosa, pero cualquier cosa eh. Por suerte es como si ni estuviera en la materia, ya que no corta ni pincha.', '4a68969e-3dab-4eae-8170-6c7b12ccbfa6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'El tipo te responde cuando estas en horario de clases, responde bien ayuda bastante pero fuera del horario de clases no existe, si te toca como corrector de tps anda haciéndote la idea de que nunca te va a corregir nada.', '4a68969e-3dab-4eae-8170-6c7b12ccbfa6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'A veces un poco se marea con las explicasiones pero siempre termina respondiéndote, eso si se toma su tiempo, pero es un tipo que va a hacer lo posible por sacarte la duda.', '079275cc-1d96-4401-8143-48170c233272');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Junto con Gabriel explican bien pero todas las clases un alumno presenta pantalla y hace un ejercicio con otros alumnos en vivo. Entonces, como el alumno a presentar pantalla es elegido al azar, cuando no esta muy metido en el tema la clase se hace eterna.', 'defbb97e-8d12-4bd3-87f6-860d6183fe3f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'el 80% de las clases son virtuales. Explica mas o menos bien y le pone onda al principio, pero si no participa nadie en clase te hace compartir pantalla y te pone a programar. Para las correcciones de los tps a veces se pone un poco detallista pero te explica las cosas bien y con onda.', 'defbb97e-8d12-4bd3-87f6-860d6183fe3f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Fue mi correctora de tp durante el cuatrimestre, explica bien. Trata de que todos participemos y hagamos ejercicios en clase. Esta practica te deja bien preparado para el parcial, el cual todos aprobamos en la primera oportunidad. ', 'defbb97e-8d12-4bd3-87f6-860d6183fe3f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'explica bien pero no tuvo muchas intervenciones, si comentarios que aportan a la clase. ', '9fb5daed-99f9-49b5-aa69-4a77b0339224');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Lo principal en la materia es el proyecto, y Stola no te ayudaba demasiado. Si le preguntabas algo te decía básicamente que te arregles vos o "hay muchas formas" sin explicar ninguna. En la entrega ni leyó el informe, y nos aprobó a todos con la misma nota sin importar el resultado del TP (el nuestro estaba claramente peor que otros y salimos todos con 8).', '4741a773-25cb-4d08-ac9a-8ab45b625c0a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Buen tipo, macanudo, se le puede consultar sobre cualquier cosa. Da lo necesario para el parcial y poco para el trabajo práctico. En cuanto al TP no te ayudan tanto, te dejan que investigues y labures sólo, están para hacer consultas generales o ayudar a tomar decisiones.', '4741a773-25cb-4d08-ac9a-8ab45b625c0a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'quisiera que dedicase el tiempo fuera del horario de clase para corregir tps, corrige solo en el horario de clase practicamente :( estuvieron explicando las cosas muy por arriba, las clases duraban media hora o como mucho una hora, tuve que complementar con claess de otra catedra para poder entender los tps y los temas, donde si daban 3hs de clase', '4741a773-25cb-4d08-ac9a-8ab45b625c0a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'no me puedo quejar de stola pero porque le pone ganas a contestar dudas, en la clase no se organizo muy bien, queda como un taller para recursantes mas o menos. eramos poquisimos.', '4741a773-25cb-4d08-ac9a-8ab45b625c0a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Buen profe explica bien y sabe que algunos tema no son tan interesantes e intenta darle un poco de interes
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es buen docente. La metodologia de la materia es no dar clases, sino exponer semana a semana avances del proyecto por lo que se me hizo un poco complicado ponerle puntaje a algunos items. Siempre esta dispuesto a responder dudas, pero por mail nunca responde. Igualmente no es mal docente. De las 3 horas esta 1 hora y media, 2 a lo sumo.', '98a6d9fd-558b-4668-9276-2867cefb4d66');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Este docente a veces estaba media hora porque decia que se tenia que ir "a otro trabajo". Es bastante agresivo y cerrado, ya que si las cosas no son a su forma no le parece que esten bien. No significa que no vayas a aprobar, porque es mas dificil desaprobar que aprobar en esta materia, pero es molesto que este constantemente pidiendo cosas que no tienen demasiado sentido (incluso el otro docente cuestiona que no tienen sentido, pero cual Macchioni se va, como si le tuviera miedo, debe ser porque es agresivo).', '98f10c92-b403-490e-aac6-8d98b4877e4d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy dinamico, da un proyecto al principio de cuatri y elaboramos todo el proceso para elaborarlo desde tomar decisiones hasta presentarlo para un cliente, todas las semanas hay algo para llevar y te da feedback durante la clase. Normalmente son virtuales pero elegimos algunas fechas especificas para hacer presencial.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Mal docente, siempre da clases tipo de simulaciones de matlab y simulink, te da ejemplos de como usar cada herramienta por lo que son bastante aburridas las clases y no te sirven para mucho. Corrige los tps como si fuera dios y nunca te explica bien las cosas. Esta siempre al fondo del salon como para responder consultas pero como no explica bien esta ahi re al pedo.', 'cd6814a0-a21f-4914-b1a5-08b31be37d0f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'La verdad que el tipo la tiene clara, sabe de lo que habla y explica bastante bien. Es el único que te ayuda a conectar los temas y entender para que sirven. Lamentablemente dio 2 o 3 clases en todo el cuatri, va siempre pero no se pq las clases las dan los otros 2 tipos que no son muy buenos. Le pone ganas y es el unico rescatable de la materia, si tienen la chance díganle que de todas las clases el. En la practica te hace hacer 2 tps medios largos sobre los temas de la materia, básicamente en siempre lo mismo a si que es medio copiable pero es en el único momento en el que practicas las cosas que dan en la materia. Tenes como un mes y medio para cada uno, no molestan mucho con las fechas y te valla bien o mal no te va a la nota de la cursada ni sirven para aprobar, es solo una forma de hacerte laburar.', '817fc125-df42-4273-adc0-5472b16ea6e0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Durante sus teóricas no se entiende exactamente qué está dando a veces; como si diera las cosas por arriba. Los parciales y finales son accesibles pero hay que saber los conceptos ', 'd7d08a61-fddf-406d-8bc5-195523a2923f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Sellerio es buen docente, dio teman en Control 1 que ayudaron a entender en Control 2 y la tenia re clara. Quiza a veces se hacia algo monotona la clase, pero quizá era por la hora.', 'd7d08a61-fddf-406d-8bc5-195523a2923f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Sellerio da las teóricas y toma el final tambien. Yo la cursé en la virtualidad pero el final fue presencial asi que aplica para la vuelta a la presencialidad. No suele tomar cosas complicadas, es bastante conceptual lo que pide lo cual demanda tener una buena base de los conocimientos teóricos', 'd7d08a61-fddf-406d-8bc5-195523a2923f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Da las teoricas, explica mas o menos bien pero las clases son medio desorganizadas y aburridas(por lo general nadie va a cursar, con leer el nise seguro aprobas y safas de las clases). Explica todos los temas de la materia y busca que relaciones todas las cosas que vez, pero es medio enquilombado y te re perdes, terminas la cursada sin entender para que sirven mas de la mitad de las cosas que explica. En mi caso estuve el primer mes y medio sin entender ni de que se trataba la materia ni para que servían las cosas que nos daban ( era algebra y demostraciones). Fui a todas las clases teoricas y creo que fue una perdida de tiempo, si lees el nise y vas 1 o dos clases antes del parcial para q te conozca la cara aprobas de una. Ni se gasten en preguntarle pq te entiende cualquier cosa y te explica lo que el quiere y no lo que le preguntas.', 'd7d08a61-fddf-406d-8bc5-195523a2923f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La practica fue darnos ejercicios para presentar, hagarran una guia de ejercicios y reparten ejercicios, para la siguiente clase. Terminas aprendiendo bien el tema que te toca pero el resto de los ejercicios es un poco mas dificil de entender. ', 'd267bf97-4c08-4d20-9ae2-5a8736572608');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La practica fue darnos ejercicios para presentar, hagarran una guia de ejercicios y reparten ejercicios, para la siguiente clase. Terminas aprendiendo bien el tema que te toca pero el resto de los ejercicios es un poco mas dificil de entender. ', '1be0a324-61bb-4a4b-998c-9ac48f75354f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Silvia dio algunas teóricas y presentaba los TPs que resolvimos a lo largo de la cursada (fueron 2). Sus clases si bien estaban bien explicadas, se hacían un poco densas por el contenido teórico y la velocidad en que las exponía. De todas formas, en el final te ayuda si tenes alguna consulta o duda sobre los ejercicios así que es copada y tampoco tengo críticas.', '1be0a324-61bb-4a4b-998c-9ac48f75354f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Marrone es el jefe de cátedra, suele dar algunas teóricas y arma los finales. En la virtualidad fue muy amena la cursada, con varias clases donde exclusivamente hacía a los alumnos exponer ejercicios de las guías resueltos por ellos mismos. Es muy amable y cero críticas. ', '6efb20ee-2d9b-475b-864b-a685e1601e2a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Sus teóricas son en el pizarrón y a veces medio desorganizadas, como si no hubiera preparado del todo la clase. No es mala persona y tiene ganas de que aprendas pero sus clases terminan volviéndose aburridas y de cualquier forma sólo son un complemento del libro, el cual vas a tener que leer si o si, vayas o no vayas. Por este motivo no va casi nadie.', 'fba34368-b3bb-4dd3-89f9-639a8d70487d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Sus prácticas son útiles porque hace un resumen de todo y te va tirando las cosas claves que tenés que saber. Pero esto dura ponele la mitad de la clase, después te dice "ahora pónganse a resolver la guía y atendiendo consultas". De todas formas recomiendo ir.', 'd635f9b9-988a-4ef0-9eb8-cb9748d7d906');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Carbonetto es medio lento explicando, pero es sencillamente genial. Es un docente con todas las letras, que no presenta puntos flojos en ningún aspecto. No solo hace que uno esté al día recordando cómo viene el calendario y sugiriendo qué ejercicios hacer, sino que tiene una predisposición inmensa y es capaz de quedarse (al menos) una hora después de finalizada la clase para responder dudas.', '8602894d-9cc8-4205-a9ce-abb5ea489de4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Gran profesor, explica muy bien, responde todas las consultas de la mejor manera.', '8602894d-9cc8-4205-a9ce-abb5ea489de4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'EXCELENTE docente para dar la teórica. a veces va un poco lento pero se entiende perfectamente y no tiene problemas en responder las dudas. Muy puntual y dedicado a la materia. Muy buen trato con los alumnos.', '8602894d-9cc8-4205-a9ce-abb5ea489de4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Lo mejor que hay, debería dar la teórica', '8602894d-9cc8-4205-a9ce-abb5ea489de4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'El mejor docente, explica lo que le preguntes todas las veces que necesites y con muy buena predisposición. Es muy claro y sabe un montón.', '8602894d-9cc8-4205-a9ce-abb5ea489de4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Simplemente MAL docente. Posee una actitud soberbia y sobradora hacia los alumnos, es lo opuesto  a lo que la facultad necesita.  No dudo en que sabe los temas de la materia pero no sirve para nada si no sabe tratar con alumnos.  Antes de conocerlo pensaba que este tipo de actitudes solo ocurrian con docentes antiguos  y que iban quedando atras en el tiempo por los recambios generacionales, pero este docente es la prueba que los docentes jovenes tambien pueden ser nefastos para con los alumnos. Quitan las ganas de cursar ', 'f9ccbf97-a79f-4a94-93af-7d1890d20d82');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buen docente Colo!', '08a0a7e0-406d-440e-a9d5-42f13d79a6c5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'El Colo. Un genio, explica excelente, te responde todas las consultas que mandas al mail.', '08a0a7e0-406d-440e-a9d5-42f13d79a6c5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy buen docente el Colo. Responde casi todas las dudas por mail, explica muy bien. La tiene bastante clara.', '08a0a7e0-406d-440e-a9d5-42f13d79a6c5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es el de la practica, siempre se presentaba a clases y respondía dudas y a veces por petición de los alumnos resolvía ejercicios de la guia en clase.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es un tipo que tiene buen trato con sus alumnos, siempre te responde de una forma que entiendas la verdad bastante bien.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Va solo dos clases para explicar VHDL y nada mas. No explica ni bien ni mal.', '2a8492ed-eb52-4249-ae2b-9c1b3df905d7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'dio las dos clases de vhdl, solo aparecio para eso. la idea de la materia es justamente que sea como un curso o taller. no evalua vhdl en el parcial pero si pide para hacer el codigo de tp.', '2a8492ed-eb52-4249-ae2b-9c1b3df905d7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Las clases duran solo 40 minutos y el parcial tenes una semana para resolverlo. La verdad que los temas no valen la pena salvo VHDL que no lo explica el. Es una materia para robar nada mas, no te llevas nada útil. Es medio polémico corrigiendo pero aprueba a todos. Varios ejercicios estaban igual resueltos y a un alumno le puso bien y a otro mal. Igual no le puse a nadie menos de 7.', '3d5fa616-7895-448b-ba64-ca4e99a7ef49');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Da clase una hora sola. Es una materia pensada para quien quiera profundizar un poco mas de tecnica digital, no esta pensada como una materia pesada ni nada por el estilo. Es leer los pdfs y hacer algun que otro ejercicio de la guia, con eso estas re bien.', '3d5fa616-7895-448b-ba64-ca4e99a7ef49');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La verdad un excelente docente. Tiene fama de forrearte al evaluar pero para mi simplemente es exigente. Le pone mucha onda a la materia y sabe un montón de temas relacionados a la misma.', 'af1d54d8-2b26-476d-8e17-e439ce636d84');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Daniel es un viejo un poco cascarrabias y un poco sobrador pero no encontré una mala intención es un forma de ser. Es un poco menos desastroso que Zothner en terminos de organización pero por lo menos no te trata para el culo.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Las clases que daba el eran una videollamada de 3 horas, básicamente lo que hacia era obligar a que un alumno comparta pantalla y lea en voz alta(traduciendo del ingles al español) unos archivos de 80 hojas. Cuando no tenia ganas de dar clase o se daba cuenta que nadie le daba bola se ponía a mostrar la imágenes de esos archivos y preguntaba que eran, le leías el pie de la imagen y seguía con otra cosa. Nunca dio un clase o explico un tema. De vez en cuando se ponia a quejarse de que la materia estaba super desorganizada y que sabia que era una perdidia de tiempo ir a las clases pero no hacia nada como para cmabiar las cosas. Lo peor de todo es que te hacia escribir una BANDA de informes de cualquier cosa(por lo general uno de cada tema que "daban " en la materia) y nunca los leia ni corregia a si que los hacías al pedo. Como Zhotner se jubila creo que queda a cargo de la materia pero no es para nada recomendable este tipo.', '8509fe2a-87b8-457c-b54f-ff5c0f33d3db');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Durante el cuatrimestre que la hice fue a todas las clases y cumplió su horario. Tiene un buen trato con sus alumnos, y al menos en el que yo la hice (que eramos solo 2 alumnos) estuvo muy encima nuestro. Explica de forma muy clara todos los conceptos y se mete mucha mano en los instrumentos, cosa que esta bueno porque algunos problablemente no los vuelvas a usar en la vida, pero conocerlos es interesante. El parcial que tomó tenia parte teórica y parte de usar el instrumental (una medición senscilla con osciloscopio y medir parametros de una señal que no conociamos con el analizador de espectro (era una señal de FM) para el primer parcial, y en el segundo era práctica de reflectometria en el tiempo). Tambien es muy atento a los mails, y siempre que va a faltar avisa con tiempo y se reprograma la clase. Lo recomiendo', '819357e5-748e-4cc6-92ae-f14ede01ea78');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No fue mi profesor favorito de la cursada 1C 2020. Falto varias veces a clases y a las teoricas nunca fue (creo que tuvo una situacion personal). Si bien sabe mucho, a veces daba impresión de prepotente y un poco mala onda. Igual es buen docente en tanto que conoce la materia en su totalidad y tiene disposición para enseñar y responder consultas.', '819357e5-748e-4cc6-92ae-f14ede01ea78');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Enrique de 10 como docente. Siempre contestaba todas las dudas y nos daba contenidos clave para el exámen. En las prácticas era muy divertido tenerlo de profesor y al final del cuatri nos llevó al INTI de excursion. Un capo.', 'ebad3a67-a6f5-45ca-af61-999f007e6bd4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Como acá se puede usar cualquier vocabulario voy a decir lo que todos pensaron cuando cursaron con Zothner. Es un hijo de puta, sus clases son desorganizadas para la mierda y trata de boludos a los estudiantes que sorprendentemente están aprendiendo una materia con temas que nunca vieron antes.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'En pocas palabra es un verdadero hdp, no explico un solo tema en todo el cuatrimestre. Las clases eran ir a hablar boludeces con el tipo por 3 horas y bancarte que te pregunte cosas que ni sabias que existian. Nunca arranco una clase explicando un tema, solo pregunta ( y pregunta de forma re confusa y nunca terminas de saber que te quiere preguntar) y se queja de que no sabes nada y que nadie estudia. De la uncia forma que logra que algún alumno aprenda algo es haciéndote leer unas notas de aplicaciones bastante complicadas de entender y en un ingles super técnico. Si tuviese la paciencia y voluntad de ponerte a leer esos archivos no te van a servir para nada pq siempre te va a preguntar una cosa super especifica del texto y si no se la respondes te re bardea. En resumen: no da clase, solo pregunta cosas que nadie sabe y te hace perder horas de vida para la aprender absolutamente nada. PD: nunca te deja usar los instrumentos tranquilo, si te ve medio complicado te manda a leer o los agarra el y hace lo que quiere y no te explica nada. Creo que se jubilo a si que no la van a ver mas (tienen suerte)', '2c5af20d-997f-4fa9-a929-7af594115b23');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente, da todos los fundamentos teóricos para entender lo que se va a hacer en la práctica. Siempre responde dudas con la mejor predisposición. Muy buen docente.', '8d0ac7e4-172b-42a2-9ee2-3b62e6c1ca0d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Increible docente, de lo mejor (si no es LA mejor) docente que tuve en la carrera. Asiste a todas las clases y es puntual. Cumple el horario de clase. Tiene un trato EXCELENTE con todos los alumnos. Organiza sus clases de forma de bajar todo lo de la teórica a tierra, y poder aplicarlo, haciendo un breve repaso de ella. Esto lo hace con un talento increible, ya que podes no haber entendido mucho en la teórica pero ella hace que entiendas todo. Fomenta que uno participe en clase para ver que dudas nos quedaron. Ademas, comenta sobre otras areas donde se aplica lo que vemos en clase. Y ahora viene lo mejor, no solo explica excelente, sino que te responde TODAS las dudas que tengas con los tps, TODAS, y no solo en persona, sino por mail. Si, se lee todo tu codigo de Matlab y te manda una captura de la linea que tenes mal explicandote porque lo tenes mal (ya sea error en el codigo, o error teórico). Una grosa.', '1c231182-90ae-478d-80db-11d311e8db79');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Transmite lo importante e interesante que es la bioingeniería.', 'eaaa2f85-ccb3-4dcd-b3e7-ff825570def1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Fabián es buen docente pero en la virtualidad sus clases no se aprovechaban del todo. Se reducían a él leyendo un powerpoint minimalista, es decir, sin las explicaciones de Fabián era un gráfico o texto muy poco explicativo. Y al no grabarse las clases resultaba muy dificultoso estudiar por nuestra cuenta sin tener que recurrir a la bibliografía aportada (que era un montón).', 'eaaa2f85-ccb3-4dcd-b3e7-ff825570def1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'La materia fue un desafío enorme, pero en pocas sentí haber aprendido tanto como en esta, pensar que hace unos meses no sabía que era una célula! Incluso me ha hecho repensar a la Ing Electrónica. Gracias por tu dedicación y esfuerzo, de verdad MUY buen trabajo.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Todas las clases de la segunda parte de la materia estan a cargo de el. Durante esta parte, los temas son mas de cosas aplicadas digamos. Hay un tp, que cuando yo la hice era analizar señales cardiacas de pacientes con epilepsia usando el HRV Kubios, y cuando uno le preguntaba dudas siempre la respuesta era "lean" o "investiguen", pero se aprueba muy tranqui. El parcial esta a cargo de el, y es un multiple choice que creo que no varia demasiado. En ese parcial te toma TODO lo que da el, incluso esas cosas que dice al aire que capaz parecen al pedo, por lo que recomiendo prestar atención en sus clases (y conseguirse los choices viejos tambien). ', 'eaaa2f85-ccb3-4dcd-b3e7-ff825570def1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muchas gracias por el esfuerzo y dedicación como profesor! Se refleja en la calidad de las prácticas y se agradece mucho. ', 'eaaa2f85-ccb3-4dcd-b3e7-ff825570def1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Esteban es un tipazo. Sus clases teóricas son muy amenas, para nada pesadas y siempre intenta que podamos hacer la interconexión entre todos los temas de la materia, ya que luego en el final hace preguntas acerca de esto. Cero críticas, un excelente docente.', '83c62bf8-89c6-4b2d-991b-a1101e41c1db');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Si bien tengo muchas observaciones para mejorar, que dejaré en la encuesta, la verdad es que me voy muy contento.', '83c62bf8-89c6-4b2d-991b-a1101e41c1db');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'No va a todas las clases, sino que se las reparten entre todos los docentes. Despues del primer mes no lo ves mas. A todos les parece un genio a mi sinceramente me parece medio pelo/malo. Da 1/2 clases, despues el resto reparte papers entre el curso, te los hace leer e investigar y a la otra clase le tenes que explicar a los demas lo que leiste. Esto podria estar bueno si sabes los temas, pero si nunca en tu vida tuviste biologia y tu primer encuentro con ella es la reprogramación celular de celulas de ratas en cardiomiocitos, la verdad que no esta bueno (y tampoco es muy provechoso, gran cantidad de las cosas te las perdes).  El final te lo toma el y suele ser un oral donde tenes que explicar un paper pero ir sabiendo todos los temas de la materia (donde algunos ni se ven en clase pero como estan en el programa te los hace estudiar).', '83c62bf8-89c6-4b2d-991b-a1101e41c1db');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica muy bien. Sube videos teóricos todos los martes y las clases de los lunes son para discutir o preguntar sobre esos temas y sobre los TPs. Una materia que realmente vale la pena. Si bien tiene bastante teoría, todos los tps son prácticos y se acercan bastante a algo profesional.', '30b9772a-6596-49fd-8095-9e91481facec');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'La tiene atadisima con todo este tipo, excelente docente con excelente predisposición para consultas.', '8ddd23f0-eafc-48ad-ad38-7af1c7eeb7ad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'De lo mejor de la materia, le preguntas alguna duda y te responde con la respuesta de un ingeniero y no un técnico audivisual. Sabe muchisimo.', '8ddd23f0-eafc-48ad-ad38-7af1c7eeb7ad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Un capo, pero a veces tiraba referencias a santiago maldonado durante la clase o algun comentario kirchnerista. Igual todo bien porque es un tipazo y la tiene muy clara con los temas. Si no sabe algo no manda fruta y dice la verdad.', '8ddd23f0-eafc-48ad-ad38-7af1c7eeb7ad');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Un grande Dani. Explica muy bien y sabe muchisimo, no solo de temas de electroacústica, sino de electrónica en general. No te mata con las correcciones y si estas interesado en el tema aprendes muchisimo. Tiene un flequillo como el de el Duki.', 'a203d1d4-bdf1-4c0b-abe1-ea286aea2fee');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Sabe los contenidos de la materia, se nota que tiene experiencia. A mi parecer no logra reflejar su experiencia en la materia, sus clases parecen mas orientadas a diseño audiovisual que a la ingenieria, es muy empirica (todo por experiencia de el, no esperen que adquieran experiencia en la materia) y personal (muchas anécdotas). En lo personal no me gusto el enfoque de la materia, salí igual que como entre a la materia.', 'a203d1d4-bdf1-4c0b-abe1-ea286aea2fee');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Un gran docente. Sabe muchísimo y responde todas las dudas, incluso de otras materias. Muy recomendable.', 'a203d1d4-bdf1-4c0b-abe1-ea286aea2fee');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Las primeras pocas clases fueron buenas, el resto fueron un desastre. Las primeras presenciales fueron muy claras, el resto que fueron virtuales (la gran mayoría de las clases) fueron más clases de consulta que otra cosa. Igual que en las clases de Mazzeo, cuando hacían preguntas respondían pocas personas o nadie, en ese caso en lugar de explicarlo más claro se enojaba.', 'd8daecda-f040-4e25-8b96-820221246e90');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy mala onda generalmente. Si bien fomenta la participación y pide que preguntemos hasta que entendamos, no te dan ganas de preguntarle nada porque dan miedo sus formas. ', 'd8daecda-f040-4e25-8b96-820221246e90');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Y la verdad que un tipo respetable. Impone autoridad y explica muy bien. La tiene clara, lo banco al gran hombre.', 'd8daecda-f040-4e25-8b96-820221246e90');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un poco obstinado ', 'd8daecda-f040-4e25-8b96-820221246e90');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Explica poco, charla mucho.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Te pide que tengas la cámara prendida todas las clases y si no la tenés te llama la atención. Él dio la primera parte de la materia, lo que correspondería al primer parcial.  No explica bien y se va muuucho por las ramas. En el primer parcial teníamos que hacer ejercicios a mano y subirlos al campus. El parcial es aprobable, no te quieren cagar. Recomiendo repasar los ejercicios vistos en clase y el ejemplo de parcial del campus. No salteen las preguntas teóricas de las guías porque puede preguntar de ahí por más que lo haya mencionado en clase en un segundo. Las prácticas no se graban.', '60e8911d-44be-4eb1-ab72-a3ec45320ce5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Hace prender la camara para las clases.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No recomiendo comentar mucho con este hombre ya que si decis algo mal se pone loco y te empieza a forrear. Segun el todos aprueban la cursada, no importa que vayas a recuperatorio ya que siempre aprueban. Hay veces que interrumpe a trinchero sin ningun aporte, solamente para decir boludeces. No tiene un buen trato con los alumnos', '60e8911d-44be-4eb1-ab72-a3ec45320ce5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Pierde muchismo tiempo charlando sin decir nada importante', '60e8911d-44be-4eb1-ab72-a3ec45320ce5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Daniel Trinchero es el que da casi todas (por no decir todas) la clases de la práctica. Lee unas diapositivas que se envían después de la clase y usa Jamboard a modo de pizarrón para ir resolviendo ejercicios. Daniel Cabibbo (que es el JTP) suele pedir que TODOS tengan la cámara prendida. En cuanto a la forma de evaluación: hay varios parcialitos multiple choice durante la primera parte de la materia y un 'parcial' de 45 min. un poco mas parecido a un parcial común (a desarrollar) pero que de todas maneras es muy accesible. Para la segunda parte hay directamente un parcial de 45 min. multiple choice que es muy fácil si se sigue un poco la materia.', '60e8911d-44be-4eb1-ab72-a3ec45320ce5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'No dio este 2C2020 las clases, bah.. solo dio la clase de compiladores. Pero según dijo él: "se turna con Trinchero por cuatrimestre" o eso entendí yo.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Dió muy pocas prácticas. Durante el 2C2020 fue Trinchero quien llevó adelante las prácticas, Cabibbo agregaba algún comentario cuando le parecía necesario o cuando había poca participación. A veces puede irse un poco por las ramas pero se aprende y no busca complicarle la vida a los alumnos.', '60e8911d-44be-4eb1-ab72-a3ec45320ce5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'De los peores docentes que tuve. Repitio 479546 veces para que servia la materia sin explicar nunca nungun contenido. Perdia todo el tiempo repitiendo eso o llendose por las ramas.', '60e8911d-44be-4eb1-ab72-a3ec45320ce5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'No dio ninguna clase durante el cuatri, comentarios sobradores pero sin malas intenciones, si sabes q vas a decir una burrada mejor no digas nada . Exigente en la corrección del primer parcial, los parciales son fáciles pero no tolera errores. En el recuperatorio me fue mal pero me perdono la vida, así q un punto a favor del Cabbibo', '60e8911d-44be-4eb1-ab72-a3ec45320ce5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'A veces vale la pena escucharlo porque amplía en el tema y si te interesa está bueno, pero se suele ir de tema muy rapido, y a veces no incita a hablar porque tenes miedo que se pueda ir por las ramas y se termine perdiendo gran parte de la clase. Tiene un aire a Ferrini
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Tiene una personalidad muy particular que hace que no tengas ganas de ir a sus clases o de participar en ellas. Explica los temas muy en el aire y no siempre le entendes. Además, es dificil que acepte que se equivoca', '60e8911d-44be-4eb1-ab72-a3ec45320ce5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Igual que Novodvoretz. Explica muy bien, tambien merece ser JTP titular. Muy buen trato con los alumnos.', '00226bd5-571e-4532-bb7b-fce3642b6aca');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Él no explicó mucho, lo que explicó de memoria la última clase no fue muy claro.', '00226bd5-571e-4532-bb7b-fce3642b6aca');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'NGutier es un gran docente, se nota que le gusta enseñar. A veces se lo notaba medio perdido pero siempre fue muy amable y predispuesto a explicar.', '00226bd5-571e-4532-bb7b-fce3642b6aca');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No sé, nunca lo diferencié de Novodvoretz. No se parecen en nada, pero como Burin es dueño y único amo de la computadora y su estructura, pasan a quedar en segundo plano gutierrez y novodvoretz. De todas formas, muy buenos profes y de buen trato. Me gustó la cátedra.', '00226bd5-571e-4532-bb7b-fce3642b6aca');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Presta atención a sus clases por mas dormido que te quedes, porque lo que da casi que no lo encontras en otro lado!!!!', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Mazzeo un buen docente, muy muy atento a las consultas que surgen, escuchando y dejando desarrollar la problemática sin interrumpir de por medio.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'En este cuatrimestre, tuvo mala conexión en la primera mitad. También suele dar clase pasándose la hora, pensarlo bien antes de meterse otra materia en el horario en que termina esta. En el resto 10/10', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Sus clases se entienden, a veces se vuelven un poco embolantes. Da las clases con un ppt y cuando quiere hacer algo a mano orienta la cámara a una hoja que se ve más o menos pero está bien. Si ves las clases grabadas por ahí queda muy chiquita la imagen de la cámara como para que se entienda. A veces deja algunos conceptos sin cerrar, recomiendo leer el Murdocca cuando sucede. ', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Buen docente. En el final se pone exquisito para corregir y puede venir con cualquier cosa. Muy buen trato con los alumnos.', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Las clases son aburridas, da de los ppt asiendo alguna que otra aclaración.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Teorica unificada. Clases aburridas a mi parecer. Tuve que re-verlas para el final en velocidad x1.8 y ahi si que le entendí todo y se hacia mas interesante la clase. Sin embargo, es muy respetuoso y paciente con las consultas. Responde todos los mails casi al toque. ', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'En las primeras clases se notaba que le ponía ganas pero al no entender bien su computadora siempre había algún problema que le costaba resolver (o la cámara, o el micrófono, o no podía presentar pantalla sin que falle, problemas varios que iban cambiando a lo largo del cuatrimestre). Además las clases no empezaban en hora, sino que tanto para las clases como para los exámenes había que esperarlo aprox unos 15/20 minutos.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Si bien no hay otra opción para la teórica, Mazzeo es un profesor que se nota que sabe mucho y su intención es enseñarlo. Pero la realidad es que sus clases son muy desorganizadas y da por sentado que uno sabe muchas cosas que no tiene por qué saber, lo que lo vuelve aun más confuso. Es un tipo bastante serio y no siempre agradable, pero sí es muy cordial y respetuoso. Graba las clases (que hasta ahora fueron virtuales), eso es un plus.', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es imposible seguirlo a este hombre, te dormis en cuanto empieza la clase. Da temas que no fueron actualizados desde 1980 mas o menos. Siempre llega tarde y en el final corrige como se le canta ademas de entregar notas en el mismo dia de la proxima fecha, por lo que no te queda otra que estudiar por si llegas a desaprobar porque es bastante impredecible su forma de corregir. El final es un gran "quien se leyo mas el murdocca" ya que pregunta cosas bastante especificas del murdocca, por lo que tenes que leerlo si o si, con las teoricas o practicas es imposible aprobar el final. Despues de una larga espera  para saber si aprobaste te manda un "Estuve viendo tu examen y considero que lamentablemente no estas todavia en condiciones de aprobar la materia.Saludos" sin siquiera mandar una revision. No se puede tener una revision ya que la proxima fecha de final es casi siempre o un dia despues de la entrega de notas o el mismo dia a la tarde, y aunque uno quisiese ver en que se equivoco, el tarda mas o menos un dia en enviarte la correccion del final, para llegar y ver que te pone un MAL en las cosas que te equivocaste sin dar ninguna explicacion. Si tenes un minimo error en el codigo de assembler ya te bocha, no importa que tan bien este la otra parte teorica del final. No acepta criticas ni revisiones del final. En conclusion, es bastante filtro el final ya que no aprueban muchos de los que se presentan.', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La verdad que un genio este hombre. Le gusta enseñar y le sale bien. Lo banco a muerte al anciano tierno.', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El peor profesor de la facultad corrigiendo finales, los devuelve pocas horas antes de la siguiente fecha y no da correcciones ', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2018', 'Clases super aburridas pero fundamentales, a no ser que tengas un compañero que te explique algunos detalles y se puede estudiar todo del libro', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica los temas usando PP. Graba las clases y las manda junto con los PP.', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es super claro para explicar y tiene muchisima paciencia para responder dudas. Sus clases queman un toque el bocho a veces', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Mazzeo da una buena teórica. Pide que algunos prendan la cámara para que se haga un poco mas interactiva la clase. Usa su cuaderno a forma de pizarrón para anotar cuando los temas no quedan claros y utiliza unas diapositivas, que las envía antes o después de la clase, para ir introduciendo los temas que él va detallando.', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'UN embole si no tenias leído para la anterior clase lo dado. Pero si la laburas todos los días a la materia, la podes seguir bien...
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Mazzeo es un buen profesor, explica bien y contesta todas las dudas sin ningun problema. Graba las clases.', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'CAPO TOTAL. Explica super claro. Le recontra interesa que todos aprendan', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Mazzeo muy largas las clases y aburridas, explica bien y un pro es que las clases son grabadas y ante cualquier duda poder mirar las clases. En las clases explica cosas que no estan muy desarrolladas en el Murdocca, por lo cual recomiendo verlas, no se si tomar apunte porque literal que son tediosas de prestar atención, pero para preparar final sirven', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Re buena onda Jorge, te invita a que te equivoques y te animes a participar, no te mata si te equivocas, las clases me parecieron muy muy pesadas, un poco exigente en el final. Es una hermosa materia si te interesa como funciona una computadora por dentro, como hace operaciones, como funciona el procesador, sistemas binarios, hexadecimal, circuitos logicos, asembler. Es una materia que con llevarla al día es suficiente, fué armada en base al libro de murdocca
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Responde todas las consultas (hasta x mail) y conoce muy bien los temas. Lo malo es que es impuntual siempre hasta en los exámenes', '00fae354-b431-4c72-a304-30b4d5e698f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Este cuatri la cosa fue distinta al 1C2022, y para mejor. Mazzeo es un profe que sabe mucho, este cuatri las clases no se trababan ni nada por el estilo, cambio un poco los PPT agregandole algunos detalles clave para aclarar algunas cosas. La materia en general es tranqui, para el primer parcial las teoricas y practicas te alcanzan y sobran para salir bien parado, ya en la 2da mitad de la materia (x lo menos en la cátedra Burin) las clases se caen un poco pero para alguna que otra cuestion sirven, y las teoricas tambien, aunque si o si vas a tener que leer los caps 4 a 7 del Murdocca, por suerte se lee facil. Ahora, el final es otra historia: Suelen ser bastante repetitivos los enunciados, pero tenes que ser el Murdocca en persona, a Mazzeo le gusta que escribas mucho, todo lo que sabes, más allá de lo que te piden las consignas, le tenes que demostrar que entendes a la perfeccion los temas sino estas en una duda eterna para saber si aprobaste o no (dejas una consigna a medias o sin responder y te hace ir la otra fecha), y eso que entrega muy tarde las notas, ponele que 2 dias antes de la proxima fecha, y las correcciones te las da aún mas tarde si te fue mal. Aprovechar las clases para preguntar y sacarse dudas esta bueno ya que este cuatri no las grabo (fueron virtuales las teoricas y las practicas presenciales hasta el 1er parcial), durante la cursada cero quejas, en el final la suerte tiene que estar de tu lado ya que las correcciones son una caja de pandora (te pone MAL y no te dice por qué, basta con unos pocos MAL para bocharte), por suerte no tuve que rendir mas de una vez el final pero conozco mucha gente que por errores en código de assembler (errores pequeños en 1 punto del final) tuvieron que ir a rendirlo de vuelta, ademas si te fue mal en una fecha no te pasa el desaprobado al SIU, asi que tenes más de los 3 llamados habituales. Otra cosa es que suele llegar tarde tanto a las clases como a los parciales/finales, unos 15 minutos aprox
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un genio. Explica muy bien, ojala algun dia llegue a ser el JTP titular. Responde cualquier consulta por mail.', '8699c3cf-5d12-46d6-bc24-60daa3c151f9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No participó mucho, pero explicaba bien y es super paciente con las consultas, a diferencia de Burin. ', '8699c3cf-5d12-46d6-bc24-60daa3c151f9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explicó algunas cosas, no es que explique re bien ni mal, zafa. Me pareció el mejor de la cátedra.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'De este curso diría que es al que más se le entiende cuando explica. Si bien al principio me daba miedo por cómo se presentaba y cómo respondía las dudas con cara de poker, a lo largo del cuatrimestre te das cuenta que es un tipo muy macanudo que realmente sabe de lo que habla. Cabe aclarar que en este curso toman un "parcialito" semanal (que no sirve para la nota, sino más para la asistencia).', '8699c3cf-5d12-46d6-bc24-60daa3c151f9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Novodvoretz o Gutierrez, ni la organización lo sabía.', '8699c3cf-5d12-46d6-bc24-60daa3c151f9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El mejor profesor de este curso', '8699c3cf-5d12-46d6-bc24-60daa3c151f9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Darío suele ser medio rígido al principio, pero una vez que agarra confianza (nosotros al preguntarle un par de veces algunas cosas x mail para el parcial nos conto una anecdota de Sir Ernest Rutherford) suele ser el mejor profe de la práctica, para la 2da parte explico bien los temas que tuvo que dar y se le puede preguntar muchas veces y te contesta bien siempre. En esta práctica para la asistencia te toman parcialitos despues de cada clase práctica, no influye en la nota pero si te va mal en varios pueden hacerte preguntas orales al final de la materia (casi nadie llega a esta instancia asi que no preocuparse).', '8699c3cf-5d12-46d6-bc24-60daa3c151f9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Dio la segunda mitad de la práctica. Es muchísimo más claro que Cabibbo quien lamentablemente a veces le interrumpe las clases innecesariamente. Sus presentaciones están buenas y el parcial fue un multiple choice en el campus, bastante accesible. Recomiendo practicar con los de la wiki. Altamente recomendado leer el Murdocca para la segunda parte de la materia.', 'b82c32f0-9886-4e23-a303-73066c4a825f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es un capo trinchero, le podes preguntar cualquier cosa que te la va a responder. El se encarga mayormente de la practica, da ejemplos que te ayudan a entender muhco de lo que va la materia. Aunque el gran problema de esta materia es el final, asi que no importa que tanto te esfuerces en la cursada, el final es el murdocca', 'b82c32f0-9886-4e23-a303-73066c4a825f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'En general explica bien. Sus clases a veces se hacen medio embole, sobretodo cuando no da recreo', 'b82c32f0-9886-4e23-a303-73066c4a825f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Daniel Trinchero es el que da casi todas (por no decir todas) la clases de la práctica. Lee unas diapositivas que se envían después de la clase y usa Jamboard a modo de pizarrón para ir resolviendo ejercicios. Daniel Cabibbo (que es el JTP) suele pedir que TODOS tengan la cámara prendida. En cuanto a la forma de evaluación: hay varios parcialitos multiple choice durante la primera parte de la materia y un 'parcial' de 45 min. un poco mas parecido a un parcial común (a desarrollar) pero que de todas maneras es muy accesible. Para la segunda parte hay directamente un parcial de 45 min. multiple choice que es muy fácil si se sigue un poco la materia.', 'b82c32f0-9886-4e23-a303-73066c4a825f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Se encargaba el de explicar, no lo veía tan organizado porque a veces se ponía en ese "paint" a escribir como loco y no lo seguías. Le importa que participes en clase siempre. Es clave si participas. NO graban las clases. ', 'b82c32f0-9886-4e23-a303-73066c4a825f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Trinchero dió casi todas las prácticas. Explica bien, le gusta que haya participación por parte de los alumnos y pide que prendan las camaras. Contesta dudas sin ningun problema por meet durante la clase y por slack. No se graban las clases.', 'b82c32f0-9886-4e23-a303-73066c4a825f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bien. Igual las clases se hacen muuy largas y pesadas', 'b82c32f0-9886-4e23-a303-73066c4a825f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Excelente explicando, resuelve toda duda que tengas. Siempre predispuesto', 'b82c32f0-9886-4e23-a303-73066c4a825f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Un capo explicando Daniel, un groso. Sus ppt son excelentes al igual que las clases, aclara mucho de lo que ves en la teorica con ejemplos y temas que no se terminaron de entender, es donde terminás de hacer el clic, podes preguntarle de todo, yo lo amé. A veces es un poco seco, pero se nota que le gusta lo que enseña
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Explica mejor que cabibbo y tiene sus clases mas organizadas. Acepta más consultas y responde de buena forma', 'b82c32f0-9886-4e23-a303-73066c4a825f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Solo da las clases teóricas, están bien estructuradas pero sólo lee los PPTs y son muy estáticas, se pueden hacer un poco aburridas', 'da91c875-4870-4d6a-93cf-e6eb0922749d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Se encarga de la parte práctica y de los TPs. Los TPs que da son bastante exigentes y requieren tiempo pero si te interesa la materia valen la pena. No tenés que perderles el ritmo y requieren leer la bibliografía porque los temas a primera vista son complicados y los tenés que ir practicando por tu cuenta para entenderlos bien, la mayoría de las clases prácticas fueron de consulta de los TPs por eso mismo.', 'c50284c6-b7ac-4ed6-abbb-81b502a7bbf8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy buena persona pero tanto ella como Casaglia no se adaptaron bien a la virtualidad, la clase sirve poco y nada.', '9c13712a-5142-463c-a377-3dd37274b679');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'De nuevo, no dan clases, pero es buena respondiendo consultas. No parece saber tanto como Casaglia de la teoria, pero sabe mucho mas en lo que respecta a Matlab.', '9c13712a-5142-463c-a377-3dd37274b679');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'Tampoco da clases. Tambien tiene un muy buen trato con sus alumnos, pero no sabe tanto de teoria como Daniel. Sin embargo, sabe mucho de Matlab.', '9c13712a-5142-463c-a377-3dd37274b679');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Le pone onda pero no es la gran cosa.', '9c13712a-5142-463c-a377-3dd37274b679');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Es un tipo que sabe mucho, pero bastante temperamental. Si le caés bien te va a ayudar y responder muchas dudas, pero si te toma de punto puede llegar a hacerte recursar sólo por el tp final con el parcial aprobado. No resuelve ejercicios completos en el pizarrón, sólo tira pistas de cómo encararlos y contesta dudas específicas.', '7ab15d52-72e9-46a3-aa51-08915e87c3ed');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Casaglia no se adaptó bien a la virtualidad, la clase sirve poco y nada. Tiene una forma de hablar bastante confrontativa y pone poca voluntad para que aprendas los temas.', '7ab15d52-72e9-46a3-aa51-08915e87c3ed');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'Va siempre a clase y explica MUY bien. Lo malo es que no da clases, pero creo que es algo de la materia en si (no entiendo que aporta a la formación o que sentido pedagógico tiene esto, pero bueno). Te responde todo, hasta por mail, todas las veces que necesites y con buena onda. Si vas a clase y te conoce, la corrección del parcial es mas amigable, al igual que la evaluación del TP (el cual tenes que entregar a tiempo, si te atrasas, ya sea un minuto, recursas, y conozco a alguien que le pasó).', '7ab15d52-72e9-46a3-aa51-08915e87c3ed');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'Un clásico del departamento de electrónica, no dar clases prácticas sino que dar "clases de consultas". Si bien sigue esta metodologia, Daniel responde absolutamente a todas las consultas, tanto en persona como por mail, y si fuiste a clase, la corrección del examen es muy tranqui (te puede llegar a hacer preguntas para aprobarte). Si no fuiste, te mata. Eso si, la entrega del TP es SI O SI en fecha, sino recursar (y conozco un caso que fue asi). Sabe muchisimo de señales, pero no tanto de matlab.', '7ab15d52-72e9-46a3-aa51-08915e87c3ed');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'El tipo es nefasto, explica muy pocos ejercicios durante el cuatrimestre, quiere que trabajes en clase pero sin escribir en el pizarrón. Es posible que el profesor sepa sobre la materia pero no lo transmite.', '7ab15d52-72e9-46a3-aa51-08915e87c3ed');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Fue buenísima la cursada, el manejo de varias plataformas y la calidad de las clases que dió. Si bien con el cambio a digital quedan unas cosas que mejorar, es un muy buen curso y Rui le pone muchas ganas.', '8f855704-d7b5-4997-a7cd-22d6efb63a8c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Es un rompebolas pero sirve que sea así. Sigue como va uno con la matetia. En las correcciones no te mata, es juto tirando a benevolo. Hace clases de consulta si hay gente que rinde recu o lo necesita. Eso si, pregunta todo en el cuatri, durante el receso medio que desaparece rui. Usa bien el tiempo que es crucial para dar el final.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es el tipo mas groso de la materia, no solo enseña bien y va al punto sino que se toma la molestia de responder dudas por fuera del horario de clases y si bien esto parecería normal, no es asi no en la fiuba, para los trabajos practicos respondió todas mis dudas y las que eran medio complicadas se tomo las molestias de hacer una hacer una videollamada solo para responderme.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Las primeras clases son un resumen de 15 min de los temas de la teórica y te deja haciendo la guia, si tenes alguna consulta lo tenes ahi al lado para preguntarle y si le decis te hace un ej especifico en el pizarron y te lo explica bien y con onda. Después del parcial las clases cambian y son basicamente un trabajo en grupo de 20 personas, por lo general alguien ponía una PC y iba explicando los ej del TP, te mostraba como se hacian y que significaba cada cosa. Cuando daba clase entendias literalmente toda la materia pero a veces era ir a cursar y estar sentado 4 horas haciendo ej', '3b8fcf8c-edbe-4300-99e0-3579f548719f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Por lo general, da uno o dos ejercicios para hacer por guía y entregar por el campus, para que llevemos al día la materia. Las clases las suele dar Torres, y Sar hace uno o dos ejercicios', '58512c84-2cbc-4fea-a06e-e8403a64a4ff');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El tipo va a clase nomas, nunca se pone a dar clases. Si le preguntas algo te responde bien y te explica. Pero tenes que ir vos y preguntarle, si no el tipo no hace nada', '58512c84-2cbc-4fea-a06e-e8403a64a4ff');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'En todas las prácticas usa un powerpoint con puntos clave sobre los temas, y las funciones de Matlab que corresponden para poder realizar eso. Hay que preguntarle varias veces para que te conteste lo que queres saber, pero trata de que lo puedas razonar por tu cuenta', '38bf126e-ae54-4306-b192-dd1a3b4214b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Las clases son bastante dinamicas, usa unas diapos bastante completas de base. Explica bien y si le preguntas algo te responde bien y con onda. Los parciales que toma no son dificiles si fuiste a clase y prestaste atención a los conceptos, no hace 2 ejercisios iguales ni en pedo a si que es clave entender los temas de la materia. No es muy estricto con las correcciones.', '38bf126e-ae54-4306-b192-dd1a3b4214b1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Suele ser algo confuso', '884e99aa-9d62-40db-adce-e65de81c15f7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Muy claro dando clases. El cuatri que yo la hice tuvo el problema de que siguió dando clases como si las teóricas las diera Galarza y la materia habia cambiado, por lo que a mi se me complicó un poco dar el parcial, pero sigue siendo un excelente docente, ya que los temas no solo explica en que se aplican en el ambito de la electronica sino tambien en otros como la economia. Lo recomiendo', 'd2dcc0af-86d3-4ff2-85f0-5634c0aeb202');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'De esta practica, es el que mejor explica. Lastima que no se hacen muchos ejercicios. De haber sabido la habría cursado en otra catedra.', 'd2dcc0af-86d3-4ff2-85f0-5634c0aeb202');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Con pecker normalmente usa un jupyter notebook (phyton) para exponer los ejercicios, estos estan disponibles para ver. Le agrega un poco mas de practica a la materia ves cosas con un poco mas de intuicion y graficos e interpretarlo que el puramente teorico, sin embargo los ejercicios mas de desarrollo sufren un poco y son un poco mas dificil de seguir, con los ejercicios en la pizarra de pecker dan un buen equilibrio', '0f4dd6b1-5657-4ebc-8e19-2b342b8fd60b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Espectacular. A veces explica medio lento o pone demasiado énfasis en temas ya vistos en la teórica o en la práctica misma. Sin embargo, es excelente persona y docente. Paciente, inteligente, simpático, colabora con el entendimiento de los temas y de los TPs. Se queda lo necesario respondiendo consultas', '7794f5aa-a4cd-473f-88af-a5acccf1c6d5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Clase practica, normalmente hace ejercicios en un jamboard y explica bastante bien, no hay muchas cosas que no cubran, dieron una clase de repaso antes del parcial y un par de ejemplos de ejercicio de final, que siempre son utiles.', '7794f5aa-a4cd-473f-88af-a5acccf1c6d5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Excelente docente de la práctica. Sus clases son clave para aprobar el parcial y solidificar los contenidos que se dan en la teórica.', 'a90d9d68-0b33-4d22-b377-11f0be08bf61');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Excelentes sus clases, uno de los mejores docentes de la facultad. Al haber llegado hace poco a la materia le pone mucha onda, además la modalidad de evaluación es bastante razonable.', '31de6dd3-4dd1-4a35-8cad-bfdad3bf5514');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Nunca pregunté cosas por el campus, pero porque no necesité. Entre el garcia(libro). En los papeles es hasta las 11 pero nunca me fui después de 10:30, algo es algo. ', 'acd996c3-e0e6-4419-9e6e-0fb36b603f6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Te prepara para ir a la NASA. Es muy importante prestarle atención, explica cosas que él no las vio en ningún libro (fenómeno). El García es su biblia. Le da bola a la participación en clase y si haces preguntas piolas quedas como terrible capo. *Diagrama psicrométrico no incluido*', 'acd996c3-e0e6-4419-9e6e-0fb36b603f6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Un grande. De chico la mamá le contaba que el colegio estaba en una calle llamada Sadi Carnot. Igual la vieja no tenía la mas puta idea de quien era.', 'acd996c3-e0e6-4419-9e6e-0fb36b603f6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Un grande Mario Moscardi, de chico vivía en una calle llamada Sadi Carnot. Nació para enseñar termodinámica.', 'acd996c3-e0e6-4419-9e6e-0fb36b603f6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Te corrige todos los ejercicios, se come las "s" pero es un tipazo y que no me entere que te reís en la cara de eso porque se pudre todo. Le ENCANTA el ejercicio 23 y robar calor de caños de escape. Vive lejos, los rumores dicen que tan lejos que hasta se queda a dormir en la facu. Si le preguntas qué hace un ingeniero electromecánico te contesta con mucho detalle.', '3da6f0a7-99f4-4f51-9bd7-694c2a855e38');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Un fenómeno. Corrige todos los ejercicios rapidísimos y explica muy bien. Lamentablemente Moscardi no lo deja jugar mucho porque tiene miedo que le saque la titularidad. Se va antes porque vive lejos.', '3da6f0a7-99f4-4f51-9bd7-694c2a855e38');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Un grande. Sabe mucho y corrige todos los ejercicios. Una pena que Moscardi no lo deje jugar mas tiempo, por ahí le saca la titularidad.', '3da6f0a7-99f4-4f51-9bd7-694c2a855e38');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Explica bastante mal, aunque por suerte sus tps no son del todo complicados asi que safa hasta ahí.', 'ae995cd7-108c-404a-86f6-8a03e1caef18');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Con el hay que entregar los trabajos de estructuras metálicas. En la clase esa te enterás de la mitad de las cosas. En el power point del apunte está incompleto o cosas implícitas desparramadas. Si bien son dos láminas y a diferencia de otros te corrige todo y bien, la terminás aprobando a prueba y error', '4ef9a248-a5bb-4799-93a3-77d0aca883c9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Mucho mejor trato que en medios. En general llega 15 minutos tarde pero da siempre la clase hasta las 21. Explica muy bien y está dispuesto a darte una mano si le consultas algo.', '3c3b154c-725b-4c14-afc9-351610a0b179');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Una clase nefasta, se limitó a leer powerpoint que ni siquiera eran suyos todas las clases, no tenía ni idea de lo que decían (es decir que ni siquiera los leyó antes). No le vayas a pedir una revisión en un examen porque lo único que te dice es que el ya sabe como corrige y no piensa cambiar la nota. No es ultra exigente pero llegás a errar una cuentita pava en entropía o primer principio y olvidate de aprobar.', '2bd1bcea-3374-4a2e-a584-09c99f7b9299');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Justa corriegiendo, también explicando dudas sobre los TPs. De gran ayuda a la hora del TP final en el laboratorio. Si mal no recuerdo apenas explicó 1 o 2 temas sencillos.', 'af0d84d6-56ae-412e-8937-9f70b42dbc5c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'La otra ayudante, es buena onda y copada. En general explica bien y es justa corrigiendo.', '79787e65-4da0-4c7e-850a-da1cd685cc9b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Este cuatrimestre no existió. Subió uno o dos videos introductorios de la materia al principio, pero más allá de eso no tuvimos teórica.', '5d2945a9-5c65-430c-8640-7f313c266775');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'La teórica de Laufgang por lo que tengo entendido es la única y la misma para todos. En este primer cuatrimestre 2020 de cursada virtual no dio clases virtuales, solo subio 3 o 4 videos que equivalen a una, como mucho dos clases y después desapareció. Tiro 2 pdfs escritos por él (de fractura y aceros inoxidables) que no los evaluaron en la cursada, pero les dieron bastante bola en el final. Al campus no entra hace 2 años (fecha real que te aparece en su perfil), y no contestó nunca un mail. Muy desprolijo. Los profesores de la práctica se encargaron de dar todo ellos, sobre todo Marcela Pichipil que es una genia.', '5d2945a9-5c65-430c-8640-7f313c266775');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Las clases teóricas suelen ser muy distintas a las prácticas', '5d2945a9-5c65-430c-8640-7f313c266775');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Faltó varias veces, a veces con reemplazo a veces sin. No suele haber correlación con la práctica. Las primeras clases tomaron parcialitos. Se nota que sabe mucho aunque suele irse por las ramas.', '5d2945a9-5c65-430c-8640-7f313c266775');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es ingeniero mecánico, trabaja en el área de materiales y se nota, siempre dando ejemplos sobre casos cotidianos y mostrando imágenes y videos sobre los procesos que explicaba Marcela. Hasta traía piezas reales para que queden más claros los conceptos. Llegó a extenderse 1h y media para reforzar un tema que notó que teníamos flojo, muy bueno en el trato y sumamente claro explicando. Estaba bueno hablar con él para salir un poco de la teoría y ver qué es lo que pasa en lo cotidiano. Justo corrigiendo TPs y explicando siempre cada duda.', '548b9d02-20d5-4035-b5ca-834a9dd249f7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Marcela es una genia. Este primer cuatri 2020 virtual como Laufgang no dio las teoricas ella dio todo, teórico y práctico. Tanto ella como los ayudantes son muy piolas y contestan todas las dudas sin problema. Dio clases por meet todos los dias que le correspondía y después de la clase los dejaba colgados en el campus. La materia tiene como 6 o 7 TPs que si bien son bastante teóricos llevan un poquito de tiempo. Lo bueno es que te obligan a llevar la materia al día y se te hace más fácil aprobarla. Por comentarios que comparan las 3 prácticas de Materiales, dicen que la de Marcela es la más exigente, pero explica muy bien y claro y la verdad es que aprendés un monton. A mi en particular tampoco me mató con los criterios de corrección. La materia en si no me parecio difícil pero es pesada, tiene bastante contenido y la tenes que ir llevando porque para estudiar todo a último momento es mucho. Los parciales fueron bastante extensos, el primero interminable, pero los dos aprobables. El final fue un choice de 20 preguntas por el campus que si aprobaste la cursada lo pasas caminando.', 'f7eacb68-2afa-413c-a4e3-3a7c104ac34e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'La práctica de Pichipil es la más dificil de las que estan disponibles, son trabajos prácticos individuales que se entregan cada 1 o 2 semanas y a veces explica un poco rápido, llevar siempre muchas consultas porque en esta materia importa cada detalle', 'f7eacb68-2afa-413c-a4e3-3a7c104ac34e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Explica muy bien, quizás va un poco rápido pero procura que todos la sigan y que se entienda bien cada concepto. Además se asegura de dar todos los temas que tiene que dar. Sabe muchísimo y responde con claridad cada duda, siempre y cuando demuestres que estuviste leyendo o tratando de comprender, incluso estuvo a disposición días ajenos a la cursada para consultas. Los parciales son largos, con ejercicios parecidos a los TPs, y a veces complicados. Sobre los TPs justamente: requieren mucha lectura, de varios libros, basándose en lo que da en la clase pero salen. En resumen, es una excelente cuya exigencia está a la par de su calidad.', 'f7eacb68-2afa-413c-a4e3-3a7c104ac34e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Creería que su cátedra es la más difícil. Parcialitos complicados todas las clases y parciales largos. Explica muy bien en general el tema y recomienda la bibliografía de donde complementar. Nos dijo que era un parcial y terminó tomando dos y en general no se promociona. No es imposible simplemente le tenés que dedicar mucho tiempo pero te prepara muy bien para el final. Es muy justa evaluando y te da segundas oportunidades o una mano si demostrás compromiso.', 'f7eacb68-2afa-413c-a4e3-3a7c104ac34e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Uno de los ayudantes que vas a tenér en el laboratorio. Es buena onda pero le pone 0 ganas a los temas que tiene que explicar. Es bastante exigente.', '3f343ee2-b51c-4a47-9452-6be209041cfc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Es el encargado de la teórica en todos los cursos aunque en la práctica terminás viendo teórica la mitad de la clase así que sería el tipo que tenés los lunes. Es medio plomo tal que siempre se enrieda con los mismos ejemplos y a veces da temas que ya se vieron en la práctica. Explica bastante bien y da buenos ejemplos, se nota que sabe mucho. Eso si siempre llega tarde.', 'b663a8f8-a93c-46b3-bde0-153a754d01a7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Sabe muchísimo y explica todo con muchísimo detalle. Fomenta el interés y la participación de los alumnos.', 'e6db469f-74cc-4f60-9745-257ecb721d0b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Sabe mucho de los temas que da y es muy bueno explicando. Las diapositivas me parecieron un poco desorganizadas.', '8587785b-8d2f-4c79-a79a-5b1e5fa4d35c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Da una clase. El resto ni aparece.', '199f086f-1768-4618-94c7-9c11ab5a2adb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'No sabe ni lo que da en las clases. De 5 mails con consultas, sabe responder 1. Muy desorganizado y los power point son puro texto.', '082ac801-fe60-4ad4-bf13-aea3c279e077');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'las clases con facal son bastante amenas.', 'e83a1d33-bd58-4f05-b83b-fbaef4b89fa2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Todo bien, pero las correcciones de los tps son infumables.', '8da43d05-d8c0-47c2-8e0a-500b03e8017c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2018', 'Un delincuente Truchetti. Directo al penal de Ezeiza el turco', 'd6bff64f-c74a-40e1-8079-1124ddef644d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'La clase es muy vaga, si bien hay material teórico la presentación no es buena, algunas clases se quedan muy cortas. ', 'd6bff64f-c74a-40e1-8079-1124ddef644d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'El profesor es un genio, pero es muy desorganizado, a tal punto de que se olvido de que teníamos parcial y lo tuvimos que pasar para la otra semana.', '30e4e043-c0e9-49f3-a991-491032c28b27');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Va a los pedos, te da una clase de dos horas en 40 minutos, son entretenidas las clases, pero tenes que ir bien despierto', '5185a0ca-7b2b-429e-953c-014e2b25786a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Trato sereno. Responde cualquier duda ', 'deebc93d-efd7-4599-bbf4-eeed767034a4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Excelente, encargada de la Teoría. ', '8f512893-eb97-4b5d-a636-cb8aecd4cdce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Las clases de Bacha son cortas y concisas. En 1 hs y media generalmente ya te libera. Suele ir muy rápido y a veces cuesta seguirle el ritmo.', 'fbfe49a5-2ee0-4105-8541-70a4b535244b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Una genia la profe, quizás va rápido y no desperdicia el tiempo pero siempre responde todo lo que le consultes mientras tengas algo planteado y da muchas formas de resolver ejercicios', 'fbfe49a5-2ee0-4105-8541-70a4b535244b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Barra da un par de clases en particular en todo el cuatrimestre (creo que 3/4). Es muy buen profesor y te contesta TODAS las dudas que tengas, inclusive le podes consultar cosas por facebook y siempre está predispuesto. Un genio ', '128cc7af-b7bf-48e4-89bb-a7b82d1351d4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es sabido que no se va a las teóricas. Son aburridas e inentendibles.  Con lo que se da en la práctica alcanza. ', '32882b44-1216-4445-985b-7d1dbb834b0d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Un asco. Se copiaron parcial y final todo el curso. En varias reuniones con personas que no son de fiuba me dicen "ustede se copian, así cualquiera". Humillante. Ya se sabe que en Fiuba la copia es fácil. Una lástima. Me siento muy mal.', '32882b44-1216-4445-985b-7d1dbb834b0d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Lee los PPT que el realiza y profundiza si hay alguna duda. Es claro explicando.', '3ceed30e-83d7-4054-9ca1-2907dbdbe987');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Se encarga de parte de las clases teóricas y sinceramente ir a su clase o ver el video del campus es casi lo mismo. Además, la teoría en esta materia solo sirve para el primer parcial y el final, la materia se entiende en las clases prácticas.', '3ceed30e-83d7-4054-9ca1-2907dbdbe987');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Buen ayudante, sabe mucho. A veces se cuelga en responder las dudas pero lo termina haciendo, y es muy claro.', '48d73251-2dde-420d-9b89-ee36d180effd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La mejor profesora. Explica super bien y no tiene problema en quedarse una hora mas despues de la clase.', '9f628d92-aa51-4037-85f2-fa6d4bc3bdd7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Excelente ', '9f628d92-aa51-4037-85f2-fa6d4bc3bdd7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'La mejor docente en toda la catedra. Se encarga de la práctica y es genial, se entiende todo y encima es super copada, te ayuda un montón. Es la razón por la que la mayoría de los estudiantes aprueban.', '9f628d92-aa51-4037-85f2-fa6d4bc3bdd7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Miriam explica muy bien los ejercicios, y hay una parte de la materia donde muestra una simulaciones muy buenas. Corrigiendo es muy exigente, ante un error conceptual por mas que el examen en general este bien, te desaprueba.', 'a30fb9bf-d96b-4313-8512-c56d1c702de9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Miriam es muy predispuesta y siempre se va a ocupar de que entiendas lo que explica e incluso otros temas que también necesites ayuda.', 'a30fb9bf-d96b-4313-8512-c56d1c702de9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Corrigiendo es muy exigente, ante un error conceptual por mas que el examen en general este bien, te desaprueba.', 'a6115df4-acb3-421f-ac6d-0f18691551fa');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Sinceramente no es el profesor que mejor trate a sus alumnos. Se encarga de parte de las clases teóricas y sinceramente ir a su clase o ver el video del campus es casi lo mismo. Además, la teoría en esta materia solo sirve para el primer parcial y el final, la materia se entiende en las clases prácticas.', 'a6115df4-acb3-421f-ac6d-0f18691551fa');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'buena onda, nos daba un poco de autocad y explica la lamina 7 nomas.', '4ee2076d-c4f1-447e-b7a5-2d778d06bc0f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Esta muy subido al pony. Si le das una critica de algo, por mas que tengas razón, te va a decir que esta mal, te va a intentar contraargumentar y se va a contradecir el solo. Llegas a escribir un numero o letra medio feo y ya te desaprueba la lamina. Lo bueno es que al menos responde dudas por whatsapp.', '00e03afe-2d11-4844-8d82-cfdda1c0e5ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'el único que da clase es pablo, los demás docentes corrigen pero a veces tiran algún comentario de ayuda o para bardearnos jajaja
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Una copada, se nota que le gusta enseñar. Única crítica (bastante importante) es muy exigente con las láminas.', '775d470f-5fb1-4f8a-a394-ef47116ea131');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es buena explicando las láminas. Es algo exigente con las correcciones, pero dentro de todo es buena docente.', '775d470f-5fb1-4f8a-a394-ef47116ea131');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Cursar con Ines es como que te da clases tu abuela, una genia!!!!!', '775d470f-5fb1-4f8a-a394-ef47116ea131');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 're piola, te explica las veces que necesites, y muy clara y prolija.', '775d470f-5fb1-4f8a-a394-ef47116ea131');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'juan cruz es buena onda y tranqui corrigiendo, es uno de los ayudantes que mejor me cayó desde el principio. no digo que si él te corrige la lámina está aprobada automáticamente pero no es tan exigente como los demás.', '90940a79-1c66-421b-9c2a-fb26f684d39d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'tipazo, trata de que el alumno aprenda y apruebe ', '90940a79-1c66-421b-9c2a-fb26f684d39d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es ingeniero, pragmático a la hora de explicar. No se va por las ramas y explica lo justo y necesario. Va siempre a clase, incluso estando enfermo y los dias que jugó la selección por el mundial se copó y no nos exigió ir. Se permite algún chiste, pero es muy cortante en el mano a mano, cuanto menos te conozca mejor. Mas allá de la personalidad, cumple con todo.', 'a4928274-3e10-44db-832b-3673ef91f21d');
