INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es el profe que es las clases en la mayoría del tiempo ,cuando la curse el plan decía de 9-15 ,lo cual no era así el ,dura hasta pasado medio día depende como el profesor vea como va la clase , es muy formal en su trato .', 'a4928274-3e10-44db-832b-3673ef91f21d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Ayudante, autómata diseñado por el mismísimo ingeniero Fernandez.', 'a4928274-3e10-44db-832b-3673ef91f21d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Son bastante despectivos con los alumnos, en las clases se ponen a hablar de cosas que no te suman nada "a modo anecdótico". El parcial no es complejo pero tenés que saber resolverlo rápido porque te dan poco tiempo. Participar en clase se complica xq medio que te boludean, no te dan lugar, o no entienden lo que preguntás. Recomendación: andá entregando los tps bien al día porque después se te juntan y no llegás a rendir el parcial.', 'a4928274-3e10-44db-832b-3673ef91f21d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'De los peores profesores que tuve hasta ahora. Desde mi punto de vista no diría que tiene un trato formal, sino más bien despectivo, pierde tiempo en clase charlando con los otros profesores, no fomenta la participación (más que nada porque si preguntás algo te sobran bastante) y en caso de que tengas que faltar por algún parcial no se te justifica la falta. Concuerdo con el de arriba, entreguen los tps al día porque después al estar limitado en cuantos se pueden entregar juntos no llegás a dar el parcial.', 'a4928274-3e10-44db-832b-3673ef91f21d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica bien, toma asistencia y no te da acceso a las clases grabadas. Las clases son largas y da muchas vueltas, no va al grano y no están muy bien organizadas. En general no da recreos en mitad de la clase lo cual, además teniendo en cuenta que son lo sábados, son bastante plomo. En los parciales toma cosas de tabla y cosas puntuales de la norma junto con ejercicios de vistas (son tramposos y apuntan mas a engañarte que otra cosa, aunque tampoco son muy difíciles, si no aprobás las dos vistas faltantes muy probablemente no aptuebes, y si aprobás una tenés que tener todo lo demás muy bien). En los trabajos prácticos da bastantes posibilidades de entrega aunque el no corrige en general.', 'a4928274-3e10-44db-832b-3673ef91f21d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'al principio pablo hace comentarios o chistes que te pueden parecer chocantes como que solo una parte de nosotros se va a recibir o aprobar la materia, pero mientras tengas paciencia y estés al día con la materia te van a dejar de importar y pablo se va poniendo menos gede. a mí al principio no me simpatizaba nada y ahora que estoy por la última entrega de láminas me parece un tipazo, posta lo queremos.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'al principio mete miedo, después te das cuenta que es un tipazo, cuando corrige láminas (rara vez) no es tan exigente', 'a4928274-3e10-44db-832b-3673ef91f21d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Reza que te toque como corrector. Es crack.', '2d72310c-4ca4-4f45-8337-d9e8d586dc1f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy justo corrigiendo los TP, si es un error sencillo te hace corregirlo en el momento y te firma la lamina. Da su mail para consultarle dudas', '2d72310c-4ca4-4f45-8337-d9e8d586dc1f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Correcto.', '2d72310c-4ca4-4f45-8337-d9e8d586dc1f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy buen profesor, muy claro y bastante coherente con las correcciones. Utiliza Adobe Connect para dar clases lo cual a mí no me resultó muy cómodo para realizar consultas en clase.', '2d72310c-4ca4-4f45-8337-d9e8d586dc1f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Buen corrector, responde dudas y corrige justamente, el mejor corrector que puede tocar. Siempre me respondio los mails, tarda un poco. Iguallmente creo que se tomo licencia.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'alejandro es como pablo al principio en cuanto a comentarios y eso, y además es el más exigente corrigiendo láminas. lo tuve como corrector la mayoría de veces y aprendí muchas cosas pero también me fue pesado que todo el tiempo me rebotaran láminas. igual no me parece mal tipo. es el único ing naval entre el equipo docente por si algún naval quiere consultarle sobre la carrera, dijo que está en dibujo para ingenieros también', '75c230a0-1cbf-4628-a2ab-675a47e102e9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'La correctora de tps, hija de Merlo, es muy buena onda, y muy atenta a los alumnos. La mejor correctora, sin dudas', '2df79782-dfa5-4297-b780-3ab1bf3b3e4d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Clases aburridisimas. Es a las 19 hs pero Merlo llega cuando quiere. Nose para que da el mail si responde cuando y como quiere. Una vez dijo que el recuperatorio era un martes, fui y ni estaba. Toda esta desorganizacion se traslada a toda la materia en general.', '2df79782-dfa5-4297-b780-3ab1bf3b3e4d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Llega siempre minimo media hora tarde y las clases terminan 1 o 2 horas antes. Primero pasa los power point explicandolos, despues explica el TP a realizar y terminó la clase', '2df79782-dfa5-4297-b780-3ab1bf3b3e4d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Nunca lo vi en clase, solo en el final firmando libretas.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'El hace las teoricas (grabadas en ppt con audio). En mi catedra no era docente pero aparece en el listado de todas.', '2df79782-dfa5-4297-b780-3ab1bf3b3e4d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Simplemente es Merlo, explica sobre el los ppt aunque tienen los audios. No hace falta entrar a las clases, es colgado sobre las correcciones. El parcial es bastante raro (hay vistas que te matan y vas sacando por descarte)', '2df79782-dfa5-4297-b780-3ab1bf3b3e4d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es el jefe de la catedra, aparece en todos los cursos y desconozco si da clase en alguno. Al fin y al cabo, responsable de lo desastrosa que es esta materia. ', '2df79782-dfa5-4297-b780-3ab1bf3b3e4d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Lo vi firmando libretas 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'sube las teoricas en formato powerpoint. Suficiente para lo que es la materia. Bastante complicado el trato ya que dan clases de consulta en las que no dan mucho espacio para que puedas preguntar cuestiones puntuales de tus laminas.', '2df79782-dfa5-4297-b780-3ab1bf3b3e4d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'El peor profesor que tuve en toda fiuba. el tipo no se interesa en que sus alumnos aprendan, presenta el powerpoint con la teoría de la semana y no le pidas mucho mas. Es inentendible la exigencia de esta materia que el propone cuando te mandan a hacer TPs con nada de practica previa, y ni hablar de la dificultad de los examenes. Suerte si te toca con el', '2df79782-dfa5-4297-b780-3ab1bf3b3e4d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Demasiada exigencia a la hora de corregir, dos veces me bochó una lamina hasta que me di cuenta de que el error lo tenía ella y no yo, corrige cuando quiere y sin muchos criterios. Ni siquiera va a las clases', '2df79782-dfa5-4297-b780-3ab1bf3b3e4d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Los profesores lo idolatran, es el que arma todo, asi que si odio tanto esta materia (que en el técnico amaba) es por este ser infernal. Osea, puede ser la mejor persona del mundo pero la verdad que me hicieron odiar la materia :)
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Curse en turno noche explicaba la teorica y las laminas que habia que entregar, las clases se hacian monotonas pero responde con respeto hacia el alumno y preguntaba si tenian dudas ya sea sobre los temas o sobre laminas', '2df79782-dfa5-4297-b780-3ab1bf3b3e4d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Roxana responde dudas por mail, a veces tiene problemas de conexion al subir las laminas corregidas. Por lo tanto es mejor mandarle mail si hace varias semanas que no ves correcciones. Tiene buena predisposición aunque durante las clases generales no hace muchas intervenciones, en las salas separadas intenta meterle onda pero no siempre hay muchos alumnos porque la gente piensa que esta es una materia para hacer asi nomas y la posta es que hay que darle bastante bola sobretodo si no fuiste a una escuela tecnica. Tip: es mejor entregar las laminas cuando realmente crees que estan en condiciones de aprobación, con el tiempo aprendes a darte cuenta de eso. Cuantas mas veces entregas las láminas, mas chances de que sigan encontrando errores que antes no vieron o que hayas borrado algo que estaba correcto', '5b083973-b188-4f95-8fad-31adcedd514f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Corran. Busca la manera de desaprobarte las laminas. En cada reentrega te marca errores que previamente no te habia corregido (muchas veces realmente absurdos). Esto convierte a las laminas en un trabajo desproporcionadamente dificil, frustrante y tedioso. La experiencia fue nefasta, facilmente la peor docente que tuve en la facultad.', '5b083973-b188-4f95-8fad-31adcedd514f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'no da clases, solo corrige laminas. busca hasta el mas minimo error para bochartelas, pero igual es buena persona', '5b083973-b188-4f95-8fad-31adcedd514f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El curso de los miércoles a la mañana es el mejor.', '5b083973-b188-4f95-8fad-31adcedd514f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es atenta en cuanto a su grupo de correcciones en cuanto a si te falta algo para poder rendir te avisa pero tarda mucho tiempo en corregir.', '5b083973-b188-4f95-8fad-31adcedd514f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'UN DESASTRE. Falta bastante, te corrige cosas que antes no te había corregido, una pesadilla que sea tu correctora en la virtualidad. No habla nunca', '5b083973-b188-4f95-8fad-31adcedd514f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Evitá que te corrija, es solo para sufrirlo', '8cc8d8c1-22b3-48ee-a418-792bc4a88452');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Carnicero si los hay. A rezar que no te toque porque es un parto. Le entregas una lamina y te corrige errores que no te había marcado antes.', '8cc8d8c1-22b3-48ee-a418-792bc4a88452');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Evitarlo siempre que se pueda', '8cc8d8c1-22b3-48ee-a418-792bc4a88452');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Bastante exigente en sus correcciones y muy rígido en cuanto a los tiempos en que realiza las devolución de las correcciones. Si no entregabas antes de un día a cierta hora, tenías que esperar en general 5-6 días para que te haga la corrección. A su vez si no cumplís con el formato de organización y nombre de carpetas y láminas no te las corrige.', '8cc8d8c1-22b3-48ee-a418-792bc4a88452');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'un sorete.', '8cc8d8c1-22b3-48ee-a418-792bc4a88452');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Un forro corrigiendo que no sabe explicar', '8cc8d8c1-22b3-48ee-a418-792bc4a88452');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'En mi opinion, muy mala persona, un tipo que quiere que hagas las cosas a su manera, tiene su propio metodo de entregas y de correccion, se llevaba mal con sus compañeros profesores, horrible. Te hace pasarla mal durante el cuatrimestre y enojarte con el y con la materia. Evitar a toda costa.', '8cc8d8c1-22b3-48ee-a418-792bc4a88452');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Solo era mi profesor de correcciones.', '8cc8d8c1-22b3-48ee-a418-792bc4a88452');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Lucas Perfumo es el que más sabe de su catedra. Sabe exactamente donde se equivocan los alumnos. ', '425021ba-c3b8-4d3f-9b4e-7601448296f7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Dentro de todo bien, explica los tps y resalta errores frecuentes. Es relativamente exigente en las correcciones (ni mas ni menos que otros). En sí la materia es pesada, no te la complica demas.', '425021ba-c3b8-4d3f-9b4e-7601448296f7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buen profesor, responde tus dudas y no es soberbio.', '425021ba-c3b8-4d3f-9b4e-7601448296f7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'dio un par de clases y me dio la impresion de que se enredaba mucho, se le entendia pero se desviaba del punto y se la complicaba demas. respondia dudas sin problema y era copado la verdad', '425021ba-c3b8-4d3f-9b4e-7601448296f7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El curso de los miércoles a la mañana es el mejor.', '425021ba-c3b8-4d3f-9b4e-7601448296f7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Si te toca como corrector de láminas, fuiste. Es mega exigente, trata de entregarselas a Sande siempre que puedas. Aprobé la cursada sin que me firme ni una lámina.', 'ca62d4cb-fc10-45ff-9e14-7fa589f8d5ab');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Porcellana padre es exigente pero un capo total. Fue dificil el parcial pero las clases bastante llevaderas', 'ca62d4cb-fc10-45ff-9e14-7fa589f8d5ab');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Le pone mucha onda. Responde los mails a la madrugada.', 'ce6270c2-96de-4e21-952e-68d3e4f09712');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buena onda, le pone muchas ganas y hace casi innecesario ir a la teórica. Suele tomar 6 parcialitos a lo largo de la cursada (aprovechalos). Contesta dudas hasta de madrugada. Permite hacer las laminas en Autocad. Super recomendable.', 'ce6270c2-96de-4e21-952e-68d3e4f09712');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es muy organizado.', 'ce6270c2-96de-4e21-952e-68d3e4f09712');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Es un hdp, ñoqui de mierda, no puede un chabon dar coases como la da, la recursa 60% de los ingresantes y no sirve para nada en toda la carrera, de 1 sola correlativa depende y es una materia del 4to año', 'ce6270c2-96de-4e21-952e-68d3e4f09712');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Emilio es lo mas, si pueden anótense con el y traten de promocionarla antes que sufrir con Santamartina en el final', 'ce6270c2-96de-4e21-952e-68d3e4f09712');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Un capo. Hace que la materia sea mucho más amena que con Porcellana. Te prepara muy bien para el final con los tres parciales que abarcan casi toda la materia.', 'ce6270c2-96de-4e21-952e-68d3e4f09712');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Monopolio de las cátedras', 'ce6270c2-96de-4e21-952e-68d3e4f09712');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'muy buena onda, te permite promocionar asi que recomiendo esta catedra. el tipo capaz te responde a las 4 am.', 'ce6270c2-96de-4e21-952e-68d3e4f09712');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'El pelado tiene cara de nada, pero le pone la poca onda que tiene. Es el mas comprensivo a la hora de corregir laminas', '63a7dd6d-b14c-4198-aacd-d0a03564edae');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Corrige laminas y, a diferencia del 99% de los correctores de laminas (O como se diga), no busca cagarte y rebotarte las laminas mil veces, si hay algo mal te lo marca e igual te las aprueba. Me ha salvado la vida mil veces, es razonable y no te va a hacer recursar o privarte de la posibilidad de rendir el parcial porque te falta aprobar 1 o 2 laminas.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Reza que tus laminas terminen en sus manos y no las de sauque', '63a7dd6d-b14c-4198-aacd-d0a03564edae');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'TE APRUEBA TODO. Muy buen tipo, y aprobable', '63a7dd6d-b14c-4198-aacd-d0a03564edae');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Alejandro es un tipo que se nota muchisimo que sabe. Aunque a veces puede parecer un poco apabullante, quizas a veces no se da cuenta de la forma en la que dice ciertas cosas (que un alumno que nunca hizo dibujo tecnico no entiende)', '63a7dd6d-b14c-4198-aacd-d0a03564edae');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Rey es lo mejor que te puedo tocar como corrector es el menos jodido respecto a las correcciones, es justo. No da clases pero siempre esta en el meet para alguna consulta y los mails los responde en un breve tiempo. ', '63a7dd6d-b14c-4198-aacd-d0a03564edae');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'el mejor lejos, dio casi todas las clases y se le entendia joya. siempre estaba abierto a consultas y no buscaba complicarte la vida', '63a7dd6d-b14c-4198-aacd-d0a03564edae');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'es lo mas ', '63a7dd6d-b14c-4198-aacd-d0a03564edae');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El curso de los miércoles a la mañana es el mejor.', '63a7dd6d-b14c-4198-aacd-d0a03564edae');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Molaro, el peor corrector que te puede tocar. No aprobo a nadie. Si te metes en su curso tenes chances de recursarla porque si te corrige te hace rehacer por siempre la primer lamina', '46a12fee-4616-429b-86b1-5ecd057b2445');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es dentro de todo decente. Responde dudas por whatsapp muy frecuentemente. En clase casi no interactúa, solo tira algún chiste cada tanto.', '7315665b-8ef5-42b0-b23a-fa39323ca3d8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Si no entendés algo te trata de tonto, después se hace el copado. Pero es tolerable.', '7315665b-8ef5-42b0-b23a-fa39323ca3d8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Idem Fernández, su actitud te termina sacando las ganas de participar.', '7315665b-8ef5-42b0-b23a-fa39323ca3d8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Personalmente el trato con el fue bastante malo, en ocasiones te forrea o provoca cuando uno está preguntando porque realmente no entiende. En otras ocasiones el trato es adecuado. En general no responde mucho por el grupo del curso, las correcciones aveces son un poco injustas especialmente en las primeras láminas. Entiendo que por ser las primeras hinchan un poco más de lo normal pero aveces se pasan', '7315665b-8ef5-42b0-b23a-fa39323ca3d8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'santiago es medio denso porque hace chistes tontos para picantearla y al momento de corregir es tan exigente como un docente de mecánica, sí es accesible para preguntarle por correcciones pero a veces rebotó láminas por errores muy pequeños, en mi opinión.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Pablo es el ayudante que supongo quedará a cargo del curso. Es exigente en cuanto a las correcciones, pero se nota que sabe un montón. ', 'fe740113-fd74-4c68-a6e3-9e3fc355ca18');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buen profesor', 'f7cd804e-0415-4c83-aa5d-6dc0d0e1a140');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'El indio es un genio. Un tipazo, lastima que este fue su ultimo cuatri dando la materia.', 'f7cd804e-0415-4c83-aa5d-6dc0d0e1a140');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Recomiendo grabar las clases con algún programa externo.', 'f863c1b0-e9aa-47e4-b4db-0f2fb4b28f1a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Si estás al borde en el final te toma un ejercicio el cual tenés que acordarte la respuesta de memoria (en el final también suele haber 1 ejercicio random donde te tenés que acordar o una fórmula o un gráfico de memoria de los que se mencionó 3 minutos en clase), y sino te lo acordás te trata como si fueras un paria, por no decir un insulto. Un desastre. ', 'f863c1b0-e9aa-47e4-b4db-0f2fb4b28f1a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Llega 45 min tarde TODAS(literal, todas) las clases. 10-15 min + poniendo el proyector. Te va pasando unas diapos con el proyector y va dando calses, cuando explica se le entiende lo que dice pero va media rápido y si no vas con 0 conocimientos de economía te re perdes. No te pasa las diapo(pero se consiguen por un grupo de telegram) y si te sentas lejos no se ve una m****a. Dentro de todo explica bien pero si pregunta algo de la clase y nadie responde se re enoja y te manda a leer el libro(que es pesimo)', 'f863c1b0-e9aa-47e4-b4db-0f2fb4b28f1a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es una completa vergüenza que exista una única cátedra de esta materia con el contenido ideológico que tiene. En rigor, no debiera ser así, ya que, como Botta bien dice, la microeconomía es una disciplina de economía positiva y no tiene sesgos, es lo que es y punto. El problema es que Botta se pasa la mayor parte de la clase (cuando está en la clase, llega de 15 a 40 minutos tarde) divagando sobre por qué en el exterior están mejor que nosotros (en Londres es porque a los tacheros le sacan el registro si cometen infracciones, en USA es porque si vas a Disney y querés salir por la entrada viene un equipo swat y te acompañan a que des toda la vuelta para que salgas por la salida y no por la entrada), sobre por qué el mercado de la grasa es re mafioso y si vos tenés una carnicería y le querés dar la grasa que te sobra al camión que tiene jurisdicción en la vereda de enfrente y no al que te corresponde van y te destruyen el local, etc. Es inaudito que este señor esté dando clases en la FIUBA haciéndole perder el tiempo a la gente. ', 'f863c1b0-e9aa-47e4-b4db-0f2fb4b28f1a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'La primera vez que lo vi fue en el final. Es el profesor más desagradable que tuve hasta ahora, se pelea con los alumnos y es soberbio.', 'f863c1b0-e9aa-47e4-b4db-0f2fb4b28f1a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es el profesor de la teorica, a veces divaga mucho. Creo que es libertario. No quiere dar sus diapos a los estudiantes.', 'f863c1b0-e9aa-47e4-b4db-0f2fb4b28f1a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'No se llega a tomar bien los apuntes por el tiempo. Se pone a explicar cosas que no son necesarias pero sobre los temas que realmente evaluan es un "esto despues lo vamos a ver". Los exámenes finales son imposibles, el tiempo es totalmente insuficiente. No se llegan a leer los enunciados y resolver. En el caso de los prácticos te confundis en alguna cuenta y olvidate, no hay tiempo de corregir, tampoco de revisar', 'f863c1b0-e9aa-47e4-b4db-0f2fb4b28f1a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'No me pareció que explicaba muy bien, pero más que nada porque se iba por las ramas y perdía el foco de la clase intentando llevar los temas a ejemplos reales que son mucho más complejos como para analizarlos con la materia. Tampoco tenía el mejor de los tratos, pero tampoco el peor. Lo que sí es un problema es el método de evaluación, que por defecto se lo atribuyo a él por ser el de la teórica pero capaz le corresponde a otro o a todos juntos. Te dan muy poco tiempo por ejercicio si no sabés perfectamente qué es lo que tenés que hacer de una (es decir, si no reconocés la consigna como una de un ejercicio que ya resolviste), te hacen escanear cada ejercicio al final de cada uno en vez de darte tiempo al final, lo cual te saca tiempo de resolución, y tenés que entregar uno antes de empezar el siguiente, que me parece cualquiera.', 'f863c1b0-e9aa-47e4-b4db-0f2fb4b28f1a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Metodologia de evaluacion pesima, tiempo reducido de resolucion de ejercicio de forma que si uno se confunde en un despeje tiene todo mal. No se evalua el concepto sino la velocidad de resolver el problema. ', 'f863c1b0-e9aa-47e4-b4db-0f2fb4b28f1a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy malo dando la teórica, lo mismo que todos los demás, sobrador, arrogante, si te equivocas en algo medio que te habla sarcástico y de mala manera.', 'f863c1b0-e9aa-47e4-b4db-0f2fb4b28f1a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es quien da la teórica. Te pasa presentaciones de diapositivas que no te las da porque "esto esta en cualquier libro". En mi opinión no explica con claridad, si hacen muchas preguntas casi que se empieza a poner de mal humor.', 'f863c1b0-e9aa-47e4-b4db-0f2fb4b28f1a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy poca voluntad para adaptarse a la virtualidad. Deja mucho que desear la práctica.', '90363110-72a0-459d-bd2e-541e52e880b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', '0 ganas de dar la materia. Llega, hace un ej de 5minutos por clase ,toma asisntecia y listo. A veces te pasa unas diapo en clases para resolver un ej pero no te da ni tiempo a copiar nada(y tampoco te pasa las diapo). Cada vez que hace un ej en clase te dice "esto es muy facil a si que lo paso rapido" y eso es el 90% del ej. Las clases antes del parcial te tira 1 o 2 ej que capas entran. Son re molestos con la asistencia y es casi seguro que si no fuiste a cursar no aprobas el parcial', '90363110-72a0-459d-bd2e-541e52e880b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Gustavo se la pasa enojado toda la clase y cree tener razon a toda costa. Se la pasan queriendo hacerse los jefes con condiciones injustas de examen. Corrijen sin corregir, le dan la tarea a la maquinita, te piden llenar nros nomas. Despues no te ponen nota de cursada, te ponen Ap o Ins. No toman en cuenta el concepto. Toman preguntas para la asistencia en Socrative, un programita online que hace cuestionarios.', '90363110-72a0-459d-bd2e-541e52e880b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Idem Palavecino.', '90363110-72a0-459d-bd2e-541e52e880b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Metodologia de evaluacion pesima, tiempo reducido de resolucion de ejercicio de forma que si uno se confunde en un despeje tiene todo mal. No se evalua el concepto sino la velocidad de resolver el problema. ', '90363110-72a0-459d-bd2e-541e52e880b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Lo mismo que los otros dos profesores, este por lo menos es un poquito más tranquilo, pero no deja de ser como los otros 2.', '90363110-72a0-459d-bd2e-541e52e880b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Casi igual de soberbio que Palavecino. Diría que una versión un poco menos forro nada más.', '90363110-72a0-459d-bd2e-541e52e880b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Muy poca desenvoltura dando clases para la cantidad de años que tiene como JTP, pero bueno, hace ejercicios clave de la guía y se aprueba tranca la materia', 'ca00b2e0-06d6-4ed8-8a3d-8fe2381ff015');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Se pone la materia al hombro, genia.', 'ca00b2e0-06d6-4ed8-8a3d-8fe2381ff015');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'La única profe "buena" de la catedra. Al lado del resto ella es lo que esperas de una clase normal. Es muy paciente, se preocupa por los chicos en clase y contesta dudas en la clase. No va a casi ninguna clase :c ', 'ca00b2e0-06d6-4ed8-8a3d-8fe2381ff015');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es la unica decente de la practica, cuando explica se le entiende mejor que a botta. ', 'ca00b2e0-06d6-4ed8-8a3d-8fe2381ff015');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'La única del curso que explicaba los temas de la clase tal cual los había preparado, no te trataba mal como los de la práctica y no se iba por las ramas como botta.', 'ca00b2e0-06d6-4ed8-8a3d-8fe2381ff015');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Metodologia de evaluacion pesima, tiempo reducido de resolucion de ejercicio de forma que si uno se confunde en un despeje tiene todo mal. No se evalua el concepto sino la velocidad de resolver el problema. ', 'ca00b2e0-06d6-4ed8-8a3d-8fe2381ff015');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Mi opinión sobre esta genia se resume en "Sacame a Botta, Carrizo y Palavecino y dejame a Silvia dando la materia sola". Explica todo lo que preguntas, te deja hacer muchas preguntas. Se le entiende todo y si no le entendiste te lo explica de otra manera.', 'ca00b2e0-06d6-4ed8-8a3d-8fe2381ff015');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy poca voluntad para adaptarse a la virtualidad. Deja mucho que desear la práctica.', '482cc54a-92b5-444d-bfe5-560e5284b359');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Llega 10-15 min tarde, toma asistencia(importante para el parcial), hace 1 o 2 ejercisios (con suerte) basicos de cada tema y termina la clase. Nunca dio mas de 1 hora de clase (la excusa es que jugaba boca). Explica bien pero no le pone muchas(ninguna) ganas a la materia', '482cc54a-92b5-444d-bfe5-560e5284b359');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Los dos chabones de la práctica son un desastre. Se hacen los piolas con los alumnos, si preguntas algo que no llegaste a escuchar te tratan de boludo, no son capaces de dar pautas claras para rendir un parcial, no hay un PDF ni nada que deje por escrito cómo son los criterios de aprobación. Dos tipos completamente desagradables.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Típico que te pide que participen en clase y cuando uno lo hace y se confunde lo basurea. Y después se queja si nadie quiere participar. Tiene la actitud de creer (o saber, en parte gracias a ellos) que su materia no le interesa a nadie entonces nunca piensa que una pregunta fue de buena fe o porque alguien quiere aprender algo de la materia. La verdad no se aprende nada en sus clases, que consisten en hacer gráficos sobre un powerpoint que no son para nada claros, y la única razón por la que muchos van es porque el presente es obligatorio e implica responder unas preguntas por socrative, una página.', '482cc54a-92b5-444d-bfe5-560e5284b359');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Metodologia de evaluacion pesima, tiempo reducido de resolucion de ejercicio de forma que si uno se confunde en un despeje tiene todo mal. No se evalua el concepto sino la velocidad de resolver el problema. ', '482cc54a-92b5-444d-bfe5-560e5284b359');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es sobrador, detestable, el peor curso que tuve.', '482cc54a-92b5-444d-bfe5-560e5284b359');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Pésimo docente. Cada pregunta que uno tiene contesta de mala manera y la mayoría de las veces con un "deberían saberlo". Se nota que no tiene ni ganas de trabajar.', '482cc54a-92b5-444d-bfe5-560e5284b359');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es el profesor de la teórica. Es un fenómeno como profe, sus clases se basan en un apunte escrito por él donde explica los temas, fomenta la participación en clase y el debate ya que son temas económicos. Hay que rendir dos exámenes orales, y hay que realizar un tp grupal (distinto al de la practica) sobre un plan económico. Lo único malo es que al ser un viernes de 18 a 22 se vuelve un poco pesado (por el horario) pero siguiendo el apunte y llevándolo al día se aprueba.', 'accec787-49ee-4cdc-a151-4d482e6c85d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Berisso dió la teórica de la materia, pero estaba en proceso de jubilarse, así que la teórica la va a pasar a dar Bertoia (que antes estaba en la práctica). Aún así para Berisso solo tengo buenas palabras, la teórica se daba con su libro, que era medio plomo pero con la segunda leida ya entendías los temas, la modalidad era de dos parciales teóricos para la parte teórica.', 'accec787-49ee-4cdc-a151-4d482e6c85d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bien los temas y sabe de lo que habla, a veces pone su punto de vista(la economía lleva a eso) pero lo complementa con su punto de vista político que no suma.', 'accec787-49ee-4cdc-a151-4d482e6c85d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy buena onda. Sus clases son re claras e interesantes porque lo relaciona mucho con hechos economicos que fueron pasando', 'accec787-49ee-4cdc-a151-4d482e6c85d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Osvaldo es un genio. Un profesor que conoce y domina todos los temas de su materia y la explica con mucha fluidez', 'accec787-49ee-4cdc-a151-4d482e6c85d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Daba la practica. En clase veíamos los temas y hacíamos ejercicios del estilo. Para el parcial los ejercicios eran parecidos a los que habíamos visto en clase. También hubo un tp, con una parte individual y una grupal, que le tenías que dedicar un tiempo pero no era muy difícil. ', '5e48b509-5d10-43d7-9faf-4672acf744fa');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Respetuoso y concreto.', '5e48b509-5d10-43d7-9faf-4672acf744fa');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Sus clases se sienten un poco lentas, pero no son malas', '5e48b509-5d10-43d7-9faf-4672acf744fa');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Esta materia está pésimamente organizada. Los temas son fáciles, y los grupos de tp son grandes y si te organizás el trabajo es mínimo. Yo promocioné la materia, pero no pude ir a firmar la libreta en ese cuatrimestre. Al siguiente cuatrimestre quise ir a firmarla, habiéndome anotado al final. Me dijo que a mí se me había vencido ya, y cuando le intentaba explicar, me seguía diciendo que me vaya. Al final, luego de varias insistencias, se fijó en la lista (antes ni siquiera eso quería hacer), y me la firmó.', 'de7c5688-ce87-4b32-b89e-acf7409addcb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es un profesor que denigra a los alumnoa', 'de7c5688-ce87-4b32-b89e-acf7409addcb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'La cursada consta de la aprobación de 1 trabajo práctico grupal + 1 parcial individual.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Conoce su materia completamente. Responde todas las dudas que se le hicieron de manera rápida ya sea por Slack o el Campus. Aunque a veces te puede dejar con más dudas que antes de preguntar. En las clases se pelea por hablar con el resto de profesores, que al principio es gracioso pero después es molesto. ', 'e05fac0b-fb26-40f9-8205-ac5d0d632853');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Está siempre atento, responde por Slack súper rápido y completo. Si bien no es perfecto, es bastante bueno explicando, aunque a veces se va por las ramas. Merece el sueldo por todo el trabajo que hace, está prácticamente siempre conectado y atento a la materia. Eso puede ser un poco molesto porque la materia es MUY demandante. Hay TP's, ejercicios semanales para entregar y exponer oralmente, preguntas teóricas semanales(aunque son muy fáciles), y un parcial que puede o no tener su dificultad. Requiere cierta lógica la materia.  ', 'e05fac0b-fb26-40f9-8205-ac5d0d632853');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bien, pero se nota a veces como extiende la clase innecesariamente. Siempre muy atento a las preguntas de Slack!', 'e05fac0b-fb26-40f9-8205-ac5d0d632853');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'la clase consiste en que los alumnos que resolvian ejercicios presentaban y aveces no sabia si lo que estaba haciendo era bien o no porque lo hacian de manera distinto. ', 'e05fac0b-fb26-40f9-8205-ac5d0d632853');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Los ayudantes de la práctica del viernes a la mañana también son excelentes, aunque no estén para puntuar. Andrés Otero y Federico Brasburg  tienen una gran predisposición que facilita mucho la cursada', '0966b639-2373-4afd-8b04-ec823483e3bb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Se encargo de las teroicas, que eran videos de YTB. No tengo opinion formada', '0966b639-2373-4afd-8b04-ec823483e3bb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Pablo es un crack conectar las explicándoles con cosas de algoritmo es un copado le podes mandar mail siempre te responde a las consultas simplemente un genio siempre te ayudará con consultas particulares . Casi 28 de 30 paro vamos el parcial a la primera chance en el 2do cuatro del 2021', '0966b639-2373-4afd-8b04-ec823483e3bb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Pablo nos dios un tp relativamente muy facil muy light, con lo pesada que es la materia, el tp consiste en prendas y lavados donde alfinal terminamos haciendo un coloreo de grafos. nos ayudo bastante con el tp. ( poco codigo).  sus  explicaciones de los  ejercicios son claros faciles de entender conecta te traduce lo que dice el enunciado a "criollo" y asi se resuelve mil veces. los truquitos unicos de pablo un grande me servio para el final. Siempre puntual la clase arranca 19:00 en punto y
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buen profesor, muy claro explicando, hace muchísimos ejercicios en clase. El tp y parcialito sale fácil.', 'e3a640f1-190b-4247-9b2c-e1edf4da711d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Genio. Dedicado a la materia y a sus alumnos. Quiere que apruebes, por lo tanto enseña bien los temas prácticos. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Gran profesor. Explica con mucha claridad. Las clases no son organizadas y son muy tediosas. En la practica solo se resuelven los ejercicios que estan asignados en el calendario. No hay ejercicios obligatorios a resolver, solo hacer algunas presentaciones de los mismos. Luego de la evaluacion parcial, te toman un parcialito sobre la segunda parte para aprobar la practica', 'e3a640f1-190b-4247-9b2c-e1edf4da711d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es ayudante de la practica. Suele realizar comentarios sobre algun tema en particular, no mas que eso. Es bastante exigente corrigiendo y se encarga de tomar presente (sí, no solo tenes que entregar los ejercicios antes de la clase para dar el presente)', 'e3a640f1-190b-4247-9b2c-e1edf4da711d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica los temas de a poco, que dependiendo como vengas con la materia te puede ser útil o molesto. Hace preguntas y en la virtualidad puede ser algo incómodo. Sus clases son muy tranquilas.', '3aca32eb-e60c-4b9e-be48-ac6f1b44c7f0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica bien. No está tan disponible como Pablo, sin embargo, buena experiencia general.', '3aca32eb-e60c-4b9e-be48-ac6f1b44c7f0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se nota que es un gran profe, que sabe mucho y que quiere que sus alumnos aprendan. Se nota que se dedica a su trabajo. Lamentablemente, no pude ver su mejor versión como profesor ya que sufre de parkinson y eso afecta mucho su forma de trasmitir su conocimiento. Por suerte tiene un equipo docente que complementa muy bien. ', 'befb768c-c407-4d1e-abbb-1ec9357ab7ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es un profesor que no explica muy bien y se la pasa generando miedo para que no nos confiemos. Suele llegar tarde a clase. Para cada clase practica hay que entregar entre 3 y 5 ejercicios de la guia de ejs. por grupo, los cuales son presentados y explicados en clase por algun grupo. Por ende, son los alumnos los que dan la clase, mas algun comentario de algun profesor. Esa modalidad me parecio un desastre ya que las clases se volvian muy monotonas debido a que era un monologo constante imposible de seguir, mas aun si no habias hecho el ejercicio que estaban presentando. Toman un parcial (que te lo pueden llegar a complicar bastante) y 2 tps bastante tranquis. La materia en si no es dificil, pero la catedra busca complicartela todo el tiempo, una actitud bastante chota.', 'befb768c-c407-4d1e-abbb-1ec9357ab7ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es un genio se queda ahast alas 23 PM atendiendo consulto casi todos los que cursamos el 2c2021 dimos el final y aprobamos 29 de 30 . Es un genio aprobaras de una con esta cátedra ', '245f3d14-f06e-47f6-9656-666eab5ccd23');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Diego bastante bueno con los parciales y los temas, siempre contestando las consultas si explicaba muy bien en virtual no me imagino presencial es lo maximo, lo unico bastante completo con los temas.', '245f3d14-f06e-47f6-9656-666eab5ccd23');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Explica muy bien, repite todo hasta el cansancio. Las clases duran hasta el último minuto. Son un poco aburridas. Es buena corrigiendo.', '3a2704e9-ff0e-4a6d-9c48-fb0bb92682ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No cursé con Silvia, pues te dejan faltar a la teórica si presentas certificado de que cursas Sistemas Operativos al mismo tiempo. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Se encargo de las teroicas, que eran videos de YTB. No tengo opinion formada', '3a2704e9-ff0e-4a6d-9c48-fb0bb92682ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Con los videos tenés más que suficiente. Estás listos para resolver la guía ', '3a2704e9-ff0e-4a6d-9c48-fb0bb92682ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Nos dio videos de  youtube como teorica. explica bastante bien. claro ', '3a2704e9-ff0e-4a6d-9c48-fb0bb92682ce');
