INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Trato a veces violento, sin necesidad.', 'e50d8902-10a3-490e-b38b-849cc27e73ce');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Educado pero de poca participación en la clase.', '15b62530-5dba-467d-9f12-16ddfd1fb2d1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Figura nefasta de la facultad. En permanente clima de conflicto, con planteos descabellados y condiciones de aprobacion muy complicados y exigentes. Ojalá se haga algo con este tipo desde el centro de estudiantes. Es inadmisible que una persona asi siga dando clases, desprestigia a la facultad.', 'b493a35a-8090-4bd5-b30f-9ec877da80f6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Violento y maleducado, trata con desprecio a los alumnos y no respeta horarios. No acepta ninguna crítica y dá temas por sabidos que no se vieron en la carrera hasta ese momento, exige conocimientos que NO imparte y tiene muy mala predisposición a los alumnos.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'El más educado y bien intencionado de los profesores, intenta hacerte entender aún desconociendo algún tema.', 'd16b3b49-04f1-4b57-b154-965f8bab6eeb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'no nos quiso dejar cursar a los condicionales porque le pinto. despues ir a clase es una tortuta, el trato es horrible a los alumnos. se hacen los soberbios o nos tratan de tontos.', 'dc494e89-9356-4a59-ba2e-47a218252882');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No le pregunten nada a Laura porque siempre está de mal humor y te responde de la peor manera. ', 'd17153ec-1e88-4b19-a6d7-468c722da19e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Jahn te habla como si entendieras todo y ya hubieras nacido siendo economista. El piensa que todo es totalmente obvio. La mayoría de las clases las dicta él y las de consulta también. No sé le entiende en ninguna. Para presentar un tema te habla de la actualidad que te entretiene pero que no te ayuda a hacer los ejercicios de la guía ni mucho menos los de parcial. ', '09f39618-36d3-4ad8-97c0-c4a49e6d0a1e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Es una persona malvada. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Por lo que pude cursar se nota que sabe de la materia, pero explica muy mal. Hubo un par de clases de consulta que fueron buenas, pero en la cursada muy mal.', '09f39618-36d3-4ad8-97c0-c4a49e6d0a1e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es al único del curso que se le entiende algo. Yo no sé por qué no da las clases de consulta él. ', 'e94ca588-0e62-49ae-bcf2-3ba6b85328c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'German sabe mucho y sabe explicar muy bien. A veces no responde de la mejor manera, pero en cuanto a la materia es el mejor en la catedra.', 'e94ca588-0e62-49ae-bcf2-3ba6b85328c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No participó en las clases. Fue el encargado de corregir los TP. Creo que fue bueno corrigiendo, incluso nos extendió el tiempo de entrega varias veces.', '73db936e-b4ad-49ee-9a50-c0d24d310b62');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explicó la primer clase (introducción) y las últimas 2 (derecho real y comercial). Es buen profesor, los apuntes que usa son mas organizados y tiene un buen trato con los alumnos. Mucho mas fácil seguir sus clases.', '73bfc97a-f6fd-42cd-853d-b40459fc3229');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Este es el que da las clases. Las clases son muy desorganizadas. El tipo lee unos PDF bastante desprolijos y es difícil seguirlo. ', 'ae8a2a09-0e3d-46b9-8c8c-bb0097336e54');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Si no me equivoco, el da la parte de Contabilidad. En general van al grano y sin vueltas. Eso es clave para estos temas tan aburridos. ', '75533295-b514-42a7-85d2-6acc89bbf16f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es el que menos vueltas da. Muy claro y simple', 'e6dfd7aa-9950-40a5-96c5-61c4050f59aa');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Cuesta entender los PowerPoint porque son nodos apuntándose entre si. También explica muy despacio. Pero lo bueno de esta materia es que graban todas las clases, y si parecen muy lentas simplemente se pone en x1.25. ', '29a6ca16-f2b4-434c-b125-c6b86626d68b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Andres no hace otra cosa que recomendar sus videos de youtube y sus libros.  No explica nada de la practica ', 'a2a68f71-c1ad-47d1-8a9b-67ba43dcaaf2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Igual de activo que Ernesto y Mechi para responder consultas, sólo que un toque más relajado para dar clase (no mucho). Nos tocó como corrector de TP y siempre cumplió a la hora de hacernos devoluciones del mismo. Es un tipo muy dedicado, vive trabajando y aún así te responde todas las consultas que le hagas por WhatsApp. Muy recomendable el curso.', 'aea44840-8e81-4287-959f-b9eb7e50b8e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Tipazo. Siempre disponible para responder dudas por mail, a cualquier hora cualquier dia. ', 'fa216507-8094-409e-b4c4-288bb4c6f4e7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Ernesto tiene mucha energía para dar clase, necesaria después de la teórica pausada y tranquila de Pinchete. Muy activo en cuanto a consultas, siempre respondió sólido y de muy buena manera. Junto con Carlos y Mechi hacen de la práctica una charla entre ingenieros, sentís que estás en una conversación más que en una clase. Si no tienen inconveniente con el horario recomiendo fuertemente esta práctica.', 'fa216507-8094-409e-b4c4-288bb4c6f4e7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'no se entiende nada, se la re complica explicando y después pretende q sepas todo', 'c714debf-4a10-4216-80bf-2275ba025236');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'en la práctica explican basicamente lo mismo que pinchete y a veces hasta terminas mas confundido. Ursula parece buena onda pero es demasiado exigente para una materia que no lo vale, que el final no te lo corrija ella. ', 'c714debf-4a10-4216-80bf-2275ba025236');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Buen profesor, muy claro y conciso en sus explicaciones. Sus clases no se graban, pero las presentaciones que muestra están subidas al campus para poder verlas.', '0ddb0e22-43ec-4314-baaf-7bcc268f88bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Presenta diapositivas de las va hablando encima. Es muy relajado explicando, se entiende todo lo que da pero después de la primer media hora se vuelve difícil prestarle atención al 100%, se vuelve muy monótono. Generalmente las clases teóricas terminan entre 30 y 45 minutos antes, dependiendo de cuántas consultas le hayan hecho o de qué tan extenso sea el powerpoint de esa clase. Buen profesor en general.', '0ddb0e22-43ec-4314-baaf-7bcc268f88bd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Materia muy aburrida. No pasan falta durante la teórica. Para el parcial me sirvió mas estudiar y entender por mi cuenta.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Buena profesora, ayuda mucho en las clases prácticas fomentando la participación en clase y realizando preguntas que se suelen tomar en los exámenes. Fue nuestra correctora de TPs, que consiste en hacer un informe (y al final de cuatrimestre una presentación oral de 15-20 minutos) acerca de la historia, reglamentación a cumplir, funcionamiento y conformación de las piezas de una máquina u objeto. Nos ayudó mucho para poder buscar información, aunque fue un poco exigente en cuanto al nivel desarrollo y profundidad que debíamos realizar para cada pieza de nuestra máquina.', '8af79ac1-cdbc-4c1f-94dd-429ce7062544');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Fue la tutora durante el tp que hay que hacer en la materia. Tp fácil. Supuestamente es un tp durante todo el cuatrimestre pero nosotros lo arrancamos recien despues del parcial. Lo hicimos en menos de 2 semanas y despues hay que defenderlo oralmente. Macarena es buena onda.', '8af79ac1-cdbc-4c1f-94dd-429ce7062544');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Lo mismo que Ernesto, muy enérgica para dar clase, predispuesta a responder dudas. Me dio la impresión de que era un poco más exigente que los otros en cuanto a la elaboración del trabajo práctico, pero nada del otro mundo, en sí el trabajo es bastante llevadero. Siempre es interesante lo que explica Mechi, dan ganas de estar en la clase.', 'fe02aa3c-ca57-4efa-bb34-7d899ead181a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Un grande el turco. Siempre abierto a responder dudas, tiene un mail exclusivamente para eso. Si encontrás un error en las guías las vuelve a subir corregidas a las pocas semanas.', '46d4860a-dc3c-472e-a5cf-0563a859e2d8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es buena onda y explica muy bien. Es justo, pero con una materia tan dificil y con tanto conenido podría ser un poco más piadoso.', '46d4860a-dc3c-472e-a5cf-0563a859e2d8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Crack total, un genio explica super. Igual ojalá deje la materia asi sube el material a SK ;)', 'b1c54cca-2ca3-4a45-b5c9-25997ceab828');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Cursar con él es una fea experiencia. Se nota que sabe un montón, pero su trato con los alumnos es pésimo por sentirse un ser superior. Siempre hay un aire tenso cuando está en el aula.', '7bda119b-908d-4d81-9072-67deddbba19f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy pesado con el TP', '98a9a295-0e5b-4f99-8a2b-6558369babbe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Clases muy largas,se excede por demás en contenido.', 'c4c251e9-b15d-4f23-bdad-ca9687df3b44');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Aita medio fantasma. Aparece algunas clases y da una en específico que es sobre el buen uso de AutoCAD que está tremenda', '1e85fad0-ad89-4a90-b206-1fb3317cd6a2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Ya no está Marengo como JTP, ahora está Antonio "Tony" Elizagaray que es un tipazo', '48abf299-a4f4-4306-bf65-2cbb33f63173');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Un bochazo el Toubes. Virtual se hizo medio paja porque leía pdf y explicaba de ahí, pero maneja muy bien la materia', '50b79a89-f17c-4d7c-a4eb-d4e449425704');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Esta mina es RE buena. Sus clases eran medio bodrio pero explicaba bien y si le preguntabas no tenia drama en responderte 20 veces las cosas.Es re comprensiva y le podes plantear todo,hablar todo.Quiere que aprendas python pero sabe que es dificil. Te enseña desde 0 asi que si nunca programaste te va a ir bien. Las guias y los examenes los hace ella asi que sabes que te van a tomar.Pero es una cursada super relajada y la mina es re copada y hace todo porque te vaya bien,anotate aca', '7b80e180-62a8-4e1a-ac43-1fb350fe6bcc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Arriazu es lo mejor que existe en computación no tiene nada malo explica bien sin apurarse,te enseña a programar python como nadie,yo siendo un termo en tema computadoras pude aprobarla re bien(literal sin haber programado) se toma la re paciencia en todo,quizá que veces en el mail tarde un poco pero es ella sola aso que es comprensible,fue un excelente cuatri cuesta con ella', '7b80e180-62a8-4e1a-ac43-1fb350fe6bcc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buena profesora, re considerada y se encarga de que entiendas todo sin importar que te lo tenga que explicar varias veces. El campus está re bien y tiene todo lo que necesitas para entender como hacer los programas.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Arriazu es un amor, explica bien, las clases son organizadas, arma buenos pdf y los envía.', '7b80e180-62a8-4e1a-ac43-1fb350fe6bcc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Excelente trato, explica muy bien la materia. Sube 2 dias antes los teoricos que ella arma en un pdf, en la clase lo vuelve a leer y va explicando parrafo por parrafo...Brinda una guia de ejercicios la cual es opcional y cada dos o tres semanas hay un parcialito de los temas, por eso es recomendable hacer las guias, las cuales sube su resolucion antes de la siguiente tanda de ejercicios a realizar. Cuando la curse tuvimos tambien 2 trabajos practicos grupales, los cuales los arma ella al azar(en mi caso el unico que tenia una buena base en progamacion era yo...).
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es la mejor profesora de fiuba sin duda alguna. No solo es excelente explicando, el trato con los alumnos es excelente. Literalmente explica como los dioses. Arranque el curso sin saber un pomo de python, y lo termine de muy buena manera. Desde un principio ya aclara como va a evaluar. Al principio eran 3 parciales y un TP grupal, habiendo aprobado dos parciales ya regularizabas, peero si aprobabas un solo parcial, haces el tp grupal y listo. A lo ultimo, por tema de feriados, terminamos teniendo 3 parciales, y como examen final podias hacer el TP grupal y cada uno del grupo lo defendia oralmente individualmente. En fin, sin duda es el mejor curso de compu.', '7b80e180-62a8-4e1a-ac43-1fb350fe6bcc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buena onda pero las clases son eternas y explica cosas que no sirven. Igual  no hay asistencia obligatoria. Usan las 4h de clases cuando podrían ser 1h con python abierto explicando como usar las funciones. Igual no es difícil aprobar la cursada y el final fue hacer y defender un tp grupal. La recomiendo.', '7b80e180-62a8-4e1a-ac43-1fb350fe6bcc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Esta profe solo da la teoría; enseña bien, yo al menos entendí todo. El sitio del curso en el campus está claramente organizado, no hay donde perderse sobre el material de apoyo de cada clase teoría y practica. El 1er parcial es grupal (2 alumnos) en la PC del lab. sacable en el tiempo que dan. Ya el 2do parcial y el final es individual. El exámen final es parte multiple choice con un desarrollo de la respuesta de cada pregunta y un ejercicio de seguimiento de un algoritmo complejo (difícil), que ante una entrada dada se debe indicar el resultado. Lo bueno de esto que tenemos la nota final de la materia en el momento. Lo negativo de la profe es que le cuesta llegar a la hora de comienzo.', '7b80e180-62a8-4e1a-ac43-1fb350fe6bcc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Persona muy cálida', '7b80e180-62a8-4e1a-ac43-1fb350fe6bcc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Nunca nos perdimos una clase entera, pero siempre llegaba tarde y terminaba antes. En general siento que las clases estuvieron bastante desaprovechadas, pero aún así, y en el tiempo que tuvimos, se vio que Arriazu sabe y tiene voluntad de enseñar. Aprendí mucho de Python, en una cursada muy tranquila, por lo cual la super recomiendo.', '7b80e180-62a8-4e1a-ac43-1fb350fe6bcc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Suele llegar tarde', '7b80e180-62a8-4e1a-ac43-1fb350fe6bcc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'buena docente, pero la materia al ser virtual se hace más densa y no tan entretenida', '7b80e180-62a8-4e1a-ac43-1fb350fe6bcc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'GROSA
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'En el cuatri que cursé tuvo una predisposición deplorable para responder cualquier tipo de dudas. Cualquier consulta era recibida con mala onda siempre, se frenaba un poco cuando eran preguntas sobre conceptos nuevos, pero cualquier otra pregunta que no cayera en esa area era respondida con muy mala gana. Arriba de eso, se perdieron muchas clases haciendo pocos temas y avanzando lentisimo. Recien se vio Python a las apuradas en las ultimas 3 (tres) clases, y en instancia de final tomaron cosas obscuras de Python que sabias si te habías tatuado la pagina que pasan sobre el tema (Que dicho sea de paso te desloguea si no clickeas cada 5 minutos)', '6db0d664-ebe4-4324-b357-ae5bc6495ba6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Él no maneja el campus, pero no le quería bajar el promedio pobrecito. La verdad que el curso es un robo a mano armada, pero es re bueno Cabrera. Pregunta cosas para que participemos en clase, y lo que explica lo explica bien. Según tenía entendido siempre tomaba los mismos examenes, pero este cuatrimestre parece que se despertó y repitió solo el primero. Igual el segundo era fácil. Con ir a las clases y prestar un toque de atención estás, toma lo que da. Eso sí, llega, por lo menos, 40 minutos tarde. Después hay un intervalo de entre 15 y 20 minutos, y a veces, si no llegaron los de la práctica, más todavía. Que se yo, cursar acá estuvo bueno, una caricia al promedio. ', '4ee3f37c-e77e-486e-ac46-42e03eb39b23');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Esta cátedra varía mucho dependiendo de si querés aprobar o aprender. Si es la primera, es la mejor cátedra lejos para eso, parciales facilisimos y repetidos y tp fácil. Si el objetivo es aprender, no te acerques a la misma', '4ee3f37c-e77e-486e-ac46-42e03eb39b23');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es copado, la materia la da muy a la chapas. Como lo q se toma en los parciales es la práctica, la teoría la da así nomás
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Un curso ladri jaja todos los cuatrimestres tomaba el mismo parcial, podía cambiar un item, todos se copiaban, una vergüenza. Es un curso para aquel que no le interesa aprender nada de computación y quiere sacarse buena nota. ', '4ee3f37c-e77e-486e-ac46-42e03eb39b23');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La verdad que muy mal organizadas las clases. las con un celular apuntando a su cara dando vueltas en circulos. la verdad que nefasta la materia con él ', '4ee3f37c-e77e-486e-ac46-42e03eb39b23');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Es una genia patricia , le da mucha bola a la parte practica de la materia, en el cuatrimestre que curse yo , seapro en 2 parciales p, uno teorico , otro practico , que se pueden recuperar por separado . El final es un programa con los contenidos que aprendiste, si seguis la materia es muy facil de aprobar sinceramente.', 'c85a31d7-2e44-4814-a4fa-61eb11aca9f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Da clases en horario siempre, explica bien y claro. Lo malo es que casi nunca responde el campus, y los tps que manda no solo se pueden hacer con el material de clase, los parciales son ejercicios de la guia. Si o si hay que tener los tps aprobados para aprobar la cursada', 'c85a31d7-2e44-4814-a4fa-61eb11aca9f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Me pareció muy buen curso. Explicaba bien y si alguien no entendía lo explicaba las veces que fueran necesarias. Hubo dos trabajos prácticos, un parcial y el trabajo final junto con su defensa para aprobar la materia. Se notaba que la profesora quería que aprobemos la materia entendiéndola y no así nomás.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Genia total. Aprendes una banda a programar, ejemplifica todo y hace super práctica la materia durante casi toda la cursada. Regularizas con un parcial de dos ejercicios re fácil y dos TPs mas dos proyectos. El final es solo teórico ya que toma todo lo práctico por aprendido, son dos preguntas también re simples. Súper recomiendo, aunque te digan que Arriazu es la mejor, con Patricia se te hace fácil aprobar y encima aprendes bocha, no como con Chantabrera (cabrera).', 'c85a31d7-2e44-4814-a4fa-61eb11aca9f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buena explicando , la tiene clara. Las clases fueron la mayoría virtuales y tenias la posibilidad de ver clases del anterior cuatrimestre (se las pueden pedir xq ya las tiene grabadas ). Las clases habia teórica y practica , te suele dar un ejercicio para hacer y cualquiera de los alumnos que termina primero lo muestra mientras lo corrigen juntos . Los parciales muy accesibles , no toman nada que no dieron.  Muy importante seguir toda la practica . Para el final fueron dos preguntas teoricas y listo . Lo único que tarda muchísimo en responder un mal.  El en campus nunca funcionó el foro tampoco .
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Teniendo conocimientos nulos o sabiendo ya programar, Patricia explica EXCELENTE. Se nota que tiene muy clara la materia. Quizá las clases virtuales teóricas fueron un plomo (me dormí en más de una) pero si realmente querés aprender, no tenes mejor cátedra que la de ella.', 'c85a31d7-2e44-4814-a4fa-61eb11aca9f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'la verdad es muy sencilla la materia al menos con ella, pero se tarda mucho en entregar la nota y cuando lo hace es solo aprobado o desaprobado, esta ok, a nunca nos respondian los correos de consulta ', 'c85a31d7-2e44-4814-a4fa-61eb11aca9f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'En las clases básicamente lee los ppts que sube al campus. Al principio es demasiado fácil y la colgás xq te confiás, pero igualmente no es taan difícil. Si resolvés los programas de alguna forma que no vieron en clase, no le copa mucho. ', 'c85a31d7-2e44-4814-a4fa-61eb11aca9f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Sabe bastante de programación. Explica de manera que cualquiera que nunca haya tocado código entienda. En los parciales toma lo que dio en clase y nada mas. Los primeros 2 TPs son faciles tirando a regalados. El 3er TP es muy dificil. En el caso de mi curso nos hizo hacer una batalla naval contra un bot. La parte de la inteligencia del bot fue extremadamente dificil.', 'c85a31d7-2e44-4814-a4fa-61eb11aca9f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es la mejor. Sus clases son muy organizadas y explica perfecto. No tiene drama en explicarte lo que no entiendas y de buena forma. Es un poco lenta contestando mails pero lo hace.', 'c85a31d7-2e44-4814-a4fa-61eb11aca9f5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Crea un grupo de facebook, con sus alumnos. A nivel comunicacion muy bueno.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es un tremendo profesor, muy claro para explicar, se manejan por slack y contestan re rapido ualquier duda', 'e910383d-f514-4725-b5d6-226b0e3668ea');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Da la primera parte de la clase, las teóricas están bien explicadas, dejan todo claro y son entretenidas, es medio colgado, no responde rápido o ni responde pero en clase te saca todas las dudas y le gusta que participes', 'e910383d-f514-4725-b5d6-226b0e3668ea');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'La verdad re mal. No contestan en el campus y no tienen ni cronograma. Ya de en si la materia es aburrida y ellos la hacen mas densa. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Ella daba las clases teóricas, que en realidad lo que hacia era leer un power point, se hacia bastante aburrido y denso, pero ambas te trataban de manera muy amable y la cursada fue bastante fácil ', '0845b296-feff-4dd0-be72-2e19b1319fe4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es regalada esta catedra. Nos tomaron un parcial que era idéntico al del cuatrimestre pasado, y te dejan promocionar la materia (No se si te dejan en el resto de las cátedras) si haces un trabajo practico grupal. Los profesores no son tan exigentes y aprendes un toque de Phyton. Conclusión: Si queres aprender bien a programar en esta materia, no te conviene esta catedra. Si simplemente queres aprobar, este curso no va a ser muy exigente. ', '0845b296-feff-4dd0-be72-2e19b1319fe4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es el mejor', 'da4ab1f8-e673-4939-8227-e6aaaacc0a38');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'El único rescatable, exocaba bastante bien. Medio pajero con los mails', 'da4ab1f8-e673-4939-8227-e6aaaacc0a38');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'El único profesor presentable, para mí odiaba que todos se copiaran con Cabrera, ellos lo saben. Quería que aprendamos más allá de eso, respondía todas las dudas. ', 'da4ab1f8-e673-4939-8227-e6aaaacc0a38');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Creo que es el mas rescatable de todo el curso... aunque lo que aporta en muy pobre. ', 'da4ab1f8-e673-4939-8227-e6aaaacc0a38');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Al profesor lo vimos unicamente el primer dia de clase (presentacion) y luego otra clase durante el cuatrimestre, pero nada mas, el no nos enseñaba la materia ', '83b3ee61-301d-4ec8-9522-6dc68e119333');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es regalada esta catedra. Nos tomaron un parcial que era idéntico al del cuatrimestre pasado, y te dejan promocionar la materia (No se si te dejan en el resto de las cátedras) si haces un trabajo practico grupal. Los profesores no son tan exigentes y aprendes un toque de Phyton. Conclusión: Si queres aprender bien a programar en esta materia, no te conviene esta catedra. Si simplemente queres aprobar, este curso no va a ser muy exigente. ', '83b3ee61-301d-4ec8-9522-6dc68e119333');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Buena dupla con Darío.', '6f5b752e-6a67-49e6-87b7-e847ac01d642');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Fue quien más respeto nos tuvo (en contraposición a Burin, con quien no se podía ni tratar), el único que contestaba dudas, aunque no siempre se entendía por completo, se valora su predisposición y el querer ayudar. Fue de gran ayuda con las correcciones en los TP's y proponiendo mejoras para tener mejores resultados. Igualmente, no recomiendo la materia con ellos en términos generales. Mala organización (tanto de los temas como de la dinámica de la clase en sí), enunciados de los TP's incompletos o confusos, aunque se les podía hacer cualquier pregunta casi nunca fueron de ayuda sus respuestas, comenzaban tarde con respecto al horario y además nos echaban la culpa a los alumnos con mal trato cuando ellos eran quienes nos dejaban en "sala de espera" en el Zoom.', '6f5b752e-6a67-49e6-87b7-e847ac01d642');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Se ríe de la desgracia de los demás pero es bueno. No se si sabe del tema o si es oyente porque se confundía con las cosas así que con eso digo todo', '6f5b752e-6a67-49e6-87b7-e847ac01d642');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No suele dar clase, muy eventualmente muestra algún ejercicio resuelto y explica cómo funciona. No es tan claro como Dario (aunque él deja la vara bastante alta), pero es respetuoso y contesta cualquier duda.', '6f5b752e-6a67-49e6-87b7-e847ac01d642');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Al igual que el otro docente de la practica. Muy claros los dos, contestan todas las dudas', '6f5b752e-6a67-49e6-87b7-e847ac01d642');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Me toco de corrector en el TP y fue muy justo ademas le mande muchos mails haciendole preguntas sobre como encarar cierto problema y me los respondio todos.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Vino 3 clases y no sabia ni lo que tenia que dar', 'd590e18f-91a0-411e-8b05-f342016e5f0c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buen profesor, responde todo, se manejan por slack', 'd590e18f-91a0-411e-8b05-f342016e5f0c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'explica lo practico, tiene paciencia y repite la cantidad de veces que sea necesario, te saca siempre las dudas, si es necesario se queda después de horario, es copado', 'd590e18f-91a0-411e-8b05-f342016e5f0c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'N', 'd590e18f-91a0-411e-8b05-f342016e5f0c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Un genio!', '373894b7-4e4f-498d-a07b-df741dd151f6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'El que más onda le pone de los tres, sin duda. A la hora de enseñar, creo que es al que más se le entienden los conceptos e intenta ayudar de vez en cuando mostrando algún ejercicio práctico en el IDLE. Igualmente, no recomiendo la materia con ellos en términos generales. Mala organización (tanto de los temas como de la dinámica de la clase en sí), enunciados de los TP's incompletos o confusos, aunque se les podía hacer cualquier pregunta casi nunca fueron de ayuda sus respuestas, comenzaban tarde con respecto al horario y además nos echaban la culpa a los alumnos con mal trato cuando ellos eran quienes nos dejaban en "sala de espera" en el Zoom.', '373894b7-4e4f-498d-a07b-df741dd151f6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Darío le pone onda, pero a veces le cuesta estructurar lo que va a hacer.', '373894b7-4e4f-498d-a07b-df741dd151f6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es copado, dispuesto a ayudar si lo necesitas qué a diferencia de sus compañeros de catedra que son una bosta. Igual no recomiendo ni de casualidad esta catedra de mierda y si quedan por los pocos cupos lo que pueden hacer es pedir un cambio de curso a toda costa pero no con este. ', '373894b7-4e4f-498d-a07b-df741dd151f6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es el que más ganas le puso. Suele mostar algún ejercicio que exceda un poco lo que se dió en la teórica (pero de todas formas posible de ser resuelto con lo que se explicó) y explicarlo paso a paso o dar una consigna y pedir que entre todos intentemos resolverlo. Sus explicaciones son muy claras y contesta cualquier duda.', '373894b7-4e4f-498d-a07b-df741dd151f6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Muy buen trato y responde todas las consultas.', '373894b7-4e4f-498d-a07b-df741dd151f6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'cátedra impecable', 'f262714a-39c6-419b-bc2f-ff6ee7f2e811');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Sinceramente nada más que pedir. Cursada impecable, buenos ejercicios para practicar, explica bien y te manda sus archivos para que checkees y estudies de ahí. Además de dar un cuestionario a resolver de 40 preguntas parecidas a las de parcial para que vayas bien preparado. Recomendable', 'f262714a-39c6-419b-bc2f-ff6ee7f2e811');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Exigente con los tps pero es promocionable y los parciales son iguales a los modelos que manda ', 'f262714a-39c6-419b-bc2f-ff6ee7f2e811');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Tuvimos solamente clases de consultas lo cual era medio complicado entender todo. Hace hacer trabajos en grupos y tenes que ir entregando todas las semanas. Explica muy bien aunque hay veces que da cosas por sabidas, pero eso debe ser por la virtualidad y que teniamos pdf para leer. Si le haces una pregunta y no entendes te lo vuelve a explicar sin ningun problema. Muy buena predisposicion.', 'f262714a-39c6-419b-bc2f-ff6ee7f2e811');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'EXCELENTE CATEDRA!
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Una genia, sus explicaciones son claras, todo el material tanto teórico como practico se puede entender y es muy paciente a la hora de explicar. Las clases fueron asincrónicas pero siempre estaba a disposición ante cualquier duda y respondía super rápido. Hubo reuniones por meet para explicar los TPs y para hacer consultas. ', 'f262714a-39c6-419b-bc2f-ff6ee7f2e811');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Muy buena profesora. Siempre responde dudas tanto en clase como por mail. Da muchos tps pero son faciles y no te hace escandalo si te atrasas un dia. tambien es promocionable', 'f262714a-39c6-419b-bc2f-ff6ee7f2e811');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Es una genia! Explica clarísimo y siempre esta predispuesta a responder dudas y consultas, en clase y por mail, y a soluciones temas administrativos.', 'f262714a-39c6-419b-bc2f-ff6ee7f2e811');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2018', 'Excelente profesora, clarísima. Sus pdf son lo más util que puede existir para esta materia. Completa el cronograma y tiempo en forma por lo que comparado con otros cursos sus clases son extensas y con mas temas que cualquiera. Además, por lo menos cuando yo la cursé. En caso de tener aprobados todos los tps y los parciales con más de 7, te da la posibilidad de no ir a final, promocionando la materia. Más que recomendable.', 'f262714a-39c6-419b-bc2f-ff6ee7f2e811');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2018', 'Excelente profesora, clarísima. Sus pdf son lo más útil que puede existir para esta materia. Completa el cronograma y tiempo en forma por lo que comparado con otros cursos sus clases son extensas y con mas temas que cualquiera. Además, por lo menos cuando yo la cursé. En caso de tener aprobados todos los tps y los parciales con más de 7, te da la posibilidad de no ir a final, promocionando la materia. Más que recomendable.', 'f262714a-39c6-419b-bc2f-ff6ee7f2e811');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'En la modalidad virtual bien, las teoricas eran pdfs super claros pero faltaba la clase en vivo para sacar dudas. Es una cursada que se re puede llevar al dia y la hace interesante los tps son buenos. Toma lo que explica. Y es muy clara con las devoluciones que da.', 'f262714a-39c6-419b-bc2f-ff6ee7f2e811');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'No da clase sincronica en la virtualidad pero responde rapido los mails, buena catedra.', 'f262714a-39c6-419b-bc2f-ff6ee7f2e811');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Cristina es una muy buena docente. No da las clases por meet sino a través de videos y pdf, pero sí hay clases de consulta por meet y responde los mails enseguida. También al momento de corregir te da varias oportunidades explicándote tus errores hasta que te salga bien. Lo único que no me gustó de la materia, no sé si es algo que determina el departamento o la misma Cristina, es que los parciales consisten en hacer un programa escrito a mano y me parece medio obsoleto eso.', 'f262714a-39c6-419b-bc2f-ff6ee7f2e811');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'daba casi todas las semanas clases de consulta cortas, pero el materia de estudio eran pdfs y videos que se entienden perfectamente asi que en mi opinion no fueron necesarias las clases sincronicas. responde rapido todas las dudas y te ayuda un monton si lo necesitas.', 'f262714a-39c6-419b-bc2f-ff6ee7f2e811');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'No daba clase, pasaba pdfs sin sonido, igual la cursada fue tranqui y facil, eran tps en grupo que se hacian cada semana. Para el objetivo de la materia que es aprender bases de python y entender un poco cómo es el pensamiento computacional está perfectamente dada. Los parciales y final fueron decentes y simples, aunque no se promociona. Si queres aprender y que sea tranqui la cursada es aca.', 'f262714a-39c6-419b-bc2f-ff6ee7f2e811');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Amable y muy predispuesta a ayudar con cualquier tipo de consultas tanto en clase como por mail. Los trabajos prácticos no son para nada rebuscados sino que buscan que cubras los temas principales de la materia con un enfoque más "ingenieril", los mismos se centran en que puedas desarrollar programas con algún tipo de utilidad práctica, en vez de juegos u otro tipo de cosas que se suelen pedir en otros cursos.  Con ella teniendo la materia al día es fácil aprobarla, el final es super accesible. Se programa con Python.', 'f262714a-39c6-419b-bc2f-ff6ee7f2e811');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Karen da la parte práctica, pero de por si cuando Arriazu da la teorica hace ejercicios para que le vayas agarrando la mano de entrada, y al hacer eso ocupa mas tiempo, y le deja unos minutos para que karen explique un ejercicio. Cuestion, las dos saben muchisimo, pero la que la rompe toda es ARRIAZU. Tanto Roberts como arriazu responden los mails sumammente rapido. RECOMENDADISIMAS LAS DOS', 'a24f072d-bec5-4255-a62c-3f331faaf09b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'realmente una genia, siempre a disposición del alumno, contesta todos los whatsapp', 'a24f072d-bec5-4255-a62c-3f331faaf09b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Como profesor muy bien, siempre preguntando si hay dudas o repasando los temas ya vistos. Pero las clases me parecieron muy lentas y al no saber nada del lenguaje Python (o de programación en general) se me dificulto muchísimo seguir las clases(pude finalizar por ayuda de mis compañeros que tuvieron la paciencia para explicarme casi de cero), hablaba un poco como si ya supiéramos para mi fue chino básico; igual si surgían dudas se podia consultar. Para terminar de explicar un tema puede pasarse del tiempo estipulado, pero el tema se ve', '5211ca23-5b36-4231-aaa2-5fadd97933c3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'fácil para aprobar la cursada, si estas buscando promocionar no intentes con el. Habla muy monótono y te dormís, pero responde cualquier duda que tengas', '5211ca23-5b36-4231-aaa2-5fadd97933c3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'No demuestra ganas de enseñar', '5211ca23-5b36-4231-aaa2-5fadd97933c3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Buen profe, quiza le baja puntos que escribe con letra pequeña a veces pero y hace largo un tema facil como dividir numeros binarios. Pero es llevable, buen profe que siempre está para consultar.', '5211ca23-5b36-4231-aaa2-5fadd97933c3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'a mi, personalmente no me gusto para nada. El final es muy dificil comparado con otros profesores y la cursada es facil pero explica muy monotono y no se le entiende. Comparé los temas que vi con servetto con otros profesores de la materia y da muchos mas temas, mas rebuscados y muy especificos que despues toma en el final. No lo recomiendo. Cabe destacar que es buen tipo, y toma en consideración lo que tiene para decir el alumno', '5211ca23-5b36-4231-aaa2-5fadd97933c3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'no se anoten, la cursada es facil, pero el final lo hace imposible. No coincide una cosa con la otra, te toma cosas que ni explica ', '5211ca23-5b36-4231-aaa2-5fadd97933c3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Las clases son un poco aburridas PERO responde cualquier pregunta por mail rapidísimo, lo que hace muy fácil hacer los tps si tenes alguna duda.', '5211ca23-5b36-4231-aaa2-5fadd97933c3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Si aprobas 2 parciales y un tp la promocionas, ideal para robar esta materia. Lo malo es que las clases son muy aburridas', '432d65ca-ec63-4de4-869b-876914d2254e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Llega siempre tarde (entre 15 min y 1 hora), para el 2do parcial llegó 1 hora y media tarde y no lo tomó el hdp. ', '432d65ca-ec63-4de4-869b-876914d2254e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Excelente cátedra! Ni me dí cuenta que la estaba cursando virtualmente.', 'e4e5d745-f364-457f-9eaa-5f46ad83a45d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Excelente catredra!!! La teorica muy buena, Diego (Essaya) explica muy bien y responde dudas. La teorica tambien excelente, los ayudantes y correctores explican y corrigen de forma justa y clara! Aparte responden dudas, via mail/discord rapido aunque sea fuera del horario de clases. Totalmente recomendada.', 'e4e5d745-f364-457f-9eaa-5f46ad83a45d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Buena onda, explica con memes', 'e4e5d745-f364-457f-9eaa-5f46ad83a45d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Essaya da las teóricas, y la verdad q las da excelentemente bien. En las clases literal q no te aburris. En la práctica tuve a Santisi, el cual se complementa genial con Essaya. Sin ninguna duda esta es la mejor comisión para rendir esta materia, esta para recursarla 39 veces.', 'e4e5d745-f364-457f-9eaa-5f46ad83a45d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es un gran profesor. Explica bien y es copado. Da clase lo justo y necesario pero lo hace bien. Recomendado.', 'e4e5d745-f364-457f-9eaa-5f46ad83a45d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Las clases con Diego son bastantes buenas, quizás faltaría que vaya con un poco menos de rapidez ya que si nunca programaste seguir la clase se hace dificil, pero dentro de lo general muy buena catedra y por todo muy buen profesor que sabe mucho sobre el tema', 'e4e5d745-f364-457f-9eaa-5f46ad83a45d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Diego es lo más, sus analogías con pokemones son todo. Es super claro con lo que explica y no tiene problema en ponerse a hacer ejemplos en el momento para que entendamos mejor, la verdad muy buenas clases.', 'e4e5d745-f364-457f-9eaa-5f46ad83a45d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Un crack con todas las letras, muy buenas filminas de la clases teóricas, muy buena onda, muy bien explicando. Las clases se hacen bastante amenas con él.', 'e4e5d745-f364-457f-9eaa-5f46ad83a45d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Excelente cátedra! Ni me dí cuenta que la estaba cursando virtualmente.', '4c82b70a-c12f-4961-b300-0936a4c561d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'El tipo nos sobraba un poco, tenía cierto dejo de soberbia pero fue dedicado, me respondió todo y me corrigió hasta el cansancio. 9/10', '4c82b70a-c12f-4961-b300-0936a4c561d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Lo tuve en la práctica de la comisión de Essaya. La verdad q explicando es buenisimo. Hay un discord donde responden todo 24/7, por lo cual siempre esta a tu disposición ante cualquier consulta. No duden en anotarse con él.', '4c82b70a-c12f-4961-b300-0936a4c561d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Le pone un montón de laburo y se nota. No es el más copado pero siempre nos ayudó. Hasta cambió las fechas de parcial porque nos coincidía. Los TPs y parciales están muy bien hechos. Corrige rápido y es justo.', '4c82b70a-c12f-4961-b300-0936a4c561d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La verdad que Seba es muy buen profesor y se nota las ganas de enseñar que tiene, la claridad con la que explica es muy buena y siempre fomenta que todos participen y es muy activo en el canal de Discord', '4c82b70a-c12f-4961-b300-0936a4c561d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Sebas es lo más, sus clases son super dinámicas y después de los parciales se queda a resolverlos. Hace talleres después de las prácticas para los que quieran y les interese y a mi me parecieron muy útiles. Creo que la materia está super bien armada y tratan de hacerla lo más divertida posible con los ejercicios a entregar y el TP final. Los parciales también me parecieron super accesibles.', '4c82b70a-c12f-4961-b300-0936a4c561d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Buenisimo Santisi, al igual que Essaya es un crack con todas las letras. Responde las dudas siempre lee los mensajes, hace preguntas para tener a todos enganchados. Los parcialitos son como lo que se ve en la clase, los ejercicios obligatorios estan buenos, los tps quizas un poco subidos de tono pero nada por lo que volverse loco.', '4c82b70a-c12f-4961-b300-0936a4c561d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'iba cada tanto a clase... daba clase 2 veces al mes...
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'En realidad no tuvimos casi clases con Fernando, pero fue él quien me corrigió el primer TP y respondió todas nuestras consultas. Además teníamos una duda con un tema y nos hizo una llamada para explicarnos.', '34526781-7405-493e-9565-f7c389b1d23c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Sus clases teóricas generalmente son muy estructuradas, si bien está toda la información en la presentación, a veces no queda muy en claro todo.', 'cfde0a50-46a9-4e0e-9a5d-90cd5e20d0b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Deja mucho que desear, llega 30/40 minutos tarde a cada clase. Para dar los temas lee diapositivas sin agregarles contenido de algún tipo.', 'cfde0a50-46a9-4e0e-9a5d-90cd5e20d0b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Llega 30/40 minutos tarde, no explica taan mal pero es muy cabeza explicando y luego te exige como si diera a un nivel mayor. Ademas el contenido de la materia es bastante obsoleto y no hay informacion en Internet de los lenguajes que se usan', 'cfde0a50-46a9-4e0e-9a5d-90cd5e20d0b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'La materia justo cambio para bien cuando la curse. Benitez es un buen profesor, sabe un monton y nunca senti que me chamuye en una respuesta como me paso en otras materias. Son clases largas hasta tarde y a veces no te cierran todos los temas, pero te conviene leerlos y hacerle preguntas para preparar el final ( o ir por consultas antes). Siempre me parecio muy claro para responder y con la mejor onda. Es exigente para el final, pero se puede aprobar. ', 'cfde0a50-46a9-4e0e-9a5d-90cd5e20d0b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No hubo mucho apoyo por fuera del horario de clases. Las clases de consulta eran durante el horario de clases.', 'cfde0a50-46a9-4e0e-9a5d-90cd5e20d0b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Lee de los pdf, tiene mucho conocimiento pero no aporta mucho mas que las diapositivas.', 'cfde0a50-46a9-4e0e-9a5d-90cd5e20d0b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'No dudo de su buena fe en enseñar. Pero no esta a la altura de la materia', 'cfde0a50-46a9-4e0e-9a5d-90cd5e20d0b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Da las clases leyendo de un ppt lo cual las hace aburridas', 'cfde0a50-46a9-4e0e-9a5d-90cd5e20d0b4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'El mejor profesor por descarte del curso, es el que mejor trato tiene y siempre que puede contesta dudas por mail y es muy predispuesto a contestar toda duda en clase.', 'f0027d88-2f44-4c90-8e55-f822e6dadda6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Da las clases de ARM (programacion en assembly, pertenece a la segunda parte de la materia y se evalua solo en el final) de manera virtual', 'f0027d88-2f44-4c90-8e55-f822e6dadda6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Una luz entre toda la desgracia de esta catedra. Por su bien, ojala, salga de ahi.', 'f0027d88-2f44-4c90-8e55-f822e6dadda6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica muy claro. Sin duda el mejor profe de esta materia. ', 'f0027d88-2f44-4c90-8e55-f822e6dadda6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Llega media hora tarde al parcial (detalle: el tiene los enunciados), llega mas de hora y media tarde a la corrección de TPs, es bastante exigente corrigiendo pero al menos es el mas consciente de los enunciados de TP y los parciales. Otra cosa: no contesta dudas por mail, la única vez que lo vi contestar de una duda de un programa fue para decir "es solo un ejemplo..."', '9f7fc1ff-1eeb-4e21-a8dd-1e8957fecc62');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Va muy rapido cuando hace un ejercicio en el pizarron y a veces medio que te contestaba con mal tono. Igual le haces preguntas y vuelve para atras y te lo explica, no tiene problema. A veces era medio picante y a veces andaba de buen humor relajado', '9f7fc1ff-1eeb-4e21-a8dd-1e8957fecc62');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Da las practicas, dió muy pocas clases de la primera parte de la mitad. No le da bola al foro del campus.', '9f7fc1ff-1eeb-4e21-a8dd-1e8957fecc62');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Le mete onda a una materia del año 1800. Pero es nada mas eso,buena onda.', '9f7fc1ff-1eeb-4e21-a8dd-1e8957fecc62');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Da las clases de Intel (programacion assembly, se evalua en el primer parcial) de manera virtual ', '5d509d40-ed72-4343-a28a-93dce24c8348');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Le hice preguntas del TP y me pidió que re diseñe mi solución aunque los demás profesores me dieron el OK a esa solución (claramente no entendió lo que le dije) otro mas que es exigente y que es poco presente, no contesta dudas por mail', '24055d17-a6e8-40d9-8510-87fb72b399de');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Fue fundamental que resuelva los ejercicios de assembler en clase. Hay que prestarle atencion a eso. A veces me perdia pero bueno, despues lo suben a la pagina y lo tenia para releer. Buena onda, te ayuda siempre que le preguntas por un ejercicio o por el tp', '24055d17-a6e8-40d9-8510-87fb72b399de');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Nunca pense que un profesor pudiera generarme tango desagrado.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Calvo es una excelente profesora, explica todos los temas de la materia. Sus clases a veces son un poco aburridas porque nunca fomenta a la participación, prácticamente un monólogo. Más allá de eso dio todos los temas y explico todo con lujo de detalles. ', '0883b920-5748-4589-b4fe-a240ab36faf8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Docente que dá la teorica y responde consultas, nada más, pueden resultar un poco aburridas sus clases por ser powerpoints pero es todo lo que necesitas, ademas aveces complementa con alguna simulación o algun ejemplo. Ideal para cursar las teoricas tranquilo.', '0883b920-5748-4589-b4fe-a240ab36faf8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Rema sola el curso. Los parcialitos son relativamente fáciles y si los aprobás el tema de ese parcialito no te lo evalúa en el final.', '0883b920-5748-4589-b4fe-a240ab36faf8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bien y sus presentaciones estan buenas.', '0883b920-5748-4589-b4fe-a240ab36faf8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'A veces se cuelga en ciertas explicaciones. Muy estricta al corregir...', 'b988b59c-cfe4-4465-b681-502bc0a016dd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Los dos de la práctica son realmente un desastre. Saben pero parecería ser que no les gusta ser docentes o quizás no tienen el tiempo para dedicarse a esto. Son dos TP, el primero de ellos nunca lo corrigieron ni dieron devoluciones, el segundo era muy extenso y no se tomaron el trabajo de ni mirar el código, simplemente vieron que funcionara y aprobaron a todos.', 'e6550586-0885-44e5-9bb9-1ff17bce2af7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Los dos de la práctica son realmente un desastre. Saben pero parecería ser que no les gusta ser docentes o quizás no tienen el tiempo para dedicarse a esto. Son dos TP, el primero de ellos nunca lo corrigieron ni dieron devoluciones, el segundo era muy extenso y no se tomaron el trabajo de ni mirar el código, simplemente vieron que funcionara y aprobaron a todos.', 'cdf4308e-2de0-4b61-a41f-4a679d2dc5f0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'La tiene clarísima.', '5371e7f7-70b5-4ff2-a7b1-8b33dc1f934f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Es un buen docente, explica muy bien y sus clases son entretenidas. Siempre tiene respuestas y hace acotaciones importantes mientras otros docentes están explicando.', '5371e7f7-70b5-4ff2-a7b1-8b33dc1f934f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Maneja muy bien los temas, pero a veces da por sentado detalles importantes. Para corregir es un asesino.', '5371e7f7-70b5-4ff2-a7b1-8b33dc1f934f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'El chabon es crack. No da muchas clases durante el cuatri, pero siempre esta ahi para dar una mano. En cuanto a las evaluaciones, son 4 parcialitos y tenes dos recus para cada parcialito. Si aprobas los 4 de una o en el primer recu, podes dar una especie de final reducido que ayuda un monton porque son muuuchos temas. Hay dos tps un toque largos pero te dan mucho tiempo para hacerlos.', '5371e7f7-70b5-4ff2-a7b1-8b33dc1f934f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Sabe muchísimo y explica bien. Algunas clases que dio fueron casi al pedo porque decía lo mismo que estaba en los videos. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'De los mejores profesores de esta facultad', '5371e7f7-70b5-4ff2-a7b1-8b33dc1f934f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es demasiado pedante. Sus clases son entretenidas pero los temas difíciles no se entienden. Contesta monosilábicamente dudas fuera de clase. El final es imposible de aprobar, si no promocionás conviene recursar.', '5371e7f7-70b5-4ff2-a7b1-8b33dc1f934f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Explica los temas perfectamente, pero cada cierto tiempo dicta la clase,  no responde dudas y si las responde no te llega a explicar nada. Los parciales/finales son un desastre son bastante complicados en comparación a como se dicta las clases, los tps este cuatrimestre fueron comparados con otros fueron muy entendibles. Se necesitamos otros cursos o un cambio severo.Si llegas a aprobar esta materia tuviste suerte.', '5371e7f7-70b5-4ff2-a7b1-8b33dc1f934f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Se notó el esfuezo por mejorar la cursada para los estudiantes', '5371e7f7-70b5-4ff2-a7b1-8b33dc1f934f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Buena catedra, TPs muy extensos y dificiles. Final reducido facil. ', '5371e7f7-70b5-4ff2-a7b1-8b33dc1f934f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Crack Argerich, y un Crack el ayudante que mas da clases pero no figura aca Gianfranco', '5371e7f7-70b5-4ff2-a7b1-8b33dc1f934f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'A veces cuesta un poco entenderla pero se le puede preguntar tranquilamente todas las veces que uno necesite, siempre contesta con buena predisposición.', '41e9dab3-933f-401d-95d0-34d4b6b7182c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Explica detalladamente y muy pausada. Tienen buena predisposición a responder dudas. Cualquier consulta con TP o con correcciones de exámenes te pide que le envíes un email para que lo evalúen.', '41e9dab3-933f-401d-95d0-34d4b6b7182c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Se encarga mas de lo administrativo y da alguna clase que otra. Explica claro, aunque yo creo que las clases de YTB son lo suficientemente claras y concisas para cursar la materia. En mi opinion, a las clases sincrónicas se les saca mas provecho si se las mira grabarlas para repasar o fijar los conocimientos.', '41e9dab3-933f-401d-95d0-34d4b6b7182c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy clara para explicar', '41e9dab3-933f-401d-95d0-34d4b6b7182c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Explica maso menos bien, las consultas no las responde y si las responde es a medias, solo dicta las clases algunos días.Si llegas a aprobar esta materia tuviste suerte.', '41e9dab3-933f-401d-95d0-34d4b6b7182c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Las clases de Nati siempre son clarísimas, resuelve ejemplos en el pizarrón de comienzo a fin', '41e9dab3-933f-401d-95d0-34d4b6b7182c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'No fui a sus clases este cuatri pero me ayudo con temas administrativos y tps', '41e9dab3-933f-401d-95d0-34d4b6b7182c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy práctico para explicar, va directamente al ejemplo.', '6e41e593-c948-4793-a466-b57d4ad1c175');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'En general explica bien, por ahí me dio al sensación que no le gusta preguntas "tontas" o rebuscadas.', '6e41e593-c948-4793-a466-b57d4ad1c175');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Le pone mucha onda. Explica temas de la manera más "bruta" que a veces está bueno.', '6e41e593-c948-4793-a466-b57d4ad1c175');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es muy bueno explicando', '6e41e593-c948-4793-a466-b57d4ad1c175');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'No se le entiende nada cuando habla.', '6e41e593-c948-4793-a466-b57d4ad1c175');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Simplemente un desastre. Dicta la mayoría de las clases , simplemente leen un resumen del apunte que tiene la materia (que también esta mal) y se equivocan bastante en leer su resumen, las preguntas en clases si no son básicas no las pueden responder, las consultar por Internet no las responden y si las responden tardan bastante en responder de forma incompleta. Su forma de corregir parciales es aberrante no hay consideración en nada y muchas veces injustificado típico no me gusta o no es lo que yo dije.Si llegas a aprobar esta materia tuviste suerte.', '6e41e593-c948-4793-a466-b57d4ad1c175');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'No soy fan de sus clases es buena onda igual', '6e41e593-c948-4793-a466-b57d4ad1c175');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Suele dar las clases con diapositivas o haciendo ejercicios directamente desde la PC. Conviene más prestarle atención antes que copiar para no perderse.', '8196a62a-23c7-4b58-a3c7-f09c7ed8a2e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Explica bien.  Es medio despistado a veces.', '8196a62a-23c7-4b58-a3c7-f09c7ed8a2e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'En las clases teóricas y prácticas se nota como básicamente lee el apunte. ', '8196a62a-23c7-4b58-a3c7-f09c7ed8a2e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica temas de la primera parte de la materia. No es el mejor profesor explicando, pero mejor que estudiar los temas solo es.', '8196a62a-23c7-4b58-a3c7-f09c7ed8a2e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un desastre. Sabe bastante poco. En los videos a veces lee textual lo que dice la PPT y se nota que no lo entiende ni él. Igualmente muchas veces explica mas o menos bien, pero seria menos irritante si primero entendiera él lo que te pretende enseñar.', '8196a62a-23c7-4b58-a3c7-f09c7ed8a2e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es el que menos sabe y se nota. Chamuyero profesional. Nunca explica un tema complicado. Pasa diapositivas y no sabe usar le pizarrón.', '8196a62a-23c7-4b58-a3c7-f09c7ed8a2e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Simplemente un desastre. Junto con el anterior dicta la mayoría de las clases , simplemente leen un resumen del apunte que tiene la materia (que también esta mal) y se equivocan bastante en leer su resumen, las preguntas en clases si no son básicas no las pueden responder, las consultar por Internet no las responden y si las responden tardan bastante en responder de forma incompleta. Su forma de corregir parciales es aberrante no hay consideración en nada y muchas veces injustificado típico no me gusta o no es lo que yo dije. Parece un copy paste pero es asi como se manejan. Si llegas a aprobar esta materia tuviste suerte.', '8196a62a-23c7-4b58-a3c7-f09c7ed8a2e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Tipo buena onda, parece medio colgado que no tiene gran interes en la clases en este momento', '8196a62a-23c7-4b58-a3c7-f09c7ed8a2e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Estuvo bastante bien para ser el primer cuatri de esta cátedra, lo único que es importante cursarla con un buen grupo ya que es lo que determina qué tan cuesta arriba sea la materia. Con un buen grupo se lleva bien, pero en caso de tener un mal grupo es bastante difícil.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'En general me parecio buena la catedra.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Explica lo que esta en el PPT y nada más, por suerte es lo que se evalúa, asi que con ir a clases e ir haciendo un resumen de eso vas bien al final', '89bb318d-87b4-4537-bd80-897de6318512');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'El mejor colaborador del mundo. Rezas para que te corriga él. Super bueno dando consejos y explicando temas.', '43edff16-efc5-48dd-812a-31796c8a63d4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica bien', '43edff16-efc5-48dd-812a-31796c8a63d4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'genio total! está en las clases practicas, explica muy claro y da tips muy utiles para los tps o ejercicios. Dió pocas clases creo que está mas bien de ayudante. En comparación al resto de los docentes es el que más da una mano a los alumnos, tiene compasión para corregir, y no te mata si no llegas a tenerla CLARÍSIMA como exige el resto.', '43edff16-efc5-48dd-812a-31796c8a63d4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Otro genio, sabe un montón y siempre está ayudando por discord.', '3bdfbe79-097c-4ff0-ad6e-754df229ecb2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Excelente docente. Me ayudó en el primer parcial a destrabarme', '3bdfbe79-097c-4ff0-ad6e-754df229ecb2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se nota que sabe muchísimo y que le gusta enseñar. Es un muy buen docente y muy amoroso, aunque al principio intenta meter algo de miedo nunca le sale mantenerlo en el tiempo :P Si bien los parciales son muuuuy largos, la materia es muy entretenida y vale muchisimo la pena cursarla en esta catedra', '3bdfbe79-097c-4ff0-ad6e-754df229ecb2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Las clases son medio un bodrio a veces (mucho menos que las de leveroni igual), pero es un tipo buena gente que le preguntas cualquier cosa y te responde lo mas bien, también cuando hace ejercicios te das cuenta que la tiene recontra re clara y sacas bastante de sus resoluciones, pero si se pone a filosofar sobre algún tema cagaste', '3bdfbe79-097c-4ff0-ad6e-754df229ecb2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'También junto a Lucho un tipazo. Burella hace los exámenes y es quien más sabe de SmallTalk
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Aportaba mucho a las clases, motivándonos a participar y con ejemplos de lo que se daba', '3bdfbe79-097c-4ff0-ad6e-754df229ecb2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buenas las clases y las explicaciones. Lo único para comentar es que a veces los criterios de corrección varían bastante entre un corrector y otro y te podes ver bastante perjudicado así como en otros casos beneficiados. Dependes de quien te toca como corrector
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Me tocó de corrector en el segundo trabajo. Parecía copado pero solo apareció en una entrega.', '227a6ae1-33ba-41f0-8664-d1028b4d96cc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'A veces se hace un poco de lio cuando explica. No es tan claro', 'ca36d8a8-833e-483d-a481-ee6b5ffedafb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Edson es muy buena onda, no da ninguna clase, es solo un ayudante más pero si responde a tiempo y claramente por el slack', 'ca36d8a8-833e-483d-a481-ee6b5ffedafb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es un genio
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buen profe. Explica bien y fomenta la participacion. La cátedra es buena todos los ayudantes están comprometidos te ayudan una banda por discord. La cursada es tranqui pero los parciales tenían un claro salto de dificultad pero no eran imposibles. Es promocionable y sino el final es un oral facil', 'd007f1ca-e6d4-4ffd-a118-4f80e952beec');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica bien pero sus clases son aburridas. La materia en sí es fácil de aprobar, comparado con la otra cátedra esta es un robo.', 'd007f1ca-e6d4-4ffd-a118-4f80e952beec');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se nota que es buena gente y tiene mucha pasión por su materia (sus teóricas me hacían recordar a las conferencias típicas de programadores hablando sobre temas como historia de la programación, Agile, TDD, etc). 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Excelente profesor. Es un tipo bastante serio que se nota que le preocupa que todos y cada uno de sus alumnos aprenda lo que él enseña. Super amable y predispuesto. Hace que la materia sea muy entretenida.', 'd007f1ca-e6d4-4ffd-a118-4f80e952beec');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La catedra la maneja leveroni. esta es la catedra que se puede promocionar, es muy facil de aprobar. SI te da la prioridad anotate en esta. Tienen varios tp que se van haciendo a lo largo de la cursada. Hay bastantes clases que se pueden faltar porque dan resoluciones de tp en la clase que a mi parecer con la correccion que te mandan por mail ya estaria pero bue. Lo malo es que la nota del tp es bastante influenciada por que corrector te toco ya que gran parte de la materia se ven los Nombres que se le pueden poner a diferentes mensajes.', 'd007f1ca-e6d4-4ffd-a118-4f80e952beec');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es una materia facil si la llevas al dia, las clases son bastante un bodrio y va recontra lento, pero es un tipo buena gente, que no te va a cagar y que quiere que aprendas y apruebes. La materia es promocionable (y ni es muy dificil promocionarla pq te viven regalando nota), pero si no la promocionas tranqui, el final es un oral re pavote, el verdadero "final" de la materia es el segundo parcial. Lo unico que si realmente no me gusto de la materia es la duracion de los parciales, el primer parcial dura 4hs y el segundo 5hs, llega un punto en el que empiezan a testear fortitud mental mas que los temas de la materia, ojala cambien el metodo de evaluacion, pero indistinto de eso, estuvo ok la cursada', 'd007f1ca-e6d4-4ffd-a118-4f80e952beec');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Lucho un capo, se nota que le gusta lo que enseña y quiere transmitir ese conocimiento a los alumnos, muy buen profe.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buena persona y profesor. Muy accesible a consultas, cuando necesité comunicarme con él por una duda estuvo muy atento.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Excelente profesor, muy claro a la hora de explicar. Si te quedas con dudas vuelve a explicar las cosas sin problema', 'd007f1ca-e6d4-4ffd-a118-4f80e952beec');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buenas las clases y las explicaciones. Lo único para comentar es que a veces los criterios de corrección varían bastante entre un corrector y otro y te podes ver bastante perjudicado así como en otros casos beneficiados. Dependes de quien te toca como corrector
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'No explica bien y te bardea cuando no entendes.', '913ba12c-5172-46ff-8b73-f2d8d7c0e57b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es el que dá las teoricas (casi siempre) te cagas de risa con los ppt, siempre le pone buena onda y las clases son muy entretenidas. Al final de cada clase hace un Kahoot. Sin embargo a veces te perdes por tanta joda y no te termina de quedar del todo claro el concepto. Pero a parte de eso creo que es buen profe.', '913ba12c-5172-46ff-8b73-f2d8d7c0e57b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Es un desastre. No se le entiende nada cuando explica ni cuando habla encima te boludea y a la hora te corregir te exige cosas que no se sabe de donde pretende que las aprendas porque nadie te explica nada', '8112e48c-0696-4a72-bb5e-7b162b3a7376');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Un desastre de profesor. Una lastima porque se nota que le encantan los temas y muchas veces se emociona con las explicaciones. Como corrector de tp practicamente no nos dió devoluciones semana a semana, al hacerle consultas es difícil de entender que quiere decir, totalmente subjetivo en la corrección de los parciales, los cuales no sabes como hacer para aprobar porque nunca te explican de antemano que cosas estan bien y que no.', '8112e48c-0696-4a72-bb5e-7b162b3a7376');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buen profe pero las clases son demasiado lentas.', '8112e48c-0696-4a72-bb5e-7b162b3a7376');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Las clases son muy malas. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy densas sus clases. ', '8112e48c-0696-4a72-bb5e-7b162b3a7376');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Sinceramente no se le entiende nada, en un choque muy fuerte comparándolo con las buenas cátedras que hay en Algo1 y Algo 2. Sus clases son monótonas, lentas, aburridas y es muy difícil seguirle el hilo.', '8112e48c-0696-4a72-bb5e-7b162b3a7376');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica bien y le da muchos consejos de el metodo para resolver los problemas que son utiles', '8112e48c-0696-4a72-bb5e-7b162b3a7376');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Diego la hace muy larga a veces buscando la participacion en la clase, sus clases no son de las mejores que hay, se lo ve muy desganado o desmotivado y eso, además de la lentitud del ritmo de la clase la vuelve muy pesada y tediosa, a pesar de que los temas puedan ser interesantes. Esto tambien hace que a veces la clase termine unos cuantos minutos más tarde de lo que debería', '8112e48c-0696-4a72-bb5e-7b162b3a7376');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Elige muy bien sus palabras pero son un tanto lentas sus clases, es el que da las clases practicas. Nunca habia visto a alguien hablar tan educadamente a sus alumnos', '8112e48c-0696-4a72-bb5e-7b162b3a7376');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Habla tan lento que cuesta seguirle el hilo pero no explica mal.', '8112e48c-0696-4a72-bb5e-7b162b3a7376');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Desde el primer día sus clases fueron malas, no servían para nada, de hecho fue más util faltar y practicar por cuenta propia que ir a las clases.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica cosas que están mal pero corrige como si hubiera enseñado todo perfecto. Es un desastre de profesor. Realmente no enseña bien y no se aprende con él. ', '8112e48c-0696-4a72-bb5e-7b162b3a7376');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Las clases de diego son para verlas en velocidad 1.5, es MUY lento yo cuando las veia me distraia mucho. Su approch de ir haciendo las cosas "mal" e ir iterativamente mejorandolas me hacia perderme y no encontrar los puntos escenciales en donde enfocarme. Es un profesor con mucha experiencia en el tema y sabe lo que esta haciendo. Siempre responde las dudas y te explica las veces que sea necesario. ', '8112e48c-0696-4a72-bb5e-7b162b3a7376');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Diego esta en todas las clases de la practica y explica casi todos los temas. Se nota que sabe pero a veces se traba o se complica cuando quiere explicar cosas que, en escencia, no son tan complicadas. Es bastante claro en cuanto a los criterios de correccion y no tiene problemas en contestar preguntas y explicar la cantidad de veces que sea necesario para que se entienda. Algo que no me gusto (particularmente de el y de Pablo Massuh) es que a veces la correccion en los parciales era subjetiva y no daban el brazo a torcer. Por ejemplo: si dos personas contestaban lo mismo en un examen y uno aprobaba y el otro no, te trataban de chamuyar de alguna forma para ver como explicarte que desaprobaste, pero bueno.', '8112e48c-0696-4a72-bb5e-7b162b3a7376');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'el JTP que no tiene la menor idea de que pasa con los trabajos practicos. Le preguntas que paso con tu tp que no lo corrigieron y dice que él no maneja eso', '8112e48c-0696-4a72-bb5e-7b162b3a7376');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Algoritmos 3 es de las peores materias que tuve, Pablo Suarez es uno de los profesores más decentes dentro de ella. Es bastante buena onda y suele explicar con claridad. Las clases son más o menos llevaderas aunque se vuelven aburridas en muchos momentos. Lo bueno es que casi siempre se terminaba antes del horario estipulado.', '97d25242-1ad4-4445-a876-8d2466b60de6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Mal docente. Graba videos que se entienden poco. Explica mal, se cree que se las sabe todas. En el TP final no te ayuda en nada. Y en las correcciones de los exámenes finales avala cualquier cosa que hagan sus ayudantes (cuando éstos no deberían corregir finales). No le podés reclamar nada, porque sino te busca cualquier excusa y encima te quiere bajar la nota. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'sabe mucho pero como docente es malo. Entrego las notas del final el mismo dia de la otra fecha( 2 min antes de que arranque la otra instancia). No responde mails, no se dirige de buena forma hacia los alumnos.', '97d25242-1ad4-4445-a876-8d2466b60de6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No participa en clase para nada. Solo corrige.', '97d25242-1ad4-4445-a876-8d2466b60de6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Sus clases estan ok. ', '97d25242-1ad4-4445-a876-8d2466b60de6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Los videos que sube explicando los temas no explican lo importante, si despues las cosas se vieran bien en la teorica o practica estaria todo OK, pero ni siquiera. Exige cosas que no tienen sentido y nunca se explicaron. Además, parece muy buena onda hasta que te trata mal con cualquier cosa y te das cuenta que no es buen profesor. ', '97d25242-1ad4-4445-a876-8d2466b60de6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Si lo pueden evitar, haganse un favor. No da clase, hizo videos que son malísimos, y en el final toma y corrige como quiere.', '97d25242-1ad4-4445-a876-8d2466b60de6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Durante la pandamia es el que grabo los videos, que en general se entienden bien. Tambien aporta algun comentario en clase que suma
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No tuvimos una clase de suarez que no sea una clase pre grabada, se lo nota como un hombre que sabe mucho pero por algun motivo no tuvimos ninguna clase con el, y eso que es el encargado del curso. Tardo muchisimo en corregir los finales (casi 20 dias)', '97d25242-1ad4-4445-a876-8d2466b60de6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica con buena intención y los videos que subió están mas o menos bien, pero en el final es un despiadado, no sabes bien que es lo que quiere, podes perder oportunidades así por pequeños errores.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es el titular pero no da clase nunca. Solo hay videos de él mal grabados. Alto ñoqui.', '97d25242-1ad4-4445-a876-8d2466b60de6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Prácticamente toda la cátedra fue mala. Las clases teóricas no eran muy buenas, al final tiene más sentido leer el libro de Fontenla por nuestra cuenta que dice lo mismo e incluso hay más ejemplos por lo que se llega a entender mejor. Resulta que se explicaba mucho de lo que no se debía hacer (evitar a toda costa formas de codear que no correspondan al paradigma de objetos en pos de respetar los pilares poo) pero no quedaba clara la forma de codear respetando los pilares, hablaban de todo lo que no se debía hacer pero al no tener ejemplos claros de como sí se podía resolver los ejercicios no se sabía de forma segura como resolverlos de una forma correcta. Las clases prácticas se puede decir que fueron nulas, en la segunda mitad de la materia directamente no hubo clases y en la primera mitad las que hubo fueron muy malas. Tener un profesor que desde el primer día empiece las clases diciendo que está cansado y que no le ponga mucha motivación a las clases no genera interés, sino que da la sensación de que se está perdiendo el tiempo. Por otro lado todas las clases prácticas tenían la misma estructura: plantear un problema más o menos durante los primeros 40 minutos y el resto de la clase charlar la solución para no llegar a nada o para llegar a una solución que no es tan buena, era usual la frase "Esta solución resuelve el problema pero fíjense que rompe x pilar" y terminaba la clase sin uno tener una solución correcta y quedándose con dudas que no se resolvían nunca. Por otro lado, si bien no se llegaba a una solución correcta al 100%, al momento de plantear posibles soluciones sólo se aceptaba la que era igual a la que el profesor quería, siendo el resto descartadas sólo porque "él tiene más experiencia y sabe por qué su solución si sirve" lo cual es entendible, pero no daba más explicaciones que esa por lo tanto no teníamos fundamentación alguna a por que nuestras soluciones no servían y las propuestas por el profesor sí. El parcial fue acorde a lo que se vio en las clases pero el examen final fue un choice de temas súper escondidos del campus, fue compartido por una gran cantidad de compañeros al salir del examen que se tomaron cosas muy puntuales de temas que fueron poco o nada mencionados en las clases y nada de temas de los cuales sí se les dio importancia en las clases.', '97d25242-1ad4-4445-a876-8d2466b60de6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'un desastre total, si no tienen ganas de enseñar dejenle el lugar a gente que sí', '97d25242-1ad4-4445-a876-8d2466b60de6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No sé, todo grabado de cuatrimestres viejos. No dio clase nunca durante el cuatrimestre. Los videos no están mal igual, lo único que explica los casos más fáciles de la historia y después tenés que aplicar cosas mucho más complejas.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Por favor no cursen en esta cátedra. Es lo peor de la facultad. Suárez es mal profesor y hasta me atrevo a decir que mala persona. Injusticia tras injusticia en esta cátedra, todos los profesores son igual de injustos y mantienen un pésimo trato con los alumnos. Un profesor así desprestigia a la facultad y no debería tener el cargo que tiene. ', '97d25242-1ad4-4445-a876-8d2466b60de6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Suarez nunca da ninguna clase (o casi nunca) tampoco lo tuve de corrector para absolutamente nada. Cuando hace acotaciones las hace cortas, tiene todas las clases grabadas (asincronicas) en el campus explicadas por el. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Nunca estuvo, es un ladrón y su cátedra no la aprueba nadie. Nunca vino el chanta. Su único aporte a la cátedra son unos videos pedorros grabados en 2020', '97d25242-1ad4-4445-a876-8d2466b60de6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Las clases son con powerpoint, el básicamente Lee lo que dice y expande la explicación de ser necesario. Lo que si, hay muchas actividades durante la clase, se ha en preguntas al final de la clase de los temas y ayuda a tener todo claro al terminar', '97d25242-1ad4-4445-a876-8d2466b60de6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Suarez se encarga de dar la teorica unificada. Da las clases con diapositivas, honestamente las primeras clases estan buenas porque te abre la cabeza para empezar a ver todo con una mirada de "objetos". A mediados de cuatrimestre las teoricas se volvian demasiado repetitivas al punto que sentia que decia todo el tiempo lo mismo por lo que deje de ir. Tampoco fui a las teoricas para el final. En mi opinion las primeras teoricas son clave para entender el paradigma pero despues se me hicieron 100% prescindibles y aburridas.', '97d25242-1ad4-4445-a876-8d2466b60de6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Sus clases terminan siempre antes, como mínimo una hora antes y a veces hasta dos y solamente lee PPTs. Conviene quedarse en casa.', '97d25242-1ad4-4445-a876-8d2466b60de6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'responde los mail cuando se le canta el orto. Si se olvida de corregirte el tp en vez de contestar disculpandose por haberse olvidado te escribe una semana despues enojado " porque no mantuviste un trato adecuado preguntandole"', '97d25242-1ad4-4445-a876-8d2466b60de6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Crack corrigiendo', 'dfe770fc-a7cb-47fc-b5c4-73fdc33d56a1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente predisposición a la hora de ser el ayudante del Trabajo Práctico 2', 'dfe770fc-a7cb-47fc-b5c4-73fdc33d56a1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Excelente. Super claro para explicar', 'dfe770fc-a7cb-47fc-b5c4-73fdc33d56a1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Yolis fue mi corrector de TP 2, el que es el TP mas pesado de la materia. La verdad fue muuuy tranqui en la correccion, aceptaba nuestras propuestas y nos proponia suyas. Nos aprobo a pesar de que nos faltaban un par de cosas para terminarlo. Las veces que daba clase se entendian los ejercicios que proponia. Le encargaron explicar JavaFx pero solo le dieron 2 clases asi que eso si que no se entendio nada pero considero que es mas por una cuestion de tiempo.', 'dfe770fc-a7cb-47fc-b5c4-73fdc33d56a1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'La materia tiene temas entretenidos. El problema es que la práctica es muy confusa y los tps son bastante difíciles de entender. Las clases están bastante desorganizadas. El parcial me lo corrigieron mal, pero fui a reclamar y me cambiaron la nota. El final es bastante fácil.', 'fa0a59c1-689a-4519-be0e-a9cc52c0987d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es un crack mariano y hacer la materia con el vale la pena, igual es relativamente nueva y esta en proceso de mejorar', 'fa0a59c1-689a-4519-be0e-a9cc52c0987d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Lo único que tiene de "malo" es que no explican desde el principio como es el régimen de cursada (o te explican uno que después no lo respetan )', 'fa0a59c1-689a-4519-be0e-a9cc52c0987d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Buen profe Mariano, como siempre, se le entiende todo y lo baja a tierra, sin las complejidades innecesarias que agregan la mayoría de los docentes. La materia es jodida, tiene orales del TP de JOS cada algunas semanas en las últimas clases. El TP Jos, que es de a 2, la hace jodida en sí, y tiene además 2 tps individuales antes de empezar con JOS.', 'fa0a59c1-689a-4519-be0e-a9cc52c0987d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buen profesor, hace que la clase se vuelva llevadera y entiendas. Lo único que tiene es que las teóricas las da presentando el apunte teórico (muy bueno y completo), por lo que se puede perder al no estar tan guiado como con un ppt
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Mariano da la teorica, y es siempre presencial aunque no toma lista. Salvo que te gusten, los temas son jodidos y muchas veces te vas de la clase con mas dudas que otras cosas. Todo lo que explica esta en los libros que recomienda la materia, pero leerlos sin haber ido a la clase es medio un suicido. La materia tiene un parcial, que no es dificil pero hay que estudiar bastante. Despues tiene 6 tps, los primeros 2 individuales y los otros 4 grupales (de a 2) e iterativos (el tp1 es la base del tp2, el tp2 del tp3 y asi...). Los tps grupales son heavys y bastante falopa, te demandan mucho tiempo pero se pueden hacer, no son imposibles. Dejo la pagina de la materia donde esta TODA la info super completa: https://fisop.github.io/7508/', 'fa0a59c1-689a-4519-be0e-a9cc52c0987d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es un buen docente, de los que se preocupan por la carrera. A mi la materia mucho no me intereso pero es una cuestion de interes personal, no me enganche. Me hubiera gustado ver algo mas cerca del uso "cotidiano".  Ahhh, no me acordaba de como era el video que mostro en clase y no pude explayarme bien en ese ejercicio del parcial! Tendrian que compartirlo por la lista. Igual esta buena la modalidad de cursada de la materia.', 'fa0a59c1-689a-4519-be0e-a9cc52c0987d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Profesor que sabe un monton, este cuatrimestre el problema que hubo es que fuimos un monton de alumnos y no nos dió pelota. No sé cómo será en cuatris más reducidos, pero te vas a tener que arreglar solx con él.', 'fa0a59c1-689a-4519-be0e-a9cc52c0987d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica muy excelente. Se entiende todo y se aprende un montón. La materia Sisop esta re bien armada, lastima que se re desbordó con la cantidad de alumnos y tardaron una barbaridad en corregir', 'fa0a59c1-689a-4519-be0e-a9cc52c0987d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'pagina de la materia: https://fisop.github.io/7508/', 'fa0a59c1-689a-4519-be0e-a9cc52c0987d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Fenomenal, parte clave del TP porque fue uno de los evaluadores y "mediador", siempre dejó en claro cual era el foco del proyecto a resolver, respondia nuestras consultas cuando nosotros a veces estabamos bastantes perdidos.', '896fa263-7ea2-427d-af1c-38d52f5fa2c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Dio algunas clases sobretodo relacionadas con el tp de la materia. Siempre muy buena onda para responder las consultas y muy claro en las explicaciones', '896fa263-7ea2-427d-af1c-38d52f5fa2c0');
