INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La tiene atada, siempre muy interesado en saber el progreso del TP y en las dudas en general.', '22787560-580e-443d-9c92-c255ba904d7a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Buen profe. Hace algunos comentarios medio precambricos, pero es buen tipo.', '22787560-580e-443d-9c92-c255ba904d7a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es el profesor de la teorica. Sus clases consisten en leer un pdf, no son muy didacticas pero los temas son faciles. La materia no tiene parcial, son solo tps (los cuales son muy faciles). Es una materia tranquila y llevadera.', '8837ea98-122e-4551-a6ba-1210c3faf019');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Lee PPTs todo el cuatri, no sé como es presencial, pero online no vale la pena ir a la clase. Los temas los lees de las ppts y haciendo los tps.', '8837ea98-122e-4551-a6ba-1210c3faf019');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buen profesor, se encarga de las practicas (los miércoles). La mayoría de las clases practicas consisten en presentar los avances de los TPs. Son 30 minutos por grupo (de a 5/6 personas)', '684c8db3-6dfe-4893-b9b5-03d4d7995451');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es el profesor de la practica. Un kapo. Divide al curso en 8 grupos de entre 6 y 9 personas x grupo (depende de la cantidad de inscriptos). La cursada consiste en realizar 3 tps usando los conceptos que se explican en la teorica. Turri ayuda muchisimo y te va guiando sobre como hacer los diagramas o encarar los tps. Por eso, termina siendo una materia llevadera, donde los profesores te dan una mano todo el tiempo y buscan que aprendas y apruebes. Datazo: las clses practicas se dividian en media hora por grupo.', '684c8db3-6dfe-4893-b9b5-03d4d7995451');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'El mejor profesor. Con él aprendi toda la materia, los tps son muy buenos y él te corrige hasta el milimetro para que aprendas. Te prepara para el final sin que tengas que estudiar. Un 10. (PD: No hay parcialitos, solo tps)', '684c8db3-6dfe-4893-b9b5-03d4d7995451');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Gran cátedra y de los mejores profesores de la facultad. Hay que llevarla al dia pero vale la pena y no cuesta hacerlo. Da gusto cursarla.', '7e27208e-0c64-4f68-a60e-84f8113ddda2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'La organización de las clases es extraña, ya que lo único que se hace es corregir ejercicios que se hacen en casa que igualmente envían corregido. Igualmente toman asistencia. No me gustó la modalidad, pero al menos no hay parcial ni final. El tp es bastante simple.', '7e27208e-0c64-4f68-a60e-84f8113ddda2');
