INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Como docente tiene poca pedagogía a la hora de dar clases. Como persona es difícil de pasar y cuando le preguntas algo te responde con una pregunta o de una manera pedorra. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Si pueden evitar este curso, mejor. Pretenden mantener un nivel de exigencia alto o muy alto (lo cual me parece correcto) pero por ese motivo no pueden mantener el orden de la clase. Tampoco mantienen los criterios del curso, como normas de corrección y demás. Tampoco responden dudas de la mejor manera (a veces dan la sensación de responder mal), no dejan las cosas claras en clase, y no tienen criterios de corrección unificados. Para destacar, la predisposición de los ayudantes (principalmente) y de los docentes. ', '7e27208e-0c64-4f68-a60e-84f8113ddda2');
