INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Villagra da las teoricas, explica muy bien aunque hay algunos temas que capaz se hacen medio densos. Siempre predispuesto para responder consultas y muy claro. Como  catedra en general, el tp grupal esta muy bueno es desarrollar un mvp desde cero y como experiencia esta muy bueno porque buscan acercarte a lo que se hace en un ambiente laboral. A la vez en la practica piden actividades obligatorias todas las semanas que son calificadas formando un promedio que hay que mantener para aprobar, asi que es muy importante llevar la materia al día. Es promocionable', '7e27208e-0c64-4f68-a60e-84f8113ddda2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La cursada es un desastre, me resulta claro que tanto Sergio Villagra como Guido De Benedetti tienen 0 interes en
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Sus correcciones dejan mucho que desear. No se confien con el arraque. Mas que nada con las actividades de desarrollo. Mucha atencion a las ultimas.', '7e27208e-0c64-4f68-a60e-84f8113ddda2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Villagra es el jefe de catedra. Da las teoricas. La materia no es dificil. No tiene final. Consta de un trabajo practico que se va a haciendo a lo largo de la materia. Recomiendo que se vaya llevando al dia y organizadamente, porque sino se junta todo a ultimo momento y las ultimas dos semanas te destruyen.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Trabajos prácticos altamente exigentes que llevan muchísimo tiempo. Es una materia muy demandante, deben haber más de 30 ejercicios tanto de ejercicios individuales, cuestionarios, además están los 2 tps grupales. Los temas están bastante actualizados. ', '947aa216-154a-4ecc-af89-bf1d3e7bd325');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Al igual que los demás, me pareció bueno explicando.', 'e135c485-b776-4a8e-a097-7d666a9461f7');
