INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Da las clases de taller y es muy buena profesora. Siempre dispuesta a responder dudas durante el recreo y le preocupa que entiendas ', '9fe92340-dba0-4a04-a059-ed83318428ff');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La clase esta aceptable, un poco exagerados (a mi criterio) los plazos de entrega de los TPs', '9fe92340-dba0-4a04-a059-ed83318428ff');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Silvana se encarga del taller de Octave. Son 3 ejercicios individuales (cuatri virtual), que son muy sencillos si seguis lo que se va dando o si ya sabes programar. Es un amor de persona.', '9fe92340-dba0-4a04-a059-ed83318428ff');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es buena y explica bien, pero en el parcial te pone un CERO sin correcciones si no llegaste al cuatro. (No les interesa que entiendas qué hiciste mal)', 'a786efec-570b-4828-a0af-61784e9b6ad0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Copada y explica piola', 'a786efec-570b-4828-a0af-61784e9b6ad0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Parece buen tipo, pero nos dejó a la deriva al final del cuatrimestre. Nos complicaron innecesariamente con los trabajos prácticos, largos y dificiles, muuuuuuuuuy lejos al nivel de las clases.', '91522f75-267f-4a0f-8296-34bb743ba3fe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Diego explica re bien, entre ellos y demás la parte práctica se entendió perfecto. El campus lo tienen bien organizado y podés acceder al pdf de la clase junto a la grabación del meet donde explicaron ese tema y eso es un golazo cuando estás preparando la materia después de mucho tiempo. En el cuatri que la cursé se encargó de hacer el 1er TP y, aunque era largo, era bastante accesible. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica casi toda la segunda parte, bien y responde dudas. Igualmente, suele querer meter miedo y eso lo veo como algo negativo. ', '91522f75-267f-4a0f-8296-34bb743ba3fe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Todos los de la práctica explican bien pero para mí sus explicaciones fueron las mejores. Es claro explicando.', 'abcffe02-42ee-42d4-98eb-8c235750115d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'El mejor profesor de la práctica, muy claro al explicar. Responde todas las consultas de la mejor manera.', 'abcffe02-42ee-42d4-98eb-8c235750115d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Subió varios videos de clases prácticas y están muy buenos, entendés mucho mejor cómo resolver los ejercicios.', 'abcffe02-42ee-42d4-98eb-8c235750115d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Ezequiel es el único de la práctica que se lo vio mas comprometido. Para el TP nos respondía con cierta demora pero respondía. A veces me mareaban sus explicaciones en las clases de consulta porque se iba un poco por las ramas ', 'abcffe02-42ee-42d4-98eb-8c235750115d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Lo mismo que Sassano, un crack Eze. El tipo te contesta todo y siempre se preocupa por transmitir los conocimientos.', 'abcffe02-42ee-42d4-98eb-8c235750115d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se nota que hace rato que da la materia xq la tiene atada. Te baja los conceptos re fácil, aunque obvio que si no estudiás, es imposible seguirlo. Le gusta mucho dar clase por como habla y contesta las dudas.', 'abcffe02-42ee-42d4-98eb-8c235750115d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Un maestro, contesta los mails con consultas al toque, y en las clases siempre se le entiende y repite si es necesario', 'abcffe02-42ee-42d4-98eb-8c235750115d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Se considera como un robo porque los exámenes son muy esquemáticos todos los cuatrimestres. Falto varias clases donde las daba uno de la práctica. Tarda mucho en llegar y las primeras semanas llega mucha gente a firmar la libreta e interrumpe la clase o empieza más tarde. También da recreos pero siendo que se cursa de noche, no sirven de mucho porque terminas saliendo a las 22, pudiendo salir antes. ', '85e2cd5c-44dc-46c9-b63e-ac7f92f46c9d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La verdad, el profe en si no es malo, pero sus clases son DENSISIMAS. Totalmente soporiferas, despues el tiene buena onda para explicar si tenes dudas, pero la clase no la recomiendo. Es totalmente estatica, daria lo mismo que de todo por escrito y despues conteste dudas sobre lo que leiste del apunte', '85e2cd5c-44dc-46c9-b63e-ac7f92f46c9d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Buen profesor. Dispuesto a responder dudas, se queda si alguien quiere consultar despues de clase. Los parciales/finales son sencillos si uno tuvo un seguimiento de la materia. Toman lista todas las clases, ojo con eso, mucha gente se quedo libre en la materia por las faltas. Hubo dos TPs de dificultad media, son exigentes con los plazos/condiciones de entrega. Las veces que llegó tarde fue por problemas de transporte (marchas o cortes por plaza de mayo)', '85e2cd5c-44dc-46c9-b63e-ac7f92f46c9d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Griggio da las clases teóricas. La materia en sí es un embole de aburrida, y por cómo da las clases Daniel te terminas durmiendo. No obstante, se le entiende y se ven menos temas que otras cátedras', '85e2cd5c-44dc-46c9-b63e-ac7f92f46c9d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se puso muy crítico en las correcciones de parciales. Por ejemplo, me corrigió que no demostré de donde saque una fórmula de obtención de raíces, cosa que siempre se usa sin demostrar, otros docentes no pedían esto. No me gustó como docente.', '2ea047a8-3071-44dc-8d31-d4eeead4a388');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Idem que Sassano y Eze, me encantaron las clases que dio escribiendo a mano en una pizarra virtual, super claro. Con solo 1 ejercicio de cada tema te hace entender todo. También re bien corrigiendo parciales, se nota que le gusta enseñar y que aprendas.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Lo que tiene Santiago es que te tira postas de la industria y ejemplos de aplicación donde te das cuenta que la materia es reee importante para un ingeniero. En los TPs te ayuda si le preguntás, pero no te regala nada, lo mismo en los parciales. Se da cuenta fácil si no estudiaste, así que no creas que te va a regalar algo, me parece muy justo y respestuoso para con todos. Además tiró un par de clases a mano alzada virtuales donde bajó conceptos jodidos en ejercicios re claros. ', '2ea047a8-3071-44dc-8d31-d4eeead4a388');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No hace bien su trabajo. Se suele equivocar al corregir, y bajar puntos por nimiedades. Su forma de evaluar me pareció injusta, como si disfrutara desaprobar a la gente. Vale aclarar que no fui bochad@, aprobé el parcial y el coloquio de una. En general, recomiendo evitar esta cátedra. Yo me anoté acá porque era la única para la que me daban los horarios, pero si me preguntan, no lo volvería a hacer.', '4d542789-837b-40d7-b34c-417b1ca7e02e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Valeria da la práctica y corrige el TP. Hay un solo TP que se puede hacer de a dos o solo. Se entrega un informe, código y hay una especie de "defensa" donde la profe hace un par de preguntas a cada integrante. En caso de desaprobar se puede hacer otro TP (con la misma persona o no) y si volves a desaprobar, hay una tercera fecha donde te dan un problema a codear y defender en 3 hs (tipo parcial).
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'muy simpatica y los ejercicios que hace (ella esta a cargo de la parte practica) tienen que ver con la teorica y con lo que entra en el examen', '4d542789-837b-40d7-b34c-417b1ca7e02e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Comparada con Rodriguez esta es una santa. Se manejan mucho por mail pero en las practicas le preguntas algo y siempre ayuda un monton', '4d542789-837b-40d7-b34c-417b1ca7e02e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Si tuviera que criticarle algo sería el audio que en algunos de sus videos (Teórca) se escuchaba algo bajo, pero si usas auriculares se escucha bien sin ningún problema. Si bien sus explicaciones son buenas, quizás cuando ves los primeros videos no se entiende nada pero con las prácticas te termina cayendo las fichas. Totalmente recomendable.', '9af0f818-5c7f-4508-aef0-c54cabf07c87');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'la teoria necesita de mas ejemplos, pero es muy abarcativa. son clases grabads y clases de consulta optativas.', '9af0f818-5c7f-4508-aef0-c54cabf07c87');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Tienen todo en youtube. Las clases de la teórica son para reforzar los videos y las de la practica para consultas. Hay que hacer 3 tps a lo largo del cuatri con los temas que vas viendo. Clave tener en tu grupo a alguno que sepa programar, sino te comes un chasco terrible. El parcial no me pareció dificil (repito, hay que saber programar basicamente). La materia es relativamente tranqui, recomiendo el curso', '9af0f818-5c7f-4508-aef0-c54cabf07c87');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Da explicaciones muy completas de los ejercicios en el pizarrón, lo que es muy útil al preparar los exámenes', '00fcc882-ada9-402f-a240-10de3fe7b948');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buena onda explicando, y da ejemplos bastante buenos', '00fcc882-ada9-402f-a240-10de3fe7b948');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Fabian se encarga de la práctica. Responde todo tipo de duda y realiza muchos ejercicios de la guía práctica lo que ayuda muchisimo, sobre todo a la hora de preparar el final.', '00fcc882-ada9-402f-a240-10de3fe7b948');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Un desastre me parecio, muy por arriba lo que explica y no alcanza para terminar de entender los ejercicios que hay que resolver despues.', 'ddfb1396-d668-4250-ad42-56a5b77e52a6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Explica bien. ', '2a8dd339-8eef-401e-9051-b31a0132d67d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy claro para explicar. Las clases de consulta son dinamicas y si no hay consultas no la estiran pueden durar 20 minutos. recomiendo.', '2a8dd339-8eef-401e-9051-b31a0132d67d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'A veces es un toque hincha con las correcciones de los tps pero en lineas generales es buena onda. Explica bien en los videos y las clases de consulta. Buen profe', '2a8dd339-8eef-401e-9051-b31a0132d67d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Se traba mucho al explicar y eso dificulta seguir la clase. Ni se molesta en revisar los exámenes y las correcciones de los mismos que hace Valeria (la jtp). Cuando la cursé, en el parcial tomaron en uno de los puntos un tema que jamás habían siquiera mencionado en clase..
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Daniel se encarga de la teórica. En general la clase se organiza: La primera hora o hora y media es la practica con Valeria, despues hay una hora aprox para ver el módulo de la teórica (son diapositivas y audios en el campus) y entre las 19 y 19:20 tenes un parcialito de 3 preguntas tipo choice por el presentismo (hay que sumar el 75% de asistencia con este parcialito para el final del cuatri). Y los ultimos 40 minutos eran con Daniel para responder dudas sobre el módulo de la teórica. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'toma lo que explica y lo que está en las guías (que estan muy buenas), le da mucha importancia a lo que es errores y estabilidad. a veces se va un poco cuando le hacen preguntas pero terminas entendiendo. acepta pocos alumnos, con lo cual la clase va a ser chica. los tps me parecieron interesantes. recomiendo.', 'efe0a9a0-932b-41d8-a9de-40042f8385fa');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es una persona muy desorganizada entinces da clase divagando por los temas y no sabes que es lo importante. Es un curso muy diferente a los otros de la materia pq Rodriguez hace lo que quiere. Muy poco recomendado, la vas a pasar mal con los tps que son dificiles y los finales que no sabes que carajo te puede tomar ni con que criterio corrige. La unica manera de aprobar en este urso es ir SIEMPRE a la practica donde Valeria te hace un repaso de lo teorico y te guia en que tenes que saber.. Al pricncipio de cuatrite dice que son clases de 2hs pq te deja 1hr para que veas la clase online pero eso nunca paso todas las clases fueron de 3 hrs. El material online es decente pero son actividades del campus y no poder poner X2 es una paja.', 'efe0a9a0-932b-41d8-a9de-40042f8385fa');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Gran profesora, sabe un monton y explica todo los temas. ', '81924d03-71d3-4ee5-a898-d098e3276d45');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Buena profesora. A lo largo de las clases nos daba ejemplos de cómo los temas vistos se aplicaban en la resolución de problemas reales, y en general, demostraba de dónde obteníamos cada fórmula. Todo eso ayuda a cerrar los conceptos mucho mejor.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Esta cátedra es buena durante la cursada, los tps de programación son razonables y te ayudan a entender cómo hace la computadora para realizar las distintas operaciones de manera numérica. Sin embargo, los exámenes son realmente nefastos, desproporcionados. Los mismos deberían ser a libro abierto, ya que hay docenas de fórmulas en los métodos numéricos que la cátedra espera que sepamos de memoria. No solo esto, sinó que en lugar de solo evaluar que sepas el método numérico, también te piden a veces hacer hasta 6 iteraciones de un método complicado para que estés 45 minutos metiendo números en la calculadora como un mono. Finalmente, en los finales te piden que tengas 2 cámaras distintas para poder rendir, cosa que no todos tienen y me parece un despropósito. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La catedra se cae bastante a pedazos. Con suerte te responden en los foros. La forma de resolver los ejercicios en las prácticas (que no son prácticas sino que clases de consulta) muchas veces no coinciden con como se ven en la teórica y termina confundiendo. Las guías de ej no sirven de nada, son ejercicios muy simples nada que ver a lo que te toman en parciales y finales. A mí me faltó que hayan más ejercicios resueltos de la última parte de la materia porque esos temas quedaron muy flojos. En cuanto a la forma de evaluación también me parece nefasta (más siendo una materia del depto de COMPUTACIÓN) te toman exámenes para hacer ochocientas cuentas en la calculadora, como por ejemplo resolver sistemas de mas de 3x3 a mano o sacar autovalores...  No entiendo por qué no se le da un enfoque más actualizado a la materia si estamos en 2022 estudiando ingeniería y no nos dejan usar software para resolver cuentas tan tediosas en un examen.  Lo único copado fue el TP grupal porque ahí sí tuvimos que programar los métodos numéricos, igualmente para nada porque en el final hay q saber hacerlo a mano... Por último la forma de corregir los parciales me pareció un desastre, cada corrector/ayudante te corrige como se le canta y me paso que me marcaron como mal algo que había puesto que lo decían ellos mismos en un video del campus, a lo que me respondieron con "si, el video del campus esta mal lo habíamos avisado en una clase de consulta". Algo positivo son los ppt de Sassano porque tienen audio y sirven para repasar. Sassano es copada, se detiene en las demostraciones pero tampoco tanto pero me dijeron que en el final si te confundís en una cuenta te pone todo el ejercicio mal ...', '81924d03-71d3-4ee5-a898-d098e3276d45');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un lujo de cátedra. Miryam sube todo el material al campus y tienen un canal de youtube con todo actualizado ni bien termina la clase. Los TPs son muy buenos porque podés implementar las cosas que uno ve en la cursada. Los parciales son fáciles, medio cuentosos, pero por algo se llama Numérico la materia. Super recomiendo esta cátedra.', '81924d03-71d3-4ee5-a898-d098e3276d45');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Excelentes sus clases, super claras y al punto. Hay que prestar atención obviamente xq si no se hace muy denso, pero te baja todos los conceptos a tierra fácil.', '81924d03-71d3-4ee5-a898-d098e3276d45');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se nota que sabe mucho de la materia. Sus clases son con powerpoints. Las veces que no habia -super piquetes- y hacía clases presenciales se le entendía mucho mejor que en la clase virtual, aunque suele ir muy rápido por momentos. A veces se rie de las preguntas que le hacen los alumnos, pero siempre con buena onda... (maso). Recomiendo esta catedra.', '81924d03-71d3-4ee5-a898-d098e3276d45');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Buena profesora para este tipo de materia medio robo', '81924d03-71d3-4ee5-a898-d098e3276d45');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Las clases teóricas las dio solo ella, a veces se le complicaba por problemas personales y cambiaba la clase para el jueves. Un poco desorganizado el tema de los horarios porque diferían del SIU. En gral la teórica son powerpoints que va explicando, los suben antes al campus y tienen sonido, además graban la clase. Siempre contesta si tenes alguna duda de la materia, pero no de cosas administrativas. A veces las clases pueden ser un poco aburridas por ser solo diapositivas que van pasando.', '81924d03-71d3-4ee5-a898-d098e3276d45');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Las clases teóricas las dio solo ella, a veces se le complicaba por problemas personales y cambiaba la clase para el jueves. Un poco desorganizado el tema de los horarios porque diferían del SIU. En gral la teórica son powerpoints que va explicando, los suben antes al campus y tienen sonido, además graban la clase. Siempre contesta si tenes alguna duda de la materia, pero no de cosas administrativas. A veces las clases pueden ser un poco aburridas por ser solo diapositivas que van pasando.', '81924d03-71d3-4ee5-a898-d098e3276d45');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'No toma asistencia. No participe/asistí en muchas clases asi que no puedo opinar mucho, pero buena profesora. Lee powerpoints y comenta sobre ellos. ', '81924d03-71d3-4ee5-a898-d098e3276d45');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Las clases teóricas son muy aburridas y da exactamente lo mismo que esta en su apunte', 'e18c8c8b-2edb-4097-ba37-729986ccc81b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Es un buen profesor pero lamentablemente da temas bastantes aburridos. Las clases estan llenas de demostraciones matemáticas sobre los métodos numéricos.', 'e18c8c8b-2edb-4097-ba37-729986ccc81b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Este cuatri tomo parciales teóricos, lo cual no estuvo mal. Además no te mata corrigiendo. Tiene bastante consideración.', 'e18c8c8b-2edb-4097-ba37-729986ccc81b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Dalas teóricas y luego las sube grabadas. Se nota que sabe de lo que habla y que es muy buena persona. Sin embargo, tuvo muchos problemas de internet y esto empeoro un poco la cursada. La cátedra es recomendable. Se tomo un parcial de 10 preguntas cortas a desarrollar, que habiendo asistido a las teóricas estaba bien.', 'e18c8c8b-2edb-4097-ba37-729986ccc81b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'schwarz es el que da las teoricas, un detalle es que son en la sede de las heras, por lo que no conviene tener materias de  recorrido. En mi opinion se pueden faltar a las teoricas hasta el primer parcial ya que los temas que se ven en el parcial los cubre por completo los videos de la practica y la practica en si. Recomiendo asistir a las clases despues del parcial ya que es lo que te van a tomar en el final. Dependiendo la cantidad de inscriptos del final, hace o oral o escrito. La forma de corregir es bastante compasiva, por lo que recomiendo esta catedra', 'e18c8c8b-2edb-4097-ba37-729986ccc81b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Rodolfo sabe un montón, asi que le podes preguntar de cualquier cosa, se dedica a modelos numericos de forma continua entonces dá muchos ejemplos práticos de ingeniería, lo que es muy interesante y da una perspectiva del problema. Lo unico malo es que las clases son MUY teóricas, explicaciones generalizadas que son dificiles de entender junto a demostraciones matematicas, que recién se entiende cuando los ves en la clase práctica. Entonces solo entendes partes o nada. Genio como corrige, no te tira "vos aprobas vos desaprobas" toma en consideración las respuestas de la mayoría de alumnos, y ve como se puede cambiar la corrección en base a eso.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La realidad es que las clases teóricas estan buenas pero son dificiles de seguir ya que hay mucha terminología matemática y demostraciones teóricas que son un poco densas. Sin embargo, el profe suele comentar cosas sobre los temas que luego se evaluan en el parcial', 'e18c8c8b-2edb-4097-ba37-729986ccc81b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Sosa nos comenta mucho sobre las aplicaciones que tiene el análisis numérico en su trabajo o en otras áreas dependiendo de que carrera sigas, además complementa perfectamente a Schwarz', '429627fd-5140-4f80-863e-e3c4feff241c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Germán es un soberbio. Vive hablando de el mismo y bardeando a otros profesores y a casi todos los departamentos de la facultad y encima se enoja por todo', '429627fd-5140-4f80-863e-e3c4feff241c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Se ama. En las clases prácticas habla mas de él que de los ejercicios o la materia, pero en los videos grabados que hay sobre como funcionan los algoritmos explica bien, y ayuda a entender y cerrar el tema.... 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Germán da prácticas dinámicas, el curso esta organizado como para que en las clases prácticas algunos alumnos tengan que presentar ejercicios al resto, y otros tengan que hacerle correcciones. Esto ayuda a tener la materia al día.', '429627fd-5140-4f80-863e-e3c4feff241c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Sus clases son clarisimas y muy interesantes, por que fomenta la participacion. Pero los parciales comparado a la de las otras comisiones son mucho mas dificiles. ', '429627fd-5140-4f80-863e-e3c4feff241c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'German sosa es el de la practica, explica muy bien y se escucha bien, dado que hay bastante eco en el anfiteatro. Toma asistencia, pero aunque no lo hiciera, recomiendo ir a las practicas ya que te ayudan para llegar al parcial. Le podes preguntar cualquier cosa. Tambien da algunos videos antes de la practica, recomiendo fuertemente verlos.', '429627fd-5140-4f80-863e-e3c4feff241c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es quien se encarga de la práctica de la materia, explica muy bien aunque a veces puede ser un poco duro pero no con mala intencion, en la practica para los civiles que nunca habian programado, dieron 1 o 2 semanas de introducción a la programación, bastante rápida pero es mejor que nada. Muy bien como explica, además subieron videos y algoritmos ya resueltos, ayuda un montonazo en aprender los temas, y poder ver el paso a paso. Mi forma de aprender fué con apunte de catedra -> ver codigo -> ver video del codigo explicandolo
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Da la mayoría de las clases prácticas, siempre predispuesto a responder todas las consultas ya sea de la materia o de programación ya que se usa python para programar todo. Explica muy bien y hace entender bien el codigo paso por paso. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Mica es una genia. En sus clases se entiende todo perfectamente, explica muy bien y tiene mucha paciencia no tiene problema en que consultes o volver a explicar si no entendiste o lo que sea, gran docente', 'ff776e44-b998-4739-92b5-3abdb7387bcc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Genia total, se nota que le gusta la materia. Explica bastante bien y le mete mucha buena onda', 'ff776e44-b998-4739-92b5-3abdb7387bcc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Da las clases prácticas de algunos temas, muy clara explicando y no se va por las ramas con demostraciones y formulas innecesarias.', 'ff776e44-b998-4739-92b5-3abdb7387bcc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Excelente profesor, pero las clases son un poco aburridas. Sube las clases a yotutube, no hizo ninguna clase en vivo.', '7fc50fe4-c00a-46b7-91bc-8700eac378b6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Si pueden no se anoten en esta cátedra. Desde que empezó la pandemia se pusieron muy exigentes al pedo. Tarela tiene las teóricas subidas a youtube y son muy completas, pero no sube pdfs a ningún lado sino que quiere que te sientes y copies a manopla las diapositivas del video, totalmente innecesario. Hubo dos TP's, donde el segundo estuvo hecho por él y fue muy difícil, eso sumado a que los de la práctica no lo explicaron bien y cuando hicimos la primer entrega nos mandaron a reentregarlo a todos, así de mal estuvo. Durante el cuatrimestre nos hizo hacer entregas de tres ejercicios teóricos que nunca corrigió, ni nos dio una devolución, un desastre. Los parciales no eran difíciles, al menos el 1C2020 tomaron ejercicios de rellenar casillas por campus sin entregar el desarrollo. Los finales son un horror, para aprobar te piden tener un ejercicio práctico bien y uno teórico bien. Los prácticos son bastantes accesibles, con hacerte un par de finales viejos y algunos de la guía estás. En el teórico entra TODA la materia, te toman desarrollos matemáticos de los métodos que la única forma de aprendérselos es estudiando de memoria sus apuntes. Me presenté a rendir en las últimas fechas del 1C 2021 y bocharon a mucha gente, exigencia al pedo. Si la tengo que recursar claramente no voy a elegir esta cátedra.', '7fc50fe4-c00a-46b7-91bc-8700eac378b6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Tarela hace que una materia que es relativamente fácil resulte complicada. siempre quieren asustarte y que te vaya mal. No recomiendo que se anoten con el. En su catedra toman complicado, rebuscado y te dan poco tiempo. En los finales no entrega las correcciones, demostrando que es una catedra en la que no les interesa que aprendas. Sus entregas teoricas no sirven y entre estas entregas, el parcial y los TPs, te consume mucho tiempo la materia. Tarela NO da clases sincronicas, y sus videos se entienden pero no sirven mucho (poco dinamicos). Tampoco responde dudas ni ningún tipo de mail.   Sin embargo, la materia es aprobable si estudias de muchos finales viejos. ', '7fc50fe4-c00a-46b7-91bc-8700eac378b6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'La materia esta bien dada, bastante completa. Para aprobar el final lo unico que ncesitas es tener la capacidad de calculo de una computadora, la memoria de una computadora y algun parentezco lejano con el mismisimo Gauss. Es un delirio su forma de evaluar.', '7fc50fe4-c00a-46b7-91bc-8700eac378b6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Muy buen profesor, aprobado el final hay que dar un oral con él cuya dificultad depende de tus notas previas. Sus clases son muy organizadas y es prolijo en el pizarrón. Tiene buen trato con los estudiantes y no tiene problemas en contestar preguntas. Parcial y final son de dificultad media. Hay 2 TP. ', '7fc50fe4-c00a-46b7-91bc-8700eac378b6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Tarela es buen profesor. Como ventajas le doy que es muy detallado para explicar, tiene paciencia y en las consultas responde todo; como desventajas tiene que las clases son muy densas comparadas con las de otros profesores.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Si pueden elegir cualquier otro curso haganlo, los finales que toma son para que te aprendas todo su cuaderno de memoria, muy dificiles al pedo e imposible tener algun apunte a mano', '7fc50fe4-c00a-46b7-91bc-8700eac378b6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Hacia el final de la cursada dio una clase práctica que fue muy buena, me hubiese gustado que diese más clases.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Otra crack, no interactué mucho con ella, pero me encantaron mal sus clases interactivas. Una lástima que sean de las últimas, estaría bueno que de más de los primeros temas. ', '2722963a-e094-404b-82b7-fe1270b8455a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Agus es re crack, te tira muchas postas para los parciales y encima dio clases re interactivas!!', '2722963a-e094-404b-82b7-fe1270b8455a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Bastante mala onda las pocas veces que interactué con ella. Te toca que te corrija y te queres morir porque es muy gede con cada detalle.', '2722963a-e094-404b-82b7-fe1270b8455a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Dio varias clases prácticas y se entendieron perfectamente. También subía las ppts que usaba para los ejercicios, muy buenos para repasar.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'me fueron útiles sus videos aunque demasiado largos', '2e35aeae-ff75-45fd-a30f-534199953e7d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Rama un lujo, las clases las subió a Youtube y se re entendieron, encima un tema medio pesado como Cuadrados mínimos lo hizo super claro. Además está bueno los comentarios que hace en clase, te tira muchas postas.', '2e35aeae-ff75-45fd-a30f-534199953e7d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Rama como Santiago, te tira postas de la industria re útiles que te hacen ver xq es una materia tan importante. También sube ejercicios y explicaciones de temas jodidos a youtube, y se nota que le gusta enseñar y que entiendas los temas. Obvio que si no estudiás, nadie te va a regalar nada (y me parece perfecto y justo para con los que sí estudian).', '2e35aeae-ff75-45fd-a30f-534199953e7d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Naaa el verdadero jeffffe. Sin tener que pensarlo mucho, es el mejor profesor de la facultad x lejos. Punto uno: graba las clases (hasta las presenciales), asi que si se te pisa con otra materia no te hagas drama (aunque por experiencia personal recomiendo fuertemente ir a las clases presenciales). Punto dos: es god explicando y no tiene drama de contestar una misma duda 10 veces; me sorprende la paciencia que tiene. Punto tres: mantiene una organizacion de la materia increible (parece que estas fuera de FIUBA xd), tiene un calendario donde detalla clase x clase lo que va a dar y donde deja los links a las grabaciones de las clases (igual en el campus esta TODO lo que podes llegar a necesitar: desde videos hasta los ppts que usan en las clases). Punto cuatro: sube TODOS los parciales y finales que tomo los ultimos cuatris al campus, es clave para practicar para el parcial. En cuanto a la cursada en si, podriamos dividir el cuatri en 2: la primera parte (primeras 10 sems aprox) es la mas heavy, en la que toma 5 de los 6 parcialitos de la cursada y el parcial; despues en la segunda parte es mas tranqui ya que no hay mucha evaluacion (solo un parcialito), pero todos los temas de la segunda parte entran al final. Bueno, en realidad todos los temas de la materia entran al final. Los parcialitos son ejercicios tipo los de la guia, y hay un parcialito por cada tema "importante". Para aprobar la cursada, hay que aprobar el parcial (en el que evalua la mitad de los temas de la materia) y 4 de los 6 parcialitos. Por eso, si le metes al principio, a mitad de cuatrimestre podes ya aprobar la cursada. Es una materia larga, con mucha info, en la que aprendes una bocha y no te demanda taanto tiempo, solo tenes que tenerla al dia hasta el parcial, y desps ir siguiendola pero sin volverte locx. Aprovechen a Mariano que es crack. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buen docente, siempre contesta con muchas ganas todas las consultas, se nota que sabe y las clases en general son muy buenas. La materia es un parcial bastante accesible y un final un poco más complicado, pero nada del otro mundo. La mitad de las clases fueron virtuales y la mitad presenciales, ambas fueron grabadas pero la calidad del sonido en las presenciales es muy mala así que conviene ir de ser posible.', 'bb314455-589f-48fb-836c-f7aa0067bc72');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Exelente. ', 'bb314455-589f-48fb-836c-f7aa0067bc72');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Las clases estan increiblemente bien organizadas, y detalladas y explica con mucho conocimiento. Creo que es de lo mejor que vi en FIUBA', 'bb314455-589f-48fb-836c-f7aa0067bc72');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se encarga de dar la practica, y como todos los de la practica, no es mal profesor pero se nota que no la tiene tan clara como Mariano Beiró. Las clases estan bien, los temas se entienden y lo que te toman en los parcialitos y en el parcial es parecido a lo que se explica.', 'efd752dc-e998-49c0-8dcd-dd5176b2680e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se encarga de dar la practica, y como todos los de la practica, no es mal profesor pero se nota que no la tiene tan clara como Mariano Beiró. Las clases estan bien, los temas se entienden y lo que te toman en los parcialitos y en el parcial es parecido a lo que se explica.', 'bfd07964-5e92-4440-a8ab-e73641be1850');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se encarga de dar la practica, y como todos los de la practica, no es mal profesor pero se nota que no la tiene tan clara como Mariano Beiró. Las clases estan bien, los temas se entienden y lo que te toman en los parcialitos y en el parcial es parecido a lo que se explica.', '2a3c16e0-0d51-493e-bdb9-d5dd45270cbc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Se encarga de la practica. No explica muy bien, pero le pone onda y los temas no son dificiles. Los parciales no los corrige a matar, y en los tps no es muy exigente. Lo mismo aplica para la otra profe de la practica (Villanueva)', 'dabe5f8d-6993-4bf7-9508-babb89563e46');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Se encarga de dar las teoricas. Aunque a veces las clases se tornan un poco aburridas, explica bien y se nota que sabe un monton. Es muy amable y contesta cualquier pregunta. Siempre esta a disposicion de ayudar al alumno. La materia es un parcial (muy tranqui) y 2 tps que no son dificiles. Es una materia interesante y la cursada es amena', '50ab4253-42d8-4dc8-bdbe-de3b15039c4c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Excelente docente y muy buen trato con los alumnos. Explica los ejercicios muy bien.', '82496993-f7ca-44d7-9449-f1e6b9240813');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Da buenas explicaciones, intuitivas y no se detiene tanto en detalle.', '82496993-f7ca-44d7-9449-f1e6b9240813');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'El dio todas las clases. Buen profesor, los temas a veces son tan rebuscados y nuevos que hasta el se complicaba.', '8c541a92-7c03-4354-bb82-e3e412573aa6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buen docente. Tarda en responder las dudas si no se hacen en clase. La modalidad de cursada es ver videos teóricos de entre 2 y 6 horas mas un encuentro virtual de 3 horas donde se resuelven ejercicios, los alumnos pueden plantear sus propias soluciones o si ninguno lo realizó victor te da su solución. Se puede promocionar, hay examenes parciales optativos que por cada ejercicio aprobado es un tema menos en el final(Aunque a veces no es conveniente). El final me parece muy dificil, en comparación con lo fácil que es aprobar la cursada.', '8c541a92-7c03-4354-bb82-e3e412573aa6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El formato este cuatri fue lunes presencial 3 horas. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy buen docente, hace lo que tiene que hacer y deja en claro lo que hay que hacer para aprobar.', '8c541a92-7c03-4354-bb82-e3e412573aa6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buen profesor, siempre mantiene un trato amable con los alumnos. Deja muy en claro las reglas de su materia mediante un calendario, criterios de aprobación, etc. Aprovecha toda instancia de evaluación como medio para enseñar y no para castigar alumnos.', '8c541a92-7c03-4354-bb82-e3e412573aa6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Victor es buen profesor, se nota que sabe mucho del ámbito y se pone al hombro la materia, es permisivo corrigiendo en las evaluaciones optativas pero en los tps suele ponerse exigente. Este cuatri tuvimos los lunes práctica presencial que consistia en hacer un cuestionario primero del tema que ibamos a ver ese dia y despues haciamos ejercicios lo que quedaba de la clase, las teóricas consistían en ver videos que explicaban el tema y muchos ejemplos, todos distintos, cada video tiene una duración media de 30 minutos y x semana son alrededor de 9 videos para ver. Es una materia densa y muy teórica (tomarse a pecho el nombre de la materia), trata temas muy interesantes y un tanto complejos, siento que tiene que ser una materia obligatoria ya que lo que se ve constituye muchos pilares de la carrera. En cuanto a TPs fueron 3: el 1ero individual y los otros en grupos de 5 personas. Clave conseguirse un buen grupo asi los trabajos se hacen amenos, al final de cuatri hay una defensa oral de TPs asi que no tenes que colgar en ninguno (la defensa suele ser tranqui si llevaste al dia los tps y cursada). Resumen: linda materia con temas interesantes, diria que consume un poco mas de tiempo que algoritmos 2 pero por la complejidad de los ejercicios y temas (la guia de ejercicios no es facil, sin embargo estan a nivel de ejercicios de final).
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Ferrigno es un genio, es un sol en todos los aspectos.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un capo. Es super claro para explicar y la materia esta bastante buena', 'c66c4094-e812-4da4-bf27-3c906c1e0145');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Las clases son un poco aburridas pero te da todos los temas. Toma asistencia cuando no es necesario. El tp es bastante simple, pero la guia de ejercicios que hay que entregar al finalizar el cuatrimestre es demasiado extenso. El final es bastante fácil, los puntos que te salieron mal, los podés recuperar con un oral.', 'c66c4094-e812-4da4-bf27-3c906c1e0145');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Materia súper robo, no fui a ninguna clase y aprobé con 10', 'c66c4094-e812-4da4-bf27-3c906c1e0145');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy buen curso, recomiendo hacer la materia de forma online!. Ferrigno le mete mucha onda, y le gusta que aprendas algo nuevo. ', 'c66c4094-e812-4da4-bf27-3c906c1e0145');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Sus clases son bastante buenas. Siempre previo a la clase hay que leer un capítulo del libro que se usa como referencia, mantener el ritmo de lectura a veces se vuelve complicado. Los temas son interesantes.', '93e05c7b-703f-4858-857c-560dd7fd4999');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Estaba encargado de la practica. Le ponía onda. Debido a la relación desproporcionada de profesores/alumnos la práctica quedó desbordada, eran 2 profesores para 80 alumnos.', '70b93894-a06f-41c2-b9e5-a6ac702c5f37');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Son muy desorganizados y en el campus no suben casi material', '039446f2-a49f-46c1-8965-b894f60ca51b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Prepara videos y en la clase da tiempo para mirarlos y después resuelve dudas sobre eso pero sus clases se sienten muy tensas y es difícil preguntar.', '2749dbea-f206-4b5d-948d-53789b6b3e1c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Un capo, explica bastante bien. Lo que si, hay que mirar videos antes de sus clases para estar en contexto (los envia él). Un poco exigente, pero nada elevado. Contesta todas tus dudas en clase hasta que entiendas al 100%. Buen profesor. Se ofreció a explicarme todo para poder rendir un recuperatorio ya que era mi primera vez programando, siempre en mi corazon :)', '2749dbea-f206-4b5d-948d-53789b6b3e1c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'El mejor prof de practica de algoritmos', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Te dan ganas de meterte a las clases y de hacer los tps, ya que tienen una tematica y son  muy entretenidos', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'De los pocos profes que hacen TAN llevadera la clase. Sus practicas son un mil, entendes todos los temas y te divertis. La mejor catedra lejos', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Le trae un poco de organización a la materia sin arruinar el ambiente que trata de crear Mariano. A veces suena algo cortante, pero no lo hace de mala onda.', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Manu, un copado total. Explica re bien los temas y si tenes alguna duda no tiene problemas en contestar de la mejor forma. Y si no, por slack siempre contestan, también hay mucha buena onda ahí. Recomendadísimo', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'EL MEJOR PROFESOR DE ALGORITMOS I. Se aprende muchísimo en esta cátedra ', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Gran profesor, sus clases teóricas son buenísimas y se entiende re bien. El problema que le veo a la cátedra es que según qué corrector tengas en un trabajo práctico la experiencia es distinta (a veces puede ser buena o no según eso). La recomendaría pero antes vean algo de programación para no estar tan perdidos.', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'excelente catedra y muy dinamico. Si bien ya no es Mendez quien da la materia, Camejo es un excelente profesor, hace muy divertidas y interesantes las clases. Los colaboradores son muy buena onda y siempre con buena predisposición', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Camejo es un excelente profesor, hace muy divertidas y interesantes las clases.', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Antes que nada, Camejo es buen profesor, pero tiene varios puntos negativos la catedra.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Clases súper organizadas y que ayudan a participar el único inconveniente es que a veces intenta ser muy gracioso pasando la línea con los alumnos', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Da la práctica turnándose con los ayudantes y es excelente, hace las clases muy amenas sin perder el objetivo de la clase como tal. Mientras que se le siga el ritmo al curso se aprende a programar desde cero sin problemas, a pesar de que enseñen en C y no en phyton. ', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Manu un genio, le pone mucha onda todas las clases. Te dan ganas de levantarte a las 8 para la clase.', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Gran tipo, gran profesor, se entiende todo perfecto.', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Un grande, él y toda la cátedra, se aprende mucho y siempre están para responder dudas, 10/10', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buen profesor, super didactico. Se usa una plataforma que se llama Slack que es como Discord. Responde rápido y te hace pensar el problema planteado para que lo puedas solucionar por tu cuenta. Para mi, la mejor cátedra para comenzar entusiasmado la carrera y seguir así en el segundo cuatimestre.', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Excelente profesor, recomiendo mucho esta catedra', '8337dacc-d820-452c-ad49-fd78d82ab9c0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un capo guido, las clases las dan mucho los ayudantes de catedra son execelentes los pibes y guido es muy copado, se aprende mucho en la catedra.', '43e2dff6-8291-4a96-8792-14aacab1dd6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No es muy regular con su asistencia a clase. Deja mucha parte de la explicación en manos de Lanzillotta o en los ayudantes. Pero cuando explica el se le entiende perfecto y además hace la materia muy divertida y entretenida. Le pone mucha onda y es un genio, explica Python y al final de la cursada se ve un poco de C. Honestamente de las mejores cátedras, o la mejor, de algoritmos.', '43e2dff6-8291-4a96-8792-14aacab1dd6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Las clases las suelen dar los ayudantes más que guido y bruno, pero aún así las veces que le tocó a alguno de los dos explicar o dar algún tema lo dieron bien, las clases suelen ser entretenidas y estar bien dadas sea quien sea el que las dé; la verdad hacen que sea un gusto ir a clase. Muy recomendada la cátedra', '43e2dff6-8291-4a96-8792-14aacab1dd6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No aparece mucho en clase, pero es un genio y explica muy bien todos los temas, es un genio y recomiendo esta catedra posta
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un crack. Gran profesor, siempre con buena onda y da claras explicaciones. En cuanto a la catedra, son pocos los ayudantes que no explican bien, la mayoria unos genios. Mi unico problema es que tu nota dependia mucho dependiendo de quien te corriga. Fue la unica falla que le encontre a esta gran catedra!', '43e2dff6-8291-4a96-8792-14aacab1dd6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Excelente profesor y excelente cursada, ojo parciales y finales largos ', '43e2dff6-8291-4a96-8792-14aacab1dd6d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Una catedra bien organizada, siguen un apunte al pie de la letra y la hace muy llevadera', '4439ecca-6a7d-427e-acfc-b423bb505afd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'La mejor cátedra lejos. Las prácticas son muy informativas y bien organizadas. Hay clases de consultas y una lista de mails por si te surgen dudas. Todos muy dispuestos a ayudarte. Las clases son re entretenidas. Essaya y Gaston son unos genios!!!!', '4439ecca-6a7d-427e-acfc-b423bb505afd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Un genio, catedra ultra recomendada.', '4439ecca-6a7d-427e-acfc-b423bb505afd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'La mejor cátedra.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Excelente catredra!!! La teorica muy buena, Diego (Essaya) explica muy bien y responde dudas. La teorica tambien excelente, los ayudantes y correctores explican y corrigen de forma justa y clara! Aparte responden dudas, via mail/discord rapido aunque sea fuera del horario de clases. Totalmente recomendada.', '4439ecca-6a7d-427e-acfc-b423bb505afd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Diego es un genio, sus presentaciones son super trabajadas hasta con memes acutales. Aprendés un monton durante la cursada, los TPs aportan bastante al aprendizaje y son temáticos (en mi cuatri fueron de Pokemon). Su curso enseña Python. Se manejan por Discord lo cual me parece excelente. Al final generás sentido de pertenencia con el curso jajaj.', '4439ecca-6a7d-427e-acfc-b423bb505afd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Siempre llega puntual, las clases las da muy bien organizadas y está al tanto del chat cuando explica. Las clases teóricas son muy buenas', '4439ecca-6a7d-427e-acfc-b423bb505afd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un crack el diegote. Las clases teoricas son excelentes, aprendes y te divertis, son super llevaderas. La materia esta re bien organizada. Podes preguntar algo en cualquier horario y te van a contestar porque nos manejamos con discord y hay 120 mil ayudantes. Los TPs estan buenisimos, el primero te mata, pero es la idea, despues de eso los otros se sienten mucho mas faciles. Tambien esta bueno tener 4 parcialitos porque son poquitos temas para cada uno.', '4439ecca-6a7d-427e-acfc-b423bb505afd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Me pareció un buen profesor, explica bien y le mete mucha onda, en las teóricas a veces pone memes entender algunos conceptos. Tiene un discord de la cátedra donde él y los ayudantes responden dudas al toque. Los TP son muy piola comparado con las otras cátedras (en esta te hacen hacer jueguitos). Los ayudantes también son muy buena onda y siempre explican si algo no quedó claro. Muy buena cátedra 10/10.', '4439ecca-6a7d-427e-acfc-b423bb505afd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Essaya es el mejor profesor que tuve este cuatri, desde el dia 1 hice que me interese por la materia, y eso que entre sin saber programar y con muchas dudas de lo que era la programacion. Pone memes en las filminas de las clases, su forma de explicar es dinamica y hace que no te aburras en las clases, las practicas no se le quedan atras, te explican cosas que capaz quedaron medio colgadas en las teoricas y son re amables y buena onda, eso si, tenes 4 parciales y 3 tps, mas que nada el primero es muy exigente y hace que te choques de frente con la programacion, pero despues salis muy curtido y sabiendo un monton. Literalmente no usan el campus, se manejan por la pagina de la materia y usan mucho Discord, lo cual hizo que las dudas se respondan rapidisimo. Super recomendable', '4439ecca-6a7d-427e-acfc-b423bb505afd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Essaya es, junto a sus ayudantes, de lo mejor de la facultad. Sus clases están bien organizadas desde el día 1 y tienen un calendario con todas las fechas de entrega y parciales. Sus explicaciones son claras y abiertas a principiantes de Python. Es siempre puntual y contesta cualquier duda que le tires, por más tonta que sea.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Leyendo el apunte de la materia antes de ir las clases se hacían muy aburridas, prácticamente no era necesario ir. De todas formas Diego es muy bien profesor y le pone ganas a la materia. Muy recomendable', '4439ecca-6a7d-427e-acfc-b423bb505afd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Excelente catedra, altamente recomendale. Explica muy buen y no tiene problema en repetir lo que acaba de decir miles veces mas hasta que se entienda.', '4439ecca-6a7d-427e-acfc-b423bb505afd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Diego es un buen profesor. Sus clases son basicamente explicaciones del apunte teórico de la materia (ahí esta practicamente todo) pero dando más ejemplos y trantando de explicar mejor los temas más complicados. Mi recomendación es que si sabes programar (especialmente Python) no es necesario ir a las clases teóricas, o al menos las primeras semanas donde se dan los temas más básicos. La materia realmente está muy bien dada, hay una gran organización y las clases prácticas son muy buenas. Los profesores (la mayoria alumnos o ex alumnos) que las dan son unos genios, tienen la mejor onda. Se crea un ambiente muy distendido en donde se da lugar a una constante interacción con los alumnos. Totalmente recomendable esta cátedra.', '4439ecca-6a7d-427e-acfc-b423bb505afd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Diego es excelente. Te enseña a programar de cero, no hace falta que sepas nada.', '4439ecca-6a7d-427e-acfc-b423bb505afd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Creo que no podría haber cursado en una cátedra mejor que esta. Las teóricas fueron cada una de ellas super organizadas, detalladas, hasta cuando se terminaban los temas de la clase, siempre tenía unos temas/tips extras que sumaban un montón. Las diapositivas que usa estan completísimas, todo super organizado y Diego que explica excelente. Yo no sabía programar antes de este curso y es increíble lo mucho que aprendes, y no solo eso, sino que Diego se encarga de dar las teóricas de manera tal que aquellos que no tienen conocimientos previos entiendas todo a la perfección. Altamente recomendada esta cátedra.', '4439ecca-6a7d-427e-acfc-b423bb505afd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Diego es lo mas, las clases teóricas muy buenas y pasaban volando ', '4439ecca-6a7d-427e-acfc-b423bb505afd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un desastre. Cuando le hice una pregunta me diji, y nose fijate vos es parte del proceso, palabras mas palabras menos. Se supone que esta ahi para ayudar. Varios mas tuvieron problemas con este', '165140db-ee55-487a-959e-97fa82835b90');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Estuve en su practica. Explica re bien. Capaz por chat parece medio cortante, pero es re copado. Varias veces cuando hace un ejercicio nos pregunta a nosotros que escribir y ahi vamos viendo que funciona y que no, muy bueno la verdad.', '165140db-ee55-487a-959e-97fa82835b90');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'No estaba en su práctica, pero tuve alguna que otra clase con él y es in profesor excelente. Explica re claro, te hace dibujos para que comprendas bien ciertos temas y principalmente se encarga de hacer participar a la mayor cantidad de alumnos. Se sabe que sabe un montón, es super copado.', '165140db-ee55-487a-959e-97fa82835b90');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es buen profe pero se va por las ramas hablando de términos y conceptos que son avanzados para ser la primer materia de programación de la carrera', '7584dcb8-ca8d-4fac-abf3-e9a9804053d7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Ezequiel es un RE PROFESOR. Sus diapositivas son facheras y su forma de dar clases es muy buena. Responde todas tus preguntas, aunque no tengan nada que ver con la clase. Fomenta la participacion. Siempre con buena onda', '920c55c6-278f-470a-a077-0b9dcec360d9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy buen profesor pero no da casi temas', '1de9017a-4900-47ca-ab73-d0356b6ab438');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Su cátedra es desordenada, pero los temas están buenos y si no sabes nada de programación es recomendable porque enseñan python. Él en particular da las clases lento (aveces demás).', '1de9017a-4900-47ca-ab73-d0356b6ab438');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Explica bien, un copado corrigiendo, no es muy exigente, hace las clases re llevaderas en aprender todos los temas.', '1de9017a-4900-47ca-ab73-d0356b6ab438');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Aparecio una vez y fue el primer dia, despues no volvió mas XD', '1de9017a-4900-47ca-ab73-d0356b6ab438');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'un capo andy!', 'fab27e21-c275-4b2d-a357-e9bd8990d7e8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Debe ser el profesor de la cátedra de Guarna que más onda le pone a sus clases y se nota que le gusta lo que enseña. El único problema es que esa cátedra es muy desordenada.', 'fab27e21-c275-4b2d-a357-e9bd8990d7e8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Andy es un re profesor, tanto en analisis como en algoritmos. Comienza las clases con un poco de humor y encuestas para conocer a los alumnos. Lo que si, su voz da sueño (el mismo lo admite) jaja. Explica muy bien. Sus clases tienen muchas diapositivas asi que agarrate.', 'fab27e21-c275-4b2d-a357-e9bd8990d7e8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy copado, la tenia muy clara. Eso si, reza para que no te toque como corrector porque es re exigente y cuando el te reprueba otro te aprueba', '5bb326aa-e8e4-4735-95f9-47ce3ee353f3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Juani manejaba mi práctica, la tiene clara. Es bastante exigente a la hora de codear pero esta bueno porque te tira tips para los parciales y para codear de manera prolija. Contesta rapidísimo por Discord y esta super dispuesto a explicar y ayudarte.', '5bb326aa-e8e4-4735-95f9-47ce3ee353f3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No lo tuve en la practica pero siempre esta por ahi contestando en discord y es el que da los talleres pre-parcial. Un genio, siempre dispuesto a ayudar.', '5bb326aa-e8e4-4735-95f9-47ce3ee353f3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Antes de los parciales siempre hace un taller resolviendo ejercicios de parciales anteriores y dando consejos.', '5bb326aa-e8e4-4735-95f9-47ce3ee353f3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un capo Juani, no lo tuve en mi practica pero en los talleres pre parcial te explica los ejercicios de una manera que te explota la cabeza, siempre le encuentra la vuelta para que el codigo quede lo mas prolijo y compacto posible, ademas es streamer y tiene un gato que se llama calefon, que mas queres. Si le hablas por privado te responde no importa la hora que sea, siempre con la mejor y con ganas de transmitir lo que sabe', '5bb326aa-e8e4-4735-95f9-47ce3ee353f3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es el ayudante que mejor explica de la materia. Los ejercicios de ejemplo que da son explicados con mucha claridad. Siempre abierto a dudas. También es un excelente corrector y te detalla en qué áreas podes mejorar o te da tips para resolver un problema.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Estuve en su práctica y la verdad que es insuperable la calidad, buena onda, y buenas explicaciones de sus clases. Se nota que sabe un montón y que recontra disfruta lo que hace, se transmite eso en sus clases lo que las hacen super dinámicas y entretenidas. Todo siempre super organizado, explicando paso a paso, preguntando si se entendió todo y de ser necesario repetía todo nuevamente hasta que quede claro...Sinceramente un lujo todo, si puede elegir esta práctica se las super recomiendo al 100%.Un idolo juanii', '5bb326aa-e8e4-4735-95f9-47ce3ee353f3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Juani es un capo, sinceramente uno de los mejores profesores que tuve, no le importaba que le hable un domingo 4 am por consultas de los tps', '5bb326aa-e8e4-4735-95f9-47ce3ee353f3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica y esta en muchas de las clases, le pone onda y lo trata de hacer entretenido pero a veces puede ser un poco pesado. Sin embargo la catedra de el y Costa es buenísima y la recomiendo.', '9930d693-c6ca-4471-a1e8-a1af57806595');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'tambien es muy bueno, puede ser medio pesado pero la verdad es que explica todo muy bien y es buena onda.', '9930d693-c6ca-4471-a1e8-a1af57806595');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Paciente a la hora de explicar, siempre responde dudas casi instantaneo', '9930d693-c6ca-4471-a1e8-a1af57806595');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'nico explica muy bien, siempre con buena onda. responde todas tus dudas y tiene diapositivas muy completas. (cada tanto una referencia al lol)', 'f222bd6b-7b71-4a61-9116-968cf9c1ead9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No existe (?', 'd972fc61-8c45-4e13-b94b-dbf5573ace67');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'El héroe invisible de la cátedra. Casi nunca se lo ve en las clases, pero nunca está ausente del todo.', 'd972fc61-8c45-4e13-b94b-dbf5573ace67');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'De las clases (prácticas) que dió, se le entendió perfecto, y contesta rapidísimo las dudas (por slack, no se usa el campus). ', 'd972fc61-8c45-4e13-b94b-dbf5573ace67');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Un genio, sabe banda y es re buena onda. Las clases son super completas y, para mi, se adaptaron re bien la cursada virtual. Además subieron todo a el canal de YouTube por lo que podes volver a ver todo lo que quieras cuando se te cante. Super recomendada', '2c6ed866-2e9a-420e-9590-f9d476781aef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Martín hace todo bien, explicaciones, correcciones, quiere que participen de la clase, contesta en slack, todo !', '2c6ed866-2e9a-420e-9590-f9d476781aef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Excelente cátedra. Toman muchos mini tps (implementaciones de TDAs) por lo que puede ser un poco agobiante si estás cursando un cuatrimestre pesado pero te deja muy bien parado a la hora de rendir. Se toman 4 parcialitos y la cursada es promocionable. Enseñan C desde cero, por lo que no hay problema si anteriormente aprendiste Python. Si querés aprender de verdad y crecer como programador es tu mejor opción.', '2c6ed866-2e9a-420e-9590-f9d476781aef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Martín es muy claro en las explciaciones y las clases quedan grabadas.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'El mejor profesor que tuve hasta ahora en fiuba. La materia es super interesante y esta catedra es increible. ', '2c6ed866-2e9a-420e-9590-f9d476781aef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica bastante bien todos los temas, las teóricas están bastante bien organizadas y siempre ay lugar para hacer consultas', '2c6ed866-2e9a-420e-9590-f9d476781aef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Se nota que sabe mucho de lo que habla. Se lo nota un tanto pedante, pero súper correcto siempre. Te tira la posta con todo. Es un buen docente, a excepción que no suele fomentar mucho la participación en clase, o a veces da la impresión que tu pregunta le molesta un poco, pero capaz es porque es un tipo medio serio. Igual, cada tanto se le escapa un chiste y la sube. Su curso es excelente, pero la cantidad de TPs es desorbitante, no te deja descansar ni una semana, mismo con los parcialitos. Cualquiera que curse en su curso le va a tener que dedicar más a esta materia que a todas las otras, pero a cambio el conocimiento que ganas sobre algunos temas es muy valioso. ', '2c6ed866-2e9a-420e-9590-f9d476781aef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es la cátedra mas prolija que vi y voy a ver en la facu, las teóricas con martín estaban bastante buenas y queda todo grabado y subido a youtube, así que cualquier cosa las poder volver a ver. También hizo "videitos" de cada tema que la verdad están muy buenos para ver antes de clase, o después de una clase si algo no te quedo claro y no podes gastarte en verla completa denuevo.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'El cuatrimestre ni había arrancado y ya había cometido un error: anotarme en esta cátedra. Iluso pensaba que la “posibilidad” de promocionar justificaba una cursada horrible, donde te bombardean a parciales y tps y no aprendes nada', '2c6ed866-2e9a-420e-9590-f9d476781aef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Buchwald explica muy bien, y corrige rápido, siempre esta abierto a preguntas acerca de errores y tiene un sistema muy documentado respecto a qué nota obtuviste respecto a tu desempeño. Un profesor muy completo y buena onda la mayoría del tiempo.', '2c6ed866-2e9a-420e-9590-f9d476781aef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Buena docente!', 'b850c2da-ecba-4017-b44b-cc7e7b013e59');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'patricia calvo lastre iiiiinsta', 'b850c2da-ecba-4017-b44b-cc7e7b013e59');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Material abundante para estudiar en el campus, creo que el curso necesita un replanteo urgente, las clases prácticas y teóricas van demasiado desacopladas, no es muy bueno que las evaluaciones parciales solo cubran punteros, TDA y Listas, pero la materia como esta planteada: Un TP grande grupal saca muchisimo tiempo y no da mucho lugar a mas TPs ni mas evaluaciones, creo que seria importantisimo tener algunos TPs individuales de los TDAs de estructuras basicas: ej: lista, abb, hash  y TPs grupales mas livianos pero que incluyan mas temas, tambien que en las practicas se vuelvan a tratar y ejercitar dichos temas. ', 'b850c2da-ecba-4017-b44b-cc7e7b013e59');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Buena docente, te da todo lo necesario para aprobar su cursada. Da 50% virtual y 50% presencial porque la facu no permite mas del 50% de virtualidad pero la teórica podria ser toda virtual. Da parcialitos teóricos a lo largo del cuatrimestre que si los aprobas te saca los temas del final quedando un final muy simple.', 'b850c2da-ecba-4017-b44b-cc7e7b013e59');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Se encarga de las teoricas, puede ser que resulten aburridas porque presenta powerpoints que parecerían ser viejos, pero es suficiente como para aprobar la cursada. Evalúa el final ella, medio difícil pero con los temas de la teorica es suficiente (la practica se evalua durante la cursada, no en el final). La cursada consta de un parcial de 3 temas a aprobar en 3 intentos. Dos trabajos practicos (el primero introductorio a la materia y es individual, el segundo es largo ya que dura todo el cuatrimestre y es grupal)', 'b850c2da-ecba-4017-b44b-cc7e7b013e59');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Realmente creo que es una profesora que merece más de lo que se le adjudica. La verdad es que en clase te lee un powerpoint, pero te lo explica bastante bien, y después CUALQUIER duda que tengas te la responde sin problemas y en cualquier momento. A veces cuelga con el mail, pero si no te responde al toque. Literalmente le fui a hacer consultas 10 minutos antes del final y me respondió todo sin problema.', 'b850c2da-ecba-4017-b44b-cc7e7b013e59');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Patricia es una gran docente, sabe mucho y en el campus sube bastante material para preparar el final, da 3 parcialitos teoricos que son optativos y no tienen recus, que de aprobarse, dicho tema ya no se rinde en el final.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Excelente, curso muy recomendado. Salís aprendiendo un montón, programando en OO con tps muy divertidos.  ', '9500d8cd-cef3-45a9-b5b6-9798ed1bc3a1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'fuente muy confiable ', '9500d8cd-cef3-45a9-b5b6-9798ed1bc3a1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El más compresivo a la hora de corregir ', '9500d8cd-cef3-45a9-b5b6-9798ed1bc3a1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Jorge siempre está con toda la onda, quizás si hay que marcarle algo es que puede llegar a tardarse un poco con las correcciones, pero en cuanto a enseñar es muy bueno.', '59ef4b1e-5069-4b74-b022-5b8119707d21');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica muy bien y le pone onda a las clases', '59ef4b1e-5069-4b74-b022-5b8119707d21');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Excelente docente. Dio un par de clases prácticas solo, se hizo desear durante el cuatrimestre, pero es un capo y sus kahoots son geniales. Tengo entendido que este fue su último cuatrimestre en esta materia (algoritmos 2), estoy seguro que lo van a extrañar. Es un docente que se hace entender muy fácilmente y explica todo con ejemplos de la vida para que entiendas cosas que capaz son medio abstractas. Lo recomiendo al 100%.', '59ef4b1e-5069-4b74-b022-5b8119707d21');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Eze es como un compañero de cursada, explica genial, muy pausado y perfecto para entender todo, aparte tiene su segmento post parcialito donde explica la resolucion de ejercicios y pregunta si fueron ejercicios con dificultad apropiada siempre dispuesto a recibir cualquier critica constructiva.', '56fa8ca4-2f57-4664-86bc-0be57ed001d7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica bastante bien los ejercicios, después de los parcialitos les da una pasada por encima explicando formas de resolverlos', '56fa8ca4-2f57-4664-86bc-0be57ed001d7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Eze es un docente impecable. Súper correcto y al mismo tiempo súper humano. Explica de forma clarísima y no tiene absolutamente ningún problema en explicarte todo las veces que necesites. Responde rapidísimo por Slack y se nota que es una persona muy comprometida y apasionada de lo que hace. Su aporte al curso hizo muchísimo la diferencia.', '56fa8ca4-2f57-4664-86bc-0be57ed001d7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Explica muy bien, la vi en clases de manejo de archivos y árboles, la verdad explica bastante bien y como correctora de parcialitos es bastante buena también !', 'e8ed5a8f-7ae6-4917-b472-810556e25d4f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Senti que es un tipo que realmente tiene ganas de que apruebes', '53c62d28-d2be-4e64-9674-0f9655e95e6c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Un profesor muy copado y alegre, nada le molesta ( creo que esas es una de sus virtudes) y no tiene problemas en responder dudas. Fomenta a que participen y que traigan comida para compartir.', '53c62d28-d2be-4e64-9674-0f9655e95e6c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es muy tranqui para explicar, se le entiende todo y esta bien predispuesto a consultas', '53c62d28-d2be-4e64-9674-0f9655e95e6c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Muy desorganizado y genera competencia. Pide cosas absurdas para aprobar la materia. ', '53c62d28-d2be-4e64-9674-0f9655e95e6c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy recomendado. Disponen de un grupo de telegram donde responden dudas bastante rápido!', '53c62d28-d2be-4e64-9674-0f9655e95e6c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Por ahí explica algo lento. El codeo en vivo durante la clase puede hacer que sea algo tediosa, pero la verdad es que Andy explica bien, te contesta todo (aunque no por slack, es medio colgado ahí). Me gusta que trata de motivar a los alumnos para que no abandonen.', '53c62d28-d2be-4e64-9674-0f9655e95e6c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Sus clases son muy buenas. Es muy paciente y responde las preguntas con claridad; si seguís sin entender, hace algún ejemplo para que lo entiendas. Es muy amable y hace varios chistes para ponerle onda al ambiente.', '53c62d28-d2be-4e64-9674-0f9655e95e6c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Andy es un genio. Sus clases teóricas se re entienden con las presentaciones y sus códigos de ejemplo. Si no llegas con alguna entrega de un trabajo práctico se habla tranquilamente. Es copado, te hace reír y sentir cómodo/a en la clases', '53c62d28-d2be-4e64-9674-0f9655e95e6c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un docente con un carácter duro, justo y cruel a la vez. ', '53c62d28-d2be-4e64-9674-0f9655e95e6c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La cátedra es bastante fácil. Andy quiere que apruebes, así que da muchas oportunidades. Es muy ameno en las clases, pero muchas cosas las tenés que estudiar por tu cuenta porque da todo medio por arriba y después te cuesta hacer los tps. ', '53c62d28-d2be-4e64-9674-0f9655e95e6c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Paciente a la hora de explicar, nunca se molesta', '53c62d28-d2be-4e64-9674-0f9655e95e6c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'es muy buena cátedra para aquellos autodidactas , para aquellos que dependen de las clases y explicaciones se les hace un poco complicado mas no imposible , muy flexible.', '53c62d28-d2be-4e64-9674-0f9655e95e6c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es paciente, te hace participar y que le expliques ciertas situaciones para ver si las entendés y sino te las explica; eso está muy bueno porque te ayuda a comprender realmente el tema y sus variantes posibles.', 'dd5b3179-d157-45b2-8297-2af631275fb9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Una persona muy sabia y con gran experiencia ', 'dd5b3179-d157-45b2-8297-2af631275fb9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'PROACTIVO, buenas clases, responde siempre dudas, buen guía para los tps', 'dd5b3179-d157-45b2-8297-2af631275fb9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy buen docente que se nota que sabe, sube a la pagian de la materia archivos de bibliografia muy claros y luego desarrolla con mayor claridad lo alli escrito', 'c16e87c3-b339-4846-9089-a14c5280e7c3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No está mas en esta materia.', 'c16e87c3-b339-4846-9089-a14c5280e7c3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Gran profesor, se nota mucho la pasión que siente por enseñar. Hace muy entretenidas las clases y responde cualquier pregunta que le hagas.', 'c16e87c3-b339-4846-9089-a14c5280e7c3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Solo dió una clase de Python. Digamos que está para ponerle nombre a la cátedra nada más. El que se encarga de todo es Lucas.', 'c16e87c3-b339-4846-9089-a14c5280e7c3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Es una persona que sabe mucho y transmite su conocimiento, lo unico malo a veces al explciar tanto se pas del tiempo y se arruina el cronograma de esa clase (nunca se pasa del tiempo igual) y siempre esta presente en el foro para contestar dudas  ', 'd742c428-23e5-4b29-b25e-178ff1a0708b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Sus clases sirven mucho para los tps y parciles, ademas que quedan grabadas las anteriores, genera mucho material para despejar dudas, ademas de que siempre se responden dudas por slack', 'd742c428-23e5-4b29-b25e-178ff1a0708b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un idolo, lo mejor de toda la catedra que ya de por si es muy buena, explica todo super claro, si tenes alguna duda vuelve atras.', 'd742c428-23e5-4b29-b25e-178ff1a0708b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Lucas es el único que da la materia. Las clases son geniales (están todas subidas a youtube en el canal algo2mendez), este cuatri fueron mayormente virtuales, y había una clase presencial antes de la entrega de cada tp para responder dudas. En cuanto a los tps, aunque eran muchos (5 en total), se podían hacer dedicándole un tiempo. Para responder dudas está siempre en el discord de la cátedra, y en este cuatri si llegabas a una cantidad de puntos podías rendir un final reducido con ejercicios solo de la segunda parte. Cátedra muy recomendabe en general', 'd742c428-23e5-4b29-b25e-178ff1a0708b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un capo mal, se pone al hombro la materia entera. Siempre respondiendo por discord y super copado en las clases. Las clases fueron virtuales salvo algunas prácticas presenciales antes de la entrega de los TPs. Son 2 TPs, 3 TDAs y un parcial. Podes ir a un final reducido si sumas una determinada cantidad de puntos a lo largo de la cursada (entre tps y el parcial) que son 3 ejercicios de los ultimos temas de la materia.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Sabe muchísimo, se le entiende todo perfectamente.', 'd742c428-23e5-4b29-b25e-178ff1a0708b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Un crack total, le mete muchísima dedicación a la materia y se encarga seguramente de todo. Sus clases son my buenas, la pasas bien y entendés. Responde TODO por el discord del curso y te ayuda con los tps si tenés algún problema. El mejor lejos!', 'd742c428-23e5-4b29-b25e-178ff1a0708b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Siempre está dispuesta a repasar si no se llega a comprender bien el tema o si hay consultas. Explica con claridad y cada tanto pregunta si vamos entendiendo para que preguntemos nuestras dudas.', 'a319b8e0-8cd1-4ddb-94b9-a88dfc0c5942');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Sus clases prácticas/teóricas estaban bien organizadas y muy completas. Los códigos de las clases los sube a github y las presentaciones a slack', 'a319b8e0-8cd1-4ddb-94b9-a88dfc0c5942');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Alma de docente, amable y justiciera ', 'a319b8e0-8cd1-4ddb-94b9-a88dfc0c5942');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Buenas clases, exigente al corregir,da muy buenos tips, aprendes un montón ', 'a319b8e0-8cd1-4ddb-94b9-a88dfc0c5942');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No da clase', '293fa156-9d19-4329-bb59-2a7385cb4b8a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Vino solo 2 veces a las clases', '293fa156-9d19-4329-bb59-2a7385cb4b8a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Solo esta presenta para los TPs.', '293fa156-9d19-4329-bb59-2a7385cb4b8a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No daba clases sino que solo corregia y explicaba los tps. Corrigiendo era bueno y las consultas sobre los tps las contestaba bien', '293fa156-9d19-4329-bb59-2a7385cb4b8a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Buena predisposición para dar las prácticas, y muy accesible en las correcciones de los parcialitos y del tp. ', '293fa156-9d19-4329-bb59-2a7385cb4b8a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica bien, con respecto a la correccion de los parcialitos depende mucho de quien te corrija, el tp ni lo revisaron hasta la ultima clase y NI LO MIRO, nos lo dieron por aprobado asi nomas. Muy pocas ganas de dar clases el y Sirotinsky, se acuerdan de la materia 5 min antes de la clase, y ahi avisan si va a ser virtual o presencial.', '293fa156-9d19-4329-bb59-2a7385cb4b8a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'le pone mucha mas onda que el otro profesor de la practica, ademas ayuda mucho que el mismo este codeando en clase mientras resuelven ejercicios de practica para el parcial ', '293fa156-9d19-4329-bb59-2a7385cb4b8a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Un profesor solido, no es el mejor del mundo pero explica bien y conciso. Tal vez es medio embolante la clase, pero siempre esta la opcion de verla despues en x1.5 y ahi se vuelve una clase excelente. Siempre tuvo un muy buen trato con todos y a pesar de que tarda en contestar, contesta a los mails.', '293fa156-9d19-4329-bb59-2a7385cb4b8a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Es buen docente, de las prácticas es que le puso más ganas al curso, nos dio siempre una mano con el tp, con respecto a los parciales: hay bastante material en el canal de YouTube, casi cuatris enteros de clases e incluso varios parciales resueltos, corrigiendo ambos son muy macanudos. Ahora lo malo: hay muy poca comunicacion fuera del horario de clases solo campus o mail los revisan muy poco, no hay rpl ni autocorrector, para el tp2 solo se usa hasta listas, nada de árboles ni grafos(igual destaco que tuvimos una clase práctica de cada uno de esos dos temas casi al final del curso, pero no es lo mismo entender el tema que llegar a implementarlo en un tp), y tampoco se exigieron usar criterios de costo en relación a la complejidad. La devolución de los tps fue bastante pobre. En resumen, la cursada dentro de todo es aprobable, muy probablemente mas que otros cursos, pero la practica tiene muchas falencias, van a salir con desventajas  para materias subsiguientes  con respecto a gente respecto a otros cursos mas solidos(Esto no es solo mio sino que ya me lo dijeron varios ex-alumnos de este curso), a la larga se superan pero planteense si es en realidad lo que les conviene o no hacer, una lastima, ya que Calvo es excelente.', '293fa156-9d19-4329-bb59-2a7385cb4b8a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Una vergüenza, siempre llega tarde o falta, no sabe ni de que tratan los tps o los explica mal. Los criterios de aprobación para los parcialitos dependen de como se levante o si te corrige el o Schmidt. Te avisan si la clase es presencial o virtual 10 minutos antes que arranque la clase.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'sabe de los temas pero pareceria que no le gusta dar clases', '2372e61c-7cba-49f5-bf4c-6bc42e488880');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Es una desgracia que Calvo(excelente profesora) tenga que compartir catedra con Sirotinsky. Es un profesor que se nota que no le importa dar clase. Durante las clases te sentís que te trata de boludo y además el 90% de las clases te manda a hacer un ejercicio larguísimo para hacer tiempo. Si le discutís algo de un ejercicio no hay chance de que ganes el argumento, siempre el va a tener la razón. A pesar de que en clase dice que responde consultas al mail, le mande 3 veces mail y en ninguna me contesto.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Bueno pero a veces se le notaba desganado o cansado. De las practicas pongo lo mismo que puse en la del otro docente de la practica: con respecto a los parciales: hay bastante material en el canal de YouTube, casi cuatris enteros de clases e incluso varios parciales resueltos, corrigiendo ambos son muy macanudos. Ahora lo malo: hay muy poca comunicacion fuera del horario de clases solo campus o mail los revisan muy poco, no hay rpl ni autocorrector, para el tp2 solo se usa hasta listas, nada de árboles ni grafos(igual destaco que tuvimos una clase práctica de cada uno de esos dos temas casi al final del curso, pero no es lo mismo entender el tema que llegar a implementarlo en un tp), y tampoco se exigieron usar criterios de costo en relación a la complejidad. La devolución de los tps fue bastante pobre. En resumen, la cursada dentro de todo es aprobable, muy probablemente mas que otros cursos, pero la practica tiene muchas falencias, van a salir con desventajas  para materias subsiguientes  con respecto a gente respecto a otros cursos mas solidos(Esto no es solo mio sino que ya me lo dijeron varios ex-alumnos de este curso), a la larga o media se superan poniendole empeno, pero planteense si es en realidad lo que les conviene o no hacer, una lastima, ya que Calvo es excelente.', '2372e61c-7cba-49f5-bf4c-6bc42e488880');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La materia es súper pesada. En este cuatri hubo un ejercicio obligatorio al principio y luego un trabajo práctico grupal de 4 personas. EL TP fue súper interesante pero es intenso. Recomiendo hacerla con otra materia liviana y sobre todo si trabajas.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La materia como tal está buenísima, en especial porque se aprende un montonazo (aunque justamente por esto la materia consume todo tu tiempo). En especifico en este curso se usa lenguaje Rust, que me parecio buenisimo, pero tiene su buena curva de aprendizaje asi que desde el comienzo hay que meterle bastante tiempo.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'EL cuatrimestre se divide en 2. Las primeras 6 semanas es teoria pura, y a partir de la semana 7 dan el enunciado el tp. El tp es largo, por eso te dan 2 meses para hacerlo. Todas las semanas tenes reunion con tu tutor para ver como van avanzando con el tp. Consejo: no se duerman, el tp lleva muchisimo tiempo (mas que nada investigar, no tanto codear). En la ultima clase hay que hacer una presentacion y una demo de como quedo el tp, y para el final hay que agregarle algunas funcionalidades y hacer la presentacion final del trabajo. Es una materia que no es dificil y que se aprende un monton pero lleva muchisimo tiempo.', 'df326813-fcd6-4c13-ad4c-f37ca96ee12e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La materia se divide en 2 partes. La primera parte de la materia dura 6 semanas y son clases teorico/practicas, donde te vas familiarizando con Rust (el lenguaje de programacion que se usa en la materia) y con algunos conceptos propios de la materia. La segunda parte consiste en un tp (muy largo) que dura el resto del cuatrimestre. Siguen habiendo clases, pero ya no duran 4 hs (2 hs como max), y todos los lunes tenes reunion con tu corrector para charlar como van avanzando con el tp. Nosotros estuvimos casi todo el cuatri atrasados con el tp, pero el ultimo mes le metimos y llegamos. El tp no es extredamente dificil, pero te lleva mucho tiempo investigar sobre como programar algunas cosas en Rust. Es mas tiempo de investigacion que de codeo. Por otro lado, personalmente no conocia el lenguaje Rust y la verdad que me encantó, es muy facil de entender y tiene un compilador que ayuda un monton. El final generalmente es agregar algunas funcionalidades el tp, bastante tranqui. Habiendo cursado tambien con Veiga, recomiendo esta catedra al 1000%, no porque sea facil sino porque los plazos para las entregas son razonables (lo que no sucede en la otra catedra). Destaco la buena onda y la buena predisposicion de los ayudantes que siempre intentan darte una mano.', 'df326813-fcd6-4c13-ad4c-f37ca96ee12e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La materia es básicamente un gran TP que dura casi todo el cuatrimestre. Hay unas clases al principio antes del TP y luego las clases se reemplazan por reuniones semanales con los correctores. El TP es de 4 personas, y es en Rust. No hay parcial y al final del cuatrimestre hay que hacer una presentación del trabajo. El final fue un agregado pequeño al TP para el cual también se pidió una presentación. ', 'df326813-fcd6-4c13-ad4c-f37ca96ee12e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Deymonnaz es el nuevo jefe de departamento de computacion o carrera de informatica, esta muy metido en las desiciones de la carrera en si, el tipo es tranqui, explica bien, en el catedra dan rust que es mejor, mas facil, y los tps son alcanzables comparados con veiga.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buen profesor.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Pablo no da todas las clases de la materia, ya que se van turnando con los otros docentes semana a semana. La materia en sí está muy buena y hay que programar bastante durante todo el cuatrimestre, asi que es esencial que tengan un buen grupo (4 integrantes este cuatri) para poder ir desarrollando el TP.', 'df326813-fcd6-4c13-ad4c-f37ca96ee12e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Crack total, de lo mejor que hay. Es increible lo mucho que sabe y lo simple que explica los conceptos. Es un lujo tenerlo de profesor.', 'f73236fc-bce0-49f6-9476-52f09903c5f9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El dipa es un crack. Muy buen profesor, explica con claridad. Siempre atento a las dudas puntuales y meticuloso con los detalles para que prestemos atención en los tps. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Di Paola es lo mejor que le pasó a esta materia, un genio total', 'f73236fc-bce0-49f6-9476-52f09903c5f9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Se nota que sabe muchísimo, pero el conocimiento que tiene no lo transmite como debería. Me corrigió el tp1 y me costó muchísimo contactarme con el. No me gusta para nada como explica y no me parece buen docente, ya que la funcion del docente es explicar (no solo debe tener conocimiento).', 'f73236fc-bce0-49f6-9476-52f09903c5f9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Un crack. Explica las cosas de manera super sencilla', 'f73236fc-bce0-49f6-9476-52f09903c5f9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Fede no dio tantas clases, pero nos corrigió el tp final. Muy buen profe, se notan que saben del tema', '09cedb89-cb82-4317-b783-5c7ccade58f3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy buena voluntad, quizás de lo mejor que tiene la cátedra. Le pone mucha dedicación y responde siempre con buena onda cuando se lo necesita.', '09cedb89-cb82-4317-b783-5c7ccade58f3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy claro a la hora de explicar, siempre predispuesto a contestar dudas. Lejos el mejor corrector!', '09cedb89-cb82-4317-b783-5c7ccade58f3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buena la cátedra, aprendés bien, muy exigente. Recomendable si querés aprender.', '79828cee-bcd7-4f15-a22f-2b196502eee1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Se nota que sabe mucho, dió unas cuantas clases explicando todo de manera basante clara. Es una catedra que consume muchísimo tiempo pero realmente lo vale, se aprende mucho.', '79828cee-bcd7-4f15-a22f-2b196502eee1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No apareció en todo el cuatrimestre, solo 2 clases', '79828cee-bcd7-4f15-a22f-2b196502eee1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Nos dio la nota de la 4ta fecha el mismo día que se rendía la 5ta, un desastre ', '79828cee-bcd7-4f15-a22f-2b196502eee1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'No dió ninguna clase', '79828cee-bcd7-4f15-a22f-2b196502eee1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Sabe muchísimo, pero da muy pocas clases, se borra. Sus clases son poco interactivas.', '79828cee-bcd7-4f15-a22f-2b196502eee1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'No da casi ninguna clase, las pocas que dan son muy aburridas', '79828cee-bcd7-4f15-a22f-2b196502eee1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Sabe y se hace notar cada vez que tiene oportunidad. Se autorreferencia demasiado. ', 'a57a863d-726f-4536-9e8d-6daad8118ff9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'D10s', 'a57a863d-726f-4536-9e8d-6daad8118ff9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es un crack Eze, en la virtualidad algunas clases que daba se hacían muy pesadas, pero al quedar grabadas las podías ver de nuevo y entender qué era lo que se estaba explicando.', 'a57a863d-726f-4536-9e8d-6daad8118ff9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica bien', 'a57a863d-726f-4536-9e8d-6daad8118ff9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Enseña bien su materia. El problema? Al evaluar se pone en un papel que te defenestra completamente lo que hayas hecho si no le gusto. La modalidad grupal no favorece para nada a la asignatura, grupos excesivamente grandes en los cuales la mitad terminan llevandose la materia de arriba y la otra mitad se tiene que comer las críticas de Piñeiro y replantearse completamente porque está siguiendo esta orientación. En adición las evaluaciones son en su mayoría grupales, lo que implica que uno por su propio mérito no define su nota, sino que depende del comportamiento de los demás miembros del grupo puesto que Piñeiro no deja que una persona exponga más de una evaluación grupal en el cuatrimestre.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'En mi opinion parece un ayudante mas. Da alguna que otra clase pero se vuelven aburridas, excesivamente pausadas. Su opinion en las evaluaciones no influyen tanto, actua mas como un intermediario que otra cosa.', 'b1c07fd7-6a76-4c53-9c97-98d912ccd02a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Solo dio una clase', '39cf2650-4735-403f-adf8-1f3dd68721a0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Super tranqui.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No hay que codear nada', '3d21e2f7-763a-45d6-b761-f07e5696dd88');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se encarga de dar las practicas. Muchas clases fueron presenciales, aunque las que pudo las hizo virtual (~40%) sin grabarlas. La practica consiste en 6 tps (un tp x tema). Una clase para explicar el tp, que generalmente consistia en aplicar cierto algoritmo sobre cierto set de datos y armar una presentacion, y otra clase para presentar la resolucion del tp. Los tps son grupales de a 2 y son super tranquis, en un dia lo haces sobrado. Es una materia tranqui para hacer de manija o si estas rascando creditos para recibirte je', 'a2da2bf6-7847-44e7-ae52-a8bde129cbc7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Practicas presenciales los jueves, hay tps para entregar cada semana, algunos duran 2 semanas, son tranqui. los dias que hay presentacion de tp las clases son virtuales. El tp es una ppt y hablar de algun algoritmo aplicado a un set de datos. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se encarga de dar la teorica. Este cuatri todas las teoricas fueron virtuales y toma presente. La materia es muuy tranqui, son 6 temas y toma dos parciales (evalua 3 temas en cada parcial). En los parciales toma literalmente lo mismo que explico en clase, y este cuatri no grabo las clases pero estaban las grabaciones del cuatri pasado subidas al campus (eran las mismas clases). Se dan temas relacionados con Machine Learning, como redes bayesianas, backpropagation y arboles. El final es hacer un tp realizando un analisis de datos y corriendo diferentes modelos de ML sobre un set de datos que lo podes elegir vos.', 'a622370e-2c9d-4912-9413-1c0419e402bf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Las teoricas los lunes son virtuales.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Bueno, voy a poner lo mismo tanto para Calonico como para Rojas. La materia es heavy y consiste en hacer una aplicacion de la puta madre desde cero. Cada cuatri cambia el tp, a nosotros nos toco hacer un spotify (con fornt mobile y web, back, bdd, etc). La materia en si esta super copada, pero el problema es que estas completamente solo. Las clases no sirven de mucho ya que se dan super tarde. Por ejemplo, la clase de JavaScript la dieron en el segundo mes de cursada, osea que si no sabias JS o estabas un mes sin poder avanzar con el tp, o investigabas y aprendias por tu cuenta (que es lo que terminamos haciendo todos). Por eso, como los temas te los explicaban despues de que uno ya los haya aprendido, no fui a una sola clase y aprendi todo con StackOverflow je. Por ende, lo mas heavy de la materia es el principio porque hay tanto para hacer que uno no saber por donde arrancar, y si no la tenes clara con algunas tecnologias (como Docker, Heroku, Git, etc) tampoco sabes como arrancar. Por suerte el tp es de a grupos de a 5, por lo que es clave conseguirse un buen grupo xq sino estas en el horno. ', 'ae8f339c-4b46-4947-97a8-8b4346ee4b52');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Fue mi corrector. Muy atento, nos acompañó toda la cursada.', '386606ad-b2bd-4180-970d-669a7bdd174c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Bueno, voy a poner lo mismo tanto para Calonico como para Rojas. La materia es heavy y consiste en hacer una aplicacion de la puta madre desde cero. Cada cuatri cambia el tp, a nosotros nos toco hacer un spotify (con fornt mobile y web, back, bdd, etc). La materia en si esta super copada, pero el problema es que estas completamente solo. Las clases no sirven de mucho ya que se dan super tarde. Por ejemplo, la clase de JavaScript la dieron en el segundo mes de cursada, osea que si no sabias JS o estabas un mes sin poder avanzar con el tp, o investigabas y aprendias por tu cuenta (que es lo que terminamos haciendo todos). Por eso, como los temas te los explicaban despues de que uno ya los haya aprendido, no fui a una sola clase y aprendi todo con StackOverflow je. Por ende, lo mas heavy de la materia es el principio porque hay tanto para hacer que uno no saber por donde arrancar, y si no la tenes clara con algunas tecnologias (como Docker, Heroku, Git, etc) tampoco sabes como arrancar. Por suerte el tp es de a grupos de a 5, por lo que es clave conseguirse un buen grupo xq sino estas en el horno. ', '386606ad-b2bd-4180-970d-669a7bdd174c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'No dió clases. Cada vez que se ponía a hablar la materia se extendía 1hs. La materia no tiene ni parcial ni final, es solo presentar un tp en grails(lenguaje de mierda) pero la cursada es obligatoria y súper aburrida', 'ed87a5c7-5955-446f-add0-b3065e299879');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Sus clases son super aburridas, no transmite interes en la materia', '348c2e12-8de4-4837-974b-866b4262e505');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Muy buena docente. Pone a tu disposición material extra para que te lleves. Y si faltaste a alguna clase por algún motivo te presta sus apuntes personales para que los copies', '601c21ca-65b9-4d77-a358-c2cca4caf343');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La materia es muy buena, los martes la practica es presencial y los jueves tenes las clases grabadas para la teorica, te dan el horario de 19-20 para ver las clases y de 20-22 usan un meet para repasar temas.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La materia es un 10/10, desde el lado del contenido y también del docente. El programa va desde un repaso de electrostática hasta corrosión y modelos de reactores. El profesor (Pablo Giunta) explica bárbaro todos los temas y dispone mucho material para su comprensión (diapos, clases grabadas, autoevaluaciones optativas, apuntes complementarios, etc.). Tiene mucha paciencia, resuelve todas las dudas y no tiene problema en explicar mil veces el mismo tema para que lo entiendas. La cursada se aprueba con un parcial (NO hay TPs) y generalmente hay un simulacro la semana anterior para que llegues preparado a la fecha de examen. Las clases son los martes a la mañana pero cualquier inconveniente se puede conversar con el profesor, que es muy comprensible y siempre abierto a buscar alternativas.', '302e8d5e-64e5-402b-a782-03afa115c60b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Es excelente, le dí 5 en todo porque es muy claro, siempre estaba dispuesto a responder dudas incluso fuera del horario de clase y se nota que quiere que todos entendamos y aprobemos.', '6043bb6f-c5e5-485b-a26a-786706abbc7c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'El que sostuvo la materia para mí. Excelente, no tengo más palabras que decir. Daba clases de consulta, se construyó un pizarrón para dar clases virtuales, se preocupaba por que entendiéramos y nos respondía todas las dudas que tuviéramos por mail. Uno de los mejores docentes y mejores personas con los que me crucé en FIUBA.', '6043bb6f-c5e5-485b-a26a-786706abbc7c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', '1000% recomendado, si te tocó con bruno, agradecele a los santos 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Bruno siempre estuvo predispuesto a resolver dudas. El cuatri que la cursé había puesto días "extra" en PC en el que podíamos acercarnos a hacerle consultas para el parcial, se re notaba que quería que entendiéramos y aprobáramos. Él y Lucho (no figura como opción) se notaba que eran los que más se preocupaban porque nos vaya bien. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Bruno es muy copado como ayudante y explica bien los problemas. Responde cualquier duda y si es necesario arma clases de consultas previo a los exámenes. Realmente se lo interesado en ayudar a los alumnos a aprobar la materia', '6043bb6f-c5e5-485b-a26a-786706abbc7c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Se va tremendamente por las ramas', 'ff514f4e-f2b4-49b6-b023-8b9a805961e2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Se ocupó de dar varios ejercicios por video e incluso un tema teórico. Se nota que tiene buena predisposición y sabe, pero se va muy por las ramas. Habla DEMASIADO rápido, al punto que tuve que enlentecer alguno de sus videos con la función de YouTube. ', 'ff514f4e-f2b4-49b6-b023-8b9a805961e2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Juan siempre trata de hacer las clases dinámicas pero a veces se va por las ramas y está una hora para hacer un ejercicio. Igual trata de que nos interesemos en la materia poniendo ejemplos de cosas reales y eso está bueno. Cuando le toca hacer el parcial a él, desaprueba la mayoría.', 'ff514f4e-f2b4-49b6-b023-8b9a805961e2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Sus clases son un intento de stand up de su vida como ingeniero, lo que a veces (muy pocas) las hace divertidas y otras (la gran mayoría) las hace tediosas y aburridas al irse por las ramas y no dedicarle tiempo suficiente a como resolver el problema.', 'ff514f4e-f2b4-49b6-b023-8b9a805961e2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'genio, muy buena onda y hace las clases nocturnas mas fluidas. quizá se va mucho por las ramas algunas veces', 'ff514f4e-f2b4-49b6-b023-8b9a805961e2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Es buena onda y siempre responde super bien a todas las dudas. Sus clases siguen al libro Smith casi al pie de la letra, conviene ir siguiendolas con eso. Varias veces tiene cosas que hacer asi que da vuelta los horarios o cosas así, a tener en cuenta.', '64a561b6-75db-48c8-bcbf-5403249422d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Beatriz está a cargo de la materia. Es una excelente profesional y una gran persona. Lamentablemente en sus clases (que se impartieron a través de videos de YouTube + un Zoom de acompañamiento) le cuesta expresarse. Los últimos temas de la materia fueron muy confusos, al punto en el que sentía que estaba copiando fórmulas en mi cuaderno sin comprender para qué servían o qué significaban (y cuando vimos el tema en la práctica, me di cuenta que no había mencionado otros conceptos que sí eran relevantes al tema). Se habrá demorado en los Zooms algunos minutos al entrar pero nada muy grave, honestamente. Respondió siempre todas las dudas, inclusive dudas sobre la "Homework", una mini guía teórica de ejercicios optativa que ella publicaba en el campus. Los ejercicios de la Homework estaban redactados de manera muy confusa y apuntaban a prácticar cosas cuya utilidad en el marco de la materia era muy discutible. ', '64a561b6-75db-48c8-bcbf-5403249422d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Para dar clase usa diapositivas que según ella no sirven para casi nada porque recomienda estudiar directamente de la bibliografía. Lo malo es que hay temas que los da muy rápido y no se llegan a entender completamente, y a la larga te termina perjudicando porque la materia es muy larga y pesada. Durante el cuatri no tuvimos todas las teóricas porque ella se fue mucho de viaje, pero igual alcanzamos con tiempo de sobra a ver los temas.', '64a561b6-75db-48c8-bcbf-5403249422d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'siempre viene con la mejor intención, pero solo lee ppts y no se entiende mucho la teórica de la materia.', '64a561b6-75db-48c8-bcbf-5403249422d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Sabe una banda y es re inteligente pero le cuesta transmitirlo. Al principio no se le entendía nada de nada pero despues pareció que le fue agarrando la mano y empezó a dar repasos teóricos antes de los ejercicios, que fueron muy útiles porque después tomaron cosas parecidas en el final, no se si seguirá haciendolos, espero que sí. En esta materia te asignan un corrector que te corrige todos los parcialitos y parciales, a mi me tocó él y fue medio paja porque era bastante exigente comparado con los demás (aunque a otros no les pareció así). Respondiendo consultas individualmente es lo más.', 'ad2f1c46-7863-40d6-9f0d-e14593ef762b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No fue el docente que me tocó en la práctica, pero sí vi varios videos de resolución de ejercicios hechos por él. Muy claro: se entendía todo lo que él planteaba, el ejercicio estaba bien estructurado; no tengo ninguna crítica a realizarle.', 'ad2f1c46-7863-40d6-9f0d-e14593ef762b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Agustín se nota que sabe bocha pero no logra trasmitirlo. Habla muy bajito y a veces da por sentado que nos acordamos muchas cosas (desarrollos matemáticos por ejemplo) cuando no es así. Cuando un ejercicio es muy teórico, él es el indicado para hacerle consultas, explica bien y sabe todo.', 'ad2f1c46-7863-40d6-9f0d-e14593ef762b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Agustín sabe un montón sobre la materia pero no puede transmitir con claridad los conocimientos a la hora de resolver los problemas. Se lo ve tímido a la hora de hablar frente a la clase por lo que ya no se lo escucha desde la mitad del aula. Respondiendo consultas mejora y se le entienden mas cosas a la hora de explicar.', 'ad2f1c46-7863-40d6-9f0d-e14593ef762b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Siempre trató de hacer las clases dinámicas y puso ejemplos de cosas que pasan en la vida real para que entendiéramos mejor el tema teórico.', 'c4af2718-16a6-4186-bb61-40625660e705');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No es muy puntual con el horario de la materia pero no genera grandes inconvenientes. Los temas los explica con total claridad y da tiempo a copiar todo lo que dicta y/o escribe. Responde cualquier consulta que surja sobre lo que esta dando y da ejemplos de la realidad sin irse por las ramas', 'c4af2718-16a6-4186-bb61-40625660e705');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Alma es el primer profesor que tengo de teórica que se queda en las clases prácticas. El forma un equipo con los de prácticas y eso es genial porque sus clases van de la mano con lo que hacemos en la práctica. Todo lo que explica se entiende y genera un ambiente super confortable en sus clases. Es un profesor muy humano.', 'c4af2718-16a6-4186-bb61-40625660e705');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Alma es un enano resentido que solo sabe lo que da en su materia. La promocione hace un par de cuatris pero el trato que tiene con algunos alumnos es chotisimo. Tiene suerte que de ayudantes estan profesores como Pato, Nacho o Damian que hacen todo bien.', 'c4af2718-16a6-4186-bb61-40625660e705');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Sin Diego la carrera se caería a pedazos. Es de los mejores profesores de la facultad y debe ser de las personas que mas sabe en toda la carrera. Te ayuda hasta cuando tenes cosas de otras materias. Sus clases son muy buenas.', '2be00f92-9a30-42ae-96b0-39b693c6afd6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Te re dormís mal pero también sabe un montón. Generalmente da para dormir pero cada tanto tira algún dato bueno.', '2e9ef69a-ab1a-4752-937f-a6a3c0f65d34');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'No cumple los horarios = se cansa rápido y a veces te larga dos horas antes. Aguante. ', '61af27ac-8071-45b2-a8be-528228e7d750');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buena profesora. Se nota que le gusta mucho y es muy organizada para dar sus clases. Envian sus powerpoints y asi tenemos las clases a mano y podemos prestar atencion. ', '232f4545-102d-485a-b9f0-c8e2116e7902');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Laura es genial. Da buenas clases de ejercicios. Se nota que quiere que el alumno quiera aprender. Los parciales son largos y hay que venir con una muy buena practica y hacer  muchos ejercicios. Son exigentes a la hora de corregir. ', 'c16332f8-fc48-4802-827e-8c1fa6a9f2f1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'JTP de la materia. El TP de la materia es largo y tedioso. Muchas entregas y se hace muy pesado la forma de entregas. Aunque uno aprende mucho, se hace todo muy pesado. Las correcciones no son de los mas claras que hay y el criterio es un poco dudoso. ', '55aa2e6e-685b-4848-bdd0-f77256f59705');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Sus clases son lecturas de apuntes, no acepta consultas, ni prepara a los estudiantes con desarrollo de ejercicios para el final. La materia gira alrededor de un TP extenso y complejo. En los ejercicios que toma en el final (destilación e integración energética) tienen que estar 100% correctos para aprobar la materia. La mayoría de los estudiantes rinde más de una vez el final. ', '55aa2e6e-685b-4848-bdd0-f77256f59705');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Una genia, muy buena persona y docente', '11a84c11-82b8-40ff-adf8-160bb8987bdb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Da toda la materia, tiene unos powerpoints bastantes completos y los sigue, ampliando donde puede dando ejemplos un poco mas practicos.', '26b0675a-6718-4741-9ecc-17cbe3675f34');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Un cra´ el Cai Aimar', 'f92e52b0-ee52-46da-ae92-ae598cbf85f6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'La clase duraba 3 horas pero él siempre la hacía de 1. Mejor, la materia es muy corta y no son necesarias tantas clases, se llegan a ver bien los temas.', 'f92e52b0-ee52-46da-ae92-ae598cbf85f6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Todas las semanas habia que hacer un tp en el campus o entregar en mano. No es una catedra tan tranquila, si bien los tps no demandan tanto tiempo de todas formas hay que hacerlos.', '92e663de-5e06-4797-979d-eed0f078cf78');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es excelente profesora y hace que la materia sea muy sencilla. Además de que casi siempre promociona a todos y con muy buena nota final.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Patricia le pone muchas ganas y siempre está predispuesta a consultas. La materia consistió en ir completando las unidades que se iban habilitando en el campus. Hubo un parcial en el que había que aplicar las técnicas vistas en un texto, no era difícil. No tiene coloquio, en su lugar hay que hacer una presentación final en castellano de un tema que a uno le guste. Para esta presentación hay que recopilar textos en inglés sobre ese tema.', '6f4b98ee-1447-4da8-a9ca-c3bae4ad274e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un profesor muy copado, materia tranqui si tenes una base de ingles. Casi una tarea o tp por semana, no muy complicados pero algo de tiempo hay q dedicarle. A lo largo de la cursada se practica bastante el habla lo cual esta bueno. No tiene final, solo un trabajo oral en grupo ', 'c7432ee5-38b6-4a09-a270-af957e9f91d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'Buen profesor para una materia robo. Recomendado saber ingles de antemano', 'c7432ee5-38b6-4a09-a270-af957e9f91d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Muy buen profe y buena persona. Un tipazo con todas las letras. Da tareas semanales sencillas que ayudan a que sea llevadera la materia. Fomenta el habla en clase lo cual es muy bueno. Tomo un examen y despues un algunos orales. No tiene final, toma un oral en grupo.', 'c7432ee5-38b6-4a09-a270-af957e9f91d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Fabián es de los mejores profesores que tuve en la facultad, enseña muy bien la materia y se enfonca en todo momento sobre mejorar tanto nuestra pronunciación como nuestra gramática, buscando que participemos en clase y preguntemos acerca de cualquier duda, un genio.', 'c7432ee5-38b6-4a09-a270-af957e9f91d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Fabián es de los mejores profesores que tuve en la facultad, enseña muy bien la materia y se enfonca en todo momento sobre mejorar tanto nuestra pronunciación como nuestra gramática, buscando que participemos en clase y preguntemos acerca de cualquier duda, un genio.', 'c7432ee5-38b6-4a09-a270-af957e9f91d2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Excelente docente. Muy amenas sus clases, duraban 2 horas. Medio exigente para corregir, pero es promocionable y si no llegas con la nota te hace hacer un tp adicional para que promociones con 7.', '85cc04ee-846e-4832-9ecd-b230d31836e0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'En esta catedra hay un parcial domiciliario y dos o tres tps, depende de si asististe a las clases o no, y un integrador. No son muy largos ni nada y con lo que explica el profe en clase estas perfecto. Los tps no tardas mas de dos horas en hacerlos. Ricardo es muy buen profe, explica bien y le pone onda a sus clases. Totalmente recomendado.', '85cc04ee-846e-4832-9ecd-b230d31836e0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy buena la cursada con Spizzo. Haciendo las tareas y siguiendo la cursada se aprende lo fundamental para interpretar textos. Algunos no entendíamos temas y ha tratado de explicarlo de varias formas distintas. ', '85cc04ee-846e-4832-9ecd-b230d31836e0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Clases de dos horas. Un parcial domiciliario y dos TPs sencillos con entregas flexibles + 1 TP extra para quienes necesiten nota. También tiene final. Suele dejar tarea que es opcional pero contribuye a la nota. ', '85cc04ee-846e-4832-9ecd-b230d31836e0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Un genio, las clases son super llevaderas y te enseña los temas de la forma más clara posible. La materia es fácil, solo te enseñan a comprender textos, los tps son fáciles y los exámenes también. Los textos están en inglés pero las clases se dan 90% en español. Recomiendo mucho a Spizzo, ya que a comparación con otros cursos es más sencilla de aprobar y sus clases muy buenas.', '85cc04ee-846e-4832-9ecd-b230d31836e0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Las clases consistieron en ir realizando ejercicios sobre los diferentes temas y después ir corrigiéndolos. Si ya tenes idea de italiano sale sin problemas (según el profesor se necesita un nivel de B1). Fue un parcial a mitad de la cursada y un parcial integrador en remplazo al final, similares a los ejercicios realizados. La cursada fue bastante tranqui', 'e844e051-76c4-4f1f-81f7-f38bcb6efa72');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'La materia que más me gustó hasta el momento.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'La materia que más me gustó hasta el momento.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Silvia una genia, mete miedo al pricipio porque es bastante estricta y exigente tanto en lo que son conocimientos como en las responsabilidades (preparar las clases, estudiar el material, etc). La materia es bastante pesada con muchos tps y parciales. Sin embargo no te busca matar en las correcciones y se nota que silvia sabe un montonazo y eso ayuda a entender mejor la materia.', 'b2d1ec31-dafd-4540-9918-a629a39bb5a1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es un excelente profesor. Pero en mi caso me resulto imposible seguirle el ritmo. Va demasiado rápido con los temas, cosa que me complico mucho para el parcial, ya que las guias de la materia son muy extensas.', 'ba051d53-c063-4bf4-a3ee-c36904668cb9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buenas clases. El cuaderno queda super completo y prolijo. Avanza muy (muy) rápido con la materia. Esto es bueno porque llega a dar todos los temas y al final queda una semana o mas de repaso. Intentar llevar la materia al dia requiere un esfuerzo muy grande pero es recomendable. Su parcial incluye algunos temas mas. (Viene bien para ya saberlos para el final). Hace varios ejemplos en clase, muchos de esos los toman en los examenes parcial y final. Las ultimas semanas del cuatrimestre termina la clase 30 o 45 min antes.', 'ba051d53-c063-4bf4-a3ee-c36904668cb9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'no pierdan el tiempo, busquen otra cátedra en la que el profesor busque sus alumnos aprueben.', 'ba051d53-c063-4bf4-a3ee-c36904668cb9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2015', 'Excelente profesor. De los mejores que hay en la FIUBA. Explica muy claro, luego de dar un teorema, hace observaciones del mismo y comienza a dar ejercicios, cosa que la carpeta termina siendo un libro de analisis 3. Suele ir un poco rápido, pero con leer la carpeta antes de ir a clase es suficiente para no perderse. El trato con los alumnos es bueno, pero él espera que los alumnos le presten atención en todo momento, cualquier indicio de que pase lo contrario (por ej, mandar un mensaje o charlar) va a resultar en un sermón y lo mejor es que va a tener razón.', 'ba051d53-c063-4bf4-a3ee-c36904668cb9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buen profesor, además hace las clases más pasarles contando chistes o anécdotas', 'b61e39a4-70ee-4702-91e1-3ebd69a2cf7a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es un excelente profesor, mientras te enseña te hace chistes y se hace la cursada mucho mas dinámica. Explica los teoremas por arriba, no le da mucha importancia a eso, a el lo que le importa es que se apliquen bien y se sepa para que se usan. ', 'b61e39a4-70ee-4702-91e1-3ebd69a2cf7a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Cachile es un bajón, arranca todo re buenito pero esto se torna super cansador luego de unas clases. Sus clases son más bien una perdida de tiempo, tiene las clases subidas a youtube y lo unico que hace es repasar lo que esta en youtube. Todo lo subido esta repleto de errores, asi que mirarlo con pinza. Se equivoca mucho, se va por las ramas, se pierde. Al momento de explicar se corrige mil veces. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy claro al explicar, además los últimos 10 o 20 minutos de la clase las usa para consultas que para quien las aprovecha son muy beneficiosas', 'a9b2ec26-8f1a-4b8f-9408-53eb1a554156');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy malas practicas, practicamente se pone a hacer ejercicios hablando para el lado del pizarron sin aportar nada interesante. Es como ver a un amigo/conocido hacer ejercicios en el living de su casa. 0 recomendada, no le hace justicia a la excelente teorica de A0', 'a9b2ec26-8f1a-4b8f-9408-53eb1a554156');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No me gusto la practica. Resuelve demasiados ejercicios inecesarios y como acero avanza rapidisimo la practica se queda muy atras. Es mejor hacer los ejercicios uno mismo y consultarlos en la practica. No hay que seguir el ritmo de la practica sino el de la teorica.', 'a9b2ec26-8f1a-4b8f-9408-53eb1a554156');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es muy lento y no se le entiende en varias ocasiones.', 'a9b2ec26-8f1a-4b8f-9408-53eb1a554156');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Para mi Calzon es bastante bueno, explica muy bien, pausado y repite todas las veces que tenga que explicar, tiene un entendimiento muy bueno de la materia y sabe cuales son las cosas que mas le complican al alumno.', 'a9b2ec26-8f1a-4b8f-9408-53eb1a554156');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Sus clases se basaban en él haciendo 5/6 ejercicios (por lo general difíciles) y casi que ni había interacción. De todos modos, servía ver la grabación para practicar ejercicios.', 'af86924a-5273-4f27-9384-128af025e26a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Explica bien pero va muy rapido, a veces cuesta seguirla, pero si la seguis, las cosas te quedan clarisimas y aprendes truquitos muy interesantes.', '1c5950a7-5a93-4a46-8e81-ed69dceba306');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Nelly la rompe, super canchera y buena onda, explica muy bien y resuelve muy bien las dudas.', '1c5950a7-5a93-4a46-8e81-ed69dceba306');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'De los mejores profesores de la UBA, se nota que sabe bastante , es un profe que sabe mantener a su curso despierto aprendes y te cagas de risa debes en cuando, no suele llegar a dar todos los tema a tiempo, pero siempre tiene en cuenta que temas dio bien y los que no llego a dar.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Completa en teoría, Prelat te hace un repaso de sus apuntes y es súper abierto a que le hagas dudas.', '551622bd-374d-4aad-ba42-e15d04271941');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Es otro genio de la facultad, explica con muy bastante claridad, se nota que le gusta la matemática, se le entiende a la perfección todo e incluso explica formas mejores y mas cortas de resolver algún tipo de problema( que esperabas? es electrónico). un genio!', 'a652d059-d96b-4fc2-bffa-eb09feb2a47d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Rosito es bastante lento en la práctica. Llegábamos a hacer 1 ejercicio en la 2hs generalmente. Está bueno si le proponen ejercicios para hacer al principio porque sino no tiene nada armado nunca. ', 'a652d059-d96b-4fc2-bffa-eb09feb2a47d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'El chico este es un crack, mucho mejr que calzon, pero lastimosamente iba solo 1 de los 2 dias de practica. Y ademas no resolvia muchos ejercicios. Pero es buena onda, no tiene drama en explicarte las cosas', 'dc2f4caf-e75d-49d9-9048-d7a7039f48a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy bueno aunque la practica en general es mala. Lo mejor es preguntarle a él las dudas cuando calzon da clases. Escribe desprolijo y va un poco rapido pero se entiende bien.', 'dc2f4caf-e75d-49d9-9048-d7a7039f48a5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Leyenda ', '7e642435-2bbe-4d5d-8439-f32e78c95788');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No tiene amor por la materia', '2507ff84-9458-4fc0-a42a-9eba5fa1f60f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es muy buena onda , sabe explicar los temas y se queda hasta que entiendas tu duda , no como calzon.', '465b17c2-88f9-4bda-a9e5-2951ae73a284');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Perri es lo mejor que me pasó a Física 3 para industriales. Las mejores clases de física. Súper claro. Se re presta a consultas. Te manda resúmenes por email. El parcial es normal. Haciendo las guías aprobas. Te enseña mucho la aplicación del asignatura con el ambiente industrial. Sabe todo. Te cagas de risa y aprendes mucho. Gran persona y docente. ', '83d847f0-797d-47d5-9f2e-38fb8aa10e3c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'un desastre de profesor, se ponia a hablar de la vida, y te decía que leas los ppt que ahi estaba todo explicado, al final dejamos de ir a las clases porque no valia la pena', 'efb6f23b-f25d-4537-9563-ef89d3eeda33');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Me inscribi en este curso pensando que era de Maioco, tal como decia el SIU. Llego y estaba Caracciolo. Es un buen tipo, quiere mejorar y le importa la materia y sus alumnos. Simplemente no estaba del todo capacitado para dar la materia al nivel que hacia falta cuando yo la curse. Ahora puede que ya haya mejorado sus clases teoricas.', 'efb6f23b-f25d-4537-9563-ef89d3eeda33');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'arrancaba diez minutos antes y no te daba tiempo para almorzar, iba a los piques,hablaba bajo, y no hacia fuerza en el pizarron para que se viera la tiza, osea, no entendías nada', 'f05be373-e697-4546-8df6-4baeec26094c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'No se nunca la vi ni aparecio :) ', 'f29c96c0-61d9-4000-8957-4600b1620eb1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La materia la dio ella sola, daba las clases, corregia parciales, tareas y mails y escribia en pantalla con mouse, una genia! La verdad yo senti que sabe un monton y trata de que entiendas todo por mas "tonta "sientas que sea tu pregunta, jamas te va a faltar el respeto, es muyyyyy buena. Te deja muy bien preparado para el parcial aunque sus pdf no tengan toda la info, hay q copiar meintras habla. Se graban las clases y despues las suben a un drive (excepto las practicas, que te recomiendo grabarlas x tu cuenta) Es re puntual con el horario y SIEMPRE se ofrece a dar clase de consultas antes del parcial y ahi le podes preguntar todo. La super recomiendo, porque explica muy bien, lo unico no le pierdas el hilo a la materia xq demanda tiempo', 'e01a49cf-15cb-4c3a-bf24-67a3532474e9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Se nota que sabe mucho de la materia, pero explica muy mal, los materiales que traia a la clase eran muy aburridos, y muchas veces si le preguntabas cosas sonsas te despreciaba. En los examenes solia poner nervioso a los alumnos acusandonos que nos copiabamos (paro dos  tres examenes por ello). De todas formas, si le mandabas mails, no paraba hasta que entendieres el tema, mismo daba clases a parte si necesitabas.', 'e01a49cf-15cb-4c3a-bf24-67a3532474e9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Excelente profesor, contestando dudas en todo momento y buscando la forma para que lo entiendas. ', '6c29e06f-0c0e-4bb9-8177-11241336ba14');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Verdadero tipazo. Sus clases son muy buenas y amenas, busca hacerte aprender pero no te deja colgado con ningun tema que da, ademas de que sus practicas te dejan muy claro como proceder con cada tipo de ejercicio. Suele ser bastante justo con las correcciones y te tira centros si te ve trabado. Lo mejor de la catedra, lejos', '6c29e06f-0c0e-4bb9-8177-11241336ba14');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Brian es el mejor de todos, hace ejercicios y no hay ni uno que no se le entienda. El verdadero tipazo. Te responde las mil dudas.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'los mejores power points que vas a ver en tu vida y literalmente el mejor de esta catedra, hasta subia las resoluciones de los parciales, un crack', '6c29e06f-0c0e-4bb9-8177-11241336ba14');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Braian es un divino. Tiene más paciencia que todo el resto de los profesores de fiuba juntos. Puede explicar lo mismo treinta veces. Eso hace que las clases se hagan medio largas a veces pero es amoroso.', '6c29e06f-0c0e-4bb9-8177-11241336ba14');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Braian es un capo, recomiendo esta comision', '6c29e06f-0c0e-4bb9-8177-11241336ba14');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Va lento y se re entienden sus ejercicios, siempre esta dispuesto a volver atras cuando no se entendio algo. ', '6c29e06f-0c0e-4bb9-8177-11241336ba14');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'no aparecio nunca de manera virtual, solo en las clases de consultas previas al parcial que siempre decian " el parcial es facil, estudien". despues la conocimos en el laboratorio y parecia muy copada y que sabia mucho ', '0cb69b6c-914e-4596-8ad1-ea8ed55daf32');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'la conoci en el lab con gisela orone y parecia buena y respondia dudas, pero durante la cursada no aparecio nunca. Lo mejor es Silvia ♥ la amamos', 'f1c2ebc5-2921-4f29-a3a4-6e2a5aa43657');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Responde ante cualquier consulta, muy rápido. Tiene mucha predisposición. Excelente.', 'e12c60e8-2c58-4493-971b-7deebd32843c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Para hacer ejercicios en la practica suele ser muy dificil seguirle el hilo ya que saltea muchas cosas buscando hacer todo mas rapido. Pero cuando explica temas de Organica (post parcial) lo hace bastante bien, en especial la clase de petroleo. Es un poco dura corrigiendo', 'e12c60e8-2c58-4493-971b-7deebd32843c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Creia que sabiamos hacer todo y se salteaba muchas cosas, pero bien predispuesta ante dudas.', 'e12c60e8-2c58-4493-971b-7deebd32843c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'La dupla de JTP's de este curso (Torcasso y Merlo) es BRILLANTE. Muy claros para explicar los ejercicios y muy buena onda para responder consultas de todo tipo. Esta cátedra es un 10 por donde se la mire.', 'e12c60e8-2c58-4493-971b-7deebd32843c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'un par de veces se calento porque no sabiamos algo y nos reto medio de mala manera, despues con algunos compañeros la verdad nos parecio demasiado exigente corrigiendo los parciales siendo que a algunos nos bajo puntos por no hacer una distributiva (?). sacando todo eso, explicaba bien los ejercicios y sus clases se entendian', 'e12c60e8-2c58-4493-971b-7deebd32843c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Barbie es una genia. Me re inspira como habla de la ingeniería, te hace sentir re importante jaja. Explica re bien y es muy práctica, no da vueltas con boludeces.', 'e12c60e8-2c58-4493-971b-7deebd32843c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica bien', 'e12c60e8-2c58-4493-971b-7deebd32843c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'a veces va medio rapido y da cosas por sentado pero explica bien, se entiende cuando da ejercicios', 'e12c60e8-2c58-4493-971b-7deebd32843c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Insulta. Maltrata. Hasta nos rompió a varios las hojas del cuaderno porque teniamos ejercicios mal hechos. Nunca vi semejante locura. Nos fue mal en el parcial y nos dijo "son muy burros, asi no llegan a ningún lado". Una compañera lloró y dejó la materia. La realidad es que se anotan 50 en el curso y al parcial llegamos unos 15 aprox. Y después dejan casi todos de esos 15. Toman falta y supuestamente "no hace falta ir". Mentira total, porque a un compañero lo dejaron libre por no ir al 75%. Vargas es el único problema del curso y es la que corrige TPs, la que da la clase práctica, y con la que revisas el examen. Natan es el ayudante y es excelente pero vargas no lo deja dar clases. Natan siempre pregunta si puede dar algun ejercicio y vargas le dice "vos quedate sentadito". Nunca dije esto, pero es real:  es preferible cursar en otro cuatrimestre y otro curso antes q en este.', 'c5856f35-bf0b-42b1-9214-bffd3c2c2366');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Vargas me pareció un desastre en la cursada virtual. Respecto al horario a veces ponía el link a la clase 15 o 20 minutos después, o a veces empezaba antes o en punto, pero siempre entrabas enseguida y ella ya empezaba a explicar y se mostraba molesta porque seguía entrando gente (en lugar de esperar a que terminen de entrar). Varias veces terminó la clase más tarde, incluso una vez llegó a pasarse como 30 o 40 minutos de la hora de clase (igualmente una vez que toman asistencia muchos dejan la clase si está explicando ella, empezarán 27 la clase y terminarán 7 u 8). No se le pueden hacer consultas porque maneja MUY mal la tecnología, si está haciendo una presentación no puede ver el chat, así que las consultas son por micrófono, aún así hubo veces que no escuchaba el audio tampoco porque no le funcionaba o vaya uno a saber. Igualmente si lográs hacerle llegar una consulta en la clase, es probable que no te termine entendiendo, termine explicando lo que entendió ella, o que lo que explique no se entienda o hasta que esté mal (yo después de hacerle un par de consultas, dejé de consultarle y le consultaba más a Natan). Algunas veces ha levantado la voz y pareciera gritar. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Personalmente cuando explicaba Mónica me solía perder y no entender los temas. Pero no tenia problemas en responder dudas también esta a cargo de corregir los parcialitos y no suele ser muy exigente pero tampoco regala.', 'c5856f35-bf0b-42b1-9214-bffd3c2c2366');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un desastre, en clase se equivoca mucho, dice cosas que después cuando uno las vuelve a ver se da cuenta de que estaba mal resuelto en clase.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Todos la bardean pero la verdad me pareció una gran profesora,  al principio no entendi nada pero cuando empecé a hacer las cosas ya consultar tuvo la mejor predisposición y la terminé re aprobando a la materia', 'c5856f35-bf0b-42b1-9214-bffd3c2c2366');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es aburrida y a veces cuesta seguirle, ademas que tiene un trato medio aspero (aunque creo que no lo hace de mala gente, le sale asi). Mas alla de eso, da todos los temas y no tiene problema en responder consultas o quedarse mas tiempo para asegurarse que se haya explicado o entendido todo. Ver las grabaciones en x2 es la clave', 'c5856f35-bf0b-42b1-9214-bffd3c2c2366');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'DE SAS TRE. Se hacia la que no escuchaba a los alumnos que preguntaban cosas para no contestarles. Te ignoraba. Muy lenta explicando. Super aburrida. En los parciales extremadamente molesta, no te dejaba ni concentrarte. En varios parciales nos hizo arrancar 10 mins mas tarde y no nos agrego tiempo despues, no le importa nada. Preferible no anotarse en la materia si solo te queda con ella. Ahorren su tiempo, vayan a otro curso', 'c5856f35-bf0b-42b1-9214-bffd3c2c2366');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'sus clases son monólogos, imposible seguirla. poco dinamicas y no es muy empática con algún problema que le pueda surgir a los estudiantes.', 'c5856f35-bf0b-42b1-9214-bffd3c2c2366');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Vera es una genia, explica muy bien los temas y de manera puntual, te ayuda a estudiar y te explica la forma en que se evalua cada tema. Responde todas las dudas casi inmediatamente. Es super aplicada y ama lo que hace.', '146b80a9-104c-4dc6-971e-5fa82f5a22b7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Es excelente, siempre esta dispuesta a contestar dudas y quiere que aprendas', '146b80a9-104c-4dc6-971e-5fa82f5a22b7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se nota que tiene un conocimiento de la materia MUY amplio, y sus clases son bastante amenas. El unico problema es la distribucion de los tiempos que le da a cada tema, ya que se pierde mucho tiempo con los primeros temas como termodinamica y termoquimica, dejando poco para los ultimos mas cercanos al parcial. Pero sus clases siguen siendo de buena calidad. Suele pasarse de hora pero nunca mas de 10/15 mins', '146b80a9-104c-4dc6-971e-5fa82f5a22b7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Claudia es lo más! un poco lento el principio de la materia porque es lo que se vio en la química anterior. Si te quedas despues de clase te responde TODAS las dudas que tengas. Mucha paciencia y buena onda.', '146b80a9-104c-4dc6-971e-5fa82f5a22b7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es buena profesora. Aunque sus clases son un poco monotonas explica detenidamente todos los temas y te enseña como resolver todos los ejercicios que te pueden llegar a tomar. En mi opinion te hace aprender mucho de memoria, y al ser tantos temas se vuelve dificil, pero en general sus clases son muy buenas. Recomiendo su catedra.', '146b80a9-104c-4dc6-971e-5fa82f5a22b7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Metete en este curso si o si. No te vas a arrepentir. Vera es muy organizada dando sus teóricas y muy buena persona. Llega muy bien a dar todos los temas y quedan muy claros siempre. Vas a llegar muy bien preparado al parcial y al final.', '146b80a9-104c-4dc6-971e-5fa82f5a22b7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'explica muy bien pero personalmente me pareció que iba muuuuy lento. el 60% de la materia para mi fue una revision de la quimica anterior solo que agregandole algunas cosas mas especificas, por lo que eso sumado a la lentitud al explicar hicieron que me aburriera demasiado durante la mayoria de las clases', '146b80a9-104c-4dc6-971e-5fa82f5a22b7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy buena, explica muy claro', '146b80a9-104c-4dc6-971e-5fa82f5a22b7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica muy bien, quiere que entiendas a fondo y lo logra', '146b80a9-104c-4dc6-971e-5fa82f5a22b7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Literalmente no hace nada, aparecía una hora tarde a hacer sus cosas en el aula y todo el tiempo nos decía que para la semana siguiente iba a tener los trabajos corregidos. Nunca apareció un solo trabajo.', 'cab9c447-a96e-40f1-9234-5fbcafce35f6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No está casi nunca, en un tp apareció y dijo algunos comentarios desafortunados', '72e777a3-ba05-465b-9204-f51e66179b32');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Te responde todo lo que le preguntes, absolutamente todo. Al igual que Perez Taboada, te responde en persona, en el campus tarda bastante la respuesta.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Por el campus en el sector de consultas no esponde. Pero si en clases preguntas, te responden re bien. Es muy copado.', '72e777a3-ba05-465b-9204-f51e66179b32');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Es copado, aunque le gusta hablar tal vez un poco de más. Sin embargo le podés hacer cualquier pregunta y es un profe acorde a una materia muy relajada que te introduce suavemente a la carrera.', '72e777a3-ba05-465b-9204-f51e66179b32');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se pone re contenta cada vez que alguien participa en clases haciendo preguntas a los docentes invitados, asi que hagan las preguntas que quieran sin miedo. En persona te responde todo, por el campus lo más probable es que no te responda nada y si lo hace es a las dos semanas.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Por el campus en el sector de consultas no esponde pero no tiene problema en que le escribas por mensaje de campus. Pero si en clases preguntas, te responden re bien. Es copada y organizada.', '46addefe-152e-4a93-8c3e-c865d8f868cc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'No hay forma de borrarle la sonrisa de la cara, nunca vi una profe igual. Le encanta que preguntes y aportes. Siempre con la mejor de las ondas. Incluso podés hacerle preguntas sobre la carrera en sí y ella te va a contestar o incluso va a hablar con sus ayudantes y te va a dar una respuesta satisfactoria.', '46addefe-152e-4a93-8c3e-c865d8f868cc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Uno de los mejores profesores de la carrera hasta ahora', '7048599d-b4c9-481d-81f8-af511182a3cf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Mario un genio se va un toque por las ramas pero esta abierto siempre dudas y consultas ', '7048599d-b4c9-481d-81f8-af511182a3cf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2014', 'Buen docente', '7048599d-b4c9-481d-81f8-af511182a3cf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy ordenado, prolijo, claro y acepta consultas en cualquier momento. Previo al parcial dio una clase de repaso/consulta que viene bien para sacarse todas las dudas. Previo al final no se llega a hacer una clase de consulta porque no dan los tiempos del contenido, pero si le mandas por mail lo que desarrollaste, responde con bastante detalle.', '29891fc7-8430-4fbf-aae6-d3517b735400');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Otro de los mejores profesores junto a Alonso', '53b4ae5b-3447-4479-9811-0c2b371f00ee');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Excelente ! Buen profesor y persona ', '53b4ae5b-3447-4479-9811-0c2b371f00ee');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2014', 'Crack.', '53b4ae5b-3447-4479-9811-0c2b371f00ee');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Manda al frente a los recursantes, las clases las desarrolla en el momento y tenes que estar descifrando su letra, cuando se equivoca (que le paso varias veces), se pierde mucho tiempo corrigiendo/eliminando lo escrito. En general es muy desordenado e improlijo. Nunca un Power point, muy difícil seguirla. Los TPs son de dificultad media pero largos, su criterio es de exposición y participación, por lo cual mas de una vez no tenes una corrección o aclaración especifica si lo encaraste de otra forma. Los parciales son eternos y recibís la nota con mucha demora, el criterio de corrección... cuestionable. A veces desvaría, se va muy lejos con el contenido o se pone a charlar con el ayudante, el tiempo que se pierde, no lo contempla y la clase puede terminar media hora después de lo pautado. ', 'ffef08c1-9137-4c0b-b522-5cd1a9dd812e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy floja tal cual los otros comentarios, al rendir el final los de la mañana llegan mucho mejor preparados. ', 'ffef08c1-9137-4c0b-b522-5cd1a9dd812e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2014', 'Medio colgada.', 'ffef08c1-9137-4c0b-b522-5cd1a9dd812e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Complica innecesariamente temas y termina por las ramas. ', 'ffef08c1-9137-4c0b-b522-5cd1a9dd812e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Un grande, explica muy bien, las clases son muy dinamicas y participan todos. Hace tiempo para repasar los conceptos al principio y no se hacen nada pesadas las clases', 'ef5b48e2-48c0-48d6-8890-14cdaa5cf897');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy organizado y le gusta mantener un trato con los alumnos de manera muy amigable y muy abierto a que todos participen', 'ef5b48e2-48c0-48d6-8890-14cdaa5cf897');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Tipazo. La verdad super amable, re buena onda, te explica las veces que necesites, le da la vuelta que se necesite para hacerte entender. De la practica con el y los dos ayudantes es un 10. Encima eramos pocos entonces te daban mas bola. La verdad re recomiendo ', '74b5497c-8d73-4d48-bb47-b7034209c5ba');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'El ultimo recuperatorio lo hace imposible. Explica bien y hace kahoots (que no impactan a la nota) antes de clase para ir llevando la materia', '74b5497c-8d73-4d48-bb47-b7034209c5ba');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Castagnino: un ladri es lo que mejor lo define. Suele ir con cartas al curso para jugar al truco. Le gusta hablar de fútbol. Llega re tarde a clase. La clase supuestamente es a las 19hs y el cae mínimo 19:30hs. Por lo general llega tipo 8pm. Hace rápido un mini ejercicio corto súper fácil. Y después se sienta a hablar de fútbol y jugar un truquito. La semana antes del parcial dibuja en el pizarrón algo re jodido y te explica como se resuelve. Vos copias sin entender nada. A la otra semana.... Te toma ese mismo. Vos te memorizas y lo pones igual. Pero por lo general suele quedarse hablando de fútbol con algun otro y ni mira si los alumnos se copian.a mayoría abre la carpeta y copia lo que hizo él. Aprueban casi todos. Muchos no sabe  que es asi la movida entonces ni copian el ejercicio. Pero el último dia de clases te toma otro distinto y te dicta como se resuelve y te pone un 4. Para el final quedas totalmente desnudo. No entendes nada de la materia. Tenes que estudiarla de 0 para dar el final que lo toman otros docentes. Castagnino es copado, súper gracioso y re canchero. Pero no aprendes nada. Se puede recontra robar la cursada. Los tps los haces copiandote de otro. Ni los miran y te los firman el último día. Podés faltar las veces que quieras. Después vas y le lloras y te pone los presentes. Incluso podes cursarla sin las correlativas y te guarda la nota. Es re permisivo.', 'c81c3aff-f298-4624-b245-314e212182ed');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Un tipaso mal. Un broder. Quiere que aprubes. Super relajado, y buen profesor', 'c81c3aff-f298-4624-b245-314e212182ed');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Gabriel es el ayudante de corral y Pujol, muy buena onda. Te saca TODAS las dudas, es el que corrige los parcialitos el mismo dia que te los toman y tambien corrige algunos tps de la práctica muy bien. ', '0b2a04ea-dfd6-4b4c-81be-7de7b6a82dfb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Un verdadero TIPAZO. Contesta mails al toque y a cualquier hora que le mandes, en los parciales/parcialitos es re permisivo y te tira muchas ayudas si las necesitas. Sabe un monton de la materia y siempre trata de ayudar. ', '0b2a04ea-dfd6-4b4c-81be-7de7b6a82dfb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Gran profesor, tiene mucha paciencia y no tiene drama en parar la clase para explicar cualquier cosa que no se haya entendido. Los powerpoints que usa en las teóricas son muy completos y tienen mucos ejemplo prácticos también. Es muy buena onda y se nota que tiene ganas de que aprendas y entiendas los conceptos. IMPORTANTE: en el 1C nos tomaba parcialitos en cada clase (a partir de cuando se arranco a ver resistencia de materiales) que si llegabas a cierta nota NO rendías el segundo parcial. No se si lo mantendrá igual.', '19b4feed-54ae-4d57-9abd-6a18851d4404');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy dedicado. Todas las semanas toma parcialitos y si llegas al 70% de puntos en total no rendís una parte del primer parcial y nada del segundo, con ese incentivo hace que todos lleven al día la materia y no se haga pesada. Recomiendo mucho su curso', '19b4feed-54ae-4d57-9abd-6a18851d4404');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Corral es muy buena onda, las clases las da con un power de sus teoricas. Conviene llevarlas impresas y la clase es fácil seguirla teniendo la impresión, responde bien las dudas que tengas. Todos los miercoles toma un parcialito de lo que se vió en la clase anterior, lo unico que trae son beneficios y son para el primer parcial si sacas un 75% bien del total de los parcialitos no rendis parte teórica, y para la segunda parte de la materia que es la más dificil, si sacas un 75% bien directamente no rendis segundo parcial.  Si te va mal en los parcialitos no pasa nada, pero esta bueno porque te ayuda a estar en tema durante la cursada.', '19b4feed-54ae-4d57-9abd-6a18851d4404');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Corral es un gran profesor, se entienden todos los temas muy bien y la clase se hace muy llevadera. La cursada no es pesada, pero tiene parcialitos todas las semanas que hacen que tengas que estar  al día con la materia. Eso si, te permiten promocionar la teoria del primer parcial y todo el segundo parcial, asi que vale la pena.', '19b4feed-54ae-4d57-9abd-6a18851d4404');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'sabe muchisimo, sus pdfs son excelentes para estudiar la parte teorica y hace clases de consulta antes de los finales que vienen fantastico. Tiene una guia de ejercicios muy buena para estudiar para parciales y finales, y toma parcialitos que hacen la parte teorica del parcial promocionable', '19b4feed-54ae-4d57-9abd-6a18851d4404');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Excelente docente. Toma parcialitos todas las clases sobre lo explicado en la teorica anterior (si minimamente lo leiste aprobas) y si sumas determinado puntaje no tenes que rendir la parte teorica del parcial.', '19b4feed-54ae-4d57-9abd-6a18851d4404');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy bueanas clases, se preocupa porque se entienda todo. Va haciendo un seguimiento del nivel del curso con parcialitos todas las semanas que permiten promocionar parte de la cursada', '19b4feed-54ae-4d57-9abd-6a18851d4404');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'El MEJOR profesor de esta facultad. El tipo da sus teoricas con un ppt que vos podes tener impreso en cuadernillo de antemano y es re llevadero y claro. Le encanta lo que hace, no tiene problema en repetirte 7 veces si no entendiste algo
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy buen profesor, muy didáctico y no tiene problema en que le preguntes mil cosas. Por ahi es medio áspero cuando hace preguntas y decis alguna burrada pero ayuda a que no cometas los "errores generales" que suelen ver. Cuando cursé estaban Iñaki Hargain (que se nota que sabe mucho y siempre te lleva los conceptos a la realidad) y Camila Beljansky, que al principio parece medio mala onda pero despues la tuve como correctora de TPs y además de terminar siendo re copada, nos respodía TODAS las dudas que le mandabamos (que a medida que se juntan los TPs y parciales es fundamental). No se si seguirán estando...', '6d9951a4-7e85-4739-a6a0-cc3d8f5a27fc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buenas clases, muy llevaderas y terminas haciendo casi todo el tp con ellos en clase. Los tps son los mismos que los de Putajol, y no pasa nada si te atrasas con la entrega.', '6d9951a4-7e85-4739-a6a0-cc3d8f5a27fc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Se jacta de que el tiempo asignado a la materia no es suficiente y que por ello le agrega una hora mas a sus teóricas (4h en total). Tiempo que termina siendo innecesario debido a que se va por las ramas al hablar de cosas que van mas allá de la materia o que no nos incumben en lo absoluto. Si fuera al grano y dejara de dar vueltas llegaría sobradisimo con 3h. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Un desastre. No puede dar clase este muchacho', 'cd0c03a8-4db1-4ddf-aebb-86fd76152554');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buenas clases, muy llevaderas y terminas haciendo casi todo el tp con ellos en clase. Los tps son los mismos que los de Putajol, y no pasa nada si te atrasas con la entrega.', '224fcc63-2146-4a36-9346-fdef50557b68');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'explica muy, muy claramente algunos temas que tal vez en la teoria parecen complicados', '224fcc63-2146-4a36-9346-fdef50557b68');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Antes de empezar con la clase te hace un repaso de la clase anterior. Organiza sus clases, prepara PPoint buenardos para cada clase . Es clara, no se va por las ramas y cualquier duda que tengas en clase te responde. Tiene humor, hace muy participativa la clase. Muy recomendable.', 'b27ac9a0-98d9-4e03-805c-e7ec5f21ccbe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Literalmente de los mejores profesores que tuve hasta ahora. Explica barbaro, 10/10, te da ganas de estar en su clase. Le podes hacer mil preguntas y te responde con la mejor hasta que entiendas. Posta otro nivel ', '3b718c8c-d38a-413f-9c86-d86d49acb66f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es un tipo sumamente organizado y prolijo de punta a punta, desde cómo arma las clases hasta cómo ordena lo que va copiando en el pizarrón. El contenido a veces puede exceder a lo que se termina usando en la práctica, pero te deja más que preparado conceptualmente para el final sin llegar a ser demasiado denso. No tiene problema en repetir algo que ya dijo, siempre busca que entiendas qué es lo que estás calculando. Compró una goma espuma con forma de viga para que pudieras ver qué es lo que está haciendo mientras lo explica. Es clarísimo y tiene muy buen trato con los alumnos. Simplemente un fenómeno, de lo mejor que he cruzado en la facultad.', '3b718c8c-d38a-413f-9c86-d86d49acb66f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Lo amo, es un crack. Se re entiende lo que explica y si preguntas responde con muy buena onda.', '3b718c8c-d38a-413f-9c86-d86d49acb66f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Gran docente. Explica muy bien y claro. Se nota que le interesa que aprendas.', '3b718c8c-d38a-413f-9c86-d86d49acb66f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un capo. Siempre predispuesto y explica muy claro, te contesta las dudas que tengas y si te gusta la te hace quererla más.', '3b718c8c-d38a-413f-9c86-d86d49acb66f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No le entendí mucho.', '3b718c8c-d38a-413f-9c86-d86d49acb66f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Clases re organizadas y completas. Es super amable y puntual, tanto para empezar la clase como para terminarla, pero si es necesario se queda una hora después de clases sacando dudas. También puso clases de repaso antes de los parciales.', '3b718c8c-d38a-413f-9c86-d86d49acb66f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Lo mejor que hay, super copado, hace clases de consulta y resuelve cosas que en realidad corresponden a la práctica. ', '3b718c8c-d38a-413f-9c86-d86d49acb66f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Un capo, se le entiende re bien y hasta hizo clases de consulta de ejercicios por mas de que es de la teorica.', '3b718c8c-d38a-413f-9c86-d86d49acb66f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'UNA GENIA. Es lo más. Super clara, y va al grano. a veeces se marea con las ternas y otras cosas, pero es buenísima y super didáctica 10/10. Altieri no es tan bueno al lado de ella', '4319f749-add0-45f8-ab4f-156c802d9427');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Tardaba banda en corregir los tps.', '4319f749-add0-45f8-ab4f-156c802d9427');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Excelente profesor, muy claro. Sube mucho material al campus con teoría y ejemplos resueltos que ayudan para hacer los TPs', 'a71ab709-aca3-4405-917c-f68cbb54b955');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy buen profesor. Realmente se preocupa por que los alumnos aprendan, y todo el tiempo insiste en que lo frenemos si no entendemos.', 'a71ab709-aca3-4405-917c-f68cbb54b955');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Los viernes Gabriel da una clase muy parecida a lo que se vió ese miercoles en la teórica para que puedas hacer un trabajo práctico que se hace en grupo y de una semana a otra. Se hacen un poco aburridas las clases, las da con un power point y es poco dinamica, los alumnos casi ni hablabamos si no teniamos dudas. Igual los tps eran accesibles y faciles de aprobar', 'a71ab709-aca3-4405-917c-f68cbb54b955');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Clases correctas, ejercicios hechos sobre un ppt (se hace un poco aburrido) pero sirven y gabriel responde cualquier duda.', 'a71ab709-aca3-4405-917c-f68cbb54b955');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'La primer parte de la materia la explico en pizarron y para la segunda parte llevo proyector con ejercicios resueltos ( que me parecio bien porque si hay que hacer todo en el pizarron se hace muy extenso). Faltaria un poco mas de comunicacion entre la teorica y la practica. Despues, todo excelente', 'a71ab709-aca3-4405-917c-f68cbb54b955');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Un poco aburrida la clase, pero el material muy completo para resolver los tps ya que no hay guías', 'a71ab709-aca3-4405-917c-f68cbb54b955');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Sus practicas son un poco tediosas, pero los ppt que usan son muy piolas, y no le molesta nada repetir varias veces para que se entienda', 'a71ab709-aca3-4405-917c-f68cbb54b955');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buena profesora. Contesta siempre consultas tanto en persona como por mail. Ademas es clara explicando. Diria que fue de lo mejor que tuve hasta ahora en la carrera, pero al menos el primer cuatri de 2018, despues del  primer parcial dejo de ir a las clases y ahi se desvirtuaron bastante la clases practicas en su ausencia.', '171229b4-674a-4c07-b5f6-9bb1b9b93f0e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Durante el primer cuatrimestre del 2020 Ruiz Re no pudo dar clases por problemas de conexión. En su reemplazo tuvimos a Adriana Taslaktzian, quien sin dudas fue una excelente profesora. Super clara y dedicada. Por momentos un poco desorganizada, pero supo adaptarse muy bien a la virtualidad.', '171229b4-674a-4c07-b5f6-9bb1b9b93f0e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'no se conecta a las clases porque no tiene wifi, se le podia preguntar via mail pero era poco practico', '171229b4-674a-4c07-b5f6-9bb1b9b93f0e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es buena mina pero muy anticuada. Usa terna izquierda.', '171229b4-674a-4c07-b5f6-9bb1b9b93f0e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Una señora dulce, a veces no se le entiende mucho pero no puedo criticarla es un amor. ', '171229b4-674a-4c07-b5f6-9bb1b9b93f0e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es buena y trata bien a los alumnos, los ejercicios resueltos en clase están buenos, pero son los muestra en un pdf manuscrito que tiene la mala costumbre de mover constantemente. Lo bueno es q ni bien terminaba la clase los mandaba por mail y podías leerlo de ahí. Los parciales fueron muy acordes a lo que explicaba.', '171229b4-674a-4c07-b5f6-9bb1b9b93f0e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Excelente profesora explica muy bien, tanto que hasta si no miras la teorica le entendes perfecto, y los ejercicios te salen si no faltas a las practicas ,ya que te hace una mini introducción teorica siempre que empieza con un tema.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Excelente profesora explica muy bien, tanto que hasta si no miras la teorica le entendes perfecto, y los ejercicios te salen si no faltas a las practicas ,ya que te hace una mini introducción teorica siempre que empieza con un tema.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Prefiere a sus alumnos de la UCA', '231aaecb-4ece-4ee0-9b51-a9b6e7a1c7d6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'En una de las primeras clases arranco diciendo que preferia a sus alumnos de la uca :) y cuando le mande mail pidiendo revisión de mi examen nunca se dignó a responder.', '231aaecb-4ece-4ee0-9b51-a9b6e7a1c7d6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Venía interesado en la materia hasta que apareció Laiun. Es un desastre, explica mal, es lento, pierde el hilo, no llega a dar los temas y en el examen toma cualquier cosa (aunque siempre lo mismo que cuatris anteriores, tuvimos que aprender los temas integramente de mirar parciales resueltos)', '1e98f5f6-b195-4413-a1a4-a740d36b8b19');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Es un docente demasiado grande, ya se debería jubilar, toca demasiado a los alumnos varones', '0ae16ee7-afba-4ab7-8e2d-a68c140f4f07');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Encontré críticas diciendo que el docente tocaba a los alumnos demasiado pero la realidad es que sólo te pincha con el dedo para molestarte, nada que sea para cuestionar. El resto excelente todo, muy buen docente.', 'a0e51f52-335f-4fd2-97cf-936d079c8145');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Es un muy buen docente en cuanto a que no tiene problemas en quedarse explicando fuera del horario de cursada, pero es muy agresivo verbalmente con los alumnos y toca demasiado de manera inapropiada a los alumnos varones', 'a0e51f52-335f-4fd2-97cf-936d079c8145');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', '(Está mal escrito el apellido) El docente es muy desorganizado, no cumple con los horarios de cursada, siempre se cursan muchas horas menos de lo que indica el siu, se podría ver contenido más práctico, realizar más tps de laboratorio, hacer visitas', '700298f6-c284-4d8e-bc5e-afb20cb7aea1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'La materia aprueba con 4, zafa pero podría aprovecharse mucho mas el tiempo de clase. Los TPs son re falopas y no aportan nada. Podrían enseñar a usar Matlab', '700298f6-c284-4d8e-bc5e-afb20cb7aea1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy buen docente con excelente predisposicion. Muy flexible a la hora de corregir los mapas de campos. En sus clases te explica, basicamente, como aprobar el parcial', 'd91bca00-df96-490f-89df-6c26974bcc5a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Debe ser de los que mas saben en el Depto de Energia pero lamentablemente sus teoricas son horribles. Diapositivas hechas a mano con caligrafía ilegible, la mayoria realizadas hace mas de 15 años (algunas dicen que son de 1995 inclusive...).   
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No hay dudas de quien es Podestá. El mejor docente lejos. Explica excelente. Te deja que le preguntes TODO. Y esta todos los dias en la oficina súper dispuesto a más preguntas. Te enseña todo lo extra. Sabe mil casos de ejemplos de la vida real. Es duro a la hora de aprobar. Aprobas si la tenes bien clara. No te regala nada. Enseña todo. Pero te pide que entiendas y sepas todo. ', 'd3f55f2c-d3c3-4ed9-a505-34607c786979');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Infante sube las teóricas al campus únicamente, nunca lo tuve en clase, pero muy bien explicadas, aunque un poco atrasadas aunque creo que es porque ibamos muy apurados nosotros.', '3948f182-ca43-433b-948f-cb7ac6dda1e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Infante sube las teóricas al campus únicamente, nunca lo tuve en clase, pero muy bien explicadas, aunque un poco atrasadas aunque creo que es porque ibamos muy apurados nosotros.', '3948f182-ca43-433b-948f-cb7ac6dda1e4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Bastante seco en el trato. Va muy rápido en las explicaciones pero al tener la carpeta impresa no tenés que andar tomando casi nota y se puede prestar más atención a lo que va diciendo. El parcial se aprueba por módulos (son 6 en total). Te da varias chances de recuperación hasta que aprobás los módulos que te fueron quedando.', 'f5cafa28-3423-4a07-ace4-5c3a88bee67f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Las clases de Medina consisten en que los alumnos intenten resolver las guías en el momento (son las mismas que Hipólito ya tiene resueltas en su Drive), y que después pase alguien al pizarrón para hacer una puesta en común. Salvo que le pidan, no suele resolver ejercicios de cero, se limita a corregir lo que los alumnos van poniendo en el pizarrón. Toma parcialitos antes de cada trabajo de laboratorio (son 5 en total) de ejercicios parecidos a los de las guías con alguna vuelta de tuerca. A veces llega y dice que el parcialito lo toma la semana que viene, y si llegando al final del cuatri ve que está corto de tiempo hay algunos que directamente no los toma. Casi siempre llega tarde a la clase pero avisa por WhatsApp. Responde dudas por el grupo sin inconvenientes y a cualquier hora, no tiene problema en repetir las cosas las veces que sea necesario. Se complementa bien con Olmos, hacen de la práctica algo bastante llevadero.', '7c7d26f8-88ba-4587-8c5c-cd8726b06045');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Fernando da la clase hasta que llega Medina. En general suele explicar lo que los alumnos le pidan, desde ejercicios de la guía hasta cosas que no se terminaron de entender de la teórica de Infante. A veces trae algún ejercicio resuelto de la guía y lo explica de cero en el pizarrón. Repite las cosas las veces que sea necesario, le interesa que te vayas entendiendo. Es un poco desorganizado pero lo que da suele ser bastante útil y se termina entendiendo sin problemas. Es muy cordial en el trato y explica todo de forma sencilla, por lo que no se hace para nada pesada la clase.', '3b1a352d-72f5-4c5d-81af-22c424ac1ae3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Barbieri:
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Desastre de curso. Muy dificil. Toman parcialitos que te dicen que se parecen a las guias pero nada que ver. La cursada fue una de las experiencias mas disgustantes que tuve en la facultad. Te hacen entregar todas las guias para corrección, TPs y un parcialito por semana que, denuevo, son dificiles. La cursé a modo virtual. Salvador parece el mas agradable del duo. Sin embargo, no se dejen engañar. En numerosas ocasiones van a tener que preguntarse si realmente es un mal tipo o solamente no se da cuenta el esfuerzo que implica rendir un parcialito por semana, que ademas es imposible.', '3671a6bf-93c4-43aa-9b97-24d4f4a1a2b2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'NO SE ANOTEN EN ESTE CURSO. La van a pasar mal. Son exageradamente exigentes y pesados. Te hacen entregar todas las guías, te toman parcialitos muy picantes de cada guía y de cada TP (en total son 14 parcialitos). Básicamente te la pasas estresandote y estudiando para parcialitos de una dificultad innecesariamente alta. NO.', '3671a6bf-93c4-43aa-9b97-24d4f4a1a2b2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'NO TE ANOTES CON ESTOS PROFESORES, parcialitos todas las semanas que en cursada virtual son imposibles y ellos te dicen que son faciles, podes recursar por culpa de estos arcialitos', '3671a6bf-93c4-43aa-9b97-24d4f4a1a2b2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'No te anotés en este curso. Hay parcialitos todas las semanas ("duran" media hora pero los hacen de veinte minutos), hay que entregar las 9 guías, 5 trabajos prácticos de laboratorio, te bajan nota de promedio por faltar o llegar tarde y te humillan cada vez que preguntás algo. Ni hablar de lo exigentes que son corrigiendo los parcialitos, nivel no te aprueban por un error numérico luego de hacer 20/30 cuentas bien. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'muy tranqui esta practica', 'abf0f3f6-dbc2-4183-9762-5e1929ef49ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'resolvia las guias en clase y tiraba tips de algunas cosas que te servian para saber si te daban bien los resultados o ibas bien encarado. buen profe', 'abf0f3f6-dbc2-4183-9762-5e1929ef49ef');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Idéntico a Barbieri. Te maltrata con clase y respeto. Pero sabe todo y explica cómo los dioses.', '745ad082-95ca-4fa5-857d-299c8934416f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Bruno Doeyo en general contesta de forma arrogante y despectiva hacia el alumno, con lo cual no da ganas de preguntar nada. Tiene algunas cosas rescatables como su aporte de datos prácticos y de campo que son interesantes. Sin embargo y en resumen, no recomiendo para nada este curso. Tal vez enseñen decente, pero el esfuerzo es demasiado y no lo vale. Vayan a otro curso.', '745ad082-95ca-4fa5-857d-299c8934416f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'NO SE ANOTEN EN ESTE CURSO. La van a pasar mal. Son exageradamente exigentes y pesados. Te hacen entregar todas las guías, te toman parcialitos muy picantes de cada guía y de cada TP (en total son 14 parcialitos). Básicamente te la pasas estresandote y estudiando para parcialitos de una dificultad innecesariamente alta. NO.', '745ad082-95ca-4fa5-857d-299c8934416f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'REPITO LO DE ANTES', '745ad082-95ca-4fa5-857d-299c8934416f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Lo mismo que el conchudo de Barbieri.', '745ad082-95ca-4fa5-857d-299c8934416f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Excelente Profesor, sabe mucho de la materia, explica los conceptos con varios ejemplos de la realidad. La catedra en si es un poco mas exigente que las demas pero si te interesa la materia es altamente recomendable.', 'cde05aec-8fc6-4172-8aa1-fa8cbb2eb167');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'BRILLANTE. LO MEJOR DE ELECTRO. Se aprende y resulta sencillo. RECOMENDADO.', 'cde05aec-8fc6-4172-8aa1-fa8cbb2eb167');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Preferiria moririme antes de volver a cursarla con estos docentes.', 'cde05aec-8fc6-4172-8aa1-fa8cbb2eb167');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Luis es re bueno y explica impecable pero exigente, los tps de laboratorio son 5 y tenes que tenerlos impecables para que te los aprueben. Para devolvernos las correcciones tardaron bastante y se nos acumuló tener que corregir como 3 tps juntos y es un montón. Además tuvimos que seguir yendo durante 3 semanas mas una vez que terminó la cursada porque teniamos que seguir reentregando los tps y ademas te toman oral o preguntas de cada tp al final de la cursada para aprobarte.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es simpático y nos dejaba acercarnos al depto de electro en cualquier horario para hacer preguntas. En las clases explica bien pero va muuy lento. Nos atrasamos con todos los tps de laboratorio y teminamos la cursada tardísimo. Muy mala organización. No recomiendo esta práctica.', 'cde05aec-8fc6-4172-8aa1-fa8cbb2eb167');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Tardan mucho en corregir los tps y te hacen ir de más durante finales para aprobar unos “orales” de los tps. No te aprueban la cursada en el tiempo y te quedas en el mejor de los casos con pocas fechas para rendir. ', 'cde05aec-8fc6-4172-8aa1-fa8cbb2eb167');
