INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Hipólito: él es ingeniero del itba. Algunas clases menciona lo desactualizado que está la UBA y recomienda "para los que tengan un manguito" pasarse al itba. Las clases zafan, no enseña mucho. Te enseña para raspar la materia. La clase anterior de parcial le nuestra a los "cara conocida" (recursante o el q fue todas las clases y se sentó adelante) el parcial que va a tomar la semana siguiente. Literal, te muestra lo que va a tomar. La primer clase hace mucho incapie en que tener un plan 2011 es estar desactualizado. Y las clases siguientes recomienda pasarse a una Privada (y menciona al itba como la mejor opción). Me pareció errado su punto de vista. E incorrecto. Para el final te conviene preguntarle cuándo va e ir hacerle alguna consulta. Misma metodología que el parcial, te muestra lo que va a tomar. Lo realves en tu casa y vas a rendir. Te pone un 8...9... O 10. Es una vez por semana la clase y faltó unas 2 veces avisando a último momento.', '2231e17d-013e-4c0b-9db6-ce0a7390d5b0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'gran profesora, los videos grabados muy buenos y aparte ofrece clases de consulta optativas que terminabamos siendo 5, y era una clase particular con un profesor que sabe un monton y tiene muchas ganas de enseñar, lo recomiendo.', '2231e17d-013e-4c0b-9db6-ce0a7390d5b0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'este cuatri nomas uso los horarios de clase para dar consultas ya que nos mando un cronograma para ver sus clases teoricas grabadas de la pandemia. el cronograma era claro y los videos estaban muy bien organizados en carpetas y se entendian piola', '2231e17d-013e-4c0b-9db6-ce0a7390d5b0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Hipólito es un crack, las teóricas están subidas en forma de video y son buenísimas. por ahí un poco largas, pero se hacen llevaderas. Muy crack', '2231e17d-013e-4c0b-9db6-ce0a7390d5b0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Buen tipo. Sus videos de teorica son muy piolas y su parcial es RE accesible.', '2231e17d-013e-4c0b-9db6-ce0a7390d5b0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'no tiene wifi, manda la teoria con notas de voz y un pdf, anda con hipolito si podes', '2a60e0f8-4ca8-4957-b5c2-d5735de035da');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No dio clases durante la cursada. Mando un pdf que tenía toda la teoría escrita a mano y con colores (bastante prolija) junto con varios audios explicando cada tema que se debía ver. A mi no me aportó demasiado pero como uno tiene acceso al contenido de TODAS  las teóricas (ya que te podés matricular en el curso de cada una) tenes bastante información disponible.', '2a60e0f8-4ca8-4957-b5c2-d5735de035da');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se entiende lo que explica y no mucho mas que eso. A veces va muy rápido y es difícil seguirlo. Tiene un cuaderno con lo que da en sus teóricas y conviene tenerlo impreso y tomar notas sobre eso. Aprobar la cursada es difícil porque se aprueba por tema, y hasta q no tengas los 6 ejercicios que toma bien no te aprueba. Hay veces que responde de mala manera.', '2a60e0f8-4ca8-4957-b5c2-d5735de035da');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'No se entienden sus clases pero con si llevás la carpeta impresa son llevaderas. Toma exactamente lo que da así que si la cursas con él andá a las clases o no vas a pasar el parcial. Da mucha información que no entra en el final.', '2a60e0f8-4ca8-4957-b5c2-d5735de035da');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Andá preparado y tratá de leer antes. Es una materia no tan complicada sin embargo la teórica es muy tediosa y absolutamente todos los profesores son bastante pedorros. ', '2a60e0f8-4ca8-4957-b5c2-d5735de035da');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Ariel es buena onda pero no me pareció muy claro cuando explicaba los ejercicios de la guía. Aún así, durante la clase no tiene drama en responder cualquier duda varias veces si hace falta. Además, a mí me respondió casi todas las dudas que le consulte por mail sobre TPs, parcialitos, ejercicios de la guía y adicionales.', '7d320ba2-3977-49c7-ab39-7955c9ab9c52');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Oscar Medina es un capo, nada mas que eso. La tiene re contra clara, te hace las clases muy llevaderas, te presenta ejemplos claros de la vida real, no se va por las ramas y le podes mandar una duda un domingo a las 21 hs y te contesta. 100% recomendable. ', '28f60704-945e-41df-a03d-bfd8fc0dad6a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Las clases de Medina consisten en que los alumnos intenten resolver las guías en el momento (son las mismas que Hipólito ya tiene resueltas en su Drive), y que después pase alguien al pizarrón para hacer una puesta en común. Salvo que le pidan, no suele resolver ejercicios de cero, se limita a corregir lo que los alumnos van poniendo en el pizarrón. Toma parcialitos antes de cada trabajo de laboratorio (son 5 en total) de ejercicios parecidos a los de las guías con alguna vuelta de tuerca. A veces llega y dice que el parcialito lo toma la semana que viene, y si llegando al final del cuatri ve que está corto de tiempo hay algunos que directamente no los toma. Casi siempre llega tarde a la clase pero avisa por WhatsApp. Responde dudas por el grupo sin inconvenientes y a cualquier hora, no tiene problema en repetir las cosas las veces que sea necesario. Se complementa bien con Olmos, hacen de la práctica algo bastante llevadero.', '28f60704-945e-41df-a03d-bfd8fc0dad6a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Clara y concisa. Toma lo que da. ', '6050e2f2-95ab-41fc-90d2-a96cea30c400');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'run.', '6050e2f2-95ab-41fc-90d2-a96cea30c400');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Espero que esta señora done su sueldo o trabaje adhonorem, porque no se explica como da semejantes clases. resuelve ejercicios en el aire IMPOSIBLE de seguirla. claramente es la cátedra en la que se inspiraron los del robo al banco río, porque esta cátedra es digna de ser llamada "el robo del siglo". Dicen las malas lenguas, que Francella se inspiró en ella para elaborar su personaje.', '6050e2f2-95ab-41fc-90d2-a96cea30c400');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Escandalosamente la peor profesora que tuve hasta ahora
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Fernando da la clase hasta que llega Medina. En general suele explicar lo que los alumnos le pidan, desde ejercicios de la guía hasta cosas que no se terminaron de entender de la teórica de Infante. A veces trae algún ejercicio resuelto de la guía y lo explica de cero en el pizarrón. Repite las cosas las veces que sea necesario, le interesa que te vayas entendiendo. Es un poco desorganizado pero lo que da suele ser bastante útil y se termina entendiendo sin problemas. Es muy cordial en el trato y explica todo de forma sencilla, por lo que no se hace para nada pesada la clase.', '5d2a939c-2ccd-433e-870f-194a8d562ff5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'No puedo dejar de recomendar su curso', 'f62dd704-60de-45fc-95b4-aab17154d39b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Alguno tiene una pistola?', 'e0916094-4278-4fd8-b799-47bacabf64e7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Algunos parcialitos de la practica no reflejan lo enseñado en clase.', '71f49710-1d0b-48bd-919d-0798a434d8db');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Fue bastante áspera la cursada con él porque no grababa las clases y al principio casi toda la cátedra estaba bastante desorganizada entonces era difícil llegar a cada clase habiendo visto los temas de la teórica, por lo que se complicaba seguirle el paso de la explicación. A partir de la mitad del cuatri empezó a tomar parcialitos cada clase (durante el horario de la teórica ya que Infante no daba clases) que si estás al día con los temas de la teórica están muy buenos porque son exigentes pero son ejercicios que no aparecen en las guías y en el final suelen tomar (si no estás al día F). Aún así, para los que nos quedaban consultas sobre el parcialito un par de veces se quedo fuera del horario de clase explicando como se resolvían.', '71f49710-1d0b-48bd-919d-0798a434d8db');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Toma 5 parcialitos a lo largo de la cursada, se enfoca en los temas de mas importancia. Los ejercicios que toma en estos no se corresponden con los que aparecen en las guias y los vistos en clase. Generalmente explica 1 ejercicio de cada tema "mas raro" y de ese estilo es lo que toma. Es complicado preparar los parcialitos porque no sabes con lo que te va a caer. Una vez rendido el parcialito, suele explicar que era lo que se pretendia y en el recuperatorio ya le agarras la mano. Suele dar mas de un recuperatorio por tema. Por el otro lado, al exceder la dificultad esperada por la catedra, te preparan bastante bien para el final.', '71f49710-1d0b-48bd-919d-0798a434d8db');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Tarda mucho en responder los mails', 'd99c5adc-d025-4ae0-acea-0012e6df23a7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'La practica esta completamente desconectada de la teorica. Los profes suelen llegar media hora tarde. Hacen pocos ejercicios. Las clases son un poco aburridas. Tardan en responder mails y esto retrasa la correccion del TP.', 'd99c5adc-d025-4ae0-acea-0012e6df23a7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'La verdad los ayudantes son un monton y ayudan mucho pongo 5 a todo por los ayudantes no especificamente este profe', 'd99c5adc-d025-4ae0-acea-0012e6df23a7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es muy simpático pero no sabe corregir ni explicar. Sus mejores aportes son comentarios interesantes sobre cuestiones prácticas.', 'b8fe1263-6534-411d-b09e-ad31997a1eb8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Bruno es re predispuesto a ayudar pero explica medio mal', 'b8fe1263-6534-411d-b09e-ad31997a1eb8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Se va un poco de mambo charlando y explicando, si bien hace solo un ejercicio por clase. Pero esta siempre bien predispuesto a consultas', 'b8fe1263-6534-411d-b09e-ad31997a1eb8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Es medio desorganizado en cuanto a clases, pero sus correcciones de parciales me resultaron claras. Los comentarios en clase son lo mejor, aunque a veces se va un poco por las ramas.', 'b8fe1263-6534-411d-b09e-ad31997a1eb8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Sabe un poco menos que Gustavo pero la buena onda que le pone es inmensa. Explica muy bien y responde atentamente consultas personalmente y por el campus. No hay dudas de que le encanta la materia', '9004562a-b5b8-49e8-b0a8-f50f4a049226');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Excelente docente en todos los aspectos dichos', '9004562a-b5b8-49e8-b0a8-f50f4a049226');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Un capo Martín. Muy buenas clases y al menos este cuatri fue muy paciente con la entrega del tp', '9004562a-b5b8-49e8-b0a8-f50f4a049226');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Martín Echarri, súper copado y explica de diez', '9004562a-b5b8-49e8-b0a8-f50f4a049226');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Crack, debería dar la teórica (en realidad ya da la teórica dado que Venturino no lo hace)', '9004562a-b5b8-49e8-b0a8-f50f4a049226');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Un genio, hace la clase divertida, explica excelente y siempre esta predispuesto a darte oportunidades y responder todas las dudas aunque signifique quedarse después de clase.', '9004562a-b5b8-49e8-b0a8-f50f4a049226');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Excelente profesor, explica muy bien y es muy claro. Hace la clase muy dinámica. ', '9004562a-b5b8-49e8-b0a8-f50f4a049226');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Un profesor muuy copado, hace amena la clase y pone muchas ganas para que los alumnos participen y que todos salgamos entendiendo los temas dados.', '9004562a-b5b8-49e8-b0a8-f50f4a049226');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'La verdad faltan ayudantes son un monton Y ayudan mucho pongo 5 a todo por los ayudantes no especificamente este profe', 'd9cd043d-3bc1-41e7-9d82-0cc8c4bbf276');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Un genio, súper ameno y abierto a consultas. La onda que le pone y la cercanía con el alumno son puntos claves', '70a77afc-e938-4754-a687-4bcbe26ca92b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Excelente profesor, súper copado y explica de una manera que logras entender perfectamente los temas', '70a77afc-e938-4754-a687-4bcbe26ca92b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El coló da la teórica que no es obligatoria, pero es totalmente recomendado ir porque adelanta los temas que se van a dar en la práctica y eso ayuda a no estar tan perdido', '00791dee-16b6-40f4-85d8-8829424328ed');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'Asiste a clase y respeta el horario. De nuevo, algo típico de FIUBA, clases prácticas donde no se da clase, sino que se responden consultas. En el caso de Ferro, parece un poco agresivo para responder, y siempre que le preguntas algo, te explica todo sobre el tema, por lo que a veces te terminas olvidando de que le preguntaste, o no te lo explico, pero bueno, explica bastante bien.', 'd1d9288d-86bf-4ffe-81f6-6427cb1cf50a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'No estuvo presente en el 1C2020, pero basado en mi experiencia del 2019 considero que es un buen profesor que se preocupa por que entendamos los temas.', 'd1d9288d-86bf-4ffe-81f6-6427cb1cf50a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Oscar estaba siempre en la práctica de la tarde y suele responder bien a todas las preguntas que le hacían, si bien muchas veces se iba un poco de tema con cosas que no terminabas entendiendo mucho o que no te aportaban mucho, como la tolerancia de los resistores (lo dice siempre). Igual está siempre y con la mejor predisposición, y en los trabajos de laboratorio también ayuda bastante.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Está loco', 'd1d9288d-86bf-4ffe-81f6-6427cb1cf50a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'Un grande Kelly, explica todo muy bien y siempre tiene buena predisposición, ya sea para consultas de ejercicios como para los TPs, eso si, esta 10 horas por alumno. Como dato de color comento que parece muy viejo pero no lo es tanto, y que con mis compañeros teniamos la teoria de que explicaba lento aproposito para resolver menos ejercicios jajaja.', 'b056c1cd-7cef-4252-a5c2-0b731009a98c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Señor grande que la tiene clara. Contesta todas las dudas aunque le preguntes una boludes, se toma el tiempo necesario para que entiendas y a veces un poco más también. Hay que hacer cola para consultar. Es una lástima que no expliquen nada en el pizarrón, las prácticas son para autodidactas y consultar con los docentes.', 'b056c1cd-7cef-4252-a5c2-0b731009a98c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 're predispuesto!!  responde al toque y con muy buena onda', 'b056c1cd-7cef-4252-a5c2-0b731009a98c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Kelly no estaba en el horario de nuestra práctica, sino después, pero es ya todo un signo que nos quedábamos para preguntarle específicamente a él. Explica con mucha claridad y tranquilidad, y suele ir muy a fondo con todo tema que le pregunten, lo que hace que haya una fila esperando, pero también te suele dejar sabiendo bien los temas.', 'b056c1cd-7cef-4252-a5c2-0b731009a98c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Se encarga de corregir los tp's, no recuerdo que haya presentado o explicado algo. ', 'b056c1cd-7cef-4252-a5c2-0b731009a98c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'No tuve mucho trato con él pero las veces que fui a hacerle consultas me contestó siempre muy bien, y hasta se explayó explicando otras cosas que no le había preguntado. Es amable y tiene buena disposición. Corrige rápido los tps y no busca cagarte ni complicarte la cursada al pedo.', '80b716d9-3f92-42a9-9080-913483ba851b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Las clases estuvieron buenas pero mucho cuidado con las condiciones de aprobación. No asumas nada porque nos cambió a último momento todo y muchos se vieron perjudicados. Recomiendo participar de todo lo que proponga porque te pueden estar tomando asistencia sin que te lo avisen.', '3c85dbe1-cfe7-45a7-857a-b53b0755504e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Sabe mucho pero siento que un poco disfruta de ver sufrir a sus alumnos. En los orales te toma cosas jodidas o engañosas, al menos en relación con los otros docentes, y la exigencia debería ser igual rindas con quien rindas. Llega y se queda en el cuartito, sólo responde consultas si vas hasta ahí a preguntarle, no parece que quiera tener una participación activa en la clase (más allá de que no expliquen ejercicios en el pizarrón, otros profesores se quedan a la vista de los alumnos para atender consultas). Dicho esto, si vas a hacerte consultas sabe responderte y explicarte bien.', '3c85dbe1-cfe7-45a7-857a-b53b0755504e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2016', 'Buen docente, explica todo como corresponde y te responde dudas en persona (aunque va rapidisimo). Su criterio de corrección es claro (todo bien o no aprobas). ', 'd7bdc0a3-0505-4f98-bc1c-0a97b05ca36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Es capo en su tema, pero siempre trata de mostrarte que sabe más que vos. Da buenas clases, suficientes para el parcial, aunque NO suficientes para el final. Las teóricas no son muchas.', 'd7bdc0a3-0505-4f98-bc1c-0a97b05ca36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'En realidad, las clases que dió fueron grabadas. Cada tanto entra a la práctica y responde preguntas. Las clases grabadas no fueron muy útiles la verdad.', 'd7bdc0a3-0505-4f98-bc1c-0a97b05ca36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Las clases teóricas "complementarias" las sube a youtube completas desde principio de cuatrimestre. A diferencia de un cuatrimestre presencial, se presentó en casi todas las clases prácticas (miercoles y viernes) para dar la clase junto a Christian. En presencial de por sí muy buen profe, pero creo que a distancia se destacó incluso más ya que logramos profundizar más en los temas con cada clase.', 'd7bdc0a3-0505-4f98-bc1c-0a97b05ca36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'se rie de vos, no lo odias pero tampoco lo queres. explica muy bien pero no te cae del todo bien . medio chamuyero en los regimenes de aprobacion.', 'd7bdc0a3-0505-4f98-bc1c-0a97b05ca36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Da clases muy bien y muy rápido, tratando de condensar toda la información posible en 2 horas. Salís sabiendo bastante más por clase.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Explica con claridad y suele tener buena disposición. Como en la práctica no dan clases se vuelve bastante necesario ir a sus teóricas. Es posible aprobar sin ir pero la materia se hace mucho más cuesta arriba. Me pareció justo en sus criterios de corrección para conmigo y no te tira a matar en los orales.', 'd7bdc0a3-0505-4f98-bc1c-0a97b05ca36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Bueno pero rapido', 'd7bdc0a3-0505-4f98-bc1c-0a97b05ca36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'En este cuatri no dio teóricas, subió videos para ver en el campus. Pero siempre estaba presente en la practica de la tarde para aportar algún comentario.', 'd7bdc0a3-0505-4f98-bc1c-0a97b05ca36d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'No da buenas clases, explica algo de matlab y simulink pero las clases son aburridas y mal explicadas. Como corrector del TP de la materia creo que no ayuda mucho, se queja mucho y hace poco. Si lo pueden esquivar se van a ahorrar dolores de cabeza', '969c9441-775f-4ffd-9516-6a496b5e7deb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'No da buenas clases, explica algo de matlab y simulink pero las clases son aburridas y mal explicadas. Como corrector del TP de la materia creo que no ayuda mucho, se queja mucho y hace poco. Si lo pueden esquivar se van a ahorrar dolores de cabeza', '969c9441-775f-4ffd-9516-6a496b5e7deb');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Suele ir a las clases, tiene buena predisposición para responder. No da clases', '7b05aec6-d65c-4ad8-a00b-709d50bd3fe5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Me toco como corrector del TP. Bastante exigente pero justo a la hora de corregir y el oral', '7b05aec6-d65c-4ad8-a00b-709d50bd3fe5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'va cada tanto, no da clases y responde normal, ni bien ni mal', '7b05aec6-d65c-4ad8-a00b-709d50bd3fe5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Otro de los de la práctica. Van cada tanto, nose como es el tema de su sueldo, pero no cumplen ningun horario ni dia en particular. No da clases, de hecho la materia no tiene clase práctica, uno va y hace consultas. Esto es horrible, porque cuando la cursé eramos 60 y habia 2 docentes, o 1 solo a veces, pero bueno.', '7b05aec6-d65c-4ad8-a00b-709d50bd3fe5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'No da clase, pero es un ayudante que sabe bastante y si le preguntas responde bien. Domina los temas de la asignatura y si hay algo que no sabe te lo dice de frente. ', '7b05aec6-d65c-4ad8-a00b-709d50bd3fe5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Se nota que sabe los temas, le preguntas algo y a la larga te responde. Si no vas  preguntarle el tipo puede estar las 2 hrs y media de clase sentado sin hacer nada.', '7b05aec6-d65c-4ad8-a00b-709d50bd3fe5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Sabe pero le gusta cagar a los alumnos. Si te está por tomar el final, corré. Es el único de los docentes capaz de desaprobar un TP final con el circuito funcionando y cumpliendo medianamente bien las especificaciones ', '7b05aec6-d65c-4ad8-a00b-709d50bd3fe5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Creo que el jefe de TPS , el tipo es crack y sabe explicar. Sabe mucho y a veces se complica seguirlo con las clases pero le pone ganas y explica cosas muy detalladas. Buen docente. Como corrector creo que es bastante exigente y pide bastantes cosas para aprobar el TP pero creo que si no lo tenes a el como corrector tenes 90% de chances de recursar la materia. Te sigue hasta el ultimo dia del cuatrimestre, te pide TODO a si que es bastante exigente. Creo que los unicos que apruebas la materia sabiendo algo son a los que les corrige el. ', '7b05aec6-d65c-4ad8-a00b-709d50bd3fe5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Creo que el jefe de TPS , el tipo es crack y sabe explicar. Sabe mucho y a veces se complica seguirlo con las clases pero le pone ganas y explica cosas muy detalladas. Buen docente. Como corrector creo que es bastante exigente y pide bastantes cosas para aprobar el TP pero creo que si no lo tenes a el como corrector tenes 90% de chances de recursar la materia. Te sigue hasta el ultimo dia del cuatrimestre, te pide TODO a si que es bastante exigente. Creo que los unicos que apruebas la materia sabiendo algo son a los que les corrige el. ', '7b05aec6-d65c-4ad8-a00b-709d50bd3fe5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Se encarga de las clases de consulta, fueron muy buenas.', '3b1e606e-dc10-4930-bfdf-45d242ffb920');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'No se quien es.', '058133c5-59fe-4a8e-90b2-9e9285dcf9c4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No me gustó. Medio falopa. Le pregunté 2 cosas y no las explico bien y deje de ir a consultarlo', '058133c5-59fe-4a8e-90b2-9e9285dcf9c4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'No lo conozco, creo que nunca estuvo en la materia.', '058133c5-59fe-4a8e-90b2-9e9285dcf9c4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'No lo conozco y fui a mas del 75% de las clases.', '058133c5-59fe-4a8e-90b2-9e9285dcf9c4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'El mejor docente de la asignatura. De los auxiliares, quien más sabe. Tiene muy buena predisposición ', '058133c5-59fe-4a8e-90b2-9e9285dcf9c4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Da las teoricas, explica bien, muy buena onda y se copa con responder cualquier consulta. Le pone bastantes ganas. El unico problema es que el 80% de los temas que da no sirven para el TP, o sea que básicamente no sirven para aprobar la materia ( solo si das al final escrito). Te sube las clases practicas y teoricas grabadas de otros cuatris y bastante material para estudiar los temas. El unco problema que tiene es que no se porque corta las clases antes, nunca alarga las clases mas de 2 horas y pico por lo que da todo medio apurado va a las corridas ( pero igual se le entiende)', '058133c5-59fe-4a8e-90b2-9e9285dcf9c4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Da las teoricas, explica bien, muy buena onda y se copa con responder cualquier consulta. Le pone bastantes ganas. El unico problema es que el 80% de los temas que da no sirven para el TP, o sea que básicamente no sirven para aprobar la materia ( solo si das al final escrito). Te sube las clases practicas y teoricas grabadas de otros cuatris y bastante material para estudiar los temas. El unco problema que tiene es que no se porque corta las clases antes, nunca alarga las clases mas de 2 horas y pico por lo que da todo medio apurado va a las corridas ( pero igual se le entiende)', '058133c5-59fe-4a8e-90b2-9e9285dcf9c4');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Pablo es un genio. Sin dudas uno de los mejores profes de fiuba. Explica bien, claro, busca que los alumnos participe  y se saquen las dudas y les hace la materia lo mas llevadera posible.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Recomendada para dar los primeros pasos en RF', '6998b071-ac3f-4ebe-b8ae-57ecc9fbbb05');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'es muy buen docente, la materia tiene un criterio de aprobacion con un TP que se entrega a fin de cuatri. Luego el final es oral y es de los temas vistos en clase, de un libro llamado Simonetta, los apuntes de una universidad de Catalunia y las ppts. Despues videos de YT dijo que los tomemos entre pinzas porque muchas veces opinan desde la practica nomas pero no tienen conocimientos asi formales. El tipo sabe un monton porque labura en el rubro desde hace banda. Re aprovechable la materia.', '3b657f15-6c4b-4f1a-a14d-d30c27b2700e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'De lo peor de la facultad', 'aaf7280a-1bf1-425a-8a3b-ff5428f296b7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Uno de los peores docentes que tuve. La teórica además de ser aburrida e sus clases innecesarias recibís el maltrato por parte del profesor, que si tiene  ganas te echa de la clase. Los finales son cualquier cosa, te puede bochar por cosas que simplemente no le gustaron como lo escribisteo por no tener ganas de terminar de ver el final del ejercicio. Además del maltrato que recibís si vas a preguntarle algo ', 'aaf7280a-1bf1-425a-8a3b-ff5428f296b7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Insoportable, demasiado exigente en el final para lo que da. Toma cualquier cosa.', 'aaf7280a-1bf1-425a-8a3b-ff5428f296b7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Hamkalo es de los peores profesores de la facultad. Toma en los exámenes cosas que dice que no va a tomar, explica cosas irrelevantes y exige saberlas como si fueran de vital importancia.', 'aaf7280a-1bf1-425a-8a3b-ff5428f296b7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Desastre total. Explica mal y toma cosas que dice que no va a tomar', 'aaf7280a-1bf1-425a-8a3b-ff5428f296b7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'No saben enseñar, los parciales son bastante random y además tienen la estupida regla de que para aprobar el parcial si o si hay que tener algo bien hecho en todos los puntos', '1d9d9835-b625-4ea7-8b1f-ea824ca143ff');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'De los peores profesores de FIUBA. Una verguenza es. No se le entiende nada. ', '1d9d9835-b625-4ea7-8b1f-ea824ca143ff');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Siempre respondió mis dudas. ', '7c2689a2-670f-4205-80af-6af74cc34fa8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'El único que realmente parece que le importa la materia. ', '7c2689a2-670f-4205-80af-6af74cc34fa8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Nico es un fenomeno. La tiene muy clara y no hay consulta que no pueda responder. Las clases estan buenas, te presenta la materia y los temas como casi todo lo que es programación son para investigar y profundizar. ', '104ded41-f7b9-41c6-a5f5-876668321cf2');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Muy clara y siempre da buenos ejemplos.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'A tener en cuenta que PS1 junta lo que antes era PS1  y PS2, asi que se ve desde filtros FIR hasta filtros de Kalman y en la última clase muestra un poco de Kalman extendido, UKF y algo aplicado a redes neuronales.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Contesta todos los mails. Fomenta la participación haciendo preguntas a cualquiera (cada clase alguien distinto, sacado por una ruleta online) y se acuerda todos los nombres. Se nota que sabe un montón.', '67ec89e9-4487-41c9-82f6-57348dad436e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Gran profesor, sabe un montón, explica bastante bien la parte de psicoacústica.', '67ec89e9-4487-41c9-82f6-57348dad436e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Pablo también es un excelente docente. La vez que la cursé explicó los temas de psicoacústica y la verdad lo hizo muy bien. Si la clase viene en picada o ve que nadie participa, pregunta al azar a algún alumno para fomentar la participación en clase. Siempre antes de cada clase pregunta si hay algún tema que no se entendió para volver a explicarlo.', '67ec89e9-4487-41c9-82f6-57348dad436e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explica bien y aporta con buenos comentarios pero la mayoría de los temas los explica Nilda.', '67ec89e9-4487-41c9-82f6-57348dad436e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy buena docente, a veces se enoja si no sabemos los temas  pero tiene sentido. Labura de lo que enseña, sabe lo que está enseñando por experiencia práctica.', '75800fa6-f935-4d27-8e82-87d8863f6d64');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Es copada, quiere que aprendamos. Se nota que le interesan mucho los temas que da. Las clases las hace con powerpoint, y va explicando las diapositivas. ', '75800fa6-f935-4d27-8e82-87d8863f6d64');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Gran persona y gran profesora, ama lo que hace y lo demuestra en sus clases. Trabaja de lo que enseña y siempre te cuenta cosas de su trabajo que son interesantes y suman a las explicaciones teóricas.', '75800fa6-f935-4d27-8e82-87d8863f6d64');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Excelente docente. Explica muy claro y detallado. Si un tema no se entendió, no tiene ningún problema en explicarlo de vuelta. Da acotaciones y ejemplos de los trabajos que ella hace (mediciones, laboratorio, etc.) que no están en las diapositivas. Se nota que sabe muchísimo sobre los temas. Se pudo adaptar muy bien a la cursada virtual.', '75800fa6-f935-4d27-8e82-87d8863f6d64');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Organizan una visita a un laboratorio de acústica en La Plata que está buenísima para "ver" (escuchar) lo que se estudia en el aula, algo que no muches docentes implementan. ', '75800fa6-f935-4d27-8e82-87d8863f6d64');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Excelente profesora, explica bien y sabe mucho del tema.', '75800fa6-f935-4d27-8e82-87d8863f6d64');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Buen Docente, a veces no eran muy buenas las clases, pero se aprovechaba cuando se le hacian consultas. ', '868f397b-0463-4b2f-b0df-e0d9fe252869');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Cabibbo dio las clases "prácticas" que de práctica tienen poco. En la virtualidad era ver videos / presentaciones de un equipo biomédico en particular pero bastante superficiales. No se metía en las ecuaciones y mucho menos en resolver algún ejercicio parecido a alguno de las guías. Lo cual por lo menos a mí me dejó sin la "bajada a tierra" que deberían dar las clases prácticas de los conceptos vistos en la teórica.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Excelente docente y profesional; durante clases compartio experiencias y explico todo muy entendiblemente. Muy buena experiencia de curso. Siempre atento a resolver nuestras dudas.', 'e2b684c0-0b35-4bb6-8535-e76021d1746c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Valverde da la teórica y toma la defensa oral al final del curso. En la virtualidad optó por no tener parcial sino hacer una monografía teórica de un equipo biomédico + TP análisis de mercado del equipo que sirva como parcial y su defensa oral como final. Hizo la materia muy llevadera, la única crítica es que dio a elegir los temas de la monografía y varios optaron por hacer equipos no muy relacionados con los temas vistos durante la cursada, lo cual no se supo aprovechar los conceptos aprendidos y para lo único que fueron usados fue para completar las guías de ejercicios que también pidió para el final de cuatri.', 'e2b684c0-0b35-4bb6-8535-e76021d1746c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy buena cátedra. Recomiendo cursarla.', 'b5c3570c-0299-4db3-9d0b-3d1f094a2464');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'No es mal docente,es medio desorganizado pero trata de ponerle onda. Saber sabe dd electrónica. No tanto los programas.', 'bdfcf901-89f8-487b-9b86-f458ad35523e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'muy desorganizada estaba la materia, la estan arreglando', 'bdfcf901-89f8-487b-9b86-f458ad35523e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2019', 'Un tipo nefasto, desatento, distraído y muy deshonesto. Da malas clases: nadie le presta atención porque no se enteinde lo que explica, a veces lleva los temas sin preparar, el contenido de la materia no es claro y las consignas de los TPs y actividades tampoco son claras. Los criterios de corrección son muy dudosos. Sin contar que tenia que dar 4 horas de clase y dio solo 3. Las clases han llegado a ser un "aprendalo usted mismo" en las que el profesor aprendía junto al alumno y en ocasiones sabía más el alumno que el profesor. Ha bajado nota a alumnos por computadoras que andaban mal y no solo no se hace cargo (baja nota al alumno por un tema ajeno al contenido), sino que no se dispone a ver que sucede con esa computadora para ver cual es el inconveniente y que no vuelva a suceder. Quedó de profesor porque estaba dando un taller, pero nadie se fijo si realmente estaba capacitado para dirigir una materia. ', 'bdfcf901-89f8-487b-9b86-f458ad35523e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'En la cursada virtual se hacian muy tediosas las clases porque daba muchas vueltas para algunos temas y otros los pasaba muy rapido y no se podía entender todo. ', 'bdfcf901-89f8-487b-9b86-f458ad35523e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Buen profesor, se nota que realmente quiere que los alumnos entiendan los conceptos. Tiene la desventaja que si uno no va a la clase habiendo leído previamente los temas se vuelve un poco tediosa. Responde todas las dudas que uno le haga, vía mail o en clase.', '8def7c82-8c09-4da1-9b97-e7768263aa84');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es medio aburrido y explica maso maso, pero atiende consultas sin problemas. En mi cuatri dio pocas clases asi que no fue mucho problema. Mas alla de eso super macanudo para hacer consultas.', '477cf1fe-3b24-4748-9d1b-fca8ec206027');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'es el ayudante y esta a cargo de la correccion de los tp, en nuestro caso colgo un poco con las devoluciones y eso complico un poco pero no es exigente al extremo con las correcciones, igualmente uno no elige sino que te asignan a un corrector al momento de formar los grupos. No suele ir a clases y tarda en contestar los mails.', '3f3ef1f0-9335-4779-bb99-e39c52f3bc23');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Explica muy claro y está abierto a dudas, pero sus clases duran las 3 horas y pueden ser un poco densas. En la práctica a veces se extiende un poco en el horario.', '24722418-25d6-4ec4-bff3-60823bbcd7de');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Las clases las hace un poco largas y pesadas porque se mete con las demostraciones y profundiza bastante en la parte mas tecnica de la materia, por lo que se torna aburrido y denso. Mas alla de eso es buen tipo, ademas que explica claro y prolijo, por lo que si prestas atencion no hace falta que leas ningun apunte ni busques temas en ninguna bibliografia.', '24722418-25d6-4ec4-bff3-60823bbcd7de');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Explica re claro, pero es bastante poco efusivo o comunicativo, por lo que no transmite muchas ganas, sobre todo siendo las clases tan temprano', '24722418-25d6-4ec4-bff3-60823bbcd7de');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy buen profesor, trata de dar una mirada complementaria a los pdfs de la cátedra (que son bastantes completos pero al tener tanta información uno a veces se pierde en que temas debería focalizar más) y es muy claro en sus explicaciones. Recomendable aprovechar sus clases de consultas, aunque a uno tal vez no le convenza asistir a menos que tenga los temas bien claros (en mi caso por miedo a cometer algún error de concepto al preguntar) ayuda mucho asistir y preguntar acerca de como encarar los ejercicios o sobre algunos conceptos que no les cierren.', '24722418-25d6-4ec4-bff3-60823bbcd7de');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'muy buen profesor sus clases son un poco densas pero la materia es asi, se hace un poco largo y cumple casi siempre con las 3 horitas de clase, es muy recomendble.', '24722418-25d6-4ec4-bff3-60823bbcd7de');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un capo, hace la clase super pasable y entretenida. Busca darle un toque mas general a la materia cosa que uno se lleve claro el concepto, aunque a veces por culpa de esto quedan unas cosas un toque incompletas y tenes que ir a leer la bibliografia si o si.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Gerez es un tipaso. Se nota su entusiasmo por la materia y por que el alumno entienda. Todo el material que utiliza está en un google site suyo, donde hasta se encuentra mucho mas material. Las clases son muy amenas y entretenidas. Logra cubrir todo el contenido en una forma mas didáctica que el otro curso. Muy recomendado', '8e7b7a41-61aa-4502-86ec-b21a78ae60f8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'de los mejores profesores que tuve en la facu, hace que la materia pesada se lleve un poco mejor, altamente recomendable.', '8e7b7a41-61aa-4502-86ec-b21a78ae60f8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es buen tipo y no tengo duda en que hace lo maximo posible para que sus alumnos aprendan y hagan las cosas de la mejor forma posible, pero termina siendo muy pero muuuuy denso. Sus clases son largas y se excede de tiempo, es medio plomo explicando y si te toca como corrector de TP es super exigente con las correcciones y con que todo tiene que estar perfecto. Si te toma oral de TP te pregunta todas cosas super teoricas y la tenes que tener clara para no quedar pataleando en el aire.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'El Marce es un genio. Te responde todas las dudas por el campus, corrige re claro los tps, explica bien a detalle los ejercicios en clase, pero a veces se va un poco por las ramas y se queda sin tiempo', 'f73fc43b-4a5b-40be-9eb8-b478f0c45bfc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Excelente profesor. Es bastante claro y no tiene problema en explicarte todo mil veces si hace falta.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Marcelo es un gran profesor. Explica muy claro y apuntando a lo que luego toman los temas, dandole mas tiempo a los temas mas complejos. Se preocupa para que el alumno aprenda y se lleve cosas aplicadas a la realidad de la materia. Los parciales son muy acordes a lo visto en clase. Recomendadisimo', 'f73fc43b-4a5b-40be-9eb8-b478f0c45bfc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'es promocionable y la promoción es accesible, anotense con él. solo las prácticas son obligatorias, no hace falta ir a la teórica de di iorio, pueden ir a la de gerez o directamente ver los videos de la página web de gerez que tiene todo. ', 'f73fc43b-4a5b-40be-9eb8-b478f0c45bfc');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Faltó a muchas clases, no te deja ver tu examen ni aunque le pidas, no fue muy copada cuando se le preguntaron dudas y no parece interesarle que el alumno aprenda. En el curso cambiaron varias veces la modalidad de evaluación y los requisitos para cada chance de parcial que ya eran diferentes, fueron cambiando semana a semana según decisión docente (esto me parece algo insolito, que se vayan sumando requisitos para rendir el mismo recuperatorio como tener mas trabajos prácticos aprobados)
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Es quien corrige los TPs, tiene muy buen seguimiento y responde dudas por mails muy rápido por mail. No asistía tan seguido a las clases pero en cuanto a la correcciones que daba y el feedback fue impecable. Hace bastante más ágil la confección de los TPs, en especial de los primeros 2 que son los más pesados (son 3 en total).', '22075f95-159f-4381-b5e6-b1e3e3c7415c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy rompe con el tema asistencia, y con tener la cámara prendida. En general no me gustó, no lo volvería a elegir. Si dejas el meet abierto al final de clase lo toma como que te fuiste y te pone ausente, asi solo te hayas olvidado de cerrarlo. Lo evitaría si tuviera otra opción. le da mucha bola a exergía para el parcial, hay que saberlo de taquito eso', 'abef11de-a3bb-4163-8252-8ee4ede4231a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Bastante exigente en cuanto a la participación de los alumnos. Es muy recomendable ir a las clases habiendo visto las clases teóricas porque hace preguntas constantemente. Si uno va a la clase habiendo realizado ejercicios o con dudas es muy productiva porque responde de manera muy completa las preguntas. Suben al campus videos desarrollando ejercicios de la guía en los que aclaran varios conceptos y muestran la metodología para encararlos (pasado un tiempo los borran por lo que es recomendable hacer esos ejercicios y comparar con los videos lo antes posible). Toma asistencia. Usa la plataforma AdobeConnect, la cual es un poco incómoda de utilizar.', 'abef11de-a3bb-4163-8252-8ee4ede4231a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Explicó bastante bien los temas pero es muy pesado en las clases. Le gusta hacer quedar mal a los alumnos que no están siguiendo la materia. Hace muchas preguntas en clase eligiendo alumnos al azar, así que es mejor tener bien leídas las teóricas antes de ir. Toma asistencia.', 'abef11de-a3bb-4163-8252-8ee4ede4231a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Parece que esta enojado pero en realidad es copado, sus clases se basan en hacer ejercicios de la guia los cuales los sube al campus. Hay bastante ida y vuelta con los alumnos. Hay muchas cosas que nunca quedaron claras de los ejercicios, debe haber practicas mejores. Pero con lo visto en la cursada el parcial fue accesible. Toman lista y te piden que no tengas mas de 3 faltas. Lo unico medio malo es que la practica es antes de la teorica, entonces si no viste los videos de la teorica de esa semana estas medio perdido.', 'abef11de-a3bb-4163-8252-8ee4ede4231a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'muy buena catedra, es tranquila la materia', '1b366824-f2e3-4b20-84a0-7bdc5cf06e0b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Si prestas atención en clase, ya aprobaste la materia, explican muy bien, y hacen muy llevaderas las clases', '1b366824-f2e3-4b20-84a0-7bdc5cf06e0b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Tete es un capo. Le verdad no me costo nada ir los viernes a la noche a cursar. Te tira chistes y no pierde tiempo con explicaciones que no son necesarias. Recommiendo este curso 100%. Din dudarlo, uno de los mejores profesores.', '1b366824-f2e3-4b20-84a0-7bdc5cf06e0b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Uno de los mejores profesores que tuve. El tipo entiende la materia y entiende como transmitirla, sin abrumarte ni  aburrirte y siempre sacándote todas las dudas que tengas. A la hora del parcial, no te toma nada que no hayas visto en clase, y para el final llegas bien preparado.', '1b366824-f2e3-4b20-84a0-7bdc5cf06e0b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Aprendio mucho del viejo y explica bien, te trata bien y siempre fomenta a que participen todos.  Te advierte todas las que te pueden pasar en una evaluación y los ejercicios que hace cubren bastante el panorama de los temas que dan. Junto con el viejo hacen una excelente cátedra.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Castro es crack, a veces se pone medio gede pero lo hace para mantener el orden y que no esten todos hablando. Sabe mucho y se nota, cualquier cosa que le preguntas te la responde claramente.', '1b366824-f2e3-4b20-84a0-7bdc5cf06e0b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Luis "Tete" Costa es de los mejores profesores de la facultad. Las clases son impecables resolviendo ejercicios importantes, sabe un montón y encima crea un grupo de wpp y contesta él todo junto a ayudantes/gente que cursó y le gustó el curso, que se quedaron y dan una mano. Encima nos invitó a su casamiento cuando terminó el cuatri.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Cristian es el profesor de la teórica. Conoce mucho los contenidos de la materia, pero se apoya en las teóricas virtuales que hay en el campus. Eso hace que tengas que cursar dos teóricas en una. Sin embargo, las clases de los viernes es un buen repaso si ya vista la teoría del campus.', '1b366824-f2e3-4b20-84a0-7bdc5cf06e0b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Tete sabe mucho de la materia, y conoce los temas que más se le dificultan a los alumnos, sabiendo eso, profundiza en esos temas para que no se repitan los mismos errores que otros cuatrimestres. Además responde permanentemente en el grupo del curso a las dudas que pueden llegar a aparecer. Un gran profesor de esta FIUBA.', '1b366824-f2e3-4b20-84a0-7bdc5cf06e0b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Esta en todas las clases pero solo hizo un ejercicio un dia. ', '15a9e0c4-1071-413f-a44f-442bdf3067e0');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Participo muy poco en las clases de los viernes. Las veces que lo hizo, fue bastante confuso seguirlo, pero se nota que conoce ampliamente la materia. En los parciales, era ameno con los alumnos y durante las clases respondia con gusto cualquier consulta', '77ee7d05-5254-4952-80d7-93c07453080c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Igual que pardi. Cobran plata y no laburan. No contestan dudas ni dan clases. Los ayudantes hacen LITERAL TODO. UNA VERGÜENZA TOTAL.', '5cf2b1b7-f1fe-4435-b647-69777f8f2eb1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'cátedra muy buena, el ayudante ariel, le mete mucha onda. bastante conforme. 8/10. Nos prepararon bien para el parcial, aprobó casi toda la clase', '4d338027-0202-4c1e-b682-e6be100bdd3c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy clara y da ejercicios que toman. Sube todos los videos lo cual es clave. Lo unico los parciales les busca una vuelta mas a lo que dio y a veces te podes quedar corto con lo visto en clase.', '4d338027-0202-4c1e-b682-e6be100bdd3c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buen docente. Explica muy claro y quiere que razonemos los ejercicios. Que no aprendamos las cosas de memoria. Uno de los mejores que tuve', '46052c45-83bf-4ed5-8e68-02cc2bdacc52');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Guarda con este curso. Silvosa comete muchos errores al punto de pasar mal fórmulas o directamente explicar mal algo, y eso si lográs seguirle la explicación.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Da la teórica, todas clases grabadas, está ok, supongo que hay mejores. Medio pelo', '830e4cfb-d796-4e3b-aef5-3d49274aa8e6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Sosa es buen profesor. Usa diapositvas, por lo tanto a las teoricas no hace falta ir porque lo sube al campus. ', '830e4cfb-d796-4e3b-aef5-3d49274aa8e6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Graba videos explicando las presentaciones de la materia que luego sube al campus. Son muy claras en general.', '830e4cfb-d796-4e3b-aef5-3d49274aa8e6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Sube las teoricas grabadas, no hace clases en vivo. Son claras pero se hacen muy largas, terminas tardando mucho mas de lo que seria una clase en vivo.', '830e4cfb-d796-4e3b-aef5-3d49274aa8e6');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Las teóricas que da presencial son iguales a los videos. Se podria no ir a las clases y ver unicamente los videos pero al principio toman asistencia. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'No desperdicia ni 2 minutos, pero te larga 1h antes o mas. En el primer parcial, si haces bien el de Empuje ya lo tenes casi adentro, aunque a veces los enunciados sean medio confusos. No transa mucho, es media ortiba pero cada tanto tiene sus buenos momentos. ', '3898b695-f96d-41e8-b17e-08f8193cf268');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Clase muy rapida y concisa. Buena profesora para la practica pero no hace muchos ejercicios en clase. Te larga 1 hora y media antes de lo que aparece en el siu.', '3898b695-f96d-41e8-b17e-08f8193cf268');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy recomendable para las practicas', '3898b695-f96d-41e8-b17e-08f8193cf268');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Muy buena profesora para la practica, optimiza muy bien el horario de clases, da tips de lo mas importante para cada ejercicio, en estw cuatri virtual sus resumenes de clase los compartía. Un poco estricta de caracter pero buena onda. Con Barra Rafael sus clases eran mas qje suficientes para preparar los parciales practicos. En algunos ejercicios del parcial existen algunos posibles metodos de resolver los problemas, Bacha empleaba metodos graficos con abacos, comparado con Asiatico sus metodos eran mas a calculos por Formulas, cuestion que una vez entendido los métodos graficos es muy interesante. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Clara y concisa. Te tira que estudiar con más detalles. Los parciales no son rebuscados, tampoco regalados. Responde los mails a la brevedad', '3898b695-f96d-41e8-b17e-08f8193cf268');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'va a los pedos asi que la clase termina minimo 1 hora antes de lo que pone en el siu, pero explica bien y me parecio copada. responde dudas sin problema y es super puntual', '3898b695-f96d-41e8-b17e-08f8193cf268');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2018', 'De las peores personas que vi en FIUBA. Maltrata a los alumnos constantemente y se ríe de ellos. ', '3898b695-f96d-41e8-b17e-08f8193cf268');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Teorica corta y facil. Terminaba como muy tarde 11am. Un solo parcial teórico y muy accesible. A diferencia de Calzaretto, Bacha no toma deducciones. El final es solo teorico y su fecha tambien es muy accesible. ', '3898b695-f96d-41e8-b17e-08f8193cf268');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Buen docente, siempre que puede te da una mano y responde las dudas que te quedes.', '63fa24b1-e8b8-4e4f-8d6c-cb52c39db21f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Recomendable  ', '63fa24b1-e8b8-4e4f-8d6c-cb52c39db21f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Con Bacha sus clases eran muy aceptables, cualquier ejercicio que le preguntes tiene la buena onda de responder y hacer que se entienda. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Durante la cursada virtual respondió todos las dudas de ejercicios por mails, por más boludas que sean. Explica claro y sin apuros', '63fa24b1-e8b8-4e4f-8d6c-cb52c39db21f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Buen profe, sus clases son claras y siempre te responde dudas en clase o por mail. sus parciales no son mega dificiles (muchas veces toma ejercicios ya hechos en libros asi que recomiendo buscar y practicar), y si ve que el alumnado viene flojo da mas tiempo en los examenes. Le da mucha bola a empuje y bombas. Lo recomiendo', '63fa24b1-e8b8-4e4f-8d6c-cb52c39db21f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Esta gaga pobre', '1a39f8be-257f-4a47-bfd9-0efc76fee818');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Gustavo se nota que sabe mucho aunque no participe demasiado en las clases. Corrigiendo es tranqui.', '1a39f8be-257f-4a47-bfd9-0efc76fee818');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'siempre estaba pero nunca participo mas que para corregir examenes ', '1a39f8be-257f-4a47-bfd9-0efc76fee818');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Sus clases son de las más aburridas que me tocaron cursar', 'ed7093e9-958c-4fb3-a978-ace66d86271d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Habla muy bajo. Sus clases son aburridisimas porque lee un power point con los ejercicio de la guia resuelto (el cual no pasa por mail). Ademas corrigiendo no perdona errores de calculo. Los parciales que toma te puede tocar el tema regaladismo o uno que es imposible de resolver', 'ed7093e9-958c-4fb3-a978-ace66d86271d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Un desastre, el tipo te pone ejercicios resueltos en un word que no lo pasan por lo que toca copiar y te los explica. Ni los hace en el pizarron explicando los pasos nada.', 'ed7093e9-958c-4fb3-a978-ace66d86271d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Explica bastante bien, se hace un poco aburrido pero aprendes.', 'ed7093e9-958c-4fb3-a978-ace66d86271d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Cursé fui a sus clases. Nadie va a las clases y todos recomendan "no ir a sus clases porque no hacen falta". Lo curioso es que si nadie va... Como saben que las clases son malas y no hacen falta? La clase zafa y el tipo te enseña todo. Después para el parcial y final ni tenés que estudiar. Tóma lo que dio en clase. Él mismo te dice que la "lista de preguntas" que andan por ahi para estudiar estan mal. Yo las leí y algunas estan erradas. Además para el final son 144 "preguntas" de ese listado. Es mil veces mejor ir con Calzareto a cursar, aprender y listo. No te estudias las preguntas. Pero bueno cada uno sabe que hace.. escuchar al que fue a todas las clases y recomienda ir.... O hacerle caso a los que nunca fueron clase y recomiendan no ir... Curioso.', 'e9911de0-7976-4cc5-9249-3ffacb67c82b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Gran docente. Avisa constantemente durante las clases cuales son los temas que van a entrar en los examenes (parcial y final) a medida que los va dando, y responde dudas las veces que sea necesario.', 'e9911de0-7976-4cc5-9249-3ffacb67c82b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Gran docente y mejor persona. ', '0eb75202-b2b2-44d9-a300-afd5bf999e5b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Un capo total, de lo mejor que me cruce en la facultad. Hace que te guste una materia como fluidos que de linda tiene poco. El tipo dio clase a toda costa, con covid, con su mujer con covid, con su hija con covid. Se le rompio el lapiz del iPad y al toque compro otro con sus ahorros para dar el mejor contenido posible. Atiende las dudas, super copado. Destaco muchisimo sus conocimientos y su nivel humano. Admirable profesor. Te saca bueno si o si', '0eb75202-b2b2-44d9-a300-afd5bf999e5b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Coronel es el mejor profesor que tuve en la FIUBA. Sus clases son con camara prendida y hace preguntas a los alumnos sobre el ejercicio que este dando, además sube todo lo que da en clase al campus y es muy claro al resolver los ejercicios. Recomiendo ir a su practica', '0eb75202-b2b2-44d9-a300-afd5bf999e5b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Coronel es un tipazo. Sus clases son muy interactivas, con cámara prendida y va haciendo preguntas para ver si seguis la clase. Esto es siempre con buena onda y si contestas mal dice que formulo mal la pregunta. Te da ejercicios muy acordes a lo que toma y te explica casos reales que estan buenos saberlos. Unacontra sería que no graba las clases, aunque sube todo el material que usa. Con los TPS es 0 exigente e incluso los resuelve en clase. Práctica muy recomendada.', '0eb75202-b2b2-44d9-a300-afd5bf999e5b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'un crack, se re preocupa por que los alumnos entiendan y los hace participar en clase. explica claro y tiene tambien resueltos varios ejercicios de las guias que explica en clase. no busca complicartela demas en los examenes, toma lo que da', '0eb75202-b2b2-44d9-a300-afd5bf999e5b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'toma lista al final de la clase pero parece que es solo para joder por que despues no lo tiene en cuenta, si no abandonas la materia y seguis en todos los recuperatorios te ayuda MUCHO como que aprobas o aprobas el tema esta en no dejarla, simulan que importan los tps y te hacen enviarlos pero nunca nadie te da una devolución ni se fijan que realmente los envies, igual mi experiencia general fue buena, tomo lo que dio en clase, aveces le pregunta a gente random en el aula al estilo señalar y hacerle una pregunta, pero si no sabes no pasa nada, puede parecer medio ortiva pero al final es un genio, sube todo al campus y si le preguntas te explica todo (nunca responde los mails)', '0eb75202-b2b2-44d9-a300-afd5bf999e5b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Un genio, super macanudo y sin duda se adapto muy bien a lo virtual. Este cuatri (2do 2020) adpoto la idea que los alumnos prendan las camaras y las clases resultaban super dinamicas y entretenidas. Las clases consisten en un repaso teorico e introduccion al tema practico, y despues explica ejercicios que ya tiene resueltos. Todo el material lo sube al campus. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'El mejor profesor que tuve en FIUBA. Es excelente como persona más allá de docente. Se nota que ama enseñar. Sus clases tienen repaso teórico y la parte práctica consiste en explicación de ejercicios resueltos de la guía. Además envía todo por mail, incluso ejercicios adicionales que ayudan a preparar los parciales. Hay que prender la cámara e interactúa mucho con los alumnos, pero la clase así se hizo más amena. Los parciales tienen un poco de dificultad mayor al resto pero con todo lo que explica, nada imposible. Incluso envía ejercicios de parciales resueltos. Responde siempre dudas, por mail, clase, incluso se queda después de clase si alguien tiene cualquier duda. Un tipazo. Lo super recomiendo.', '0eb75202-b2b2-44d9-a300-afd5bf999e5b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Pedazo de práctica. Coronel es lo más, hace muy llevadera la practica y todo parece fácil cuando el hace ejercicios en la clase. Fue una práctica muy dinámica con mucha participación de los alumnos lo que hizo una cursada muy amena. Aprobas la materia con dos parciales prácticos que fueron muy parecidos a lo visto en clase. Coronel siempre muy dispuesto a responder las dudas que sean necesarias. Pasan asistencia y si estas en una situación critica ven cuan presente estuviste asique recomiendo ir a las clases.', '0eb75202-b2b2-44d9-a300-afd5bf999e5b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Lasanta: es una vergüenza que en FIUBA se copien literal todo el examen sin asco. Nadie puede decir que estudió para esa materia. Desprestigia la facultad ver a todo el curso con celular copiandose TODO. Y Lasanta es consciente de lo que pasa.', '6da4b2a9-763c-4bd0-a3f7-42cbfa1df921');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Su criterio de correccion es una loteria. Fundamental no pifiar lineas de energia.', '6da4b2a9-763c-4bd0-a3f7-42cbfa1df921');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Clases teóricos no son recomendables, no son muy dinamicas.', '6da4b2a9-763c-4bd0-a3f7-42cbfa1df921');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Tito es... Tito. La virtualidad no es lo suyo. Las clases son más embole que un partido de burako. Sus parciales son muy desorganizados, sin siquiera conectarse a zoom. A veces queda gente sin corregir y hay que mandarle mail. Es un buen señor, muy desordenado', '6da4b2a9-763c-4bd0-a3f7-42cbfa1df921');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'No tiene un buen manejo de la tecnología y esto afecta a las clases virtuales.', '6da4b2a9-763c-4bd0-a3f7-42cbfa1df921');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'hizo casi toda la cursada virtual, no toma lista, el examen es bastante accesible si estudiaste un poco sale y toma lo que dio', '6da4b2a9-763c-4bd0-a3f7-42cbfa1df921');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2016', 'Clases teoricas no obligatorias, fui a las primeras dos. No aportan, pasa un power point con formulas y deducciones que no sirven', '6da4b2a9-763c-4bd0-a3f7-42cbfa1df921');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Son clases largas y aburridas, ademas que no responde el mail y es muy desordenado con el parcial. A pesar de eso, no es mal tipo y lo que explica si bien es un embole se entiende. Hay mejores alternativas, pero no es nada grave si te toca con el.', '6da4b2a9-763c-4bd0-a3f7-42cbfa1df921');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Tito está en otra galaxia. Desastre a nivel administrativo. No hay material para estudiar de sus teóricas, conviene grabar las teóricas y escucharlas después en velocidad 2.0. No responde nunca mails, este cuatri muchos no tuvieron su nota hasta el mismo día del recuperatorio. Igual si tenés suerte, pasás todo sin problemas administrativos (lo dudo!)', '6da4b2a9-763c-4bd0-a3f7-42cbfa1df921');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Paciencia, es un hombre mayor, se nota que sabe bien la materia.', '6da4b2a9-763c-4bd0-a3f7-42cbfa1df921');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'casi no participa en las clases nunca dio un tema completo capaz solo pequeñas cosas al final de alguna clase cuando coronel lo dejaba, parecia saber y si le haces consultas siempre tiene buena predisposición ', 'b4df5c74-ecf2-42f9-b667-62fa69b005cf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'ayudante copado, explicó muy pocas cosas durante la cursada pero bien. Es el mas exigente corrigiendo parciales', 'b4df5c74-ecf2-42f9-b667-62fa69b005cf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Malo explicando en el pizarron. Sumado que habla muy bajo. A la hora de responder consultas por momentos fue claro y por otros no. Cuando tomaron un parcial muy dificil (con conceptos que obvio nunca dijeron en la clase) muy mala predisposicion a la hora de hacerle una pregunta.', 'e64f4cd5-9fc2-4e5d-9484-0266f908a726');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Un capo, nos tiro ejercicios adicionales para los que queriamos seguir ejercitando, y termino tomando uno del estilo. No es mala onda corrigiendo.', 'e64f4cd5-9fc2-4e5d-9484-0266f908a726');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Correctora de TPs. No dicta clases ', 'da8dd79a-df75-4e7c-9bb0-dec299352c7b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'JTP, se quedó a cargo sola de la cátedra', 'da8dd79a-df75-4e7c-9bb0-dec299352c7b');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Cuando arrancaba la clase él ya estaba en el aula de la clase anterior, pero en vez de empezar se iba a tomar un café y volvía 20 minutos después, si lo agarraba alguien en el pasillo podía ser hasta media hora.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Desperdicia mucho el tiempo de las clases. Algunas clases pueden ser muy útiles, otras son paupérrimas.', '07836732-4741-4d6e-97c5-d85027dfb2b5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Sus teóricas de 2 horas se podrían dar en 45 minutos, o menos. A veces parece que hace tiempo  contándote anécdotas y boludeces que ni tienen que ver con la materia, hasta cumplir las 2hs, como si tuviera que fichar el pelado. Re detallista y un poquito facho, pero a la larga piola. Dentro de todo es piola y no trata de cagara a nadie.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Parece un hombre estricto pero es bastante claro explicando los contenidos de la materia y te deja el cuaderno hecho un libro cuando querés estudiar para el parcial o final. Los finales de el son accesibles pero es muy quisquilloso y hace mucho énfasis en que le escribas las cosas como quiere él (las dice en clase), aún así toma finales dentro de todo fáciles. ', '07836732-4741-4d6e-97c5-d85027dfb2b5');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Viene solo algunas clases, hace algún ejercicio rápido y mal, nos caga a pedos por no estudiar y se va.', '68344c39-4ada-4d3a-810a-72c32c6fdd04');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy buena dinámica en las clases y muy claras las explicaciones.', '68344c39-4ada-4d3a-810a-72c32c6fdd04');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Un fenómeno!', '68344c39-4ada-4d3a-810a-72c32c6fdd04');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Es buen tipo, pero a veces da por sabidas cosas de la teórica y pueden marear un poco.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'sube videos y los podés ver cuando querés. Son super tediosos y si los vez en x1.75 parece velocidad normal. bastante aburrido todo', 'bcf81035-684e-4fac-93ff-33dda8900ad8');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Obliga a presentar ejercicios en clase y te toma aleatoriamente para presentarlo enfrente de todos. A la hora de corregir parciales, es demasiado exigente. Si estás al limite, quedate tranquilo que desaprobás. Es super respetuoso, pero claramente se la re vive.', 'deb97806-18de-4206-a714-0323843d0869');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Hace la materia super llevadera. Realmente no es tan pesada como modelos I. Se toma un parcial y hay 3 trabajos practicos en grupo que no son muy dificiles de hacer.', '03d9f7f2-9b82-4abf-b550-da62b5651acd');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'basicamente las clases practicas se dedicaron a el tp de fabrica (hasta ahi y muy justas siendo extremadamente generoso), hizo unos parcialitos que nunca devolvió y realmente cero preparacion para los parciales, te la vas a tener que rebuscar solo/a.', '387d38ce-4830-459c-b15d-ffa120648aed');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un desastre. Si te toca como docente de practica la vas a pasar mal. No sabe que es lo que se enseña en la materia y casi que no te da ayuda en los parciales. Se supone que deberia dar clase practica pero esto nunca paso, como ucho nos dio parciales viejos y nos mando unas resoluciones que no se entendian nada y si le preguntas, se enoja. Se hace el boludo y te dice que le conviene hacer a clase online y te metes a un zoom a que critique tu tp y no ayude en nada. Y si le decis que queres clase presencial, va a ir enojado y si le pedis que haga un ejercicio o explique algo directamente se niega. S', '387d38ce-4830-459c-b15d-ffa120648aed');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Adrián da las clases por Zoom y después las sube a Youtube. Explica con claridad.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'es el que da las clases teórico/practicas, excelente, las clases muy buenas y organizadas.-', 'dac86318-88c1-4ec4-90ca-7c391ca2e622');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Consta de una teórica general dictada por Diehl, la cual es bastante clara y contesta las dudas. La materia me pareció organizada. Además hay videos extras subidos por Guida. Se graban las clases, y toman asistencia.', 'dac86318-88c1-4ec4-90ca-7c391ca2e622');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy bueno, muy respetuoso, siempre que buscamos ayuda nos respondio muy precisamente. Osea que ademas de mar todas las teoricas, si te toca un mal profesor de la practica podes preguntarle a Diehl y te deja todo clarisimo.', 'dac86318-88c1-4ec4-90ca-7c391ca2e622');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Las Teóricas de Guida las suben directamente grabadas a Youtube. No hay nada de feedback, pero tampoco es tan necesario. ', '058e42cd-a29a-4bff-87e7-74adf3f733e3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Da un par de clases presenciales que no entendes mucho y no son muy importantes. Sus videos del campus entran al final asi q eso s hay q verlo.', '058e42cd-a29a-4bff-87e7-74adf3f733e3');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Néstor Pagani es un profesor muy honesto y una buena persona. Te da su wpp y respondé consultas. Peero, al menos en este cuatri, fue muy notorio de que tenía otras prioridades y preparó muy pocas clases. Las clases que preparó fueron muy buenas, las que no, se notaba mucho.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Persona poco profesional.', '77728272-96e2-4022-b227-2f7b427df78c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es un noremberg a 1.5 pero sin el botón rojo.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'El boga, te explica bien, a veces se traba y le cuesta pero siempre encuentra la forma de hacerte entender.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Le gusta dar extensos monólogos frente a consultas simples, en donde pierde la paciencia y termina resultando agresivo lo que lo transforma en un pésimo profesor.', '60462300-dc05-446e-9a54-d60c818b3d57');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Sus clases consisten en ir y leer diapositivas, y cuando digo leer, es leer literal. Parrafos y parrafos de lo que dice la ley. Tiene muy mal trato con los alumnos, es muy agresivo. Lo vi renvetar a gritos a varios alumnos sin ningun motivo. Lamentablemente es el único curso que hay, y la materia es obligatoria, y por como es esta facultad esto no va a cambiar. Asi que tomenselo con calma y eviten hablarle para no pasar un mal momento. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Este tipo esta mal de la cabeza. Es agresivo y las clases son pesimas, va y lee una diapositiva. Si le preguntas algo, lo que sea, te responde mala forma. Un tipo que deberian echar lo antes posible, pero bueno, en FIUBA es imposible. Lamentablemente es el unico curso, pero es una basura.', '60462300-dc05-446e-9a54-d60c818b3d57');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es un inoperante.', '60462300-dc05-446e-9a54-d60c818b3d57');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Uno de los peores docentes en la facultad, lejos, en todo aspecto', '60462300-dc05-446e-9a54-d60c818b3d57');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Que tipo mas odioso, claramente solo quiere cobrar un sueldo y te toma lo que se le canta y como se le cante, la prioridad es que el tiene que terminar rápido para irse temprano HDP, hasta en clases aceleraba para ir a ver el partido! en el final se le ocurrió achicar el tiempo para los choice asi podia pasar a oral mas rápido e irse. repito HDP!
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'El docente más serio y rescatable de la materia. Responde rápido y detallado por mail lo cual es excelente. Tiene trato respetuoso con el alumno, lo que los demás docentes del curso pierden rápidamente.', 'cfb9f7e9-3a58-433b-9e90-5a4d90515f8d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Va cuando quiere. Cuando va, hace su horario. Sus clases son aburridisimas y no aportan nada. Sin embargo, tiene muy buen trato con los alumnos y no te corrige a matar.', 'cfb9f7e9-3a58-433b-9e90-5a4d90515f8d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Esta medio gaga pero es lo mejor de la materia. Va cuando se le canta, y cuando falta se nota que son excusas. Las clases son medio una cagada.', 'cfb9f7e9-3a58-433b-9e90-5a4d90515f8d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Es unico tipo que se empeña en dar clases, las prepara, te explica te hace entender, siempre de buen humor... GENIO', 'cfb9f7e9-3a58-433b-9e90-5a4d90515f8d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un desastre. Sus consignas de TP van completamente en contra de lo que plantea la cátedra y los enunciados. No da consignas claras no importa cuántas veces le preguntes y en la clase puede parecer que está todo bien hasta que le pinta mirar las actividades que mandaste y te dice que está todo mal. Nunca te va a dar la razón aún si le lees una definición dada por la cátedra. Alarga las clases innecesariamente y repite cosas que no tienen importancia. No tiene claros los conceptos de la materia.', '925bd20b-faaf-4b3f-afed-dabfd023ae0a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'En lo referente a la práctica Francisco es un muy buen profesor, siempre responde dudas por mail y fomenta la participación en clase. Es muy claro al explicar y receptivo a las críticas por el motivo que fuere.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Un pésimo profesor. Desgraciadamente él supervisaba el TP de Campo y a pesar de que De Góngora dijo que nuestro TP estaba "buenisimo", Spector apareció un día de la nada y dijo que el TP no estaba bien hecho. Cuando defendimos nuestro trabajo se enojó y nos tomo de punto para el resto del cuatrimestre. En la presentación oral fuimos el único grupo al que criticó, despreció todo nuestro trabajo y a pesar de haber terminado nuestra presentación, lo siguió haciendo aún cuando otros grupos exponían. (Si, muy infantil y poco profesional).
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Muy buen profesor, se nota que le gusta enseñar y sabe mucho!', '28f42bf0-d1dd-470a-b832-f08b324d0baf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Siempre tiene buena onda y predisposición. En lo referente a la toma de exámenes crea un ambiente relajado y se preocupa porque entregues a tiempo :')', 'f991bd05-0941-42a4-8989-11031f22fa91');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Sus clases están buenas y explica bien, son dentro de todo entretenidas porque va mechando comentarios sobre la economía en Argentina/el mundo, aunque a veces se extiende un poco con esto.', '69a6da5a-4244-42f4-b4a0-2ba207515c7a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Es medio hdp', '2abc651b-812e-426f-9a7a-64121cd7c2bf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'Muy dinámicas las clases, lastima que dio menos de la mitad de las clases.', '2abc651b-812e-426f-9a7a-64121cd7c2bf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es medio garca y a veces desaparece x 2 semanas sin avisar. Te conviene ver la teoria del Pindick y despues ir a la teorica si queres reforzar y si o si ir a la practica pq es muy buena y sirve si ya viste los temas', '2abc651b-812e-426f-9a7a-64121cd7c2bf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2019', 'Muy copadaas las pocas clases que dio ya que desaparece a la quinta clase aprox. Un terrible conchudo como persona garca como ninguno.', '2abc651b-812e-426f-9a7a-64121cd7c2bf');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Las teoricas no estan mal pero al no grabarlas quedan medio en la nada, basicamente la podes seguir unicamente con el pyndick.', '39fa21d4-f870-4c51-a33e-551cbe946532');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Da bien las clases, aunque no las graban y dan muy poco tiempo para copiar. De todas formas es buena profesora, lo que me sorprendió de este curso fueron los ayudantes... hay cada uno muy mala leche. Si tienen la posibilidad, no estén con Felipe.', '39fa21d4-f870-4c51-a33e-551cbe946532');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Buena profe, quizás algunas clases se volvían medio lentas por el tema que se daba en el día, pero le pone ganas y trata de que entiendas. Se tiene un TP que dura todo el cuatrimestre sobre el armado de una empresa y su puesta en marcha (junto con su presentación oral al final), y un parcial (choice con algunos ejercicios de costos/presupuesto, no es difícil). Con juntarse para hacer lo de la semana para el TP casi que estas. El final es un oral de 30~ minutos sobre un articulo/tema que da la profe. La materia la unieron con Organización de la Producción', 'c1c871c0-c0ad-45c7-95dd-d2cae13b4724');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Excelente profesora. Explica muy claro y siempre atenta. Toda consulta que se le hacia por mail ella contestaba.', 'c1c871c0-c0ad-45c7-95dd-d2cae13b4724');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'No cumple con los horarios que figuran en el siu, tarda mucho en responder preguntas y no cuenta con un foro para hacer alguna consulta. El campus esta desactualizado en comparacion a lo que dan en clase (campus: diapositivas de 2020 y grabaciones de cuatrimestres anteriores, en clase: diapositivas modificadas)', 'c1c871c0-c0ad-45c7-95dd-d2cae13b4724');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'El peor docente de la facultad. No solo le tiene desprecio al alumnado, sino que además no tiene ganas de ejercer su cargo demostrándolo cada vez que habla. Más de una vez ha sido impuntual, llegando al caso extremo de imputar su tardanza al tiempo total que había para un resolver parte de un final. En todas y cada una de las instancias de examen que presencie, el "docente" siempre nos propino una escena ninguneando y faltando el respeto a uno o varios alumnos. A la hora de evaluar a los alumnos pone una vara alta y desmedida como su ego, pero totalmente contraria a la forma que tiene de preparar y realizar sus clases. Las pocas veces que impartió la teórica (por suerte) lo hizo leyendo presentaciones con errores y realizadas a comienzo de siglo. Además de esto, cada tanto se quejaba de la "poca participación" que había, cosa bastante curiosa ya que al primer alumno que intentaba preguntar o responder algo de manera respetuosa, Noremberg no dudaba un segundo en responder con bronca y malicia.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Trata mal a los alumnos, durante sus clases se percibe un constate y total clima de violencia. Parece que hace lo posible para que no aprobemos', '6be5afcd-34a1-401a-b651-a5765519752f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Toda la humanidad que le faltan a los otros dos, la tiene Néstor. ', 'c7d6ed36-2e83-4c4e-a38e-a4b14f1ba384');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es un copado. Buena onda y sobre todo ser humano. No es muy organizado, de hecho siempre dice que no sabe ni lo que hay que dar en el día. Pero  la verdad prefiero mil veces eso que como te forrean noremberg y daccorso', 'c7d6ed36-2e83-4c4e-a38e-a4b14f1ba384');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Jamas nos dio la nota del tp final. Solo nos dijo "aprobaron" y nunca nos dijeron la nota con lo cual la nota final de cursada no sabes de donde sale. Bastante pesimista en el tp final y te tira abajo todas las ideas. Sin embargo es buena onda y trata de ponerle humor a las clases ', 'a02dfb07-ca9d-42f2-bb38-e06079b73579');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Da muy pocas clases, cuando explica le cuesta redondear la idea principal, es buena onda.', 'a02dfb07-ca9d-42f2-bb38-e06079b73579');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un capo. Buenas clases.', 'a02dfb07-ca9d-42f2-bb38-e06079b73579');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Maru es una genia, responde super rapido los mails y te explica todo perfecto en la teorica. ', 'cc42dc90-e41c-45f6-a0a8-90ff240798a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Muy buena profe, siempre responde y aclara todo, muy buen trato con los alumnos. Lejos la mejor del curso.', 'cc42dc90-e41c-45f6-a0a8-90ff240798a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es de las mejores profesoras que te podes encontrar en la carrera, explica super bien y tiene un muy buen trato con sus alumnos. si te toca como correctora aprovechala porque sabe un monton .', 'cc42dc90-e41c-45f6-a0a8-90ff240798a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es buena y explica bien.', 'cc42dc90-e41c-45f6-a0a8-90ff240798a9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Muy mala. Se burla de sus alumnos. ', 'ea46bcfa-87f8-4938-8c3d-c4156a4baa8f');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2017', 'Buen profesor. Enseña bien y te hace algo interesante la materia.', '43957103-27de-450f-bab1-05a40571e0c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2018', 'muuuuuuy aburrido', '43957103-27de-450f-bab1-05a40571e0c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un asco esta catedra, Romina,Pinchete, y Daniela tienen un trato asqueroso con los alumnos. Si preguntabas algo te contestaban sobrandote y se reian en tu cara. Eso a preguntas que iban desde la teoria hasta sobre como iba a ser un examen. Soberbios,un asco, a las preguntas teoricas te contestaban como si fuera obvio y hubieras trabajado en una empresa toda tu vida. La materia es una pelotudez pero las clases con ellos son un penal. Horrible el trato', '43957103-27de-450f-bab1-05a40571e0c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Mala onda maal. Todas las preguntas le parecen preguntas boludas y te lo hace saber.', '43957103-27de-450f-bab1-05a40571e0c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Luis es recomendable, sus clases son una vez por semana dos horas, toman asistencia, la cursada consiste en la elaboración desde cero de un producto en grupo.  ', '43957103-27de-450f-bab1-05a40571e0c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Aceptaba un poco mas q solana las criticas pero hasta ahi. Las clases duraban 20 min como mucho, te mandanban a ver las teoricas y en clase te decian "bueno es eso del video" y alguna cosita mas.... Una vez nos bardearon x wpp y como estaban presentando pantalla lo vimos todos :) Muy mala', '43957103-27de-450f-bab1-05a40571e0c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Muy malos tratos hacia los alumnos de parte de el y Solana. Eviten este curso. ', '43957103-27de-450f-bab1-05a40571e0c7');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Es buena onda y muy macanudo. Se nota que le gusta lo que hace y junto con Maru hacen muy didactica la clase. ', 'd028c93c-a137-407d-a4be-881b8b9619fe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Buen profesor, se nota que le gusta la materia. Siempre da ejemplos de los temas vistos. Aunque impone miedo en las presentaciones de los trabajos practicos, ya que si no justificas algo que decis o te pregunta algo y no le sabes responder, se queda medio enojado. Mas alla de eso, buen trato con los alumnos y siempre responde cualquier duda', 'd028c93c-a137-407d-a4be-881b8b9619fe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es super copado, te tira la posta en todo. hace muy buenos aportes a las clases. A la hora de dar los trabajos grupales es bueno que hablen todos sino va a hacer preguntas dificiles a quien no habla y si no contesta como que se enoja.', 'd028c93c-a137-407d-a4be-881b8b9619fe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'A veces es un maldito. Otras veces es la mejor persona del mundo. Se nota que sabe mucho.', 'd028c93c-a137-407d-a4be-881b8b9619fe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2014', 'Profesor ideal. Qué valioso es tener a alguien como Rickert en esta materia, cumple el objetivo de abrirte la cabeza a lo que es el mundo de ingeniería industrial.', 'd028c93c-a137-407d-a4be-881b8b9619fe');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es una de las ayudantes, se nota que sabe una banda y cuando esta te tira los tips para los parciales y los finales. Lo malo es que como sigue estudiando, a veces no viene a las clases o se va antes, asi que si te toca ella como la que te guia en el tp, seguro tarde en contestar.', 'adf372cf-d3cc-42e1-a742-43ab60d280da');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es ayudante y aporta muy buenos comentarios a las clases. si daria alguna clase lo haria genial porque sabe manejar muy bien al alumnado.', 'adf372cf-d3cc-42e1-a742-43ab60d280da');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es una ayudantaza. A veces pone mano dura, pero siempre esta atenta al mail/telefono y atiende todas tus dudas.', 'adf372cf-d3cc-42e1-a742-43ab60d280da');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Un asco esta catedra, Romina,Pinchete, y Daniela tienen un trato asqueroso con los alumnos. Si preguntabas algo te contestaban sobrandote y se reian en tu cara. Eso a preguntas que iban desde la teoria hasta sobre como iba a ser un examen. Soberbios,un asco, a las preguntas teoricas te contestaban como si fuera obvio y hubieras trabajado en una empresa toda tu vida. La materia es una pelotudez pero las clases con ellos son un penal. Horrible el trato', 'e66b3737-b066-47db-a8f4-2acc364a395c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Esta mujer hace bulling!!!', 'e66b3737-b066-47db-a8f4-2acc364a395c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Lo que mas molestaba era que uno proponia ideas con el grupo, pero siempre te la tiraban abajo. Nunca te ayudaban a entender como se podia mejorar.', 'e66b3737-b066-47db-a8f4-2acc364a395c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Pésima docente, tiende a sobrar a sus alumnos. Malísimo el trato.', 'e66b3737-b066-47db-a8f4-2acc364a395c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Sus clases son ok. Las teóricas grabadas son 90% leer el ppt textual y 10% tirar algún dato útil para el examen. Las teóricas de consulta a veces pasa los videos que están en el campus, a veces explica algo nuevo o lleva piezas para que veamos. Se puede hacer consultas pero nadie suele hacer. No es para nada necesario para aprobar pero tampoco es tan molesto.', 'f1efeaca-90f6-4dd5-b600-a60fb4313b47');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Este cuatri el curso fue casi en su totalidad virtual, con excepcion de: la 1er clase, las fechas de parcial/recuperatorios y la fecha de defensa del tp.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Un genio manu, uno de los mejores profesores que tuve hasta ahora. El da la practica, siempre con la mejor onda y tratando de hacer que las clases sean divertidas. Hay muchos momentos en los que el chat de meet explota de risa. Los ejercicios siempre son con tematica, lo que los hace mas dinamicos y no tan aburridos. Explican C desde 0 asi que si no sabes programar es una buena opcion esta catedra', 'e54be964-02ee-444c-baf2-a4f99260048e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'A cargo de la practicas, son fundamental sus clases, depejan todas las dudas. Los ejercicios que hace los podes encontrar en el sitio para practicarlos por tu cuenta.', 'e54be964-02ee-444c-baf2-a4f99260048e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Bastante genio Guido, pero a veces cuando explica él, se quedan bastantes cortas las clases. Sentis que te falta algo para entender el tema.', '3c5c7579-d9fb-408a-a539-e1bd2abaad3d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'No se lo suele ver muy seguido, pero cuando aparece, la rompe con sus comentarios y/o dando la teórica', '3c5c7579-d9fb-408a-a539-e1bd2abaad3d');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'El curso de costa está bueno para las personas que tienen una base de programación. Yo nunca había programado y tuve que ver un par de videos por mi cuenta para poder seguirle el ritmo a la materia, no es difícil pero si cursas muchas materias quizá se hace algo tedioso para quien es la primera vez que se mete a programar. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2021', 'Bastante mala onda. Aparece cada tanto, pero algunas veces, cuando le queres preguntar algo, te responde medio mal. Cuando los alumnos piden ayudar con algo, hace vista al costado, diciendo "Eso lo tenes que ver vos"', '3e049448-4e16-4eac-8eb6-81477abb7e9e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Al igual que Guido, no aparece muy seguido, pero sus teóricas se entienden muy bien.', '3e049448-4e16-4eac-8eb6-81477abb7e9e');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Las clases de bruno son medio pesadas, hay momentos donde quizá como el grupo está avanzado, explica más técnico pero no tiene problema en frenar la clase y explicarte lo que no se entiende. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Un genio Tomi, siempre presente y disponible para aclarar dudas, quedandose despues de clase y haciendo clases de consulta con los ayudantes. Sus explicaciones son super claras y transmite muchas ganas de aprender.', 'e41c1ef1-8c2f-45eb-b726-aa668b73f758');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'La cursada fue mixta, las teoricas son mas que nada presenciales, muy pocas fueron virtuales. Se puede promocionar, para eso hay que preparar una clase de 20-30 min sobre un tema que elijas(hay una lista de temas que propone el) y ademas aprobar casi todos los parcialitos que son multiple choice que da todas las clases sobre las lecturas obligatorias(son bastante tranquis la verdad) y aprobar el TP. Por esto es que la mayoria de las clases las dan los alumnos, Fontela dio muy pocas.', 'f79bf1fe-cfd1-4bac-91cf-2310a691eb25');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2022', 'Las clases practicas suelen explicar metodologias que probabemente tengas que aplicar para el TP, hubieron varias virtuales. A partir de la mitad del cuatri la mitad de la practica explican algo y la otra mitad es seguimiento con tu tutor de TP. El TP se arranca desde las primeras semanas y se entrega al final del cuatri. No hay que colgarlo porque se hace pesado, suele ser hacer un front y back de alguna app que exista hoy en dia. La clave esa en organizarse muy bien desde el primer dia y tener un grupo que labure. Ademas de eso no tiene mucha complejidad en si el TP.', 'd258d166-662e-48f4-b820-a8f9ef44b0f1');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'La práctica es OBLIGATORIA, te hace hacer ejercicios en clase y despues elige al azar a alguien para hacerlos. Esto te ayuda más que te perjudica, las clases dejan de ser aburridas, te hacen estar al dia y te sirve para el TP. Con estos ejercicios aprobas la cursada, pero tranqui, que nunca desaprueba a nadie, mientras que los hagas. ', '7adbc3c0-4807-4e32-b0a2-7c37fcadb88a');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'La materia es relativamente facil y lo que se aprende esta bueno. Basicamente es programacion funcional. Este cuatrimestre hubo dos parciales y el final fue agregar algo a un interprete de tlc-lisp que se habia dado como TP integrado (se hace en clojure)', '0f5e5915-447e-414c-b902-640bfb0ca880');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'El docente muy predispuesto con la materia. Muy buenos apuntes. El trabajo práctico está muy copado, te dan todas las herramientas para hacerlo sin problema y más por si querés profundizar.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Siguiendo la cursada teórica y haciendo los ejercicios prácticos se aprueba. Para la practica hay que entregar ejercicios de cada uno de los temas de forma obligatoria, llevan un poco de tiempo si uno no conoce los temas y luego se corrigen en grupo. Luego el TP es en Clojure, es un poco heavy porque no alcanza con la teórica de ese tema, se necesita profundizar uno mismo sobre el lenguaje. Los docentes contestan todas las dudas por correo con bastante velocidad.', '0f5e5915-447e-414c-b902-640bfb0ca880');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Las clases están bien organizadas. Toma asistencia. Las clases teóricas quedan grabadas para poder verlas nuevamente en caso de ser necesario.', '0f5e5915-447e-414c-b902-640bfb0ca880');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'Docente muy capacitado, materia que escucharla no cuesta (tanto) y son temas muy interesantes. Solo toma 1 TP en todo el cuatri, sin parciales ni nada más. El TP es muy interesante y te da 1 mes para hacerlo, en una semana lo metes. Muy recomendable', '0f5e5915-447e-414c-b902-640bfb0ca880');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Es el profe encargado de la teorica. Es medio plomo y (por lo menos con el curso de marensi) repite lo mismo que en la practica. No vale mucho la pena ir a sus clases, aunque si vas te dice claro que toma y te prepara bien para el final. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Suele responder los mails y ATENCIÓN: Lo conocés recién al dar el final (a carpeta abierta, 1 hora, multiple choice, restan) pero:
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2020', 'Nunca conocimos ni a D'elia ni a Battan asi que no puedo decir muchos sobre ellos. Califico a Battan con la opinion de la cátedra en general.  Las clases son ppts que se van subiendo y 10 tps individuales que se entregan a lo largo del cuatrimestre. No hay devolución sobre los mismos. Idem para el parcial (10 preguntas choice, todos aprobamos, sin nota). Cátedra muy recomendada.', 'e03474a3-a5a2-4e5a-88f5-8df265b8f8d9');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'En el curso con marensi da pocas clases, ademas que marensi medio lo pisa cuando habla, lo cual me daba pena porque es re macanudo y siempre tira algun bocado mas de info que puede ser interesante. 
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Un capo, hace la materia super entretenida porque no se detiene en las cosas finitas, sino que intenta darte un panorama general cosa que lo puedas aplicar en tu dia a dia. Cursar con el fue mas como ir a una charla donde vas y te sentas tranca a escuchar al profe, te entretenes un cacho, aprendes un par de cosas interesantes y no volves a tocar la materia hasta la semana siguiente.
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2020', 'Vale la pena cursar la materia en modo virtual.', '4574909a-8edb-4cd2-a75a-8c28e1f7ad0c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Las clases pueden ser virtuales o presenciales segun el tema, te explica unas diapos por arriba, no son dificiles pero si medias aburridas(no por la clase en si, si no por los temas). Tenes que hacer 3 o 4 tps a lo largo de la materia en grupo, no son dificiles y por lo general te pone buenas notas, nunca vi que desaprobara ni un tp. El final tambien es tranqui.', '4574909a-8edb-4cd2-a75a-8c28e1f7ad0c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2017', 'Una grande Bianucci, te explica todo, te toma lo que te da, y no jode con nada. Impecable. Lo que si para el final estudie bien extintores', '4574909a-8edb-4cd2-a75a-8c28e1f7ad0c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'es un amor esta profe, toma lo que da, explica con claridad. No te tira al muere, es excelente.', '4574909a-8edb-4cd2-a75a-8c28e1f7ad0c');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('1Q2022', 'Genia 100%, super tranquila y relajada. Le interesa que te lleves algo y te quede una buena nota. Sus clases son todo lo que necesitas para aprobar, y sube algunos cuestionarios y tps para levantar nota.', 'e78d1148-167a-4d3d-82dc-7e1e18472913');
INSERT INTO comentarios (cuatrimestre, contenido, codigo_docente) VALUES ('2Q2021', 'El curso esta bueno pero demasiado exigente, en el final te destruyen. Les recomiendo cursar en otro si quieren aprobar el final.', '5765a92e-9ab1-4f75-8075-9bdf3cd34d33');